INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(11, 'United States of America', 'La Guerre des étoiles', 'Il y a bien longtemps, dans une galaxie très lointaine... La guerre civile fait rage entre l\'Empire galactique et l\'Alliance rebelle. Capturée par les troupes de choc de l\'Empereur menées par le sombre et impitoyable Dark Vador, la princesse Leia Organa dissimule les plans de l’Étoile Noire, une station spatiale invulnérable, à son droïde R2-D2 avec pour mission de les remettre au Jedi Obi-Wan Kenobi. Accompagné de son fidèle compagnon, le droïde de protocole C-3PO, R2-D2 s\'échoue sur la planète Tatooine et termine sa quête chez le jeune Luke Skywalker. Rêvant de devenir pilote mais confiné aux travaux de la ferme, ce dernier se lance à la recherche de ce mystérieux Obi-Wan Kenobi, devenu ermite au cœur des montagnes désertiques de Tatooine...', 'Lucasfilm', 'https://image.tmdb.org/t/p/w1280/qelTNHrBSYjPvwdzsDBPVsqnNzc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aDYSnJAK0BTVeE8osOy22Kz3SXY.jpg', 'https://www.youtube.com/embed/XsS1yE2f-hE', 121, '2023-05-20', 4.1, 1),
(12, 'United States of America', 'Le Monde de Nemo', 'Nemo, un jeune poisson-clown intrépide est capturé puis plongé dans l\'aquarium d\'un cabinet dentaire. Marin, son père, et Dory, un poisson-chirurgien bleu sympathique mais tête-en-l\'air, entament un long périple pour le retrouver. Ils croiseront en chemin une éclectique faune tropicale plus ou moins bien intentionnée. Sauront-ils retrouver la piste de Nemo ?', 'Pixar', 'https://image.tmdb.org/t/p/w1280/8zR2vXoXfdlknEYjfHvCbb1rJbI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yzqaKAhglTrkeOfuIXYYArf0WnA.jpg', 'https://www.youtube.com/embed/TKi8VJmBuLs', 101, '2003', 3.91, 1),
(13, 'United States of America', 'Forrest Gump', 'Durant trois décennies particulièrement agitées, Forrest Gump vit une série d\'aventures le propulsant de l\'état de handicapé physique à celui de star du football, de héros du Vietnam au roi de la crevette, des honneurs de la Maison Blanche au bonheur d\'une grande histoire d\'amour. Forrest est le symbole d\'une époque, un candide dans une Amérique qui a perdu son innocence. Son cœur dépasse les limites de son QI…', 'Paramount', 'https://image.tmdb.org/t/p/w1280/A0Th0x8QIzP0njrFAJnYQ5ouIoB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3h1JZGDhZ8nzxdgvkxha0qBqi05.jpg', 'https://www.youtube.com/embed/HzxX_TDldcQ', 120, '1994', 4.24, 1),
(14, 'United States of America', 'American Beauty', 'Alors qu\'il éprouve des difficultés à supporter une femme irascible, un travail ingrat et une ado morose, un homme tombe raide dingue d\'une des amies de sa fille.', 'Jinks/Cohen Company', 'https://image.tmdb.org/t/p/w1280/jLkxPf0IPJZ3EBVG27oUTZfYavL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//DztBnZaqmla2sGUW9s8AyOmskT.jpg', 'https://www.youtube.com/embed/IJM3cZlqwlA', 122, '1999', 4.02, 1),
(15, 'United States of America', 'Citizen Kane', 'À la mort du milliardaire Charles Foster Kane, un grand magnat de la presse, Thompson, un reporter, enquête sur sa vie. Les contacts qu\'il prend avec ses proches lui font découvrir un personnage gigantesque, mégalomane, égoïste et solitaire.', 'Mercury Productions', 'https://image.tmdb.org/t/p/w1280/89GnRTK1CjJSUelKKHLIPXsVam9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ruF3Lmd4A8MHbnEBE6lxPMbsHGL.jpg', 'https://www.youtube.com/embed/', 119, '1941', 4.01, 1),
(16, 'Argentina', 'Dancer in the Dark', 'Selma Jezkova, émigrée tchèque et mère célibataire, travaille dans une usine de l\'Amérique profonde. Elle trouve son salut dans sa passion pour la musique, spécialement les chansons et les danses des grandes comédies musicales hollywoodiennes. Selma garde un lourd secret : elle perd la vue et son fils Gene connaîtra le même sort sauf si elle réussit à mettre assez d\'argent de côté pour lui payer une opération. Quand un voisin aux abois accuse à tort Selma d\'avoir volé ses économies, le drame de sa vie s\'intensifie pour se terminer en final tragique.', 'Lantia Cinema & Audiovisivi', 'https://image.tmdb.org/t/p/w1280/sBh45R8jwJRiN72tnjV49Amhu09.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ikR2qy9xJCHX7M8i5rcvuNfdYXs.jpg', 'https://www.youtube.com/embed/fJfdGuCca2k', 134, '2000', 3.94, 1),
(17, 'Germany', 'The Dark', 'En débarquant dans cette contrée isolée du pays de Galles, Adelle espérait d\'abord reconquérir son mari, James, pour le plus grand bonheur de leur fille, Sarah. Mais loin des retrouvailles idéales qu\'elle avait rêvées, Adelle va vivre le pire des cauchemars : sa fille se noie.  Brisée, elle découvre que Sarah n\'est peut-être pas morte, mais retenue dans une dimension parallèle liée à une ancestrale légende païenne. Seule face au terrifiant secret qui hante la région, Adelle va devoir affronter l\'impossible pour tenter de sauver sa fille.  Qui est donc Ebrill, la mystérieuse enfant surgie de nulle part qui ressemble tant à Sarah ? Comment vaincre l\'épouvantable malédiction qui trouve sa source près des falaises ? Et plus que tout, comment échapper à un monde où vos pires terreurs prennent vie ? Adelle trouvera les réponses, mais il lui faudra payer le prix...', 'Constantin Film', 'https://image.tmdb.org/t/p/w1280/ebzumprgCpfFUZOTJNZ407FA9IH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dhr0q4eiRr8ltqPig32TwhPRdaD.jpg', 'https://www.youtube.com/embed/', 87, '2005', 2.92, 1),
(18, 'France', 'Le Cinquième Élément', 'New York, XXIIIème siècle. Une boule de feu fonce sur la Terre. Pour l\'arrêter il faut retrouver le Cinquième Élément, l\'être suprême, qui associé aux quatre éléments vitaux - l\'air, l\'eau, le feu et la terre - peut seul repousser Le Mal. Cornélius reçoit l\'aide de Korben, taxi et ancien agent secret, et de Leeloo, extraterrestre qui a pris la forme d\'une jeune femme aux cheveux oranges.', 'Gaumont', 'https://image.tmdb.org/t/p/w1280/8nx8sttha1Zidt73SbNncVfSwqk.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dwN0kPGrLbFRxyL3F3J3t4ShQx.jpg', 'https://www.youtube.com/embed/7rzmiE-pESk', 126, '1997', 3.76, 1),
(19, 'Germany', 'Metropolis', 'En 2026, une métropole à l’architecture fantastique vit sous le joug d’un groupe de tyrans. Les aristocrates se prélassent et se divertissent dans de somptueuses demeures et de luxuriants jardins, tandis que la grande masse de la population travaille, dort et survit durement dans les profondeurs de la terre. Le fils du maître de la ville découvre avec effarement l’existence du monde souterrain, où se rencontrent en secret les ouvriers, peu enclins à supporter pour toujours leur situation. Pendant ce temps, un savant invente une femme‐robot qui doit détourner les opprimés de leur révolte…', 'UFA', 'https://image.tmdb.org/t/p/w1280/vHDWZOpupmKB7iNuiWFqnUSjfmN.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//eeMoFKxjjiCi6iep2GEZtSAMYIr.jpg', 'https://www.youtube.com/embed/FFUGtw7uzB4', 150, '1927', 4.08, 1),
(20, 'Canada', 'Ma vie sans moi', 'Anne a 23 ans, deux petites filles, un mari au chômage et un boulot sans intérêt. Un bilan de santé va changer radicalement cette morne existence. Elle dresse la liste de ses priorités, de ses envies, de ses rêves. Maintenant, elle va prendre sa vie en main...', 'El Deseo', 'https://image.tmdb.org/t/p/w1280/sFSkn5rrQqXJkRNa2rMWqzmEuhR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kZyurQjTMLHalUxs7sHgH5XeiwO.jpg', 'https://www.youtube.com/embed/', 106, '2003', 2.94, 1),
(21, 'United States of America', 'The Endless Summer', 'Robert August et Mike Hynson, deux jeunes surfeurs californiens, vont entreprendre un voyage bien particulier. Munis de leur planche de surf, ils vont se rendre en Afrique, en Australie, en Nouvelle-Zélande, à Tahiti puis Hawaï, à la recherche de la vague parfaite…', 'Bruce Brown Films', 'https://image.tmdb.org/t/p/w1280/gtJ7zIbiXXyRgB6tZ5NmbHwAPkU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uNRfK14Ga8Hwfqt07vo8nvWQN1i.jpg', 'https://www.youtube.com/embed/LHgHe4rxhvU', 95, '1966', 3.68, 1),
(22, 'United States of America', 'Pirates des Caraïbes : La Malédiction du Black Pearl', 'Petite, Elizabeth Swann, la fille du gouverneur, a sauvé de la noyade Will Turner après le naufrage de son bateau. Les années ont passé, Will et Elizabeth ont grandi. Will est devenu forgeron à Port Royal, et Elizabeth se prépare à épouser le commodore Norrington. Cependant, la vie d\'Elizabeth bascule lorsque le capitaine Barbossa et sa bande de pirates décident d\'attaquer Port Royal et la prennent en otage. Malheureusement pour lui, Barbossa a commis deux erreurs.', 'Walt Disney Pictures', 'https://image.tmdb.org/t/p/w1280/jFmc6zbnx6mSoxejECYvdi3IHIs.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uRNgkJSkNBFbbn9fPsEjDIy8Sh3.jpg', 'https://www.youtube.com/embed/IrnQj5p9ieo', 140, '2003', 3.89, 1),
(24, 'United States of America', 'Kill Bill: Volume 1', 'Au cours d\'un mariage, un commando armé massacre l\'assistance, laissant pour morte la Mariée et l\'enfant qu\'elle porte. Après 4 ans de coma, la Mariée se lance à la poursuite des assassins, membres du clan de Bill, au sein duquel, sous le pseudonyme de Black Mamba, elle exerça elle-même autrefois ses talents de redoutable tueuse...', 'Miramax', 'https://image.tmdb.org/t/p/w1280/hM2fUVWViGIJT0Twz2BTXOBEYLM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lVy5Zqcty2NfemqKYbVJfdg44rK.jpg', 'https://www.youtube.com/embed/8trTO5mJYsg', 110, '2003', 4, 1),
(25, 'United Kingdom', 'Jarhead : La Fin de l\'innocence', 'Été 1990. Anthony Swofford, fils et petit‐fils de militaires, vient tout juste de fêter son vingtième anniversaire lorsqu’il est envoyé dans le désert saoudien. La Guerre du Golfe vient d’éclater, son bataillon de Marines est parmi les premiers à se déployer dans cette aride et immense étendue de sable. Pour ces jeunes déracinés, gavés d’images et de phraséologie guerrières, ivres de rock et de bière, commence alors la longue et dérisoire attente d’un ennemi fantôme. La soif, la peur, l’épuisement, l’ennui, les frustrations lancinantes, les tensions extrêmes s’additionnent dans un climat de plus en plus délétère et explosif. Dans cet enfer naîtront pourtant de surprenantes et inaltérables amitiés entre compagnons d’armes liés par le vieux serment des Marines.', 'Red Wagon Entertainment', 'https://image.tmdb.org/t/p/w1280/xiL3lwMWODEiCBDJ9F0jVf5kSE9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bQ8fRUaitJvi54O2lUT6Ta7FVHK.jpg', 'https://www.youtube.com/embed/s0yQySbdSL8', 123, '2005', 3.3, 1),
(26, 'Israel', 'Tu marcheras sur l\'eau', 'Eyal est un agent du Mossad. Sa mission est de retrouver la trace d\'un ancien officier nazi, Alfred Himmelman. Pour mener son enquête, il va servir de guide touristique au petit-fils d\'Himmelman, Axel, venu en Israël rendre visite à sa soeur. Celle-ci vit en effet dans un kibboutz depuis qu\'elle s\'est brouillée avec sa famille. Axel veut essayer de la convaincre de revenir avec lui en Allemagne pour l\'anniversaire de leur père. Malgré leurs personnalités contrastées, Eyal sympathise avec Axel. Même si parfois le machisme et le conservatisme d\'Eyal se heurtent aux vues libérales d\'Axel, en particulier quand ce dernier lui révèle qu\'il est homosexuel. S\'installent alors des relations tendues entre les deux hommes. Alors qu\'Axel rentre en Allemagne sans sa soeur, le Mossad suspecte l\'ex-nazi Himmelman de vouloir refaire surface pour la fête d\'anniversaire du père d\'Axel...', 'Lama Films', 'https://image.tmdb.org/t/p/w1280/sXgxTzSElgKP7RCdMWesENlNYum.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//z5YFbE9VVHwDXbXbqZdoO6THqPs.jpg', 'https://www.youtube.com/embed/', 103, '2004', 3.46, 1),
(27, 'United Kingdom', '9 Songs', 'A Londres, durant l\'automne 2003.Lisa, une étudiante américaine, rencontre l\'anglais Matt lors d\'un concert de Black Rebel Motorcycle Club à la Brixton Academy. C\'est le coup de foudre immédiat, le point de départ d\'une histoire d\'amour sensuelle, charnelle. Une histoire passionnée qui durera un an, se concluera pourtant par une rupture sans appel.', 'Revolution Films', 'https://image.tmdb.org/t/p/w1280/91O7z0vo7MiNWd5xD2BoivwbQsb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qU7tNIMpRqkizIObXfkJY3haTqh.jpg', 'https://www.youtube.com/embed/mTiYaF4G5IE', 69, '2004', 2.86, 1),
(28, 'United States of America', 'Apocalypse Now', 'Cloîtré dans une chambre d\'hôtel de Saïgon, le jeune capitaine Willard, mal rasé et imbibé d\'alcool, est sorti de sa prostration par une convocation de l\'état-major américain. Le général Corman lui confie une mission qui doit rester secrète : éliminer le colonel Kurtz, un militaire aux méthodes quelque peu expéditives et qui sévit au-delà de la frontière cambodgienne.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/scaiAT7I2KZ2GAeMvoU6Ro1515J.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9Qs9oyn4iE8QtQjGZ0Hp2WyYNXT.jpg', 'https://www.youtube.com/embed/jlg-RwbJuHw', 181, '1979', 4.14, 1),
(33, 'United States of America', 'Impitoyable', 'Après avoir été un impitoyable tueur, toujours entre deux verres, Bill Munny a raccroché ses colts pour l’amour d’une femme aujourd’hui disparue. Il élève péniblement des cochons dans un enclos boueux, avec pour seuls compagnons ses deux jeunes enfants. Bill reçoit un jour la visite de Schofield Kid, un apprenti desperado qui veut devenir le partenaire de cette légende vivante. Le Kid lui propose de partager les mille dollars offerts par des prostituées de Big Whiskey, une bourgade lointaine, pour l’élimination des deux cow‐boys qui ont défiguré l’une d’entre elles. Munny finit par accepter la proposition et rend visite à son vieux complice, Ned Logan…', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/3O3whKDJYa8zKXHmlwJnLXReGI1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rvRGFevvZK48onX0PYI1eQLbuJd.jpg', 'https://www.youtube.com/embed/-7ud7PNdQkM', 130, '1992', 3.96, 1),
(35, 'United States of America', 'Les Simpson, le film', 'Lorsque Homer pollue gravement le lac de Springfield, une agence de protection de l’environnement décide de mettre la ville en quarantaine en l’isolant sous un énorme dôme.', 'Gracie Films', 'https://image.tmdb.org/t/p/w1280/8RAHFsRCE4Jwa1jD00tWFCvrsIa.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yajM2akz8QKOx0RdvN6OYaxe3GN.jpg', 'https://www.youtube.com/embed/8arbBxezySc', 88, '2007', 3.5, 1),
(38, 'United States of America', 'Eternal Sunshine of the Spotless Mind', 'Joël et Clémentine ne voient plus que les mauvais côtés de leur tumultueuse histoire d’amour, au point que celle‐ci fait effacer de sa mémoire toute trace de cette relation. Effondré, Joël contacte l’inventeur du procédé Lacuna, le Dr. Mierzwiak, pour qu’il extirpe également de sa mémoire tout ce qui le rattachait à Clémentine. Deux techniciens, Stan et Patrick, s’installent à son domicile et se mettent à l’œuvre, en présence de la secrétaire, Mary. Les souvenirs commencent à défiler dans la tête de Joël, des plus récents aux plus anciens, et s’envolent un à un, à jamais. Mais en remontant le fil du temps, Joël redécouvre ce qu’il aimait depuis toujours en Clémentine – l’inaltérable magie d’un amour dont rien au monde ne devrait le priver. Luttant de toutes ses forces pour préserver ce trésor, il engage alors une bataille de la dernière chance contre Lacuna…', 'Focus Features', 'https://image.tmdb.org/t/p/w1280/5MwkWH9tYHv3mV9OdYTMR5qreIz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8AE7M2lMsyvowfT36porzGtmOtI.jpg', 'https://www.youtube.com/embed/Z3oSxyslN2k', 108, '2004', 4.05, 1),
(55, 'Mexico', 'Amours chiennes', 'Mexico. Un tragique accident de voiture mêle les extrêmes de la vie, sous l\'angle de trois histoires radicalement différentes : Octavio, un adolescent qui a décidé de s\'enfuir avec la femme de son frère; Daniel, un quadragénaire qui quitte sa femme et ses enfants pour aller vivre avec un top model; El Chivo, un ex-guérillero communiste devenu tueur à gages, qui n\'attend plus rien de la vie.', 'Altavista Films', 'https://image.tmdb.org/t/p/w1280/2RyxsKW0nOJKzkPly3DUczzPKNv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3YzVtvNERQOIJXnrcWv3xhj5EMT.jpg', 'https://www.youtube.com/embed/', 154, '2000', 3.81, 1),
(58, 'United States of America', 'Pirates des Caraïbes : Le Secret du coffre maudit', 'Le pirate Jack Sparrow est confronté à son passé. Treize ans auparavant, il signait un pacte avec Davey Jones, le maléfique maître des sept mers. En échange de son âme, ce dernier lui promettait le commandement du mythique Black Pearl… Aujourd’hui, Jones vient donc récupérer sa dette.', 'Walt Disney Pictures', 'https://image.tmdb.org/t/p/w1280/bzOlMYEfNmgCDnFHj3zL3RBqwau.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//14F9FtM2DOPex5zrZkauJwWobtl.jpg', 'https://www.youtube.com/embed/fKBH7kup-jo', 150, '2006', 3.67, 1),
(59, 'Canada', 'A History of Violence', 'Père de famille dans une petite ville tranquille, Tom Stall est un jour contraint de tuer deux malfrats qui menaçaient la vie des employés et des clients de son restaurant. Proclamé héros par la presse locale, Tom essaie peu à peu de revenir à une vie normale. Mais un certain Carl Fogarty débarque, convaincu de reconnaître en Tom celui avec qui il a autrefois eu de violents démêlés…', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/keHREQ9jRiHp7ja1SM8xmDCo6vI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5EEdDTV0IBxJ2J4jDUDvl076v7f.jpg', 'https://www.youtube.com/embed/UQjzRHMiPWE', 95, '2005', 3.59, 1),
(62, 'United Kingdom', '2001 : L’odyssée de l’espace', 'Aux temps préhistoriques, une petite tribu d’hommes‐singes installée au milieu de rochers arides lutte difficilement pour la vie. Un matin, ils trouvent devant eux une mystérieuse dalle noire monolithique. L’un des singes touche la pierre et apprend alors à se servir d’un os de quadrupède pour tuer ses ennemis. Quatre millions d’années plus tard, en 2001, un savant de l’espace, le Dr Heywood Floyd, débarque sur la lune pour examiner une dalle noire semblable à celle des singes, qui était enterrée sous la surface de l’astre. Selon les premières observations, l’objet émettrait un signal mystérieux…', 'Stanley Kubrick Productions', 'https://image.tmdb.org/t/p/w1280/jNSk4dXs1cHu0SoLxmmZ2W6CYKl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kCEXA22ASuq7Y29jnngyaisyA0X.jpg', 'https://www.youtube.com/embed/5px2VwyCeWE', 156, '1968', 4.04, 1),
(63, 'United States of America', 'L\'Armée des 12 singes', 'Nous sommes en l’an 2035. Les quelques milliers d’habitants qui restent sur notre planète sont contraints de vivre sous terre. La surface du globe est devenue inhabitable à la suite d’un virus ayant décimé 99 % de la population. Les survivants mettent tous leurs espoirs dans un voyage à travers le temps pour découvrir les causes de la catastrophe et la prévenir. C’est James Cole, hanté depuis des années par une image incompréhensible, qui est désigné pour cette mission.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/lOKC5K87T0sxYKc6Db4WMPosm2p.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1IWaKG7AWiYMhADxhGtnElDJAGI.jpg', 'https://www.youtube.com/embed/23KZkUdaQQ4', 130, '1995', 3.8, 1),
(64, 'Spain', 'Parle avec elle', 'Benigno, un jeune infirmier, et Marco, un écrivain d’une quarantaine d’années, se rendent, chacun de son côté, à un spectacle de Pina Bausch, Café Müller. Ils sont assis l’un à côté de l’autre. La pièce est si émouvante que Marco éclate en sanglots. Apercevant les larmes de son voisin, Benigno aimerait lui faire part de son émotion, mais il n’ose pas. Quelques mois plus tard, les deux hommes se retrouvent dans d’autres circonstances, à la clinique El Bosque, où travaille Benigno. Lydia, la petite amie de Marco, torero professionnel, est plongée dans un profond coma suite à un accident survenu lors d’une corrida. Benigno, quant à lui, est au chevet d’Alicia, une jeune danseuse également dans le coma. Lorsque Marco passe à côté de la chambre d’Alicia, Benigno, sans hésiter, s’approche de lui. C’est le début d’une grande amitié quelque peu mouvementée.', 'Vía Digital', 'https://image.tmdb.org/t/p/w1280/fmCJvc6ZpPaeSGS4bgfc3n5rt00.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9aCRXFWT1rd1nZDcEtWILKb2Sap.jpg', 'https://www.youtube.com/embed/7fl8tyEIXXI', 112, '2002', 3.8, 1),
(65, 'Germany', '8 Mile', 'A Detroit, en 1995, Jimmy Smith Jr. a des rêves plein la tête, mais il lui manque encore les mots pour les exprimer. Sa vie d’adolescent se déroule entre banlieue blanche et quartiers noirs, le long de cette ligne de démarcation que l’on nomme 8 Mile Road. En dépit de tous ses efforts, Jimmy n’a jamais franchi cette barrière symbolique et continue d’accumuler les déboires familiaux, professionnels et sentimentaux.Un jour, il participe à un clash – une joute oratoire de rappeurs – où il doit faire face à Papa Doc, le chef de la bande des « Leaders du Monde Libre ». Paralysé par le trac, il reste muet et doit quitter la scène sous les huées de la foule. Cette nouvelle humiliation l’oblige à un salutaire examen de conscience. Quelques jours plus tard, Jimmy se retrouve forcé de tenter un come‐back…', 'Mikona Productions GmbH & Co. KG', 'https://image.tmdb.org/t/p/w1280/9DUYN04hWHVy1tAf8MhXK1vAZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bfccQmQWNFQYRv4PHgCnjDu7PXn.jpg', 'https://www.youtube.com/embed/56BBoO2z6OA', 110, '2002', 3.56, 1),
(66, 'United States of America', 'Les Pleins Pouvoirs', 'Luther Whitney est un Arsène Lupin moderne, un voleur élégant qui s’en est toujours pris aux riches. Arrivé au terme de sa longue carrière, il entreprend de dévaliser la résidence de Sullivan, un des hommes les plus riches de Washington, parti en voyage d’affaires avec sa jeune épouse, Christy. Tout se passe pour le mieux. Il s’apprête à repartir lorsqu’il découvre que la cloison de la chambre forte est un miroir sans tain qui donne sur la chambre à coucher. De l’autre côté de ce miroir, Luther assiste à un meurtre impliquant Christy et Richmond, le Président des Etats‐Unis.', 'Castle Rock Entertainment', 'https://image.tmdb.org/t/p/w1280/sU0SPvZPJj9AORrCqoI8JnhJiIw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//n7U0FEirHej1yQIy2mAzDtF9wBz.jpg', 'https://www.youtube.com/embed/', 121, '1997', 3.32, 1),
(67, 'France', 'Paradise Now', 'Deux amis d\'enfance palestiniens, Khaled et Saïd, sont désignés pour commettre un attentat suicide à Tel aviv. Engagés volontaires depuis plusieurs années dans une faction, ils sont liés par un contrat moral qu\'ils ne peuvent ou ne veulent rompre. Ils passent une dernière soirée avec leurs familles sans pouvoir toutefois leur dire adieu. Le lendemain, munis de leurs ceintures d\'explosifs, ils sont conduits à la frontière.Mais l\'opération ne se déroule pas comme prévu...', 'Eurimages', 'https://image.tmdb.org/t/p/w1280/qWZkYa8VdcDZk8uzRB2PfhpM9IL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pIESejTZpHXvc6SF0LuQWpJIUD2.jpg', 'https://www.youtube.com/embed/', 87, '2005', 3.45, 1),
(68, 'United Kingdom', 'Brazil', 'Sam Lowry est un technocrate harcelé dans une société futuriste complètement alambiquée et inefficace. Dans son fantasme, il rêve d\'une vie où il pourra échapper à la bureaucratie écrasante et passer l\'éternité avec la femme de ses rêves. L\'improbable se produit alors que Sam essaie de rectifier l\'arrestation injustifiée d\'un certain Archibald Buttle ; l\'ordinateur omniprésent qui contrôle tout dans le monde « réel » dysfonctionne. Lorsque cela se produit, Sam rencontre vraiment la femme qu\'il poursuit depuis toujours dans ses rêves, Jill Layton. Cependant, la bureaucratie mécanique l\'a pointé du doigt pour une vague d\'attentats terroristes, et les vies de Sam et de Jill sont mises en danger.', 'Embassy International Pictures', 'https://image.tmdb.org/t/p/w1280/745fbQQG6MEr9n3Fovj7clf6AT4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ziRWOYnl6e2JUaHYmFLR1kfcECM.jpg', 'https://www.youtube.com/embed/1d_nnPW1jRc', 143, '1985', 3.84, 1),
(69, 'Germany', 'Walk the Line', 'En retraçant le destin du chanteur country-rock Johnny Cash, Walk the line évoque la naissance d\'un nouveau style d\'artiste, celle d\'un homme qui au-delà de ses colères, des ravages de la dépendance et des tentations du statut de star, a tout dépassé pour devenir une icône.C\'est aussi le parcours d\'un homme qui, du fond de la période la plus noire de sa vie, a été porté par une histoire d\'amour fusionnelle avec June Carter. Leur passion a nourri son art tout au long de sa vie.Cette saga est marquée par les thèmes qui feront la force de la musique de Cash et de son style minimaliste : la mort, l\'amour, la trahison, le péché, l\'espoir et la foi.', 'Mars Media Beteiligungs', 'https://image.tmdb.org/t/p/w1280/iQf7NnMBQRzrfqqwbpoooOHGXrG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pMBKzEotLUzk3NuQiyVjZEDlH70.jpg', 'https://www.youtube.com/embed/5gvycTmsfJM', 137, '2005', 3.75, 1),
(70, 'United States of America', 'Million Dollar Baby', 'Rejeté depuis longtemps par sa fille, l’entraîneur Frankie Dunn s’est replié sur lui‐même et vit dans un désert affectif, en évitant toute relation qui pourrait accroître sa douleur et sa culpabilité. Le jour où Maggie Fitzgerald, 31 ans, pousse la porte de son gymnase à la recherche d’un coach, elle n’amène pas seulement avec elle sa jeunesse et sa force, mais aussi une histoire jalonnée d’épreuves et une exigence, vitale et urgente : monter sur le ring, entraînée par Frankie, et enfin concrétiser le rêve d’une vie. Après avoir repoussé plusieurs fois sa demande, Frankie se laisse convaincre par l’inflexible détermination de la jeune femme. Une relation mouvementée, tour à tour stimulante et exaspérante, se noue entre eux, au fil de laquelle Maggie et l’entraîneur se découvrent une communauté d’esprit et une complicité inattendues…', 'Lakeshore Entertainment', 'https://image.tmdb.org/t/p/w1280/7yWwlgq12qZ4nMLQHhEf8ITaggn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oGMomeS7bE43eN8SGJUaKvQnmud.jpg', 'https://www.youtube.com/embed/jV1dB6ikln0', 132, '2004', 3.98, 1),
(71, 'France', 'Billy Elliot', 'Dans un petit village minier du Nord‐Est de l’Angleterre, Billy, 11 ans, découvre avec stupeur qu’un cours de danse partage désormais les mêmes locaux que son club de boxe. D’abord effaré, il devient peu à peu fasciné par la magie de la gestuelle du ballet, activité pourtant trop peu virile au regard de son père et de son frère Tony, mineurs en grève. Billy abandonne les gants de cuir pour assister discrètement aux leçons de danse professées par Mme Wilkinson. Repérant immédiatement un talent potentiel, elle retrouve une nouvelle énergie devant les espoirs que constitue Billy. Les frustrations larvées explosent au grand jour quand son père et son frère découvrent que Billy a dépensé l’argent consacré au cours de boxe pour des cours de danse. Partagé entre une famille en situation de crise et un professeur de ballet têtu, le jeune garçon embarque alors dans un voyage à la découverte de lui‐même.', 'StudioCanal', 'https://image.tmdb.org/t/p/w1280/zUntiKHa8AZHO7YKW0ZfjOLWYbj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9B4198IzCI0POkUIVu5yQ2s7Pzr.jpg', 'https://www.youtube.com/embed/kGoxs5lui8E', 110, '2000', 3.8, 1),
(73, 'United States of America', 'American History X', 'À travers l’histoire d’une famille américaine, ce film tente d’expliquer l’origine du racisme et de l’extrémisme aux États‐Unis. Il raconte l’histoire de Derek qui, voulant venger la mort de son père, abattu par un dealer noir, a épousé les thèses racistes d’un groupuscule de militants d’extrême droite et s’est mis au service de son leader, brutal théoricien prônant la suprématie de la race blanche. Ces théories le mèneront à commettre un double meurtre entrainant son jeune frère, Danny, dans la spirale de la haine.', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/yygSRdHdcIVPRNC0rDv658ZdJiD.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9LSsSPbP715XT9B7acIZzantPyX.jpg', 'https://www.youtube.com/embed/GlOT1vpy9oM', 118, '1998', 4.18, 1),
(74, 'United States of America', 'La Guerre des mondes', 'Ray Ferrier est un docker divorcé et un père rien moins que parfait, qui n’entretient plus que des relations épisodiques avec son fils Robbie, 17 ans, et sa fille Rachel, 11 ans. Quelques minutes après que son ex‐femme et l’époux de cette dernière lui ont confié la garde des enfants, un puissant orage éclate. Ray assiste alors à un spectacle qui bouleversera à jamais sa vie…', 'Paramount', 'https://image.tmdb.org/t/p/w1280/b2GIYpfFuO43ailnUFGER9LDa2Q.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nH6hPhJq3EEv9CnBZgXU3IQnpJo.jpg', 'https://www.youtube.com/embed/JLDflS8FkOI', 116, '2005', 3.25, 1),
(75, 'United States of America', 'Mars Attacks!', 'Ils arrivent ! D’immondes Martiens, aux yeux globuleux et au crâne énorme, débarquent subitement sur la planète Terre. On ne connaît absolument rien de leurs intentions, mais le président des États‐Unis et ses conseillers se réjouissent unanimement de cette apparition incongrue. Tout comme Art Land, un ambitieux promoteur de Las Vegas, qui voit là la possibilité d’un fructueux coup de publicité, et sa femme, une ancienne alcoolique, fervente adepte du New Age, qui prépare dans la plus pure tradition ésotérique l’union cosmique entre les peuples de toutes les galaxies. Tout un programme ! Mais les affreux jojos venus d’ailleurs sont‐ils aussi cordiaux et désintéressés que tout ce petit monde veut bien le prétendre ?', 'Tim Burton Productions', 'https://image.tmdb.org/t/p/w1280/ljW8CVhjhoJNrMor6pIQLM3Mhqr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//d9DeuR70Y8AGppSYwdLuoCUGenN.jpg', 'https://www.youtube.com/embed/NzC5qlbSNAs', 106, '1996', 3.2, 1),
(76, 'Austria', 'Before Sunrise', 'Céline est une étudiante française qui est allée rendre visite à sa grand-mère à Budapest. Jesse est un jeune américain en voyage à travers l\'Europe. Tous deux se rencontrent dans un train, entre Budapest et Vienne. Arrivés à Vienne, Jesse doit descendre. Il parvient à convaincre Céline de passer une nuit avec lui dans la capitale autrichienne. Au cours de cette nuit, ils apprendront à se connaître. Le lendemain, ils devront se séparer.', 'Castle Rock Entertainment', 'https://image.tmdb.org/t/p/w1280/vLY17UVvhwXpEjnTqTYqlmuO2py.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qA2TyqPldTtoTVY3LKrNIG5g6bH.jpg', 'https://www.youtube.com/embed/25v7N34d5HE', 101, '1995', 4, 1),
(77, 'United States of America', 'Memento', 'Leonard Shelby ne porte que des costumes de grands couturiers et ne se déplace qu’au volant de sa Jaguar. En revanche, il habite dans des motels miteux et règle ses notes avec d’épaisses liasses de billets. Leonard n’a qu’une idée en tête: traquer l’homme qui a violé et assassiné sa femme afin de se venger. Sa recherche du meurtrier est rendue plus difficile par le fait qu’il souffre d’une forme rare et incurable d’amnésie. Bien qu’il puisse se souvenir de détails de son passé, il est incapable de savoir ce qu’il a fait dans le quart d’heure précédent, où il se trouve, où il va et pourquoi. Pour ne jamais perdre son objectif de vue, il a structuré sa vie à l’aide de fiches, de notes, de photos, de tatouages sur le corps. C’est ce qui l’aide à garder contact avec sa mission, à retenir les informations et à garder une trace, une notion de l’espace et du temps.', 'Summit Entertainment', 'https://image.tmdb.org/t/p/w1280/nzlv62aC0octS5AklAiWpXLX9Z0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//q2CtXYjp9IlnfBcPktNkBPsuAEO.jpg', 'https://www.youtube.com/embed/FzFQ768J7Bs', 116, '2000', 4.1, 1),
(78, 'United States of America', 'Blade Runner', '2019, Los Angeles. La Terre est surpeuplée et l’humanité est partie coloniser l’espace. Les nouveaux colons sont assistés de Replicants, androïdes que rien ne peut distinguer de l\'être humain. Conçus comme de nouveaux esclaves, certains parmi les plus évolués s’affranchissent de leurs chaînes et s’enfuient. Rick Deckard, un ancien Blade Runner, catégorie spéciale de policiers chargés de \"retirer\" ces replicants, accepte une nouvelle mission consistant à retrouver quatre de ces individus qui viennent de regagner la Terre après avoir volé une navette spatiale.', 'Shaw Brothers', 'https://image.tmdb.org/t/p/w1280/zHKWxyG4j404HVeSYHNH4niUpkW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wfQTVBIQj1wJUe0jV3OZ4zOivIO.jpg', 'https://www.youtube.com/embed/FfRPKYwsFNg', 117, '1982', 3.97, 1),
(79, 'China', 'Hero', 'Il y a deux mille ans, la Chine était divisée en sept royaumes. Chacun d\'eux combattait les autres pour obtenir la suprématie, tandis que le peuple endurait la souffrance et la mort. De ces sept royaumes, Qin était le plus virulent. Le roi de Qin était obsédé par la conquête de la Chine et le désir de devenir son premier Empereur. Les autres royaumes dépêchèrent leurs plus redoutables assassins pour l\'éliminer. Le seul nom de trois de ces tueurs suffisait à répandre la terreur : Lame Brisée, Flocon de Neige et Ciel Étoilé. À quiconque anéantirait ces trois assassins, le roi de Qin promit puissance et fortune.  Pendant dix ans, personne n\'y parvint. Lorsque le mystérieux Sans Nom se présenta au palais, avec en sa possession les armes des assassins abattus, le roi fut impatient d\'entendre son histoire. Assis à dix pas du monarque, Sans Nom commença alors à la raconter…', 'Beijing New Picture Film Co. Ltd.', 'https://image.tmdb.org/t/p/w1280/8eYg4hWMMHNfnD8wrnOrVkJnGIf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jDz6RYN3nKYtlo7J9IMvGoJit7B.jpg', 'https://www.youtube.com/embed/', 98, '2002', 3.76, 1),
(80, 'United States of America', 'Before Sunset', 'Neuf ans auparavant, Jesse et Céline se sont rencontrés par hasard à Vienne, et ont passé une nuit ensemble dans les rues désertes de la ville. En se séparant, quatorze heures plus tard, ils s\'étaient promis de se revoir six mois après. Aujourd\'hui, il se retrouvent à Paris alors que Jesse est venu présenter son nouveau roman. Ils passent l\'après-midi ensemble dans des cafés, des parcs et sur les quais de la Seine, retrouvant instantanément leur ancienne complicité. Comme lors de leur première rencontre, ils ont énormément de choses à se raconter...', 'Warner Independent Pictures (WIP)', 'https://image.tmdb.org/t/p/w1280/gycdE1ARByGQcK4fYR2mgpU6OO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zwgDZw9dyrgkYz2RCOb2HvUDlt2.jpg', 'https://www.youtube.com/embed/oI3UuneLcyU', 80, '2004', 3.9, 1),
(81, 'Japan', 'Nausicaä de la vallée du vent', 'Dans un monde où la nature est hostile à l’Homme, Nausicaä – princesse de la Vallée du Vent – se bat pour protéger son village. Mais la guerre des hommes frappe à leur porte. Les vestiges d’une humanité industrielle menacent l’équilibre entre les rescapés humains du grand cataclysme et les insectes, protecteurs de la forêt toxique.', 'Topcraft', 'https://image.tmdb.org/t/p/w1280/oFepxUN7SJ3kwuohhUoqzn5eNTA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qLftEsGNW3WxNbf76SHxbAoIj3b.jpg', 'https://www.youtube.com/embed/aasYJcvHhj0', 117, '1984', 3.95, 1),
(82, 'Uruguay', 'Miami Vice : Deux flics à Miami', 'Miami... Deux agents fédéraux et la famille d\'un informateur ont été sauvagement exécutés. Une nouvelle enquête commence pour Sonny Crockett et son coéquipier Ricardo Tubbs, avec une certitude : la fuite qui a permis ce massacre en règle provenait des sommets de la hiérarchie... Les deux inspecteurs découvrent rapidement que les tueurs étaient au service de la Fraternité Aryenne, organisation suprématiste liée à un réseau de trafiquants internationaux doté d\'un système de protection ultra-sophistiqué. Poursuivant leurs investigations, les deux partenaires prennent contact avec l\'administratricefinancière du cartel, Isabella, une sinocubaine aussi experte en investissements et transferts de fonds qu\'en blanchiment d\'argent. La séduisante Isabella offre contre toute attente à Sonny une chance d\'exorciser ses démons...', 'Metropolis Films', 'https://image.tmdb.org/t/p/w1280/pdp3PA8XUxKdXJEJTXM3BQKpRZp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lV2UQv1qmiZA0tWsVjgFLD6z2uG.jpg', 'https://www.youtube.com/embed/qk7lyUPvNBI', 140, '2006', 2.99, 1),
(83, 'United States of America', 'Open Water : En eaux profondes', 'Susan et Daniel sont venus aux Bahamas pour se détendre, et ils en ont bien besoin. Adeptes de la plongée, ils s\'inscrivent pour une sortie sur la barrière de corail. Parce que le bateau est trop plein, parce que l\'équipage ne fait pas vraiment attention, ils se retrouvent seuls, perdus au large, dans des eaux infestées de requins...', 'Plunge Pictures LLC', 'https://image.tmdb.org/t/p/w1280/nQ6dccxakKV4u8ePr9Kfxh2gPVJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//58BUQzjN6TH0bLe6JEfgMbHc55u.jpg', 'https://www.youtube.com/embed/', 80, '2003', 2.76, 1),
(85, 'United States of America', 'Les Aventuriers de l\'arche perdue', '1936. Parti à la recherche d’une idole sacrée en pleine jungle péruvienne, l’aventurier Indiana Jones échappe de justesse à une embuscade tendue par son plus coriace adversaire: le Français René Belloq. Revenu à la vie civile à son poste de professeur universitaire d’archéologie, il est mandaté par les services secrets et par son ami Marcus Brody, conservateur du National Museum de Washington, pour mettre la main sur le Médaillon de Râ, en possession de son ancienne amante Marion Ravenwood, désormais tenancière d’un bar au Tibet. Cet artefact égyptien serait en effet un premier pas sur le chemin de l’Arche d’Alliance, celle‐là même où Moïse conserva les Dix Commandements. Une pièce historique aux pouvoir inimaginables dont Hitler cherche à s’emparer.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/pb6ZqNK1luGnkILnkONicFXwNeW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//c7Mjuip0jfHLY7x8ZSEriRj45cu.jpg', 'https://www.youtube.com/embed/JdKKkWHx8pQ', 115, '1981', 3.96, 1),
(86, 'Germany', 'The Elementary Particles', 'Based on Michel Houellebecq\'s controversial novel, Atomised (aka The Elementary Particles) focuses on Michael and Bruno, two very different half-brothers and their disturbed sexuality.  After a chaotic childhood with a hippie mother only caring for her affairs, Michael, a molecular biologist, is more interested in genes than women, while Bruno is obsessed with his sexual desires, but mostly finds his satisfaction with prostitutes.  But Bruno\'s life changes when he gets to know the experienced Christiane.  In the meantime, Michael meets Annabelle, the love of his youth, again.', 'Moovie', 'https://image.tmdb.org/t/p/w1280/wpGpR7GewyApPgqPvuWadBAfmFc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//60PJPzXtQmLQdaCNuWUrrHe1mzu.jpg', 'https://www.youtube.com/embed/uixr8mL7-jI', 105, '2006', 3.11, 1),
(87, 'United States of America', 'Indiana Jones et le Temple maudit', 'L’archéologue Indiana Jones est obligé de fuir un cabaret de Shanghai après une négociation houleuse. En compagnie de la chanteuse Willie Scott et du petit Short Round, il se retrouve sur un glacier himalayen, dans un village dont une secte a dérobé le diamant magique et enlevé les enfants afin de les sacrifier.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/oiUd1KUXWZeDPGMr8TrtZcXzpQU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//iO73omOyLwUPW22EpaZkJNC72ec.jpg', 'https://www.youtube.com/embed/Yg6HP1hQpIQ', 118, '1984', 3.65, 1),
(88, 'United States of America', 'Dirty Dancing', 'En 1963. Bébé – de son vrai prénom Frédérique – fille d’une riche famille, passe ses vacances avec ses parents et sa sœur à la pension de la famille Kellerman dans l’État de l’Oregon. Elle va être confrontée à un monde qui lui est complètement étranger, celui de la danse, et vivre une histoire d’amour avec Johnny, l’un des professeurs de danse de l’établissement, issu d’un milieu social très différent. Film à petit budget d’Émile Ardolino, il deviendra l’un des plus grand succès des années 80.', 'Great American Films Limited Partnership', 'https://image.tmdb.org/t/p/w1280/osfBQ18P0y3pwT5qVuhdPk8btbj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6iDQCBUSZKzY8Rnu8ECwl2gXcfG.jpg', 'https://www.youtube.com/embed/Ka-EcMNlSCI', 100, '1987', 3.67, 1),
(89, 'United States of America', 'Indiana Jones et la dernière croisade', 'Indiana Jones se lance cette fois‐ci à la recherche du Saint Graal, accompagné de l’éminent et très maladroit Dr Henry Jones, son père. Malheureusement, ils ne sont pas les seuls lancés sur la trace du trésor, les nazis le convoitent également.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/uE0aVKGfBEeGpTgcnz4MFZrkc95.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//S6lLHuyh86V6SDRkSBsbuVTE6n.jpg', 'https://www.youtube.com/embed/JaHLB1f83cw', 127, '1989', 3.92, 1),
(90, 'United States of America', 'Le Flic de Beverly Hills', 'Axel Foley, ancien voyou, est maintenant un des flics les plus efficaces de Detroit. Et même si ses méthodes sont loin d\'être traditionnelles, ses supérieurs sont bien obligés de reconnaître ses qualités. Axel retrouve un ami d’enfance, mais celui-ci est assassiné le jour de leurs retrouvailles. L\'enquête lui étant refusée, Axel prend ses congés et se lance à la poursuite du meurtrier. Le petit flic de Detroit se retrouve à Beverly Hills, entraîné dans le milieu des dealers et des truands…', 'Paramount', 'https://image.tmdb.org/t/p/w1280/zZzdcXKZAvr3bcfqtkoHWmiGnT3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pDMNtdSbwXZIz1TSSEPhcQYDJvt.jpg', 'https://www.youtube.com/embed/XRnQSMZz9jA', 105, '1984', 3.59, 1),
(91, 'France', 'Terre sans pain', 'Seul film documentaire de Luis Buñuel, tourné en 1932 dans la région de Las Hurdes (Estrémadure), à partir de la thèse ethnographique de Maurice Legendre, directeur de l\'Institut Français de Madrid, « Las Jurdes : étude de géographie humaine » (1927), « Terre sans pain » ne fut sonorisé qu’en 1937 puis en 1996 lorsque Buñuel décida de diffuser une version non censurée du film avec son producteur Pierre Braunberger. Remarquable par son sujet, la misère en milieu rural, peu traité à l’époque, par son montage (fait par Buñuel « sur une table de cuisine, à Madrid »), l\'usage du gros plan, de la piste sonore et par la place assignée au spectateur par le film, le film continue à surprendre aujourd’hui encore.', 'Ramón Acín', 'https://image.tmdb.org/t/p/w1280/sBSqYsfKjMySKq88jIbvHOSjrwF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aaRbO3m3L3yVg2L73QLYvgP23hj.jpg', 'https://www.youtube.com/embed/qO86FO1bs6g', 29, '1933', 3.54, 1),
(92, 'Austria', 'Megacities', '', 'Lotus-Film', 'https://image.tmdb.org/t/p/w1280/qO48XLCG58cICOgAR57ao0PrJ6A.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 94, '1998', 3.45, 1),
(93, 'United States of America', 'Autopsie d\'un meurtre', 'L\'avocat Paul Biegler reçoit un coup de téléphone de Laura Manion lui demandant d\'assurer la défense de son mari. Le lieutenant Frederik Manion a tué un propriétaire de bar qui avait violé sa femme. Biegler accepte de le défendre. Le procès commence et la vérité a du mal à émerger, d\'ailleurs les avocats et les juges, s\'affrontant dans des batailles juridiques, en sont en réalité peu soucieux.', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/ArLco9bmJgwA4quPDDdyoU4Zxcd.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jtCNu6f3MCFuEQ4cyHcNdI1QUjI.jpg', 'https://www.youtube.com/embed/', 150, '1959', 3.92, 1),
(94, 'Germany', 'Kunstgriff', '', 'Hamburger Filmschule', 'https://image.tmdb.org/t/p/w1280/82CFTXepfmETr2C4n7ZlrpLyjAx.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 6, '2002', 4.25, 1),
(95, 'United States of America', 'Armageddon', 'Un astéroïde se dirige vers la Terre à la vitesse de 35 000 kilomètres à l’heure. Harry S. Stamper, grand spécialiste du forage pétrolier, est recruté par le directeur de la NASA pour tenter de le détruire. Lui et son équipe de têtes brulées devront se poser sur l’astéroïde et placer en son cœur une charge nucléaire. Débute alors l’entraînement indispensable des astronautes et l’apprentissage des outils spatiaux…', 'Touchstone Pictures', 'https://image.tmdb.org/t/p/w1280/45kba3oT8q7BtsP9XsMIU3x8j0N.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sODk4VuMTt8S56zYFOr1Kx8BFqu.jpg', 'https://www.youtube.com/embed/pCWKG2HVqRE', 148, '1998', 3.41, 1),
(96, 'United States of America', 'Le Flic de Beverly Hills 2', 'Axel Foley est de retour à Beverly Hills. Cette fois, il vient prêter main forte à ses collègues et amis pour résoudre une affaire de vol de bijoux.', 'Eddie Murphy Productions', 'https://image.tmdb.org/t/p/w1280/A4yhgMSb0TuyWhUxbW2SvFXzrC4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bIA65PCRtIQfBvIoKohJbtOPl3M.jpg', 'https://www.youtube.com/embed/7GAyZDlSdE8', 103, '1987', 3.23, 1),
(97, 'United States of America', 'TRON', 'Flynn, un concepteur de jeux vidéos qui s\'est vu voler ses jeux vidéos par son ex-employeur, veut à tout prix récupérer une preuve qui lui ferait valoir ses droits. Avec l\'aide d\'Alan et de Lora, deux de ses anciens collègues, il infiltre le MCP (Maître Contrôleur Principal), un ordinateur avide de pouvoir à l\'intelligence artificielle surdévelopée. Quand ce dernier découvre que Flynn veut s\'infiltrer dans ses circuits, il le téléporte dans un jeu vidéo. Pour s\'évader, Flynn devra compter sur l\'aide de Tron, un programme indépendant inventé par Alan.', 'Lisberger/Kushner Productions', 'https://image.tmdb.org/t/p/w1280/gyQi3cpOunqKrz8Jfr9OHeOxxsu.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vUmeBHiGp5r2ydd8aEvbNLamTVD.jpg', 'https://www.youtube.com/embed/7vMKjZM5Sm4', 96, '1982', 3.34, 1),
(98, 'United Kingdom', 'Gladiator', 'Le général romain Maximus est le plus fidèle soutien de l\'empereur Marc Aurèle, qu\'il a conduit de victoire en victoire avec une bravoure et un dévouement exemplaires. Jaloux du prestige de Maximus, et plus encore de l\'amour que lui voue l\'empereur, le fils de Marc Aurèle, Commode, s\'arroge brutalement le pouvoir, puis ordonne l\'arrestation du général et son exécution. Maximus échappe à ses assassins mais ne peut empêcher le massacre de sa famille. Capturé par un marchand d\'esclaves, il devient gladiateur et prépare sa vengeance.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/5gJOu3t2QrznuJqjCG7FQDMI76t.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aZtwH3RQ0L8jbInxr7OSc9tlGMJ.jpg', 'https://www.youtube.com/embed/Nz5CnNHnpO8', 155, '2000', 4.1, 1),
(99, 'Spain', 'All About My Mother', 'Following the tragic death of her teenage son, Manuela travels from Madrid to Barcelona in an attempt to contact the long-estranged father the boy never knew. She reunites with an old friend, an outspoken transgender sex worker, and befriends a troubled actress and a pregnant, HIV-positive nun.', 'Renn Productions', 'https://image.tmdb.org/t/p/w1280/hjQhzhkGYXPNM96k0mOgob6HMmn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tilClWjFZeUTGJu0pxgF72fvUmN.jpg', 'https://www.youtube.com/embed/', 101, '1999', 3.85, 1),
(100, 'United Kingdom', 'Arnaques, crimes et botanique', 'Eddy, un joueur invétéré, s\'apprête à participer à la plus grosse partie de cartes de sa vie avec un enjeu de cent mille livres, somme qu\'il a durement amassée avec ses trois acolytes, Tom, Baco et Soap. Eddy est considéré comme l\'un des meilleurs joueurs du circuit, mais la partie s\'avère être un coup monté à l\'issue duquel il doit cinq cent mille livres à son adversaire Hatchet Harry. Ce dernier lui donne une semaine pour réunir cette somme, sinon il aura les doigts coupés. Seul JD, le père d\'Eddy, pourrait annuler la dette en cédant son bar à son vieux rival, Harry.', 'Summit Entertainment', 'https://image.tmdb.org/t/p/w1280/yCWGMcU0rI0dGq0snlKlCf9RZXR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cXQH2u7wUIX1eoIdEj51kHXoWhX.jpg', 'https://www.youtube.com/embed/', 106, '1998', 4.05, 1),
(101, 'United States of America', 'Léon', 'Léon est un tueur professionnel redoutable et insaisissable. Il vit seul à New York avec sa plante verte et ses habitudes jusqu\'au jour où une petite Mathilda de douze ans sonne à sa porte et fait irruption dans sa vie.', 'Gaumont', 'https://image.tmdb.org/t/p/w1280/4NkX4dSIP5PZhaZbanvNas1ila9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jRJrQ72VLyEnVsvwfep8Xjlvu8c.jpg', 'https://www.youtube.com/embed/Jcjel7l_7mQ', 110, '1994', 4.16, 1),
(102, 'Denmark', 'Open Hearts', 'Cecilie et Joachim ont tout pour être heureux. Mais leur bonheur s\'écroule le jour où ce dernier est victime d\'un accident de voiture et se retrouve paralysé. Désespérée, Cecilie se rapproche de plus en plus du médecin chargé de soigner son compagnon.', 'Zentropa Entertainments', 'https://image.tmdb.org/t/p/w1280/oR4Hzc17SqjfPzKbR8Qcy5QxZJF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1pRNzOM7OQA29cVayaCheBI4vn7.jpg', 'https://www.youtube.com/embed/', 113, '2002', 3.42, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(103, 'United States of America', 'Taxi Driver', 'A mentally unstable Vietnam War veteran works as a night-time taxi driver in New York City where the perceived decadence and sleaze feed his urge for violent action.', 'Italo/Judeo Productions', 'https://image.tmdb.org/t/p/w1280/ekstpH614fwDX8DUln1a2Opz0N8.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//a58oc5qGNazb3QOxEH8eG5S7gjr.jpg', 'https://www.youtube.com/embed/dB_5XEMH3mc', 114, '1976', 4.08, 1),
(104, 'Germany', 'Cours, Lola, cours', 'Manni est un petit malfrat qui accepte de se mouiller pour un gros coup : en revendant des diamants volés, il obtient cent mille marks, qu\'il doit remettre à midi à un trafiquant. Mais il perd le sac contenant l\'argent dans le métro berlinois.En dernier recours, il appelle sa copine, Lola, vingt ans, les cheveux rouges, fragile mais déterminée. Manni lui résume la situation. Il est onze heures quarante. Si dans vingt minutes, Manni ne récupère pas l\'argent, c\'est un homme mort. Désespérée, la jeune femme s\'élance dans la capitale. Elle a vingt minutes pour trouver cent mille marks, rejoindre Manni et ainsi sauver l\'homme de sa vie...', 'X Filme Creative Pool', 'https://image.tmdb.org/t/p/w1280/9srcZ6WzkJnIulazKLlRLK5Vh4E.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lhsrT0SbPaqmBMHLd5N83j8XAFy.jpg', 'https://www.youtube.com/embed/4kGTwJvKR1c', 81, '1998', 3.66, 1),
(105, 'United States of America', 'Retour vers le futur', 'En 1985, Marty, un adolescent comme les autres, mène une existence morne et ennuyeuse. Heureusement, il est épris de la jolie Jennifer et entretient une profonde amitié avec Doc, un savant fou qui prétend avoir inventé une machine à explorer le temps. Un jour, Doc invite Marty à l\'essayer...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/y9bs2N5rEM51YBXbU7N5PaXJc6W.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5bzPWQ2dFUl2aZKkp7ILJVVkRed.jpg', 'https://www.youtube.com/embed/Q5ffxbs4vYs', 116, '1985', 4.16, 1),
(106, 'United States of America', 'Predator', 'Le Major Dutch Schaefer et son équipe sont envoyés dans la jungle sud-américaine avec pour mission de délivrer des alliés pris en otage par une bande de guérilleros. Mais pendant l\'opération, Dutsch et ses hommes s\'aperçoivent que les preneurs d\'otages ont été... dépecés et suspendus à la plus haute cime des arbres. Très vite, le commando comprend qu\'il a en face de lui un ennemi hors du commun. Un monstre invisible et indestructible venu d\'une autre planète. Un extraterrestre rompu à toutes les formes d\'attaques et qui ne poursuit qu\'un seul but : la chasse à l\'être humain. Schaefer et sa troupe sont pour lui du gibier de premier choix.', 'Silver Pictures', 'https://image.tmdb.org/t/p/w1280/lXoATMtTK3ZsICCvTtXygASHZd9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//YL3GPOiDcNraIJOVDCZsoOBoDy.jpg', 'https://www.youtube.com/embed/n_wszy5pdYA', 107, '1987', 3.74, 1),
(107, 'United Kingdom', 'Snatch, tu braques ou tu raques', 'Franky vient de voler un énorme diamant qu’il doit livrer à Avi, un mafieux new‐yorkais. En chemin, il fait escale à Londres où il se laisse convaincre par Boris de parier sur un combat de boxe clandestin. Il ignore, bien sûr, qu’il s’agit d’un coup monté avec Vinny et Sol, afin de le délester de son magnifique caillou. Turkish et Tommy, eux, ont un problème avec leur boxeur, un gitan complètement fêlé qui refuse de se coucher au quatrième round comme prévu. C’est au tour d’Avi de débarquer, bien décidé à récupérer son bien, avec l’aide de Tony, une légende de la gâchette.', 'SKA Films', 'https://image.tmdb.org/t/p/w1280/pP2o0ir6T1cnpZBdSuDN7MZwKGn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ysKahAEPP8h6MInuLjr0xuZOTjh.jpg', 'https://www.youtube.com/embed/AMZH867eWS4', 103, '2000', 3.9, 1),
(108, 'France', 'Trois couleurs : Bleu', 'Après la mort de son mari, compositeur réputé, et de leur fille dans un accident de voiture, Julie commence une nouvelle vie, coupant tout lien avec son passé. Ex-assistant du couple, Olivier, amoureux d\'elle, tente de l\'inciter à terminer le Concerto pour l\'Europe.', 'France 3 Cinéma', 'https://image.tmdb.org/t/p/w1280/70O1cudvYiEWpKW2Sb1FPAdaqjf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//s9rWmLANsVlSV4XmuC0IUcseGzO.jpg', 'https://www.youtube.com/embed/cVaqLZmMf-k', 100, '1993', 3.84, 1),
(109, 'France', 'Trois couleurs : Blanc', 'Karol a tout perdu après son divorce avec Dominique, il ne peut même pas retourner en Pologne et refuse de devenir meurtrier pour de l\'argent. Après avoir enfin réussi à retourner dans son pays, il se lance dans diverses entreprises et tombe dans le piège de sa vengeance sur Dominique.', 'Le Studio Canal+', 'https://image.tmdb.org/t/p/w1280/trza88l4jjvIlmP1Dy3BjbAnFNr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2eBL3wXDZqemW8SJ1RNxqtx6bgJ.jpg', 'https://www.youtube.com/embed/uBEku1kG1fo', 100, '1994', 3.73, 1),
(110, 'France', 'Trois couleurs : Rouge', 'Valentine, étudiante à Genève et mannequin à ses heures, passe son temps à attendre les appels téléphoniques de son petit ami, Michel, qui vit en Angleterre. Auguste, son voisin, épris de la douce Karin, travaille d\'arrache-pied pour devenir avocat. Sans le savoir, tout ce petit monde a été placé sur écoute par un juge à la retraite, acariâtre et cynique, qui occupe ainsi sa misanthropie et ses vieux jours. Parce qu\'au volant de sa voiture, elle a renversé la chienne du juge, Valentine fait la connaissance du vieux grigou et découvre ses basses manies. Dégoûtée autant que fascinée, elle se met à lui rendre de fréquentes visites...', 'Zespół Filmowy TOR', 'https://image.tmdb.org/t/p/w1280/dNdmJU2VT13wA9Aa9S53m12VmOn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//A9IY3j3Hwf4Q8Q9w5QxSQPYSvCu.jpg', 'https://www.youtube.com/embed/RPLpbDFQZpg', 100, '1994', 4, 1),
(111, 'United States of America', 'Scarface', 'En 1980, le gouvernement cubain expulse plusieurs centaines de prisonniers dangereux vers la Floride. Parmi eux, Tony Montana : ambitieux et sans scrupules, il élabore un plan pour prendre la place d\'un caïd de la drogue.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/pIFZCbL2t6J4cAWQuFiiHkJJs1z.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cCvp5Sni75agCtyJkNOMapORUQV.jpg', 'https://www.youtube.com/embed/3VNLz5pHq74', 165, '1983', 4.08, 1),
(112, 'Denmark', 'Italian for Beginners', 'A group of strangers find friendship, family and love within an Italian beginners’ course.', 'Zentropa Entertainments', 'https://image.tmdb.org/t/p/w1280/xBEiE8yBaWtpRG04QpSAcIfJiW1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1e8tQfZZ65n1UNibJFYHpPFmOqj.jpg', 'https://www.youtube.com/embed/S0I4l3J9ljA', 95, '2000', 3.25, 1),
(113, 'South Korea', 'Printemps, été, automne, hiver... et printemps', 'Un maître zen et son disciple vivent au cœur d\'un temple bouddhiste en bois : au fil des saisons, leurs sentiments évoluent…', 'LJ Film', 'https://image.tmdb.org/t/p/w1280/pKuneZXwLaDF2aNJcrDC4beg5Og.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6JDjZdFckZyMYgtawDwUb6HTwVp.jpg', 'https://www.youtube.com/embed/0ijOE8HqIH0', 103, '2003', 3.92, 1),
(114, 'United States of America', 'Pretty Woman', 'Quand Edward Lewis, businessman de talent, s’offre les services de la belle Vivian, beauté fatale qui arpente chaque nuit les trottoirs d’Hollywood Boulevard, il décide par amusement de l’engager, de lui faire découvrir son style de vie, de la couvrir de cadeaux. Ils vivent ainsi quelque temps, jusqu’au jour où ils découvrent tous deux qu’ils ne peuvent plus se séparer…', 'Touchstone Pictures', 'https://image.tmdb.org/t/p/w1280/apTFre4duDr92xJgsAts55OeHs1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3tuWpnCTe14zZZPt6sI1W9ByOXx.jpg', 'https://www.youtube.com/embed/eBl8jzO6KHg', 119, '1990', 3.71, 1),
(115, 'United Kingdom', 'The Big Lebowski', 'Jeff Lebowski, prénommé le Duc, est un paresseux qui passe son temps à boire des coups avec son copain Walter et à jouer au bowling, jeu dont il est fanatique. Un jour deux malfrats le passent à tabac. Il semblerait qu’un certain Jackie Treehorn veuille récupérer une somme d’argent que lui doit la femme de Jeff. Seulement Lebowski n’est pas marié. C’est une méprise, le Lebowski recherché est un millionnaire de Pasadena. Le Duc part alors en quête d’un dédommagement auprès de son richissime homonyme…', 'Gramercy Pictures', 'https://image.tmdb.org/t/p/w1280/dhZ0xWMvv4TU2QEpAJKL7XLU2se.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wlpjRBQdRSVdu2a8icYZaIp2xmt.jpg', 'https://www.youtube.com/embed/L4u_8ZCigEY', 117, '1998', 3.92, 1),
(116, 'France', 'Match Point', 'Jeune professeur de tennis issu d\'un milieu modeste, Chris Wilton se fait embaucher dans un club huppé des beaux quartiers de Londres. Il ne tarde pas à sympathiser avec Tom Hewett, un jeune homme de la haute société avec qui il partage sa passion pour l\'opéra. Très vite, Chris fréquente régulièrement les Hewett et séduit Chloe, la sœur de Tom. Alors qu\'il s\'apprête à l\'épouser et qu\'il voit sa situation sociale se métamorphoser, il fait la connaissance de la ravissante fiancée de Tom, Nola Rice, une jeune Américaine venue tenter sa chance comme comédienne en Angleterre...', 'DreamWorks Pictures', 'https://image.tmdb.org/t/p/w1280/vHjEVTD8ucuwKSFOZJeyAnTZYli.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1HEdbjJ20vXn8nW1LwPMc5lY63U.jpg', 'https://www.youtube.com/embed/', 123, '2005', 3.68, 1),
(117, 'United States of America', 'Les Incorruptibles', 'À Chicago en 1930, à l’époque de la prohibition, le trafic d’alcool bat son plein et permet à des truands de bâtir de colossales fortunes. Eliot Ness, jeune policier frais émoulu du FBI, est chargé de démanteler un réseau de contrebande d’alcool. L’ennemi est facilement identifiable : Al Capone, inattaquable officiellement, et pourtant impliqué dans les affaires les plus sordides. La première mission de Ness, maladroitement conduite, se solde par un échec humiliant. Loin de se laisser décourager par ce premier affront, Ness décide de s’entourer de personnes de confiance. Il recrute ainsi Jim Malone, un flic qui connaît bien le monde des truands…', 'Paramount', 'https://image.tmdb.org/t/p/w1280/xrdMy48NrJSJYRplKfuQT0sDfSI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//i1oWUGVDNBhGBykcCRBlX326udb.jpg', 'https://www.youtube.com/embed/YbzkK06MJjE', 119, '1987', 3.88, 1),
(118, 'United Kingdom', 'Charlie et la Chocolaterie', 'Charlie est un enfant issu d\'une famille pauvre. Travaillant pour subvenir aux besoins des siens, il doit économiser chaque penny, et ne peut s\'offrir les friandises dont raffolent les enfants de son âge. Pour obtenir son comptant de sucreries, il participe à un concours organisé par l\'inquiétant Willy Wonka, le propriétaire de la fabrique de chocolat de la ville. Celui qui découvrira l\'un des cinq tickets d\'or que Wonka a caché dans les barres de chocolat de sa fabrication gagnera une vie de sucreries.', 'The Zanuck Company', 'https://image.tmdb.org/t/p/w1280/lxzRFeCHblcE1vc4GVXGN0otrSA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bSvUW4JQ6g4QiKvwejcfcPRd4Ke.jpg', 'https://www.youtube.com/embed/GmHyDsmTggU', 116, '2005', 3.52, 1),
(120, 'New Zealand', 'Le Seigneur des anneaux : La Communauté de l\'anneau', 'Le jeune et timide Hobbit, Frodon Sacquet, hérite d\'un anneau. Bien loin d\'être une simple babiole, il s\'agit de l\'Anneau Unique, un instrument de pouvoir absolu qui permettrait à Sauron, le Seigneur des ténèbres, de régner sur la Terre du Milieu et de réduire en esclavage ses peuples. À moins que Frodon, aidé d\'une Compagnie constituée de Hobbits, d\'Hommes, d\'un Magicien, d\'un Nain, et d\'un Elfe, ne parvienne à emporter l\'Anneau à travers la Terre du Milieu jusqu\'à la Crevasse du Destin, lieu où il a été forgé, et à le détruire pour toujours. Un tel périple signifie s\'aventurer très loin en Mordor, les terres du Seigneur des ténèbres, où est rassemblée son armée d\'Orques maléfiques... La Compagnie doit non seulement combattre les forces extérieures du mal mais aussi les dissensions internes et l\'influence corruptrice qu\'exerce l\'Anneau lui-même.', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/5OPg6M0yHr21Ovs1fni2H1xpKuF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//a0lfia8tk8ifkrve0Tn8wkISUvs.jpg', 'https://www.youtube.com/embed/vvx7m22GGtA', 179, '2001', 4.2, 1),
(121, 'New Zealand', 'Le Seigneur des anneaux : Les Deux Tours', 'Après la mort de Boromir et la disparition de Gandalf, la Communauté s\'est scindée en trois. Perdus dans les collines d\'Emyn Muil, Frodon et Sam découvrent qu\'ils sont suivis par Gollum, une créature versatile corrompue par l\'Anneau. Celui-ci promet de conduire les Hobbits jusqu\'à la Porte Noire du Mordor. À travers la Terre du Milieu, Aragorn, Legolas et Gimli font route vers le Rohan, le royaume assiégé de Theoden. Cet ancien grand roi, manipulé par l\'espion de Saroumane, le sinistre Langue de Serpent, est désormais tombé sous la coupe du malfaisant magicien. Eowyn, la nièce du Roi, reconnaît en Aragorn un meneur d\'hommes. Entretemps, les Hobbits Merry et Pippin, prisonniers des Uruk-hai, se sont échappés et ont découvert dans la mystérieuse Forêt de Fangorn un allié inattendu : Sylvebarbe, gardien des arbres, représentant d\'un ancien peuple végétal dont Saroumane a décimé la forêt...', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/qVHBqQYLDRs7ESjP9q6o9iPHLWj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kWYfW2Re0rUDE6IHhy4CRuKWeFr.jpg', 'https://www.youtube.com/embed/xS8lwH02tAA', 180, '2002', 4.19, 1),
(122, 'New Zealand', 'Le Seigneur des anneaux : Le Retour du roi', 'Les armées de Sauron ont attaqué Minas Tirith, la capitale de Gondor. Jamais ce royaume autrefois puissant n\'a eu autant besoin de son roi. Mais Aragorn trouvera-t-il en lui la volonté d\'accomplir sa destinée ? Tandis que Gandalf tente de soutenir les forces brisées de Gondor, Théoden exhorte les guerriers de Rohan à se joindre au combat.  Mais malgré leur courage et leur loyauté, les armées des Hommes ne sont pas de taille à lutter contre les innombrables légions ennemies qui s\'abattent sur la Terre du Milieu... Chaque victoire se paye d\'immenses sacrifices. Pendant ce temps et malgré ses pertes, la Communauté poursuit sa quête, ses membres faisant tout pour détourner l\'attention de Sauron afin de donner à Frodon une chance d\'accomplir sa mission. Voyageant à travers les terres ennemies, ce dernier doit s\'appuyer sur Sam et Gollum, tandis que l\'Anneau continue de le tenter ...', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/ypUCFOvOf07bcHy81jng9LyMUfi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lXhgCODAbBXL5buk9yEmTpOoOgR.jpg', 'https://www.youtube.com/embed/rc6snEBb-_g', 201, '2003', 4.24, 1),
(123, 'Spain', 'Le Seigneur des anneaux', 'Dans les Terres du Milieu, l\'Anneau unique forgé par Sauron le maléfique pour dominer les hommes, les elfes et les nains est tombé par inadvertance dans les mains de Frodon, paisible hobbit. Ce n\'est qu\'une question de temps avant que les sinistres Cavaliers Noirs, les Servants de l\'Anneau, retrouvent sa trace. Sous la direction de Gandalf le magicien, une expédition est alors montée avec pour mission une tâche quasi-impossible : détruire l\'Anneau, en le jetant dans le feu de la Montagne du Destin, au coeur du territoire de l\'ennemi...', 'Fantasy Films', 'https://image.tmdb.org/t/p/w1280/lH5at1RvvglQmnoBkytTTPZfw94.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//x9McE1WFKnAHludiY7xfd7modDC.jpg', 'https://www.youtube.com/embed/', 132, '1978', 3.29, 1),
(124, 'Poland', 'Sans fin', 'Zyro, avocat, vient de mourir et voit de loin le monde des vivants: sa femme qui se rend compte combien il est difficile de vivre sans lui, le jeune ouvrier accusé d\'avoir organisé une grêve, que defendent maintenant de manière différente d\'autres avocats...', 'Film Polski', 'https://image.tmdb.org/t/p/w1280/9L92cHw17f4V79q1JmGiRPpKtLr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xjcQI6O8xZCFtLVjp2IckYgDqV6.jpg', 'https://www.youtube.com/embed/', 108, '1985', 3.65, 1),
(125, 'Poland', 'La Gare', 'Sous l\'œil troublant d\'une caméra de surveillance, la vie de la gare centale de Varsovie.', 'WFD', 'https://image.tmdb.org/t/p/w1280/c4xG9QoCx2zXc8iP3jQVLYDHiMi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 12, '1980', 2.95, 1),
(126, 'Poland', 'Une courte journée de travail', 'En 1976, la ville de Radom était en proie aux émeutes après la décision du gouvernement d\'augmenter les prix des denrées alimentaires. Le Secrétaire du Comité local du Parti avait du faire face à la situation. En 1981, après la création de Solidarnosc, il raconte ce qu\'il a vécu.', 'Zespól Filmowy \"Tor\"', 'https://image.tmdb.org/t/p/w1280/8tqJb6sv9C8mbH2bifCFGDZhUud.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//59PVw1vVgLZVVJZfV6k1SfOvcYZ.jpg', 'https://www.youtube.com/embed/', 73, '1981', 3.58, 1),
(127, 'Poland', 'Le Hasard', 'Witek est étudiant en médecine, au futur incertain dans la Pologne communiste. Kieslowski dramatise son histoire à travers différentes possibilités qui suggèrent que la chance et nos choix ont la même implication dans notre vie. La difficile compatibilité entre idéaux politiques et bonheur personnel.', 'Film Polski', 'https://image.tmdb.org/t/p/w1280/QO3u6mejOyWxoCeOaoFzU4cw4A.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//eTSRN1Bwce60rpAORwkKbPRDT6V.jpg', 'https://www.youtube.com/embed/', 114, '1987', 3.78, 1),
(128, 'Japan', 'Princesse Mononoké', 'Au XVᵉ siècle, durant l’ère Muromachi, la forêt japonaise, jadis protégée par des animaux géants, se dépeuple à cause de l’homme. Un sanglier transformé en démon dévastateur en sort et attaque le village d’Ashitaka, futur chef du clan Emishi. Touché par le sanglier qu’il a tué, celui‐ci est forcé de partir à la recherche du dieu Cerf pour lever la malédiction qui lui gangrène le bras.', 'Studio Ghibli', 'https://image.tmdb.org/t/p/w1280/AulQiyP2PMQKW5Vm7PviGrFbpPm.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mpNd0rTVrp6vHJ9Je7wSa3zC8JS.jpg', 'https://www.youtube.com/embed/DgJS-CqLHwU', 135, '1997', 4.17, 1),
(129, 'Japan', 'Le Voyage de Chihiro', 'Chihiro, 10 ans, a tout d’une petite fille capricieuse. Elle s’apprête à emménager avec ses parents dans une nouvelle demeure. Sur la route, la petite famille se retrouve face à un immense bâtiment rouge au centre duquel s’ouvre un long tunnel. De l’autre côté du passage se dresse une ville fantôme. Les parents découvrent dans un restaurant désert de nombreux mets succulents et ne tardent pas à se jeter dessus. Ils se retrouvent alors transformés en cochons. Prise de panique, Chihiro s’enfuit et se dématérialise progressivement. L’énigmatique Haku se charge de lui expliquer le fonctionnement de l’univers dans lequel elle vient de pénétrer. Pour sauver ses parents, la fillette va devoir faire face à la terrible sorcière Yubaba, qui arbore les traits d’une harpie méphistophélique.', 'Studio Ghibli', 'https://image.tmdb.org/t/p/w1280/12TAqK0AUgdcYE9ZYZ9r7ASbH5Q.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//Ab8mkHmkYADjU7wQiOkia9BzGvS.jpg', 'https://www.youtube.com/embed/Tny3gaN7CIA', 126, '2001', 4.27, 1),
(132, 'United States of America', 'Gimme Shelter', 'Une chronique détaillée de la célèbre tournée de 1969 du groupe de rock britannique The Rolling Stones aux États-Unis, qui a culminé avec le concert désastreux et tragique donné le 6 décembre au festival gratuit Altamont Speedway, un événement d\'importance historique, car il a marqué la fin d\'une époque : la génération de la paix et de l\'amour est soudainement devenue la génération de la désillusion.', 'Maysles Films', 'https://image.tmdb.org/t/p/w1280/hbGiaHULqEKmEEGb61ko7erTeYG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1UZn5MA63PjaVCf470o0fz5nrbv.jpg', 'https://www.youtube.com/embed/', 92, '1970', 3.7, 1),
(133, 'United States of America', 'Primary', '', 'Drew Associates', 'https://image.tmdb.org/t/p/w1280/gVloWsthHRlw719vzRWRpBqDM20.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//e6IPjjDzZDkgdkvxQtCjaVCMYJF.jpg', 'https://www.youtube.com/embed/', 60, '1960', 3.23, 1),
(134, 'France', 'O\'Brother', 'Dans le Mississippi profond, pendant la Grande Depression. Trois prisonniers enchainés s’évadent du bagne : Ulysses Everett McGill, le gentil et simple Delmar et l’éternel râleur Pete. Ils tentent l’aventure de leur vie pour retrouver leur liberté et leur maison. N’ayant rien à perdre et unis par leurs chaînes, ils entreprennent un voyage semé d’embûches et riche en personnages hauts en couleur. Mais ils devront redoubler d’inventivité pour échapper au mystérieux et rusé shérif Cooley, lancé à leur poursuite…', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/5Mci3lYiAftUNSOuY6ZgC4DexuJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3U98a4AWjRRptUSbNdxtM9cp3dd.jpg', 'https://www.youtube.com/embed/', 106, '2000', 3.66, 1),
(135, 'United States of America', 'Bob Dylan: Dont Look Back', 'Une tournee mythique en Angleterre de BOB Dylan en 1965, avec des apparitions de Joan Baez et Donovan.', 'Leacock-Pennebaker', 'https://image.tmdb.org/t/p/w1280/eE6LQ1EVkslBwku36564kk6rAOI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5dJ8t6CljwZ1NUXwW1nsmEpMf8x.jpg', 'https://www.youtube.com/embed/', 96, '1967', 3.75, 1),
(136, 'United States of America', 'Freaks, la monstrueuse parade', 'Des êtres difformes se produisent dans un célèbre cirque, afin de s\'exhiber en tant que phénomènes de foire. Le lilliputien Hans, fiancé à l\'écuyère naine Frieda, est fasciné par la beauté de l\'acrobate Cléopâtre. Apprenant que son soupirant a hérité d\'une belle somme, cette dernière décide de l\'épouser pour l\'empoisonner ensuite avec la complicité de son amant Hercule. Mais le complot est découvert, et les amis de Hans et Frieda vont se venger...', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/j5Yi9gn1xDHa7QdLRFMYnxylFM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yukdRXb2bhpwDtCHKvQpQ0q77pd.jpg', 'https://www.youtube.com/embed/H6Dm9fRaB-4', 64, '1932', 3.91, 1),
(137, 'United States of America', 'Un jour sans fin', 'Phil Connors, présentateur météo grincheux et arrogant, doit tourner un reportage sur la fête de la marmotte. Mais lorsqu\'il se réveille le lendemain, il découvre avec stupeur que la date n\'a pas changé et qu\'il est condamné à revivre un par un les événements de la veille. Connors se voit dès lors obligé de faire face à la répétition infinie du Jour de la marmotte.', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/kSdgmtOmxFxdiJqK1R3kfKBqRUo.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ttBydD0SynC0TMkW3AcnmsySkLp.jpg', 'https://www.youtube.com/embed/m8Z3PPOLvm8', 101, '1993', 3.8, 1),
(138, 'United States of America', 'Dracula', 'Renfield, chargé de conclure une transaction imobilière avec le comte Dracula, se rend dans son château des Carpathes, où l\'aristocrate, qui s\'avère être un vampire, va l\'hypnotiser pour le mettre sous ses ordres. Débarqué en Angleterre, Dracula ne tarde pas créer de nouveaux semblables parmi la société locale en commençant par la jeune Lucy, fille du directeur de l\'asile...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/hLA7d1FFaPM7DpeFZvWyCQ2UQ44.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cemjdP7HrUyJAry85vRT19Hidbi.jpg', 'https://www.youtube.com/embed/s0YoGSEp5FU', 75, '1931', 3.6, 1),
(139, 'Denmark', 'Mifune', 'Kresten, newly wed, is on the threshold of a great career success in his father-in-law´s company. But when the death of his own father takes him back to his poverty-stricken childhood home, far out in the country, his career plans fall apart. For one thing he has to deal with his loveable, backward brother, who is now all alone; for another, he meets a stunning woman who comes to the farm as a housekeeper, in disguise of her real profession as a call-girl.', 'Nimbus Film', 'https://image.tmdb.org/t/p/w1280/962ZZDr4FV3L46ZnurqIaZveL60.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//luPyx8j6pwIxaGzvWNSsUYGqdV0.jpg', 'https://www.youtube.com/embed/', 98, '1999', 3.45, 1),
(140, 'Spain', 'La Mauvaise Éducation', 'Deux garçons, Ignacio et Enrique, découvrent l\'amour, le cinéma et la peur dans une école religieuse au début des années soixante. Le père Manolo, directeur de l\'institution et professeur de littérature, est témoin et acteur de ces premières découvertes. Les trois personnages se reverront deux autres fois, à la fin des années 70 et en 1980. Cette deuxième rencontre marquera la vie et la mort de l\'un d\'entre eux.', 'Canal+ España', 'https://image.tmdb.org/t/p/w1280/uVklRuBl4pbM0YRO1OOVtfmHrXl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1tlXFhE6qnap6xvd4d4vzfHZpDZ.jpg', 'https://www.youtube.com/embed/39Xm-jSFlOk', 110, '2004', 3.69, 1),
(141, 'United States of America', 'Donnie Darko', 'Donnie Darko est un adolescent de seize ans pas comme les autres. Intelligent et doté d\'une grande imagination, il a pour ami Frank, une créature que lui seul peut voir et entendre. Lorsque Donnie survit par miracle à un accident, Frank lui propose un étrange marché. La fin du monde approche et ce dernier doit accomplir sa destinée. Des événements bizarres surviennent dans la petite ville tranquille, mais Donnie sait que derrière tout cela se cachent d\'inavouables secrets. Frank l\'aidera à les mettre à jour, semant ainsi le trouble au sein de la communauté.', 'Flower Films', 'https://image.tmdb.org/t/p/w1280/z3gIuT4e4tjCKYEYJChcBI44U21.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//msCHK5Kh1YbdZ0zPJ2nzPUhhSN9.jpg', 'https://www.youtube.com/embed/ZPPHqG1bd3k', 114, '2001', 3.89, 1),
(142, 'Canada', 'Le Secret de Brokeback Mountain', 'Été 1963, Wyoming. Deux jeunes cow-boys, Jack et Ennis, sont engagés pour garder ensemble un troupeau de moutons à Brokeback Mountain. Isolés au milieu d\'une nature sauvage, leur complicité se transforme lentement en une attirance aussi irrésistible qu\'inattendue. À la fin de la saison de transhumance, les deux hommes doivent se séparer. Ennis se marie avec sa fiancée, Alma, tandis que Jack épouse Lureen. Quand ils se revoient quatre ans plus tard, un seul regard suffit pour raviver l\'amour né à Brokeback Mountain.', 'Focus Features', 'https://image.tmdb.org/t/p/w1280/oyDdvdDZPcNNNOJJXNwmLDw9jGL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3KyAxlakmcyHWqlcxgIxMQnSilk.jpg', 'https://www.youtube.com/embed/', 128, '2005', 3.9, 1),
(143, 'United States of America', 'À l\'Ouest, rien de nouveau', 'Lors de la Première Guerre mondiale, Paul Bäumer et ses amis de classe d\'un lycée allemand se décident à s\'enrôler volontairement pour répondre aux harangues patriotiques de leur professeur.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/7xdlEb12Vaxh8qUMEWHZltHY4Fc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hSRb0YhB4TaeIKgZtQbFuY3l0XM.jpg', 'https://www.youtube.com/embed/', 131, '1930', 3.9, 1),
(144, 'France', 'Les Ailes du désir', 'Deux anges, Daniel et Cassiel, descendent du ciel à Berlin. Ils peuvent côtoyer les humains sans être vus... Ils rencontrent un ancien ange devenu humain qui peut sentir leur présence et leur communique sa foi dans l\'humanité. Daniel fait une autre rencontre qui sera pour lui décisive puisqu\'il tombe amoureux...', 'Argos Films', 'https://image.tmdb.org/t/p/w1280/w9zLpnXGjpO1oJ3J0iRNfZCbzr6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7TlGXrB4WQ3wbpOCUQnBXseCuOl.jpg', 'https://www.youtube.com/embed/', 128, '1987', 3.9, 1),
(145, 'Denmark', 'Breaking the Waves', 'Au début des années soixante-dix sur la côte nord-ouest de l’Écosse, la communauté d\'une petite ville célèbre à contrecœur le mariage de Bess, jeune fille naïve et pieuse, et de Jan, homme d\'âge mûr qui travaille sur une plate-forme pétrolière. Leur bonheur va être brisé par un accident qui va paralyser Jan.', 'Trust Film', 'https://image.tmdb.org/t/p/w1280/xWN0uwOJV11Hh5q1IAQmP8WK8cO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yCxuILdReGFK948mfUOAX75xb5Z.jpg', 'https://www.youtube.com/embed/', 159, '1996', 3.75, 1),
(146, 'China', 'Tigre et Dragon', 'Dans la Chine ancienne, Li Mu Bai est un virtuose des arts martiaux. Las des combats, il décide de confier « Destinée », son épée rapide et magique à Yu Shu Lien, à qui il n’ose pas avouer son amour. Celle‐ci doit remettre la fameuse épée au seigneur Té, à la résidence duquel elle fait la connaissance de Jiao Long, la fille du gouverneur Yu, qui a été promise à un homme qu’elle n’aime pas et ferait tout pour mener une vie aussi libre que Shu Lien. Mais une fois la nuit tombée, un habile voleur parvient à la lui dérober. Li et Shu Lien partent récupérer l’épée aux vertus magiques.', 'China Film Co-Production Corporation', 'https://image.tmdb.org/t/p/w1280/wegYCSQkY9KHX0ttONykOT2N5dW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ylZ06kRUF2JKkrCG2E3qn5D9w8L.jpg', 'https://www.youtube.com/embed/SXckO-tnYiA', 120, '2000', 3.7, 1),
(147, 'France', 'Les Quatre Cents Coups', 'Antoine a une adolescence turbulente. Il ment à ses parents indifférents à son sort, vole, fugue. Son seul réconfort, il fait les quatre cents coups avec son ami René. Un jour, la police s\'en mêle.', 'Les Films du Carrosse', 'https://image.tmdb.org/t/p/w1280/9y51Fk9VeihwWzuCdkLDeCnjfoO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//63HcRYJI4LKeo8sINlL71ZtlUFY.jpg', 'https://www.youtube.com/embed/vvTsT6AoG6s', 100, '1959', 4.04, 1),
(148, 'Spain', 'The Secret life of words', 'Un lieu isolé au milieu de la mer. Une plateforme pétrolière où ne vivent que des hommes, ceux qui y travaillent, et où vient d\'avoir lieu un accident. Une femme mystérieuse et solitaire, essayant d\'oublier son passé, débarque sur la plateforme pour soigner un homme qui a temporairement perdu la vue. Entre eux se crée une étrange intimité, un lien fait de secrets, tissé de vérités, de mensonges, d\'humour et de souffrance, qui ne les laissera pas indemnes et changera leur vie.', 'Hotshot Films', 'https://image.tmdb.org/t/p/w1280/5V7i63rodY56cGWmPATxumzj4xv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cuZgstgSwb5cv0Dq5RfPTxHcTeH.jpg', 'https://www.youtube.com/embed/iPAFnmmJf_Y', 112, '2005', 3.5, 1),
(149, 'Japan', 'Akira', 'Tetsuo, un adolescent ayant vécu une enfance difficile, est la victime d\'expériences visant à développer les capacités psychiques qui dorment en chacun de nous. Ainsi doté d\'une puissance que lui-même ne peut imaginer, Tetsuo décide de partir en guerre contre le monde qui l\'a opprimé. Dès lors, Il se retrouve au cœur d\'une légende populaire qui annonce le retour prochain d\'Akira, un enfant aux pouvoirs extra-ordinaires censé délivrer Tokyo du chaos...', 'MBS', 'https://image.tmdb.org/t/p/w1280/8fCn7TwTe0Z4fTugIiLssX6UcHe.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jkwVCMIkN3j284EPIDIGnskTd69.jpg', 'https://www.youtube.com/embed/_aIJOdIWFd0', 124, '1988', 3.97, 1),
(150, 'United States of America', '48 heures', 'Deux meurtriers sont pourchassés par la police, alors qu’ils recherchent le butin d’un casse commis par Reggie Hammond, un de leurs anciens complices actuellement emprisonné. Pour les retrouver, l’inspecteur de police Jack Cates a besoin de l’aide de Reggie. Il va le voir en prison pour solliciter sa collaboration mais Hammond négocie son aide contre une permission de sortie. Jack va donc faire en sorte que Reggie soit en liberté surveillée pendant 48 heures, durant lesquelles il va tenter de l’aider à retrouver ses anciens complices...', 'Paramount', 'https://image.tmdb.org/t/p/w1280/wBHFB1D0rDWyEEvHS5ZlsxB5XQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xQTSGz5dvIAYFssPWhD160AcR7Z.jpg', 'https://www.youtube.com/embed/', 96, '1982', 3.34, 1),
(152, 'United States of America', 'Star Trek, le film', 'Une entité d\'origine extra-terrestre sans précédent se dirige vers la Terre en détruisant tout sur son passage. L\'équipage de l\'USS Enterprise est chargé de stopper ce nouvel ennemi. Alors que le capitaine Decker se prépare à diriger la mission, il est relevé de ses fonctions et remplacé par le fameux amiral Kirk, absent des commandes du vaisseau depuis trois ans…', 'Paramount', 'https://image.tmdb.org/t/p/w1280/1DoTP6ooOTHQetVSYmc5muZnqdv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tdEsBRophyizObx5ABwJkOUQHOA.jpg', 'https://www.youtube.com/embed/wpZwPpxlfRk', 130, '1979', 3.24, 1),
(153, 'Japan', 'Lost in Translation', 'Bob Harris, acteur sur le déclin, se rend à Tokyo pour tourner un spot publicitaire. Il a conscience qu\'il se trompe - il devrait être chez lui avec sa famille, jouer au théâtre ou encore chercher un rôle dans un film -, mais il a besoin d\'argent. Du haut de son hôtel de luxe, il contemple la ville, mais ne voit rien. Il est ailleurs, détaché de tout, incapable de s\'intégrer à la réalité qui l\'entoure, incapable également de dormir à cause du décalage horaire. Dans ce même établissement, Charlotte, une jeune Américaine fraîchement diplômée, accompagne son mari, photographe de mode. Ce dernier semble s\'intéresser davantage à son travail qu\'à sa femme. Se sentant délaissée, Charlotte cherche un peu d\'attention. Elle va en trouver auprès de Bob...', 'American Zoetrope', 'https://image.tmdb.org/t/p/w1280/bUDD5bfF5EHzBwPhL9iJeZuHjVE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//45He7gApNQyDbqCDjxew9BnHzjf.jpg', 'https://www.youtube.com/embed/6OHMAyuLD-M', 102, '2003', 3.7, 1),
(154, 'United States of America', 'Star Trek II : La colère de Khan', 'À bord de l\'USS Enterprise, vaisseau de la Fédération des Planètes Unies, l\'amiral James T. Kirk accomplit une mission d\'inspection de routine. Il reçoit un appel urgent du laboratoire spatial Regular One. Khan, brillant renégat et vieil ennemi de Kirk, s\'est emparé d\'un dispositif ultrasecret : le projet « Genesis ». À la tête d’une bande de surhommes génétiquement améliorés, Khan menace l’Univers entier…', 'Paramount', 'https://image.tmdb.org/t/p/w1280/avb0wORx5CzhSfs0ZnKh1UeBsya.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oXs8kp1oX5N0Mte6U8UUAwmLwt6.jpg', 'https://www.youtube.com/embed/', 113, '1982', 3.73, 1),
(155, 'United Kingdom', 'The Dark Knight : Le Chevalier noir', 'La suite de Batman Begins, The Dark Knight, le réalisateur Christopher Nolan et l\'acteur Christian Bale, qui endosse à nouveau le rôle de Batman/Bruce Wayne dans sa guerre permanente contre le crime. Avec l\'aide du Lieutenant de Police Jim Gordon et du Procureur Harvey Dent, Batman entreprend de démanteler définitivement les organisations criminelles de Gotham. L\'association s\'avère efficace, mais le trio se heurte bientôt à un nouveau génie du crime, plus connu sous le nom du Joker, qui va plonger Gotham dans l\'anarchie et pousser Batman à la limite entre héros et assassin. Heath Ledger interprète Le Joker : le méchant suprême et Aaron Eckhart joue le rôle de Dent. Maggie Gyllenhaal complète le casting en tant que Rachel Dawes. De retour après Batman Begins, Gary Oldman est à nouveau Gordon, Michael Caine interprète Alfred, et Morgan Freeman est Lucius Fox.', 'DC Comics', 'https://image.tmdb.org/t/p/w1280/pyNXnq8QBWoK3b37RS6C3axwUOy.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pbEkjhdfP7yuDcMB78YEZwgD4IN.jpg', 'https://www.youtube.com/embed/XGqgxGBn7Qw', 152, '2008', 4.25, 1),
(156, 'Denmark', 'Wilbur begår selvmord', '', 'Les Films du Losange', 'https://image.tmdb.org/t/p/w1280/bRrHJbr8kMb849IKBZ0RBk2Vmte.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2bCcbNyB1g5F8CXqABo0JsNig73.jpg', 'https://www.youtube.com/embed/', 111, '2002', 3.25, 1),
(157, 'United States of America', 'Star Trek III : À la recherche de Spock', 'Le capitaine Kirk et son équipage volent l\'USS Enterprise pour tenter de récupérer le corps de Spock, qui s\'est sacrifié lors du combat contre Khan.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/a4U4it6vaTSqUDaQMXzujTIvu01.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5lUpy6OrDhzdeAGBaM1mIsQvfOl.jpg', 'https://www.youtube.com/embed/', 95, '1984', 3.31, 1),
(158, 'Germany', 'Paradis Express', 'Martin Brest et Rudi Wurlitzer, deux malades atteints d\'un cancer et qui se savent condamnes, s\'enfuient de l\'hopital. Ils veulent realiset le reve de Rudi: voir la mer. Ils volent une voiture. Ils ignorent qu\'elle appartient a la mafia et qu\'elle est bourree d\'argent. Et les voila poursuivis par les policiers, les truands et leur angoisse de la mort.', 'Mr. Brown Entertainment', 'https://image.tmdb.org/t/p/w1280/9pTUCXcMDZurDmZRtOrnk9mjSFH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yXnlw2SB0QhYUC4QDyuRZh3CQlU.jpg', 'https://www.youtube.com/embed/', 90, '1997', 3.82, 1),
(159, 'Germany', 'Maybe... Maybe Not', 'Der Bewegte Mann is a German comedy about a heterosexual man, Axel, who is thrown out of his girlfriends home for cheating and ends up moving in with a gay man. Axel learns the advantages of living with gay men even though they are attracted to him and when his girlfriend wants him back he must make a tough decision.', 'Constantin Film', 'https://image.tmdb.org/t/p/w1280/2TcZBHcseRXLxNq2RXnKIsbKZwi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1BMnXAAMbGN8N1xm2ZvlSVVUQiy.jpg', 'https://www.youtube.com/embed/BzoHTJdzniQ', 90, '1994', 3.1, 1),
(160, 'France', 'L\'arrivée d\'un train à La Ciotat', 'L\'arrivée d\'un train en gare de La Ciotat, ou L\'arrivée d\'un train à La Ciotat, est un film français réalisé par Louis Lumière en 1895, sorti en janvier 1896, dont il existe plusieurs versions.', 'Lumière', 'https://image.tmdb.org/t/p/w1280/y3A15HpugKsPjVyxKa9POLTEX6B.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uusNog5m2aCuL53rrKw8RaBnprb.jpg', 'https://www.youtube.com/embed/3RYNThid23g', 1, '1897', 3.55, 1),
(161, 'United States of America', 'Ocean\'s Eleven', 'A peine sorti de prison, Danny Ocean n\'a qu\'une idée en tête : organiser le casse du siècle en cambriolant les trois plus grands casinos de Las Vegas. Pour cela il réunit une équipe de malfrats spécialistes dans des domaines aussi variés que les explosifs, l\'informatique, le bluff...', 'Village Roadshow Pictures', 'https://image.tmdb.org/t/p/w1280/lO5u6krhCeYXG7HVjfnimWOrdSs.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//boI3myFhWBvQcru4zZ15aJ0u3CX.jpg', 'https://www.youtube.com/embed/tW_PZKjKLR4', 116, '2001', 3.7, 1),
(162, 'United States of America', 'Edward aux mains d\'argent', 'Edward n’est pas un garçon ordinaire. Création d’un inventeur, il a reçu un cœur pour aimer, un cerveau pour comprendre. Mais son concepteur est mort avant d’avoir pu terminer son œuvre et Edward se retrouve avec des lames de métal et des instruments tranchants en guise de doigts.', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/tMCj9KY70NasF2KsiXWpg0m7smK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uNLIMPxknsV4n3IAEDpS1iqF5dm.jpg', 'https://www.youtube.com/embed/XdL1oR_L5EM', 105, '1990', 3.86, 1),
(163, 'United States of America', 'Ocean\'s Twelve', 'Trois ans ont passé depuis le braquage historique du casino Bellagio de Las Vegas. Depuis, Danny Ocean et ses associés se sont dispersés dans la nature avec l\'intention de mener une existence honnête. Remarié à Tess, ce dernier joue profil bas jusqu\'au jour où Terry Benedict retrouve sa trace. Le propriétaire du Bellagio n\'y va pas par quatre chemins: la bande doit, sous peine de mort, lui restituer le magot. Et ce n\'est qu\'un début, car quelqu\'un d\'autre s\'intéresse de très près aux agissements de la bande des Onze...', 'Village Roadshow Pictures', 'https://image.tmdb.org/t/p/w1280/iOiVwflPyS6U8Tz2r43bZo165MM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5b5HrewiViLWEdMR4dmbd7ajQ8Q.jpg', 'https://www.youtube.com/embed/uEzvY9z3pvc', 125, '2004', 3.28, 1),
(164, 'United States of America', 'Diamants sur canapé', 'Holly Golightly est une délicieuse call-girl très en vue à New York, déterminée à se marier à un milliardaire brésilien. Son voisin est un jeune écrivain entretenu par une riche décoratrice. D’une relation amicale va naître une forte passion entre ces deux êtres si différents. Une nouvelle fois Audrey Hepburn illumine l’écran de son charme dans cette comédie de Blake Edwards, adaptée du best-seller de Truman Capote (Breakfast at Tiffany’s). Henry Mancini remporta l’Oscar® pour la chanson «Moon River».', 'Paramount', 'https://image.tmdb.org/t/p/w1280/nauABSXgv994NIlqWlMtuV51eqj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jXZ2tyJl44yKvh22I6ooQwU5rFM.jpg', 'https://www.youtube.com/embed/', 120, '1961', 3.85, 1),
(165, 'United States of America', 'Retour vers le futur II', 'En 1985, Marty McFly a retrouvé sa famille et sa petite amie après un voyage mouvementé dans le passé. Surgit alors Doc Brown, au volant de sa machine à explorer le temps. Il lui enjoint de le suivre dans le futur, en l\'an 2015, pour secourir son fils tombé sous la coupe du sinistre Biff Tannen.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/fnjqN51P5rF9vslU9W21SDUNt9N.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//iGkZLNllCJH9QqKIAIkg5NSy8I6.jpg', 'https://www.youtube.com/embed/p72KZB36bKw', 108, '1989', 3.88, 1),
(166, 'France', 'La Boum', 'Vic, treize ans, inscrite au lycée Henri-IV, est à l\'âge des premières sorties et des premiers émois. Vic n\'a guère l\'occasion de parler avec ses parents, trop occupés par leur carrière respective, et dont le couple subit les assauts classiques du temps. Elle se confie donc à son arrière-grand-mère, la pétillante Poupette, ou à sa meilleure amie, Pénélope. Elle partagera donc avec elles son amour pour le beau Mathieu. Mais cet amour-là aussi connaîtra quelques difficultés...', 'Productions Marcel Dassault', 'https://image.tmdb.org/t/p/w1280/qxIbrx8xQuRAoceifhKhAldi5k9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9B3NnLM7Uct4eSB5Th9aqVQa8uT.jpg', 'https://www.youtube.com/embed/uqKKiUSLZK8', 110, '1980', 3.3, 1),
(167, 'Germany', 'K-Pax, l\'homme qui vient de loin', 'Un jour, un homme surgit de nulle part dans la gare centrale de New York. L\'air avenant, les yeux dissimulés derrière d\'épaisses lunettes noires, cet inconnu prétend être originaire d\'une planète lointaine : K-Pax. Sourire aux lèvres, il se laisse embarquer sans résistance par la police, qui le conduit à la clinique psychiatrique de Manhattan. Le docteur Mark Powell, directeur de l\'établissement, est un habitué des cas de dédoublement de personnalité. Mais le patient Prot l\'intrigue et il veut en savoir davantage sur cet homme aux affirmations loufoques. Ce dernier s\'accroche obstinément à son délire et brosse à qui veut l\'entendre un tableau idyllique de K-Pax, ses mœurs pacifiques et son haut niveau culturel. Au fur et à mesure de ses entretiens, le docteur Powell en vient à se demander s\'il n\'y aurait pas un fond de vérité dans ses histoires d\'extraterrestres.', 'Intermedia Films', 'https://image.tmdb.org/t/p/w1280/cqELHObWTl4KhvRyuEZQAe5HJJE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//PWszEgzNetOHY458udSVYRKRcb.jpg', 'https://www.youtube.com/embed/lS9NAEV1Mhk', 121, '2001', 3.6, 1),
(168, 'United States of America', 'Star Trek IV : Retour sur terre', 'À l\'issue de la mission sur Genesis, l\'équipe de l\'Enterprise fait route vers la Terre à bord d\'un vaisseau klingon. Au même moment, une sonde d\'origine inconnue se dirige vers la Terre.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/c1feYVjxUb8QGdVxsmt7Q2FIzc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wN3dgwkiWSLrMVukPQIeccv5EJ6.jpg', 'https://www.youtube.com/embed/', 119, '1986', 3.59, 1),
(169, 'United States of America', 'Predator 2', 'Le lieutenant Mike Harrigan est un flic de Los Angeles. Lorsqu\'une fusillade éclate entre des trafiquants de drogue mettant ainsi les rues de la ville à feu et à sang, Mike et son équipe se préparent à intervenir... Mais soudain, les gangsters sont liquidés un par un d\'une horrible manière par une créature invisible. Commence alors pour Mike une enquête sanglante qui va le conforter à un monstre extraterrestre qui a pris la ville de Los Angeles pour terrain de chasse !', 'Davis Entertainment', 'https://image.tmdb.org/t/p/w1280/40hVOA8hljQI2aUDyuJxla1syDC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7PoWlbQg7ZxgwofFRrkytvpLvJD.jpg', 'https://www.youtube.com/embed/l_KdfzXlrps', 108, '1990', 3.12, 1),
(170, 'United Kingdom', '28 Days Later', 'Twenty-eight days after a killer virus was accidentally unleashed from a British research facility, a small group of London survivors are caught in a desperate struggle to protect themselves from the infected. Carried by animals and humans, the virus turns those it infects into homicidal maniacs -- and it\'s absolutely impossible to contain.', 'DNA Films', 'https://image.tmdb.org/t/p/w1280/sQckQRt17VaWbo39GIu0TMOiszq.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//veUl0QT8swshQ9Dz0fQ1k6ZkthD.jpg', 'https://www.youtube.com/embed/iTfb_uqA9XM', 113, '2002', 3.6, 1),
(171, 'France', 'La Boum 2', 'Deux ans après La Boum, Vic, maintenant âgée de 15 ans et demi entre en classe de seconde au lycée Henri IV. Cela fait maintenant un an qu\'elle n\'est pas \"sortie\" avec un garçon. Dans le train, en rentrant d\'Autriche avec Poupette, sa formidable arrière grand-mère, elle échange accidentellement son passeport avec celui de Philippe, un jeune garçon de 18 ans dont elle va vite tomber amoureuse. Vraiment amoureuse. Par les jeux de l\'amour, ne mettra t-elle pas en péril son histoire avec lui ? Palpitant et plein de suspense.', 'Productions Marcel Dassault', 'https://image.tmdb.org/t/p/w1280/x2oI5CA7lzGwY9NzZCCmZXzFBz7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3oNDTUxv2lLWMqt5R12A0vM5dBn.jpg', 'https://www.youtube.com/embed/NnHZuv7ITic', 103, '1982', 3.2, 1),
(172, 'United States of America', 'Star Trek V : L\'ultime frontière', 'En 2287, le capitaine Kirk et son équipage prennent sur Terre des vacances bien méritées... Mais lorsqu\'ils apprennent que le Vulcain Sybok, demi-frère de Spock, vient de prendre en otage des diplomates venus cohabiter sur la planète Nimbus III, nos héros remontent à bord de l\'Enterprise...', 'Paramount', 'https://image.tmdb.org/t/p/w1280/4hnWJzZO0SHZkg8OLDNCIhIAPdi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//y0klN15XPVyYtd4P7HYecgJXSsZ.jpg', 'https://www.youtube.com/embed/', 107, '1989', 2.87, 1),
(173, 'United States of America', '20 000 Lieues sous les mers', 'En 1868, un monstre mystérieux s\'acharne sur les bateaux naviguant dans l\'océan Pacifique. Alarmé par ce phénomène, le gouvernement américain arme une frégate. Ned, un fabuleux harponneur, Aronnax, un homme de science et son assistant partent à la recherche du supposé monstre marin...', 'Walt Disney Productions', 'https://image.tmdb.org/t/p/w1280/h3H1uaEo831THipKE4H30shwFLS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pIBZpX9H6U6Nk6gbyWTD4rFKEqq.jpg', 'https://www.youtube.com/embed/oOxILnRqKGI', 127, '1954', 3.54, 1),
(174, 'United States of America', 'Star Trek VI : Terre inconnue', 'Alors que Spock, le capitaine Kirk et l\'équipage de l\'USS Enterprise escortent le chancelier Gordon jusqu\'au centre de conférence où il doit signer un accord de paix avec l\'Empire klingon, leur vaisseau est attaqué et le chancelier est abattu. Chang, un général Klingon, accuse Kirk, qu\'il envoie en compagnie de McCoy sur l\'astre de glace Rura Penthe. Spock ne dispose que de quelques jours pour sauver son ami et rétablir la paix menacée.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/gGYIfEDqKwPttvrhkbmtvyPEAd.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lcQRSqOCkWkJSwF6xSYXAoOhaAF.jpg', 'https://www.youtube.com/embed/', 110, '1991', 3.51, 1),
(175, 'France', 'Le Grand Bleu', 'C\'est l\'histoire de deux apnéistes, Jacques Mayol et Enzo Molinari. Leur aventure commence dans les îles grecques dès les années 50. Gamins, les deux plongeurs se disputent déjà tous les records des profondeurs. Vingt ans plus tard, ils se retrouvent concurrents au même championnat. «Le grand bleu», c\'est l\'amitié de ces deux hommes, liés définitivement à la mer.', 'Gaumont', 'https://image.tmdb.org/t/p/w1280/44QEkafepQe753YDu3Z1JtWYQJE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2oum8FkgH1AiDWhmhEw8nbtoHdJ.jpg', 'https://www.youtube.com/embed/', 168, '1988', 3.74, 1),
(176, 'United States of America', 'Saw', 'Deux hommes se réveillent enchaînés au mur d’une salle de bains. Ils ignorent où ils sont et ne se connaissent pas. Ils savent juste que l’un doit absolument tuer l’autre, sinon dans moins de huit heures, ils seront exécutés tous les deux… Voici l’une des situations imaginées par un machiavélique maître criminel qui impose à ses victimes des choix auxquels personne ne souhaite jamais être confronté un jour. Un détective est chargé de l’enquête…', 'Twisted Pictures', 'https://image.tmdb.org/t/p/w1280/3fhUaMnlY72GGuBlzEeKA4brZAb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ok4ot3YbfDYZcINXf91JUfq3maB.jpg', 'https://www.youtube.com/embed/HKPy5RWuqNA', 103, '2004', 3.7, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(177, 'United States of America', 'Fisher King : Le Roi Pêcheur', 'Jack, cynique et célèbre présentateur de radio en rupture de ban, est sauvé de l\'attaque d\'une bande de loubards par Henry, clochard ex-professeur de lettres, dont la femme fut la victime d\'un auditeur trop attentif de Jack. Ensemble ils partent à la recherche du bonheur...', 'TriStar Pictures', 'https://image.tmdb.org/t/p/w1280/mxa3jxsWgiCgidF49X4VRo4GnwU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//iqaQP6bYnwRGxdVBORppFS1TQWj.jpg', 'https://www.youtube.com/embed/zyKILTuhFFg', 137, '1991', 3.64, 1),
(178, 'United States of America', 'Blown Away', 'Jimmy Dove, spécialiste du déminage, est un des meilleurs éléments de la police de Boston. Mais en réalité il a fuit l\'Irlande après avoir provoqué un massacre - chez ses amis séparatistes - en voulant prévenir un attentat. Des années plus tard, son ancien chef débarque, bien décidé à se venger...', 'Trilogy Entertainment Group', 'https://image.tmdb.org/t/p/w1280/zrLF53nrmI7ZQi6eoKDbo3cF2xt.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fmSeUzAcBPOBXeaJIQ11hACwfsj.jpg', 'https://www.youtube.com/embed/', 121, '1994', 3.05, 1),
(179, 'France', 'L’Interprète', 'Silvia Broome est une brillante interprète new-yorkaise de l\'Onu. Par hasard, elle surprend une conversation évoquant l\'assassinat imminent du président africain Zuwanie. Comme ce dictateur doit bientôt venir rendre des comptes devant les Nations unies sur les méfaits de son régime totalitaire, Silvia avertit la police. Mais elle se heurte à Tobin Keller, un agent du FBI très sceptique, qui préfère vérifier minutieusement son témoignage. Lorsqu\'un photographe français connaissant bien les exactions de Zuwanie disparaît après le rendez-vous que Silvia lui avait donné, Keller se demande à qui il peut faire confiance...', 'Mirage Enterprises', 'https://image.tmdb.org/t/p/w1280/e2oWzbhxfqAlJ83ea38D64VD1RR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//A5mBIAtZOqVpAVUXolwtOnaQcZc.jpg', 'https://www.youtube.com/embed/hWTsvfq2bcg', 120, '2005', 3.15, 1),
(180, 'United States of America', 'Minority Report', 'À Washington, en 2054, la société du futur a éradiqué le meurtre en se dotant du système de prévention / détection / répression le plus sophistiqué du monde. Dissimulés au cœur du Ministère de la Justice, trois extra‐lucides captent les signes précurseurs des violences homicides et en adressent les images à leur contrôleur, John Anderton, le chef de la « Précrime » devenu justicier après la disparition tragique de son fils. Celui‐ci n’a alors plus qu’à lancer son escouade aux trousses du « coupable » … Mais un jour se produit l’impensable : l’ordinateur lui renvoie sa propre image. D’ici 36 heures, Anderton aura assassiné un parfait étranger. Devenu la cible de ses propres troupes, Anderton prend la fuite. Son seul espoir pour déjouer le complot : dénicher sa future victime. Sa seule arme : les visions parcellaires, énigmatiques, de la plus fragile des Pré‐Cogs : Agatha.', 'Digital Image Associates', 'https://image.tmdb.org/t/p/w1280/hb0cri8EVIWbiKbumXOkrl1ethM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qq4H9JfBKQ5DarMLI6lhUQjn9D7.jpg', 'https://www.youtube.com/embed/V0Ay_CB9quU', 145, '2002', 3.67, 1),
(182, 'United States of America', 'The Good German', 'En 1945, le correspondant de guerre américain Jake Geismer débarque à Berlin pour couvrir la conférence de Postdam où les Alliés décideront du sort de l\'Allemagne vaincue, parleront de l\'avenir de l\'Europe… et se disputeront âprement les restes du gâteau. Quelques années plus tôt, Jake dirigeait une agence de presse à Berlin et eut dans cette ville une liaison avec la belle Lena, mais tout cela semble bien éloigné, car la guerre a souillé, meurtri et ravagé ce que chacun avait de plus de cher. Le chauffeur de Geismer, le caporal Tully, est l\'un de ces profiteurs, rompus à toutes les combines, livrant dans chaque secteur de Berlin petits secrets et produits de contrebande. Plus triste, il est devenu l\'amant de Lena. Lorsque Tully se fait tuer dans le secteur russe, en possession de 100 000 marks, Jake est aussi surpris que choqué de voir les Américains et les Russes classer l\'affaire en un clin d\'œil. Il décide d\'élucider cette mort mystérieuse.', 'Sunset Gower Studios', 'https://image.tmdb.org/t/p/w1280/3LjHC2CWDkzoiPehf3GViujws0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fH0jyQWw3lEBvEaqUycgEUow9aq.jpg', 'https://www.youtube.com/embed/', 105, '2006', 2.9, 1),
(183, 'United States of America', 'Videokid', 'Corey et Jimmy sont séparés depuis le divorce de leurs parents. Jimmy est mentalement instable depuis la mort de sa soeur quand il était petit. Un jour Corey découvre que son frère a un don pour les jeux vidéo...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/dXvG7MVcmZJC8xkLtPV3ruriNfp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gE0MLnPzXHoAJIogLhsqt0RW39R.jpg', 'https://www.youtube.com/embed/', 100, '1989', 3, 1),
(184, 'United States of America', 'Jackie Brown', 'Hôtesse de l’air, Jackie Brown arrondit ses fins de mois en convoyant de l’argent liquide pour le compte de Ordell Robbie, trafiquant d’armes. Quand la police et le FBI lui signifient qu’ils comptent sur elle pour faire tomber Robbie, Jackie Brown échafaude un plan audacieux.', 'Miramax', 'https://image.tmdb.org/t/p/w1280/9kXL2QGonp0D2ipqoKxEpTK8XRS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mXELcGjyU0osFfUCiz1YdAn470M.jpg', 'https://www.youtube.com/embed/7TnOf2AWRMo', 150, '1997', 3.68, 1),
(185, 'United Kingdom', 'Orange Mécanique', 'Au XXIe siècle, où règnent la violence et le sexe, Alex, jeune chef de bande, exerce avec sadisme une terreur aveugle. Après son emprisonnement, des psychanalystes l\'emploient comme cobaye dans des expériences destinées à juguler la criminalité…', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/n2oKNiEq9DZljqs6xsxs8hnsW9p.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bR4U9n9YnZOvBUhOUNl316UNEyh.jpg', 'https://www.youtube.com/embed/Tys3BFPmxIg', 136, '1971', 4.11, 1),
(186, 'Canada', 'Slevin', 'La vie n\'est pas tendre avec Slevin. En quelques jours, ce jeune homme a perdu son appartement, découvert que sa petite amie le trompait, et s\'est fait voler ses papiers. Décidé à souffler un peu, Slevin s\'envole vers New York, où il va habiter quelque temps l\'appartement d\'un copain, Nick Fisher. La poisse ne va pas le lâcher pour autant, bien au contraire...Le milieu new-yorkais est en ébullition. Deux de ses plus grands parrains, le Rabbin et le Boss, se livrent une guerre sans pitié. Autrefois complices, ils sont devenus les pires ennemis. Pour venger l\'assassinat de son fils, le Boss est décidé à faire tuer celui du Rabbin. Il a chargé Goodkat de l\'affaire. Celui-ci a un plan très simple : trouver quelqu\'un qui doit énormément d\'argent au Boss et l\'obliger à exécuter la besogne en échange d\'une annulation de dette. Le candidat idéal est... Nick Fisher...', 'The Weinstein Company', 'https://image.tmdb.org/t/p/w1280/oa5sB5LJ5m0ViumwmMAatJee42H.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ShDHEWiJ4NL6ldn4W2m3bEkIBr.jpg', 'https://www.youtube.com/embed/RCfyKy4EEv4', 110, '2006', 3.74, 1),
(187, 'United States of America', 'Sin City', 'Sin City est une ville infestée de criminels, de flics ripoux et de femmes fatales. Hartigan s’est juré de protéger Nancy, une strip‐teaseuse qui l’a fait craquer. Marv, un marginal brutal mais philosophe, part en mission pour venger la mort de son unique véritable amour, Goldie. Dwight est l’amant secret de Shellie. Il passe ses nuits à protéger Gail et les filles des bas quartiers de Jackie Boy, un flic pourri, violent et incontrôlable. Certains ont soif de vengeance, d’autres recherchent leur salut. Bienvenue à Sin City, la ville du vice et du péché.', 'Dimension Films', 'https://image.tmdb.org/t/p/w1280/rrS6R9Reqiev2BbyYWpGiZUpslk.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lt1rGQSqhk2T2T4lHo6CTQYvoWP.jpg', 'https://www.youtube.com/embed/-vWkWeuGoN0', 123, '2005', 3.72, 1),
(189, 'United States of America', 'Sin City : J\'ai tué pour elle', 'Dans une ville où la justice est impuissante, les plus désespérés réclament vengeance, et les criminels les plus impitoyables sont poursuivis par des milices.  Marv se demande comment il a fait pour échouer au milieu d\'un tas de cadavres. Johnny, jeune joueur sûr de lui, débarque à Sin City et ose affronter la plus redoutable crapule de la ville, le sénateur Roark. Dwight McCarthy vit son ultime face-à-face avec Ava Lord, la femme de ses rêves, mais aussi de ses cauchemars. De son côté, Nancy Callahan est dévastée par le suicide de John Hartigan qui, par son geste, a cherché à la protéger. Enragée et brisée par le chagrin, elle n\'aspire plus qu\'à assouvir sa soif de vengeance. Elle pourra compter sur Marv…  Tous vont se retrouver au célèbre Kadie\'s Club Pecos de Sin City…', 'Residaco', 'https://image.tmdb.org/t/p/w1280/1shNoqbuWxJ4lJwcU2J0rOHZ83V.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//f4KiaxSD5B8bcg5VLsvrDhaZlFu.jpg', 'https://www.youtube.com/embed/XVjDcUCui0w', 102, '2014', 3.18, 1),
(220, 'United States of America', 'À l\'est d\'Eden', '1914. Adam Trask exploite ses terres à Salinas Valley, aidé par ses deux fils, Cal et Aaron. Tous deux croient que leur mère est morte. Cal est persuadé que son père ne l\'aime pas. Un jour, il apprend que sa mère n\'est pas morte mais qu\'elle tient une maison close. Dès lors, ses rapports avec son père vont se dégrader de plus en plus.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/h6GqJiBbrqVzbp0DUYar2xJZYST.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//u7i1XtbOubq0xwRy2Zbgmox6g9W.jpg', 'https://www.youtube.com/embed/m67qFpHG0GE', 117, '1955', 3.8, 1),
(221, 'United States of America', 'La Fureur de vivre', 'Jim Stark est le petit nouveau au lycée. Un jeune homme accablé de problèmes familiaux et brimé par ses camarades mais qui n\'aspire qu\'à se faire une place parmi ses camarades. Entraîné malgré lui dans un défi de vitesse face à Buzz, chef d\'un groupe un peu rebelle, ce dernier y perdra la vie. Suite à ce drame, Jim est entraîné dans une spirale de violence.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/7Ve2oZJ8QBUhlMgzPMYkJQtORNX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jPXsPciwlPTG756CHkZt2jYpnNM.jpg', 'https://www.youtube.com/embed/vwUMGJcOaIw', 111, '1955', 3.79, 1),
(222, 'Germany', 'Berlin, symphonie d\'une grande ville', 'Ce film nous montre une journée à Berlin, au rythme de cette époque, commençant au petit matin et se terminant dans la nuit la plus profonde', 'Deutsche Vereinsfilm AG', 'https://image.tmdb.org/t/p/w1280/k51sXmhS86p9he46RjYdTLCdQMn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oJhrCtF4CbFPvAn7hGdT6QyFu8R.jpg', 'https://www.youtube.com/embed/', 62, '1927', 3.86, 1),
(223, 'United States of America', 'Rebecca', 'Mrs. Edythe Van Hopper, respectable veuve déjà âgée, accompagnée de sa jeune demoiselle de compagnie, est en villégiature à Monte-Carlo dans l\'hôtel Côte-d\'Azur, lorsque leur chemin croise celui de Maxim de Winter, riche veuf, qui n\'a aucun mal à séduire la jeune fille et, dans la foulée, à l\'épouser et l\'emmener dans sa demeure ancestrale de Manderley, quelque part sur la côte sud-est de l\'Angleterre. Les premiers contacts avec le personnel du château, régenté par la peu amène gouvernante Mrs. Danvers, sont glaciaux. Cette dernière, en effet, attachée depuis toujours au service de la précédente Mrs. de Winter, Rebecca, et lui vouant une passion sans limite, même à titre posthume, n\'accepte pas l\'intrusion de l\'« usurpatrice ». Le souvenir de l\'épouse disparue et vénérée continue de hanter le château sombre.', 'Selznick International Pictures', 'https://image.tmdb.org/t/p/w1280/6bHIZsfMDhuRUOCeJwOsp0RZRke.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jKgLVAhoq4fXBs1C9Gjvap93fxd.jpg', 'https://www.youtube.com/embed/', 130, '1940', 3.95, 1),
(224, 'Poland', 'L\'Homme de marbre', 'Agnieszka est persuadée que son idée est la bonne : réaliser un reportage sur Mateusz Birkut, ce jeune maçon devenu héros national dans les années 50, dont elle a retrouvé une statue abandonnée. Son directeur d\'études tente de la dissuader, mais la jeune femme s\'obstine et finit par découvrir le dessous des cartes. Un cinéaste réputé, Burski, lui raconte comment Birkut a conquis sa gloire, en posant 30 000 briques en une journée. D\'autres témoins, elle apprend que son exploit lui a valu la haine d\'autres ouvriers...', 'Zespól Filmowy \"X\"', 'https://image.tmdb.org/t/p/w1280/cRrWaVNGTxrDDaH2izNKBw2K2RW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8BpYPAmba2ozCxnQbJTnNmkwsoU.jpg', 'https://www.youtube.com/embed/', 165, '1977', 3.5, 1),
(225, 'Poland', 'L\'Homme de fer', 'Suite de \"l\'Homme de marbre\", l\'homme de fer raconte l\'épopée d\'un étudiant devenu ouvrier pendant les grèves des chantiers navals de Gdansk.', 'Film Polski', 'https://image.tmdb.org/t/p/w1280/2FlIwfhRyiJXVgZwjfUSIEeWCmD.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//row4sMw5mVzKCWRbyrAQ39zvyLX.jpg', 'https://www.youtube.com/embed/', 153, '1981', 3.4, 1),
(226, 'United States of America', 'Boys Don\'t Cry', 'Teena Brandon, une jeune adolescente du Nebraska, assume mal sa condition de fille. Elle déménage à Falls City et devient Brandon, un garcon aux cheveux courts, très vite adopté par une bande de désoeuvrés. Teena-Brandon s\'intègre au groupe mais reste toujours prisonnière de cette crise d\'identité sexuelle qui l\'a hantée sa vie entière. Elle tombe amoureuse de Lana, la petite amie de John. En découvrant la vérité sur Teena, ce dernier entre dans une rage meurtrière. D\'après un fait divers authentique.', 'IFC Films', 'https://image.tmdb.org/t/p/w1280/qzRTq6IgMU2RFtXb1kNQZdfs4Hu.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cFGE7Bx9ur6nAuc5v4x9If99Ugy.jpg', 'https://www.youtube.com/embed/', 114, '1999', 3.72, 1),
(227, 'United States of America', 'Outsiders', 'En 1966, dans la petite ville de Tulsa en Oklahoma. Ponyboy, Sodapop et Darrel appartiennent à la bande des Greasers, des jeunes délinquants issus des quartiers défavorisés. Leurs rivaux sont les Socs, des fils de bourgeois. Suite à une bagarre violente, Ponyboy et Johnny tentent d\'échapper à la police.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/lR2mvwGITF1CzIRHLk3QVEMzEsG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zE4QhjqT7Nr9Y0LPYaPtKHhM3GR.jpg', 'https://www.youtube.com/embed/IVRTWPPvtyU', 91, '1983', 3.63, 1),
(228, 'Germany', 'The Blue Angel', 'Prim professor Immanuel Rath finds some of his students ogling racy photos of cabaret performer Lola Lola and visits a local club, The Blue Angel, in an attempt to catch them there. Seeing Lola perform, the teacher is filled with lust, eventually resigning his position at the school to marry the young woman. However, his marriage to a coquette -- whose job is to entice men -- proves to be more difficult than Rath imagined.', 'UFA', 'https://image.tmdb.org/t/p/w1280/3FStCU5ipNGmwASfHVP282IO39z.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vzkueeO7XwkziTDla4ncF6H4laQ.jpg', 'https://www.youtube.com/embed/', 108, '1930', 3.67, 1),
(229, 'United States of America', 'La Fiancée de Frankenstein', 'Le Dr Frankenstein et sa créature ont survécu. Un savant fou, le Dr Pretorius, kidnappe la femme du Dr Frankenstein, et l\'oblige à tenter de nouveau l\'horrible expérience, dans le but cette fois de créer un monstre féminin...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/bacvNvhA3vAKFtSnzmNizrSY3MQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//haPU3dCyYUTRN34ceyJrX4DAjZq.jpg', 'https://www.youtube.com/embed/gJoE3AIHTjU', 74, '1935', 3.78, 1),
(231, 'United States of America', 'Syriana', 'L\'héritier du trône d\'un émirat arabe, le Prince Nasir, réformiste et progressiste, décide d\'accorder les droits de forage de gaz naturel à une compagnie chinoise, au détriment du géant texan Connex Oil. Connex rachète alors la petite compagnie Killen, une fusion qui attire l\'attention du Ministère de la Justice à Washington. Benett Holiday, ambitieux avocat du cabinet Sloan Whiting, veille au bon déroulement de cette opération douteuse. Bob Barnes, vétéran de la CIA qui se préparait à \"pantoufler\", se voit proposer une dernière mission : éliminer le prince Nasir. Bryan Woodman, expert en ressources énergétiques, se rend à un gala organisé par le Prince Nasir. Son jeune fils meurt accidentellement lors de cette soirée. Ces événements auront une incidence directe sur la vie d\'un jeune ouvrier pakistanais de la Connex.', 'Participant', 'https://image.tmdb.org/t/p/w1280/yAQqQlfGh19ELsl3mpKXifbNHm5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8bEagsrYdl3NXnSfp5bSZ5kj834.jpg', 'https://www.youtube.com/embed/jRSdGIOzSO0', 127, '2005', 3.21, 1),
(232, 'United States of America', 'Rusty James', 'Tulsa, Oklahoma. Petite frappe locale, Rusty James rêve d’égaler les exploits de son grand frère, le Motorcycle Boy, légendaire chef de bande qui a choisi de s’éclipser. En son absence, pour être à la hauteur de sa réputation et se tailler la part du lion, Rusty se frotte aux gangs rivaux… Un soir, une rixe tourne mal. Le voyou est gravement blessé et ne doit son salut qu’à l’intervention inattendue de son aîné. Mystérieux et charismatique, le Motorcycle Boy est de retour chez lui…', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/qDIa0j79QoISqoBOumVyiKtiVpS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pFplKqzRya9a8rXwV1PJDJ3D8km.jpg', 'https://www.youtube.com/embed/LG2iczXHJZU', 94, '1983', 3.49, 1),
(233, 'United States of America', 'The Wanderers', 'The streets of the Bronx are owned by \'60s youth gangs where the joy and pain of adolescence is lived. Philip Kaufman tells his take on the novel by Richard Price about the history of the Italian-American gang ‘The Wanderers.’', 'Warner Bros. Home Entertainment Group', 'https://image.tmdb.org/t/p/w1280/oedFtX9hZZWpD7L5wkD0WxSteY2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1K9YJzQ6r5nCrOVrjSnAmji8zLc.jpg', 'https://www.youtube.com/embed/tfe81JM4bUs', 117, '1979', 3.5, 1),
(234, 'Germany', 'Le Cabinet du docteur Caligari', 'Dans une fête foraine, un mystérieux docteur prédit un avenir tragique à un jeune étudiant...', 'Decla Film Gesellschaft Holz & Co.', 'https://image.tmdb.org/t/p/w1280/qWAZozKtoRI8PO8teYmSvH3zcHI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uHztAwe3iWDC5I0W1tDZ5fUtRRQ.jpg', 'https://www.youtube.com/embed/', 77, '1920', 3.98, 1),
(235, 'United States of America', 'Stand by Me', 'Un événement peu ordinaire va marquer la vie du jeune Gordie Lachance. Au cours de l’été 1959, un adolescent a disparu mystérieusement dans l\'Oregon. Gordie et ses inséparables copains, Chris, Teddy et Vern savent qu\'il est mort pour avoir approché de trop près la voie ferrée, un train l\'a heurté. Son corps gît au fond des bois. C\'est le frère de Vern qui l\'a découvert. Les enfants décident de s\'attribuer le scoop et partent pour la grande forêt de Castle Rock. Cette aventure va rester pour Gordie et ses trois amis la plus étrange et la plus exaltante de leur vie.', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/paxBmWVvdw1yiAnSxBxuYUyZKBA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bTvvPSjOCaoMKq8dO8qwCm0924Y.jpg', 'https://www.youtube.com/embed/', 85, '1986', 3.93, 1),
(236, 'Australia', 'Muriel', 'Muriel, boulotte de vingt-trois ans, maladroite et ridicule, tête de Turc de ses copines, étouffée par sa famille, attend le prince charmant en écoutant ABBA et en feuilletant des catalogues de robes de mariée dans une ennuyeuse petite station balnéaire. Le prince charmant se faisant attendre, elle décide de partir à sa recherche à Sydney.', 'CiBy 2000', 'https://image.tmdb.org/t/p/w1280/xtddj3hrhrGMc0KcLcwafNZsRa3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//x4sqnmV2nAKIG6cmt9WAF9xRA2M.jpg', 'https://www.youtube.com/embed/', 105, '1994', 3.45, 1),
(237, 'France', 'Young Adam', 'A Glasgow, au début des années 50, Joe est engagé par Les pour travailler sur sa péniche. Un après-midi, les deux hommes découvrent le cadavre d\'une jeune femme flottant sur l\'eau. Accident ? Suicide ? Meurtre ? La police enquête et arrête un suspect alors qu\'il devient de plus en plus évident que Joe connaissait bien la victime. Entre-temps, Joe et l\'épouse de Les, Ella, irrésistiblement attirés l\'un par l\'autre, nouent une liaison passionnée.', 'Recorded Picture Company', 'https://image.tmdb.org/t/p/w1280/rU5GJ5r4tQbSx9C2ENKbPkD6nr9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bHqIHC1sK5CzAS2XkF1jbyuS4ww.jpg', 'https://www.youtube.com/embed/', 93, '2003', 2.95, 1),
(238, 'United States of America', 'Le Parrain', 'La Seconde Guerre mondiale vient de s\'achever. À New York, le « parrain » Don Corleone, l\'un des chefs respectés de la mafia, se sent vieillir. Il refuse de s\'adapter à son temps et de se lancer, comme ses pairs, dans le trafic de drogue. Une frilosité qui entrave la bonne marche des affaires des autres « familles » et qui lui vaut d\'être la cible d\'un attentat. Don Corleone survit à ses blessures, mais reste très diminué. Mike, son plus jeune fils, qui jusque-là se tenait à l\'écart des affaires de son père, devient le plus dévoué de ses héritiers. Plus efficace que ses frères, Sonny et Fredo, il venge son père et organise l\'élimination de ses adversaires…', 'Paramount', 'https://image.tmdb.org/t/p/w1280/wnDNKCeBQzioXYQrXcSyrmRHVxf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tmU7GeKVybMWFButWEGl2M4GeiP.jpg', 'https://www.youtube.com/embed/bmtuIhesQWA', 175, '1972', 4.36, 1),
(239, 'United States of America', 'Certains l\'aiment chaud', 'Deux musiciens de jazz au chômage, mêlés involontairement à un règlement de comptes entre gangsters, se transforment en musiciennes pour leur échapper. Ils partent en Floride avec un orchestre féminin. Ils tombent illico amoureux d\'une ravissante et blonde créature, Alouette, qui veut épouser un milliardaire.', 'The Mirisch Company', 'https://image.tmdb.org/t/p/w1280/vUBgUWMs6TuCuUScfB98kPBYIbG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5zTwAcnI3zCJ0mucPPnoBtkSWEV.jpg', 'https://www.youtube.com/embed/', 121, '1959', 4.06, 1),
(240, 'United States of America', 'Le Parrain, 2e partie', 'Depuis la mort de Don Vito Corleone, son fils Michael règne sur la famille. Amené à négocier avec la mafia juive, il perd alors le soutien d\'un de ses lieutenants, Frankie Pentageli. Échappant de justesse à un attentat, Michael tente de retrouver le coupable.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/chMfGLOf5EMz0o10Duukmb9oj0P.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kGzFbGhp99zva6oZODW5atUtnqi.jpg', 'https://www.youtube.com/embed/qJr92K_hKl0', 202, '1974', 4.3, 1),
(241, 'United States of America', 'Tueurs nés', 'Mickey et Mallory Knox, un jeune couple, décident de s’embarquer dans une virée sanglante, tuant les gens qu’ils rencontrent sur leur route, eux qui ont été victimes de mauvais traitements de la part de leurs parents respectifs. Leur déchéance à travers les États-Unis est détaillée dans les médias.', 'J D Productions', 'https://image.tmdb.org/t/p/w1280/bOghi9waIRWv2NZNI3wzbaiN2M4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gGQvvkgiYf35FbG3K5Cw75m7KGt.jpg', 'https://www.youtube.com/embed/dB6YIo3--Do', 118, '1994', 3.54, 1),
(242, 'United States of America', 'Le Parrain, 3e partie', 'Atteignant la soixantaine, Michael Corleone désire à la fois renouer avec les siens et se réhabiliter aux yeux de la société, surtout de l\'Église. Il arrivera presque à ses fins, mais sa vie passée et ses anciens ennemis le rattraperont plus vite. Michael Corleone est fatigué. Il veut prendre ses distances avec les activités mafieuses de sa famille. Il veut convertir ces activités en affaires légales. Kay, son ex-femme, lui fait même accepter que leur fils devienne un chanteur d\'opéra et ne reprenne pas les activités familiales. Pendant ce temps, la fille de Michael, Mary, et son neveu, le fils de Sonny, Vincent, nouent une idylle qui n\'est pas la bienvenue dans la famille. Il décide d\'aider le Vatican à renflouer ses caisses et reçoit en échange le contrôle d\'une entreprise immobilière leur appartenant. Attisant la jalousie de ses pairs, Michael échappe de justesse à un attentat commis par l\'un d\'eux. Vincent se propose alors pour reprendre les affaires de la famille en main.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/AqHvf08rsE54Mk5JudgnzXMjVTA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zNnjHLDtV8Ti3aworltaeaLMov4.jpg', 'https://www.youtube.com/embed/1NCln6ZEtFk', 160, '1990', 3.7, 1),
(243, 'United Kingdom', 'High Fidelity', 'Après avoir enduré moult ruptures et peines de cœur, Rob Gordon se voit brusquement plaqué par sa compagne Laura. Encore sous le choc, il s\'efforce de comprendre les raisons de cette nouvelle débâcle. Dressant le Top 5 des ruptures qui l\'ont le plus marquées, il décide de relancer ses ex dans l\'espoir qu\'elles lui fourniront la clé de l\'énigme.', 'Buena Vista Pictures', 'https://image.tmdb.org/t/p/w1280/5GlQ4MMZKTJwASLGQkmFTQOpvvM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1pjOrzAqlQPifZkRi5h1zlO1VJ2.jpg', 'https://www.youtube.com/embed/QwZe8_uXBJk', 113, '2000', 3.57, 1),
(244, 'United States of America', 'King Kong', 'Figurante sans travail, la blonde Ann Darrow est engagée par le réalisateur Carl Denham pour être la vedette de son prochain film. Le Venture, le navire commandé par le capitaine Englehorn et qui comprend toute l\'équipe, atteint Skull Island, une île mystérieuse où vivrait une créature légendaire vénérée par les indigènes et appelée King Kong.Durant le voyage, Ann tombe amoureuse de John Driscoll, le second du bateau. Une fois débarqués, les explorateurs sont aussitôt repérés par les indigènes et font marche arrière. Mais ces derniers enlèvent Ann, la \"femme aux cheveux d\'or\", et l\'attachent pour l\'offrir en sacrifice à King Kong.Au moment où ses compagnons arrivent pour la délivrer, un singe gigantesque saisit la jeune fille et disparaît dans la forêt. Denham et ses hommes se lancent alors à la poursuite de King Kong.', 'RKO Radio Pictures', 'https://image.tmdb.org/t/p/w1280/5YMtL9RRAgUFm4w4PEwkKzzpvhD.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7hDdW3C17pi4MdSeYXs8bwIVA78.jpg', 'https://www.youtube.com/embed/vZNaePPrEXU', 104, '1933', 3.82, 1),
(245, 'United Kingdom', 'Pour un garçon', 'Will Freeman est un trentenaire londonien et un célibataire endurci. Vivant allègrement grâce aux droits d\'auteur qu\'il perçoit sur une chanson de Noël écrite par son père, il s\'invente un fils pour draguer des mères célibataires.Un jour, il fait la connaissance de Marcus, un garçon de douze ans, fils de Fiona, hippie et végétarienne, et tête de Turc de l\'école. Will et Marcus deviennent amis, et pendant que Will apprend à Marcus l\'art d\'être cool, Marcus apprend à Will l\'art d\'être... adulte.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/b5uCL8EzOXe0DD2PZJjuF34eLy7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xxiPjhXigJ4zPiqqrA77FK10ULo.jpg', 'https://www.youtube.com/embed/xC7REp40_uc', 105, '2002', 3.33, 1),
(246, 'France', 'Zatoichi', 'Au Japon, au XIXe siècle, Zatoichi est un voyageur aveugle gagnant sa vie comme joueur professionnel et masseur. Mais derrière son humble apparence, il est un redoutable combattant, rapide comme l\'éclair et dont les coups s\'avèrent d\'une stupéfiante précision. Alors qu\'il traverse la montagne, il découvre une petite ville entièrement sous la coupe d\'un gang. Son chef, Ginzo, se débarrasse de tous ceux qui osent se dresser sur son chemin, d\'autant plus efficacement qu\'il a engagé un redoutable samouraï ronin, Hattori. Dans un tripot, Zatoichi rencontre deux geishas, aussi dangereuses que belles. Okinu et sa sœur Osei vont de ville en ville à la recherche du meurtrier de leurs parents. Elles possèdent pour seul indice un nom mystérieux : Kuchinawa. Dès que les hommes de main de Ginzo croisent Zatoichi, l\'affrontement est inévitable et sa légendaire canne-épée rentre en action.', 'Office Kitano', 'https://image.tmdb.org/t/p/w1280/eYq0CnAuR4L6slAcJG8VrUed4wf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kP6WiYHQUUXo6ZaXI06enkMsxkF.jpg', 'https://www.youtube.com/embed/', 116, '2003', 3.62, 1),
(247, 'United States of America', 'L\'Ultime Razzia', 'Une bande de gangsters organisent le hold-up de la caisse des paris lors d\'une course de chevaux…', 'United Artists', 'https://image.tmdb.org/t/p/w1280/noFbLXootOb035fSGqVzpyrM9lb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dY0suaAdGpOqh7JkLeIN6lT7k9d.jpg', 'https://www.youtube.com/embed/', 83, '1956', 3.85, 1),
(248, 'United States of America', 'Milliardaire pour un jour', 'Annie est une clocharde qui vend des pommes à Broadway. Elle a fait croire à sa fille Louise, élevée en Espagne, qu’elle appartenait à la haute société new-yorkaise. Mais Louise annonce son arrivée aux États-Unis, accompagnée de son fiancé et de son père, des nobles espagnols. Dave \"the Dude\" Conway, un gangster convaincu que les pommes d’Annie lui portent chance, et son amie \"Queenie\" Martin vont s’efforcer de faire passer Annie pour une femme du monde le temps du séjour de Louise.', 'Franton Production', 'https://image.tmdb.org/t/p/w1280/7LK6BfaYc4JxOItqAe32V7ryvcs.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kYaqmkeCSqNSat8nKgdLSz0A20l.jpg', 'https://www.youtube.com/embed/7wNIE6Yx8XI', 136, '1961', 3.63, 1),
(249, 'United States of America', 'La Guerre des Rose', 'L\'histoire d\'un couple de yuppies, les Rose, qui, après une existence qu\'ils pensaient heureuse et confortable, se retournent tout à coup l\'un contre l\'autre, n’omettant aucune bassesse pour se détruire, jusqu\'à l\'apaisement et la conquête de l\'instant de bonheur final.', 'Jersey Films', 'https://image.tmdb.org/t/p/w1280/gbdBBIlFdp4yNHaVhzYN41l0saU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1BQWhphpn8HORDoZpC1EXnYDOwz.jpg', 'https://www.youtube.com/embed/QVCejFIKrzQ', 117, '1989', 3.44, 1),
(250, 'Denmark', 'En Chine, on mange des chiens', 'Un film d\'humour noir danois au rythme effréné sur deux frères motivés séparément qui, avec leurs tendances légèrement psychopathes, se retrouvent dans une situation délicate. Un frère a de graves ennuis après un braquage de banque et supplie l\'autre frère de l\'aider.', 'Steen Herdel Filmproduktion', 'https://image.tmdb.org/t/p/w1280/2qU5gQfgD086R5lVHeWcgU9SJ0h.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bZt4CwuaZWadSh9OEcNQCZbPFR1.jpg', 'https://www.youtube.com/embed/', 91, '1999', 3.67, 1),
(251, 'United States of America', 'Ghost', 'Sam Wheat, cadre dans une banque, vit une belle histoire d\'amour avec Molly Jensen, une sculptrice. Mais un soir, Sam se fait agresser, puis abattre. Il revient sous la forme d\'un fantôme et parvient à communiquer avec une voyante. Il va tenter d\'entrer en contact avec Molly pour qu\'elle enquête sur son meurtre.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/8y9mxFKeTMYWIiXQHJKlIszDdAf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zOyXP0MS4jvU01yIxzRV394ZUJw.jpg', 'https://www.youtube.com/embed/zUY8bf4mUPg', 127, '1990', 3.6, 1),
(252, 'United States of America', 'Charlie et la Chocolaterie', 'Charlie, enfant issu d\'une famille pauvre. Travaillant pour subvenir aux besoins des siens, il doit économiser chaque penny, et ne peut s\'offrir les friandises dont raffolent les enfants de son âge. Pour obtenir son comptant de sucreries, il participe à un concours organisé par l\'inquiétant Willy Wonka, le propriétaire de la fabrique de chocolat de la ville. Celui qui découvrira l\'un des cinq tickets d\'or que Wonka a caché dans les barres de chocolat de sa fabrication gagnera une vie de sucreries.', 'David L. Wolper Productions', 'https://image.tmdb.org/t/p/w1280/7IMlQhdyy9GOda5flGY5mLhWGfI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//idfNNlVwjVkBQrM2eWpLZiDOTIc.jpg', 'https://www.youtube.com/embed/', 100, '1971', 3.74, 1),
(253, 'United Kingdom', 'Vivre et laisser mourir', '007 est appelé à la rescousse pour mettre fin à l\'hécatombe meurtrière qui décime les agents secrets britanniques. Enquêtant à New York, dans le quartier de Harlem, il affronte un caïd de la drogue, le redoutable Docteur Kananga et sa comparse, l\'étrange Blanche Solitaire.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/1WskKj2i2rsbYfnIXMHHvVk81Zn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//v28YYcN5p9hD8PKGAeWLz0ugsfX.jpg', 'https://www.youtube.com/embed/6jFtyPrut2c', 122, '1973', 3.24, 1),
(254, 'New Zealand', 'King Kong', 'New York, 1933. Ann Darrow est une artiste de music‐hall dont la carrière a été brisée net par la Dépression. Se retrouvant sans emploi ni ressources, la jeune femme rencontre l’audacieux explorateur‐réalisateur Carl Denham et se laisse entraîner par lui dans la plus périlleuse des aventures… Ce dernier a dérobé à ses producteurs le négatif de son film inachevé. Il n’a que quelques heures pour trouver une nouvelle star et l’embarquer pour Singapour avec son scénariste, Jack Driscoll, et une équipe réduite. Objectif avoué : achever sous ces cieux lointains son génial film d’action. Mais Denham nourrit en secret une autre ambition, bien plus folle : être le premier homme à explorer la mystérieuse Skull Island et à en ramener des images. Sur cette île de légende, Denham sait que « quelque chose » l’attend, qui changera à jamais le cours de sa vie…', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/bCuu3UWja1Ni6uWZeav4rEIDVYM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//khCWWTRSwmMw1Us6rVFpEzDeDJf.jpg', 'https://www.youtube.com/embed/', 180, '2005', 3.43, 1),
(255, 'France', 'Baisers volés', 'La suite des aventures d\'Antoine Doinel après son service militaire, ses rencontres et aventures amoureuses.', 'Les Films du Carrosse', 'https://image.tmdb.org/t/p/w1280/xc6le6aPCZrWRQkDY8y8I0eNqJ3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//h39p97Pn0b55PV63PislftZslhk.jpg', 'https://www.youtube.com/embed/', 91, '1968', 3.65, 1),
(256, 'France', 'Antoine et Colette', 'Antoine tombe amoureux de Colette, mais elle le traite en copain. Deuxième volet du cycle Antoine Doinel initié avec le film Les 400 Coups.', 'Les Films du Carrosse', 'https://image.tmdb.org/t/p/w1280/kB3hszqPPDiVCfb6UNGVk9LTYvF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ymtwNtiuZwbYa1Vetp68VOGgrw3.jpg', 'https://www.youtube.com/embed/', 30, '1962', 3.62, 1),
(257, 'Czech Republic', 'Oliver Twist', 'Au XIXe siècle, en Angleterre, Oliver Twist, un orphelin de 9 ans, est chassé de son hospice pour avoir demandé une ration supplémentaire de gruau. Pris comme apprenti par un croque-mort, le gamin est cependant maltraité et décide de s\'enfuir. Arrivant à Londres après une longue marche à pied, Oliver rencontre Artful Dodger, un jeune voleur à la tire qui travaille pour le compte du hideux Fagin. Ce dernier ne tarde pas à prendre l\'orphelin sous sa coupe, l\'entraînant à voler les bourgeois dans la rue. C\'est ainsi qu\'Oliver tombe sur M. Brownlow, un vieil homme riche qui décide de le recueillir. Aussitôt, le fourbe Bill Sikes, un associé de Fagin, s\'arrange pour enlever le garçon. Mais la maîtresse de Bill, la jeune Nancy, révèle à Brownlow où Oliver est retenu captif.', 'ETIC Films', 'https://image.tmdb.org/t/p/w1280/q5IHBSXzh97wE7lmckuV0zhNpxg.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pP3fTbqsvpr9p0fc5tr7tJkdZqb.jpg', 'https://www.youtube.com/embed/gdpjhnaTlZE', 130, '2005', 3.35, 1),
(258, 'France', 'Domicile conjugal', 'Antoine Doinel a finalement épousé Christine Dabon. Le jeune homme est embauché dans une entreprise d\'hydraulique après avoir quitté son travail de teinturier pour fleurs. Peu de temps après, Antoine rencontre Kyoko, une Japonaise avec qui il trompe Christine alors que celle-ci vient de mettre au monde leur fils Alphonse.', 'Valoria Films', 'https://image.tmdb.org/t/p/w1280/it1CIdXuoaOQ7KDCRd90QaSIool.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4MyxINPUlXyvOOGAS91EwNr2AOa.jpg', 'https://www.youtube.com/embed/', 100, '1970', 3.6, 1),
(259, 'France', 'L\'Amour en fuite', 'Antoine Doinel a maintenant 35 ans. Après trois années de séparation, Christine et lui, restés bons amis, finissent par divorcer. Antoine est amoureux de Sabine, vendeuse dans un magasin de disques. Il gagne sa vie comme correcteur d\'imprimerie. Après l\'échec de son premier roman, « Les Salades de l\'amour », il décide d\'en écrire un autre. Par hasard, il rencontre Colette, un amour d\'adolescence. Elle traverse elle aussi une crise sentimentale, mais semble s\'intéresser davantage au roman d\'Antoine qu\'à Antoine lui-même. Il revoit également monsieur Lucien, l\'ancien amant de sa mère, qui a perdu sa fougue pour devenir un vieux monsieur respectable…', 'Les Films du Carrosse', 'https://image.tmdb.org/t/p/w1280/450uSM8uq3mQwZxh944GAlEtq4h.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7LmhNfSkSkE296AvQbLZK4jgbnp.jpg', 'https://www.youtube.com/embed/', 93, '1979', 3.56, 1),
(260, 'United Kingdom', 'The 39 Steps', 'Richard Hanney has a rude awakening when a glamorous female spy falls into his bed - with a knife in her back. Having a bit of trouble explaining it all to Scotland Yard, he heads for the hills of Scotland to try to clear his name by locating the spy ring known as The 39 Steps.', 'Gaumont-British Picture Corporation', 'https://image.tmdb.org/t/p/w1280/paI9Tmqm2cZG6xy4Tnjw3Ydjuw5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2SCZfhWvFgjmVrpGWN24UpXZVbf.jpg', 'https://www.youtube.com/embed/EjPwRiJ1Yxw', 86, '1935', 3.7, 1),
(261, 'United States of America', 'La Chatte sur un toit brûlant', 'Dans une villa du sud des États-Unis, la famille se réunit pour fêter l\'anniversaire du patriarche malade, Big Daddy. Maggie et Brick forment un couple en pleine crise: Brick est déprimé par le suicide de son meilleur ami et se réfugie dans l\'alcool. Maggie est frustrée car son époux ne veut plus accomplir son devoir conjugal. Brick la considère comme responsable de la mort de son ami, Skipper. Big Mama reproche à Maggie de ne pas avoir d\'enfant. Maggie, comme Gooper, le frère de Brick, et son épouse Mae sont en fait venus pour tenter de s\'approprier la majeure partie de l\'héritage du père dont ils savent la fin prochaine. Gooper et Mae vont avoir fort à faire pour se mettre dans les petits papiers du père puisque Brick reste le fils préféré. Alors que la famille s\'entre-déchire, Brick va se remettre en question et annoncer à son père ce qu\'il ne sait pas encore: sa mort prochaine.', 'Avon Productions', 'https://image.tmdb.org/t/p/w1280/dim1zZQeHAQgESgjRG6Vzu4Hlf1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//o53YZOxru84Z9wgZwbwqF25bdOl.jpg', 'https://www.youtube.com/embed/', 108, '1958', 3.85, 1),
(262, 'United States of America', 'La Valse des pantins', 'Un comique méconnu, pour se faire reconnaître, enlève le présentateur d\'un show télévisé et n\'accepte de le libérer qu\'à la condition de participer à son spectacle.', 'Embassy International Pictures', 'https://image.tmdb.org/t/p/w1280/zmb3PE0GEepF7wGHoCuazh4r90.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//npoUm3stzUM2lR46ClLDwBZDaeZ.jpg', 'https://www.youtube.com/embed/3aXeQRQYIH8', 109, '1982', 3.9, 1),
(265, 'Germany', 'Lili Marleen', 'Zurich, 1938. Willie, une jeune chanteuse de cabaret allemande, s\'éprend de Robert, un musicien juif. Le père du jeune homme, David Mendelsson, dirige une organisation juive clandestine d\'aide aux réfugiés. Il voit d\'un mauvais oeil la liaison de Robert et Willie. Le jeune musicien convoie régulièrement des fonds en Allemagne. Sur l\'insistance de Willie, il accepte un jour de la laisser l\'accompagner. Le père de Robert, trouvant là l\'occasion de séparer les deux amants, fait retenir la chanteuse en Allemagne. Lorsque la guerre éclate, Willie, désemparée, se place sous la protection de Henkel, un officier SS qui lui fait enregistrer la chanson « Lili Marleen ». Le succès est immédiat. Willie devient une véritable star, parrainée par le ministère de la Culture du IIIe Reich. Elle rêve toutefois de retrouver Robert…', 'Rialto Films', 'https://image.tmdb.org/t/p/w1280/eGpiOyuL3CdFioxxWV5ORdWw2rK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oPSDUtgVjFiWOve4e2dDZUpa50n.jpg', 'https://www.youtube.com/embed/yNzbWrpKPL0', 120, '1981', 3.11, 1),
(266, 'France', 'Le Mépris', 'Le scénariste Paul Javal mène une vie heureuse avec sa femme Camille. Un jour, le célèbre producteur américain Jeremy Prokosch lui propose de travailler à une adaptation de l’Odyssée, réalisée par Fritz Lang à Cinecittà. Le couple se rend alors sur les lieux du tournage et rencontre l’équipe. Prokosch fait bientôt des avances à Camille sous les yeux de Paul. Cette tentative de séduction va sonner le glas de leur couple…', 'Rome Paris Films', 'https://image.tmdb.org/t/p/w1280/3swhQjMh9u3zF0gVzO6uat2pPLI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//65VvjEscRHZNCCg63GmRfGU66v9.jpg', 'https://www.youtube.com/embed/kJe2nCXmCD0', 103, '1963', 3.57, 1),
(267, 'Spain', 'En chair et en os', 'Victor Plaza vit une nuit d\'amour avec Elena, qu\'il vient de rencontrer. Mais, lorsqu\'il se présente chez elle quelques jours après leur brève rencontre, ce n\'est pas lui qu\'Elena attend mais son dealer. L\'intrusion de deux policiers au sang chaud dans leur histoire complique la situation, au point de bouleverser la vie de chacun.', 'France 3 Cinéma', 'https://image.tmdb.org/t/p/w1280/z10hX3cD4zvS3MiGWd3dqHlsR6s.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gDekB0OnIYbKhqzzdArfSQpcAvH.jpg', 'https://www.youtube.com/embed/', 99, '1997', 3.54, 1),
(268, 'United States of America', 'Batman', 'Violence et corruption règnent dans la ville de Gotham City. La mafia dirige la ville à sa manière, au nez et à la barbe des autorités, complètement dépassées par les événements. Depuis quelques semaines cependant, un mystérieux justicier, drapé dans un costume de chauve-souris, terrorise les malfaiteurs et sème l\'inquiétude dans les rangs de la mafia. Une jeune journaliste, Vicki Vale, mène l\'enquête. C\'est ainsi qu\'elle fait la connaissance d\'un séduisant mais excentrique milliardaire, Bruce Wayne. Celui-ci n\'est autre que Batman, qui l\'a déjà sauvée. Elle rencontre également un odieux truand, Jack Napier, bras droit du parrain Carl Grissom...', 'The Guber-Peters Company', 'https://image.tmdb.org/t/p/w1280/cij4dd21v2Rk2YtUQbV5kW69WB2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2va32apQP97gvUxaMnL5wYt4CRB.jpg', 'https://www.youtube.com/embed/ygK7sAavO0c', 126, '1989', 3.61, 1),
(269, 'France', 'À bout de souffle', 'Un petit escroc vole une voiture et assassine impulsivement un policier. Recherché par les autorités, il retrouve une étudiante américaine en journalisme et tente de la persuader de s\'enfuir avec lui en Italie.', 'Les Films Impéria', 'https://image.tmdb.org/t/p/w1280/hrtmpGNKRaDm8loHmvyvRbyyIGe.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5VGmkeXybclhOqBaLprigVG9Ucz.jpg', 'https://www.youtube.com/embed/MmDDJWSNr9E', 90, '1960', 3.8, 1),
(270, 'Germany', 'Wir sagen Du! Schatz.', 'Oliver doesn’t have a family so he steals one.', 'miko-film', 'https://image.tmdb.org/t/p/w1280/le35Cod2vJWmWSbrUjeClZMC8JK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vraoblSotQdnODpez65zT5pKB1d.jpg', 'https://www.youtube.com/embed/', 98, '2007', 3.29, 1),
(271, 'Sweden', 'Ronja Rövardotter', '', 'Svenska Ord', 'https://image.tmdb.org/t/p/w1280/wJYkdYN4OzS5s9kiF4EtGvvnFm3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lPYts3qpBDMlJaGjzd7nA5Piyd2.jpg', 'https://www.youtube.com/embed/', 126, '1984', 3.4, 1),
(272, 'United Kingdom', 'Batman Begins', 'Alors que le souvenir de ses parents assassinés le hante, Bruce Wayne, désemparé, erre à travers le monde cherchant les moyens de combattre l\'injustice et ses propres peurs. Avec l\'aide de son dévoué majordome et homme de confiance Alfred, de l\'inspecteur Jim Gordon et de son allié Lucius Fox, Wayne revient à Gotham City et révèle son alter ego: Batman, un justicier masqué qui utilise sa force, son intelligence et une batterie d\'armes high-tech pour combattre les forces sinistres qui menacent la ville…', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/pqB8Xlu0QdwsONakoiKtortANdn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ew5FcYiRhTYNJAkxoVPMNlCOdVn.jpg', 'https://www.youtube.com/embed/V9x8j8Xx9w8', 140, '2005', 3.85, 1),
(273, 'Germany', 'Das weisse Rauschen', '', 'Cameo Film- und Fernsehproduktion', 'https://image.tmdb.org/t/p/w1280/kYJLb69aANQhf6EvewCnKRpiJ5O.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bGpRDAU5b0Ejc64wydAxt2ovx20.jpg', 'https://www.youtube.com/embed/', 107, '2001', 3.45, 1),
(274, 'United States of America', 'Le Silence des agneaux', 'Un psychopathe connu sous le nom de Buffalo Bill sème la terreur dans le Middle West en kidnappant et en assassinant de jeunes femmes. Clarice Starling, une jeune agent du FBI, est chargée d’interroger l’ex‐psychiatre Hannibal Lecter. Psychopathe redoutablement intelligent et porté sur le cannibalisme, Lecter est capable de lui fournir des informations concernant Buffalo Bill ainsi que son portrait psychologique. Mais il n’accepte de l’aider qu’en échange d’informations sur la vie privée de la jeune femme. Entre eux s’établit un lien de fascination et de répulsion.', 'Orion Pictures', 'https://image.tmdb.org/t/p/w1280/dwYqg3GXO2CdZ0s0LpgGID0z6wv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aYcnDyLMnpKce1FOYUpZrXtgUye.jpg', 'https://www.youtube.com/embed/gn55Sk-3mq0', 118, '1991', 4.17, 1),
(275, 'United Kingdom', 'Fargo', 'Quelque part dans le Minnesota, en plein hiver. Jerry Lundegaard, un minable vendeur de voitures, contacte un petit escroc, Carl Showalter, et son inquiétant compère, Grimsrud. Il leur demande d’enlever sa femme, Jean, dont le père, Wade, un richissime homme d’affaires, ne manquera pas de régler la rançon exigée. Les deux truands s’empêtrent quelque peu dans les péripéties mais finissent par réussir leur affaire. Grimsrud commence alors à donner la mesure de ses talents. Il tue de sang‐froid un policier lors d’un banal contrôle de routine, puis les deux témoins du meurtre. Marge Gunderson, une femme policier, enceinte, est chargée de l’enquête. Pendant ce temps, Jerry apprend avec déplaisir que son beau‐père entend conduire lui‐même les négociations avec les preneurs d’otage…', 'PolyGram Filmed Entertainment', 'https://image.tmdb.org/t/p/w1280/pkuNNMtJ40h3l0eQIMM8CYHXJlQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//747dgDfL5d8esobk7h4odaOFhUq.jpg', 'https://www.youtube.com/embed/qZGA2insxDs', 97, '1996', 3.94, 1),
(276, 'Austria', 'The Edukators', 'Jan, Peter et Jule sont trois jeunes en pleine rebellion et unis par leur volonté de changer l\'état du monde. La nuit, Jan et Peter forment \" The Edukators \" , de mystérieux activistes qui s\'infiltrent dans de riches villas pour avertir leurs propriétaires que \"les années de vaches grasses sont révolues\". Tout se complique lorsque Jule, la petite amie de Peter, tombe amoureuse de Jan et les entraine accidentellement dans un kidnapping...', 'Y3 Film', 'https://image.tmdb.org/t/p/w1280/3Z0R46cuFWB6gxZwEBf8ekVxgZ0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//whgmJ6vRE7o8zszh60kicT1vVSy.jpg', 'https://www.youtube.com/embed/', 127, '2004', 3.58, 1),
(277, 'Germany', 'Underworld', 'Depuis des centaines d\'années, à l\'insu des humains, se déroule un combat sans merci entre deux races immortelles : vampires contre lycans, un peuple sauvage proche des loups-garous de nos légendes… Sélène, une intrépide vampire, mène cette lutte millénaire sans aucune pitié pour ses ennemis. Mais lorsque Michael Corvin, un humain, se retrouve par hasard au cœur de cette guerre des clans, les règles changent. Sélène entre passion et fidélité, va devoir choisir son camp.', 'Screen Gems', 'https://image.tmdb.org/t/p/w1280/acExGk8mCtqF4RqwL3NS6hgrEOl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pvVkWJZYsUoCgnvpkd62pgnet7r.jpg', 'https://www.youtube.com/embed/77-AYZ2l-as', 115, '2003', 3.4, 1),
(278, 'United States of America', 'Les Évadés', 'En 1947, Andy Dufresne, un jeune banquier, est condamné à la prison à vie pour le meurtre de sa femme et de son amant. Ayant beau clamer son innocence, il est emprisonné à Shawshank, le pénitencier le plus sévère de l\'État du Maine. Il y fait la rencontre de Red, un noir désabusé, détenu depuis vingt ans. Commence alors une grande histoire d\'amitié entre les deux hommes…', 'Castle Rock Entertainment', 'https://image.tmdb.org/t/p/w1280/rL1YQLqUtHK3HdQyenHvuOCuWzO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wPU78OPN4BYEgWYdXyg0phMee64.jpg', 'https://www.youtube.com/embed/UIzBz2hYnwc', 140, '1994', 4.35, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(279, 'United States of America', 'Amadeus', 'Wolfgang Amadeus Mozart is a remarkably talented young Viennese composer who unwittingly finds a fierce rival in the disciplined and determined Antonio Salieri. Resenting Mozart for both his hedonistic lifestyle and his undeniable talent, the highly religious Salieri is gradually consumed by his jealousy and becomes obsessed with Mozart\'s downfall, leading to a devious scheme that has dire consequences for both men.', 'AMLF', 'https://image.tmdb.org/t/p/w1280/1n5VUlCqgmVax1adxGZm8oCFaKc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hCHO4FMRSJdGf0urLtGnST9Lhi3.jpg', 'https://www.youtube.com/embed/kQGw2cQIkOc', 160, '1984', 4.02, 1),
(280, 'France', 'Terminator 2 : Le Jugement dernier', 'En 2029, après leur échec pour éliminer Sarah Connor, les robots de Skynet programment un nouveau Terminator, le T‐1000, pour retourner dans le passé et éliminer son fils John Connor, futur leader de la résistance humaine. Ce dernier programme un autre cyborg, le T‐800, et l’envoie également en 1995, pour le protéger. Une seule question déterminera le sort de l’humanité : laquelle des deux machines trouvera John la première ?', 'TriStar Pictures', 'https://image.tmdb.org/t/p/w1280/mKCG5N5gDjDmxg07PXWsrPVrdCg.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xKb6mtdfI5Qsggc44Hr9CCUDvaj.jpg', 'https://www.youtube.com/embed/yWF2_TCgsas', 127, '1991', 4.05, 1),
(281, 'United States of America', 'Strange Days', 'Los Angeles 1999. Lenny Nero, flic déchu, mi-dandy, mi-gangster, s\'est reconverti dans le trafic de vidéos très perfectionnées qui permettent de revivre n\'importe quelle situation par procuration. Un jour, il découvre une vidéo révélant l\'identité des meurtriers d\'un leader noir.', 'Lightstorm Entertainment', 'https://image.tmdb.org/t/p/w1280/tI9ikzf6VOhgArBnF2lPcOUOB9Y.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lPvwp0esgdnb6L7ypTbgwhhAMxz.jpg', 'https://www.youtube.com/embed/', 145, '1995', 3.5, 1),
(284, 'United States of America', 'La Garçonnière', 'C.C. Baxter est employé à la Sauvegarde, grande compagnie d\'assurance. Dans l\'espoir d\'un avancement il prête souvent son appartement à ses supérieurs qui y emmènent leurs petites amies. Un jour le chef du personnel le convoque et lui apprend qu\'il sait tout et lui demande aussi sa clé. Baxter est enfin promu. Mais ce qu\'il ignorait c\'est que le chef du personnel emmenait dans son appartement la femme dont il était amoureux.', 'The Mirisch Company', 'https://image.tmdb.org/t/p/w1280/AoYhpPhpO8Ujszt6crxtNR980Ia.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vRTKNKNWLZ22fAgPa5kY8wT2b1F.jpg', 'https://www.youtube.com/embed/qk9UMLzhq2g', 125, '1960', 4.11, 1),
(285, 'United States of America', 'Pirates des Caraïbes : Jusqu\'au bout du monde', 'L’âge d’or de la piraterie touche à sa fin. Même le terrifiant Vaisseau Fantôme et son capitaine maudit servent Lord Cutler Beckett. Il écume désormais les sept mers, massacrant sans pitié les pirates de tous bords. Une seule chance de résister à Beckett et à son armada : Rassembler les Neuf Seigneurs de la Cour des Frères.', 'Jerry Bruckheimer Films', 'https://image.tmdb.org/t/p/w1280/3JjceHUzbtgJ4fJs6x2ow4ckH89.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xQkk0i3FrNSq7DTBlxRf9XJhH7l.jpg', 'https://www.youtube.com/embed/HKSZtp_OGHY', 168, '2007', 3.62, 1),
(286, 'Germany', 'Deutschland. Ein Sommermärchen', '', 'Little Shark Entertainment', 'https://image.tmdb.org/t/p/w1280/yUSWNpzQR0Qh0nvLCmRGKuMNzGE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fy9DOJO07EaVun1HcGdjFAVdtkt.jpg', 'https://www.youtube.com/embed/', 110, '2006', 3.42, 1),
(287, 'United States of America', 'Duo à trois', 'Crash Davis, un vétéran du base-ball, est chargé de prendre en main une équipe de première division menée par Nuke LaLoosh. Une groupie de l\'équipe hésite entre les deux hommes.', 'The Mount Company', 'https://image.tmdb.org/t/p/w1280/51nMZjjCJJ5SzEsnAukr2OXJ8AF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vnl0fqfuIZc5XuUP6YO3kw0fZfO.jpg', 'https://www.youtube.com/embed/PamIZqPy_sw', 108, '1988', 3.33, 1),
(288, 'United States of America', 'Le Train Sifflera Trois Fois', 'Alors qu\'il s\'apprête à abandonner ses fonctions de shérif pour se marier, Will Kane apprend qu\'un bandit, condamné autrefois par lui, arrive par le train pour se venger. Will renonce à son voyage de noces et tente de réunir quelques hommes pour braver Miller et sa bande. Mais peu à peu tous l\'abandonnent.', 'Stanley Kramer Productions', 'https://image.tmdb.org/t/p/w1280/mSiGEkgvAvEotfUbCA1iJCQAVAC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6S4gjpkd359UuMLfrnUV1M695DF.jpg', 'https://www.youtube.com/embed/FcSyL3Zxvbk', 89, '1952', 3.85, 1),
(289, 'United States of America', 'Casablanca', 'À Casablanca, pendant la Seconde Guerre mondiale, le night‐club le plus couru de la ville est tenu par Rick Blaine, un Américain en exil. Mais l’établissement sert également de refuge à ceux qui voudraient se procurer les papiers nécessaires pour quitter le pays. Lorsque Rick voit débarquer un soir le dissident politique Victor Laszlo et son épouse Ilsa, quelle n’est pas sa surprise de retrouver dans ces circonstances le grand amour de sa vie.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/5K7cOHoay2mZusSLezBOY0Qxh8a.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wOfzdzC0QZyhUIlyjeMuUYSb8Ax.jpg', 'https://www.youtube.com/embed/I3u5SM2cXY8', 102, '1942', 4.08, 1),
(290, 'United Kingdom', 'Barton Fink', 'A renowned New York playwright is enticed to California to write for the movies and discovers the hellish truth of Hollywood.', 'Working Title Films', 'https://image.tmdb.org/t/p/w1280/s8Jd8T2UktNkECPfaleruDt3zUf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uvghTjsDNpdN9abdgSlYn6EKK8P.jpg', 'https://www.youtube.com/embed/', 117, '1991', 3.73, 1),
(310, 'United States of America', 'Bruce tout-puissant', 'Bruce Nolan, reporter pour une célèbre chaîne de télévision de Buffalo, est constamment de mauvaise humeur. Pourtant, il n\'a aucune raison d\'avoir cette attitude de grincheux : il est très célèbre, et est aimé par une très jolie jeune femme, Grace. Un jour où tout se passe mal pour lui (il s\'offre un superbe accident de voiture et se fait virer de la chaîne), Bruce s\'emporte et se met en colère contre Dieu. Mais il est entendu par l\'oreille divine, qui décide de prendre forme humaine et de descendre sur Terre. Dieu met au défi le reporter : il lui lègue les pouvoirs divins pendant une semaine et charge Bruce de faire mieux que lui. S\'il échoue, il peut entraîner l\'apocalypse…', 'Pit Bull Productions', 'https://image.tmdb.org/t/p/w1280/qUHtc0BWRK7i9TZVYFip78p1Fs4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8bQbejOvAKe78RXxpkfM04n0K18.jpg', 'https://www.youtube.com/embed/9djo1o70N7A', 101, '2003', 3.35, 1),
(311, 'United States of America', 'Il était une fois en Amérique', 'Nathan Aaronson, dit \"Noodles\", vieil homme solitaire, revient à New York et se souvient de sa jeunesse délinquante dans le ghetto juif des années 20 avec Max, son ami de toujours, leur ascension sans gloire dans la pègre, le trafic d\'alcool, les fumeries d\'opium... Mais il se souvient aussi de son amour d\'enfance, Deborah, de la violence, des meurtres sauvages...', 'The Ladd Company', 'https://image.tmdb.org/t/p/w1280/qu50vK8DVt0tP9jBdqYJdsFRIo0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uPYa165sraN2c8gZBM9C47g3JoU.jpg', 'https://www.youtube.com/embed/nHncGNNSDRE', 220, '1984', 4.22, 1),
(312, 'Germany', 'Au-delà du silence', 'Alors que les parents de Lara sont tous deux sourds, leur fille entendante est leur lien avec le monde : Lara sert d\'interprète à ses parents dans les situations pratiques de la vie, comme par exemple à la banque ou plus absurde et drôle, aux réunions parents-professeurs de son école.', 'Roxy Film', 'https://image.tmdb.org/t/p/w1280/c7pZYrEeI5OAnEDIzoQv3UhdwGY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zxHSp0F0DKdHx3OPIh1rN4zApJq.jpg', 'https://www.youtube.com/embed/', 109, '1996', 3.45, 1),
(313, 'Canada', 'Snow Cake', 'Un drame centré sur l\'amitié entre une femme autiste et un homme traumatisé par un accident de voiture mortel.', 'Revolution Films', 'https://image.tmdb.org/t/p/w1280/AkqX01OfZQeuCZcv4zYrNeAKqYr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aN5soKp3KMT5Z0LmA9lAu44V3R9.jpg', 'https://www.youtube.com/embed/8PjobprTjUE', 112, '2006', 3.57, 1),
(314, 'United States of America', 'Catwoman', 'Patience Philips est une artiste douée, mais maladivement timide, qui se contente d\'un modeste emploi de dessinatrice publicitaire au sein du conglomérat Hedare Beauty que dirigent le tyrannique George Hedare et sa femme, le légendaire top model Laurel. Cette société se prépare à lancer « LE » cosmétique miracle censé procurer aux femmes un visage et un corps à jamais immaculés. Patience découvre que le produit ne possède aucune de ces vertus, mais est froidement tuée par ses patrons avant d\'avoir pu dénoncer l\'imposture. Tout n\'est pas perdu, cependant, car celle-ci ressuscite sous l\'emprise d\'une force mystérieuse. Elle se réincarne, magnifiée, en une femme féline, sensuelle, d\'une agilité et d\'une force surhumaines : Catwoman… Libérée de ses complexes, celle-ci commence par régler quelques comptes et s\'offrir certains plaisirs trop longtemps négligés...', 'Village Roadshow Pictures', 'https://image.tmdb.org/t/p/w1280/k2nCH7FrNM88CV0LsJ555WZhU55.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//x7fK0oOUX8Ks1B1lZsACmCXUybI.jpg', 'https://www.youtube.com/embed/v0Gv4N5FgFo', 104, '2004', 2.29, 1),
(315, 'United States of America', 'Faster, Pussycat! Kill! Kill!', 'Trois femmes sauvages, dans trois somptueuses voitures, décident de former un gang et se livrent à des pillages meurtriers. Elles kidnappent et droguent la petite amie d’une de leurs victimes et se cachent dans un ranch isolé appartenant à un vieil homme infirme qui vit avec ses deux fils. Cet homme détient et cache une grosse somme d’argent. Les trois femmes tentent de séduire les deux fils afin de découvrir où est le butin.', 'Eve Productions Inc.', 'https://image.tmdb.org/t/p/w1280/xZtJR0UWkaXTJGJaH33Hlv9EGKZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kEYzCALqaU8cMMRPtghjAjcLRQi.jpg', 'https://www.youtube.com/embed/aPdSZ-fPxtI', 83, '1965', 3.21, 1),
(316, 'Germany', 'Grill Point', 'In the style of a documentary this tragic comedy tells the story of a relationship crisis between two married couples and their longing to break out of their miserable daily lives. In this East German post-wall movie Andreas Dresen introduces the sad everyday life of two couples from Frankfurt an der Oder in a honest and tolerable manner.', 'Peter Rommel Productions', 'https://image.tmdb.org/t/p/w1280/bMdeYeO8ylTqJDVnEPECdhroEg8.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ykyF3JodRIB32iHMufklU45lDIS.jpg', 'https://www.youtube.com/embed/', 111, '2002', 3.4, 1),
(317, 'Bosnia and Herzegovina', 'Sarajevo, mon amour', 'A Sarajevo, peu de temps après la guerre, Esma élève seule sa fille, Sara, âgée de 12 ans. La gamine va à l\'école et y rencontre Samir. Ce dernier, comme Sara, n\'a pas de père, mais est persuadé que le sien est un héros de la guerre.', 'Coop 99 Filmproduktion', 'https://image.tmdb.org/t/p/w1280/xmvWXXTHso7x0zj8pY4WOOqa5BO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//97PwLIedtl0kutNHcdcJ9jLSGD3.jpg', 'https://www.youtube.com/embed/', 90, '2006', 3.45, 1),
(318, 'United States of America', 'The Million Dollar Hotel', 'A Los Angeles, un palace délabré dans le quartier déshérité de Down Town. L\'envers du décor de la cité des anges, la poubelle de la ville, devenue aujourd\'hui la cour des miracles où survit une faune de marginaux livrés à eux-mêmes. Un matin, Tom Tom, un attardé mental, se jette dans le vide depuis le toit de son hôtel. A travers un long flash-back, nous découvrons la vie de ce paumé, amoureux fou d\'Eloise, un ange déchu qui nie sa propre vie, traînant pieds nus dans les rues malfamées de Down Town.', 'Kintop Pictures', 'https://image.tmdb.org/t/p/w1280/iGRyPsZF0lfIL3IadmBdoAsYzyn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3vUkQpnwbsFEQlMh9EORpvKJfpo.jpg', 'https://www.youtube.com/embed/PNmJlGCd3Mg', 122, '2000', 2.96, 1),
(319, 'France', 'True Romance', 'Le jour de son anniversaire, Clarence Worley rencontre la splendide Alabama dans un cinéma miteux. Coup de foudre immédiat. Après une nuit d’amour, Alabama avoue à Clarence qu’elle a été en fait engagée par le patron de Clarence comme cadeau d’anniversaire. De là va commencer une folle aventure.', 'Morgan Creek Productions', 'https://image.tmdb.org/t/p/w1280/wiVWuh2zOoeayn54CEQ0ybwgYZU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lUdwe0awsLBILK9yKZK9uAiHe5o.jpg', 'https://www.youtube.com/embed/', 120, '1993', 3.77, 1),
(320, 'United States of America', 'Insomnia', 'Will Dormer, un policier expérimenté et désabusé, est envoyé en Alaska pour enquêter sur le meurtre sordide d\'une adolescente. Lui et ses hommes montent une embuscade et repèrent le tueur, mais celui-ci parvient à s\'enfuir. Will le prend en chasse mais le perd de vue dans l\'opaque brouillard. Il voit une ombre qui pointe une arme à feu et tire. Lorsqu\'il s\'approche du corps, il découvre qu\'il vient de tuer Hap, son partenaire. Instinctivement, il prend le pistolet qu\'a auparavant laissé tomber le tueur dans sa fuite et le place près de Hap pour dissimuler sa culpabilité. Walter Finch, le meurtrier, a vu faire Will. Il le menace de le dénoncer s\'il ne ferme pas rapidement le dossier en accusant l\'ancien petit ami de la victime d\'être responsable des deux meurtres. Will ne peut laisser Walter s\'en tirer aussi facilement. Cependant, l\'absence de sommeil l\'empêche d\'avoir les idées claires.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/6Vwc5vgioIXUhLQGAqmp3uDDKJJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jU8MC5uSgBkZXyZYGtZgMsMsfeN.jpg', 'https://www.youtube.com/embed/emIHzg4VH8A', 119, '2002', 3.47, 1),
(321, 'Canada', 'Mambo Italiano', 'Fin de vingtaine, Angelo est un agent de voyage rêvant de devenir scénariste pour la télévision. Nino, dans la trentaine, est un policier très respecté. Maria et Gino, parents d\'Angelo, ont émigré dans les années 1950 et se sont mariés juste après leur arrivée dans le \"Nouveau Monde\", un milieu auquel ils ne se sont jamais habitués. Anna, soeur aînée d\'Angelo, est enseignante et célibataire. En plus d\'habiter encore chez ses parents, elle a une faiblesse pour les pilules et un penchant pour tout ce qui est dramatique. Lina, mère de Nino et veuve, est une femme exigeante qui veut tout contrôler et qui donnerait même du fil à retordre à Mussolini. Le monde de Maria et de Gino bascule lorsque leur fils décide de partir en appartement...', 'icon', 'https://image.tmdb.org/t/p/w1280/zStdgYCXGXkqN8CsmBKlyz8siSY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tjlVklWsCrJH2XkoT1I2LIXvkvC.jpg', 'https://www.youtube.com/embed/', 90, '2003', 2.9, 1),
(322, 'United States of America', 'Mystic River', 'Jimmy Markum, Dave Boyle et Sean Devine ont grandi ensemble dans les rues de Boston. Rien ne semblait devoir altérer le cours de leur amitié jusqu\'au jour où Dave se fit enlever par un inconnu sous les yeux de ses amis. Leur complicité juvénile ne résista pas à un tel événement et leurs chemins se séparèrent inéluctablement.Jimmy sombra pendant quelque temps dans la délinquance, Sean s\'engagea dans la police, Dave se replia sur lui-même, se contenta de petits boulots et vécut durant plusieurs années avec sa mère avant d\'épouser Celeste.Une nouvelle tragédie rapproche soudain les trois hommes : Katie, la fille de Jimmy, est retrouvée morte au fond d\'un fossé. Le père endeuillé ne rêve plus que d\'une chose : se venger. Et Sean, affecté à l\'enquête, croit connaître le coupable : Dave Boyle...', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/1z7IwJBQSKVY7BPLYOOS3ZNWM53.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ah9hRJhdMMLkntNDIatKwncNJra.jpg', 'https://www.youtube.com/embed/ahitvzwTgng', 138, '2003', 3.87, 1),
(326, 'United States of America', 'Des Serpents Dans l\'Avion', 'La mission de l\'agent spécial Neville Flynn est simple : il doit escorter un témoin essentiel sur un avion de lignede Hawaï à Los Angeles. L\'homme va permettre de faire tomber l\'un des piliers de la mafia, après qui Flynn court depuis longtemps. Toutes les précautions ont été prises, mais ce n\'est pas assez...Décidé à ce que le témoin n\'arrive jamais au tribunal, le criminel met au point un lâcher de serpents venimeux à bord de l\'avion. Ils sont partout, silencieux et mortels. Entre un équipage et des passagers paniqués et un témoin qu\'il faut protéger à tout prix, Flynn va devoir se battre pour que l\'avion ait une chance d\'arriver…', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/ksXFuIKTfnDGlZeC9g82YO9Grjb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bAG05yQkT56yFuLAETr12UfK05y.jpg', 'https://www.youtube.com/embed/S8Mi3JjModU', 105, '2006', 2.7, 1),
(327, 'United States of America', 'Aniki, mon frère', 'Aniki Yamamoto, un yakuza de Tokyo, refuse de se soumettre au clan adverse qui a fait tuer son chef. Sa tête étant mise à prix, il quitte le Japon et part rejoindre son demi-frère Ken aux États-Unis.Il arrive alors à Los Angeles, ne parlant pas un seul mot d\'anglais, et découvre une société qu\'il ne connaît pas. Mais il retrouve rapidement son demi-frère, qui est devenu un petit dealer.Lors d\'une altercation entre son demi-frère et le revendeur de celui-ci, Aniki intervient et passe à tabac le revendeur. C\'est ainsi que petit à petit, Aniki va former son propre clan en appliquant les méthodes des yakuzas...', 'Recorded Picture Company', 'https://image.tmdb.org/t/p/w1280/2KVZtwU1gWdAKq7dqVUHIml69lj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cL1VX6WllejQQhGTUGGWHW25yor.jpg', 'https://www.youtube.com/embed/', 114, '2000', 3.57, 1),
(329, 'United States of America', 'Jurassic Park', 'Ne pas réveiller le chat qui dort... C\'est ce que le milliardaire John Hammond aurait dû se rappeler avant de se lancer dans le \"clonage\" de dinosaures. C\'est à partir d\'une goutte de sang absorbée par un moustique fossilisé que John Hammond et son équipe ont réussi à faire renaître une dizaine d\'espèces de dinosaures. Il s\'apprête maintenant avec la complicité du docteur Alan Grant, paléontologue de renom, et de son amie Ellie, à ouvrir le plus grand parc à thème du monde. Mais c\'était sans compter la cupidité et la malveillance de l\'informaticien Dennis Nedry, et éventuellement des dinosaures, seuls maîtres sur l\'île...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/2E2dKGPTWoyiaSzgNaer9zpP49n.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1FN6pHFDDlhT7oVhABKKGtG6ga7.jpg', 'https://www.youtube.com/embed/7cCbj-9Ww1o', 126, '1993', 3.97, 1),
(330, 'United States of America', 'Le monde perdu : Jurassic Park', 'Quatre ans après le terrible fiasco de son Jurassic Park, le milliardaire John Hammond rappelle le Dr Ian Malcolm pour l\'informer de son nouveau projet. Sur une île déserte, voisine du parc, vivent en liberté des centaines de dinosaures de toutes tailles et de toutes espèces. Ce sont des descendants des animaux clonés en laboratoire. D\'abord réticent, Ian se décide à rejoindre le docteur quand il apprend que sa fiancée fait partie de l\'expédition scientifique. Il ignore qu\'une autre expédition qui n\'a pas les mêmes buts est également en route.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/xJwNK2KZCvxyqR5OZw763q6UHKn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//w9eBtIHHpGgGfjqnEAJM3s7mCOa.jpg', 'https://www.youtube.com/embed/QCnj45q6EA8', 129, '1997', 3.26, 1),
(331, 'United States of America', 'Jurassic Park III', 'Huit ans après les événements surréalistes survenus lors de sa visite au Jurassic Park du richissime John Hammond, le paléontologue Alan Grant se rappelle toujours de sa rencontre, d\'abord magique puis effroyable, avec ces dinosaures ramenés à la vie grâce aux incroyables progrès de la génétique. Cependant, il manque de subventions pour financer ses recherches. Paul Kirby et sa femme Amanda, un couple richissime, lui proposent alors une grosse somme d\'argent s\'il leur fait survoler la fameuse île. Alan accepte leur offre. Mais celui-ci flaire une entourloupe lorsque le pilote amorce sa descente sur l\'île...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/3hmO6ecp7cfSG0IaqMZCYwh5pH2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9jFWActtkANe3NexnPkHEDnYfl3.jpg', 'https://www.youtube.com/embed/FxOfakcWAeE', 92, '2001', 3.06, 1),
(332, 'United States of America', 'Inspecteur Gadget', 'John Brown, vigile aux laboratoires Bradford, rêve de devenir un grand détective pour séduire celle qu\'il aime en secret, Brenda Bradford. L\'occasion se présente quand, alors que le professeur et sa fille mettent au point leur programme top secret de cyber-policier, le méchant Sanford Scolex organise un cambriolage du laboratoire. Au cours de cette effraction particulièrement violente, le professeur est tué tandis que John Brown fait preuve d\'héroïsme. Pour le récompenser, Brenda décide de lui appliquer son programme scientifique.', 'DiC Entertainment', 'https://image.tmdb.org/t/p/w1280/mcq2SwUd1kiU44EEVp96MnYLagT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7OsGo8yVkTgD1ZJMBi9M8GP5aes.jpg', 'https://www.youtube.com/embed/agJktHtUJWI', 78, '1999', 2.22, 1),
(333, 'Canada', 'Bollywood/Hollywood', '', 'Different Tree Same Wood Productions', 'https://image.tmdb.org/t/p/w1280/pXIVHT73QG70nZZdsVMwa0OgFUK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ahdc4lmShSJOkIGnbUI77xeh2Ze.jpg', 'https://www.youtube.com/embed/', 101, '2002', 3.15, 1),
(334, 'United States of America', 'Magnolia', 'Earl Partridge, âgé et malade, va bientôt mourir. Il demande à son fidèle infirmier de retrouver le fils qu\'il a jadis abandonné. Sa jeune épouse, qui convoitait sa fortune, devrait se réjouir mais n\'y parvient pas. Frank Mackey, jeune gourou cathodique de la séduction masculine, s\'est construit un passé et une vie. Mais combien de temps le masque peut-il résister ? Toutes ces vies s\'entrecroisent le temps d\'une journée comme les autres sous le soleil de la Californie.', 'Ghoulardi Film Company', 'https://image.tmdb.org/t/p/w1280/eO0Y67WaGW5C0ztHi0lcRQivaGS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sWn488xLGp9SrPjZYuaIAaZE0dF.jpg', 'https://www.youtube.com/embed/0UijGgGC040', 184, '1999', 3.86, 1),
(335, 'Italy', 'Il était une fois dans l\'Ouest', 'Alors que les constructeurs de chemins de fer traversent sans relâche le désert de l\'Arizona en direction de la mer, Jill arrive dans la petite ville de Flagstone avec l\'intention de commencer une nouvelle vie.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/xjXKy5b2M3fDelAQItIswcDNvwm.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//h31SOVlekuHXsMWVGxI8nPPfY82.jpg', 'https://www.youtube.com/embed/591ov1tj3EQ', 166, '1968', 4.15, 1),
(336, 'Spain', 'Il était une fois la révolution', 'Mexique, 1913. Un pilleur de diligences, Juan Miranda, fait chanter un spécialiste en explosifs, John Mallory, pour qu\'ils s\'associent afin de dévaliser la banque centrale de Mesa Verde. Tous deux se trouvent plongés en plein cœur de la tourmente de la révolution mexicaine.', 'Rafran Cinematografica', 'https://image.tmdb.org/t/p/w1280/547R2me0kQjXPHSJNmZ21ZKGSkb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//b2IrRkWgkLFdwsCSHK3CD526hUn.jpg', 'https://www.youtube.com/embed/zlbkDgELdzQ', 157, '1971', 3.86, 1),
(337, 'France', 'Monsieur Ibrahim et les Fleurs du Coran', 'À Paris, dans les années 60, Momo, un garçon de 13 ans, se retrouve livré à lui-même. Il a un seul ami, Monsieur Ibrahim, l\'épicier arabe et philosophe de la rue Bleue. Celui-ci va lui faire découvrir la vie, les femmes, l\'amour et quelques grands principes.', 'ARP Sélection', 'https://image.tmdb.org/t/p/w1280/fnI8E3SC00Nf6YVHmH4sCJgsuGV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cxhc4KO48wHgJ5Vqa7v3dFsJSou.jpg', 'https://www.youtube.com/embed/', 91, '2003', 3.5, 1),
(338, 'Germany', 'Good Bye, Lenin!', 'Alex, un jeune Berlinois de l’Est, apprend la chute du mur alors que sa mère est dans le coma à la suite d’un infarctus. Celle‐ci a toujours été quelqu’un d’actif, participant avec enthousiasme à l’animation d’une chorale. Les mois passent et le coma continue. La ville se transforme, les voitures occidentales sillonnent les rues, les publicités envahissent les murs. Au bout de 8 mois, elle ouvre les yeux dans une ville qu’elle ne peut plus reconnaître. Alex veut absolument lui éviter un choc brutal que son cœur affaibli ne pourrait supporter. Profitant de son alitement, avec l’aide de sa famille et de ses amis, il reconstruit autour d’elle son univers familier, convoque les jeunes chanteurs de la chorale, sollicite l’aide d’un ancien cosmonaute, reconverti en chauffeur de taxi, et s’efforce de faire revivre la RDA dans les 79 m² de l’appartement, remis aux normes socialistes.', 'WDR', 'https://image.tmdb.org/t/p/w1280/oFjNbLWMkrstVUiZkJsES1AKYcl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oJeJTGIXgHIvg83AofuRV3KBf0y.jpg', 'https://www.youtube.com/embed/', 118, '2003', 3.78, 1),
(339, 'Germany', 'Night on Earth', 'An anthology of 5 different cab drivers in 5 American and European cities and their remarkable fares on the same eventful night.', 'Channel Four Films', 'https://image.tmdb.org/t/p/w1280/ktejUHCo6c8DekpOtR3uSb6oDXr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//s7lwxcX5iZuOdoQhM77WyQaPtWv.jpg', 'https://www.youtube.com/embed/b12pcc3ZWho', 128, '1991', 3.77, 1),
(340, 'United States of America', 'Everything Is Illuminated', 'A young Jewish American man endeavors—with the help of eccentric, distant relatives—to find the woman who saved his grandfather during World War II—in a Ukrainian village which was ultimately razed by the Nazis.', 'Stillking Films', 'https://image.tmdb.org/t/p/w1280/gk469Y3fJTlbcAkSNMZc4OtETOK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//v6DoiKp2ThK0VUgWt73JrEN4qa4.jpg', 'https://www.youtube.com/embed/tSUOYY4oukc', 106, '2005', 3.62, 1),
(341, 'France', 'Un crime', 'La vie de Vincent ne reprendra que lorsqu\'il aura retrouvé le meurtrier de sa femme. Sa voisine, Alice, est persuadée qu\'elle le rendrait heureux. Alors elle décide de fabriquer un coupable, pour que Vincent se venge et tourne la page. Mais le coupable idéal n\'existe pas… Le crime parfait non plus.', 'ARP Sélection', 'https://image.tmdb.org/t/p/w1280/ms5tA7A2xc1EOqc2mVvcFrnH6gO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2I0pJ1IEoPTlB1K807CSTw7SQ5w.jpg', 'https://www.youtube.com/embed/fWwka2LIsU4', 102, '2006', 2.88, 1),
(342, 'Germany', 'Summer Storm', 'Tobi and Achim, the pride of the local crew club, have been the best of friends for years and are convinced that nothing will ever stand in the way of their friendship. They look forward to the upcoming summer camp and the crew competition. Then the gay team from Berlin arrives and Tobi is totally confused. The evening before the races begin, the storm that breaks out is more than meteorlogical...', 'Claussen+Wöbke Filmproduktion', 'https://image.tmdb.org/t/p/w1280/vvoOOEgSv2kKVxIqTZvFwtPp9eI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mjCTpAo0GIfK8tzt1YPJuy1dA9S.jpg', 'https://www.youtube.com/embed/A4YghiZxHfw', 98, '2004', 3.35, 1),
(343, 'United States of America', 'Harold and Maude', 'The young Harold lives in his own world of suicide-attempts and funeral visits to avoid the misery of his current family and home environment. Harold meets an 80-year-old woman named Maude who also lives in her own world yet one in which she is having the time of her life. When the two opposites meet they realize that their differences don’t matter and they become best friends and love each other.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/t7qEuGwDjcYu8ajaKZ68DeDnOxw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fJid19GoQFdbE4bRs0vk5RWYrfx.jpg', 'https://www.youtube.com/embed/FYBlob_d2t8', 91, '1971', 3.82, 1),
(344, 'Germany', 'Bang Boom Bang', 'La vie pourrait être géniale pour le voleur de banque Keek: Son pote Kalle est en train de faire le coup pour son dernier coup, tandis que Keek doit garder le butin. Kalle passera deux autres années en prison, donc Keek n\'est pas vraiment dérangé par le fait qu\'il a perdu la plupart de l\'argent en pariant sur les courses de chevaux. Mais alors Kalle regarde une vidéo porno \'mettant en vedette\' sa femme et il se libère pour se venger. Soudainement, Keek a désespérément besoin d\'argent et même le plan le plus étrange semble prometteur.', 'Traumwerk Filmproduktion GmbH', 'https://image.tmdb.org/t/p/w1280/wffvNQYOry50oHhe7aytyT4s2mU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hNMC5goV4L5rWaD33bqldKcmxRA.jpg', 'https://www.youtube.com/embed/', 110, '1999', 3.77, 1),
(345, 'United Kingdom', 'Eyes Wide Shut', 'After Dr. Bill Harford\'s wife, Alice, admits to having sexual fantasies about a man she met, Bill becomes obsessed with having a sexual encounter. He discovers an underground sexual group and attends one of their meetings -- and quickly discovers that he is in over his head.', 'Stanley Kubrick Productions', 'https://image.tmdb.org/t/p/w1280/knEIz1eNGl5MQDbrEAVWA7iRqF9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cAZ87S5bONxKMMAlPxK8LZvdOcm.jpg', 'https://www.youtube.com/embed/', 159, '1999', 3.75, 1),
(346, 'Japan', 'Les Sept Samouraïs', 'Au XVIème siècle, au Japon, des paysans décident d\'embaucher des samouraïs pour protéger leur village, et en trouvent sept. Ces hommes organisent la défense du village contre quarante brigands.', 'TOHO', 'https://image.tmdb.org/t/p/w1280/itaaGjeYL5ZzufV8BOxkTYQxx4K.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qvZ91FwMq6O47VViAr8vZNQz3WI.jpg', 'https://www.youtube.com/embed/5dZioLIejeo', 207, '1954', 4.23, 1),
(347, 'Germany', 'Les Hommes le dimanche', 'Le week-end berlinois de cinq jeunes gens de condition modeste. Un des derniers films muets allemands et la première mise en scène de Robert Siodmak.', 'Filmstudio 1929', 'https://image.tmdb.org/t/p/w1280/8eAROyk8JDbImKKLYYcpaTHkHzi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9Ldf2rbtTpIvars9mf896XhFMvq.jpg', 'https://www.youtube.com/embed/', 74, '1930', 3.61, 1),
(348, 'United States of America', 'Alien, le huitième passager', 'En 2122, le Nostromo, vaisseau de commerce, fait route vers la Terre avec à son bord un équipage de sept personnes en hibernation et une cargaison de minerais. Il interrompt soudain sa course suite à la réception d’un mystérieux message provenant d’une planète inexplorée. Réveillé par l’ordinateur de bord, l’équipage se rend sur place et découvre les restes d’un gigantesque vaisseau extraterrestre dont le seul passager semble être mort dans d’étranges circonstances…', 'Brandywine Productions', 'https://image.tmdb.org/t/p/w1280/l8CES84JndFlNfBNMxdLRYaLvI6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//AmR3JG1VQVxU8TfAvljUhfSFUOx.jpg', 'https://www.youtube.com/embed/Pyw9Szhyruw', 117, '1979', 4.07, 1),
(349, 'France', 'Crustacés et coquillages', 'C\'est l\'été. Marc emmène sa famille au bord de la Méditerranée dans la maison où il passait ses vacances quand il était adolescent. Béatrix, son épouse, doit partager son temps entre sa famille et son amant exigeant, venu la rejoindre.Leur fille Laura, 19 ans, attend avec impatience l\'arrivée de son petit copain motard qui l\'emmènera vers d\'autres rivages. Leur fils Charly reçoit Martin, son meilleur ami, dont Béatrix et Marc ne tardent pas à comprendre qu\'il est homosexuel. Ils en tirent un peu rapidement des conclusions concernant les préférences sexuelles de leur fils...', 'Bac Films', 'https://image.tmdb.org/t/p/w1280/cddLDg4CTg0g7QItlSCEyEagzPY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qJyv8aRRwPhI5jX98XMmluWEdDq.jpg', 'https://www.youtube.com/embed/', 93, '2005', 3.05, 1),
(350, 'France', 'Le Diable s’habille en Prada', 'Fraîchement diplômée, Andrea débarque à New York et décroche le job de rêve. Mais en tant qu’assistante de la tyrannique rédactrice en chef d’un prestigieux magazine de mode, elle va vite découvrir ce que le mot « enfer » veut dire…', 'Fox 2000 Pictures', 'https://image.tmdb.org/t/p/w1280/vTIBjWMWx1p5Wv2J3IRhEW13lrj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//CpLAfXgSNeNRRbRzPrTuzKmIHO.jpg', 'https://www.youtube.com/embed/SkXERnN-vzw', 110, '2006', 3.69, 1),
(351, 'Germany', 'Longing', 'An average, everyday metalworker and volunteer firefighter content in his marriage to his childhood sweetheart finds his emotions unexpectedly stirred when he falls for a pretty waitress from a nearby town.', 'Rommel Film', 'https://image.tmdb.org/t/p/w1280/sRihbZIwNLXDyv5OC6wDWPSGhEM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//w6He2Tnxatr717Qm6lxCtno8SeZ.jpg', 'https://www.youtube.com/embed/', 88, '2006', 3.25, 1),
(363, 'Germany', 'Head-On', 'With the intention to break free from the strict familial restrictions, a suicidal young woman sets up a marriage of convenience with a forty-year-old addict, an act that will lead to an outburst of envious love.', 'Corazón International', 'https://image.tmdb.org/t/p/w1280/qcWWH76OYTOdk5JHzHba6eindu3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5SV2p8jI3kGH3jzyX5p1C6PjPqt.jpg', 'https://www.youtube.com/embed/JcpER0ZQFIM', 117, '2004', 3.72, 1),
(364, 'United States of America', 'Batman : Le Défi', 'Abandonné à la naissance à cause de sa difformité, le surdoué et richissime héritier Oswald Cobblepot grandit dans les égouts de Gotham City parmi une troupe de saltimbanques et se fait appeler « Le Pingouin ». Des années plus tard, il s\'associe à l\'homme d\'affaires Max Shreck pour corrompre les habitants de Gotham et devenir maire. Le justicier masqué Batman, alias Bruce Wayne, tente de les arrêter. Entretemps, Selina Kyle, timide secrétaire effacée travaillant pour Shreck, découvre la preuve des intentions peu louables de son patron. Ce dernier tente de l\'assassiner. Selina jure d\'obtenir vengeance...', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/aExqFVyVwqKClvnMxy6ujaFOHM7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3WP0RObZ2t7ShHfqQpKPljF9B22.jpg', 'https://www.youtube.com/embed/SU8QKdCk6VY', 126, '1992', 3.45, 1),
(377, 'United States of America', 'Les Griffes de la Nuit', 'Avec son gant aux griffes aiguisées, un assassin défiguré du nom de Freddy Krueger rôde dans la nuit, et transforme les pires cauchemars de ses victimes en réalité. Pour rester en vie, il faut rester éveillé...', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/hshCRdx9uNceOGdftaRfIK6S7DT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//g9ROrZey0JYp7kf8DoAyZtKnObj.jpg', 'https://www.youtube.com/embed/3S7r-i29OKo', 90, '1984', 3.66, 1),
(378, 'United States of America', 'Arizona Junior', 'Hi, impénitent cambrioleur de supermarchés, passe beaucoup de temps dans la prison de Tempe en Arizona. Il y rencontre un jour Ed, charmante femme policier, dont il tombe éperdument amoureux. Terminé les braquages, il se marie et part pour l’usine qui ressemble somme toute à la prison. Hi et Ed voudraient un enfant mais Ed est stérile. Or un jour des quintuplés font la une de la presse locale. Hi et Ed décident d’en voler un. Sur cinq, cela ne se verra pas trop.', 'Circle Films', 'https://image.tmdb.org/t/p/w1280/awYB5yuZ7PdWybDlQ7jdyzYwD2t.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kYB4Le7xjOckmiMGgroElQTZiwY.jpg', 'https://www.youtube.com/embed/', 94, '1987', 3.51, 1),
(379, 'United States of America', 'Miller\'s Crossing', 'A l\'époque de la Prohibition, le gangster Tom Reagan, bras droit d\'un caïd irlandais, trahit et manipule son entourage, l\'utilisant à ses propres fins, même par la violence, afin de se faire une place.', 'Circle Films', 'https://image.tmdb.org/t/p/w1280/3gBrkByOEdRnUK66voFbDUU05QR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3EJ7lQ9VOnvFLv2KrJOtlGA3uzT.jpg', 'https://www.youtube.com/embed/', 122, '1990', 3.74, 1),
(380, 'United States of America', 'Rain Man', 'À la mort de son père, Charlie Babbitt hérite d\'une vieille Buick qu\'il convoitait depuis longtemps, mais se voit spolié de quelque trois millions de francs versés à l\'Institution psychiatrique Wallbrook au profit d\'un bénéficiaire anonyme. Charlie se rend a Wallbrook et découvre l\'heureux bénéficiaire. Il s\'agit de Raymond, savant autiste, celui qu\'il appelait dans son enfance Rain Man, qui représente ses seuls souvenirs heureux et qui n\'est autre que son frère.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/eq9ruJmq8E6Mju7NLoyhcMUQYtQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mrfbeWcjgSaZ9NEb0xJMR9xzSeB.jpg', 'https://www.youtube.com/embed/dBSstaTiq14', 133, '1988', 3.88, 1),
(381, 'United States of America', 'To Catch a Thief', 'An ex-thief is accused of enacting a new crime spree, so to clear his name he sets off to catch the new thief, who’s imitating his signature style.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/cbMRkBGBgo3aLJK2M4MyicvkPLQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//q0RgndABwmpooJamrCkbNPb8dG9.jpg', 'https://www.youtube.com/embed/YIc5SDKEC6g', 106, '1955', 3.67, 1),
(400, 'United States of America', 'Dernières heures à Denver', 'Jimmy le Saint gère une affaire un peu particulière : il enregistre les malades en phase terminale afin qu\'ils puissent donner des \"conseils d\'après vie\" à tous ceux qui leur survivent. Mais le business ne fonctionne pas bien, et ses dépenses personnelles deviennent trop importantes. Devant les dettes, il accepte de faire une faveur à un caïd : lui et son équipe doivent juste effrayer un type. Mais l\'opération tourne mal...', 'Miramax', 'https://image.tmdb.org/t/p/w1280/75p3gUkYQJAtrrhKdqEhHz3RMKZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7fEOKdQIfbkOxy0enLtpyPGUsTm.jpg', 'https://www.youtube.com/embed/oOoPdKOR-YE', 116, '1995', 3.25, 1),
(401, 'United States of America', 'Garden state', 'Acteur de télévision, Andrew « Large » Largeman est obligé de retourner dans son New Jersey natal pour l\'enterrement de sa mère. Soudain, il se retrouve sans les antidépresseurs et les 3 000 kilomètres qui le protégeaient de son histoire… Après 9 ans d\'absence, Large revoit son père, un vieil homme dominateur, mais aussi tous ceux avec qui il a grandi. Ils sont aujourd\'hui fossoyeur, employé de fast-food ou magouilleur professionnel… Sa rencontre avec la jolie Sam va le bouleverser encore un peu plus. Elle est son exacte contraire, vivante et audacieuse. Entre passé et futur, entre douleur et joie, Large va découvrir qu\'il est peut-être temps de commencer à vivre…', 'Fox Searchlight Pictures', 'https://image.tmdb.org/t/p/w1280/nL3NRcDGs1JXXSRSmSsuj6Y5UbV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2mu6XkJE0B6nK5jeOvXOyWPVmhw.jpg', 'https://www.youtube.com/embed/2Sxljz-My1w', 102, '2004', 3.55, 1),
(402, 'France', 'Basic Instinct', 'Nick Curran, inspecteur de police à San Francisco, enquête sur le meurtre d\'une star du rock, Johnny Boz, tué de trente et un coups de pic à glace par une inconnue alors qu\'il faisait l\'amour. Nick apprend que le chanteur fréquentait Catherine Tramell, riche et brillante romancière. Au cours de son enquête, il s\'aperçoit que les parents de Catherine sont morts dans un accident suspect, que son professeur de psychologie a été assassiné dix ans plus tôt à coups de pic à glace et qu\'enfin, une de ses meilleures amies a, en 1956, tué ses trois enfants et son mari.', 'Carolco Pictures', 'https://image.tmdb.org/t/p/w1280/uAYVMTscCciqLFhbAbzqFJx6g33.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7FRraud59N3s10bbf9bfYjvwx3v.jpg', 'https://www.youtube.com/embed/gBQ1zdGjeAw', 130, '1992', 3.45, 1),
(403, 'United States of America', 'Miss Daisy et son chauffeur', 'Miss Daisy a soixante-douze ans.Elle est riche, énergique, autoritaire... et juive. Son chauffeur est un peu plus jeune. Il est pauvre, serviable, compétant... et noir. Entre ces deux là, c\'est à la fois la haine et l\'amitié, l\'humour et la colère, la tendresse et la violence. Etalée sur 25 ans, l\'extraordinaire histoire de ce duo pas comme les autres a remporté 4 OSCARS à Hollywood.', 'The Zanuck Company', 'https://image.tmdb.org/t/p/w1280/VATOAqeD5aEZLZLLBuSDV5M0dR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kmYVtq3uNQNrveVMuGmO8o4De05.jpg', 'https://www.youtube.com/embed/dWkh6yOTv28', 99, '1989', 3.61, 1),
(404, 'United States of America', 'Une histoire vraie', 'Comme son titre l\'indique, il s\'agit bien d\'une histoire vraie, celle d\'Alvin Straight qui, a soixante-treize ans, après une mauvaise chute, décidé de quitter Laurens, village du nord de l\'Iowa, pour retrouver son frère ainé qui vient d\'avoir une attaque. Les deux frères sont fâchés depuis dix ans.', 'Walt Disney Pictures', 'https://image.tmdb.org/t/p/w1280/gL63NnHslMF1OF8m5ogvkzbOAOZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1S81PpyGwS8eVx4W75uSKzMw4B0.jpg', 'https://www.youtube.com/embed/', 111, '1999', 3.85, 1),
(405, 'Italy', 'La strada', 'Gelsomina a été vendue par sa mère à Zampano, qui la brutalise et ne cesse de la tromper. Ils partent ensemble sur les routes, vivant misérablement du numéro de saltimbanque de Zampano. Surgit Il Matto (le fou), violoniste et poète, qui seul sait parler à Gelsomina.', 'Ponti-De Laurentiis Cinematografica', 'https://image.tmdb.org/t/p/w1280/eKdSqv9wPPhdzb6cVrcEujSo3lp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5Pl47mB0Jnrg4oHoO0sVdJ6WMRL.jpg', 'https://www.youtube.com/embed/jfRp_S-4nWQ', 100, '1954', 3.98, 1),
(406, 'France', 'La Haine', 'After a chaotic night of rioting in a marginal suburb of Paris, three young friends, Vinz, Hubert and Saïd, wander around unoccupied waiting for news about the state of health of a mutual friend who has been seriously injured when confronting the police.', 'Kasso Productions', 'https://image.tmdb.org/t/p/w1280/8rgPyWjYZhsphSSxbXguMnhN7H0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//viGCwLxupyoaLsa6hrnu1gYrB0B.jpg', 'https://www.youtube.com/embed/y88-ZYB0R9I', 98, '1995', 4.04, 1),
(407, 'Germany', 'L\'Engrenage', 'Gabriel est turc, Bobby est serbe, Costa est grec. Ces trois copains forment un petit gang qui sevit a Hambourg. Gabriel est chauffeur de taxi et reve de partir en Turquie. Costa survit grace a de petits larcins en promettant a la belle Ceyda, soeur de Gabriel, qu\'il va rentrer dans le droit chemin. Quant a Bobby, il s\'imagine qu\'il peut faire carriere dans la mafia albanaise et reve de vivre une histoire d\'amour avec une belle Allemande. Mais tout va basculer lorsque trafic d\'armes, violence et culture s\'entrechoquent.', 'ZDF', 'https://image.tmdb.org/t/p/w1280/2NqG0XFbVed3vUTXppdgCY9aEaW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qOzN3bxxUgIMgkBNEhLKPqRcIWV.jpg', 'https://www.youtube.com/embed/', 100, '1998', 3.35, 1),
(408, 'United States of America', 'Blanche-Neige et les Sept Nains', 'Blanche Neige est une princesse d’une très grande beauté, ce qui rend jalouse sa belle‐mère. Celle‐ci demande quotidiennement à son miroir magique de lui dire qu’elle est la plus belle; mais un jour, le miroir affirme que la plus belle femme du royaume est Blanche Neige. La reine décide alors de la tuer, mais le garde chargé de cette tâche ne trouve pas le courage et abandonne Blanche Neige dans la forêt. Perdue, à bout de force, elle échoue dans une maison où habitent sept nains.', 'Walt Disney Productions', 'https://image.tmdb.org/t/p/w1280/4mARqREIIwQX8FTa8UWL76rZioK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//n3pJwYuPnkw7JX7tOMbH0GRfBPn.jpg', 'https://www.youtube.com/embed/I0gmCl3fxJs', 83, '1937', 3.56, 1),
(409, 'United Kingdom', 'Le Patient anglais', 'En 1945, quatre personnes déchirées par la guerre se réfugient dans un monastère abandonné de Toscane pour se guérir de leurs maux. Peu à peu le passé va resurgir et la présence d\'un homme mystérieux et méconnaissable, le patient anglais, va bouleverser le destin de ceux qui croisent son chemin.', 'Miramax', 'https://image.tmdb.org/t/p/w1280/r6xJpyD0KuIBW891S1SxNn1XuAQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//v6Xxo34CHXKRmqMwjNknBTDo8Oz.jpg', 'https://www.youtube.com/embed/', 160, '1996', 3.6, 1),
(410, 'Germany', 'Summer in Berlin', 'When you read the title ‘Summer on the Balcony’ you probably think it will be a light Berlin summer comedy but it’s not. This film is an intimate study of two women friends who come to each other because of troubles with everyday life and with men and thus try to enjoy a life based on their ideas.', 'Peter Rommel Productions', 'https://image.tmdb.org/t/p/w1280/9zu21w5SwWDSHZI7P5fv8wJqUz5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//goQ3L7Gzh65A1gcQHeZJxAaQAW8.jpg', 'https://www.youtube.com/embed/', 105, '2005', 3.32, 1),
(411, 'United Kingdom', 'Le Monde de Narnia : Le Lion, la sorcière blanche et l\'armoire magique', 'Le Monde de Narnia : chapitre 1 conte la lutte entre le bien et le mal qui oppose le magnifique lion Aslan aux forces des ténèbres dans le monde magique de Narnia. Grâce à ses sombres pouvoirs, la Sorcière Blanche a plongé Narnia dans un hiver qui dure depuis un siècle, mais une prédiction révèle que quatre enfants aideront Aslan à rompre la malédiction. Lorsque Lucy, Susan, Edmund et Peter Pevensie, quatre frères et sœurs, découvrent ce monde enchanté en y pénétrant à travers une armoire, tout est en place pour une bataille de proportions épiques...', 'Walt Disney Pictures', 'https://image.tmdb.org/t/p/w1280/cnC878qp93R6cjIgWBEBW0dI8tr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9iRRfMZbnpgHDdKi2lczGGYZXDo.jpg', 'https://www.youtube.com/embed/ztFix1KQmSI', 140, '2005', 3.56, 1),
(414, 'United States of America', 'Batman Forever', 'Nul ne sait que Bruce Wayne, le patron d\'un vaste et puissant consortium, l\'homme le plus riche des États-Unis, revêt chaque nuit la combinaison et le masque de cuir de Batman pour voler au secours de ses concitoyens injustement opprimés. Personne, hormis son fidèle majordome Alfred et son vieil ami, le commissaire Gordon.', 'DC Comics', 'https://image.tmdb.org/t/p/w1280/nS2fskuUG0zktxPLSNgsYXbR8iM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//snlu32RmjldF9b068UURJg8sQtn.jpg', 'https://www.youtube.com/embed/', 121, '1995', 2.7, 1),
(415, 'United States of America', 'Batman & Robin', 'Dans cette nouvelle aventure, Batman aura bien besoin de son audacieux partenaire Robin, juché sur sa fringante moto turbo. En effet, le glacial M. Frezze fait régner une vague de froid polaire sur Gotham City avec la complicité de la belle et vénéneuse Poison Ivy, au baiser mortel et aux formes sinueuses, qui rêve de soumettre le monde au pouvoir des femmes-fleurs.', 'DC Comics', 'https://image.tmdb.org/t/p/w1280/rbGlp0egjL8O3BEAjNSSJ66yMMp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//m4UT6yKXhXgbzxpeV35L4jLoJoP.jpg', 'https://www.youtube.com/embed/ce240VBEysQ', 125, '1997', 2.16, 1),
(419, 'Germany', 'Vom Suchen und Finden der Liebe', '', 'Constantin Film', 'https://image.tmdb.org/t/p/w1280/eauZ3KLBcBejZDyXge5HoWJ6zwn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yGTku4DYJ5BiVraUvP3tvTUuYiv.jpg', 'https://www.youtube.com/embed/', 105, '2005', 2.25, 1),
(421, 'United States of America', 'La Vie aquatique', 'Steve Z., le chef de l\'équipe océanographique « Team Zissou », sait que l\'expédition qu\'il conduit est sans doute la dernière, et son plus cher désir est de graver son nom dans l\'Histoire. Parmi les membres de son équipe figurent Ned Plimpton, qui est peut-être ou peut-être pas son fils, Jane Winslett-Richardson, une journaliste enceinte dépêchée par le magazine Oceanographic Explorer, et sa femme Eleanor sa femme que l\'on prétend être « le cerveau de la Team Zissou ». Tandis qu\'ils affrontent tous les dangers, depuis une mutinerie jusqu\'à une attaque de pirates en passant par un « requin jaguar » plus ou moins imaginaire, Zissou est bien forcé d\'admettre que tout ne peut pas être planifié comme il l\'aimerait...', 'American Empirical Pictures', 'https://image.tmdb.org/t/p/w1280/tN5qDs0EGcxAHoB8zNHr8ZPOJ0o.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7tWktnLQ81G8pHUkhuTebcTkcB3.jpg', 'https://www.youtube.com/embed/TEioiiX7UkQ', 118, '2004', 3.56, 1),
(422, 'Italy', 'Huit et demi', 'Un cinéaste dépressif fuit le monde du cinéma et se réfugie dans un univers peuplé de fantasmes.', 'Cineriz', 'https://image.tmdb.org/t/p/w1280/9MQdBEd4oetuKFZemxT6MisLgjg.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hiXMQiwpa0fqPJxWLSMWTbpiWn8.jpg', 'https://www.youtube.com/embed/yLbE1A-PNOg', 138, '1963', 4.1, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(430, 'United States of America', 'Un, deux, trois', 'À Berlin-Ouest, l’ambitieux Mac Namara représente les intérêts de Coca-Cola. Il voudrait bien conquérir le marché de l’Est, ce qui lui vaudrait à coup sûr de l\'avancement. Il entreprend donc de convaincre un trio d’attachés commerciaux soviétiques. Sur ces entrefaites débarque miss Coca, fille du grand patron de la firme et séductrice impénitente. Les tracas ne font que commencer…', 'The Mirisch Company', 'https://image.tmdb.org/t/p/w1280/zMREOOCWAs3xj3AHq8NrfYnQmkO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vo3cB6xkMswMz9gB2X517TmxmI2.jpg', 'https://www.youtube.com/embed/', 115, '1961', 3.78, 1),
(431, 'Canada', 'Cube', 'Un groupe de personnes, sans savoir pourquoi, se retrouve enfermé dans une prison surréaliste, un labyrinthe sans fin constitué de pièces cubiques communicantes et équipées de pièges mortels. Le policier, l’architecte, l’étudiante en mathématiques, la psychologue et l’autiste captifs ne savent qu’une seule chose : chacun possède un don particulier qui, combiné aux autres, peut les aider à s’évader. Au fur et à mesure que la peur grandit, les conflits personnels et les luttes de pouvoir s’amplifient. Il leur faudrait pourtant réussir à s’associer pour échapper à une mort certaine.', 'Cube Libre', 'https://image.tmdb.org/t/p/w1280/Ar7Tyhd6eUK7oUGqKqa5fjZpKoA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1AZz3SSYB3i9FOfc8r3enewSsRM.jpg', 'https://www.youtube.com/embed/YBOAlSgRQrM', 90, '1997', 3.4, 1),
(433, 'United States of America', 'Mary Poppins', 'Rien ne va plus dans la famille Banks. La nurse vient de donner ses huit jours. Et ni M. Banks, banquier d’affaire, ni son épouse, suffragette active, ne peuvent s’occuper des enfants Jane et Michaël. Ces derniers passent alors une annonce tout à fait fantaisiste pour trouver une nouvelle nurse. C’est Mary Poppins qui répond et apparaît dès le lendemain, portée par le vent d’Est. Elle entraîne aussitôt les enfants dans son univers merveilleux. Un des plus célèbres films de la production Disney.', 'Walt Disney Productions', 'https://image.tmdb.org/t/p/w1280/ytoxKwiFM3ojHsYSljFAVvsWfTS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//prVH6SyQ6yDmzVxxkcr57zhLM5C.jpg', 'https://www.youtube.com/embed/iy82CmAK8Xs', 134, '1964', 3.79, 1),
(434, 'Germany', 'Les enragés', 'Après s\'être séparée de son riche amant, Myriam emménage avec son fils de 15 ans, Michael, dans la banlieue de Berlin. Bien qu\'il réussisse assez rapidement à s\'intégrer, le jeune homme est victime de racket dans sa nouvelle école. Michael cherche alors désespéremment une solution pour trouver de l\'argent...', 'Boje Buck Produktion GmbH', 'https://image.tmdb.org/t/p/w1280/vYd5v3GXDBwPvK6897gNj8DEHkB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cFMl2jt9ABthgLbCgZ08jWLQMd7.jpg', 'https://www.youtube.com/embed/', 98, '2006', 3.34, 1),
(435, 'United States of America', 'Le Jour d\'Après', 'Le climatologue Jack Hall avait prédit l\'arrivée d\'un autre âge de glace, mais n\'avait jamais pensé que cela se produirait de son vivant.Un changement climatique imprévu et violent à l\'échelle mondiale entraîne à travers toute la planète de gigantesques ravages : inondations, grêle, tornades et températures d\'une magnitude inédite. Jack a peu de temps pour convaincre le Président des États-Unis d\'évacuer le pays pour sauver des millions de personnes en danger, dont son fils Sam. A New-York où la température est inférieure à - 20° C, Jack entreprend une périlleuse course contre la montre pour sauver son fils.', 'The Mark Gordon Company', 'https://image.tmdb.org/t/p/w1280/bbuMjk5ZbaAIKYhYhzMeWhFfqND.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fXJhA3pjLMDkHPgZ2GVhRDXA5M3.jpg', 'https://www.youtube.com/embed/4uQTj9tsxIo', 123, '2004', 3.25, 1),
(436, 'Ecuador', 'Maria, pleine de grâce', 'Une jeune Colombienne veut quitter son pays. Elle ne trouve qu\'un seul moyen : accepter d\'être \"une mule\" pour le compte d\'un trafiquant.', 'Journeyman Pictures', 'https://image.tmdb.org/t/p/w1280/piF1bDCR5kXrapCuJM5mQyzRCGK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//immNDdI0qx7IOriuZcsK3PSFUu4.jpg', 'https://www.youtube.com/embed/', 101, '2004', 3.62, 1),
(437, 'Canada', 'Cube² : Hypercube', 'Lorsqu’elles se réveillent, 8 personnes qui ne se connaissent pas se découvrent prisonnières d’un labyrinthe de salles cubiques : l’hypercube. Dans cette étrange structure, les lois connues du temps et de l’espace ne s’appliquent plus. Aucun des captifs ne sait comment ni pourquoi il a atterri là. La survie de chacun dépend de la capacité du groupe à percer les secrets du cauchemar géométrique avant qu’il ne se désintègre, entraînant la mort de ceux qui y sont retenus… Hallucination collective, réalité simulée, conspiration démoniaque ou dimension parallèle, ils doivent comprendre. Le général Maguire, Jerry, un ingénieur électricien, Simon, un consultant en management, Kate, une psychothérapeute, Max, un concepteur de jeux, Sasha, une étudiante aveugle, Julia, une avocate, et Mme Paley, une mathématicienne à la retraite, vont devoir décrypter ce lieu qui défie l’esprit…', 'Lions Gate Films', 'https://image.tmdb.org/t/p/w1280/zHZYE83eByeHyQkGMJL4KM0Fiw7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zJqv6s4XCdHWrnoqfLqlGzzxSjH.jpg', 'https://www.youtube.com/embed/7kCvFDEB7uU', 95, '2002', 2.75, 1),
(438, 'Canada', 'Cube Zero', 'Éric Wynn est un homme respectable qui travaille pour une compagnie dont il croit tout connaître. Son travail : surveiller des gens prisonniers d’une sorte de Cube, prison métallique étrange. Mais quand une innocente se fait capturer et est enfermée dans le Cube, Éric commence à comprendre qu’il y a quelque chose qui se passe derrière ce que raconte la compagnie pour laquelle il travaille. Décidant de ne pas se laisser faire, Éric décide d’entrer lui‐même dans le Cube, pour sauver le maximum de gens. Mais l’horreur ne commence pas à l’intérieur du Cube, mais à l’extérieur. Ceux qui épient sont épiés, et la fin n’est que le commencement…', 'Mr. X', 'https://image.tmdb.org/t/p/w1280/7S1B4dWnHr1VCcNSd3zwKVQxJQB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//erA8i1SvSfq3f6he4cGucsqJR9E.jpg', 'https://www.youtube.com/embed/tJehn9uSjQ0', 97, '2004', 2.84, 1),
(439, 'France', 'La Dolce Vita', 'Journalist and man-about-town Marcello struggles to find his place in the world, torn between the allure of Rome\'s elite social scene and the stifling domesticity offered by his girlfriend, all the while searching for a way to become a serious writer.', 'Cinecittà', 'https://image.tmdb.org/t/p/w1280/kZF1akNxeNJiCiMRWdF0fe0x48H.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zPbu0CFnAT2kYfbGWjgZBTajmzi.jpg', 'https://www.youtube.com/embed/BtrtW0SoYOg', 176, '1960', 4.07, 1),
(440, 'United States of America', 'Aliens vs Predator: Requiem', 'The iconic creatures from two of the scariest film franchises in movie history wage their most brutal battle ever—in our own backyard. The small town of Gunnison, Colorado becomes a war zone between two of the deadliest extra-terrestrial life forms—the Alien and the Predator. When a Predator scout ship crash-lands in the hills outside the town, Alien Facehuggers and a hybrid Alien/Predator are released and begin to terrorize the town.', 'Dune Entertainment', 'https://image.tmdb.org/t/p/w1280/d3xsKYqRO1Ys5UddRstbeb0Kf95.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//y8yvIrmoM2PLuJcSto7OmOfsXQj.jpg', 'https://www.youtube.com/embed/ZMwfnUyikW0', 94, '2007', 2.57, 1),
(441, 'United States of America', 'Human Nature', 'Lila, une naturaliste à la pilosité abondante, et Nathan, un scientifique obsédé par les bonnes manières, ont perdu foi en la race humaine. Elle a trouvé le repos en allant vivre dans la jungle et en s\'entourant d\'animaux. Lui mène des expériences sur des souris en espérant rendre les hommes meilleurs. Sur leur route, ils font la connaissance de Puff, un homme-singe recueilli dans la jungle, et tentent de l\'éduquer. Mais Lila va se battre pour préserver l\'âme vierge et innocente de cet individu hors norme.', 'Senator Film', 'https://image.tmdb.org/t/p/w1280/dFjjZPWm1oTH6CbyzDvoQ6WaZm6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kz0xtrWKisCEOPB2qdiSWOUigkd.jpg', 'https://www.youtube.com/embed/', 96, '2001', 3, 1),
(442, 'Denmark', 'Musique rock de Vittula', 'Début des années 1960. Copains depuis l\'âge de 7 ans, Niila et Matti vivent à Pajala, bourgade paumée du nord de la Suède. Il ne s\'y passe jamais rien, sauf quelques tensions entre Suédois et Finlandais de souche, la majorité d\'entre eux parlant un étrange volapük. Ici, les \"vrais hommes\" lèvent bien le coude, chassent l\'élan et font beaucoup d\'enfants qu\'ils n\'hésitent pas à battre pour leur apprendre le respect de Dieu. Tout change le jour où Niila échange la bible de sa grand-mère contre un 45-tours des Beatles. Avec leur nouveau professeur de musique, lui et Matti décident de monter un groupe de rock... Une tragi-comédie exquise et très rythmée, qui joue sur une multitude de registres : on y trouve à la fois le côté chronique adolescente du Péril jeune de Cédric Klapisch, le psychédélisme d\'Emir Kusturica, le laconisme d\'Aki Kaurismaki et les doutes d\'Ingmar Bergman. L\'occasion aussi de revoir la sublime Kati Outinen, qui interprète la mère de Niila.', 'Solar Films', 'https://image.tmdb.org/t/p/w1280/28TLfHa3df8jF7hOIlHmuRcPOts.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wsQWCwnPV3HmKUU4LD6CEdlc3OE.jpg', 'https://www.youtube.com/embed/', 101, '2004', 3.18, 1),
(445, 'Austria', 'Caché', 'Georges, journaliste littéraire, reçoit des vidéos — filmées clandestinement depuis la rue — où on le voit avec sa famille, ainsi que des dessins inquiétants et difficiles à interpréter. Il n\'a aucune idée de l\'identité de l\'expéditeur. Peu à peu, le contenu des cassettes devient plus personnel, ce qui laisse soupçonner que l\'expéditeur connaît Georges depuis longtemps. Ce dernier sent qu\'une menace pèse sur lui et sur sa famille, mais comme cette menace n\'est pas explicite, la police lui refuse son aide…', 'Les Films du Losange', 'https://image.tmdb.org/t/p/w1280/vSIGVNCLDnw1NYH8mgSrxC5jYQn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2LDz3KmQ83EggYIiTwLvrZwWdA5.jpg', 'https://www.youtube.com/embed/', 117, '2005', 3.53, 1),
(446, 'Germany', 'Lichter', '', 'Claussen+Wöbke Filmproduktion', 'https://image.tmdb.org/t/p/w1280/vpKnM9Vc8jADfOfhM9ftOCimKv9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 105, '2003', 3.79, 1),
(451, 'France', 'Leaving Las Vegas', 'Ben, scénariste alcoolique, décide de partir à Las Vegas après s\'être fait licencier par la maison de production pour laquelle il travaillait. Il se donne quatre semaines pour boire jusqu\'à en mourrir et s\'installe pour cela dans un petit hôtel miteux à proximité des bars qui ne ferment jamais. Il rencontre Sera, une jeune prostituée dont il tombe amoureux. Elle décide de l\'héberger et l\'assistera jusqu\'à ses derniers instants.', 'Initial Productions', 'https://image.tmdb.org/t/p/w1280/xetp8XKuHz3VxXbkRavqBJFEkea.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qRLP2gVKkn3Jrk2ICepseUkddlg.jpg', 'https://www.youtube.com/embed/6aqjImwniec', 111, '1995', 3.65, 1),
(452, 'Denmark', 'Les Idiots', 'Un groupe de jeunes gens dotés d\'un appétit de vie féroce, passe son temps à traquer la bêtise. Ils explorent les valeurs cachées et les moins appréciées de l\'idiotie et les confrontent à la société dans laquelle ils vivent. Ils sont ravis à chaque fois que l\'un d\'entre eux trouve une nouvelle manière de dépasser les limites de la bêtise. Karen rencontre par hasard trois membres du groupe et devient involontairement impliquée dans leur petit jeu.', 'Zentropa Entertainments', 'https://image.tmdb.org/t/p/w1280/rtCENF2B195nKbQ00zcvYkM1IGx.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//16UEQo8TSAJoAMNdoEJm7lJIABf.jpg', 'https://www.youtube.com/embed/', 117, '1998', 3.25, 1),
(453, 'United States of America', 'Un homme d\'exception', 'En 1947, étudiant les mathématiques à l’université de Princeton, John Forbes Nash Jr., un brillant élève, élabore sa théorie économique des jeux. Pour lui, les fluctuations des marchés financiers peuvent être calculées très précisément. Au début des années cinquante, ses travaux et son enseignement au Massachusetts Institute of Technology ne passent pas inaperçus et un représentant du Département de la Défense, William Parcher, se présente à lui pour lui proposer d’aider secrètement les États‐Unis. La mission de John consiste à décrypter dans la presse les messages secrets d’espions russes, censés préparer un attentat nucléaire sur le territoire américain. Celui‐ci y consacre rapidement tout son temps, et ce au détriment de sa vie de couple avec Alicia. Ce job n’est toutefois pas sans risques : des agents ennemis surveillent ses moindres faits et gestes. Mais personne ne le croit.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/iYAGo8B2NIrtyPoRowe7wlT3twa.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vVBcIN68kFq681b4lObiNJhEVro.jpg', 'https://www.youtube.com/embed/tZJufJqEccA', 134, '2001', 3.93, 1),
(454, 'Mexico', 'Roméo + Juliette', 'Aux Etats-Unis, à Verona Beach, deux richissimes familles se livrent une terrible guerre. Tybalt, neveu adoré de lady Capulet, entouré de ses hommes de main, vêtus de noir, affronte régulièrement le clan des Montaigu, dont fait partie Roméo, peu concerné par ces histoires familiales. Il assiste d\'ailleurs, masqué, à une fête donnée chez les Capulet. Là, il tombe éperdument amoureux de Juliette, la fille de la maison. Ses sentiments s\'avèrent réciproques. Les deux tourtereaux font rapidement appel au frère Laurent pour les marier. Mercutio, un ami de Roméo, se prend de querelle avec Tybalt. Roméo tente de s\'interposer, mais ne peut bientôt plus que pleurer la mort de Mercutio et en tirer une éclatante vengeance...', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/mszYLUhrxU4wyjx2Q3Z8gKi5QKp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//m0miV65ZZIp13TNHJSRUF6vmCos.jpg', 'https://www.youtube.com/embed/oO4jqwpt25k', 120, '1996', 3.4, 1),
(455, 'Germany', 'Bend It Like Beckham', 'Jess Bhamra, the daughter of a strict Indian couple in London, is not permitted to play organized soccer, even though she is 18. When Jess is playing for fun one day, her impressive skills are seen by Jules Paxton, who then convinces Jess to play for her semi-pro team. Jess uses elaborate excuses to hide her matches from her family while also dealing with her romantic feelings for her coach, Joe.', 'Kintop Pictures', 'https://image.tmdb.org/t/p/w1280/6F2tFbxgqcSIMK5WOZfwoHXaROc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9Dc0ZMoMmPSuRYZ1lt9NLLjMPEs.jpg', 'https://www.youtube.com/embed/uZsXumwV_PM', 112, '2002', 3.15, 1),
(457, 'Austria', 'Sissi', 'The young Bavarian princess Elisabeth, who all call Sissi, goes with her mother and older sister Néné to Austria where Néné will be wed to an emperor named Franz Joseph, Yet unexpectedly Franz runs into Sissi while out fishing and they fall in love.', 'Herzog', 'https://image.tmdb.org/t/p/w1280/4GtssGHNZprHVSdCouszcBb87Se.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rKs8y5WlXcYX5GCbDkXcXybGteZ.jpg', 'https://www.youtube.com/embed/', 102, '1955', 3.7, 1),
(458, 'Austria', 'Sissi Impératrice', 'Sissi est maintenant l’impératrice d’Autriche‐Hongrie. Ce qui ne va pas sans heurts puisque sa nature spontanée et enjouée se retrouve confrontée aux rigueurs dues à son rang…', 'Erma-Film', 'https://image.tmdb.org/t/p/w1280/q2AY50ypImTI9Rcvc92VmSc1iKH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9Hc26MlSjRCCGtR3srxbBxq6K4E.jpg', 'https://www.youtube.com/embed/', 107, '1956', 3.55, 1),
(459, 'Germany', 'Sissi: The Fateful Years of an Empress', 'After a wonderful time in Hungary Sissi falls extremely ill and must retreat to a Mediterranean climate to rest. The young empress’ mother takes her from Austria to recover in Madeira.', 'Ernst Marischka & Co', 'https://image.tmdb.org/t/p/w1280/6LQaN8KGQcakpRHkGac2FqWfLxQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//AcGg5H2R5YHDISU6QHlS8xozlYc.jpg', 'https://www.youtube.com/embed/', 109, '1957', 3.6, 1),
(460, 'Germany', 'Monsieur Zucker joue son va-tout', 'Menacé de prison par l’huissier et de divorce par sa femme, Jaeckie Zucker compte sur une victoire à un tournoi de billard pour s’en sortir. Jusqu’au jour où il apprend le décès de sa mère. Son frère Samuel et sa famille s’apprêtent à débarquer à Berlin pour l’enterrer. Or, Jaeckie Zucker, de son vrai nom Jakob Zuckermann, ne veut rien avoir à faire avec eux. Mais c’est sans compter la dernière volonté de la défunte : ses fils n’hériteront qu’à condition de se réconcilier et d’observer, avec leurs familles, les sept jours de deuil traditionnels…', 'WDR', 'https://image.tmdb.org/t/p/w1280/fHQ00dcvz8bw8hKJk6cOdbLcmBD.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//drK0PlCLkKUz5MmYHNHkVLPwFh3.jpg', 'https://www.youtube.com/embed/', 87, '2004', 3.21, 1),
(462, 'United States of America', 'Erin Brockovich, seule contre tous', 'Mère élevant seule ses trois enfants, Erin Brockovich n\'avait vraiment pas besoin d\'un accident de voiture. D\'autant que le responsable sort du tribunal financièrement indemne. Obligée de trouver rapidement un travail pour couvrir tous ses frais médicaux et de justice, Erin obtient de son avocat de l\'employer comme archiviste dans son cabinet. Son allure et son franc-parler ne lui valent pas des débuts faciles mais elle apprend vite. En classant des documents, Erin déterre une affaire louche d\'empoisonnement et décide de se jeter dans la bataille.', 'Jersey Films', 'https://image.tmdb.org/t/p/w1280/xAVH2hsaKCb7lFU4HGHoFT24GKT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3HmLKhahTxX2ALTWlagr92pZrU7.jpg', 'https://www.youtube.com/embed/GMUhdhM3PAo', 131, '2000', 3.71, 1),
(464, 'Denmark', 'La chorale du bonheur', '\"Faire de la musique pour ouvrir le cour des gens.\" C’est le rêve de ce violoniste prodige, avant de devenir un chef d’orchestre célèbre. Mais il quitte tout, pour un petit village du nord de la Suède. Dans une discrétion totale, il va s’occuper de la chorale paroissiale et, par la musique, apporter aux autres tout ce qu’ils n’ont pas. Il se fera des amis et des ennemis. Il rencontrera l\'amour.', 'GF Studios', 'https://image.tmdb.org/t/p/w1280/qtPUrODebW2L8JJSWGIWXjs1tOw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1MUfnjzUBTTEEZKaWWmIruh03Ke.jpg', 'https://www.youtube.com/embed/', 126, '2004', 3.59, 1),
(465, 'France', '36 Fillette', 'Parce qu\'elle est amoureuse d\'un play-boy dont elle ne sait pas s\'il en veut à son corps ou son esprit, une jeune fille qui passe ses vacances dans un camping finit par coucher avec un banal dadais.', 'CB Films', 'https://image.tmdb.org/t/p/w1280/8ClbHCNKkTQggKLKFUVLLVVokdV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uqcYcBve5TDElL5buSzOMHWIqPA.jpg', 'https://www.youtube.com/embed/', 88, '1988', 2.7, 1),
(466, 'United States of America', 'Klute', 'John Klute est détective privé. Un jour, l\'épouse et l\'associé de son ami Tom Gruneman, disparu depuis six mois, lui demandent de le retrouver. Il se rend de Pennsylvanie à New York pour mener l\'enquête. La seule piste est une call-girl, Bree Daniels, à qui Tom aurait adressé des lettres obscènes.', 'Gus Productions', 'https://image.tmdb.org/t/p/w1280/xX2sO8us9JbgCbbS5zLl9LghJI6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bxh7ybql4p24u9WsX1GI9v9PDLg.jpg', 'https://www.youtube.com/embed/ZbQS66Kpgog', 114, '1971', 3.4, 1),
(467, 'United Kingdom', 'The Hole', 'Elizabeth \'Liz\' Dunn, Frances \'Frankie\' Almond Smith, Michael \'Mike\' Steel et Geoffrey \'Geoff\' Bingham , quatre étudiants d\'une prestigieuse université britannique, décident d\'investir un bunker durant trois jours pour s\'essayer à de nombreuses expériences et faire des folies. Cependant il ne parviennent pas à en sortir. Au bout de dix-huit jours, alors que personne ne croit plus les revoir, Liz réapparaît, seule survivante, couverte de sang et traumatisée par ce qui vient de lui arriver. Rapidement, le Dr  Horwood découvre que la jeune fille mélange réalité et fiction. Où se cache la vérité ? Comment Liz en est-elle sortie vivante ?  Tandis que l\'on extirpe des cadavres du bunker, le puzzle du cauchemar se reconstitue peu à peu.', 'Dimension Films', 'https://image.tmdb.org/t/p/w1280/gu6BkNlJHVJYnJAOP2wUUNwKAbb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//o3PJPcTY40mUkj96P6wwhTIN9Rf.jpg', 'https://www.youtube.com/embed/uMqPTOKUneY', 102, '2001', 3.1, 1),
(468, 'United States of America', 'My Own Private Idaho', 'Mike et Scott vivent parmi les marginaux de Portland, partageant leur solitude, les drogues et les hommes ou femmes à qui ils se vendent. Mike est introverti, homo et souffre de crises de narcolepsie. Enfant abandonné, il est obsédé par l\'idée de retrouver sa mère. Scott, lui, est le fils du maire de la ville, un homme qu\'il déteste et qui cherche à lui imposer un avenir tout tracé. Mike ne cache pas son amour à Scott, qui se refuse pourtant à lui. Ensemble, ils prennent la route pour retrouver la mère de Mike. Le voyage les mène en Idaho, puis au-delà, bouleversant leurs valeurs mutuelles...', 'Fine Line Features', 'https://image.tmdb.org/t/p/w1280/ccz20GMMdlGHCsBWyiFjawJUFU9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//stSaFz5CtMXwIj3r4MDjqxqWRot.jpg', 'https://www.youtube.com/embed/', 104, '1991', 3.55, 1),
(469, 'Germany', 'Stranger Than Paradise', 'A Hungarian immigrant, his friend, and his cousin go on an unpredictable adventure across America.', 'Cinesthesia Productions', 'https://image.tmdb.org/t/p/w1280/Q9wdlNjBOti4JhAjAQXphzShw3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oeT5amYwrZiaqsj4QKcOYYa5c5K.jpg', 'https://www.youtube.com/embed/', 89, '1984', 3.59, 1),
(470, 'United States of America', '21 grammes', 'On dit que nous perdons tous 21 grammes au moment précis de notre mort... Le poids de cinq pièces de monnaie. Le poids d\'une barre de chocolat. Le poids d\'un colibri. 21 grammes. Est-ce le poids de notre âme? Est-ce le poids de la vie? Paul attend une transplantation cardiaque. Cristina, ex-junkie, est mère de deux petites filles. Jack sort de prison et redécouvre la foi. A cause d\'un accident, ils vont s\'affronter, se haïr... et s\'aimer.', 'This Is That Productions', 'https://image.tmdb.org/t/p/w1280/jWJQIAxynFP7PaCf98P0WrzfMu8.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aM7fOkJBjHpWcgCVUJRGTEp3Gb9.jpg', 'https://www.youtube.com/embed/TGZui7kLCzE', 124, '2003', 3.67, 1),
(471, 'Germany', 'Bandyta', 'Bastard depicts the distress of needy children and the love of a nurse and a hard boiled criminal. A film from Polish director Maciej Dejczer and actor Til Schweiger’s first international film.', 'Douek Productions', 'https://image.tmdb.org/t/p/w1280/vLNF6iyZ4QZdOwEbkdcN3OKSVm9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zloMlLdJaxc1bNyd3FfZ8DWdLx6.jpg', 'https://www.youtube.com/embed/', 102, '1997', 3.1, 1),
(473, 'United States of America', 'Pi', 'Max, brillant mathematicien, souffrant de migraines intolérables, est néanmoins sur le point de faire la plus grande decouverte de sa vie : décoder la formule numérique qui se cache derrière le marché des changes. C\'est alors que tout bascule dans un immense chaos. Il est a la fois poursuivi par une grande firme de Wall Street qui souhaite dominer le monde de la finance, et par des cabalistes qui tentent de percer les mystères enfouis derrière les nombres secrets.', 'Harvest Filmworks', 'https://image.tmdb.org/t/p/w1280/oPXWSYognG1SsS6GcWQUNJjE7rA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rYpGznw5UExo3ojqRK8eRIfqoEJ.jpg', 'https://www.youtube.com/embed/', 85, '1998', 3.55, 1),
(475, 'United States of America', 'Bonnie et Clyde', 'La dramatique aventure de deux amants révoltés pendant la grande dépression des années trente aux Etats-Unis, inspirée par un fait réel. Film culte réalisé un an avant les événements de 1968.', 'Tatira-Hiller Productions', 'https://image.tmdb.org/t/p/w1280/l7SGiO7BLLAJyZJgWWRMcar5Rbe.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fyzSiE8IWezmd3ls1amHNeOkrEf.jpg', 'https://www.youtube.com/embed/', 110, '1967', 3.75, 1),
(476, 'United States of America', 'Drugstore Cowboy', 'Une vision hallucinante de l\'Amérique contemporaine. La descente aux enfers d\'un junkie qui devient braqueur pour obtenir de l\'argent pour la drogue.', 'Avenue Pictures', 'https://image.tmdb.org/t/p/w1280/AcNMOJGaltVDv08Dxrs28SrfqbA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ydrBuCEfMI4rxh3QFlJfXwqHEY4.jpg', 'https://www.youtube.com/embed/', 98, '1989', 3.57, 1),
(479, 'Germany', 'Shaft', 'New York. Une simple altercation va entraîner l\'Inspecteur John Shaft dans l\'enquête la plus explosive et la plus dangeureuse de sa carrière... L\'affaire commence une nuit, dans un bar de Manhattan où Shaft a été appelé à la suite d\'une agression raciste. Quelques minutes après son arrivée, la victime (l\'étudiant noir Trey Howard) succombe à un traumatisme crânien. La barmaid Diane Palmieri, unique témoin oculaire du drame, désigne alors discrètement à Shaft le coupable : Walter Wade Jr., un gosse de riche qui invoque avec arrogance la légitime défense et défie ouvertement le policier. Shaft arrête Wade, mais l\'avocat Fleming obtient sa libération immédiate.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/kPQyxTzCnguyYGSGasN37cFin4T.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lGDPYuPKgGWTqMnpL88EiYonOG7.jpg', 'https://www.youtube.com/embed/', 99, '2000', 2.99, 1),
(480, 'France', 'Monsoon Wedding', 'As the romantic monsoon rains loom, the extended Verma family reunites from around the globe for a last-minute arranged marriage in New Delhi. This film traces five intersecting stories, each navigating different aspects of love as they cross boundaries of class, continent and morality.', 'IFC Films', 'https://image.tmdb.org/t/p/w1280/nchsMqHcTE7kIylMKQjmEZb4E6H.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//67hLUIzxLS04ZNJalxmVO0ehi78.jpg', 'https://www.youtube.com/embed/8ApEUhwT3t0', 114, '2001', 3.41, 1),
(481, 'Spain', '7 vierges', 'L\'été dans un quartier ouvrier et marginal d\'une ville du Sud. Tano, un adolescent qui purge une peine dans un centre de redressement, reçoit un permis spécial de 48 heures pour assister aux noces de son frère Santacana. Pendant la durée de son permis, Tano retrouve son meilleur ami Richi, avec la ferme intention de vivre ces heures en s\'amusant et faire tout ce qui lui est interdit dans le centre : il se saoule, se drogue, vole, aime, et surtout il revient à la vie. Il se sent libre avec toute la force et l\'insolence de l\'adolescence. Mais à mesure que se déroule son séjour en dehors du centre, Tano assiste aussi à l\'effondrement de tous ses repères : le quartier qui a changé, la famille, l\'amour et l\'amitié. Au-delà d\'un permis de 48 heures, la liberté de Tano devient un voyage imposé vers la maturité.', 'Tesela Producciones Cinematográficas', 'https://image.tmdb.org/t/p/w1280/g3o2jxOM3IpYuT7RPACFNeChYHR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2MdzmoTErMTNeHYD4XGCsMwJiW0.jpg', 'https://www.youtube.com/embed/', 86, '2005', 2.9, 1),
(482, 'United States of America', 'Shaft, les nuits rouges de Harlem', 'John Shaft, détective noir-américain, opère à Harlem. Il est implacable et téméraire. Il marche seul et ne fait confiance à personne. Il est engagé par un des gros bonnets de la drogue dont la fille a été enlevée. Mais cet enlèvement n\'est qu\'un des épisodes que se livrent les deux mafias, la blanche et la noire.', 'Shaft Productions', 'https://image.tmdb.org/t/p/w1280/8teKJOkvQg11WhBKpXtfLLdsOgD.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oTKI2d1ltsS3uaQuOoLmI6FN92N.jpg', 'https://www.youtube.com/embed/', 100, '1971', 3.26, 1),
(483, 'United States of America', 'Sailor et Lula', 'Sailor et Lula, deux jeunes amoureux, fuient Marietta, la mère de la jeune fille qui s’oppose à leurs amours, ainsi que toute une série de personnages dangereux et mystérieux qui les menacent. L’amour triomphera‐t‐il de la violence qui les entoure ?', 'Samuel Goldwyn Company', 'https://image.tmdb.org/t/p/w1280/uvfZtoos9bbSKaLDUnCE2O73kkZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6qwGvagVDinEzeiJV653pUSv5CO.jpg', 'https://www.youtube.com/embed/DWo7rTvTUXY', 127, '1990', 3.53, 1),
(488, 'United Kingdom', 'L\'Odyssée De L\'African Queen', 'L’Afrique en 1915. Charlie Allnut, américain, transporte sur son bateau \"l\'African Queen\" toutes sortes de marchandises qu\'il distribue dans les villages. Il prévient le révérend Sawyer et sa sœur Rose, tous deux sujets britanniques, de l\'approche des troupes allemandes. Il revient le lendemain et embarque Rose, pensant la déposer en territoire neutre. Mais, décidée à lutter, elle l\'oblige à descendre les rapides du fleuve pour rejoindre les Anglais.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/7bxy1t4drpNw9SIKcxDQWOjPaHY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gwe1k68ZFxEo8ZqqR73oobiQwK4.jpg', 'https://www.youtube.com/embed/', 105, '1952', 3.68, 1),
(489, 'United States of America', 'Will Hunting', 'Will Hunting est un authentique génie mais également un rebelle aux élans imprévisibles. Il est né dans le quartier populaire de South Boston et a arrêté très tôt ses études, refusant le brillant avenir que pouvait lui procurer son intelligence. Il vit désormais entouré d\'une bande de copains et passe son temps dans les bars a chercher la bagarre et à commettre quelques petits délits qui risquent bien de l\'envoyer en prison. C\'est alors que ses dons prodigieux en mathématiques attirent l\'attention du professeur Lambeau, du Massachusetts Institute of Technology...', 'Miramax', 'https://image.tmdb.org/t/p/w1280/dMxqv6b08mQCikVPZL4UBl2MuHR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4ywKTlsIllvQYRiZJPwYACJIHY8.jpg', 'https://www.youtube.com/embed/f3v9pRa5dR8', 126, '1997', 4.05, 1),
(490, 'Sweden', 'Le Septième Sceau', 'Au XIVe siècle, la grande peste ravage la Suède. De retour des croisades, le chevalier Antonius Blok rencontre la Mort sur son chemin. Espérant retarder l\'échéance fatidique, le temps de trouver des réponses à ses questionnements métaphysiques, il lui propose une partie d\'échecs. Sur la route, tandis que l\'écuyer qui l\'accompagne professe sa philosophie nihiliste, les deux hommes rencontrent le bateleur Jof qui chemine avec sa jeune famille au cœur du pays tourmenté et dit avoir vu la vierge Marie.', 'SF Studios', 'https://image.tmdb.org/t/p/w1280/tM7ZfWHWYV0qLTWrGN9zcuBMyLn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6s2BqtDvp1BMiP70zCDU5OW6hMy.jpg', 'https://www.youtube.com/embed/', 97, '1957', 4.11, 1),
(521, 'United States of America', 'Le crime était presque parfait', 'Tony Wendice, une ancienne gloire du tennis, s\'est marié avec Margot pour sa richesse. Mais celle-ci le trompe depuis peu avec Mark Halliday, un jeune auteur de romans policiers. Craignant que sa femme le quitte et le laisse sans le sou, Tony fait appel au capitaine Lesgate et le charge d\'assassiner Margot en échange d\'une grosse somme d\'argent.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/2ikfaqVUxyPq726S8TYihSczkFF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uvd1KXopHKelymR2JbSumRupRJo.jpg', 'https://www.youtube.com/embed/', 105, '1954', 4.01, 1),
(522, 'United States of America', 'Ed Wood', 'Evocation de la vie d’Ed Wood, réalisateur considéré de son vivant comme le plus mauvais de tous les temps, aujourd’hui adulé et venéré par des milliers d’amateurs de bizarre et de fantastique à travers le monde.', 'Touchstone Pictures', 'https://image.tmdb.org/t/p/w1280/lgSnLaDu48WskDAobYH1vntKETk.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3jrwJiMCe7VZP0DNcywHYOKg0Zu.jpg', 'https://www.youtube.com/embed/hCBY4ASlWGE', 127, '1994', 3.75, 1),
(523, 'Germany', 'Requiem', 'Michaela, an epileptic, enrolls in college to study education. She goes off her medication and soon begins hearing voices and seeing apparitions that tell her to avoid religious objects, although she is devoutly Roman Catholic. One priest scoffs at the idea that Michaela could be possessed by demons, but a younger pastor arranges an exorcism for the young woman.', 'ARTE', 'https://image.tmdb.org/t/p/w1280/m42xNNYk3Nxs3xmucuKjl4zSjMc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//f95HJq5bwa3RsfJySjIR8mP8kPo.jpg', 'https://www.youtube.com/embed/', 92, '2006', 3.34, 1),
(524, 'France', 'Casino', 'Dans les années soixante‐dix à Las Vegas, Ace Rothstein dirige d’une main de fer l’hôtel‐casino Tangiers, financé en sous‐main par le puissant syndicat des camionneurs. Le Tangiers est l’un des casinos les plus prospères de la ville et Ace est devenu le grand manitou de Las Vegas, secondé par son ami d’enfance, Nicky Santoro. Impitoyable avec les tricheurs, Rothstein se laisse un jour séduire par une virtuose de l’arnaque d’une insolente beauté, Ginger McKenna. Amoureux, il lui ouvre les porte de son paradis et l’épouse. Ses ennuis commencent alors.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/4a0I37pYcdFY6HeutalHQTGs0sl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2W9HjAYWNug5RwyrEtrneXeL94Z.jpg', 'https://www.youtube.com/embed/7XpRCdzsW8o', 178, '1995', 4.01, 1),
(525, 'United States of America', 'Les Blues Brothers', 'Dès sa sortie de prison, Jake Blues est emmené par son frère Elwood chez Sœur Mary Stigmata, qui dirige l’orphelinat dans lequel ils ont été élevés. Ils doivent réunir 5 000 dollars pour sauver l’établissement, sinon c’est l’expulsion.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/t91M0hkXL9spI6CjHqQDFi4fpIw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//osrCL96kbVPcpe56Jsp1IIFTfpm.jpg', 'https://www.youtube.com/embed/', 130, '1980', 3.87, 1),
(526, 'United States of America', 'Ladyhawke, la femme de la nuit', 'Ensorcelés par le cruel et jaloux évêque d\'Avila, les amants Etienne de Navarre et Isabeau d\'Anjou se tranforment alternativement en loup et en faucon. Avec le secours de Philippe Gaston, jeune voleur qu\'ils prennent comme messager, et du vieux moine Imperius, ils se lancent dans une quête pour combattre le diabolique homme d\'église et retrouver leur forme originelle.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/kWkxiI62SZPKKEks3nQv0GrhwGZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//DNb1rBm6R75IJ88PKOd0wfCHm6.jpg', 'https://www.youtube.com/embed/', 121, '1985', 3.51, 1),
(527, 'New Zealand', 'L\'Âme des guerriers', 'Beth et Jake Heke vivent avec leurs cinq enfants dans la banlieue māori pauvre d\'Auckland, en Nouvelle-Zélande. Jake vient de perdre son travail. Alcoolique et brutal, il frappe souvent Beth, femme énergique et fière mais toujours amoureuse. Un soir, particulièrement ivre, il bat son épouse si violemment que Beth, le visage terriblement contusionné, ne peut accompagner son fils Boogie, un jeune délinquant, au tribunal. Le jeune garçon se retrouve placé dans un foyer. L\'unité familiale vole en éclat. Nig, l\'aîné, s\'agrège à un gang de jeunes révulsés par la décadence de leurs ainés et qui tentent de retrouver l\'âme de guerriers de leurs ancêtres à travers la violence, éprouvant le courage des postulants.', 'Avalon Studios', 'https://image.tmdb.org/t/p/w1280/d7IxXDOsV18JucjVHRk3P23ogNg.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wPApsZx55cmLpd7lEeV29PmjiYl.jpg', 'https://www.youtube.com/embed/AEesI6dJAj8', 98, '1994', 3.69, 1),
(530, 'United Kingdom', 'Wallace & Gromit : Une grande excursion', 'Wallace décide de construire une fusée pour aller sur la Lune qui, comme chacun sait, est un immense fromage. Un étrange robot hante ces lieux...', 'Aardman', 'https://image.tmdb.org/t/p/w1280/ywO2s5STf9DgX1PEgH9q4d0E9CW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1mY2vJCGQW2IUgGK6yNc852A4tR.jpg', 'https://www.youtube.com/embed/', 23, '1990', 3.75, 1),
(531, 'United Kingdom', 'Wallace & Gromit : Un mauvais pantalon', 'Pour payer ses factures, Wallace, l\'inventeur, décide de louer une chambre de sa maison. Le nouveau locataire, un étrange pingouin, va rapidement troubler sa vie et celle de son fidèle chien, Gromit.', 'Aardman', 'https://image.tmdb.org/t/p/w1280/il1nrKu1ujuUhTK0GtCZXi5gCcF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1OnXivHQ6TH0Xtn77YpHznIhKwl.jpg', 'https://www.youtube.com/embed/', 29, '1993', 3.87, 1),
(532, 'United Kingdom', 'Wallace & Gromit : Rasé de près', 'Pour arrondir ses fins de mois, Wallace s\'est spécialisé dans le nettoyage de vitres. C\'est en allant nettoyer les vitres de la boutique de laine qu\'il rencontre Wendolène dont il tombe amoureux. Mais Wendolène est accompagnée d\'un chien pour le moins étrange qui pourrait bien être pour quelque chose dans toutes ces histoires de disparition de moutons qui causent une pénurie de laine dans la région... Shaun, le mouton qui s\'était réfugié chez Wallace et Gromit, disparaît. Alors que Gromit part à sa recherche, il est pris pour un voleur de moutons et condamné à la prison à vie. Tout le monde se lance dans une course poursuite pour le délivrer et arrêter le vrai coupable.', 'Aardman', 'https://image.tmdb.org/t/p/w1280/sNCkVQcQkqhIeG9PlxP0qC9r5WJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aCAvih7z9D8FZHrF8sSSaczl9N8.jpg', 'https://www.youtube.com/embed/', 30, '1995', 3.77, 1),
(533, 'United Kingdom', 'Wallace & Gromit : Le mystère du lapin-garou', 'Une \"fièvre végétarienne\" intense règne dans la petite ville de Wallace et Gromit, et l\'ingénieux duo a mis à profit cet engouement en inventant un produit anti-nuisibles humain et écolo, qui épargne la vie des lapins. L\'astuce consiste simplement à capturer, à la main, un maximum de ces rongeurs et à les mettre en cage. A quelques jours du Grand Concours Annuel de Légumes, les affaires de Wallace et Gromit n\'ont jamais été aussi florissantes, et tout irait pour le mieux dans le meilleur des mondes, si un lapin-garou géant ne venait soudain s\'attaquer aux sacro-saints potagers de la ville. Pour faire face à ce péril inédit, l\'organisatrice du concours, Lady Tottington, se tourne vers nos deux \"spécialistes\" et leur demande d\'appréhender le monstre.', 'Aardman', 'https://image.tmdb.org/t/p/w1280/x12w9DwDO1qNLvpx0llASLWj5dS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lDc57OEx1u1aNpOmHFjWbpT99kl.jpg', 'https://www.youtube.com/embed/', 85, '2005', 3.5, 1),
(534, 'Germany', 'Terminator Renaissance', 'En 2018, après l\'apocalypse qui a vu s\'affronter les hommes et les robots, John Connor est devenu le chef de la résistance humaine contre Skynet et son armée de Terminators. Sa vision du monde est pourtant remise en cause par l\'apparition de Marcus Wright, un inconnu qui se souvient seulement de s\'être trouvé dans le quartier des condamnés à mort. Connor doit découvrir si Marcus a été envoyé du futur ou s\'il est un rescapé du passé. Alors que Skynet prépare l\'assaut final, Connor et Marcus s\'engagent dans une odyssée qui va les mener au cœur même des opérations de Skynet. Ils y perceront le terrible secret qui se cache derrière l\'annihilation programmée de l\'humanité tout entière...', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/yvNh6F4jxb263ewe1kKTlq94ZAR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5tKiuZvvV1lic7v65rdoGPmoOvf.jpg', 'https://www.youtube.com/embed/Z3cDtMDdmf8', 108, '2009', 3.02, 1),
(535, 'United States of America', 'Flashdance', 'Énorme succès au box office, Flashdance est l’irrésistible histoire d’Alex Owens (Jennifer Beals), jeune beauté de 18 ans, pleine de résolution, soudeuse la journée et danseuse dans un cabaret le soir. Une bande son qui a marqué les années 80, avec les fameux airs “Flashdance” chanté par Irène Cara et “Maniac” chanté par Michael Sembello. Suivons Alex qui se bat pour son indépendance, pour trouver l’amour et réaliser son rêve : danser au Conservatoire de Pittsburg. Un véritable film culte !', 'Paramount', 'https://image.tmdb.org/t/p/w1280/ziiy6ORt8BlxWFXskBChBMInvDA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4taRyneJlNDhuEkfX5QU6CG6Vbh.jpg', 'https://www.youtube.com/embed/', 95, '1983', 3.26, 1),
(536, 'China', 'Stuttgart Shanghai', '', 'Filmakademie Baden-Württemberg', 'https://image.tmdb.org/t/p/w1280', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 60, '2007', 2.5, 1),
(537, 'France', 'Je ne suis pas là pour être aimé', '50 ans, huissier de justice, le cœur et le sourire fatigués, Jean-Claude Delsart a depuis longtemps abandonné l\'idée que la vie pouvait lui offrir des cadeaux. Jusqu\'au jour où il s\'autorise à pousser la porte d\'un cours de tango...', 'Angoa-Agicoa', 'https://image.tmdb.org/t/p/w1280/zwm45xc3SL3in0Y3BvKoIciPWRa.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dAHrR2Avzpdpii9RGRGglJqt0BU.jpg', 'https://www.youtube.com/embed/nIjw0e_1QPA', 93, '2005', 3.4, 1),
(550, 'United States of America', 'Fight Club', 'Le narrateur, sans identité précise, vit seul, travaille seul, dort seul, mange seul ses plateaux‐repas pour une personne comme beaucoup d’autres personnes seules qui connaissent la misère humaine, morale et sexuelle. C’est pourquoi il va devenir membre du Fight club, un lieu clandestin où il va pouvoir retrouver sa virilité, l’échange et la communication. Ce club est dirigé par Tyler Durden, une sorte d’anarchiste entre gourou et philosophe qui prêche l’amour de son prochain.', 'Regency Enterprises', 'https://image.tmdb.org/t/p/w1280/6NdNO1dq9w54ujk2G4sK4ogsf0H.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hZkgoQYus5vegHoetLkCJzb17zJ.jpg', 'https://www.youtube.com/embed/tZpXdiB_pg0', 139, '1999', 4.22, 1),
(551, 'United States of America', 'L\'Aventure du Poséidon', 'Alors que les passagers du Poséidon, yacht luxueux en croisière vers l\'Israël, s\'apprêtent à fêter le réveillon, une catastrophe se prépare : un raz-de-marée a soulevé un mur d\'eau de plusieurs dizaines de mètres de hauteur. Instantanément retourné, le paquebot commence à sombrer. Une course contre la montre s\'engage alors pour les survivants, qui cherchent désespérément à rejoindre une issue...', 'Kent Productions', 'https://image.tmdb.org/t/p/w1280/CL2dCDlmM0zKbSPofbShj6OOHA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//v1QEIuBM1vvpvfqalahhIyXY0Cm.jpg', 'https://www.youtube.com/embed/H_5w-WmSdz0', 112, '1972', 3.56, 1),
(552, 'Italy', 'Pain, tulipes et comédie', 'Cette comédie légère et menée tambour battant est un vrai petit bonheur. On y pose les questions justes sur la vie, l’amour, l’avenir, l’amitié, le tout sans prétention et avec empathie. Dialogues et situations dignes d’un comique de haute voltige, petit voyage à travers Venise en prime avant les vacances …', 'Istituto Luce Cinecittà', 'https://image.tmdb.org/t/p/w1280/bOyIpueqjFkUMNkPKCLcyb9WWpx.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//k4JIHyAXaGHwAwT7y5Skd17f0Wl.jpg', 'https://www.youtube.com/embed/', 115, '2000', 3.65, 1),
(553, 'Denmark', 'Dogville', 'Dans les années trente, des coups de feu retentissent un soir dans Dogville, une petite ville des Rocheuses. Grace, une belle femme terrifiée, monte en courant un chemin de montagne où elle fait la rencontre de Tom, un jeune habitant de la bourgade. Elle lui explique qu\'elle est traquée par des gangsters et que sa vie est en danger. Encouragée par Tom, la population locale consent à la cacher, en échange de quoi Grace accepte de travailler pour elle. Lorsqu\'un avis de recherche est lancé contre la jeune femme, les habitants de Dogville s\'estiment en droit d\'exiger une compensation, vu le risque qu\'ils courent à l\'abriter. Mais la pauvre Grace garde en elle un secret fatal qui leur fera regretter leur geste…', 'YLE', 'https://image.tmdb.org/t/p/w1280/lraVawavIXh5geMlVjpzCw9TGwR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//r3xsFBD1VTUusk393bBc7SsDUJe.jpg', 'https://www.youtube.com/embed/', 178, '2003', 3.89, 1),
(554, 'Finland', 'Kukushka, le coucou', 'Septembre 1944, le Finlandais Veiko est enchaîner par ses camarades à un rocher et abandonné à son sort. Dans le camp de l\'Armée Rouge un capitaine est transporté sous surveillance au Quartier Général pour des propos anti-soviétiques. Tandis que Veiko réussit à se libérer, le convoi des russes et attaqué. Seul le capitaine survit et est emmené par Anni, une femme lapone, dans sa demeure pour y être soigné.  Veiko trouve refuge dans la ferme de Anni et entre les trois va commencer une cohabitation difficile. Personne ne comprend la langue de l\'autre, or Anni, qui a perdu son mari, remarque que sa solitude a pris fin. Elle s\'emploie à séduire avec culot les deux hommes arrivés miraculeusement chez elle.', 'CTB Film Company', 'https://image.tmdb.org/t/p/w1280/i21z0FHES4Uh3zDnzYyFLZN2AB7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1qwXItFKqvKYyW1CwbYhxyUC8Pj.jpg', 'https://www.youtube.com/embed/', 99, '2002', 3.52, 1),
(555, 'Switzerland', 'Absolut', '', 'Frenetic Films', 'https://image.tmdb.org/t/p/w1280/cwxOwSDwbwUfceIlaWFoo65SdzX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 94, '2005', 3.85, 1),
(557, 'United States of America', 'Spider-Man', 'Orphelin, Peter Parker est élevé par sa tante May et son oncle Ben dans le quartier Queens de New York. Tout en poursuivant ses études de biophysique à l\'université, il trouve un emploi de photographe au journal Daily Bugle. Cependant, après avoir été mordu par une araignée radioactive, ce dernier est sujet à des transformations physiques : son agilité et sa force se sont accrues, et il se voit doter de pouvoirs surnaturels. Peter décide alors de participer à un combat de catch qu\'il remporte avec une facilité déconcertante. Mais l\'organisateur du spectacle, décrétant qu\'il y a eu tricherie, refuse de lui remettre le prix de 3 000 dollars qui lui revient de droit. Au même moment, l\'homme d\'affaires mégalomane Norman Osborn expérimente sur lui-même de dangereuses solutions chimiques. Des mutations s\'opèrent bientôt sur son corps et son esprit. Il se transforme alors en Bouffon Vert.', 'Marvel Enterprises', 'https://image.tmdb.org/t/p/w1280/pNz1NREgddPdlzytlR8mW4B26fW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zQ8AxTPiCiS5nnwXpwTBPBHSaa5.jpg', 'https://www.youtube.com/embed/OFijO5eH3ok', 121, '2002', 3.63, 1),
(558, 'United States of America', 'Spider-Man 2', '2 ans après avoir choisi sa vie de super-héros, Peter Parker ne parvient plus à gérer sa double vie. Il perd son boulot, Mary-Jane sait qu\'elle ne peut plus compter sur lui, et ses études prennent le même chemin. Il décide de raccrocher le costume de Spiderman. Son ami Harry lui présente un ami de son professeur de science, le bienveillant docteur Otto Octavius sur lequel il doit rédiger un mémoire. Celui-ci travaille sur la fusion qu\'il croit pouvoir contrôler. Mais une démonstration de ses recherches tourne mal, et le docteur se voit doter de 4 membres mécaniques supplémentaires greffés sur sa colonne vertébrale et qui prennent le contrôle de son esprit...', 'Marvel Enterprises', 'https://image.tmdb.org/t/p/w1280/m8X5HdADsW5YdmVNjwTOArMOUoL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8G6HCS82vNxgg5wp7oBDSk32XpF.jpg', 'https://www.youtube.com/embed/sckzK6kXBQA', 128, '2004', 3.62, 1),
(559, 'United States of America', 'Spider-Man 3', 'Peter Parker a retrouvé un équilibre de vie et il veut se marier avec Mary Jane. Pendant une nuit au parc, alors que Peter et Mary Jane sont ensemble, une petite météorite tombe tout près du lieu où ils se trouvent, et une particule s\'en échappe, libérant, en éclatant, une matière visqueuse, la Venom, qui s\'attache à la mobylette de Peter. Pendant ce temps, Flint Marko s\'échappe de la prison où il était détenu pour cambriolage afin d\'aller revoir sa fillette qui lui manque terriblement, mais dont il n\'a pas le droit de s\'approcher à cause de l\'injonction d\'éloignement obtenue contre lui par son ex-femme ; pendant sa fuite, il tombe dans un accélérateur de particules, qui fond son corps avec le sable et il devient l’Homme-Sable. Le meilleur ami de Peter, Harry Osborn, veut venger la mort de son père, et, croyant que Spider-Man est la cause de cette mort, l\'attaque.', 'Laura Ziskin Productions', 'https://image.tmdb.org/t/p/w1280/4SBTOPWMM3My5nDIlpNHt6dg78d.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//w1oD1MzHjnBJc5snKupIQaSBLIh.jpg', 'https://www.youtube.com/embed/qK7nMGNlHgk', 139, '2007', 3.19, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(560, 'United States of America', 'Le Secret derrière la porte', 'Celia Barrett, riche héritière, rencontre pendant des vacances à Mexico Mark Lamphere, qu\'elle épouse aussitôt. Mais le soir des noces, son mari la quitte brusquement, sans aucune raison apparente. La jeune femme va peu à peu réaliser que celui qu\'elle a épousé est un homme bien étrange…', 'Diana Productions, Inc.', 'https://image.tmdb.org/t/p/w1280/lcpLFiUqtodr0jRYL9zjGDTYmxs.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xMZJwdGMDEQWKavwMWB4Lpkuixg.jpg', 'https://www.youtube.com/embed/tvJRjPPQhhI', 99, '1947', 3.22, 1),
(561, 'Germany', 'Constantine', 'John Constantine, extralucide anticonformiste, qui a littéralement fait un aller-retour aux enfers, doit aider Katelin Dodson, une policière incrédule, à lever le voile sur le suicide mystérieux de sa sœur jumelle. Cette enquête leur fera découvrir l\'univers d\'anges et de démons qui hantent les sous-sols de Los Angeles d\'aujourd\'hui.', 'Village Roadshow Pictures', 'https://image.tmdb.org/t/p/w1280/wtkbdBdscJqZws61NFuqJmVS0m3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tIG8FwHRiHLOlWJdizp2oxdkSL2.jpg', 'https://www.youtube.com/embed/wW9y5hEY8yM', 121, '2005', 3.52, 1),
(562, 'United States of America', 'Die Hard', 'NYPD cop John McClane\'s plan to reconcile with his estranged wife is thrown for a serious loop when, minutes after he arrives at her office, the entire building is overtaken by a group of terrorists. With little help from the LAPD, wisecracking McClane sets out to single-handedly rescue the hostages and bring the bad guys down.', 'Gordon Company', 'https://image.tmdb.org/t/p/w1280/pLjyTKKiY3LeSv10HGKn5nNSCfh.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oIwfoUFfWfESn0Y8u8jv9lc8li1.jpg', 'https://www.youtube.com/embed/XDg9AkYRWCc', 131, '1988', 3.9, 1),
(563, 'United States of America', 'Starship Troopers', 'Au XXIVe siècle, une fédération musclée fait régner sur la Terre l’ordre et la vertu, exhortant sans relâche la jeunesse à la lutte, au devoir, à l’abnégation et au sacrifice de soi. Mais aux confins de la galaxie, une armée d’arachnides se dresse contre l’espèce humaine et ces insectes géants rasent en quelques secondes la ville de Buenos‐Aires. Cinq jeunes gens, cinq volontaires à peine sortis du lycée, pleins d’ardeurs et de courage, partent en mission dans l’espace pour combattre les envahisseurs. Ils sont loin de se douter de ce qui les attend.', 'Touchstone Pictures', 'https://image.tmdb.org/t/p/w1280/kNpQWAHKrCjrjT0pXz15BWXW1eB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7PR2yMwXuXelAcp3qpJ3isZCdd0.jpg', 'https://www.youtube.com/embed/cjajhlGV21k', 135, '1997', 3.51, 1),
(564, 'United States of America', 'La Momie', '1719 avant J.C. Pour avoir osé ravir sa fiancée au Pharaon, le grand prêtre Imhotep est momifié vivant et enseveli dans une crypte secrète d\'Hamunaptra. Mais son cœur bat toujours et la Momie attend l\'heure de sa libération. En 1923, l\'aventurier O\'Connell découvre les ruines d\'Hamunaptra. La malédiction d\'Imhotep va pouvoir se réaliser...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/88t3UtgPZAnk87JRM3bl6IO0EsJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wyIhlSbqBS7ZsDbCQwGhuNIDYyq.jpg', 'https://www.youtube.com/embed/O2jooxM7Zw8', 125, '1999', 3.45, 1),
(565, 'United States of America', 'Le Cercle : The Ring', 'Lorsque sa nièce trouve la mort foudroyée par la peur une semaine après avoir visionné une mystérieuse cassette vidéo, Rachel Keller, une journaliste de Seattle, décide d\'enquêter sur ce fameux enregistrement. Aidée de son ex-mari Noah, elle découvre que cette cassette est porteuse d\'une étrange malédiction : quiconque la visionne est condamné à périr dans de terribles circonstances.Rachel prend tout de même le risque de regarder l\'enregistrement. Le téléphone sonne alors, le décompte mortel s\'enclenche : la jeune femme ne dispose plus que de sept jours pour sauver sa vie et celle de son fils. Sept jours pour tenter de déjouer le sortilège du Cercle...', 'BenderSpink', 'https://image.tmdb.org/t/p/w1280/sSpGWUvdXGXdw5yle3oLj87fd4X.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6TBaTZCq0FdjrXcj9mKdHGpcr2D.jpg', 'https://www.youtube.com/embed/ztVThBF-exk', 115, '2002', 3.33, 1),
(567, 'United States of America', 'Fenêtre sur cour', 'À cause d\'une jambe cassée, le reporter-photographe L. B. Jefferies est contraint de rester chez lui dans un fauteuil roulant. Homme d\'action et amateur d\'aventures, il s\'aperçoit qu\'il peut tirer parti de son immobilité forcée en étudiant le comportement des habitants de l\'immeuble qu\'il occupe dans Greenwich Village. Et ses observations l\'amènent à la conviction que Lars Thorwald, son voisin d\'en face, a assassiné sa femme. Sa fiancée, Lisa Fremont, ne le prend tout d\'abord pas au sérieux, ironisant sur l\'excitation que lui procure sa surveillance, mais finit par se prendre au jeu.', 'Alfred J. Hitchcock Productions', 'https://image.tmdb.org/t/p/w1280/xiPX9jCpPXQIqIrbbuHfsL4qt9c.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zZvtZZXRnZ4Tdcs0QEWaZZcIWy8.jpg', 'https://www.youtube.com/embed/C28s0gXXyRA', 110, '1954', 4.18, 1),
(568, 'United States of America', 'Apollo 13', 'Après les premiers pas de l\'homme sur la Lune, la NASA décide de poursuivre les vols habités. Jim Lovell qui, deux ans plus tôt, avait participé au vol Apollo 8, est choisi pour diriger la mission Apollo 13. Avec Fred Haise et Ken Mattingly, il suit un entraînement intensif. Une semaine avant le départ prévu, les médecins détectent chez Ken Mattingly des signes de rougeole. À contrecœur, Jim Lovell doit se résigner à le remplacer par Jack Swigert, insuffisamment préparé à son goût. Le jour du lancement, le 11 avril 1970, Apollo 13 décolle de Cap Kennedy, dans l\'indifférence générale. Jusqu\'au troisième jour, tout se passe bien...', 'Imagine Entertainment', 'https://image.tmdb.org/t/p/w1280/6npr35siRnvQ5oIq06pZtQSRFRZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//32zua2oKjn2EaRk7am3qK8zAlEj.jpg', 'https://www.youtube.com/embed/', 140, '1995', 3.72, 1),
(570, 'France', 'À ma sœur !', 'Anaïs, douze ans, se trouve complexée par son poids. Tapie dans l\'ombre ou laissée pour compte, elle souffre intérieurement. C\'est l\'été, la mer, les vacances en famille, l\'apprentissage du premier amour. Cet apprentissage, Anaïs le fait en observant sa sœur aînée Eléna. Celle-ci, quinze ans, incarne la beauté du diable. Pas plus intelligente, ni plus bête que sa cadette, elle rejette l\'idée de n\'être qu\'un objet de désir. La perte de la virginité des filles va ouvrir la porte au drame.', 'Urania Pictures', 'https://image.tmdb.org/t/p/w1280/bRBsTYJBgc74eMIy8QMSXpYWfyo.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pnwI95K4pmYeM3LsMRTQYzvhvvO.jpg', 'https://www.youtube.com/embed/', 93, '2001', 3.1, 1),
(571, 'United States of America', 'Les Oiseaux', 'Melanie, jeune femme quelque peu superficielle, rencontre chez un marchand d\'oiseaux un brillant et séduisant avocat qui recherche des inséparables. Par jeu, Melanie achète les oiseaux et les apporte à Bodega Bay. Dès son arrivée, elle est blessée au front par une mouette...', 'Alfred J. Hitchcock Productions', 'https://image.tmdb.org/t/p/w1280/pIc5nX1neiJ38R7b4e8PKqvxbkD.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//q2XxGMCO8Zey8YDrvQGi8P8ns5F.jpg', 'https://www.youtube.com/embed/nFyfZiQ7pJ0', 120, '1963', 3.76, 1),
(572, 'Denmark', 'Next Door : Fantasmes sanglants', 'Peu de temps après que sa petite amie Ingrid soit venue récupérer ses affaires, John croise ses deux jolies voisines, Anne et Kim, qui l\'invitent dans leur appartement. C\'est leur première rencontre et pourtant, elles semblent tout connaître de sa vie avec Ingrid. Le comportement provocateur des deux femmes met John mal à l\'aise, mais Anne le convainc de rester avec Kim pour qu\'elle puisse aller à la pharmacie. Kim attire alors John de plus en plus profondément dans l\'immense appartement, dans un monde où il devient impossible de séparer la réalité de l\'illusion. John commence à perdre le contrôle de son existence. Il dépasse des limites qu\'il n\'imaginait même pas avoir.', 'Nordisk Film Sweden', 'https://image.tmdb.org/t/p/w1280/dCoOIsK6TXuOruKrG2DHioiQUDn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//k0tUeAfV591707I9A5Irl702Q8L.jpg', 'https://www.youtube.com/embed/b-j-vB0VylU', 75, '2005', 3.16, 1),
(573, 'United Kingdom', 'Frenzy', 'Pendant le discours d\'un ministre se flattant du succès d\'une campagne antipollution, le corps d\'une femme est découvert dans la Tamise. Le fleuve vient de charrier la nouvelle victime d\'un meurtrier sadique, qui étrangle des femmes avec une cravate après les avoir violées. Dans le même temps, Richard Blaney, misanthrope solitaire d\'une trentaine d\'années, est renvoyé du café où il officiait en qualité de barman. Il demande assistance à son ancienne épouse, directrice d\'une agence matrimoniale. Le lendemain, la malheureuse est retrouvée étranglée. Tous les soupçons se concentrent sur Richard Blaney...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/5QIqTgQTA9PALpJniGsJ1tLQow7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5NWLgFDwDOsLXs5m0tTuyRm4SKa.jpg', 'https://www.youtube.com/embed/', 116, '1972', 3.56, 1),
(574, 'United States of America', 'L’Homme qui en savait trop', 'Ben et Jo McKenna, un couple de touristes américains, sillonnent le Maroc avec leur petit garçon, Hank. Dans un autocar, ils font la connaissance d\'un Français, Louis Bernard, qui est assassiné quelque temps plus tard à Marrakech. Avant de rendre l\'âme, Bernard a le temps de souffler quelques mots à McKenna. Ce dernier, stupéfait, s\'apprête à prévenir la police lorsqu\'il apprend que son fils vient d\'être enlevé.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/lkUN19J2eXbL4VnxnIh1EXZlxks.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gpvTdLLzwBkH1DMQLqoPpCZ2uLo.jpg', 'https://www.youtube.com/embed/', 120, '1956', 3.75, 1),
(575, 'Germany', 'L\'Expérience', 'Afin d\'étudier scientifiquement le comportement humain, le professeur Thon enferme vingt volontaires, des hommes ordinaires, dans un univers carcéral. Huit d\'entre eux sont désignés pour être les \"gardiens\", les douze autres étant les \"prisonniers\". La règle est simple : comme dans une vraie prison, les détenus doivent obéir aux gardiens qui sont chargés de faire régner l\'ordre.Progressivement, la situation se détériore, la frontière entre l\'expérience et la réalité devient de plus en plus floue. Le pouvoir monte à la tête de certains et les atteintes à la liberté et à la dignité en affectent d\'autres. Chaque jour qui passe voit le pouvoir et l\'autorité se heurter de plus en plus violemment à la rébellion.L\'expérience dépasse tout ce qui était prévu. Les personnalités se révèlent. Désormais, l\'enjeu n\'est plus scientifique : il s\'agit d\'abord de s\'en sortir vivant.', 'Seven Pictures', 'https://image.tmdb.org/t/p/w1280/ysuhUg6fcXvMfGUi5yZlyCPbB8F.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6LrSj1vsYALVLTf2RCCfJFWimM7.jpg', 'https://www.youtube.com/embed/', 114, '2001', 3.7, 1),
(576, 'United States of America', 'La Horde sauvage', 'En 1914, Pike Bishop et sa bande entrent dans San Rafael, une petite ville du Texas, déguisés en cavaliers de l\'US Cavalry. Ensemble, ils se dirigent vers la gare pour y dérober la paie des employés du chemin de fer. Ils ignorent que Thornton, autrefois leur complice, aujourd\'hui leur pire ennemi, les y attend, chargé par la direction des chemins de fer de leur tendre une embuscade. L\'affaire tourne à la fusillade. Des dizaines d\'innocents y laissent la vie. Pike, qui a perdu quelques hommes dans l\'affaire, n\'est pas satisfait. Il accepte l\'offre d\'un général mexicain, Mapache, qui lui demande d\'attaquer un train rempli d\'or et de munitions.', 'Warner Bros-Seven Arts', 'https://image.tmdb.org/t/p/w1280/bf0UYvhSVxttNDKu90KdqH3vxs4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3VOMg5qurrIGoZrg3cfbxhEW5Ye.jpg', 'https://www.youtube.com/embed/', 145, '1969', 3.82, 1),
(577, 'Canada', 'Prête à tout', 'Pour atteindre son rêve et devenir une star du petit écran, Suzanne est prête à tout. Même à faire disparaître son mari...', 'The Rank Organisation', 'https://image.tmdb.org/t/p/w1280/6HjWIJBfEhZ0IM8nzv7JERyKh0N.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hkQonhCuDyjRmhFsFrCK0XnW7kk.jpg', 'https://www.youtube.com/embed/', 102, '1995', 3.3, 1),
(578, 'United States of America', 'Les Dents de la mer', 'À quelques jours du début de la saison estivale, les habitants de la petite station balnéaire d\'Amity sont mis en émoi par la découverte sur le littoral du corps atrocement mutilé d\'une jeune vacancière. Pour Martin Brody, le chef de la police, il ne fait aucun doute que la jeune fille a été victime d\'un requin. Il décide alors d\'interdire l\'accès des plages mais se heurte à l\'hostilité du maire uniquement intéressé par l\'afflux des touristes. Pendant ce temps, le requin continue à semer la terreur le long des côtes et à dévorer les baigneurs...', 'Zanuck/Brown Productions', 'https://image.tmdb.org/t/p/w1280/wuRf6gkX0JUJsu1MeECPubhMRdd.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//p3DeIBpSrg0R0yCIRhgEMvfY7mb.jpg', 'https://www.youtube.com/embed/BlqvX50DSNo', 124, '1975', 3.83, 1),
(579, 'United States of America', 'Les dents de la mer, 2e partie', 'Au lendemain de l\'inauguration d\'un luxueux complexe hôtelier, Martin Brody, le chef de la police d\'Amity, apprend la disparition d\'une équipe de plongeurs. Il craint le pire. Un requin est déjà venu nager dans les eaux d\'Amity quelques années auparavant. Ses inquiétudes ne tardent pas à se confirmer. Un autre accident se produit et le cadavre d\'une baleine portant les morsures d\'un requin géant échoue sur la plage. Martin Brody alerte immédiatement le maire et lui demande d\'interdire la baignade. Mais le conseil municipal refuse de prendre de telles précautions. La saison s\'annonce prometteuse et l\'enjeu financier est trop important. Brody, devenu trop gênant, est démis de ses fonctions. Le voilà réduit à attendre le pire...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/4Q4w2lMWvPaEVWp3D9BMOqEHjYX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qNsLlAE9Sp34AYkaMw5083Xa660.jpg', 'https://www.youtube.com/embed/mdFx-OdKxps', 116, '1978', 2.98, 1),
(580, 'United States of America', 'Les Dents de la mer 4 : La Revanche', 'Amity, la désormais célèbre station balnéaire américaine, prépare fébrilement les fêtes de Noël. Ellen Brody, dont le mari a été dévoré par un requin, apprend à vivre seule. Il ne lui reste plus que ses deux fils, Michael, installé avec sa famille aux Bahamas, et Sean, qui doit bientôt se marier. Celui-ci, qui a remplacé son père au poste de shérif, part en mer pour déplacer une balise. Il est tué par un requin. Ellen, désespérée, pense que les siens sont maudits. Michael invite sa mère à venir vivre auprès de sa famille. Elle accepte et part le rejoindre. Là, loin d\'Amity, elle oublie un peu ses angoisses grâce à Hoagie, un pilote d\'avion jovial qui lui fait visiter l\'archipel. Mais la réalité la rattrape...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/kP4nGk7OUqzlZQkD7jBenSJOz44.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cJyQfwSEa5IjOdeNTuiWjciVbou.jpg', 'https://www.youtube.com/embed/NuzZyn_bT0w', 89, '1987', 2.03, 1),
(581, 'United Kingdom', 'Danse avec les loups', 'Durant la guerre de Sécession, le lieutenant John Dunbar, envoyé à un poste de reconnaissance dans les plaines du Dakota, rencontre le peuple sioux. Il se lie d\'amitié avec la population indienne, au point d\'intégrer une tribu et de s\'éprendre de l\'une des leurs.', 'Tig Productions', 'https://image.tmdb.org/t/p/w1280/eDOcvPDiV5o6MRZJfZrbRjgRjQx.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ywWva4trKw7f3wtbz81Fe3FnrtC.jpg', 'https://www.youtube.com/embed/VWDYpL1Y0ng', 233, '1990', 3.93, 1),
(582, 'France', 'La Vie des autres', 'Au début des années 1980, en Allemagne de l\'Est, l\'auteur à succès Georges Dreyman et sa compagne, l\'actrice Christa-Maria Sieland, sont considérés comme faisant partie de l\'élite des intellectuels de l’État communiste, même si, secrètement, ils n\'adhèrent aux idées du parti. Le Ministère de la Culture commence à s\'intéresser à Christa et dépêche un agent secret, nommé Wiesler, ayant pour mission de l\'observer. Tandis qu\'il progresse dans l\'enquête, le couple d\'intellectuels le fascine de plus en plus…', 'Creado Film', 'https://image.tmdb.org/t/p/w1280/tuITw3t3WMOEKtL1sUYts1ZAnoa.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3mxteiwtcCPjbYKlyC0WxY1G9J3.jpg', 'https://www.youtube.com/embed/', 137, '2006', 4.02, 1),
(583, 'United Kingdom', 'Monty Python : La vie de Brian', 'En l’an 0, en terre de Galilée, Mandy et son bébé Brian reçoivent la visite des Rois Mages un beau soir de décembre. Ceux‐ci, s’apercevant de leur erreur, remballent prestement leurs présents et filent dans l’étable voisine. Hélas, Brian a tiré le mauvais numéro…', 'HandMade Films', 'https://image.tmdb.org/t/p/w1280/6RKbtDCMUaPboo1WYBUCNoVxgA9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gbLeMznYBlI7rsyg766oBwkdo2w.jpg', 'https://www.youtube.com/embed/f9fJpOdJtPg', 90, '1979', 3.88, 1),
(584, 'Germany', '2 Fast 2 Furious', 'Brian O\'Conner a signé sa plus belle action, mais aussi sa faute la plus grave, en laissant filer le chef du gang de voleurs de voitures qu\'il avait mission d\'infiltrer. Radié de la police de Los Angeles, ce jeune flic rebelle, fan de vitesse et de rodéos, a gardé intact son honneur mais a gâché une belle carrière. Après 2 ans de galère, Brian O\'Conner se retrouve à Miami et se voit offrir une ultime chance de se racheter. Le FBI et les douanes locales surveillent depuis plusieurs mois le puissant homme d\'affaires Carter Verone, qu\'ils soupçonnent de se livrer à des opérations de blanchiment d\'argent. Mais leurs efforts sont restés vains, le seul indice dont ils disposent pour appâter et démasquer l\'énigmatique criminel étant sa passion pour les rodéos. Le temps presse, Brian semble être le seul espoir…', 'Ardustry Entertainment', 'https://image.tmdb.org/t/p/w1280/riIa9UIxyhhOBIXI8vhpWmcesGB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//z3ioibdjWZOYeXjoiabFOFOfPI3.jpg', 'https://www.youtube.com/embed/fDooSsgINLQ', 107, '2003', 3.23, 1),
(585, 'United States of America', 'Monstres & Cie', 'Monstropolis est une petite ville peuplée de monstres dont la principale source d’énergie provient des cris des enfants. Monstres & Cie est la plus grande usine de traitement de cris de la ville. Grâce au nombre impressionnant de portes de placards dont dispose l’usine, une équipe de monstres d’élite pénètre dans le monde des humains pour terrifier durant la nuit les enfants et récolter leurs hurlements.\r Le Terreur d’élite le plus réputé de Monstres & Cie s’appelle Jacques Sullivent, alias Sulli. C’est un monstre cornu de 2m40 de haut à la fourrure bleu-vert tachetée de violet. Une nuit, alors qu’il se trouve à l\' »Etage de la Terreur », il s’aperçoit qu’une porte de placard n’a pas été fermée correctement. Pour vérifier que tout est en place, il l’ouvre, permettant sans le vouloir à Bouh, une petite fille, de pénétrer dans son monde.', 'Pixar', 'https://image.tmdb.org/t/p/w1280/a99lbMSp4ScGT79FDKJeOEmcZaN.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//c7VbRPlev1bRfKvTxr98erw5T7B.jpg', 'https://www.youtube.com/embed/ciypyjnl0D4', 92, '2001', 3.91, 1),
(586, 'United States of America', 'Des hommes d\'influence', 'Pour sauver le candidat Président des Etats-Unis, éclaboussé par un scandale de mœurs quelques jours avant l\'élection présidentielle, ses conseillers décident, pour détourner l\'attention des électeurs, d\'inventer une guerre dans quelque coin obscur de la vieille Europe.', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/lPUHBlaP7QE9QvEhBEaOb9t3dEy.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bWoNwo04ZfZoEvEF8gliyB1EAyS.jpg', 'https://www.youtube.com/embed/jTbxrcVCuYg', 86, '1997', 3.49, 1),
(587, 'United States of America', 'Big Fish', 'L’histoire à la fois drôle et poignante d’Edward Bloom, un père débordant d’imagination, et de son fils William. Ce dernier retourne au domicile familial après l’avoir quitté longtemps auparavant, pour être au chevet de son père, atteint d’un cancer. Il souhaite mieux le connaître et découvrir ses secrets avant qu’il ne soit trop tard. L’aventure débutera lorsque William tentera de discerner le vrai du faux dans les propos de son père mourant.', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/SF6pWtcdu1GEQxzeeYBEP1yEcK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bLqUd0tBvKezDr9MEla7k34i3rp.jpg', 'https://www.youtube.com/embed/AEh2eRhZNkA', 125, '2003', 3.88, 1),
(588, 'Canada', 'Silent Hill', 'Malgré les protestations de son mari, Rose conduit sa fille Sharon dans une ville abandonnée du nom de Silent Hill en Virginie-Occidentale qui semble irrésistiblement attirer l\'enfant. Alors qu\'elles pénètrent dans cet univers lugubre, Sharon disparaît. Rose poursuit ce qu\'elle croit être la silhouette de sa fille, mais se rend vite compte que ce lieu étrange ne ressemble à rien de ce qu\'elle connaît. Avec l\'aide de Cybil, une motarde de la police également égarée sur les lieux, Rose va se lancer dans une quête éperdue pour retrouver sa fille, et percer le secret terrifiant de Silent Hill.', 'TriStar Pictures', 'https://image.tmdb.org/t/p/w1280/ypm4vjs1x8w1GRidpTE3udLZCnS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//29BCwmpV9HQUekAGlJLplkslRRf.jpg', 'https://www.youtube.com/embed/1mfnhu8sO5k', 125, '2006', 3.27, 1),
(590, 'United States of America', 'The Hours', 'Dans la banlieue de Londres, au début des années vingt, Virginia Woolf lutte contre la folie qui la guette. Elle entame l\'écriture de son grand roman, Mrs Dalloway. Plus de vingt ans après, à Los Angeles, Laura Brown lit cet ouvrage : une expérience si forte qu\'elle songe à changer radicalement de vie. A New York, aujourd\'hui, Clarissa Vaughn, version moderne de Mrs Dalloway, soutient Richard, un ami poète atteint du sida. Comment ces histoires vont-elles se rejoindre, comment ces trois femmes vont-elles former une seule et même chaîne ? La littérature est si puissante qu\'un chef-d’œuvre peut, par-delà les époques, modifier irrévocablement l\'existence de celles qui le côtoient.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/x4xFyKaQlZK1Tli6nnU0JxQcMyZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vPxVNrhIDbqjTw2K6clafOn4uTy.jpg', 'https://www.youtube.com/embed/', 114, '2002', 3.66, 1),
(591, 'United States of America', 'The Da Vinci Code', 'A murder in Paris’ Louvre Museum and cryptic clues in some of Leonardo da Vinci’s most famous paintings lead to the discovery of a religious mystery. For 2,000 years a secret society closely guards information that — should it come to light — could rock the very foundations of Christianity.', 'Imagine Entertainment', 'https://image.tmdb.org/t/p/w1280/j9lsWwnIDN2ZNtqZcE1x2o4ZKyI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//66oSbVOmD4W7S6ILRPssYt51ab4.jpg', 'https://www.youtube.com/embed/0Rgglvw0e18', 149, '2006', 3.36, 1),
(592, 'United States of America', 'Conversation secrète', 'Spécialiste de la filature, Harry Caul est engagé pour suivre un couple et enregistrer leur conversation. Une fois sa mission accomplie, Caul écoute la bande sonore. La banalité des propos le surprend. S\'agit-il d\'un code secret?', 'Paramount', 'https://image.tmdb.org/t/p/w1280/kfYGcQIMM0Lr4RsACTESPl7DIdH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//s7yfiwIshKQIT6M8ZcTnFKXHs8B.jpg', 'https://www.youtube.com/embed/', 113, '1974', 3.77, 1),
(593, 'Soviet Union', 'Solaris', 'Solaris est une planète mystérieuse qu’étudie une station orbitale. D’étranges phénomènes s’y sont produits. Un physicien s’est donné la mort, et deux autres sont devenus fous. Kris Kelvin, un scientifique spécialisé en psychologie, y est envoyé en mission. À peine arrivé, il croit sentir une forme de vie non humaine à bord de la station. Une femme lui apparaît, qui devient sa maîtresse. Elle n’est que le double de sa propre femme, qui s’est suicidée quelques années plus tôt, par sa faute. Elle disparaît ou surgit au gré de ses désirs. Il comprend que la planète Solaris fonctionne comme une mémoire affective, qui matérialise les pulsions de ceux qui l’approchent…', 'Unit Four', 'https://image.tmdb.org/t/p/w1280/wyRTlDFauciqkzvIanRDNAoangf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qjPhauZx2vOi3gNKsQfJZHeGemB.jpg', 'https://www.youtube.com/embed/fmWaYZPPgfs', 165, '1972', 3.93, 1),
(594, 'United States of America', 'Le Terminal', 'Viktor Navorski est l’un de ces milliers de touristes, venus des quatre coins du monde, qui débarquent chaque jour à l’Aéroport JFK de New York. Mais, à quelques heures de son arrivée, voilà qu’un coup d’État bouleverse sa petite république d’Europe Centrale, mettant celle‐ci au ban des nations et faisant de Viktor… un apatride. Les portes de l’Amérique se ferment devant lui, alors même que se bouclent les frontières de son pays: Viktor est bel et bien coincé…', 'Amblin Entertainment', 'https://image.tmdb.org/t/p/w1280/kzmY94woFy7alwea9H1JVS4tUCQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zywtNiaZ9r7azrcNdl2j0jOgrkw.jpg', 'https://www.youtube.com/embed/2P4vgwGkTz8', 129, '2004', 3.65, 1),
(595, 'United States of America', 'Du silence et des ombres', 'Atticus Finch, un avocat dans le sud des États-Unis des années 1930 doit défendre un homme noir accusé de viol. Le récit, raconté à travers les souvenirs et le regard de ses enfants Scout et Jem, est parsemé de détails sur la vie et les mentalités de l\'époque ainsi que d\'anecdotes de voisinages (dont certaines inspirées des souvenirs d\'enfance de l\'auteur du roman).', 'Pakula-Mulligan', 'https://image.tmdb.org/t/p/w1280/bMuXgPmZhQtvzsy0oivTVLjVKi8.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mbJIERhLu25fyZb8DQIq1JN3AOR.jpg', 'https://www.youtube.com/embed/pBAV_-nkRaU', 129, '1962', 4.01, 1),
(596, 'United States of America', 'Les Raisins de la colère', 'Un jeune homme rentre à la ferme familiale en Oklahoma, après avoir purgé une peine de quatre ans de prison pour homicide involontaire. La Grande Dépression sévit alors et comme beaucoup d’autres fermiers, sa famille est chassée de son exploitation. Ensemble, ils partent à travers le pays dans l’espoir de trouver, un jour, du travail en Californie. C’est le début d’un périple éprouvant, de camps de réfugiés en bidonvilles de fortunes, dans une Amérique en proie à la misère et à l’oppression…', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/3Eg7DADbVD28JB3pHByLID4R3pU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7UTQCis1B8oWNjIMzQq57LPqma2.jpg', 'https://www.youtube.com/embed/7G9JgxcleMc', 129, '1940', 3.92, 1),
(597, 'United States of America', 'Titanic', 'Southampton, 10 avril 1912. Le paquebot le plus grand et le plus moderne du monde, réputé pour son insubmersibilité, le « Titanic », appareille pour son premier voyage. Quatre jours plus tard, il heurte un iceberg. À son bord, un artiste pauvre et une grande bourgeoise tombent amoureux.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/vpsvHLkoeKUjceIMeNSqCp3xEyY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rzdPqYx7Um4FUZeD8wpXqjAUcEm.jpg', 'https://www.youtube.com/embed/7zhkCAVlr7E', 194, '1997', 3.95, 1),
(598, 'Brazil', 'La Cité de Dieu', 'Dans une favela qui a vu le jour à Rio de Janeiro dans les années soixante, Fusée est un gamin noir, pauvre, trop fragile pour devenir hors-la-loi, mais assez malin pour ne pas se contenter d\'un travail sous payé. Il grandit dans un environnement violent, mais tente de voir la réalité autrement, avec l\'oeil d\'un artiste. Il rêve de devenir photographe professionnel. Petit Dé, un enfant de onze ans, emménage dans la Cité. Il souhaite pour sa part devenir le plus grand criminel de Rio et commence son apprentissage en rendant de menus services à la pègre locale. Il admire Tignasse et son gang, qui arraisonnent les camions et cambriolent à tout va. Tignasse donne à Petit Dé l\'occasion de commettre un meurtre, le premier d\'une longue série...', 'O2 Filmes', 'https://image.tmdb.org/t/p/w1280/sxK3ESowPbYI5Tij2SIK8xqMQnE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5p3aTxtUtZHCHwYsuycutmxIhND.jpg', 'https://www.youtube.com/embed/_mDvXaRJcTM', 135, '2002', 4.21, 1),
(599, 'United States of America', 'Boulevard du crépuscule', 'Norma Desmond, grande actrice du muet, vit recluse dans sa luxueuse villa de Berverly Hills en compagnie de Max von Meyerling, son majordome qui fut aussi son metteur en scène et mari. Joe Gillis, un scénariste sans le sou, pénètre par hasard dans la propriété et Norma lui propose de travailler au scénario du film qui marquera son retour à l\'écran, Salomé. Joe accepte, s\'installe chez elle, à la fois fasciné et effrayé par ses extravagances et son délire, et devient bientôt son amant. Quand son délire se transforme en paranoïa et qu\'elle débarque au milieu des studios Paramount pour convaincre Cecil B. DeMille de tourner à nouveau avec elle, Gillis commence à prendre ses distances...', 'Paramount', 'https://image.tmdb.org/t/p/w1280/uI3woJ8BROjZm1Tfvc6XlyDkXG3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//p47ihFj4A7EpBjmPHdTj4ipyq1S.jpg', 'https://www.youtube.com/embed/xCcv0Iojj3c', 110, '1950', 4.18, 1),
(600, 'United Kingdom', 'Full Metal Jacket', 'Pendant la guerre du Viêt Nam, la préparation et l’entraînement d’un groupe de jeunes marines, jusqu’au terrible baptême du feu et la sanglante offensive du Tết à Hue, en 1968.', 'Natant', 'https://image.tmdb.org/t/p/w1280/cShwwkz4gBBIRj8yFy8TP2tEWZ4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yozBWKbyeXtPGN75PlHurOaVvEz.jpg', 'https://www.youtube.com/embed/QCW8p5GeBj4', 116, '1987', 4.07, 1),
(601, 'United States of America', 'E.T. l\'extra-terrestre', 'Une soucoupe volante atterrit en pleine nuit près de Los Angeles. Quelques extraterrestres, envoyés sur Terre en mission d’exploration botanique, sortent de l’engin, mais un des leurs s’aventure au-delà de la clairière où se trouve la navette. Celui-ci se dirige alors vers la ville. C’est sa première découverte de la civilisation humaine. Bientôt traquée par des militaires et abandonnée par les siens, cette petite créature apeurée se nommant E.T. se réfugie dans une résidence de banlieue. Elliot, un garçon de dix ans, le découvre et lui construit un abri dans son armoire. Rapprochés par un échange télépathique, les deux êtres ne tardent pas à devenir amis. Aidé par sa sœur Gertie et son frère aîné Michael, Elliot va alors tenter de garder la présence d\'E.T. secrète.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/5jl5sfhTeAlp60rM9GxoDA2dmX9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9Kg322bGsEbmp94LjCCVGz3cpNw.jpg', 'https://www.youtube.com/embed/DKOjbO9-vcc', 115, '1982', 3.75, 1),
(602, 'United States of America', 'Independence Day', 'Une immense soucoupe volante envahit le ciel terrestre, libérant un nombre infini de plus petites soucoupes qui prennent position au-dessus des plus grandes villes du monde. Un informaticien new-yorkais décrypte les signaux émanant des étranges voyageurs. Ils ne sont pas du tout amicaux et ces extraterrestres se préparent à attaquer la Terre.', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/uKKikO9Rec7dkk29ob8BrqLCV8q.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uw4SnKFZ453Gxmj5XR5Susj8TNo.jpg', 'https://www.youtube.com/embed/ztv8HJuPyL4', 140, '1996', 3.43, 1),
(603, 'United States of America', 'Matrix', 'Programmeur anonyme dans un service administratif le jour, Thomas Anderson devient Neo la nuit venue. Sous ce pseudonyme, il est l’un des pirates les plus recherchés du cyber‐espace. À cheval entre deux mondes, Neo est assailli par d’étranges songes et des messages cryptés provenant d’un certain Morpheus. Celui‐ci l’exhorte à aller au‐delà des apparences et à trouver la réponse à la question qui hante constamment ses pensées : qu’est‐ce que la Matrice ? Nul ne le sait, et aucun homme n’est encore parvenu à en percer les défenses. Mais Morpheus est persuadé que Neo est l’Élu, le libérateur mythique de l’humanité annoncé selon la prophétie. Ensemble, ils se lancent dans une lutte sans retour contre la Matrice et ses terribles agents…', 'Village Roadshow Pictures', 'https://image.tmdb.org/t/p/w1280/pEoqbqtLc4CcwDUDqxmEDSWpWTZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//l4QHerTSbMI7qgvasqxP36pqjN6.jpg', 'https://www.youtube.com/embed/nUEQNVV3Gfs', 135, '1999', 4.1, 1),
(604, 'United States of America', 'Matrix Reloaded', 'Neo apprend à mieux contrôler ses dons naturels, alors même que Sion s\'apprête à tomber sous l\'assaut de l\'Armée des Machines. D\'ici quelques heures, 250 000 Sentinelles programmées pour anéantir notre espèce envahiront la dernière enclave humaine de la Terre. Mais Morpheus galvanise les citoyens de Sion en leur rappelant la Parole de l\'Oracle : il est encore temps pour l’Élu d\'arrêter la guerre contre les Machines. Tous les espoirs se reportent dès lors sur Neo. Au long de sa périlleuse plongée au sein de la Matrix et de sa propre destinée, ce dernier sera confronté à une résistance croissante, une vérité encore plus aveuglante, un choix encore plus douloureux que tout ce qu\'il avait jamais imaginé.', 'Village Roadshow Pictures', 'https://image.tmdb.org/t/p/w1280/4ZVnFZUjahpLz7B42mkVjtEl9Wl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pxK1iK6anS6erGg4QePmMKbB1E7.jpg', 'https://www.youtube.com/embed/JNCLUd3Htos', 138, '2003', 3.52, 1),
(605, 'United States of America', 'Matrix Revolutions', 'La longue quête de liberté des rebelles culmine en une bataille finale explosive. Tandis que l\'armée des Machines sème la désolation sur Sion, ses citoyens organisent une défense acharnée. Mais pourront-ils retenir les nuées implacables des Sentinelles en attendant que Neo s\'approprie l\'ensemble de ses pouvoirs et mette fin à la guerre ? L\'agent Smith est quant à lui parvenu à prendre possession de l\'esprit de Bane, l\'un des membres de l\'équipage de l\'aéroglisseur. De plus en plus puissant, il est désormais incontrôlable et n\'obéit plus aux Machines : il menace de détruire leur empire ainsi que le monde réel et la Matrice...', 'Village Roadshow Pictures', 'https://image.tmdb.org/t/p/w1280/xOCeckuZDzqydvt3vLlzftZkef1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//533xAMhhVyjTy8hwMUFEt5TuDfR.jpg', 'https://www.youtube.com/embed/sK51m1tj_bE', 128, '2003', 3.35, 1),
(606, 'United States of America', 'Out of Africa', 'Après une déception amoureuse, la jeune Danoise Karen décide de se marier et de s\'embarquer pour l\'Afrique. Vite délaissée par un mari volage, elle se consacre à la culture des caféiers et fait figure de pionnière. Son amitié pour l\'aventurier Denys se transformera en amour mais elle ne saura pas retenir cet homme épris de liberté.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/mkWeTzhzncrsPlJaKpTKWSxcp78.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oGYRCq5eBhgXuLX20czONxa0uC8.jpg', 'https://www.youtube.com/embed/wrtj4q6XbEs', 161, '1985', 3.6, 1),
(607, 'United States of America', 'Men in Black', 'Chargés de protéger la Terre de toute infraction extraterrestre et de réguler l’immigration intergalactique sur notre planète, les Men in black ou MIB opèrent dans le plus grand secret. Vêtus de costumes sombres et équipés des toutes dernières technologies, ils passent inaperçus aux yeux des humains dont ils effacent régulièrement la mémoire récente : la présence d’aliens sur notre sol doit rester secrète. Récemment séparé de son vieux partenaire, retourné à la vie civile sans aucun souvenir de sa vie d’homme en noir, K, le plus expérimenté des agents du MIB décide de former J, un jeune policier. Ensemble, ils vont afronter une nouvelle menace : Edgar le cafard…', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/rd0VCTHFFIE7BbZfy0aEIkOYxGA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wM1aNIXSqB8GSeQY38LOUHYMYIw.jpg', 'https://www.youtube.com/embed/ubl2iqQO90E', 98, '1997', 3.59, 1),
(608, 'United States of America', 'Men in Black II', 'En quatre années passées à protéger la Terre de toutes sortes d’invasions extraterrestres, l’agent J, qui travaille secrètement au quartier général des Men in Black, n’a toujours pas trouvé de partenaire avec qui faire équipe. À la suite d’un crime étrange impliquant des extraterrestres, l’agence découvre l’existence d’un redoutable complot menaçant notre planète. Serleena, une maléfique séductrice qui a pris l’apparence d’un top‐model en lingerie fine, est prête à tout pour accomplir son sinistre dessein. J a absolument besoin des services de K, son ancien partenaire qui n’a plus aucun souvenir des MIB et travaille dorénavant à la Poste. J va devoir par tous les moyens le faire sortir de sa retraite.', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/uuCitEX1b1OdWqu8upqoSuIwmoz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//o1l6OCqA3pYDZHIc5L1s7CEzCMv.jpg', 'https://www.youtube.com/embed/DMHlNR6x2Sw', 90, '2002', 3.18, 1),
(609, 'United States of America', 'Poltergeist', 'Steve Freeling lives with his wife, Diane, and their three children, Dana, Robbie, and Carol Anne, in Southern California where he sells houses for the company that built the neighborhood. It starts with just a few odd occurrences, such as broken dishes and furniture moving around by itself. However, when he realizes that something truly evil haunts his home, Steve calls in a team of parapsychologists led by Dr. Lesh to help before it\'s too late.', 'SLM Production Group', 'https://image.tmdb.org/t/p/w1280/xPazCcKp62IshnLVf9BLAjf9vgC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bvkPno6U02lLyvPWCnmibq4eIaN.jpg', 'https://www.youtube.com/embed/', 114, '1982', 3.57, 1),
(612, 'Canada', 'Munich', 'Jeux Olympiques de Munich, 5 septembre 1972. Un commando de terroristes palestiniens prend en otages puis exécute 11 membres de l\'équipe sportive israélienne, sous l\'œil des téléspectateurs du monde entier. Inspiré de faits réels, Munich retrace le parcours de 5 agents israéliens chargés de traquer les 11 palestiniens considérés comme les commanditaires de l\'attentat. Pour mener à bien cette mission, les 5 hommes devront renoncer du jour au lendemain à leur identité, et s’exposer à tout moment à la vengeance de leurs cibles.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/mCWtxKSrdSjRWhFl4Mf3UDrkpdM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//titl6uMe5u974sLAA2Zy1kFi4sC.jpg', 'https://www.youtube.com/embed/CQNUwN5d5ck', 163, '2005', 3.57, 1),
(613, 'Austria', 'La Chute', 'Berlin, avril 1945. Le IIIe Reich agonise. Les combats font rage dans les rues de la capitale. Hitler, accompagné de ses généraux et de ses plus proches partisans, s\'est réfugié dans son bunker, situé dans les jardins de la Chancellerie. À ses côtés, Traudl Junge, la secrétaire particulière du Führer, refuse de l\'abandonner. Tandis qu\'à l\'extérieur la situation se dégrade, Hitler vit ses dernières heures et la chute du régime.', 'NDR', 'https://image.tmdb.org/t/p/w1280/65SbewZc6xPsQ9cydXZhF1hVOh2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xgAEfHByamMdRCA31oERQrsiutF.jpg', 'https://www.youtube.com/embed/Bp1RXmM1-60', 155, '2004', 3.92, 1),
(614, 'Sweden', 'Les Fraises sauvages', 'Le docteur Isak Borg part à Lund pour assister à une cérémonie de jubilé en son honneur. Au cours de ce voyage, dans sa propre limousine et accompagné de sa bru, il fait le point sur sa vie et finalement se réconcilie avec lui-même.', 'SF Studios', 'https://image.tmdb.org/t/p/w1280/sSwqjBEHTnu2fsATr4hndlZZYyV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//BBVAUchYvkmPThVIqipgAfabfl.jpg', 'https://www.youtube.com/embed/', 92, '1957', 4.07, 1),
(615, 'United States of America', 'La Passion du Christ', 'Les douze dernières heures de la vie du Christ. Rendu au Mont des Oliviers, Jésus prie après avoir partagé un dernier repas avec ses apôtres. Il résiste maintenant aux tentations de Satan. Trahi par Judas, Jésus est arrêté et emmené à Jérusalem, où les chefs des Pharisiens l’accusent de blasphème et lui font un procès qui a pour issue sa condamnation à mort…', 'Icon Productions', 'https://image.tmdb.org/t/p/w1280/nVjopQNIWFGQ4Kk73QxAeIw6xov.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4840rkbpsiuow5ew155oVKcqJwj.jpg', 'https://www.youtube.com/embed/Yj-vkw6Yn90', 126, '2004', 3.73, 1),
(616, 'Japan', 'Le Dernier Samouraï', 'En 1876, le capitaine Nathan Algren vit avec les souvenirs des batailles sanglantes menées contre les Sioux. Fort de son expérience au combat, il devient conseiller militaire pour le compte de l\'empereur japonais soucieux d\'ouvrir son pays aux traditions et au commerce occidentaux et d\'éradiquer l\'ancienne caste guerrière des samouraïs. Mais ceux-ci influent sur le capitaine Algren, qui se trouve bientôt pris entre deux feux, au cœur d\'une confrontation entre deux époques et deux mondes avec, pour le guider, son sens de l\'honneur.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/dJDLjVmBNMb13wZ6lXYwe6uscel.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4m0eLZzOr5W1BK9el9ASQrTwd0m.jpg', 'https://www.youtube.com/embed/6KgyOTKK_FY', 154, '2003', 3.78, 1),
(617, 'United States of America', 'Wild Things', 'When teen-socialite Kelly Van Ryan and troubled bad girl Suzie Toller accuse guidance counselor Sam Lombardo of rape, he\'s suspended by the school, rejected by the town, and fighting to get his life back. One cop suspects conspiracy, but nothing is what it seems...', 'Mandalay Entertainment', 'https://image.tmdb.org/t/p/w1280/aaicreJBf7EuwGq3GgUV5ZedlfF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1Gci6i2RHuum4JaXnlWfev3GH5b.jpg', 'https://www.youtube.com/embed/OdCeYYQylA4', 108, '1998', 3.17, 1),
(618, 'United States of America', 'The Birth of a Nation', 'Two families, abolitionist Northerners the Stonemans and Southern landowners the Camerons, intertwine. When Confederate colonel Ben Cameron is captured in battle, nurse Elsie Stoneman petitions for his pardon. In Reconstruction-era South Carolina, Cameron founds the Ku Klux Klan, battling Elsie\'s congressman father and his African-American protégé, Silas Lynch.', 'Epoch Film Co.', 'https://image.tmdb.org/t/p/w1280/pNpOXpQI5GSUfiWypubYtMh9928.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4H4RAeeykpi0ijvu3wYgV346y06.jpg', 'https://www.youtube.com/embed/a9UPOkIpR0A', 193, '1915', 3.03, 1),
(619, 'United States of America', 'Bodyguard', 'Frank Farmer, ancien agent des services secrets, est un garde du corps émérite qui a mis ses talents à la disposition de deux présidents et de nombreux financiers et politiciens de réputation internationale. Un jour, l\'impresario Bill Devaney lui propose un contrat avantageux pour assurer la protection de sa cliente Rachel, comédienne et chanteuse en pleine ascension, menacée par un fan inconnu.', 'Kasdan Pictures', 'https://image.tmdb.org/t/p/w1280/ky6WwnRd4SjKRhWDvwHC8YN5MgT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6LS4YtklwlHSHhNTCAiZGEXRvJZ.jpg', 'https://www.youtube.com/embed/AhIJMuPHWVQ', 129, '1992', 3.35, 1),
(620, 'United States of America', 'Ghostbusters', 'After losing their academic posts at a prestigious university, a team of parapsychologists goes into business as proton-pack-toting \"ghostbusters\" who exterminate ghouls, hobgoblins and supernatural pests of all stripes. An ad campaign pays off when a knockout cellist hires the squad to purge her swanky digs of demons that appear to be living in her refrigerator.', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/7E8nLijS9AwwUEPu2oFYOVKhdFA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//c6yfABGVKuB5cjoOwdX4AJMlzUz.jpg', 'https://www.youtube.com/embed/EzGrXSCpQNY', 107, '1984', 3.73, 1),
(621, 'United States of America', 'Grease', 'Durant l\'été 1958, Sandy Olsson, une lycéenne australienne en vacances aux États-Unis, rencontre Danny Zuko, le chef de la bande des T-Birds. Leur amour est cependant interrompu par la fin des vacances : Sandy doit retourner en Australie.  Toutefois, le hasard fait que Sandy reste en Amérique et qu\'elle intègre le lycée Rydell, l\'établissement où étudie Danny. Elle y rencontre un groupe de filles, les « Pink Ladies », mené par Betty Rizzo. Sans savoir qu\'ils sont si proches l\'un de l\'autre, Danny et Sandy racontent à leurs amis, chacun de leur côté,  leur amour de vacances. Danny et Sandy finissent par se rencontrer et décident de reprendre leur relation, bien que tout les oppose à l\'école...', 'Paramount', 'https://image.tmdb.org/t/p/w1280/eaRVdZWk1rSFT4eDaRnUFR7I7xZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pdhDFmVQSA0f5i5IL0gpWROjgZ5.jpg', 'https://www.youtube.com/embed/eQMVx4krPwg', 110, '1978', 3.7, 1),
(622, 'Spain', 'La Neuvième porte', 'Dean Corso est un chercheur de livres rares pour collectionneurs fortunés. Sa réputation lui vaut d\'être engagé par un éminent bibliophile, féru de démonologie, Boris Balkan, qui lui demande de traquer les deux derniers exemplaires du légendaire manuel d\'invocation satanique, « Les 9 portes du royaume des ombres ». Corso relève le défi. De New York à Tolède, de Paris à Cintra, il s\'enfonce dans un labyrinthe semé de pièges et de tentations. Il va peu à peu décrypter les énigmes du livre maudit et découvrir le véritable enjeu de sa mission.', 'R.P. Productions', 'https://image.tmdb.org/t/p/w1280/vSdhswCcskSKLXiS1OAJfr04Rcl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aHuXEyMrXPNw01qyk2pdcCfuN75.jpg', 'https://www.youtube.com/embed/nNB6Plpv9_4', 132, '1999', 3.23, 1),
(623, 'United Kingdom', 'Un poisson nommé Wanda', 'Wanda, Ken, Otto et George viennent d\'accomplir un joli hold up. Mais George, très vite dénoncé par Wanda et Otto, finit en prison. Or, lui seul connaît l\'endroit où sont cachés les diamants qui constituent le butin. Wanda décide de séduire Archie Leach, un avocat très traditionnel, coincé et marié à une femme snob, afin qu\'il fasse libérer George de prison...', 'Prominent Features', 'https://image.tmdb.org/t/p/w1280/axPDdJguyn7ilGBYHknQYclG6Su.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//y8HaV1Ntr6nHmKxZ29B7DwxwvNU.jpg', 'https://www.youtube.com/embed/', 108, '1988', 3.6, 1),
(624, 'United States of America', 'Easy Rider', 'Wyatt «Captain America» et Billy, deux bikers hippies, traversent le sud des États-Unis. Sur leur route, une galerie de portraits contrastés de l\'Amérique d\'alors.', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/2mLXLpXFLgzEY9x35sT3lQ6Ff5H.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//78dHjJKxKZ8JbCm3lEMjDRulLp.jpg', 'https://www.youtube.com/embed/', 90, '1969', 3.54, 1),
(625, 'United Kingdom', 'The Killing Fields', 'New York Times reporter Sydney Schanberg is on assignment covering the Cambodian Civil War, with the help of local interpreter Dith Pran and American photojournalist Al Rockoff. When the U.S. Army pulls out amid escalating violence, Schanberg makes exit arrangements for Pran and his family. Pran, however, tells Schanberg he intends to stay in Cambodia to help cover the unfolding story — a decision he may regret as the Khmer Rouge rebels move in.', 'Goldcrest', 'https://image.tmdb.org/t/p/w1280/cX6Bv7natnZwQjsV9bLL8mmWjkS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//SmzC77NERiB8cLdA6enIjvuS8E.jpg', 'https://www.youtube.com/embed/yzi0TohDUPk', 142, '1984', 3.75, 1),
(640, 'United States of America', 'Arrête-moi si tu peux', 'Dans les années soixante, le jeune Frank Abagnale Jr. est passé maître dans l’art de l’escroquerie, allant jusqu’à détourner 2, 5 millions de dollars et à figurer sur les listes du FBI comme l’un des dix individus les plus recherchés des États‐Unis. Véritable caméléon, Frank revêt des identités aussi diverses que celles de pilote de ligne, de médecin, de professeur d’université ou encore d’assistant du procureur. Carl Hanratty, agent du FBI à l’apparence stricte, fait de la traque de Frank Abagnale Jr. sa mission prioritaire, mais ce dernier reste pendant longtemps insaisissable…', 'Parkes/MacDonald Productions', 'https://image.tmdb.org/t/p/w1280/kBKinpkg20wdxjRYtzrJDJfytms.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//Ag6qhzsJd3k1NKuNrG9RmhZDMh7.jpg', 'https://www.youtube.com/embed/rPKoc0sU_DA', 141, '2002', 3.98, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(641, 'United States of America', 'Requiem for a Dream', 'Harry Goldfarb est un junkie. Il passe ses journées en compagnie de sa petite amie Marion et son copain Tyrone. Ensemble, ils s’inventent un paradis artificiel. En quête d’une vie meilleure, le trio est entraîné dans une spirale infernale qui les enfonce toujours un peu plus dans l’angoisse et le désespoir. La mère d’Harry, Sara, souffre d’une autre forme d’addiction, la télévision. Juive, fantasque et veuve depuis des années, elle vit seule à Coney Island et nourrit dans le secret l’espoir de participer un jour à son émission préférée. Afin de satisfaire aux canons esthétiques de la télévision, elle s’astreint à un régime draconien. Un jour, elle le sait, elle passera de l’autre côté de l’écran.', 'Artisan Entertainment', 'https://image.tmdb.org/t/p/w1280/nOd6vjEmzCT0k4VYqsA2hwyi87C.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//g1U311jgL4DJbGgvIZgiCfHp44Q.jpg', 'https://www.youtube.com/embed/', 101, '2000', 4.02, 1),
(642, 'United States of America', 'Butch Cassidy et le Kid', 'Au début du XXème siècle, Butch Cassidy et son ami Sundance Kid pillent les trains et les banques. Les deux malfrats élaborent un plan ingénieux qui leur permet de dévaliser deux fois le même convoi, mais les autorités sont sur leur piste. Le Kid retrouve son amie, Etta Place, une jeune institutrice, et Butch Cassidy improvise avec elle un brillant numéro à bicyclette. La seconde attaque de l\'Union Pacific oblige les deux complices et Etta à abandonner leurs amis et à fuir en Bolivie. Là, ils poursuivent leurs exploits criminels et ce, malgré la défection de la jeune femme, effrayée par la tournure que prennent les événements.', 'Campanile Productions', 'https://image.tmdb.org/t/p/w1280/iSY0dVU2BG4NRGV0KGqt8F3c4Ra.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//C6jcUqld8M6hZQmzBxgwHuQ4qT.jpg', 'https://www.youtube.com/embed/', 110, '1969', 3.81, 1),
(643, 'Soviet Union', 'Le Cuirassé Potemkine', 'En janvier 1905, éclate la première révolution russe, suivie le 14 juin de la révolte des marins du « Potemkine ». Ce qui au départ s\'annonçait comme une petite protestation d\'un équipage lassé et furieux de n\'avoir à manger que de la viande pourrie a dégénéré en une véritable insurrection dans le port d\'Odessa.', 'Mosfilm', 'https://image.tmdb.org/t/p/w1280/hE9f8of8DyRq5TsituuIfF0T8bZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uzr65Z3xDCjuMW7fw8Whm5curr7.jpg', 'https://www.youtube.com/embed/048SEBstzBM', 75, '1925', 3.82, 1),
(644, 'United States of America', 'A.I. : Intelligence artificielle', 'Dans un XXIe siècle où la fonte des glaces a submergé la majorité des terres habitables et provoqué famines et exodes, les robots sont devenus une composante essentielle de la vie quotidienne, et assurent désormais la plupart des tâches domestiques. Pourtant, le professeur Hobby veut aller encore plus loin en créant le premier androïde sensible : un enfant capable de développer un vaste répertoire d\'émotions et de souvenirs. Peu après cette annonce, David, un robot de onze ans, fait son entrée chez Henry et Monica Swinton, un couple dont le jeune fils a été cryogénisé en attendant la découverte d\'un remède pour guérir sa grave maladie. Bientôt abandonné par sa mère adoptive, David entame un périlleux voyage à la recherche de son identité et de sa part secrète d\'humanité.', 'Amblin Entertainment', 'https://image.tmdb.org/t/p/w1280/q9zvQ1WuriRlGDYu5Nip5N2vZRA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//n7p6UTAZtkeoHkwCO42BEQaMFJY.jpg', 'https://www.youtube.com/embed/a6lTk0mLaGo', 145, '2001', 3.5, 1),
(646, 'United Kingdom', 'James Bond 007 contre Dr. No', 'Le chef des services secrets de Sa Majesté britannique, « M », envoie en mission à la Jamaïque l\'agent spécial 007, James Bond, enquêter sur la disparition d\'un de ses collègues. L\'espion va affronter la puissance maléfique de Spectre, organisation criminelle qui vise à la domination du monde, personnifiée par le redoutable Dr No. Au gré de ses aventures il rencontrera la sublime Honey, qui surgit de l\'eau vêtue d\'un bikini blanc.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/wfe1iXOCHXqcergfzwg6V5CBCkf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ptcXbbxTyjHfEE4d4QocNP0YQct.jpg', 'https://www.youtube.com/embed/tb6n1lq0MCw', 105, '1962', 3.5, 1),
(647, 'Japan', 'Final Fantasy VII: Advent Children', 'Cloud Strife, ex‐soldat, décide de s’isoler de ses anciens compagnons pour lutter contre les souvenirs de son passé, seul. Cependant, quand il se fait attaquer par le gang de Kadaj, Loz, et Yazoo, qui recherchent leur « Mère » pour commencer leur « Réunion », Cloud va devoir plus que jamais affronter les souvenirs qui le tourmentent.', 'SQUARE ENIX', 'https://image.tmdb.org/t/p/w1280/3ofB33mQKyPZo1TnezhQdHtKyXl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8xhgpYyNSX5sJi0P35hwL73QYOV.jpg', 'https://www.youtube.com/embed/Np93_Kpd5pI', 100, '2005', 3.57, 1),
(648, 'France', 'La Belle et la Bête', 'Pour l\'offrir à sa fille, le père de la Belle cueille, sans le savoir, une rose appartenant au jardin de la Bête, qui s\'en offense. Afin de sauver son père, la Belle accepte de partir vivre au château de la Bête.', 'Andre Paulve Film', 'https://image.tmdb.org/t/p/w1280/eDVFP076HkfD2LL29aja6zGh6As.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2Ae0iV2HR3Raoras8G40MjBtJnn.jpg', 'https://www.youtube.com/embed/Kd7K1mxaOjM', 96, '1946', 3.74, 1),
(649, 'France', 'Belle de jour', 'Séverine Serizy est une jeune et très belle femme aux fantasmes masochistes assez particuliers. Elle est mariée au docteur Pierre Serizy qu\'elle aime « au-delà du plaisir » : elle ne parvient en effet pas à trouver le plaisir auprès de lui, ce qui les frustre tous les deux. Un ami du couple, Monsieur Henri Husson, lui parle d\'un bordel de luxe et lui avoue son désir pour elle. Insatisfaite sexuellement, Séverine commence secrètement à y travailler, se prostituant seulement certains après-midi de 14 à 17 heures, d\'où son surnom Belle de jour, avant de retourner dans les bras de son mari, qui, heureux, ne se doute de rien.', 'Paris Films Productions', 'https://image.tmdb.org/t/p/w1280/7B6TUmb1vSkJW2emcIat2XkuUIx.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9fJPLvrUV32MzpfDwXk7cOnj8hM.jpg', 'https://www.youtube.com/embed/eeuiM0RObjI', 101, '1967', 3.71, 1),
(650, 'United States of America', 'Boyz n the Hood : La loi de la rue', 'Le passage de l\'adolescence a l\'age d\'homme pour trois heros de la rue d\'une banlieue de Los Angeles. Premier film de John Singleton fortement inspire de sa propre experience.', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/pPhJFt6fqaJjHwnk43oPSFFpyum.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ojzo9tMl8ZLrQgdGApZJFLuS331.jpg', 'https://www.youtube.com/embed/', 112, '1991', 3.8, 1),
(651, 'United States of America', 'M*A*S*H', 'Pendant la guerre de Corée, Hawkeye Pierce, Trapper John Mc Intyre et Duke Forrest rejoignent la 4077 ème antenne chirurgicale militaire. Ces chirurgiens de valeur vont se consacrer à leur métier et à leur passion pour les femmes, en l\'occurrence les infirmières. L\'horreur, la bouffonnerie et l\'acidité du propos vont de pair avec une authenticité quasi documentaire de certaines scènes.', 'Aspen Productions (I)', 'https://image.tmdb.org/t/p/w1280/Q8zeMBVaMEKw0QneN2Wl2x3mKz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//u4u4c5I12Vt6lZI3j6e8CAbOMnW.jpg', 'https://www.youtube.com/embed/', 116, '1970', 3.5, 1),
(652, 'United States of America', 'Troie', 'Dans la Grèce antique, l\'enlèvement d\'Hélène, reine de Sparte, par Pâris, prince de Troie, est une insulte que le roi Ménélas ne peut supporter. L\'honneur familial étant en jeu, Agamemnon, frère de Ménélas et puissant roi de Mycènes, réunit toutes les armées grecques afin de faire sortir Hélène de Troie. Mais en réalité, la sauvegarde de l\'honneur familial n\'est qu\'un prétexte pris par Agamemnon pour cacher sa terrible avidité. Celui-ci cherche en fait à contrôler Troie et à agrandir son vaste empire. Aucune armée n\'a jamais réussi à pénétrer dans la cité fortifiée, sur laquelle veillent le roi Priam et le prince Hector. L\'issue de la guerre de Troie dépendra notamment d\'un homme, Achille, connu comme le plus grand guerrier de son époque. Arrogant, rebelle, et réputé invincible, celui-ci n\'a d\'attache pour rien ni personne si ce n\'est sa propre gloire…', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/pkKBYrihVm5kuBgOH04KagSids0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qZitv5zrSXfJafGThxmvbvTsuu5.jpg', 'https://www.youtube.com/embed/5GkNIb-YphI', 196, '2004', 3.57, 1),
(653, 'Germany', 'Nosferatu le vampire', 'En 1838, Hutter, jeune clerc de notaire, part conclure une vente avec un châtelain des Carpathes. Après des rencontres menaçantes et de funestes presages, il est reçu par le comte Orlock qui n\'est autre que la réincarnation du vampire Nosferatu, créature qui ne peut vivre qu\'en suçant le sang des humains. Ce chef-d\'oeuvre du cinéma muet d\'épouvante tourné en decors naturels est la première adaptation fidèle du célèbre roman de Bram Stocker, Dracula, publié en 1897.', 'Prana-Film GmbH', 'https://image.tmdb.org/t/p/w1280/3MI2hME5h1yrGAT2eWjXaeHf89e.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//u06SympEEMb7pLhR9W3tvydHT9L.jpg', 'https://www.youtube.com/embed/rg6FJfhy6GM', 95, '1922', 3.86, 1),
(654, 'United States of America', 'Sur les quais', 'Un jeune docker, Terry Malloy, ancien boxeur, est manipulé par son frère, avocat du syndicat des dockers dirigé par le crapuleux Johnny Friendly. Il assiste sans intervenir au meurtre d\'un employé qui voulait dénoncer les méthodes illégales de ce dernier. Malloy se retrouve devant un cas de conscience...', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/mVrMBsovgLtlONd03l1OhjsnnCq.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hUzRPXBUHyJhpyGV0NfBDuadbgp.jpg', 'https://www.youtube.com/embed/f6J1PZVcdMY', 106, '1954', 4, 1),
(655, 'France', 'Paris, Texas', 'Un homme réapparaît subitement après quatre années d\'errance, période sur laquelle il ne donne aucune explication à son frère venu le retrouver. Accompagné de son fils, il part au Texas à la recherche de Jane, la mère de l\'enfant. Une quête vers l\'inconnu, une découverte mutuelle réunit ces deux êtres au passé tourmenté.', 'Channel Four Films', 'https://image.tmdb.org/t/p/w1280/u7fVugekkAeFLiEBuUOLrpI7MyO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//moTOuNKnM2phZCYPF49Y1Hb7WJj.jpg', 'https://www.youtube.com/embed/', 145, '1984', 4.05, 1),
(657, 'United Kingdom', 'Bons baisers de Russie', 'Venise, Kronsteen, grand champion d\'échecs et membre du Spectre, a été chargé par Blofeld de rallumer la guerre froide entre l\'Est et l\'Ouest. Avec l\'aide de Rosa Klebb, ex-chef des services secrets soviétiques, il a mis au point une stratégie qui passe par Istanbul et le vol du nouveau lecteur de déchiffrement soviétique. Persuadé que les britanniques vont mordre à l\'hameçon qu\'il leur tend et qu\'ils vont envoyer sur place James Bond, il charge Klebb de recruter une jeune femme au sein du consulat russe, dont le rôle sera de séduire Bond, de l\'aider à s\'emparer du lecteur et de le livrer à un redoutable tueur, Red Grant. La première partie du plan de Kronsteen se déroule sans anicroche. Bond arrive à Istanbul et y rencontre Kerim Bey qui dirige les services de renseignements britanniques en Turquie. Il apprend ainsi que Tatiana Romanova est prête à passer à l\'Ouest en leur donnant le lecteur.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/aEziUcFrC8m50RLj6FtdYIglGdA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8uNjWHsSW3TSOWDU4EY76H5MzAG.jpg', 'https://www.youtube.com/embed/JELm6NkF7yY', 115, '1963', 3.54, 1),
(658, 'United Kingdom', 'Goldfinger', 'L\'agent secret 007 est chargé d’enquêter sur les revenus d\'Auric Goldfinger. La banque d\'Angleterre a découvert qu\'il entreposait d\'énormes quantités d\'or, mais s\'inquiète de ne pas savoir dans quel but. Quelques verres, parties de golf, poursuites et autres aventures galantes plus loin, James Bond découvre en réalité les préparatifs du « crime du siècle », dont les retombées pourraient amener le chaos économique sur les pays développés du bloc de l\'Ouest…', 'Eon Productions', 'https://image.tmdb.org/t/p/w1280/8hN3D6rsQ98jSlkeMc43kfQ9pox.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lh65Y0sUQcRh5UVVgnTOfMUbN2c.jpg', 'https://www.youtube.com/embed/rbyPhz-voSg', 105, '1964', 3.68, 1),
(659, 'Germany', 'Le Tambour', 'À la fin des années 1920, dans la région de Dantzig, Oskar, refusant le monde cruel et surfait des adultes, décide à l\'âge de trois ans de ne plus grandir.\r Palme d\'or 1979 à Cannes', 'Jadran Film', 'https://image.tmdb.org/t/p/w1280/ntROGVllrLZ45NjR4Ua4bG7IdoL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uZJjc4hMgckb3H3tVkTmbmcBhIT.jpg', 'https://www.youtube.com/embed/Og-EkJ-_1C0', 163, '1979', 3.46, 1),
(660, 'United Kingdom', 'Opération Tonnerre', 'L\'organisation criminelle SPECTRE détourne un avion de l\'OTAN transportant deux bombes atomiques et réclame une rançon au gouvernement britannique. L\'agent secret James Bond est envoyé aux Bahamas à la recherche de Domino, la sœur du commandant Derval, qui pilotait le Vulcan. Celui-ci a en fait été tué et remplacé par un sosie. 007 découvre que l\'instigateur de l\'opération est un dénommé Emilio Largo, un homme riche et cruel passionné par les requins.', 'Eon Productions', 'https://image.tmdb.org/t/p/w1280/8dEXGawwI6aBUrh3RWKAQes9DAL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uJrKyUYf8FwVJQonCekRISeWUCc.jpg', 'https://www.youtube.com/embed/F9FOoyBolTM', 120, '1965', 3.32, 1),
(661, 'Germany', 'Le Mariage de Maria Braun', 'Maria et Herman ont connu un bonheur éphémère durant la guerre. Maria, devenue entraîneuse, se raccroche à la pensée de l\'être aimé. Lorsqu\'il réapparaît, elle tue son amant et Herman s\'accuse du meurtre.', 'Albatros Filmproduktion', 'https://image.tmdb.org/t/p/w1280/l3Jgm9Qi1t3fnRhD58sw613rahN.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sTgN0nsejc6vs4iJqEbWcFVUTzp.jpg', 'https://www.youtube.com/embed/', 120, '1979', 3.65, 1),
(662, 'France', 'La Jetée', 'L\'histoire débute à Paris, après la \" Troisième Guerre mondiale \" et la destruction nucléaire de toute la surface de la Terre. Le héros est le cobaye de scientifiques qui cherchent à rétablir un corridor temporel afin de permettre aux hommes du futur de transporter des vivres, des médicaments et des sources d\'énergies : \"D\'appeler le passé et l\'avenir au secours du présent\". Il a été choisi en raison de sa très bonne mémoire visuelle : il garde une image très forte et présente d\'un événement vécu pendant son enfance, lors d\'une promenade avec sa mère sur la jetée de l\'aéroport d\'Orly.', 'Argos Films', 'https://image.tmdb.org/t/p/w1280/ykoMHTuzXfSgVjSDkzH8ImG6ETo.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qNbl3TFwxIm0fyFqQ1iRxzs4hb7.jpg', 'https://www.youtube.com/embed/', 28, '1962', 3.96, 1),
(663, 'Canada', 'Saw 4', 'Le Tueur au puzzle et sa protégée, Amanda, ont disparu, mais la partie continue. Après le meurtre de l’inspectrice Kerry, deux profileurs chevronnés du FBI, les agents Strahm et Perez, viennent aider le détective Hoffman à réunir les pièces du dernier puzzle macabre laissé par le Tueur pour essayer, enfin, de comprendre. C’est alors que le commandant du SWAT, Rigg, est enlevé… Forcé de participer au jeu mortel, il n’a que 90 minutes pour triompher d’une série de pièges machiavéliques et sauver sa vie. En cherchant Rigg à travers la ville, le détective Hoffman et les deux profileurs vont découvrir des cadavres et des indices qui vont les conduire à l’ex‐femme du Tueur, Jill. L’histoire et les véritables intentions du Tueur au puzzle vont peu à peu être dévoilées, ainsi que ses plans sinistres pour ses victimes passées, présentes… et futures.', 'Twisted Pictures', 'https://image.tmdb.org/t/p/w1280/4igbMego1x6SpBxGuER3bqTTLkW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yi0tfJBw9icvlWTXvjLqpEeSTia.jpg', 'https://www.youtube.com/embed/Qe8ZSX2NW0A', 96, '2007', 3.1, 1),
(664, 'United States of America', 'Twister', 'Les exploits quotidiens et méconnus d\'un groupe de scientifiques, chasseurs de tornades du Midwest aux États-Unis. Jo Harding, qui a vu son père emporté par une tornade quand elle était enfant, sillonne inlassablement les routes du Midwest à la tête d\'une petite équipe de météorologues, aventuriers et casse-cou, unis autour d\'un même objectif: observer les tornades sur leur terrain d\'élection.', 'Constant c Productions', 'https://image.tmdb.org/t/p/w1280/bfrw3EciPa5NwlaGJMtMik6hxjr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aoWQe00ctaK5k56yc7vsoqEWdHI.jpg', 'https://www.youtube.com/embed/IeokJIGsAyM', 113, '1996', 3.23, 1),
(665, 'United States of America', 'Ben-Hur', 'Judas Ben‐Hur, prince de Judée, retrouve son ami d’enfance Messala, venu prendre la tête de la garnison de Jérusalem. Mais leur amitié ne peut résister à leurs caractères différents. Alors qu’une pierre tombe du balcon de la maison familiale de Ben‐Hur, manquant de tuer le gouverneur qui paradait plus bas, Messala trahit son ami qu’il sait innocent en l’envoyant aux galères et en jetant en prison sa mère et sa sœur. Ben‐Hur jure alors de reconquérir sa liberté et prépare sa vengeance.', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/4KH7VM5YyGwxe4kLSNxix2PNTn6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sU3gFo7Gn67zjtKXIvzJ4omcUbH.jpg', 'https://www.youtube.com/embed/0-UlyaNnQvc', 212, '1959', 3.93, 1),
(666, 'Brazil', 'Central do Brasil', 'Dora, ex-institutrice, gagne sa vie en écrivant des lettres pour les migrants illettrés à la gare centrale de Rio. Ana et son jeune fils Josue font appel à ses services pour retrouver le père de Josue. Lorsque Dora rentre dans son petit appartement de banlieue, elle fait le tri des lettres de la journée, en envoie certaines, jette les autres et en garde une partie dans un tiroir. C\'est ce qui arrive à la lettre de Josue. Quand sa mère meurt, renversée par un bus, Josue demande à Dora de l\'aider à retrouver son père. D\'abord insensible, Dora finit par accepter de l\'aider.', 'MACT Productions', 'https://image.tmdb.org/t/p/w1280/mxPuOyRJQbfopmXxHrY8d5lrMlK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lrLIy9OFRQg4VkhrCyolfNXJEUH.jpg', 'https://www.youtube.com/embed/', 110, '1998', 4.07, 1),
(667, 'United Kingdom', 'On ne vit que deux fois', 'Le gouvernement d’un pays asiatique veut provoquer un conflit armé entre les États-Unis et l’URSS. Afin de rester dans l’anonymat, il confie cette mission à l’organisation criminelle et secrète du SPECTRE. Celle-ci commence à faire disparaître des capsules américaines et russes dans l’espace pour engendrer le conflit et James Bond est bientôt envoyé au Japon pour enquêter sur ces incidents. Désormais allié à Tigre Tanaka, le chef des services secrets japonais, et à ses nombreux agents, il a une fois de plus l’occasion de démontrer ses talents dans bien des domaines.', 'Eon Productions', 'https://image.tmdb.org/t/p/w1280/ndTrIikus8KmeGnKdStGXvxsQS9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cpZAXIYA0lkZMpAt7d1MmH8ojNV.jpg', 'https://www.youtube.com/embed/NWPGujrEXw4', 117, '1967', 3.28, 1),
(668, 'United Kingdom', 'Au service secret de Sa Majesté', 'L\'agent secret James Bond est appelé à la rescousse pour mettre un terme aux malversations de Blofeld. Ce dernier tente de mettre au point un virus qui mettrait un terme à toute vie végétale sur la planète.', 'Eon Productions', 'https://image.tmdb.org/t/p/w1280/sHYTFChLjBU7TLQwpcX5BHQNUp9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1kdyLiE2Mqt7cxnivdPX3qckvfW.jpg', 'https://www.youtube.com/embed/FLh-saxgMjY', 142, '1969', 3.29, 1),
(669, 'United States of America', 'Nanouk l\'Esquimau', 'Dans le Grand Nord canadien, la vie quotidienne d\'une famille d\'Esquimaux au fil des saisons. Présentation de Nanouk et des siens en été : arrivée du kayak pagayé par Nanouk et d\'où sortent successivement tous les membres de sa famille, sa femme, leurs deux enfants et sa belle-sœur ; vente au comptoir local des fourrures récoltées au cours de l\'hiver ; écoute amusée de la musique jouée sur un gramophone (il mordille le disque en riant) ; chasse à l\'otarie ; pêche en mer. En hiver : déplacement de la famille en traîneau à chiens, chasse au renard blanc, construction d\'un igloo avec une niche pour les chiots, exercice du jeune fils à la chasse aux phoques, installation pour la nuit dans l\'igloo. Au cours d\'un voyage, la famille est surprise par une tempête de neige et trouve refuge dans un igloo abandonné tandis que les chiens restent dehors, pelotonnés sous le blizzard.', 'Les Frères Revillon', 'https://image.tmdb.org/t/p/w1280/b0FJ0GotJyivHdgaiXY4vyoKXBA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//f8wJyERoBQgmptrue3xhMkC1Mjq.jpg', 'https://www.youtube.com/embed/2VNBg2A-fXY', 78, '1922', 3.55, 1),
(670, 'South Korea', 'Old Boy', 'À la fin des années 80, Oh Dae-Soo, père de famille sans histoire, est enlevé un jour devant chez lui. Séquestré pendant plusieurs années dans une cellule privée, son seul lien avec l\'extérieur est une télévision. Par le biais de cette télévision, il apprend le meurtre de sa femme, meurtre dont il est le principal suspect. Au désespoir d\'être séquestré sans raison apparente succède alors chez le héros une rage intérieure vengeresse qui lui permet de survivre. Il est relâché 15 ans plus tard, toujours sans explication. Oh Dae-Soo est alors contacté par celui qui semble être le responsable de ses malheurs, qui lui propose de découvrir qui l\'a enlevé et pourquoi. Le cauchemar continue pour le héros.', 'Show East', 'https://image.tmdb.org/t/p/w1280/5zSmPTMyKaSRagTMhJN33EL6GKA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//foc0hOprAdNpk1auscKqtipMtT5.jpg', 'https://www.youtube.com/embed/yDwKRlbWNFw', 120, '2003', 4.15, 1),
(671, 'United Kingdom', 'Harry Potter à l\'école des sorciers', 'Orphelin, Harry Potter a été élevé sans amour par son oncle et sa tante Dursley, béats devant leur exécrable fils, Dudley. Le jour de ses 11 ans, un brave colosse nommé Hagrid lui apprend qu\'il est un grand magicien. Comme l\'étaient ses parents, tués par le maléfique Voldemort. L\'heure est venue pour Harry de rejoindre la célèbre école de sorcellerie de Poudlard', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/fbxQ44VRdM2PVzHSNajUseUteem.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hziiv14OpD73u9gAak4XDDfBKa2.jpg', 'https://www.youtube.com/embed/UMs6IqPievo', 153, '2001', 3.96, 1),
(672, 'United Kingdom', 'Harry Potter et la Chambre des secrets', 'Après de très mauvaises vacances passées chez ses odieux oncle et tante et son affreux cousin, Harry rejoint, non sans mal, l\'École des Sorciers où, avec ses amis Ron et Hermione et l\'aide ponctuelle de nouveaux venus, il parvient à élucider le mystère de la Chambre des secrets, malgré les pièges tendus par ses ennemis et sans le concours de Lockhart, un nouveau professeur fanfaron et lâche, chargé pourtant de vaincre les Forces du Mal.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/8KpHRokGpiaqEGpjYe0rpywtvUx.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1stUIsjawROZxjiCMtqqXqgfZWC.jpg', 'https://www.youtube.com/embed/VjN5_mB7KFs', 155, '2002', 3.86, 1),
(673, 'United Kingdom', 'Harry Potter et le Prisonnier d\'Azkaban', 'Sirius Black, un dangereux sorcier criminel, s’échappe de la sombre prison d’Azkaban avec un seul et unique but : retrouver Harry Potter, en troisième année à l’école de Poudlard. Selon la légende, Black aurait jadis livré les parents du jeune sorcier à leur assassin, Lord Voldemort, et serait maintenant déterminé à tuer Harry…', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/t4P2079IyK19njHDP2GwQrKdvzd.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//obKmfNexgL4ZP5cAmzdL4KbHHYX.jpg', 'https://www.youtube.com/embed/su4qlSRYlfA', 140, '2004', 4.01, 1),
(674, 'United Kingdom', 'Harry Potter and the Goblet of Fire', 'When Harry Potter\'s name emerges from the Goblet of Fire, he becomes a competitor in a grueling battle for glory among three wizarding schools—the Triwizard Tournament. But since Harry never submitted his name for the Tournament, who did? Now Harry must confront a deadly dragon, fierce water demons and an enchanted maze only to find himself in the cruel grasp of He Who Must Not Be Named.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/fECBtHlr0RB3foNHDiCBXeg9Bv9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8f9dnOtpArDrOMEylpSN9Sc6fuz.jpg', 'https://www.youtube.com/embed/8Mvo64z9doU', 157, '2005', 3.91, 1),
(675, 'United Kingdom', 'Harry Potter et l\'Ordre du Phénix', 'Alors qu’il entame sa cinquième année d’étude à Poudlard, Harry Potter découvre qu’une bonne partie de la communauté des sorciers feint d’ignorer sa récente confrontation avec Lord Voldemort, et préfèrent nier cette aveuglante évidence : le Seigneur des Ténèbres est bel et bien vivant. De plus, la communauté magique lit les mensonges de Rita Skeeter dans la Gazette du Sorcier sous contrôle du Ministère de la Magie. Craignant que le puissant Albus Dumbledore ne mente à propos du retour de Voldemort dans le but de saper son autorité et de lui ravir son poste, le Ministre de la Magie Cornélius Fudge nomme un nouveau Professeur de Défense contre les Forces du Mal, qu’il charge de surveiller le vieux doyen et ses étudiants. Mais celle‐ci, Dolores Ombrage, se révèle incapable de préparer les collégiens à affronter les nouvelles menaces qui planent sur Poudlard…', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/9ZfpCVNx0y8jpColnnfdA1HI4Zb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bsaA9qtIR6VTDQykXdBzJc8V5rS.jpg', 'https://www.youtube.com/embed/MQ8r1rNso8k', 138, '2007', 3.84, 1),
(676, 'United States of America', 'Pearl Harbor', 'Amis depuis la plus tendre enfance, Rafe McCawley et Danny Walker sont deux brillants pilotes de l\'armée de l\'air américaine. La Seconde Guerre mondiale a commencé, mais les États-Unis n\'ont pas encore engagé les hostilités. Rafe succombe bientôt au charme d\'Evelyn Johnson, une jeune infirmière. C\'est le coup de foudre. Mais ce dernier part combattre aux côtés des Britanniques. Evelyn et Danny sont, quant à eux, transférés sur la base américaine de Pearl Harbor. La paisible existence de ces deux jeunes gens bascule lorsqu\'ils apprennent la mort de Rafe. Evelyn partage son chagrin avec Danny et un amour naît de leurs confidences. Rafe est pourtant vivant. En cette journée du 7 décembre 1941, les retrouvailles et les explications vont devoir être reportées à plus tard : au même moment, près de 200 bombardiers japonais surgissent dans le ciel de Hawaï pour une attaque surprise.', 'Jerry Bruckheimer Films', 'https://image.tmdb.org/t/p/w1280/1ovgH43LODnZHy1BGoVWuHscL1D.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zv1xOEQzebKyku349qDZ085FZlO.jpg', 'https://www.youtube.com/embed/B_Mp4at3lyE', 178, '2001', 3.47, 1),
(677, 'Germany', 'Les Dieux du stade - Le Festival des Nations', 'La première partie d\'Olympia, un documentaire sur les Jeux olympiques de 1936 à Berlin, réalisé par la réalisatrice allemande Leni Riefenstahl. Le film a été projeté dans les salles en 1938 et à nouveau en 1952 après la chute du régime nazi.', 'Olympia-Film GmbH', 'https://image.tmdb.org/t/p/w1280/nPLZIBLvWqgGQs3dplxujQrNno2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uXuxoktT74hcMqNvbf6dPKPCPHD.jpg', 'https://www.youtube.com/embed/', 126, '1938', 3.45, 1),
(678, 'United States of America', 'La Griffe du passé', 'Jeff Bailey, ancien détective privé, tente de vivre une vie paisible, mais son passé revient le hanter. Il fut jadis embauché par un joueur de casino pour retrouver sa petite amie en fugue, Kathy. Jeff l\'avait retrouvée au Mexique et en était tombé amoureux. Elle l\'avait ensuite incité à doubler le joueur, mais c\'est bien Jeff qui a fini par se faire doubler. Des années plus tard, la vie tranquille de Jeff est de nouveau bouleversée lorsque ses anciens associés criminels le retrouvent. Il court un grand danger : quelqu\'un tente de lui mettre un meurtre sur le dos.', 'RKO Radio Pictures', 'https://image.tmdb.org/t/p/w1280/qqTMChg2K6vZTN1Kus8b7JYsmux.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//y5piuei6sm2D8QI8CETZzboY1AZ.jpg', 'https://www.youtube.com/embed/', 96, '1947', 3.82, 1),
(679, 'United States of America', 'Aliens', 'When Ripley\'s lifepod is found by a salvage crew over 50 years later, she finds that terra-formers are on the very planet they found the alien species. When the company sends a family of colonists out to investigate her story—all contact is lost with the planet and colonists. They enlist Ripley and the colonial marines to return and search for answers.', 'Brandywine Productions', 'https://image.tmdb.org/t/p/w1280/r1x5JGpyqZU8PYhbs4UcrO1Xb6x.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jMBpJFRtrtIXymer93XLavPwI3P.jpg', 'https://www.youtube.com/embed/X4xLFXJ2sLI', 137, '1986', 3.96, 1),
(680, 'United States of America', 'Pulp Fiction', 'L’odyssée sanglante et burlesque de petits malfrats dans la jungle d’Hollywood : Deux petits tueurs, un dangereux gangster marié à une camée, un boxeur roublard, des prêteurs sur gages sadiques, un caïd élégant et dévoué, un dealer bon mari et deux tourtereaux à la gâchette facile.', 'Miramax', 'https://image.tmdb.org/t/p/w1280/4TBdF7nFw2aKNM0gPOlDNq3v3se.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//suaEOtk1N1sgg2MTM7oZd2cfVp3.jpg', 'https://www.youtube.com/embed/wV3ph7a_H2Y', 154, '1994', 4.25, 1),
(681, 'United Kingdom', 'Les diamants sont éternels', 'James Bond se lance à la recherche d\'un trafiquant de diamants, à Amsterdam, et se retrouve face au terrifiant Blofeld. Ce dernier est en passe de finir la construction d\'un gigantesque laser d\'une puissance terrifiante, à l\'aide de tous les diamants qu\'il a rassemblés, pour détruire Washington.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/bVbbAm8lgT5qpDLj7aHeMQH0NLj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pyTDtQCn5sG8gi2zkM5ZylSNmtJ.jpg', 'https://www.youtube.com/embed/pj-MegghrNc', 120, '1971', 3.19, 1),
(682, 'United Kingdom', 'L\'Homme au pistolet d\'or', 'À San Francisco, James Bond a peut-être rencontré un rival à sa hauteur en la personne de Scaramanga, un tueur mondialement connu pour exécuter ses victime à l’aide d’un pistolet d’or. Lorsque Scaramanga s’empare du précieux convertisseur d’énergie, le Solex Agitator, 007 est chargé de mettre la main sur l’appareil et d’affronter le tueur au pistolet d’or dans une lutte… à mort.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/rWWtStXei0hjNElbtM0J28trLcO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vcj47nTm1fDlkxUwDb2GgYbKDDW.jpg', 'https://www.youtube.com/embed/WWYEf8gKd1U', 125, '1974', 3.22, 1),
(685, 'Germany', 'Les Dieux du stade - Le Festival de la Beauté', '', 'Olympia-Film GmbH', 'https://image.tmdb.org/t/p/w1280/fVAVcdBqAI4HXhVIRCvKbYM6Jrq.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hbL5vWtqJrPCrLEcgQLT5lj2a8G.jpg', 'https://www.youtube.com/embed/', 100, '1938', 3.4, 1),
(686, 'United States of America', 'Contact', 'Orpheline depuis l\'âge de 9 ans, Eleanor, dite Ellie, a toujours cultivé une passion pour l\'astronomie, qu\'elle a choisi comme métier. Scientifique réputée, elle scrute désormais les tréfonds de l\'univers, à la recherche d\'un hypothétique signal de vie extraterrestre, pour le compte du fortuné David Drumlin. Persuadé de travailler à fonds perdus, celui-ci la licencie, alors qu\'elle pense toucher au but. Ellie décroche le soutien financier d\'un milliardaire excentrique, SR Hadden, et d\'un conseiller du président des États-Unis, Palmer Joss, et peut ainsi poursuivre son écoute du ciel. Au bout de longs mois, elle capte enfin un signal artificiel, en provenance de l\'étoile Véga...', 'South Side Amusement Company', 'https://image.tmdb.org/t/p/w1280/arIq3PpXh9KrxgsMZBOfKR1xfc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lpqLdupRPthO9lOLxRICQ3h6F3s.jpg', 'https://www.youtube.com/embed/09ffXK4UYWs', 153, '1997', 3.71, 1),
(687, 'United States of America', 'La Dernière Marche', 'Soeur Helen Prejean va accompagner jusqu\'à sa mort Matthew Poncelet, condamné à la peine capitale pour l\'assassinat de deux adolescents.', 'Havoc', 'https://image.tmdb.org/t/p/w1280/pYnZqKwaH9LeSM3HcvSCHya2Re3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ka6np2LONtAElZOVeebb3mwSTBs.jpg', 'https://www.youtube.com/embed/', 122, '1995', 3.68, 1),
(688, 'United States of America', 'The Bridges of Madison County', 'Photographer Robert Kincaid wanders into the life of housewife Francesca Johnson for four days in the 1960s.', 'Amblin Entertainment', 'https://image.tmdb.org/t/p/w1280/8TfLAfIh5Qxp2J4ZjOafHYhWtDb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4TnGcUsyd6ixuLWHaaEG5BGkAIp.jpg', 'https://www.youtube.com/embed/NiaVEFIOtro', 135, '1995', 3.85, 1),
(689, 'Greece', 'Le Voyage des comédiens', 'De 1939 à 1952, une troupe de comédiens sillonne les petites villes de Grèce pour donner des représentations. Lorsque la Seconde Guerre mondiale éclate, la comédie naïve qu’ils jouaient alors est vite remplacée par une tragédie. Malgré l’oppression politique et les drames qui se jouent entre les membres de la troupe, les comédiens continueront de jouer et de résister jusqu’au bout.', 'Giorgos Papalios Productions', 'https://image.tmdb.org/t/p/w1280/qdOqhhhJuEYQfJlrlznpmYYLhHx.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dyZ1pUMTpwX4skeq0BfeGkdTtvV.jpg', 'https://www.youtube.com/embed/', 222, '1975', 3.7, 1),
(690, 'France', 'Pickpocket', 'Michel se rend au champ de courses et vole un peu d\'argent à une spectatrice. En quittant le champ de courses, il est arrêté. Il est rapidement libéré pour manque de preuves. Malgré cela, Michel continue à voler et s\'associe avec des complices afin d\'être plus efficace. Il refuse l\'aide de son ami Jacques qui veut le pousser à trouver un emploi. Se sentant en danger, il fuit la France pour revenir deux ans plus tard retrouver Jeanne, l\'ex-aide ménagère de sa mère.', 'Lux Compagnie Cinématographique de France', 'https://image.tmdb.org/t/p/w1280/6LOGubEfLLikSQPqoXpYkhBLpGI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//l3N6BtcVwXp6rJAUOpcb8ooyE9c.jpg', 'https://www.youtube.com/embed/', 80, '1959', 3.66, 1),
(691, 'United Kingdom', 'L\'Espion qui m\'aimait', 'Pour retrouver des sous-marins nucléaires russe et britannique qui ont mystérieusement disparu, James Bond fait équipe avec l\'agent soviétique Anya Amasova. Leur mission les conduit à affronter un ennemi redoutable, Requin, un géant de près de deux mètres vingt quasiment indestructible et armé d\'une mâchoire en acier aussi coupante qu\'un rasoir. 007 devra également affronter Karl Stromberg, l\'employeur de Requin. Stromberg veut se servir des sous-marins nucléaires qu\'il a volés pour détruire le monde et créer une cité sous-marine.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/nIjqzDyGwPtM4gFTOXXgidNzcBL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8lRdfsmJjUXQU3DMOOB3vVIhJxP.jpg', 'https://www.youtube.com/embed/TqhzdF8m6q4', 126, '1977', 3.38, 1),
(692, 'United States of America', 'Pink Flamingos', 'Divine se cache de la police et se fait appeler Babs Johnson. Elle vient d\'emménager dans une caravane avec sa mère Edie, simple d\'esprit qui ne vit que par amour des œufs, son fils Crackers, aux mœurs sexuelles particulières, et leur amie Cotton qui a tendance au voyeurisme. Ensemble ils mènent une vie tranquille, jusqu\'au jour où Divine est nommée par un magazine « l\'être vivant le plus dégoûtant de la planète ». C\'est alors que Connie et Raymond Marble, un couple de fétichistes tout aussi abjects, empreints de jalousie, va chercher par tous les moyens à détrôner Divine...', 'Dreamland Productions', 'https://image.tmdb.org/t/p/w1280/8UUuEJhZR5YyraqMUyOcO74uHY7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uh1zf6Q0UcHaqWQXZXu1qOOSCRg.jpg', 'https://www.youtube.com/embed/', 92, '1972', 3.1, 1),
(693, 'United States of America', 'Mon beau-père, mes parents et moi', 'Greg Focker est un brave infirmier qui accumule les déboires, les maladresses et les faux-pas. Soucieux de plaire à tout le monde et de faire oublier son nom grotesque, sa première entrevue avec ses futurs beaux-parents Jack et Dina Byrnes fut un concentré exemplaire de tout ce qu\'il ne faut pas faire dans de telles circonstances. Entre-temps, les choses se sont arrangées, et Greg a même réussi à amadouer le terrifiant Jack et à intégrer son cercle de confiance.Pam et lui peuvent donc envisager le mariage, mais il reste à organiser une réunion entre les Byrnes et les Focker. Un paisible week-end en Floride dans la propriété de Bernie et Roz Focker -lui fervent libéral, elle sexologue militante- permettra enfin aux deux familles de lier connaissance. Un ultime examen de passage, qui ne devrait pas poser de problème...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/1dN1oYqgbaKPsV9hU0aJbqLEgvT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tS6PvNcFxoqcjkb0iCnX7oHeD1u.jpg', 'https://www.youtube.com/embed/XdRJ1KKCNng', 115, '2004', 3.11, 1),
(694, 'United States of America', 'Shining', 'Jack Torrance, gardien d’un hôtel fermé l’hiver, sa femme et son fils Danny s’apprêtent à vivre de longs mois de solitude. Danny, qui possède un don de médium, le «Shining», est effrayé à l’idée d’habiter ce lieu, théâtre marqué par de terribles événements passés…', 'Hawk Films', 'https://image.tmdb.org/t/p/w1280/cfF0o7sVAfKE081zj0YZtwUzTg0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mmd1HnuvAzFc4iuVJcnBrhDNEKr.jpg', 'https://www.youtube.com/embed/JkZzWDaId-s', 119, '1980', 4.11, 1),
(695, 'United States of America', 'Short Cuts', 'Many loosely connected characters cross paths in this film, based on the stories of Raymond Carver. Waitress Doreen Piggot accidentally runs into a boy with her car. Soon after walking away, the child lapses into a coma. While at the hospital, the boy\'s grandfather tells his son, Howard, about his past affairs. Meanwhile, a baker starts harassing the family when they fail to pick up the boy\'s birthday cake.', 'Fine Line Features', 'https://image.tmdb.org/t/p/w1280/nAEBc3g9bHAcF9whKFMfIxHxVwn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//a0OjGWE9ru1OlKLBujbz3mAYYxU.jpg', 'https://www.youtube.com/embed/ePyhGz9_RCI', 187, '1993', 3.61, 1),
(696, 'United States of America', 'Manhattan', 'Manhattan explores how the life of a middle-aged television writer dating a teenage girl is further complicated when he falls in love with his best friend\'s mistress.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/k4eT3EvfxW1L9Wmt04UqJqCvCR6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ohJFDJRU547aWFVjaM3ppY0oFj6.jpg', 'https://www.youtube.com/embed/5Xo-AnBn8H0', 96, '1979', 3.89, 1),
(697, 'Soviet Union', 'Octobre', 'Petrograd, octobre 1917 : les Bolcheviks prennent le pouvoir. 10 jours qui ébranlèrent le monde…', 'Sovkino', 'https://image.tmdb.org/t/p/w1280/4bNO7rfM3X9VBomuSaAO9m4vAr0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//inb0a3zdLW8GUDcfj7HNORTthrY.jpg', 'https://www.youtube.com/embed/', 115, '1928', 3.49, 1),
(698, 'France', 'Moonraker', 'Une navette spatiale américaine, Moonraker, confiée au gouvernement britannique disparaît soudainement. L’agent 007 est chargé d’enquêter mais il découvre vite que le responsable n’est autre que le constructeur de l’engin spatial lui‐même, Hugo Drax. Ce dernier tend à recréer une nouvelle race d’hommes parfaits en anéantissant l’humanité actuelle.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/vF11JtjH1PmEvsRo4djEWWmHXvi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5F05pVtt0aGcRXH2oyBOnUQaCdY.jpg', 'https://www.youtube.com/embed/qz7uoU7Xvjg', 130, '1979', 3.07, 1),
(699, 'United Kingdom', 'Rien que pour vos yeux', 'Un bateau espion du Royaume-Uni, sombre dans les eaux albanaises après avoir heurté une mine, engloutissant avec lui l\'ATAC, système top secret de lancement de missiles. Les services secrets britanniques déclenchent une opération sous-marine discrète pour récupérer l\'appareil. L\'opération est conduite par un couple d\'archéologues marins, Timothy et Iona Havelock. Mais le tueur cubain Hector Gonzalès interrompt brutalement les recherches en assassinant le couple sous les yeux de sa fille Mélina. James Bond entre alors en scène et s\'en va enquêter, secondé de la séduisante et vengeresse Mélina, sur les liens de Gonzalès avec le système ATAC...', 'United Artists', 'https://image.tmdb.org/t/p/w1280/hEbE2BhShWEqdcUK0eTZ38IXzGv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//z7Jp7HAsY7MqXzPYzTjJnmOQk2r.jpg', 'https://www.youtube.com/embed/YrEHNHW_Lt0', 128, '1981', 3.25, 1),
(700, 'United Kingdom', 'Octopussy', 'Chargé d’enquêter sur la mort très suspecte de l\'agent 009 (pourquoi avait-il donc cet inestimable œuf Fabergé dans la main ?...), James Bond assiste à la mise aux enchères de l’œuf. Le richissime Kamal Khan en fait l\'acquisition. Ce prince Indien exilé semble nourrir de secrètes accointances avec le général renégat Orlov. Mais quel lien y a-t-il entre l’œuf, les complots du tandem russo-indien et la désirable, bien que mystérieuse, Octopussy ? Et si c\'était le déclenchement de la Troisième Guerre Mondiale ?!', 'Eon Productions', 'https://image.tmdb.org/t/p/w1280/wknYYbej13De3RXoq4iUgjwTZJv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xTS1qCmhzH3vq7cuextO5vQA6eW.jpg', 'https://www.youtube.com/embed/q1hLWZzgZvU', 131, '1983', 3.15, 1),
(701, 'United States of America', 'Les Lois de l\'hospitalité', 'Dans les contrées lointaines des États-Unis, persistent, de génération en génération, de tragiques luttes ancestrales. Ainsi en est-il des Canfield et des McKay. Quand le jeune Willie McKay, après avoir grandi, sain et sauf, à New York, revient au pays, charmé puis invité par sa compagne de voyage, il ne se doute pas que celle-ci n’est autre que la plus jeune des filles Canfield et qu’il vient donc de se jeter dans la gueule du loup !', 'Joseph M. Schenck Productions', 'https://image.tmdb.org/t/p/w1280/i8wfrdTdeeVQ8YRrFnCVO49Mt2G.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4tbUsrndxsHcHsJE3jGNxVtlZj3.jpg', 'https://www.youtube.com/embed/1BWMJ06xDN0', 75, '1923', 3.76, 1),
(702, 'United States of America', 'Un tramway nommé Désir', 'Après une longue séparation, Blanche Dubois vient rejoindre sa soeur, Stella, qui vit avec son mari Stanley, ouvrier immigré, dans le vieux quartier français de La Nouvelle-Orléans. Stanley n\'apprécie guère les manières distinguées de Blanche et cherche à savoir quel a été son passé.', 'Charles K. Feldman Group', 'https://image.tmdb.org/t/p/w1280/kf4GEaqCGFCvO1ASAwCcUMAUhNy.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//or90vNrOVnYwi07fYYpQ3pbnjxP.jpg', 'https://www.youtube.com/embed/', 122, '1951', 3.84, 1),
(703, 'United States of America', 'Annie Hall', 'À l\'aube de ses quarante ans, Alvy Singer fait le bilan de la situation. Une introspection sur sa dernière rencontre, Annie Hall, qui vient de le quitter, et un hommage à la ville qu\'il aime, New York.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/wkqBnx6s63seSHBr5lW3UGIHi6Z.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8n9dYsTbXTykzm2Nuy7R2ftapXQ.jpg', 'https://www.youtube.com/embed/', 93, '1977', 3.88, 1),
(704, 'United Kingdom', 'Quatre garçons dans le vent', 'En 1964, les Beatles prennent le train pour donner un concert. Le grand-père de l\'un d\'eux, qui les accompagne et dont la devise est de semer le désordre et l\'anarchie partout où il passe, disparaît soudain avec son petit-fils. Commence alors une course folle pour les retrouver avant que le concert ne commence.', 'Proscenium Films', 'https://image.tmdb.org/t/p/w1280/6Ulsccp2VkaVU5qbya3bxm9JG4x.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9hWiNbvLR3nPDanTdEWOc4EeBGp.jpg', 'https://www.youtube.com/embed/Pbg8T9r1DiQ', 87, '1964', 3.71, 1),
(705, 'United States of America', 'Ève', 'Ève Harrington reçoit, des mains d\'un vieil acteur, le prix Sarah Siddons. L\'entourage de celle-ci se souvient de son ascension.', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/pR2Cf9CvAiF5ofjGlmzr2EJNoHI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xl4t4ButJaBqdi5va3mZexlC004.jpg', 'https://www.youtube.com/embed/HvMRz0_PZk0', 138, '1950', 4.07, 1),
(706, 'Germany', 'Effi Briest', 'Dans les années 1890, Effi Briest, dix-sept ans, vit dans un milieu privilégié aux environs de Berlin. Elle épouse un baron et s\'installe avec lui dans une petite ville où elle est mal acceptée, mais un autre homme tombe amoureux d\'elle.', 'Tango Film', 'https://image.tmdb.org/t/p/w1280/hxM1aplPiMDp4wZ4Ode9zDlpzsf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cv6MxWigdHr1ga9AN4stzyzEG7r.jpg', 'https://www.youtube.com/embed/', 141, '1974', 3.35, 1),
(707, 'United Kingdom', 'Dangereusement vôtre', 'James Bond, l’agent 007, découvre que les Soviétiques détiennent une puce ultra‐sophistiquée ressemblant étrangement à celle des Britanniques et soupçonne Max Zorin, patron d’une écurie de courses, d’être à l’origine de cette fuite vers l’Est. En apprenant que Zorin veut détruire Silicon Valley, Bond tente de contrecarrer ses plans…', 'Eon Productions', 'https://image.tmdb.org/t/p/w1280/kep542k31Aukb3s58g2xO1KpUe6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hvGWyyC8wER1I8ExSXNtFBs7Mgd.jpg', 'https://www.youtube.com/embed/xhRN5rPpPM8', 131, '1985', 3.1, 1),
(708, 'United Kingdom', 'Tuer n\'est pas jouer', 'Après que Bond a aidé un officier soviétique à traverser le rideau de fer pour passer à l\'Ouest, il découvre avec stupeur que celui-ci a été retrouvé et kidnappé. La piste le mène sur les traces d\'une belle violoncelliste, Kara, qui va l\'entraîner dans une suite de situations dangereuses, avec comme paroxysme une base militaire en Afghanistan où il doit stopper un trafic d\'armes.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/bz5kqT4dwzCyqSflosSwXiO2aAB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ebaq0ecL1Tu39rIExfHwE4ToFl2.jpg', 'https://www.youtube.com/embed/XxC7N3ByJn4', 130, '1987', 3.25, 1),
(709, 'United Kingdom', 'Permis de tuer', 'Bond se trouve à Key West, en Floride, aux côtés de Felix Leiter. Mais cette fois, ils ne sont pas en mission : Felix se marie et James Bond et son ami Sharky sont ses témoins. Tous trois portent la tenue de circonstance et se rendent en voiture sur les lieux de la cérémonie. Mais un hélicoptère de la brigade des stupéfiants les arrête : Leiter apprend que Franz Sanchez est sur le territoire américain, or, l\'agent de la CIA poursuit cet insaisissable parrain de la drogue depuis des années. Retrouvant les réflexes de la bonne époque de leur collaboration, Leiter et Bond réussissent à capturer Sanchez à l\'issue d\'une poursuite aérienne spectaculaire. Une fois Sanchez aux mains de la police américaine, il ne reste plus au futur marié et à son témoin qu\'à sauter en parachute au-dessus de l\'église. Mais la victoire de Leiter est de courte durée. Sanchez qui a offert une prime de deux millions de dollars à quiconque le libérera, s\'évade.', 'Eon Productions', 'https://image.tmdb.org/t/p/w1280/lUFz8piD5fSDqvXP6Byms4boNLP.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//p6VFbg5lhWj0RCgXf5dj6IDMPvt.jpg', 'https://www.youtube.com/embed/JrwAnFQzYu8', 132, '1989', 3.17, 1),
(710, 'United Kingdom', 'GoldenEye', 'When a powerful satellite system falls into the hands of Alec Trevelyan, AKA Agent 006, a former ally-turned-enemy, only James Bond can save the world from a dangerous space weapon that -- in one short pulse -- could destroy the earth! As Bond squares off against his former compatriot, he also battles Xenia Onatopp, an assassin who uses pleasure as her ultimate weapon', 'Eon Productions', 'https://image.tmdb.org/t/p/w1280/z0ljRnNxIO7CRBhLEO0DvLgAFPR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5jVWJiPpmk216Q7vjjlwNXXE6ee.jpg', 'https://www.youtube.com/embed/_PMD6YenOEg', 130, '1995', 3.44, 1),
(711, 'United States of America', 'Finding Forrester', 'Gus Van Sant tells the story of a young African American man named Jamal who confronts his talents while living on the streets of the Bronx. He accidentally runs into an old writer named Forrester who discovers his passion for writing. With help from his new mentor Jamal receives a scholarship to a private school.', 'Laurence Mark Productions', 'https://image.tmdb.org/t/p/w1280/heHi6n68fDiQoUc7SMletM9Adjz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//eQnIwnhDuHQiSks3dy0zwrJydWU.jpg', 'https://www.youtube.com/embed/8QGCBH_2Dck', 136, '2000', 3.55, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(712, 'United Kingdom', '4 Mariages & 1 Enterrement', 'Charles est célibataire. Seul compte son petit cercle d\'amis, composé de Fiona, Gareth, Tom, Matthew et Scarlett, sa co-locataire. L\'amour ne le tente pas et quand il fait la connaissance de Carrie lors d\'un mariage où il officie en tant que témoin, il n\'imagine en rien la passion qui va l\'envahir. Car Charles tombe amoureux de Carrie. Et ses retrouvailles quelques mois plus tard avec la demoiselle, sur le point de se marier avec un riche Écossais, ne vont que confirmer les sentiments qu\'il éprouve pour elle.', 'PolyGram Filmed Entertainment', 'https://image.tmdb.org/t/p/w1280/80PxGcaL3huYtCdPKEqBKPvTz6E.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ejFaHWnDP29z7ePw2cJVOsWvOvH.jpg', 'https://www.youtube.com/embed/8Pcadjt7yHs', 117, '1994', 3.38, 1),
(713, 'New Zealand', 'La Leçon de piano', 'Au siècle dernier en Nouvelle-Zélande, Ada, mère d\'une fillette de neuf ans, s’apprête à suivre son nouveau mari au fin fond du bush. Il accepte de transporter tous ses meubles à l\'exception d\'un piano qui échoue chez un voisin illettré. Ne pouvant supporter cette perte, Ada accepte le marché que lui propose ce dernier. Regagner son piano touche par touche en se soumettant à ses fantaisies. Palme d\'or et prix d\'interprétation féminine à Cannes en 1993.', 'New South Wales Film & Television Office', 'https://image.tmdb.org/t/p/w1280/wyQO9ugIqj6mB8v7dwPJZOYijV4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3axPBC6p8rNt82qbJHOC0B1SlDj.jpg', 'https://www.youtube.com/embed/3_Lzv0NKcL4', 120, '1993', 3.7, 1),
(714, 'United Kingdom', 'Demain ne meurt jamais', 'L’agent 007, alias James Bond, a pour mission de localiser l’épave du « Devonshire », une frégate de la Royal Navy, perdue dans les eaux territoriales chinoises. Il doit également retrouver le coupable de l’attentat, un certain Henry Gupta, ancien gauchiste activement recherché par le FBI et, enfin, remonter jusqu’au cerveau de l’opération, Elliot Carver, propriétaire du quotidien « Tomorrow » et patron du plus grand empire médiatique de tous les temps.', 'Eon Productions', 'https://image.tmdb.org/t/p/w1280/6sHUh1Zvz5QXDJbSvGErfNatwBD.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fesAgiKA0pc04vScDTAQe1f9nd4.jpg', 'https://www.youtube.com/embed/', 115, '1997', 3.17, 1),
(742, 'Denmark', 'Together', 'En 1975, tout comme l\'ensemble du monde occidental, la Suède est soumise à une remise en question assez radicale de son mode de vie par une jeunesse avide d\'expériences nouvelles.\r A Stokholm, une communauté hippie vit dans une promiscuité joyeuse : les couples se font et se défont, regardent pousser leurs légumes, ne mangent jamais de viande et ont juré la perte du Grand Capital. Les contraintes sociales sont oubliées, les enfants s\'épanouissent à l\'écart du cadre scolaire, les discussions sont libres et l\'amour aussi.\r Cependant, un beau jour, la sérénité de ce microcosme est perturbée par l\'arrivée impromptue d\'une inconnue, Elisabeth (Lisa Lindgren), la soeur de Göran (Gustav Hammarsten). Celle-ci, lassée des violences répétées de son mari, débarque avec enfants et bagages. La vie des uns et des autres va s\'en trouver changée à jamais.', 'Memfis Film', 'https://image.tmdb.org/t/p/w1280/nYeWUUA45Co51N7B4BtFTrYBZBY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8uszBImrPngs8G4Y21LHJVstNtC.jpg', 'https://www.youtube.com/embed/', 102, '2000', 3.49, 1),
(743, 'Germany', 'Zugvögel – einmal nach Inari', '', 'Prokino Filmproduktion', 'https://image.tmdb.org/t/p/w1280/muMxZofb86YFGTe8SVu64DftFht.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dxOqPoaMNi8oqmFDYmSfIGmPUCW.jpg', 'https://www.youtube.com/embed/', 87, '1998', 3.02, 1),
(744, 'United States of America', 'Top Gun', 'Jeune as du pilotage et tête brûlée d\'une école réservée à l\'élite de l\'Aéronavale américaine, la fameuse « Top Gun », Pete Mitchell, dit Maverick, tombe sous le charme d\'une instructrice alors qu\'il est en compétition pour le titre du meilleur pilote…', 'Paramount', 'https://image.tmdb.org/t/p/w1280/kYqMRjDDgWpJOkF1eTol7qXG6Iu.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jILeJ60zPpIjjJHGSmIeY4eO30t.jpg', 'https://www.youtube.com/embed/CgQkvz6NAcw', 109, '1986', 3.52, 1),
(745, 'United States of America', 'Sixième sens', 'Cole Sear, garçonnet de huit ans est hanté par un terrible secret. Son imaginaire est visité par des esprits menaçants. Trop jeune pour comprendre le pourquoi de ces apparitions et traumatisé par ces pouvoirs paranormaux, Cole s\'enferme dans une peur maladive et ne veut révéler à personne la cause de son enfermement, à l\'exception d\'un psychologue pour enfants. La recherche d\'une explication rationnelle guidera l\'enfant et le thérapeute vers une vérité foudroyante et inexplicable.', 'Spyglass Entertainment', 'https://image.tmdb.org/t/p/w1280/7s3ekiDpic8NxDjwdLdOYDIX8Pe.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//paUKxrbN2ww0JeT2JtvgAuaGlPf.jpg', 'https://www.youtube.com/embed/VG9AGf66tXM', 107, '1999', 3.97, 1),
(746, 'China', 'Le Dernier Empereur', 'L\'évocation, presque aux dimensions de la Chine, de la vie du dernier empereur Pu Yi. De 1908, où il monte à trois ans sur le trône impérial à 1967, la fin de sa vie où il devient jardinier du parc botanique de Pékin, en passant par la révolution chinoise durant laquelle il est rééduqué.', 'Hemdale Film Corporation', 'https://image.tmdb.org/t/p/w1280/bDRM7YUBZxwv3RFs8FOwF9fjxwl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//k29qVmwWwR0i5A1UMIws1Vmv6hV.jpg', 'https://www.youtube.com/embed/TOaysZ8hKvE', 156, '1987', 3.82, 1),
(747, 'France', 'Shaun of the Dead', 'À presque 30 ans, Shaun ne fait pas grand-chose de sa vie. Entre l\'appart qu\'il partage avec ses potes et le temps qu\'il passe avec eux au pub, Liz, sa petite amie, n\'a pas beaucoup de place. Elle qui voudrait que Shaun s\'engage, ne supporte plus de le voir traîner. Excédée par ses vaines promesses et son incapacité à se consacrer un peu à leur couple, Liz décide de rompre. Shaun est décidé à tout réparer, et tant pis si les zombies déferlent sur Londres, tant pis si la ville devient un véritable enfer. Retranché dans son pub préféré, le temps est venu pour lui de montrer enfin de quoi il est capable...', 'WT2 Productions', 'https://image.tmdb.org/t/p/w1280/uZCC0b2AfnLivW5D5RMYf1SROLf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ysUbm8qcKLaUiMf0H82mE5ujvVQ.jpg', 'https://www.youtube.com/embed/5I6M_C9XUE0', 99, '2004', 3.77, 1),
(750, 'United Kingdom', 'Le train de 16h50', 'Miss Marple a pris le train de 16h50 pour rentrer chez elle, à Brackhampton. Confortablement installée dans un compartiment, elle s\'adonne à sa lecture préférée, les romans policiers, puis somnole. Elle s\'éveille tout à coup lorsque son train en croise un autre. Par la fenêtre, elle aperçoit une jeune femme qui se débat, étranglée par deux mains gantées de noir. Elle va aussitôt raconter l\'histoire à la police. Confrontée à l\'indifférence des forces de l\'ordre, qui n\'ont retrouvé aucun corps, elle décide de mener son enquête. Elle parvient à se faire embaucher comme domestique à Ackenthorpe Hall, seule maison longeant cette portion de voie ferrée. Miss Marple pense en effet que le meurtrier pourrait bien s\'y cacher...', 'George H. Brown Productions', 'https://image.tmdb.org/t/p/w1280/fRkvdFl2tXncGoX81fHwfcn1HcL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yhz3KYKM9xzjuRyTz1aAQXsTPig.jpg', 'https://www.youtube.com/embed/', 87, '1961', 3.64, 1),
(751, 'United Kingdom', 'Murder at the Gallop', 'Miss Marple and Mr. Stringer are witnesses to the death by heart attack of elderly, rich Mr. Enderby. Yet they have their doubts about what happened. The police don\'t believe them, thus leading Miss Marple to yet again investigate by herself.', 'George H. Brown Productions', 'https://image.tmdb.org/t/p/w1280/lCLJ6yutSJc8PkiazcEh8dB6Juh.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bsI320Bb2X0nCSf1lZ9OqDo7dsR.jpg', 'https://www.youtube.com/embed/', 81, '1963', 3.49, 1),
(752, 'Germany', 'V pour Vendetta', 'Londres, au 21ème siècle… Evey Hammond ne veut rien oublier de l’homme qui lui sauva la vie et lui permit de dominer ses peurs les plus lointaines. Mais il fut un temps où elle n’aspirait qu’à l’anonymat pour échapper à une police secrète omnipotente. Comme tous ses concitoyens, trop vite soumis, elle acceptait que son pays ait perdu son âme et se soit donné en masse au tyran Sutler et à ses partisans. Une nuit, alors que deux « gardiens de l’ordre » s’apprêtaient à la violer dans une rue déserte, Evey vit surgir son libérateur. Et rien ne fut plus comme avant. Son apprentissage commença quelques semaines plus tard sous la tutelle de « V ». Evey ne connaîtrait jamais son nom et son passé, ne verrait jamais son visage atrocement brûlé et défiguré, mais elle deviendrait à la fois son unique disciple, sa seule amie et le seul amour d’une vie sans amour…', 'Studio Babelsberg', 'https://image.tmdb.org/t/p/w1280/4HFt1jyjZD3MssiyNPJLToqGd1v.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sFEYsEfzTx7hhjetlNrme8B5OUo.jpg', 'https://www.youtube.com/embed/_6_91UoGAak', 132, '2006', 3.95, 1),
(753, 'United States of America', 'Faces', 'Richard Frost, un distributeur de films, se laisse séduire par une call-girl, Jeannie, au cours d\'une soirée arrosée entre copains. En rentrant ivre mort chez lui, il se dispute avec sa femme Maria, avant de lui annoncer son intention de divorcer et retourne auprès de Jeannie. Le soir même, Maria fait de son côté la rencontre de Chet lors d’une viré en boîte de nuit. Au petit matin, Richard fait son retour au foyer familial tandis que Chet se sauve par la fenêtre. Le couple ne peut plus reculer devant l’inexorable face à face qui remettra en cause leurs quatorze ans de vie commune.', 'Maurice McEndree Productions', 'https://image.tmdb.org/t/p/w1280/o5XozaHa1K49xCchD1lulPBcMlQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9ghi70TsFo5DJuYfsElEmSG58XG.jpg', 'https://www.youtube.com/embed/', 130, '1968', 3.63, 1),
(754, 'United States of America', 'Volte/Face', 'Castor Troy, dangereux terroriste, est tombé dans le coma à la suite d’un affrontement avec Sean Archer, agent de la CIA. Grâce à une intervention chirurgicale, Archer prend le visage de Troy pour faire avouer au frère de ce dernier l’emplacement d’une bombe. Mais Troy sort du coma et prend à son tour le visage d’Archer.', 'Krane Entertainment', 'https://image.tmdb.org/t/p/w1280/tRPJim0c5SHwp3aOQMt6avC5Nze.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yeIpgoZWzbNqkeSYPwhNZQ5xCRX.jpg', 'https://www.youtube.com/embed/CoUib_rQKAs', 139, '1997', 3.51, 1),
(755, 'United States of America', 'Une Nuit en Enfer', 'Deux criminels prennent une famille en otage près de la frontière mexicaine, après une cavale particulièrement sanglante durant laquelle ils ont tué un policier et kidnappé l’employée d’une banque. Leur fuite vers le Mexique les conduit finalement dans un bar en plein desert, où un contact leur à donné rendez-vous. Le « Titty Twister », un repaire de motards ouvert toute la nuit, va s\'avérer être une antre cauchemardesque…', 'Los Hooligans Productions', 'https://image.tmdb.org/t/p/w1280/lYKrBABSPr2DPY6VcVvGKPQVbYT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9JcMUzQy9gPqDmJJGH3AcL145mv.jpg', 'https://www.youtube.com/embed/-DtG2Gx_tW0', 107, '1996', 3.5, 1),
(756, 'United States of America', 'Fantasia', 'Ce chef-d’œuvre intemporel de Walt Disney est une célébration de sons et lumières de huit séquences, alliant musique classique et animations innovantes de l\'époque. Admirez « La Suite Casse-Noisette », « L’Apprenti Sorcier », « La Danse des Heures » et « Une Nuit sur le Mont Chauve ». Écoutez la musique prendre vie, regardez les images exploser en chanson et vivez l’exaltation de Fantasia.', 'Walt Disney Pictures', 'https://image.tmdb.org/t/p/w1280/hg5QpPLIvaFEon60Vyo2CK3LB1C.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yRDU00odN8kHIFJQobkoCKcL6Le.jpg', 'https://www.youtube.com/embed/tsOgp7edsO0', 125, '1940', 3.69, 1),
(757, 'United Kingdom', 'Lady détective entre en scène', 'Pour Jane Marple, cet homme accusé d\'un meurtre n\'a rien fait. Elle en est persuadée, mais elle est la seule. Alors elle décide elle-même de mener l\'enquête...', 'Lawrence P. Bachmann Productions', 'https://image.tmdb.org/t/p/w1280/m5PJdsshNz8BHB0kGvQ13O6YdUw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//txopLEglF7yhenRw2gR1dl2YH8Z.jpg', 'https://www.youtube.com/embed/', 90, '1964', 3.48, 1),
(758, 'United Kingdom', 'Passage à tabac', 'Miss Marple fait partie d\'un conseil d\'administration, un de ses membres est assassiné. L\'inspecteur menant l\'enquête conclut à une crise cardiaque. Mais la vieille demoiselle enquête à partir du tabac à priser du mort...', 'Metro-Goldwyn-Mayer British Studios', 'https://image.tmdb.org/t/p/w1280/o4HzdGIwpNDJjA3kEyJQEZtnYBt.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3zZNORpf1iTEgQYhAqWbJnXYKxp.jpg', 'https://www.youtube.com/embed/', 93, '1964', 3.54, 1),
(759, 'United States of America', 'Gentlemen Prefer Blondes', 'Lorelei Lee is a beautiful showgirl engaged to be married to the wealthy Gus Esmond, much to the disapproval of Gus\' rich father, Esmond Sr., who thinks that Lorelei is just after his money. When Lorelei goes on a cruise accompanied only by her best friend, Dorothy Shaw, Esmond Sr. hires Ernie Malone, a private detective, to follow her and report any questionable behavior that would disqualify her from the marriage.', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/fDozhst5HVJJcd3BM8ZOsKniO7Q.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xORxfun2s1Gn43nPbYkMpQZZ9sK.jpg', 'https://www.youtube.com/embed/Ygu6RQSXCeg', 91, '1953', 3.66, 1),
(760, 'France', 'Les Aventures de Rabbi Jacob', 'À la suite d’un quiproquo, un homme d’affaires irascible et raciste, se retrouve confronté malgré lui à un règlement de compte entre terroristes d’un pays arabe. Afin de semer ses poursuivants, il se déguise en rabbin, après avoir croisé à Orly des religieux juifs en provenance de New‐York.', 'Horse Film', 'https://image.tmdb.org/t/p/w1280/lf6D4UZ7khLmpRRzKF7OQRmgISc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5R7ZF32KZexcPWWftIZvEZJNH5A.jpg', 'https://www.youtube.com/embed/NAUBjOJBSQM', 100, '1973', 3.69, 1),
(761, 'France', 'L\'Aile ou la Cuisse', 'Charles Duchemin, le directeur d’un guide gastronomique qui vient d’être élu à l’Académie Française, se trouve un adversaire de taille en la personne de Jacques Tricatel, le PDG d’une chaîne de restaurants. Son fils Gérard anime en cachette une petite troupe de cirque.', 'Les Films Christian Fechner', 'https://image.tmdb.org/t/p/w1280/bPiy54eS2243YKp6l5u73UOL226.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//w35oEmLCEjzHOqBjG5c3kLTaXEK.jpg', 'https://www.youtube.com/embed/HHArVsoHK0w', 104, '1976', 3.61, 1),
(762, 'United Kingdom', 'Monty Python : Sacré Graal !', 'Le roi Arthur et les Chevaliers de la Table Ronde se lancent à la conquête du Graal, chevauchant de fantômatiques montures dans un bruitage de noix de coco cognées. La petite troupe va devoir passer mille épreuves, dont un chevalier à trois têtes, des jouvencelles en chaleur, voire même un terrible lapin tueur.', 'Python (Monty) Pictures Limited', 'https://image.tmdb.org/t/p/w1280/5y6rOuxx9TnhL0HSx6v6BdloCm6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nWkxOXpctN2NuToGzwCSdFdiht0.jpg', 'https://www.youtube.com/embed/ui3-NDLJt3I', 91, '1975', 3.9, 1),
(763, 'New Zealand', 'Braindead', 'Lionel Cosgrove, un jeune homme timide flanqué d\'une mère envahissante fait la connaissance de la belle Paquita, dont il tombe amoureux. Ce qui n\'est pas du goût de sa chère maman, bien décidée à gâcher cette relation. Alors qu\'elle espionne l\'un de leurs rendez-vous galants au zoo, cette dernière est mordue par un singe-rat de Sumatra. Succombant à ses blessures, elle se transforme alors en zombie cannibale et contamine peu à peu la ville. Seul Lionel peut stopper l\'invasion...', 'WingNut Films', 'https://image.tmdb.org/t/p/w1280/i3FmGTBFR1s54aifzXUUgxEDqmH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//te7PK3CrO7SWeNaiGfswWqpM4eH.jpg', 'https://www.youtube.com/embed/Rixe4kPjJbw', 104, '1992', 3.7, 1),
(764, 'United States of America', 'Evil Dead', 'Cinq jeunes vacanciers s’installent dans une baraque au cœur d’une sinistre forêt. En descendant dans une cave lugubre, les deux garçons de la bande découvrent un vieux magnétophone qui une fois remis en marche, émet une incantation magique. Laquelle réveille les forces du mal, déclenchant ainsi une horreur sans nom…', 'Renaissance Pictures', 'https://image.tmdb.org/t/p/w1280/5ARFGQmFGAE2eCjgLWESnfXCgDE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//377E9KSoUGxKWuvyR1Zu9aXcU4I.jpg', 'https://www.youtube.com/embed/clIaqwQGoJc', 85, '1981', 3.66, 1),
(765, 'United States of America', 'Evil Dead 2', 'Dans un chalet qui semble abandonné, Ash et Annie découvrent un magnétophone. Ils le mettent en route et entendent la voix du Professeur Knoby qui a réussi à traduire le livre des morts. Mais ses paroles réveillent l’Esprit du Mal. Annie disparaît. Ash est poursuivi par une force étrange. A son réveil, il est possédé par le Mal, mais au lever du soleil, retrouve son apparence normale. Il cherche en vain à s’enfuir et se réfugie à nouveau dans le chalet. Des spectres hideux s’en prennent à lui…', 'Rosebud Releasing Corporation', 'https://image.tmdb.org/t/p/w1280/b3t9SIfnsiDZasS2jVklsCMw3ZM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jyRk8ykqLOXaVadZ0aWRDd89gMP.jpg', 'https://www.youtube.com/embed/Xb5lOGxZrRk', 85, '1987', 3.78, 1),
(766, 'United States of America', 'Evil Dead 3 : L\'Armée des ténèbres', 'Une tronçonneuse greffée au poignet, un fusil à canon scié dans la main libre, Ash se retrouve bien malgré lui plongé dans le passé vers l’an 1300. Pour s’en sortir, il lui faut mettre la main sur le Nécronomicon, grimoire responsable de son état. Mais les dangers qu’il va rencontrer sont multiples. Sa quête va se transformer en croisade contre des forces machiavéliques, qui vont l’obliger à affronter une armée de squelettes…', 'Renaissance Pictures', 'https://image.tmdb.org/t/p/w1280/aQK3A91S3yAAnEP6D4ZtaH8Unpd.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xErw1pfmyWYQcXIlXipPY3O9uRH.jpg', 'https://www.youtube.com/embed/ATd3E6o45ro', 96, '1992', 3.64, 1),
(767, 'United Kingdom', 'Harry Potter and the Half-Blood Prince', 'As Lord Voldemort tightens his grip on both the Muggle and wizarding worlds, Hogwarts is no longer a safe haven. Harry suspects perils may even lie within the castle, but Dumbledore is more intent upon preparing him for the final battle fast approaching. Together they work to find the key to unlock Voldemorts defenses and to this end, Dumbledore recruits his old friend and colleague Horace Slughorn, whom he believes holds crucial information. Even as the decisive showdown looms, romance blossoms for Harry, Ron, Hermione and their classmates. Love is in the air, but danger lies ahead and Hogwarts may never be the same again.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/z7uo9zmQdQwU5ZJHFpv2Upl30i1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//urDWNffjwmNi5IQaezw9GwqkUXa.jpg', 'https://www.youtube.com/embed/7GIoHjLOZyA', 153, '2009', 3.85, 1),
(768, 'Czech Republic', 'From Hell', 'Frederick Abberline is an opium-huffing inspector from Scotland Yard who falls for one of Jack the Ripper\'s prostitute targets in this Hughes brothers adaption of a graphic novel that posits the Ripper\'s true identity.', 'Underworld Entertainment', 'https://image.tmdb.org/t/p/w1280/t2WpWM8nBO4sULXr2bDfNEt4qgr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xo2S7gRwCvWdVqM0Swv37yA2rzw.jpg', 'https://www.youtube.com/embed/Y1C2K47LSVA', 122, '2001', 3.34, 1),
(769, 'United States of America', 'Les Affranchis', 'Brooklyn, dans les années 50. Depuis l\'enfance, le jeune Henry Hill rêve de devenir gangster. À 16 ans, il se met en selle auprès de Paul Cicero, un caïd local, et commet ses premiers délits. Arrêté et interrogé, il refuse de parler et gagne ainsi le respect du milieu. À sa sortie de prison, il fait la connaissance de James Conway et de Tommy DeVito, deux truands d\'une extrême violence, et se lance avec eux dans des trafics de grande envergure. Karen, une jeune bourgeoise qu\'il courtise et finit par épouser, ne devine sa profession qu\'après être passée devant l\'officier d\'état-civil. Grisé par le succès, Henry multiplie les coups les plus audacieux...', 'Winkler Films', 'https://image.tmdb.org/t/p/w1280/v4c6WMVqUlSJHMyjHNj72iTFGhm.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sw7mordbZxgITU877yTpZCud90M.jpg', 'https://www.youtube.com/embed/xFxgu0ScjJ0', 141, '1990', 4.23, 1),
(770, 'United States of America', 'Autant en Emporte le Vent', 'En Géorgie, en 1861, Scarlett O\'Hara est une jeune femme fière et volontaire de la haute société sudiste. Courtisée par tous les bons partis du pays, elle n\'a d\'yeux que pour Ashley Wilkes malgré ses fiançailles avec sa douce et timide cousine, Melanie Hamilton. Scarlett est pourtant bien décidée à le faire changer d\'avis, mais à la réception des Douze Chênes c\'est du cynique Rhett Butler qu\'elle retient l\'attention…', 'Selznick International Pictures', 'https://image.tmdb.org/t/p/w1280/5263HcQlS1h3RTsyOH9pAc8g3Gt.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ft8WRF2xqEwwGWa59naDUybKTAx.jpg', 'https://www.youtube.com/embed/z6HU1MO0qsk', 233, '1939', 3.99, 1),
(771, 'United States of America', 'Maman, j\'ai raté l\'avion !', 'La famille McCallister a décidé de passer les fêtes de Noël à Paris. Seulement Kate et Peter McCallister s\'aperçoivent dans l\'avion qu\'il leur manque le plus jeune de leurs enfants, Kevin, âgé de 9 ans. D\'abord désespéré, Kevin reprend vite les choses en main et s\'organise pour vivre le mieux possible. Quand deux cambrioleurs choisissent sa maison pour commettre leurs méfaits.', 'Hughes Entertainment', 'https://image.tmdb.org/t/p/w1280/aP9UrDpKS5i5PCiYKDgJvkRz7ne.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vaVaNrscmsG8CUKYxiwZGFNqGJo.jpg', 'https://www.youtube.com/embed/GPtHAQARLdw', 103, '1990', 3.7, 1),
(772, 'United States of America', 'Maman, j’ai encore raté l’avion !', 'Après Paris, c\'est à Miami que la tribu McCallister décide de passer les fêtes de Noël. À l\'aube du jour J, toute la famille est sur le pied de guerre et file a l\'aéroport en prenant bien garde de ne pas oublier Kevin. Mais celui-ci s\'éclipse pour acheter des piles pour son walkman, il ne retrouve plus les siens et s\'embarque par mégarde pour New York...', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/gFhf8NwvEKCbNIOQZxLqj1i5DMy.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pnkcE3Q3fPNM9XzWEN1gJJRYYX4.jpg', 'https://www.youtube.com/embed/y50aUvCWC2A', 119, '1992', 3.35, 1),
(773, 'United States of America', 'Little Miss Sunshine', 'A family loaded with quirky, colorful characters piles into an old van and road trips to California for little Olive to compete in a beauty pageant.', 'Fox Searchlight Pictures', 'https://image.tmdb.org/t/p/w1280/tFnTds88mCuLcLPBseK1kF2E3qv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4YzGG8IPduUQRVnQ0vN5laHA1rH.jpg', 'https://www.youtube.com/embed/-wAG7sdIouI', 102, '2006', 3.84, 1),
(774, 'France', 'La Sortie de l\'Usine Lumière à Lyon', 'La Sortie de l\'usine Lumière à Lyon est un film français réalisé par Louis Lumière, sorti en 1895, qui existe en au moins trois versions, dont l\'une fait partie des dix films montrés au Salon indien du Grand Café à partir du 28 décembre 1895.  Cette \"vue Lumière\", qualifiée non sans humour par l\'historien du cinéma Georges Sadoul comme étant \"presque une bande publicitaire\", est considérée par de nombreux historiens du cinéma comme le premier film de l\'Histoire.', 'Lumière', 'https://image.tmdb.org/t/p/w1280/cxrOGMYOASLBgidmrhmz6jQNe5T.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wNxy6Fqvjh0FsIuk7cgqNNq5PhP.jpg', 'https://www.youtube.com/embed/', 1, '1895', 3.34, 1),
(775, 'France', 'Le Voyage dans la Lune', 'Lors d\'un colloque d\'astronomie, le professeur Barbenfouillis propose à ses confrères d\'organiser une expédition sur la Lune. Son idée est de s\'y faire envoyer à l\'aide d\'un obus spatial qui sera propulsé au moyen d\'un canon géant. Le lancement réussit et les six savants embarqués découvrent que la lune est habitée par une population locale, les Sélénites, et sont faits prisonniers.', 'Star-Film', 'https://image.tmdb.org/t/p/w1280/ep8nPMDeKE01jss7mzEKDzgYQdr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//g67r1eiQD3ERSEQFCFkSn7TeGw5.jpg', 'https://www.youtube.com/embed/38YVp3fYxvM', 14, '1902', 3.98, 1),
(776, 'France', 'La Règle du jeu', 'Le marquis de la Chesnaye organise une partie de chasse sur son domaine de Sologne. Un pléiade d\'invités arrive au château dont André Jurieu, héros national depuis sa traversée de l\'Atlantique en 23 heures. Un exploit réalisé pour les beaux yeux de la marquise Christine La Chesnaye, en vain. Dans une société où nobles et domestiques sont soumis à la règle des conventions, Jurieu, par cet amour, bouleverse le jeu.', 'La Nouvelle Edition Francaise', 'https://image.tmdb.org/t/p/w1280/g0BeC0rVBcuygPSyjBzGwc32d2u.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lxNG1eGsfY8yOeTSk66B5hrv6pZ.jpg', 'https://www.youtube.com/embed/', 112, '1939', 3.8, 1),
(777, 'France', 'La Grande Illusion', 'Pendant la Première Guerre mondiale, l\'avion du lieutenant Maréchal et du capitaine de Boëldieu est abattu par le commandant von Rauffenstein. Les deux officiers français sont envoyés dans un camp en Allemagne. Ils y retrouvent d\'autres prisonniers français, de tous grades et issus de différents milieux sociaux. Les prisonniers organisent différentes activités, partagent leurs maigres ressources et vivent au rythme des nouvelles de l\'armée française. La chambrée, outre Maréchal et Boëldieu, regroupe également le lieutenant Demolder, un amoureux des lettres, le lieutenant Rosenthal, fils d\'une riche famille juive dans les finances, un ingénieur du cadastre et Cartier, un sergent populaire et volubile. Ils décident de s\'échapper du Lager en creusant un tunnel dans des conditions périlleuses. La veille de leur évasion, le sort veut qu\'ils soient transférés dans un autre camp.', 'Réalisation d\'Art Cinématographique', 'https://image.tmdb.org/t/p/w1280/gjmEyFJUtddbDvh6dPFqkw8nklb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yNraM35Vsga5x54whRh7BvQ9afm.jpg', 'https://www.youtube.com/embed/E4nA6QJ1hAQ', 113, '1937', 3.92, 1),
(778, 'France', 'Les Vacances de Monsieur Hulot', 'Les vacances, tout le monde le sait, ne sont pas faites pour s\'amuser. Tout le monde le sait, sauf Monsieur Hulot qui, pipe en l\'air et silhouette en éventail, prend la vie comme elle vient, bouleversant scandaleusement au volant de sa vieille voiture Salmson pétaradante la quiétude estivale des vacanciers qui s\'installent avec leurs habitudes de citadins dans cette petite station balnéaire de la côte atlantique.', 'Cady', 'https://image.tmdb.org/t/p/w1280/tLFYEkIo9LPoTtjvjmw8jP9SK37.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qi7PmFSlCXVAwqlvdiN2ZrlxJGj.jpg', 'https://www.youtube.com/embed/Ysxw1PmHxKY', 88, '1953', 3.49, 1),
(779, 'Germany', 'Vampyr', 'David Gray arrive dans une auberge au crépuscule. Tout semble étrange. En pleine nuit, un vieil homme en robe de chambre surgit auprès de lui et lui confie un mystérieux paquet à n\'ouvrir qu\'en cas de décès. La vie de David bascule subitement. Il sort, suit des ombres, arrive dans une maison abandonnée, y fait d\'inquiétantes rencontres. Il échoue finalement dans un château. C\'est là qu\'habite l\'homme au paquet. L\'une de ses filles, Léone, est gravement malade, peut-être même possédée...', 'Tobis Filmkunst', 'https://image.tmdb.org/t/p/w1280/urribgjwiJ6A6GHTXIi6SIsOGQU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zQ47mh7SkU08fOJIrjHQpVuRrDT.jpg', 'https://www.youtube.com/embed/', 83, '1932', 3.66, 1),
(780, 'France', 'La Passion de Jeanne d\'Arc', 'Le procès de Jeanne d\'Arc, au terme duquel elle fut brûlée sur le bûcher.', 'Société générale des films', 'https://image.tmdb.org/t/p/w1280/A5OBsVmg6COi6nxyrjKNOr4dUPd.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//A1mteOfKdvK5er2sD5i02Qw3CWz.jpg', 'https://www.youtube.com/embed/', 82, '1928', 4.03, 1),
(781, 'Germany', 'Les Rêveurs', 'Quatre citadins qui occupent un chalet près de la ferme de Théo, dans une station de ski, sont victimes d’événements hallucinatoires.', 'X Filme Creative Pool', 'https://image.tmdb.org/t/p/w1280/xex5cnXfw0q01hONM5E0USpL1O4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7KB5MLHBkkZrjKIZm5PRhImOSdt.jpg', 'https://www.youtube.com/embed/VguCsChAxK0', 105, '1997', 3.53, 1),
(782, 'United States of America', 'Gattaca', 'In a future society in the era of indefinite eugenics, humans are set on a life course depending on their DNA. Young Vincent Freeman is born with a condition that would prevent him from space travel, yet is determined to infiltrate the GATTACA space program.', 'Jersey Films', 'https://image.tmdb.org/t/p/w1280/eSKr5Fl1MEC7zpAXaLWBWSBjgJq.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hPsCR1ny6GnctJkWqeJwihTDD7T.jpg', 'https://www.youtube.com/embed/7u3RrbNpRUQ', 106, '1997', 3.77, 1),
(783, 'India', 'Gandhi', 'Reconstitution historique à grand spectacle de la vie de celui que l\'on surnomma le \"mahatma\". La carrière de Gandhi comme avocat débute en Afrique du Sud où il défend les droits de la minorité indienne, ce qui a un grand retentissement dans son pays. Plus tard, dans ses luttes contre les Anglais, il prônera toujours la non-violence et usera essentiellement de l\'arme de la grève de la faim.', 'Goldcrest', 'https://image.tmdb.org/t/p/w1280/eTv0wtWoBwrkme13ja0ThSybZZe.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gum3tuO1zKHBdElSQPS08PJ1w67.jpg', 'https://www.youtube.com/embed/', 190, '1982', 3.77, 1),
(784, 'France', 'Kolya', 'After a fictitious marriage with a Russian emigrant, Cellisten Louka, a Czech man, must suddenly take responsibility for her son. However, it’s not long before the communication barrier is broken between the two new family members.', 'Space Films', 'https://image.tmdb.org/t/p/w1280/fB0cGiEOngfsfyDHXIpFOmEwFgi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//q9GAThBRXMeXFLArzxt1tpbjK7E.jpg', 'https://www.youtube.com/embed/', 105, '1996', 3.7, 1),
(785, 'Germany', 'Kuhle Wampe oder: Wem gehört die Welt?', 'Berlin, au debut des annees trente. Une famille n\'arrive plus a survivre dans les conditions economiques catastrophique que connait le pays. Le fils, sans travail, se suicide. Sur le conseil de l\'ami de la fille, la famille s\'installe dans la colonie \"Kuhle Vampe\". Scenario de Bertolt Brecht.', 'Praesens-Film AG', 'https://image.tmdb.org/t/p/w1280/wlgWDBftI6P832bnxUNHPiA3gol.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//l4vdoEQnOYrMgl4hetzXCXAlfK9.jpg', 'https://www.youtube.com/embed/', 74, '1932', 3.45, 1),
(786, 'United States of America', 'Almost Famous', 'In 1973, 15-year-old William Miller\'s unabashed love of music and aspiration to become a rock journalist lands him an assignment from Rolling Stone magazine to interview and tour with the up-and-coming band, Stillwater.', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/3rrkyLYbgLj84AYvjhdcJot4JPx.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//AqLtFRKVX2G0ghMnMnQoSGan4pY.jpg', 'https://www.youtube.com/embed/mk5rWkyFIjU', 124, '2000', 3.74, 1),
(787, 'China', 'Mr. & Mrs. Smith', 'After five (or six) years of vanilla-wedded bliss, ordinary suburbanites John and Jane Smith are stuck in a huge rut. Unbeknownst to each other, they are both coolly lethal, highly-paid assassins working for rival organisations. When they discover they\'re each other\'s next target, their secret lives collide in a spicy, explosive mix of wicked comedy, pent-up passion, nonstop action and high-tech weaponry.', 'Epsilon Motion Pictures', 'https://image.tmdb.org/t/p/w1280/wzIO3ytxeSNt1wRpXLIdkNbGoDm.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//iFaWUETEE2umP1WY0LUAmjSpzm7.jpg', 'https://www.youtube.com/embed/8a6yfi77hxA', 120, '2005', 3.34, 1),
(788, 'United States of America', 'Madame Doubtfire', 'Privé, à la suite de son divorce, de ses trois enfants qu\'il adore, Daniel Hillard, doubleur de dessins animés, met en œuvre tous ses talents d\'acteur et d\'imitateur et se transforme en respectable gouvernante irlandaise. Lorsque Mme Doubtfire se présente dans la famille Hillard, elle est acceptée à l\'unanimité.', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/z57TpEyQwCoyLxZkrVMiUCqT8Aw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//z2G8VrZI6waLyUfwLeSwLd1HBgv.jpg', 'https://www.youtube.com/embed/rG3l9GD0RPU', 125, '1993', 3.59, 1),
(789, 'Czechoslovakia', 'Trains étroitement surveillés', 'Milos travaille dans une petite gare tchèque pendant la deuxième guerre mondiale. Tourmenté par sa timidité, il n\'arrive pas à séduire la jolie contrôleuse qui pourtant s\'offre à lui. Devant cet échec et désespéré de pouvoir prouver qu\'il est un homme, il tente de se suicider. Une jeune fille va tenter de lui faire surmonter ses craintes.', 'Filmové studio Barrandov', 'https://image.tmdb.org/t/p/w1280/yzNCrmtT6o8gLlsYkXN9NlGNQkk.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//eD1ztHEgCsexPrdciDBhhvxHLQs.jpg', 'https://www.youtube.com/embed/', 92, '1966', 3.65, 1),
(790, 'United States of America', 'Fog', 'Une légende persiste dans une petite ville du Pacifique, Antonio Bay. On raconte aux enfants qu\'un naufrage a eu lieu il y a une centaine d\'années, que tous les passagers sont morts et que, à chaque fois que le brouillard se lève, les victimes surgissent des flots pour se montrer aux vivants.', 'AVCO Embassy Pictures', 'https://image.tmdb.org/t/p/w1280/j84k9m2ozOzIToP1COPveNCj5Ce.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ezxy4ncmiQEJdtlcHMak1KUhHtA.jpg', 'https://www.youtube.com/embed/97PQ1QgKL8c', 89, '1980', 3.34, 1),
(791, 'Canada', 'Fog', '1871, un navire fait naufrage au large de l\'île d\'Antonio Bay. L\'équipage disparaît avec le bateau. Il ne s\'agit pas d\'un accident, mais les quatre coupables voient leur effroyable crime dissimulé par une étrange brume.Plus d\'un siècle plus tard, le passé refait surface et un mystérieux brouillard envahit l\'île. Face aux épouvantables morts qui se multiplient, les habitants terriﬁés doivent affronter la malédiction de ceux qui veulent se venger.Si le mystère demeure, il n\'y aura plus de paix. Sans vérité, personne ne survivra...', 'Revolution Studios', 'https://image.tmdb.org/t/p/w1280/3Yz96T2B6MUN1Lug9zv8yjBZwo0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aMZ3uPB5A8Qk1N7MJ5DMezEAfrr.jpg', 'https://www.youtube.com/embed/', 96, '2005', 2.24, 1),
(792, 'United States of America', 'Platoon', 'Septembre 1967 : Chris Taylor, dix‐neuf ans, rejoint la compagnie Bravo du 25ème régiment d’infanterie, près de la frontière cambodgienne. Chris, issu d’une famille bourgeoise s’est engagé volontairement et, plein d’idéal entend bien servir son pays. Mais la réalité est tout autre et ses illusions vont tomber les unes après les autres. Il sera également témoin de la rivalité sanglante qui oppose deux officiers qu’il admire.', 'Hemdale Film Corporation', 'https://image.tmdb.org/t/p/w1280/rehBWOx9AIkZRKVuiemWvAMH40.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2WZLSN9cdHCkJFbkj0oMfOfVHn8.jpg', 'https://www.youtube.com/embed/C6sTln5N3mE', 120, '1986', 3.87, 1),
(793, 'United States of America', 'Blue Velvet', 'Épaulé par son amie Sandy, Jeffrey, un jeune homme, mène son enquête concernant une oreille humaine trouvée dans un terrain vague. Il croise sur son chemin Dorothy Vallens, une mystérieuse chanteuse de cabaret.', 'DEG', 'https://image.tmdb.org/t/p/w1280/psJb2NQKUWDQyhMRV3hoEWk60gS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vB5hoogPuLO5Hpbb63c8yFB7WPf.jpg', 'https://www.youtube.com/embed/00Mq6N5AsjE', 120, '1986', 3.82, 1),
(794, 'United Kingdom', 'La Malédiction', 'Robert Thorn viens de devenir ambassadeur des États-Unis à Londres. Celui-ci va réaliser peu à peu que son fils de 5 ans, Damien, n\'est autre que la réincarnation de l\'Antéchrist.', 'Mace Neufeld Productions', 'https://image.tmdb.org/t/p/w1280/oghpe74tKZIbLMuris27iI5di0M.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gw9vOHSYDEuKcNKgQWS2iePcfjk.jpg', 'https://www.youtube.com/embed/', 111, '1976', 3.7, 1),
(795, 'Germany', 'La Cité des Anges', 'Seth est un ange des temps modernes : une créature céleste qui aspire à se rendre utile sur terre. Pour ce faire, il prend de temps en temps une apparence humaine, mais la mission exige le plus souvent qu\'il reste invisible. Les êtres les plus sensibles soupçonnent de temps en temps sa présence lorsque, pris par une angoisse, ils ont la sensation qu\'une main invisible à l’œil nu vient se poser sur eux, dissiper leurs ennuis.', 'Atlas Entertainment', 'https://image.tmdb.org/t/p/w1280/1lQJe8MDq96ODb9fKMJi0bMISEv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fqaq7q8rxvySxZQHR9lcNqmK5hR.jpg', 'https://www.youtube.com/embed/5TjFtnkrPxQ', 113, '1998', 3.4, 1),
(796, 'United States of America', 'Sexe intentions', 'Ils sont jeunes, beaux, riches et rivalisent d\'adresse machiavélique pour comploter des conquêtes amoureuses. Dans cette version moderne des \"Liaisons Dangereuses\", l\'intrigante Kathryn Merteuil charge son perfide ami et double masculin, Sebastian Valmont, de séduire la vertueuse Annette Hargrove, dont les régulières déclarations sur les bienfaits de la virginité sont des agressions permanentes au systême de pensée de Mlle Merteuil. Ce challenge devient un pari, que Sebastian veut absolument gagner. Mais sa tentative de séduction ne produit pas les effets escomptés : il est séduit en retour par la jeune et jolie étudiante...', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/tkShoPdnzijP1VdADBLghgephTC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//m2QvGozzKz5ux74gKocn4kFTGz1.jpg', 'https://www.youtube.com/embed/F3tUNyHT1MU', 97, '1999', 3.4, 1),
(797, 'Sweden', 'Persona', 'Une actrice muette est confiée à une infirmière qui constate que leurs personnalités se confondent.', 'SF Studios', 'https://image.tmdb.org/t/p/w1280/5DD1LJWLzLS8UYwDZKRdSwVaRr5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//32YB3OXR036XBi1Dm5i9D0hDM2o.jpg', 'https://www.youtube.com/embed/', 85, '1966', 4.13, 1),
(798, 'Austria', 'Pünktchen und Anton', '', 'Rhombus Ringfilm', 'https://image.tmdb.org/t/p/w1280/xpUaSs8ynsXQfayNhle6sFUf5qy.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hcjA8Z8C3kESZvADNAScDiaPEIx.jpg', 'https://www.youtube.com/embed/', 91, '1953', 3.54, 1),
(799, 'Germany', 'Petit Point et Antoine', 'Entre Annaluise, surnommée Petit Point, et Antoine, l\'amitié ne connaît pas les frontières de classes. Les parents de la première sont aisés, mais travaillent beaucoup et ne sont presque jamais à la maison, la laissant aux bons soins de leur jeune fille au pair française. Quant à Antoine, il vit seul avec sa mère malade, depuis que son père s\'est évaporé dans la nature. Pour rapporter un peu d\'argent à la maison, Antoine travaille tous les soirs chez un marchand de glaces, ce qui l\'épuise.', 'Lunaris Film', 'https://image.tmdb.org/t/p/w1280/d7sc2f57F3jSFew7Nz5dJBPUCFC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//LtrKJI6q8AAnOEvJeNhL5H6M8J.jpg', 'https://www.youtube.com/embed/', 107, '1999', 3.55, 1),
(800, 'Mexico', 'Los olvidados', 'Evadé d\'un centre de redressement, El Jaibo, jeune Mexicain laissé à lui-même, prend la tete d\'une bande de jeunes délinquants de Mexico. Le vieux mendiant aveugle Don Carmelo, sur le point d\'être volé, blesse l\'un deux avec la pointe de sa canne...', 'Ultramar Films', 'https://image.tmdb.org/t/p/w1280/4HVAr9KrCAOsojtcnbWuRTXNL3S.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//b4VAgPHGL33OA5QNZCYi0jU5Nma.jpg', 'https://www.youtube.com/embed/jV1WArrh5-k', 80, '1950', 4, 1),
(801, 'United States of America', 'Good Morning, Vietnam', 'A disk jockey goes to Vietnam to work for the Armed Forces Radio Service. While he becomes popular among the troops, his superiors disapprove of his humour.', 'Touchstone Pictures', 'https://image.tmdb.org/t/p/w1280/rcod81d34X1avhRIKBOQ4BsHtYZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//l04cyHUP6PCAozc2GMEHPguu7AN.jpg', 'https://www.youtube.com/embed/JnBXv3W0arQ', 121, '1987', 3.67, 1),
(802, 'United Kingdom', 'Lolita', 'L\'écrivain Humbert Humbert vient d\'obtenir une chaire de littérature française à l\'université de Ramsdale. Il trouve une chambre chez une jeune veuve, Charlotte Haze, qui tombe rapidement amoureuse de lui. Mais les yeux d\'Humbert ne voient que Lolita, l\'aguichante et troublante fille de Charlotte. Pour être sûr de rester toujours auprès de la jeune fille, il finit par céder aux multiples avances de sa mère, et accepte de l\'épouser. Un accident vient à point nommé abréger la vie de Charlotte, au moment même où elle apprend la vérité sur les sentiments de Humbert. L\'écrivain entraîne alors Lolita dans une folle passion qui les mènera jusqu\'au meurtre…', 'Seven Arts Productions', 'https://image.tmdb.org/t/p/w1280/5Ah53wQpl3xRvaUW7qBc0LNp14g.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//a0Apuqi8sZASOr5uvFeg5dgNJxT.jpg', 'https://www.youtube.com/embed/', 153, '1962', 3.68, 1),
(803, 'France', 'Nuit et Brouillard', '1955 : Alain Resnais, à la demande du comité d\'histoire de la Seconde Guerre mondiale, se rend sur les lieux où des milliers d\'hommes, de femmes et d\'enfants ont perdu la vie. Il s\'agit d\'Orianenbourg, Auschwitz, Dachau, Ravensbruck, Belsen, Neuengamme, Struthof. Avec Jean Cayrol et l\'aide de documents d\'archives, il retrace le lent calvaire des déportés.', 'Cocinor', 'https://image.tmdb.org/t/p/w1280/c0eZtYCYOe4XV55dOZ016XesKg3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cnl95VtUon66J1PLRPpsgYgwHF7.jpg', 'https://www.youtube.com/embed/', 33, '1956', 4.13, 1),
(804, 'United States of America', 'Vacances romaines', 'Les tendres amours, le temps d\'une journée, d\'une princesse fugueuse et d\'un séduisant journaliste américain, dans la Ville éternelle, Rome.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/wnjs5tA2rqAi2LXU8Dv6KBKB8fj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9p2oLEbktIrmwaZWRJkUtuQiSH8.jpg', 'https://www.youtube.com/embed/', 119, '1953', 3.95, 1),
(805, 'United States of America', 'Rosemary\'s Baby', 'Malgré les conseils de leur vieil ami Hutch, Guy Woodhouse et sa jeune femme, enceinte, s’installent dans un immeuble new-yorkais vétuste, considéré par leur ami comme une demeure maléfique. Aussitôt, leurs voisins, Minnie et Roman Castevet, vieux couple d’Europe centrale, imposent leur amitié et leurs services. Si Guy accepte facilement ce voisinage, Rosemary s’en inquiète…', 'William Castle Productions', 'https://image.tmdb.org/t/p/w1280/8xreLDdWHQZa2u3zObRuOdNJDpm.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sd8UeAahns9ZwxI7WlSa90iUxqd.jpg', 'https://www.youtube.com/embed/', 138, '1968', 3.91, 1),
(806, 'United States of America', '666, La Malédiction', 'Le Vatican est en pleine effervescence : tout indique que la prédiction du livre des révélations, qui veut que l\'apocalypse débute avec l\'incarnation de Satan sur la Terre, doit se réaliser dans les tous prochains jours. Robert Thorn, diplomate américain en poste à Rome, est soulagé de pouvoir annoncer à sa femme, qui se réveille dans la salle de travail, qu\'après de nombreuses tentatives infructueuses, elle a enfin pu donner naissance à un fils. Mais, au fur et à mesure que Damien grandit, il devient évident qu\'il s\'agit d\'un enfant hors du commun. Autour de lui, les morts mystérieuses et les avertissements les plus sinistres se multiplient. Thorn réalise bientôt que la naissance de son fils, à la 6ème heure du 6ème jour du 6ème mois, n\'est sans doute pas due au hasard et qu\'elle cache le plus terrifiant des secrets...', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/3n1Dm3pNOrx33E9Gspwo6qW0W0S.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xIUllvT7at1ua65O2HT7MUA9pVk.jpg', 'https://www.youtube.com/embed/', 108, '2006', 2.78, 1),
(807, 'United States of America', 'Seven', 'Pour conclure sa carrière, l’inspecteur Somerset, vieux flic blasé, tombe à sept jours de la retraite sur un criminel peu ordinaire. John Doe, c’est ainsi que se fait appeler l’assassin, a décidé de nettoyer la société des maux qui la rongent en commettant sept meurtres basés sur les sept péchés capitaux: La gourmandise, l’avarice, la paresse, l’orgueil, la luxure, l’envie et la colère.', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/moHx8JGzIdEAMLj1CqDzcLYhMRY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hh28CTWLdxTXA5yJgefZ6gUnFDo.jpg', 'https://www.youtube.com/embed/BLY4treE0XU', 130, '1995', 4.18, 1),
(808, 'United States of America', 'Shrek', 'Shrek, un ogre verdâtre, cynique et malicieux, a élu domicile dans un marécage qu’il croit être un havre de paix. Un matin, alors qu’il sort faire sa toilette, il découvre de petites créatures agaçantes qui errent dans son marais. Shrek se rend alors au château du seigneur Lord Farquaad, qui aurait soi‐disant expulsé ces êtres de son royaume. Ce dernier souhaite épouser la princesse Fiona, mais celle‐ci est retenue prisonnière par un abominable dragon. Il lui faut un chevalier assez brave pour secourir la belle. Shrek accepte d’accomplir cette mission. En échange, le seigneur devra débarrasser son marécage de ces créatures envahissantes. Or, la princesse Fiona cache un secret terrifiant qui va entraîner Shrek et son compagnon l’âne dans une palpitante et périlleuse aventure.', 'DreamWorks Pictures', 'https://image.tmdb.org/t/p/w1280/EKERKucZeBrkrR8xLDTkr5FeDc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sRvXNDItGlWCqtO3j6wks52FmbD.jpg', 'https://www.youtube.com/embed/08dotHAQ-6M', 90, '2001', 3.86, 1),
(809, 'United States of America', 'Shrek 2', 'Devenus de jeunes mariés, Shrek et Fiona rentrent de leur heureuse lune de miel. Ils sont invités par les parents de Fiona à venir dîner dans leur royaume, à Far Far Away. Mais ils ne se doutent pas que leur fille est devenue une ravissante ogresse… Ce mariage met par ailleurs en péril l’avenir et les projets les plus secrets du Roi…', 'DreamWorks Pictures', 'https://image.tmdb.org/t/p/w1280/2AkwJ5cgTZTwgW9tlvir2hHEAl2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bk44UUz9YpPhzYuMCgkSobEqYrr.jpg', 'https://www.youtube.com/embed/MQ5CP5uouLg', 90, '2004', 3.62, 1),
(810, 'United States of America', 'Shrek le troisième', 'L’ogre Shrek n’avait pas quitté son marécage pestilentiel et épousé sa chère Fiona pour devenir roi. C’est pourtant ce qui risque de lui arriver après que son beau‐père Harold clabote soudain sans crier gare. S’il n’arrive pas à dénicher illico un roi avec l’aide de ses fidèles compagnons, l’Âne et le Chat Potté, Shrek deviendra le prochain souverain du Royaume Fort Fort Lointain. Bonjour les ennuis ! À moins qu’Artie, le cousin loser de Fiona, ne se laisse convaincre de monter sur le trône à sa place. Mais ce paumé a‐t‐il vraiment l’étoffe d’un roi ?', 'DreamWorks Animation', 'https://image.tmdb.org/t/p/w1280/oUrougXnOHJVXmW2IsbAIthjcZC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wxkXCVGw61kbJAfP9SkxoETD0uz.jpg', 'https://www.youtube.com/embed/_MoIr7811Bs', 93, '2007', 3.14, 1),
(811, 'United States of America', 'Silent Running', 'In a future Earth barren of all flora and fauna, the planet\'s ecosystems exist only in large pods attached to spacecraft. When word comes in that the pods are to be jettisoned into space and destroyed so that the spacecraft can be reused for commercial purposes, most of the crew of the Valley Forge rejoice at the prospect of going home. Not so for botanist Freeman Lowell who loves the forest and its creatures, so decides to take matters into his own hands to protect what he loves.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/ahasZ5HILZHtlrl6cbXgpfk0y8H.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5QTwfS9vcr22Nl7PCcUro7dEMFq.jpg', 'https://www.youtube.com/embed/jC10RfDoIZA', 89, '1972', 3.2, 1),
(812, 'United States of America', 'Aladdin', 'Aladdin, un jeune orphelin chapardeur, fait équipe avec Jasmine, une princesse astucieuse et sure d’elle, pour empêcher le sorcier maléfique Jafar de s’emparer du royaume. En chemin, il prend confiance en lui grâce à un génie métamorphe facétieux, dont les trois souhaits peuvent tout changer.', 'Walt Disney Pictures', 'https://image.tmdb.org/t/p/w1280/dSMEfVse2sXKWaTYCCa7XA5tL5V.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5OeY4U2rzePxWq2rkqMajUx2gz7.jpg', 'https://www.youtube.com/embed/mq05scD6PUs', 90, '1992', 3.82, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(813, 'United States of America', 'Y a-t-il un pilote dans l\'avion ?', 'Les personnages et les événements de ce film sont fictifs - heureusement ! Robert Hays joue le rôle d’un ancien pilote de chasse obligé de prendre les commandes d’un avion de ligne quand l’équipage succombe à une intoxication alimentaire. Julie Hagerty est sa petite amie/hôtesse de l’air/co-pilote, entourée d’autres acteurs comme Robert Stack, Lloyd Bridges, Peter Graves, Leslie Nielsen, Kareem Abdul-Jabbar… et d’autres encore. Leurs gags parodient tous les films-catastrophe et l’histoire rebondit sans cesse en un tourbillon étourdissant.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/7pH55GUezP1isKGo16ehbmRB1pK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yqrlmH2dDcOaz32eGsrZj4m9Vgb.jpg', 'https://www.youtube.com/embed/', 88, '1980', 3.64, 1),
(814, 'United Kingdom', 'Le Loup-Garou de Londres', 'Deux jeunes Américains en vacances s\'égarent dans une région déserte de l\'Angleterre. Ils sont attaqués par une bête étrange. Peu après, l\'un d\'entre eux s\'éveille dans un hôpital...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/eIsZwhFNKLuZvriaIhQrGEnAguM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//faK1VWh8oA561BrY1BqmOB6lStF.jpg', 'https://www.youtube.com/embed/', 97, '1981', 3.68, 1),
(815, 'United Kingdom', 'La Ferme des Animaux', '', 'Animal Farm Productions Ltd.', 'https://image.tmdb.org/t/p/w1280/vFQo4DdhgHBr0Jy06VpzCYaZaPI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2mEXtIjgsoe5uqH70CLpszs6rQY.jpg', 'https://www.youtube.com/embed/', 91, '1999', 2.88, 1),
(816, 'Germany', 'Austin Powers', '1967. Londres a son idole. Photographe de mode le jour et super espion de sa Gracieuse Majesté la nuit, Austin Powers est investi d’une mission : déjouer les plans funestes du Dr Denfer, son ennemi juré ! Après l’échec d’un attentat, le Dr Denfer disparaît dans l’espace et Austin Powers, au fait de sa gloire se fait cryogéniser.  1997. Les deux ennemis sont décongelés et un ultime affrontement se prépare : le Dr Denfer menace de faire exploser la terre. Aidé par la sublime Vanessa Kensington, Austin Powers parviendra-t-il à sauver la planète et à conquérir le cœur de sa coéquipière ?', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/sqbYNe6ILOWGLE6CBmTVi11Zbz7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3tSCdgdUpXmkpHtAoQJgTt1LSI0.jpg', 'https://www.youtube.com/embed/L2CyPAKmEng', 95, '1997', 3.27, 1),
(817, 'United States of America', 'Austin Powers : L\'Espion qui m\'a tirée', 'Austin Powers s’est très bien adapté aux années 90, mais le sinistre docteur Denfer rêve toujours de l’éliminer. Pour cela, il construit une machine à remonter le temps pour retourner en 1969 afin d’extraire la libido d’Austin Powers, son « mojo », tandis qu’il est congelé. Austin Powers, dépossédé de son pouvoir d’attraction, doit lui aussi remonter le temps afin d’affronter son ennemi mortel et récupérer son mojo.', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/4UG8W1GEP3AFB0emnSzlJM8JcR6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//edg3mPp97KLhHjEWwKMrugaASv3.jpg', 'https://www.youtube.com/embed/zxpydq_4_ME', 95, '1999', 3.13, 1),
(818, 'United States of America', 'Austin Powers dans Goldmember', 'Pour la troisième fois, Austin Powers et le docteur Denfer s’affrontent. Mais cette fois‐ci, le meilleur agent secret de Grande‐Bretagne se trouve face à un nouvel ennemi : Goldmember, qui a kidnappé son père Nigel Powers. Ensemble, le docteur Denfer et Goldmember projettent de noyer le monde dans les profondeurs des océans ; dès lors, Austin Powers doit non seulement délivrer son père, mais aussi empêcher le docteur Denfer et Goldmember de mener leur plan diabolique à bien.', 'Eric\'s Boy', 'https://image.tmdb.org/t/p/w1280/AbjHqIKt7uDWQJZPxZK5o6iYtW3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2U0sF8StXUECjs02KYxnWka48WN.jpg', 'https://www.youtube.com/embed/s-DvjCNAGy8', 95, '2002', 3, 1),
(819, 'United States of America', 'Sleepers', 'Two gangsters seek revenge on the state jail worker who during their stay at a youth prison sexually abused them. A sensational court hearing takes place to charge him for the crimes.', 'Propaganda Films', 'https://image.tmdb.org/t/p/w1280/yUpiEk2EojS9ZEXb3nIQonQCYYF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//w2rWEjAMYErpNfoK2Z0GFh1LFhN.jpg', 'https://www.youtube.com/embed/f6SeUzdUxC4', 147, '1996', 3.8, 1),
(820, 'United States of America', 'JFK', 'En 1966, trois ans après l\'assassinat du président John F. Kennedy à Dallas, Jim Garrison, procureur de La Nouvelle-Orléans (Louisiane), se plonge dans la lecture du rapport de la commission Warren chargée d\'élucider le crime et ayant établi la culpabilité de Lee Harvey Oswald. Les invraisemblances et les « trous » du rapport Warren étonnent Garrison qui décide d\'enquêter lui-même sur l\'assassinat. Les pistes qu\'il découvre avec l\'aide d\'une petite équipe gagnée à sa cause le mènent à la conclusion que Oswald n\'était qu\'une « couverture » masquant en fait un véritable complot minutieusement organisé par la CIA, le FBI et le Pentagone afin d\'éliminer Kennedy.', 'Ixtlan Productions', 'https://image.tmdb.org/t/p/w1280/r0VWVTYlqdRCK5ZoOdNnHdqM2gt.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lGJxJQCiEeaoXAoQUvBcv6lRa7U.jpg', 'https://www.youtube.com/embed/oqbDoA0YdGI', 189, '1991', 3.81, 1),
(821, 'United States of America', 'Jugement à Nuremberg', 'En 1948, le juge Haywood est envoyé à Nuremberg pour présider le procès de quatre magistrats allemands accusés de trop de complaisance à l\'égard du régime Nazi. L\'un d\'eux, Janning, se renferme dans un silence méprisant et, en écartant les témoignages et les films sur les camps de concentration, dit qu\'il n\'a fait qu\'appliquer la loi en vigueur...', 'United Artists', 'https://image.tmdb.org/t/p/w1280/6cgc5YOnCQJ04ocbIdVNYdSlZW5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//37lz7mPo3AWV2BiaF7TA6ZWqL5u.jpg', 'https://www.youtube.com/embed/', 179, '1961', 4.02, 1),
(822, 'India', 'The Music Room', 'A wealthy landlord who lives a decadent life with his wife and son. His passion - his wife would call it his addiction - is music, and he spends a great deal of his fortune on concerts held for the locals in his magnificent music room. He feels threatened by his neighbour, a commoner who has attained riches through business dealings. His passion for music and quest for social respect are his undoing, as he sacrifices his family and wealth trying to retain it.', 'Arora', 'https://image.tmdb.org/t/p/w1280/nB1mkxQKFRlAUkW8klmXrbs55zo.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gLe36kc0Qbe0JIkVKEGvy7hvAwO.jpg', 'https://www.youtube.com/embed/', 100, '1958', 3.75, 1),
(823, 'Japan', 'Jin-Roh : La brigade des loups', 'L\'histoire prend place dans un Japon totalitaire, juste après une Seconde Guerre mondiale où l\'Allemagne nazie aurait envahi l\'archipel, qui aurait poursuivi une dérive fascisante post-nazie. La POSEM (POlice de SEcurité Metropolitaine), dont les panzers, une brigade d\'élite de répression lourdement armée, aux équipements et au casques rappelant les soldats de la Wehrmacht, tente d\'étouffer un début de guerre civile menée par un groupe terroriste. Lors d\'une émeute, le lieutenant Kazuki Fuse, une jeune recrue de cette brigade, va être confronté à une très jeune terroriste, « un petit Chaperon Rouge », transportant une bombe dans les égouts.', 'Bandai Visual', 'https://image.tmdb.org/t/p/w1280/lYhn2cHRF9mYw5LsGyVYPqUBELr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gmPigAhU57VgrV0ucBOvQkRpoCG.jpg', 'https://www.youtube.com/embed/leTBtP_pUm0', 102, '1999', 3.7, 1),
(824, 'Australia', 'Moulin Rouge !', 'À la fin du XIXe siècle, dans le Paris de la Belle Époque, Christian, un jeune poète désargenté, s\'installe dans le quartier de Montmartre. Il découvre un univers où se mêlent sexe, drogue et french cancan, mais se rebelle contre ce milieu décadent en menant une vie de bohème. Christian rêve d\'écrire une grande pièce, et le peintre Henri de Toulouse-Lautrec est prêt à lui donner sa chance. Celui-ci a besoin d\'un spectacle grandiose pour le Moulin Rouge et le poète est embauché pour rédiger le livret de la revue. C\'est là qu\'il tombe amoureux de la courtisane Satine, la star du prodigieux cabaret....', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/eAicfZA6ntU329w8ewwoP0IDGjk.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//19TLetNUXW9PjggtZBxr9lInTqL.jpg', 'https://www.youtube.com/embed/ASxyB5LElV8', 126, '2001', 3.79, 1),
(825, 'United States of America', 'La Carte du cœur', 'A travers l\'histoire d\'un groupe d\'individus, de milieux et d\'âges différents, ce film montre comment l\'amour sous toutes ses formes - romantique, familial, l\'amour de son prochain ou l\'amour de soi-même - influence nos vies. \"La Carte du coeur\" est une exploration de l\'amour et des émotions qu\'il peut provoquer : extase, douleur, rire, peur ou rédemption.', 'Morpheus', 'https://image.tmdb.org/t/p/w1280/3neHR1oPnC0OpcYhLn0TEdSHoEp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//31hKau6i2AqCUHubvl82f111jgo.jpg', 'https://www.youtube.com/embed/', 121, '1998', 3.3, 1),
(826, 'United Kingdom', 'The Bridge on the River Kwai', 'The classic story of English POWs in Burma forced to build a bridge to aid the war effort of their Japanese captors. British and American intelligence officers conspire to blow up the structure, but Col. Nicholson , the commander who supervised the bridge\'s construction, has acquired a sense of pride in his creation and tries to foil their plans.', 'Horizon Pictures', 'https://image.tmdb.org/t/p/w1280/7paXMt2e3Tr5dLmEZOGgFEn2Vo7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cX4xeWZ0DebcpFoxCXeKbBOZQs4.jpg', 'https://www.youtube.com/embed/Mbogb3fw9BM', 161, '1957', 3.91, 1),
(827, 'France', 'Diabolique', 'The cruel and abusive headmaster of a boarding school, Michel Delassalle, is murdered by an unlikely duo -- his meek wife and the mistress he brazenly flaunts. The women become increasingly unhinged by a series of odd occurrences after Delassalle\'s corpse mysteriously disappears.', 'Véra Films', 'https://image.tmdb.org/t/p/w1280/pNcwhz3Eyfn3KQ2XykTozbARMpr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oMpX8thZFDVZNS4j240HYSMMvyg.jpg', 'https://www.youtube.com/embed/bavW-HjHCGQ', 117, '1955', 3.94, 1),
(828, 'United States of America', 'Le Jour où la Terre s\'arrêta', 'Une soucoupe volante atterrit sur Terre. Alors qu\'on les croyait hostiles, les extraterrestres sont en fait porteurs d\'un message de paix pour l\'humanité.', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/ph3ZC6Yfs9tvIM9xWkxQHUsDTjg.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3cxXe9mLoMiIeBxvjRh4lcC2TuK.jpg', 'https://www.youtube.com/embed/', 92, '1951', 3.75, 1),
(829, 'United States of America', 'Chinatown', 'Gittes, détective privé, reçoit la visite d’une fausse Mme Mulwray, qui lui demande de filer son mari, ingénieur des eaux à Los Angeles. Celui‐ci est retrouvé mort, noyé. Gittes s’obstine dans son enquête, malgré les menaces de tueurs professionnels.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/xW9t98UyCmxyHMBKEzEuuDMUgcG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bsoAg22remHKL5O0xJH0m9DX6Pu.jpg', 'https://www.youtube.com/embed/', 130, '1974', 3.96, 1),
(830, 'United States of America', 'Planète interdite', 'Au XXIIe siècle, le vaisseau spatial C 57 D se pose sur la lointaine planète Altaïr 4. Une expédition dirigée par le commandant Adams vient enquêter sur la disparition, vingt années plus tôt, du navire spatial Bellérophon et de son équipage. Les explorateurs sont accueillis par Robby, un robot ultra perfectionné qui les conduit jusqu\'à la formidable demeure de l\'énigmatique Docteur Morbius. Celui-ci, avec sa fille Altaira est le seul survivant de l\'expédition précédente qui a été décimée par une force inconnue... Le Docteur Morbius explique qu\'il a découvert qu\'il y a plusieurs milliers d\'années, la planète était habitée par des êtres à l\'intelligence exceptionnelle, les Krells, qui ont mystérieusement disparu, laissant derrière eux des traces de leur civilisation : un cube gigantesque de plusieurs kilomètres de côté capable de fournir une énergie incommensurable.', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/iQbiHCMKL1ibv0yekalFpOMCPDt.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9EUmwXS6EbY5djAhLtBGzUbBwNV.jpg', 'https://www.youtube.com/embed/', 99, '1956', 3.64, 1),
(831, 'United States of America', 'Les Survivants De l\'Infini', 'Lorsque le scientifique Charles Meacham, spécialisé en transmutation, reçoit d\'étranges condensateurs miniaturisés et un guide de montage, sa curiosité le pousse à suivre les instructions. Il construit un \"interociteur\", appareil de vidéotransmission sophistiqué. Le professeur Exeter y apparait, l\'invitant à venir travailler sur un projet spécial. Il ne se doute pas que cet étrange personnage vient de la planète Métaluna, en guerre contre les Zahgons…', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/iAjTzqhowMiYLAFznz0B80E7fVG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//inQQLXDOkb3jwDqNqHF8Lnel6yU.jpg', 'https://www.youtube.com/embed/', 87, '1955', 2.99, 1),
(832, 'Germany', 'M le maudit', 'Toute la presse ne parle que de ça : le maniaque tueur d’enfants, qui terrorise la ville depuis quelques temps, vient de faire une nouvelle victime. Chargé de l’enquête, le commissaire Lohmann multiplie les rafles dans les bas-fonds. Gênée par toute cette agitation la pègre décide de retrouver elle-même le criminel : elle charge les mendiants et les clochards de surveiller chaque coin de rue…', 'Nero-Film AG', 'https://image.tmdb.org/t/p/w1280/6ggCgD8LLGT3rGukHdTxFWna1qq.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//r8Un26Y8GhcIdtmVZVnUOccnHaj.jpg', 'https://www.youtube.com/embed/ssdtn60srNc', 110, '1931', 4.05, 1),
(833, 'Italy', 'Umberto D.', 'Fonctionnaire à la retraite, Umberto D. ne parvient plus à subvenir à ses besoins. Ayant pour seul refuge une pension en piteux état, il occupe ses journées à chercher de l\'argent, accompagné par son fidèle chien Flike.', 'Amato Film', 'https://image.tmdb.org/t/p/w1280/mbkQ4A04Er9WJNudlVZH5HS8IMf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oHL7gjqFgxHiwm45hqj4Xou9Odg.jpg', 'https://www.youtube.com/embed/uAgrq1_UOOc', 89, '1952', 3.94, 1),
(834, 'United States of America', 'Underworld 2 : Évolution', 'La lutte millénaire que se livrent vampires et lycans est sur le point de connaître un tournant décisif… Pour avoir découvert le secret du massacre de sa famille, Sélène, la redoutable guerrière vampire, est plus que jamais seule et menacée. Ses véritables ennemis ne sont pas forcément ceux qu\'elle croyait. Michael, devenu le premier hybride à la fois vampire et lycan, aimerait se joindre à elle, mais il est incapable de contrôler la part lycan qui fait rage en lui. Pour chacun d\'eux, il est temps de percer le mystère de leurs origines et de la guerre, mais dans cette quête de vérité, ils devront affronter les plus puissants des adversaires, les plus proches aussi... Plus que jamais, au plus profond des ténèbres, loin du regard des hommes, se joue le sort du monde...', 'Screen Gems', 'https://image.tmdb.org/t/p/w1280/lfTRmqf0rQ101evfT0u5KK9JhJj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kIZzOU6ZSbcyejTK0c5BBeF3YfD.jpg', 'https://www.youtube.com/embed/7jHxESgl9qA', 106, '2006', 3.28, 1),
(850, 'United States of America', 'A Christmas Story', 'Ralphie a un unique souhait pour Noël, celui de se faire offrir la fameuse carabine à double action de Red Ryder. Se heurtant à l\'opposition de ses parents, il décide de s\'adresser directement au Père Noël.', 'Christmas Tree Films', 'https://image.tmdb.org/t/p/w1280/f3VITMLSmP3Ai65AvXT54RcF5Sw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7hJ54hwwdUMODmE7OUbRwlFNtFk.jpg', 'https://www.youtube.com/embed/', 94, '1983', 3.65, 1),
(851, 'United Kingdom', 'Brève rencontre', 'Dans le café-buffet de la gare de Milford, un homme et une femme se disent adieu. Troublée par l’arrivée fortuite d’une amie encombrante, Laura, la femme, fait un malaise au moment où l’homme la quitte pour prendre son train. De retour à la maison, elle passe la soirée en compagnie de son mari et imagine secrètement qu’elle lui confesse sa liaison…', 'Cineguild', 'https://image.tmdb.org/t/p/w1280/hQeYRminEHQMpEJxPTLqCU4sXZT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vKvoOlhhaZCsiGQDvaZQqyGq1oA.jpg', 'https://www.youtube.com/embed/', 86, '1945', 3.89, 1),
(852, 'Germany', 'Ça s\'est passé en plein jour', 'Suisse, canton de Berne. Une fillette de sept ans est découverte assassinée après avoir été violée. C’est la septième victime en un an. La police arrête un colporteur auquel elle extorque des aveux, sur lesquels il se rétracte le lendemain avant de se pendre dans sa cellule. Cette erreur judiciaire révolte un policier proche de la retraite qui décide de reprendre l’enquête. Celle-ci le mène sur une route nationale que semble emprunter régulièrement un suspect qui distribue aux fillettes des chocolats aux amandes en forme de châtaignes. Sur cette route nationale, le policier loue une station service vacante et y installe une mère et sa fillette comme appât.', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/dw5zqCbaaCtKxG2pRdSK8RIqwxv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bxqh93Hx4kxmiSDV0HBYuHvFbCX.jpg', 'https://www.youtube.com/embed/', 95, '1958', 3.65, 1),
(853, 'France', 'Stalingrad', 'Durant la Seconde Guerre mondiale, en septembre 1942, Hitler envisage d\'envahir Stalingrad, ville clé de l\'URSS qui le sépare de la victoire totale sur l\'Europe. Les Russes se préparent à la défensive. Un héros aiderait à motiver les troupes. Entre alors en jeu Vassili Zaitsev, un jeune tireur d\'élite de l\'Armée Rouge. Doué d\'une stupéfiante adresse au tir, il est remarqué par un commissaire au peuple, Ivan Danilov. Les deux jeunes gens deviennent amis. Ranimer la flamme de l\'héroïsme, redonner aux soldats décimés la force de lutter contre l\'implacable machine de guerre allemande, telle est la mission de Danilov. Celui-ci fait de Vassili le héros de sa propagande. Dans le camp ennemi, l\'état-major dépêche son meilleur tireur d\'élite, le Major König, pour abattre celui qui est devenu le symbole de l\'indomptable résistance russe.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/fnlyfRaAnOlLeQoYNH9agyu4Ues.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pnEMDuaZeDXUQPPhhGTo9QMfMeA.jpg', 'https://www.youtube.com/embed/xqwlIaOyBSA', 131, '2001', 3.69, 1),
(854, 'United States of America', 'The Mask', 'Stanley Ipkiss, modeste employé de banque, passionné par l’univers de Tex Avery, trouve un masque ancien aux pouvoirs surnaturels. Il est néanmoins partagé entre devenir cette créature verte sûre d’elle ou rester le timide Stanley Ipkiss, incapable d’aborder la magnifique chanteuse de cabaret Tina Carlyle.', 'Dark Horse Entertainment', 'https://image.tmdb.org/t/p/w1280/5OBK9sksRSyrwrcMtxpdxql75Sw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bdhA6nWf5IIyfiGjdegYPu0iK9e.jpg', 'https://www.youtube.com/embed/75KwhmFq_cs', 100, '1994', 3.46, 1),
(855, 'United Kingdom', 'La Chute du faucon noir', 'Le 3 octobre 1993, avec l\'appui des Nations Unies, une centaine de marines américains de la Task Force Ranger est envoyée en mission à Mogadiscio, en Somalie, pour assurer le maintien de la paix et capturer les deux principaux lieutenants et quelques autres associés de Mohamed Farrah Aidid, un chef de guerre local. Cette opération de routine vire rapidement au cauchemar lorsque les militaires sont pris pour cibles par les factions armées rebelles et la population, résolument hostiles à toute présence étrangère sur leur territoire.', 'Jerry Bruckheimer Films', 'https://image.tmdb.org/t/p/w1280/8PbLgvdfcdBad3sie9cfIBHq2Xz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dd11uT1rtjQfEwEAvWiNfXgzXtD.jpg', 'https://www.youtube.com/embed/p4LHBu5prOI', 143, '2001', 3.68, 1),
(856, 'United States of America', 'Qui veut la peau de Roger Rabbit ?', 'A Hollywood, en 1947, les personnages de dessins animés, ont leur propre ville, Toon Town. Roger Rabbit, un lapin vedette, soupçonne sa femme, la pulpeuse Jessica, de le tromper. Pour le faire revenir dans le droit chemin, le producteur R.K. Maroon décide de prouver l\'infidélité de Jessica. Il engage Eddie Valiant, un détective privé humain et alcoolique, qui voue une haine féroce aux Toons.', 'Amblin Entertainment', 'https://image.tmdb.org/t/p/w1280/mfLqkzlCKXqgCaMb13krofTEKGW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tym6NH7ybFeldBuYYp0RSLpjZFq.jpg', 'https://www.youtube.com/embed/7T_oQ3dxrAQ', 103, '1988', 3.75, 1),
(857, 'United States of America', 'Il faut sauver le soldat Ryan', 'Alors que les forces alliées débarquent à Omaha Beach, Miller doit conduire son escouade derrière les lignes ennemies pour une mission particulièrement dangereuse : trouver et ramener sain et sauf le simple soldat James Ryan, dont les trois frères sont morts au combat en l’espace de trois jours. Pendant que l’escouade progresse en territoire ennemi, les hommes de Miller se posent des questions. Faut‐il risquer la vie de huit hommes pour en sauver un seul ?', 'Paramount', 'https://image.tmdb.org/t/p/w1280/uLbBoC6QzfKibKf7Y5u78DR62Rz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bdD39MpSVhKjxarTxLSfX6baoMP.jpg', 'https://www.youtube.com/embed/kHljZ-ShIAE', 163, '1998', 4.1, 1),
(858, 'United States of America', 'Sleepless in Seattle', 'When Sam Baldwin\'s wife dies, he is left to bring up his eight-year-old son Jonah alone, and decides to move to Seattle to make a new start. On Christmas Eve, Jonah rings a radio phone-in with his Christmas wish to find a new wife for his dad. Meanwhile in Baltimore, journalist Annie Reed, who is having doubts about her own relationship, is listening in.', 'TriStar Pictures', 'https://image.tmdb.org/t/p/w1280/iLWsLVrfkFvOXOG9PbUAYg7AK3E.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fROgQIALHJEmayqLITFHhOMW3ef.jpg', 'https://www.youtube.com/embed/XACtsPeHvxA', 105, '1993', 3.36, 1),
(859, 'United Kingdom', 'Les Liaisons dangereuses', 'Deux aristocrates brillants et spirituels, la marquise de Merteuil et le séduisant Vicomte de Valmont, signent un pacte d\'inviolable amitié à la fin de leur liaison. C\'est au nom de celui-ci que la marquise demande à Valmont de séduire la candide Cécile de Volanges qui doit prochainement épouser son ex-favori, M. de Bastide. Mais Valmont a entrepris de séduire la vertueuse Mme de Tourvel.', 'Lorimar Film Entertainment', 'https://image.tmdb.org/t/p/w1280/t8DdLi4Q1JqnCg11hX1eEmQkRRU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aFZS4Zyhi7FqIiv9M8CrmmkF5IR.jpg', 'https://www.youtube.com/embed/HP_J8nnkBT8', 119, '1988', 3.62, 1),
(860, 'United States of America', 'WarGames', 'En pleine guerre froide, un adolescent pirate sans le savoir le système informatique militaire américain géré par une intelligence artificielle qui se prend dangereusement au jeu d\'une guerre thermonucléaire globale contre le bloc de l\'Est...', 'United Artists', 'https://image.tmdb.org/t/p/w1280/9lR8GWwuYJa756KsUGEXCElcKBS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qtamfYGFfDLfGRcucx1zNwohRts.jpg', 'https://www.youtube.com/embed/tAcEzhQ7oqA', 114, '1983', 3.54, 1),
(861, 'United States of America', 'Total Recall', '2048, Doug Quaid rêve chaque nuit qu’il est sur la planète Mars à la recherche de la belle Melina. Sa femme, Lori, s’efforce de dissiper ce fantasme. Doug va bientôt s’apercevoir que son rêve était artificiel et que sa femme est une espionne chargée de veiller à son reconditionnement mental. Il se souvient d’un séjour réel sur Mars, à l’époque où il était l’agent le plus redouté du cruel Coohagen. Il décide de s’envoler sur Mars à la recherche de son énigmatique passé.', 'Carolco Pictures', 'https://image.tmdb.org/t/p/w1280/5hHXAjyM2vSBL5n92eJXdG9j8WR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cE9Gtz5KEVkien4VDSgXjtwfcs.jpg', 'https://www.youtube.com/embed/3kOyRb7AwiM', 113, '1990', 3.64, 1),
(862, 'United States of America', 'Toy Story', 'Dans un monde où les jouets vivent leur vie quand les humains ne sont pas présents, Toy Story emmène les spectateurs dans un voyage fantastique vu principalement par les yeux de deux rivaux : Woody, un cow-boy, et Buzz l\'Éclair, un ranger de l’espace. Ce duo va devoir apprendre à mettre ses différences de côté et s\'allier, lorsqu’il sera séparé de son propriétaire Andy.', 'Pixar', 'https://image.tmdb.org/t/p/w1280/4cWLRhub0yY9VJpdw0nqoTPYyiN.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3Rfvhy1Nl6sSGJwyjb0QiZzZYlB.jpg', 'https://www.youtube.com/embed/U5tEQCiTzTY', 81, '1995', 3.98, 1),
(863, 'United States of America', 'Toy Story 2', 'Andy part en colonie de vacances et laisse ses jouets à la maison. Les choses se gâtent quand le collectionneur Al McWhiggin kidnappe Woody. Dans l’appartement d’Al, Woody découvre qu’il est un objet de collection d’une émission des années 50, il rencontre d’autres jouets : Jessie, Pile-Poil, Papi Pépite. Buzz et les autres vont tenter de sauver Woody, avant qu’il ne devienne une pièce de musée.', 'Pixar', 'https://image.tmdb.org/t/p/w1280/ipsb2wEqz9W1IWdojd7GI1rq8uu.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//91qfG6VaxRsCh1SbIi1w2vxknsL.jpg', 'https://www.youtube.com/embed/2FlAUxq1MUU', 92, '1999', 3.8, 1),
(864, 'United States of America', 'Cool Runnings', 'When a Jamaican sprinter is disqualified from the Olympic Games, he enlists the help of a dishonored coach to start the first Jamaican bobsled team.', 'Walt Disney Pictures', 'https://image.tmdb.org/t/p/w1280/6fXuGEb7EqGmAeUodxm7l5ELPZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2Y0lMMmfbpMbVMgc86oi8o5cFQX.jpg', 'https://www.youtube.com/embed/y1gzxdjcjxA', 98, '1993', 3.49, 1),
(865, 'United States of America', 'Running Man', 'Los Angeles, 2019 : les USA sont sous la coupe d’une dictature qui a réduit les libertés publiques à néant et qui, grâce à des programmes télévisés bassement démagogiques, parvient à conditionner le comportement populaire. Le jeu‐vedette, suivi avec passion par le pays entier, s’appelle « The Running Man ».', 'Braveworld Productions', 'https://image.tmdb.org/t/p/w1280/qP04x5gJOXFKPeU6Eo5vu9PNgWz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sCTD23P22WTILZlClKyC4bKRfYe.jpg', 'https://www.youtube.com/embed/pkAN5rGGP1M', 101, '1987', 3.26, 1),
(866, 'United Kingdom', 'Neverland', 'Londres au début du XXe siècle, J. M. Barrie auteur de pièces de théâtre est en manque d’inspiration. Son mariage ne va pas bien, sa dernière pièce est un désastre. Mais alors qu’il est dans le parc avec son chien Porthos, il rencontre Mme Sylvia Llewelyn Davies, qui est veuve, et ses 4 garçons. Une amitié très forte naît entre J. M. Barrie, les 4 enfants et leur mère.', 'Miramax', 'https://image.tmdb.org/t/p/w1280/uIBeUKLW74zCcOFiIzonbkcdZZZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sBsnLIrB0UdB7gBdmw5iJ9L1ltK.jpg', 'https://www.youtube.com/embed/m41gObaKgOw', 101, '2004', 3.66, 1),
(867, 'United States of America', 'Sliver', 'A woman moves into an apartment in Manhattan and learns that the previous tenant\'s life ended mysteriously after they fell from the balcony.', 'Robert Evans Company', 'https://image.tmdb.org/t/p/w1280/g7PC2e2KqDkIfOoJx9iXJJez99d.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fwreQBx5CD55c1DpH117cS8915P.jpg', 'https://www.youtube.com/embed/rdSIyG6euDY', 108, '1993', 2.73, 1),
(868, 'South Africa', 'Mon nom est Tsotsi', 'Dans un bidonville aux abords de Johannesburg, en Afrique du Sud, un jeune homme de 19 ans orphelin a occulté tout souvenir de son passé, jusqu\'à son propre nom. Il s\'appelle donc Tsotsi, qui signifie \"voyou\", \"gangster\" dans le jargon des ghettos. Sans nom, sans passé, sans ambition, il n\'existe que dans un présent plein de colère.Il dirige une bande de marginaux : Boston, un instituteur raté ; Boucher, un meurtrier de sang-froid ; et Gorille, un costaud à l\'intelligence très moyenne. Lors d\'une soirée arrosée, Tsotsi tabasse Boston dans un accès de violence extrême, puis il disparaît dans la nuit, traverse le bidonville et se retrouve dans une banlieue aisée.Une femme descend de sa BMW et tente en vain d\'ouvrir le portail de sa maison. Tsotsi sort son arme, l\'agresse, tire et s\'échappe avec la voiture. Un enfant pleure sur la banquette arrière...', 'Movieworld Productions', 'https://image.tmdb.org/t/p/w1280/zBeD7MTd8dIPV4BZivpNupmcLgG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//v9yXidPSqTjTDutxcBTnRqfDSpO.jpg', 'https://www.youtube.com/embed/', 94, '2005', 3.44, 1),
(869, 'United States of America', 'La Planète des singes', 'En 2029, un groupe d\'astronautes entraîne sur la station orbitale Oberon des singes pour remplacer l\'homme dans des explorations spatiales à haut risque. Suite à la réception d\'étranges signaux, les astronautes envoient le chimpanzé Pericles afin d\'en connaître l\'origine. Toutes les communications entre le primate et la station sont subitement interrompues et le vaisseau disparaît des radars. Désobéissant à ses supérieurs, Leo Davidson embarque dans un des vaisseaux expérimentaux pour aller porter secours à Pericles. Tout comme lui, il perd le contrôle des commandes et s\'écrase dans les marais d\'une forêt tropicale. L\'intrépide pilote voit alors un groupe d\'humains affolés foncer droit sur lui, et se fait capturer par des chimpanzés parlants. Qu\'est-il arrivé sur cette planète pour que des singes en viennent à dominer la race humaine ?', 'Tim Burton Productions', 'https://image.tmdb.org/t/p/w1280/yqhsaHw8bAxQMIenDGxkWqb0Gn2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rF0Y0fYVsNFEvGve8Nq0Ij9EDCM.jpg', 'https://www.youtube.com/embed/', 120, '2001', 2.85, 1),
(870, 'Japan', 'Dolls', 'Dolls takes puppeteering as its overriding motif, which relates thematically to the action provided by the live characters. Chief among those tales is the story of Matsumoto and Sawako, a young couple whose relationship is about to be broken apart by the former\'s parents, who have insisted their son take part in an arranged marriage to his boss\' daughter.', 'TV Tokyo', 'https://image.tmdb.org/t/p/w1280/rEFj0GCEnIJwpyjF0IwknSdFI0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xbHQmiHIvT3xQzmpRYZ6p0lLp7v.jpg', 'https://www.youtube.com/embed/jKoDf0Yrphw', 114, '2002', 3.79, 1),
(871, 'United States of America', 'La Planète des singes', 'Égaré dans l\'espace-temps, un engin spatial américain s\'écrase en 3978 sur une planète inconnue. Les astronautes Taylor, Landon et Dodge découvrent que les hommes primitifs de cette planète mystérieuse sont placés sous le joug de singes très évolués.', 'APJAC Productions', 'https://image.tmdb.org/t/p/w1280/vh1LU9aCThFJncCfqyveX1SFtDW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dQS3L3USI7Zhcq41abzMZF8dXCm.jpg', 'https://www.youtube.com/embed/mlMDFedpi4M', 112, '1968', 3.82, 1),
(872, 'United States of America', 'Chantons sous la pluie', 'Les films muets laissent place aux films parlants - et le danseur devenu chanteur (Gene Kelly) est lui aussi pris dans cette transition compliquée, tout comme son ami (Donald O’Connor), sa petite amie (Debbie Reynolds) et sa désagréable co-star (Jean Hagen).', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/wPX0ZU7cGRZKJjnyeTqK7bTETTv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//g7KmJaGFvST5cyvA71V6epKAqIC.jpg', 'https://www.youtube.com/embed/A8dGhZ91Qhk', 103, '1952', 4.08, 1),
(873, 'United States of America', 'La Couleur pourpre', 'Début du XXe siècle. Au cœur de la communauté noire du sud des États-Unis, Celie et Nettie, deux sœurs, vivent avec leur beau-père. Celui-ci veut se débarrasser de Celie et l\'offre à Albert, un veuf tyrannique qui l\'emmène vivre chez lui…', 'Amblin Entertainment', 'https://image.tmdb.org/t/p/w1280/nvO4QWbOjI3QjUGvhAgzDhlQY0Q.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rhMpAPvoy1beXd8gA6CvYoCSztj.jpg', 'https://www.youtube.com/embed/n7GFt8VMcRs', 154, '1985', 3.88, 1),
(874, 'United Kingdom', 'Un Homme pour l\'éternité', 'En 1529, Thomas More, juriste britannique, succède au cardinal Wolsey comme chancelier d\'Henri VIII. D\'amis que sont le roi et son ministre, ils vont devenir ennemis du fait du refus de Thomas de consentir au remariage du roi. Thomas ira jusqu\'au martyre, avec prudence et sans fanatisme.', 'Highland Films', 'https://image.tmdb.org/t/p/w1280/5xEGVD4rx4kOqkJsD3BJYKv6hYK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4WPdeIyF35N4Enppd7UCiEGo8s3.jpg', 'https://www.youtube.com/embed/', 120, '1966', 3.67, 1),
(875, 'United States of America', 'Shanghai Express', 'A beautiful temptress re-kindles an old romance while trying to escape her past during a tension-packed train journey.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/l59j7Mdfry4Mbxvpo68qTG8Y4GY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yW9OHnJKeHzo7OP1t8E1hvyInmt.jpg', 'https://www.youtube.com/embed/i86Hc6AAVt4', 82, '1932', 3.47, 1),
(877, 'United States of America', 'Scarface', 'In 1920s Chicago, Italian immigrant and notorious thug, Antonio \"Tony\" Camonte, shoots his way to the top of the mobs while trying to protect his sister from the criminal life.', 'The Caddo Company', 'https://image.tmdb.org/t/p/w1280/y4E5oRiHMTFkEB12IIcpbKbKzDW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bIv1kaxb7tsiZYPO27PHfVb5eSF.jpg', 'https://www.youtube.com/embed/bwK-6utq2hM', 93, '1932', 3.74, 1),
(878, 'Germany', 'Ce diable de garçon', '', 'Deutsche Filmvertriebs GmbH', 'https://image.tmdb.org/t/p/w1280/yPklnEcziGaLCetKtLSwEJrecBe.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kXbW6BKF2tL0aI7a9RsfJ5w4FhP.jpg', 'https://www.youtube.com/embed/', 97, '1944', 3.56, 1),
(879, 'United States of America', 'Hook ou la Revanche du capitaine Crochet', 'Peter Banning alias Peter Pan est devenu un brillant avocat d\'affaires qui a tout oublié de ses merveilleuses aventures. Mais le terrible Capitaine Crochet, lui, n\'a pas oublié. Pour enfin, régler leur compte, il enlève une nuit Jack et Maggie, les enfants de Peter. C\'est en compagnie de Tinkerbell que Peter s\'envole à nouveau pour le pays de Nulle Part.', 'Amblin Entertainment', 'https://image.tmdb.org/t/p/w1280/w6SoK7KVC4bzv3Upnk7TWqjYe1S.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//x5VGdEBBGuhA0YRlk6dFFxGcamG.jpg', 'https://www.youtube.com/embed/a4LdM6DYTZw', 136, '1991', 3.41, 1),
(880, 'Netherlands', 'Antonia et ses filles', '', 'Bergen Film', 'https://image.tmdb.org/t/p/w1280/nUCVi6bBIL7LGC61nYaCqikAhIA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sOkUBkwq21ZEThCX7wboY2Xl3m5.jpg', 'https://www.youtube.com/embed/', 102, '1995', 3.55, 1),
(881, 'United States of America', 'Des hommes d\'honneur', 'Deux jeunes marines, Louden et Dawson, abattent, au cours d\'une action disciplinaire désignée \"Code Rouge\", un de leur leurs camarades, Santiago. C\'est le lieutenant Daniel Kaffee qui est désigné pour assurer leur défense lors de leur procès. Mais si Kaffee entame une défense de pure routine, sa jeune et pugnace adjointe, le lieutenant JoAnne Galoway, se rebiffe et l\'oblige a instruire le dossier. Kaffee va devoir, pour découvrir la vérité sur cette affaire qui s\'avère inquiétante, remonter jusqu\'au sommet de la hiérarchie.', 'David Brown Productions', 'https://image.tmdb.org/t/p/w1280/n8mKc5XZ94s291KVrc28sb1IKiV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//H40nWdJngUc6gtytMAbElm9HOu.jpg', 'https://www.youtube.com/embed/N8xC1s4K82o', 138, '1992', 3.76, 1),
(882, 'Germany', 'Flussfahrt mit Huhn', 'Au cours de l\'été sur la terre de leur grand-père, Johanna, Robert, Harald et Alex décident d\'un voyage secret jusqu\'à la rivière sur un bateau à la recherche d\'une nouvelle voie vers la mer du Nord de l\'Allemagne. Film d\'aventure pour enfants, un classique allemand.', 'Frankfurter Filmwerkstatt GmbH', 'https://image.tmdb.org/t/p/w1280/mVtXEfo2bTAlbHkaSjTgruDQ5Xw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aM4H6RiysXEUwZ7ux0aO5lFwp6P.jpg', 'https://www.youtube.com/embed/', 103, '1984', 3, 1),
(883, 'United States of America', 'Coffee and Cigarettes', 'Coffee and Cigarettes est une collection de onze court-métrages du réalisateur culte Jim Jarmusch. Chaque film accueille un groupe de stars qui partagent tous le plaisir de la conversation autour d\'un café et de cigarettes.', 'Smokescreen Inc.', 'https://image.tmdb.org/t/p/w1280/pfG02QCsutx3PIxFS8UY4iM9AsS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//riKGYv1afrSTggw4lKXusjToqYG.jpg', 'https://www.youtube.com/embed/', 96, '2003', 3.5, 1),
(884, 'Canada', 'Crash', 'James et Catherine Ballard, un couple dont la vie sexuelle s\'essouffle quelque peu, va trouver un chemin nouveau et tortueux pour exprimer son amour grace aux accidents de voiture. A la suite d\'une violente collision, ils vont en effet se lier avec des adeptes des accidents...', 'Alliance Communications', 'https://image.tmdb.org/t/p/w1280/1BmzdzhfeXJ4rxRLSSp2X1FrySa.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//li7EvrNoX5MoqK4WQXONsSUDjH1.jpg', 'https://www.youtube.com/embed/XY7mcGOh0ws', 100, '1996', 3.23, 1),
(885, 'United States of America', 'The Docks of New York', 'A blue-collar worker on New York\'s depressed waterfront finds his life changed after he saves a woman attempting suicide.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/rCMZpfPAHeuy02nMCttEX3OJt4B.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uLgeOKqBF7PIn9Dz3oa5TSY8k3s.jpg', 'https://www.youtube.com/embed/', 76, '1928', 3.57, 1),
(886, 'United States of America', 'Le Kid de Cincinnati', 'A la Nouvelle Orléans, dans les années 1930, le Kid est un champion de poker à la réputation faite. Lorsque Larsey Howard, dit Le King, arrive en ville à la recherche de nouveaux adversaires à sa taille, le Kid y voit la chance de battre un maître du jeu...', 'Filmways Pictures', 'https://image.tmdb.org/t/p/w1280/ofNWOwLN3rDvtutvw7Mueu4UGXx.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zPKm9BMAXd4P1q8oSyWFLOQTfZI.jpg', 'https://www.youtube.com/embed/', 102, '1965', 3.53, 1),
(887, 'United States of America', 'Les Plus Belles Années de notre vie', 'En 1945, trois soldats démobilisés, le sergent d\'infanterie Al Stephenson, le capitaine d\'aviation Fred Derry et le marin Homer Parrish, font connaissance dans l\'avion qui les ramène à Boone City, leur ville natale. Leurs sentiments sont partagés entre l\'impatience et l\'appréhension. Ils ne tardent pas à reprendre contact avec la réalité quotidienne...', 'Samuel Goldwyn Productions', 'https://image.tmdb.org/t/p/w1280/6lIxkUOA76EklnH2kCvi6j8zQQK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nCl5KzxUs4rVVlAdixDf4r5AbbZ.jpg', 'https://www.youtube.com/embed/', 172, '1946', 3.92, 1),
(888, 'United States of America', 'La Famille Pierrafeu', 'Dans un petit village préhistorique, les familles Pierrafeu et Rubble sont les meilleures amies du monde. Après avoir gagné un concours grâce aux Rubble, Fred Pierrafeu est promu bras droit de son patron et est contraint de prendre des décisions à l\'encontre de ses amis. Fred ignore qu\'il est alors victime des plans machiavéliques de son patron...', 'Hanna-Barbera Productions', 'https://image.tmdb.org/t/p/w1280/bAJRDK2qykEmSBh3EbXx8435mau.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ge7Ut4a2ly41pCS5nSIjyINoUnp.jpg', 'https://www.youtube.com/embed/pMnEbfzllso', 91, '1994', 2.66, 1),
(889, 'United States of America', 'Les Pierrafeu à Rock Vegas', 'Fred Pierrafeu, grutier diplômé de l\'académie Bronto Crane, passe ses journées à concasser, charger et entasser de gros cailloux. Fièrement juché sur sa grue, ce brave ouvrier au sourire épanoui inspire d\'emblée confiance et sympathie. Seule ombre au tableau : le manque de femmes qui rend parfois la vie bien triste. A l\'autre bout de l\'échelle sociale, dans le quartier chic de Bedrock City, la blonde Wilma Slaghoople s\'ennuie ferme auprès de sa mère Pearl et de ses copines snobinardes, qui voudraient la convaincre d\'épouser Chip Rockefeller.', 'Amblin Entertainment', 'https://image.tmdb.org/t/p/w1280/wwvDGNQRbdfFfymLFETzN8HLNnV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5TgtoN4NjBsRD8PksQSDdWVjuWC.jpg', 'https://www.youtube.com/embed/Yxz2RS6ehfE', 91, '2000', 2.4, 1),
(890, 'Austria', 'Frère Sommeil', '', 'Dor Film Production Company', 'https://image.tmdb.org/t/p/w1280/xMnI1UauGsAQxoraCiTGEab6jHZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ioOJOynKH49uTRXYhKDgGJkHDud.jpg', 'https://www.youtube.com/embed/', 127, '1995', 3.35, 1),
(891, 'United States of America', 'Les Hommes du président', 'Les journalistes Woodward et Bernstein découvrent certains éléments à l’origine du plus grand scandale politique de l’après‐guerre: l’affaire du Watergate qui força le président Nixon à démissionner…', 'Wildwood Enterprises', 'https://image.tmdb.org/t/p/w1280/oTmgVuywId1bgRv1QTYRcA9Jz2g.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qvLjTAwwQTcAiYXxnGaXctlqUJ6.jpg', 'https://www.youtube.com/embed/5FEhAS1Wmq8', 139, '1976', 3.84, 1),
(892, 'France', 'Delicatessen', 'In a post-apocalyptic world, the residents of an apartment above the butcher shop receive an occasional delicacy of meat, something that is in low supply. A young man new in town falls in love with the butcher\'s daughter, which causes conflicts in her family, who need the young man for other business-related purposes.', 'Victoires Productions', 'https://image.tmdb.org/t/p/w1280/bq18nae4FBPGCB8B2ZhBAEyERjq.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ii6L97z4uzJ1vPTHOnpTgzkvrXs.jpg', 'https://www.youtube.com/embed/', 99, '1991', 3.67, 1),
(893, 'Germany', 'Policewoman', 'Die Polizistin is a documentary by Andreas Dresen about the life of a young police woman who is faced with the difficulties between her responsibilities at work and her personal responsibilities.', 'Westdeutsche Universum-Film GmbH', 'https://image.tmdb.org/t/p/w1280/vlvjjp7WD3K1J5G2lxPoWhU53bk.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 97, '2000', 3.36, 1),
(894, 'Germany', 'Willenbrock', '', 'UFA Filmproduktion GmbH', 'https://image.tmdb.org/t/p/w1280/x7OPrm4GvGGlUDqgBvIH6uQ981F.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7iFUHQKqVlNq48Sr85ls3PndUbC.jpg', 'https://www.youtube.com/embed/', 105, '2005', 3.27, 1),
(895, 'Soviet Union', 'Andreï Roublev', 'En Russie, durant l’été 1400. Trois moines peintres d\'icônes, Kyrill, Daniil et Roublev, désireux de travailler à la décoration de l’église de l’Annonciation de Moscou, se rendent chez le célèbre peintre Théophane le Grec dans l’espoir d\'obtenir sa recommandation. Seule la candidature de Roublev est retenue. Au cours de son voyage, l’homme, qui n’avait illustré jusque-là que la beauté spirituelle, découvre la terrible condition des hommes et s’interroge sur le sens qu’il doit donner à son travail. Huit ans plus tard, Roublev exécute avec Daniil les peintures murales de la cathédrale de la Dormition de Vladimir…', 'Mosfilm', 'https://image.tmdb.org/t/p/w1280/du2c90VR8b8enEmty4RyyKXvKVD.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fKa8Jy2ge1O0IU6zZXnJ2sxUzdU.jpg', 'https://www.youtube.com/embed/', 150, '1966', 4.06, 1),
(896, 'India', 'Le Monde d\'Apu', 'À Calcutta, Apu est un jeune diplômé brillant qui ne trouve pas de travail et tue le temps en écrivant son autobiographie. Alors qu’il assiste à un mariage, l’union est annulée car le futur époux souffre de graves problèmes mentaux. Tous les villageois tentent alors de marier coûte que coûte la fiancée. Apu, bienveillant, accepte de se lier avec elle.', 'Satyajit Ray Productions', 'https://image.tmdb.org/t/p/w1280/i6XxarpLwVBYhpI2kQwouUEjEdJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//d3RW7jRsBCHfC9QZaUF9FpzJrh8.jpg', 'https://www.youtube.com/embed/', 117, '1959', 4.1, 1),
(897, 'India', 'L\'Invaincu', 'Dans le deuxième volet de la trilogie, Apu a 10 ans et est devenu un élève brillant. Il décroche une bourse et part étudier à Calcutta, laissant sa mère déchirée par le chagrin.', 'Epic Productions', 'https://image.tmdb.org/t/p/w1280/vHieklheD2PEJPwRrNUQLbGaA9k.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qDEZmaaAGhEso6kvB5kk1CROPwG.jpg', 'https://www.youtube.com/embed/mgv68E_o6VM', 110, '1956', 3.97, 1),
(898, 'United States of America', 'Le prisonnier d\'Alcatraz', 'Coupable de meurtres, Robert Stroud est condamné à la réclusion à perpétuité dans la sinistre prison d\'Alcatraz. Le forçat supporte difficilement les conditions de vie jusqu\'au jour où il trouve un épervier blessé dans la cour de prison et décide de le soigner. Cet événement insignifiant va pourtant changer sa vie à jamais. Car, en dépit d\'une éducation limitée, le prisonnier va devenir un ornithologue reconnu et donner ainsi, derrière les murs d\'Alcatraz, un extraordinaire sens au mot liberté.', 'Norma Productions', 'https://image.tmdb.org/t/p/w1280/scGgx65zUdzPjI6nrpRCXQjOVnp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4jz7JAgU3DQoQhZTDal6o2odg3Y.jpg', 'https://www.youtube.com/embed/', 147, '1962', 3.75, 1),
(899, 'United States of America', 'Le Lys brisé', 'Dans un quartier pauvre de Londres, une jeune fille, Lucy, est battue par son père, champion de boxe ivrogne et raciste. Un soir, alors qu\'elle erre dans la rue déboussolée et blessée, Cheng Huan, jeune immigré chinois timide et idéaliste, la recueille chez lui. Il prend alors soin d\'elle et en tombe amoureux. Mais le père ne tarde pas à les retrouver…', 'D.W. Griffith Productions', 'https://image.tmdb.org/t/p/w1280/l9rHRp7Yb2PVy5Qd5wUR9coXZoy.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3DW3xHM7FgdE8XzpODbEfvlR9qR.jpg', 'https://www.youtube.com/embed/', 90, '1919', 3.45, 1),
(900, 'United States of America', 'L\'Impossible Monsieur Bébé', 'David Huxley, un paléontologue, est fiancé à sa secrétaire Alice. Susan, rencontrée lors d\'une partie de golf, est également sensible au charme félin de David. Hélas, M. Bébé ne quitte pas la jeune femme d\'une semelle. Enfin, d\'une patte, car M. Bébé est un léopard...', 'RKO Radio Pictures', 'https://image.tmdb.org/t/p/w1280/bIqLibVWopRn1RqRSyS3EvNDTtu.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fzJgCQh2NBnUYlms8EGyr4bPNz3.jpg', 'https://www.youtube.com/embed/', 102, '1938', 3.78, 1),
(901, 'United States of America', 'Les Lumières de la ville', 'Un vagabond s’éprend d’une belle et jeune vendeuse de fleurs aveugle qui vit avec sa mère, couverte de dettes. Suite à un quiproquo, la fleuriste s’imagine le misérable, qui vient de lui acheter une fleur, en milliardaire…', 'Charles Chaplin Productions', 'https://image.tmdb.org/t/p/w1280/osvXWgShaFKDPeKMB751L10qimp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//n0Cju2Eu3VyrUFl32thblHFWznA.jpg', 'https://www.youtube.com/embed/', 87, '1931', 4.17, 1),
(902, 'Belgium', 'La Cité des enfants perdus', 'Krank, un étrange personnage, vit entouré de clones et d\'autres personnages encore plus étranges sur une plate-forme en mer perdue dans le brouillard. Pour ne pas vieillir trop vite, Krank doit voler les rêves des enfants. C\'est pour cela qu\'il les enlève de la cité portuaire.', 'Victoires Productions', 'https://image.tmdb.org/t/p/w1280/68LLyfJQa7lkOfIVwOzcgg4YpJH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//m8mW6Faz4eXPamx0szTiA1cvdbF.jpg', 'https://www.youtube.com/embed/XZUkwd2a0s8', 112, '1995', 3.66, 1),
(903, 'United States of America', 'Luke la main froide', 'Luke Jackson n\'est pas de ceux que l\'on peut dompter facilement. Alors quand il se retrouve en prison, il ne compte pas se laisser dicter quoi que ce soit. Mais d\'évasions en captures, Luke va devoir lutter de toutes ses forces contre une équipe pénitencière qui compte bien le briser...', 'Jalem Productions', 'https://image.tmdb.org/t/p/w1280/5h52u8i31leiMXBGT18xlLDKhUX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yW9mPUhrsIzKvogNJKQKuWO8fJO.jpg', 'https://www.youtube.com/embed/zu9MVydp2Oo', 126, '1967', 3.87, 1),
(904, 'Germany', 'Der Stolz der Firma', '', 'Projektions-AG Union', 'https://image.tmdb.org/t/p/w1280/pK9la4Y3WfcU3VJwcxt6sh1wH0T.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 40, '1914', 5, 1),
(905, 'Germany', 'Loulou', 'Loulou est une jeune femme qui ne s\'encombre d\'aucun préjugé et vit pour l\'amour et le plaisir. Ses amis sont nombreux. Elle en a de tous les âges et de toutes les conditions. Elle est présentement la maîtresse en titre du Dr Schön, propriétaire de plusieurs journaux, qui a aidé sa carrière de danseuse en faisant beaucoup parler d\'elle. Ce jour-là, Schön fait grise mine en annonçant à Loulou son prochain mariage avec la fille du ministre de l\'intérieur.', 'Nero-Film AG', 'https://image.tmdb.org/t/p/w1280/gEuNTHYEbVJx6NOytuKjuDiTUmf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//y3WwIEEDcbT88MxjCjM8mlBEF04.jpg', 'https://www.youtube.com/embed/', 100, '1929', 3.73, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(906, 'Germany', 'The Three from the Filling Station', 'Die Drei von der Tankstelle, meaning The Three from the Gas Station, was advertised as a German operetta when release and with it’s star studded cast would become the forerunner of Musical films. Even today the soundtrack of the comic harmonists is popular in Germany.', 'UFA', 'https://image.tmdb.org/t/p/w1280/7JMa5tn9zdA6rwrU8qbslhEBGWU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yEasywTxSzxXcFQKnYMMPOUSgdS.jpg', 'https://www.youtube.com/embed/', 90, '1930', 3.1, 1),
(907, 'Italy', 'Le Docteur Jivago', 'Jivago, médecin russe idéaliste, est enrôlé de force dans l\'armée au début de la révolution d\'Octobre, qui l\'entraîne dans les remous de l\'histoire.', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/kaXYPAGOrwyeGLEON10qPoKVv6N.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kMdvowuSvAbYfugANje3qUqkbxQ.jpg', 'https://www.youtube.com/embed/DCgdsX3Wfwg', 197, '1965', 3.77, 1),
(908, 'Netherlands', 'Schnitzel Paradise', 'Schnitzel Paradise is a Dutch film about a young Moroccan man working in the kitchen of popular Dutch restaurant.', 'Lemming Film', 'https://image.tmdb.org/t/p/w1280/n6rrJY8pGq7pWZOQeD0UdI0D51o.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sdrjP5FQkhzQE5nQGEWAChEsreI.jpg', 'https://www.youtube.com/embed/WnpSyKmqK2M', 82, '2005', 2.78, 1),
(909, 'United States of America', 'Le Chant du Missouri', 'À Saint-Louis en 1903, alors que la ville prépare l\'Exposition universelle, la famille Smith vit un bonheur sans histoire. Mais un soir, le père de famille annonce qu\'il a obtenu un travail plus avantageux à New York et qu\'il faudra bientôt quitter le Missouri. La mère et les trois filles sont en émoi…', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/9qn0CCzxONe734ynCgRxjuC0cIz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fQ93o3wVSIe0dXMLTVTBHoqWwew.jpg', 'https://www.youtube.com/embed/', 113, '1944', 3.51, 1),
(910, 'United States of America', 'Le Grand Sommeil', 'Le général Sternwood engage le détective privé Philip Marlowe pour régler une affaire de chantage dont il est victime. Un dénommé Geiger possèderait des photos compromettantes de sa fille cadette, Carmen. Mais Marlowe découvre que le maître chanteur a été assassiné. Rapidement, les cadavres s\'accumulent et l\'intrigue se complique. De nombreux personnage entrent en scène, dont Vivian, la sœur aînée de Carmen.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/5gaYxcRapzqqa7EZu6F8DDzLTx1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yxMgxS0NlmkG5RhatQE8MUjxT2C.jpg', 'https://www.youtube.com/embed/', 114, '1946', 3.83, 1),
(911, 'United States of America', 'La Banque Dick', 'Egbert Sousé devient un héros inattendu quand un voleur de banque tombe sur un banc qu\'il occupe. Maintenant considéré comme courageux, Egbert est donné un emploi comme gardien de banque. Bientôt, il est approché par J. charlatan Frothingham Waterbury sur l\'achat d\'actions dans une société minière. Egbert persuade caissier Og Oggilby lui prêter de l\'argent de la banque, à retourner lorsque le système est payant. Malheureusement, inspecteur de banque Snoopington fait ensuite une apparition surprise.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/3XrqHTrJpTaUeyqXqb4fVacYWpf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//erqri6EuFfDNZg2kPjk33IPKfGq.jpg', 'https://www.youtube.com/embed/', 72, '1940', 3.2, 1),
(912, 'United States of America', 'L\'Affaire Thomas Crown', 'Thomas Crown, riche et séduisant homme d\'affaires, organise le braquage d\'une banque pour tromper l\'ennui et satisfaire son goût du risque. Il engage quatre hommes de main qui exécutent parfaitement son plan, puis il récupère le butin déposé dans une poubelle après le hold-up. Vickie Anderson, détective dans une compagnie d\'assurances, se rapproche de Crown pour les besoins de son enquête. Le milliardaire, qui se croyait hors de danger, est inquiété par les soupçons de la jeune femme. Un jeu du chat et de la souris.', 'The Mirisch Company', 'https://image.tmdb.org/t/p/w1280/oaB1ioQwvxRFmLC3UhozXGwTSxn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fsXsG8Q6QbgLehhKhKYKiRMkGSv.jpg', 'https://www.youtube.com/embed/', 104, '1968', 3.46, 1),
(913, 'United States of America', 'Thomas Crown', 'Financier réputé, mécène généreux et collectionneur d\'art, Thomas Crown a le goût du risque, du jeu et de l\'aventure. Sûr de lui, il reste pourtant un solitaire invétéré qui n\'a jamais entretenu que de brèves liaisons. Depuis quelques semaines, il sacrifie ses déjeuners pour visiter le plus grand musée de New York et y admirer a loisir une toile de Van Gogh. Le conservateur lui fait remarquer un Monet d\'une valeur inestimable qui laisse le financier indifférent. Un jour, un commando de quatre hommes investit le musée. Crown en profite pour dissimuler le Monet dans son cartable.', 'Irish Dreamtime', 'https://image.tmdb.org/t/p/w1280/2nb76hBVOVt2GJPvSlE0Z9ECFj1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//iDGfPcu2CV66BCRk31uOcfB3IvU.jpg', 'https://www.youtube.com/embed/', 105, '1999', 3.36, 1),
(914, 'United States of America', 'Le Dictateur', 'Dans le ghetto juif vit un petit barbier qui ressemble énormément à Adenoid Hynkel, le dictateur de Tomania qui a décidé l\'extermination du peuple juif. Au cours d\'une rafle, le barbier est arrêté en compagnie de Schultz, un farouche adversaire d\'Hynkel…', 'Roy Export Company Establishment', 'https://image.tmdb.org/t/p/w1280/iklNcUOELu4VV8jZthsY0hsGW50.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8AMKZODrCvWe2sCy9Ts7VsLcKd6.jpg', 'https://www.youtube.com/embed/i2YinwcgpaA', 126, '1940', 4.17, 1),
(916, 'United States of America', 'Bullitt', 'Bullitt, un lieutenant de police, est chargé par un politicien ambitieux de protéger Johnny Ross, un gangster dont le témoignage est capital dans un procès où est impliqué l\'homme politique. Malgré les précautions prises par Bullitt et ses hommes, Ross est grièvement blessé, puis achevé sur son lit d\'hôpital. Bullitt s\'aperçoit alors que la victime n\'était pas le vrai Ross…', 'Solar Productions', 'https://image.tmdb.org/t/p/w1280/bwqYLTFP6OVtxvISSpbTIr4xZ30.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wu0Ad30NciUbR5c5Q1AglHZbRWJ.jpg', 'https://www.youtube.com/embed/a1B2hWBZY2g', 113, '1968', 3.57, 1),
(917, 'India', 'Mother India', '', 'Mehboob Productions', 'https://image.tmdb.org/t/p/w1280/mEew34BWjNoe6gsiNnLwumavBGT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pt1GOIJy4eFoSfkNSsS2zdg4195.jpg', 'https://www.youtube.com/embed/', 172, '1957', 3.6, 1),
(918, 'United States of America', 'Boire et déboires', 'Walter davis, ancien artiste devenu analyste dans une importante société financière, rencontre Nadia par l\'intermédiaire de son frère Ted. Mais celle-ci est extrèment sensible à l\'alcool. Walter charmé oublie ce détail et fait boire Nadia...', 'Permut Presentations', 'https://image.tmdb.org/t/p/w1280/fC8Ej0sf4Q3JVSJEE0YN1Nr0axP.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3iNwC8f33sVxJs5HMoHKd3gSniX.jpg', 'https://www.youtube.com/embed/', 96, '1987', 3, 1),
(919, 'Japan', 'Blood : The Last Vampire', 'En 1966, dans un Japon sous tension à cause de la guerre du Vietnam, des militaires américains stationnés à la base aérienne de Yokota doivent faire face à un danger inattendu : des vampires, immondes créatures se nourrissant de chair humaine, seraient infiltrés parmi eux. Une équipe d\'agents secrets, spécialement formés pour combattre ces créatures de la nuit, est envoyée sur place pour les démasquer et les éliminer. Parmi eux se trouve une mystérieuse adolescente, Saya, dotée de pouvoirs surnaturels...', 'Aniplex', 'https://image.tmdb.org/t/p/w1280/sIeDX5nyICSDgvdfNR0F0ka19ae.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//17s9ojb8j8QnBGCfqDUJraXLlFi.jpg', 'https://www.youtube.com/embed/', 48, '2000', 3.4, 1),
(920, 'United States of America', 'Cars', 'Lightning McQueen, a hotshot rookie race car driven to succeed, discovers that life is about the journey, not the finish line, when he finds himself unexpectedly detoured in the sleepy Route 66 town of Radiator Springs. On route across the country to the big Piston Cup Championship in California to compete against two seasoned pros, McQueen gets to know the town\'s offbeat characters.', 'Pixar', 'https://image.tmdb.org/t/p/w1280/u4G8EkiIBZYx0wEg2xDlXZigTOZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sd4xN5xi8tKRPrJOWwNiZEile7f.jpg', 'https://www.youtube.com/embed/OFWMrNpzATk', 117, '2006', 3.46, 1),
(921, 'United States of America', 'De l\'ombre à la lumière', 'Autrefois boxeur prometteur, Jim Braddock s\'est vu contraint d\'abandonner la compétition après une série de défaites. Alors que l\'Amérique sombre dans la `Grande Dépression\', Jim accepte n\'importe quel petit boulot pour faire vivre sa femme Mae et leurs enfants. Il n\'abandonne pourtant pas l\'espoir de remonter un jour sur le ring. Grâce à une annulation de dernière minute, Jim est appelé à combattre le deuxième challenger mondial, à la stupéfaction générale il gagne au troisième round.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/3WFqefpOIBmj6kqZ5zvnZw8Dy6M.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//40PwKtiXIZhHS1NmDko6h8EA391.jpg', 'https://www.youtube.com/embed/PpdRWplFjG8', 144, '2005', 3.77, 1),
(922, 'Germany', 'Dead Man', 'En voyageant vers les frontières de l\'Ouest américain pour un nouvel emploi, le jeune comptable Bill Blake devient accidentellement un hors-la-loi. Il est recueilli par un Indien marginalisé par les siens parce que lettré, qui voyant à travers Bill son homonyme défunt, le poète William Blake, va le conduire à entreprendre un voyage initiatique.', 'JVC', 'https://image.tmdb.org/t/p/w1280/4K3yec5EWavUkAtcfH7Rupp7YSG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9Kfi1QDVGbMzzi06n8c6A789odL.jpg', 'https://www.youtube.com/embed/', 134, '1995', 3.64, 1),
(923, 'Italy', 'Zombie', 'Des morts-vivants assoiffés de sang ont envahi la Terre et se nourrissent de ses habitants. Un groupe de survivants se réfugie dans un centre-commercial abandonné. Alors que la vie s\'organise à l\'intérieur, la situation empire à l\'extérieur.', 'Dawn Associates', 'https://image.tmdb.org/t/p/w1280/guIseJXs8kZLAPUoTp9VAzklvmi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9OKzKuCfcMwpHVp56pjNI7J4xXR.jpg', 'https://www.youtube.com/embed/', 115, '1978', 3.75, 1),
(924, 'Canada', 'L\'Armée des Morts', 'Personne ne peut expliquer comment tout cela est arrivé, mais ce matin, le monde n\'est plus qu\'un immense cauchemar. La population de la planète se résume désormais à une horde de morts vivants assoiffés de sang et lancés à la poursuite des derniers êtres humains encore en vie. Après avoir miraculeusement réussi à s\'échapper de son quartier, Ana Clark se barricade avec un petit groupe de survivants dans un centre commercial. André et sa femme enceinte, Michael et Kenneth, officiers de police, vont tout faire pour rester vivants. Alors que dehors, la situation est de pire en pire, à l\'intérieur, il faut aussi faire face aux peurs et aux démons de chacun.', 'New Amsterdam Entertainment', 'https://image.tmdb.org/t/p/w1280/5Ve9CiNA53PgnuBr9PX9MTxtiF7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//d3BTRD2Pslyr4uSvFdJEWtnrfws.jpg', 'https://www.youtube.com/embed/Aq-oVyxJJUs', 104, '2004', 3.52, 1),
(925, 'United States of America', 'Do the Right Thing', 'À Brooklyn, c\'est littéralement le jour le plus chaud de l\'année. Mookie, un jeune afro-américain, est livreur à la pizzeria du quartier, tenue par Sal et ses deux fils, d\'origine italienne. Chacun vaque à ses occupations, mais la chaleur estivale va bientôt cristalliser les tensions raciales.', '40 Acres and a Mule Filmworks', 'https://image.tmdb.org/t/p/w1280/tlu7AwizbRv62kwIfe4E6oi7Z1T.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//leT6tupwfYea4T0zYBafP73gXj9.jpg', 'https://www.youtube.com/embed/x9IVvJZKE-o', 120, '1989', 3.88, 1),
(926, 'United States of America', 'Galaxy Quest', 'For four years, the courageous crew of the NSEA protector - \"Commander Peter Quincy Taggart\" (Tim Allen), \"Lt. Tawny Madison (Sigourney Weaver) and \"Dr.Lazarus\" (Alan Rickman) - set off on a thrilling and often dangerous mission in space...and then their series was cancelled! Now, twenty years later, aliens under attack have mistaken the Galaxy Quest television transmissions for \"historical documents\" and beam up the crew of has-been actors to save the universe. With no script, no director and no clue, the actors must turn in the performances of their lives.', 'Gran Via Productions', 'https://image.tmdb.org/t/p/w1280/fZXSwgZknp81vmciTb86rw0MejV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uIyxbTK1FXJj2wINnlGZzxphlv5.jpg', 'https://www.youtube.com/embed/BgB9R9A_M7g', 101, '1999', 3.53, 1),
(927, 'United States of America', 'Gremlins', 'When Billy Peltzer is given a strange but adorable pet named Gizmo for Christmas, he inadvertently breaks the three important rules of caring for a Mogwai, and unleashes a horde of mischievous gremlins on a small town.', 'Amblin Entertainment', 'https://image.tmdb.org/t/p/w1280/gDSfs0hqAQVJ9jIHbX3AJ3StTVG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5UX6M0aEphiW6Xmy5rpYX75glbo.jpg', 'https://www.youtube.com/embed/nkJxDZqR9z0', 106, '1984', 3.54, 1),
(928, 'United States of America', 'Gremlins 2 : La Nouvelle Génération', 'Six ans après avoir triomphé des abominables Gremlins, ces petits monstres dévastateurs nés de la fourrure mouillée de Gizmo, une adorable peluche vivante, Billy Peltzer et sa fiancée Kate, installés à New York, ont trouvéé du travail dans le gigantesque building qui abrite les bureaux du milliardaire Daniel Clamp.', 'Amblin Entertainment', 'https://image.tmdb.org/t/p/w1280/rSA6Rtmoz4awKWSFCs3SrqVSuS4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//iR3tV8NXFls4UKzPA60D4zrI7Jh.jpg', 'https://www.youtube.com/embed/', 106, '1990', 3.2, 1),
(929, 'Japan', 'Godzilla', 'Une tempête effroyable se déchaîne sur le Pacifique, engloutissant un pétrolier tandis qu\'un immense éclair illumine le ciel au-dessus de la Polynésie française. Des empreintes géantes creusent un inquiétant sillon à travers des milliers de kilomètres de forêts et de plages au Panama. Les navires chavirent au large des côtes américaines et ces horribles phénomènes s\'approchent de plus en plus près de New York. Le chercheur Nick Tatopoulos est arraché à ses recherches afin d\'aider les États-Unis à traquer le monstre qui est à l\'origine de ces désastres mystérieux.', 'TOHO', 'https://image.tmdb.org/t/p/w1280/yakeieBEqB5iKeSlool5W3bhpbv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//z6fmvhQXS5hbXSizx4DGajjBmGD.jpg', 'https://www.youtube.com/embed/', 140, '1998', 2.81, 1),
(940, 'United Kingdom', 'Une femme disparaît', 'Dans le train qui la ramène des Balkans chez elle, Iris se lie avec une vieille dame, Miss Froy. Or celle-ci disparaît pendant le sommeil d\'Iris : à sa place se trouve une autre dame portant les mêmes vêtements. Aucun passager du train ne se souvient de Miss Froy. Assistée par un jeune musicien, Gilbert, Iris mène l\'enquête.', 'Gainsborough Pictures', 'https://image.tmdb.org/t/p/w1280/5y7oxSHLzeyxXmbuacc2ddW4gDa.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fzlnTGJar9dctH4b7D7BbJp16vK.jpg', 'https://www.youtube.com/embed/', 96, '1938', 3.75, 1),
(941, 'United States of America', 'L\'Arme fatale', 'Pour Roger Murtaugh, 50 ans tout juste et un bon policier, deux seules choses comptent à présent : sa famille et la retraite. Mais voilà qu\'on lui fait un cadeau empoisonné : Martin Riggs, jeune flic de la crime, rompu aux techniques de combat, doté d\'un instinct suicidaire avancé. Et dans la sordide affaire de suicide qu\'ils doivent démêler, Roger Murtaugh va apprendre à ses dépens pourquoi Riggs mérite l\'inquiétant surnom d\'\"arme fatale\".', 'Silver Pictures', 'https://image.tmdb.org/t/p/w1280/uh1ImPGPySZ0bKEVgPDIXHLt22.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//guTNnSWS3CaH71jasY8W1FMptjG.jpg', 'https://www.youtube.com/embed/OeBVtCT6HW8', 109, '1987', 3.64, 1),
(942, 'United States of America', 'L\'Arme fatale 2', 'Riggs et Murtaugh. Les flics les plus redoutés de Los Angeles. On leur confie la protection d\'un comptable et ils mettent à jour un trafic de drogue impliquant le consulat d\'Afrique du Sud. Face à des tueurs protégés par l\'immunité diplomatique, ces policiers useront des moyens les moins conventionnels pour faire triompher la justice. Au jeu de la folie destructrice, Riggs n\'a pas été surnommé \"L\'arme Fatale\" pour rien.', 'Silver Pictures', 'https://image.tmdb.org/t/p/w1280/z4Vd5YgIztiLOkpcmAlj7yhhD6R.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zjRkl5PZvFujbRndrNbf4ZKbeNC.jpg', 'https://www.youtube.com/embed/5AdW-ShY9T4', 114, '1989', 3.5, 1),
(943, 'United States of America', 'L\'Arme fatale 3', 'Riggs et Murtaugh, toujours encombrés depuis le film précédent de l\'impossible Léo Getz, veulent mettre la main sur un ex-policier reconverti dans le trafic d\'armes. Mais un détective est déjà sur le coup : elle est belle, experte en arts martiaux et aussi folle de Riggs…', 'Silver Pictures', 'https://image.tmdb.org/t/p/w1280/zsrpmK8H9LokswJYJaUKLL6yHEB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kmt9XmhmX36sJduuDVFlTgEWh9U.jpg', 'https://www.youtube.com/embed/w0Y6L5Y9M3s', 118, '1992', 3.35, 1),
(944, 'United States of America', 'L\'Arme fatale 4', 'Notre tandem de choc, est confronté à un parrain du milieu asiatique décidé à accomplir une vengeance personnelle…', 'Silver Pictures', 'https://image.tmdb.org/t/p/w1280/oeMlCo5D0efLm2bPAClj9e2EBTg.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//u4d4vymNPo1UuJ6ihtyy9OQgco2.jpg', 'https://www.youtube.com/embed/Es4CYLavwuw', 127, '1998', 3.29, 1),
(946, 'United States of America', 'Lettre d\'une inconnue', 'Un célèbre pianiste vieillissant reçoit un jour une lettre d\'une jeune femme inconnue de lui, Lisa Berndle. Celle-ci lui retrace l\'amour qu\'elle a éprouvé secrètement pour lui depuis son enfance. Elle évoque les rares étreintes que ce volage amant voulut bien lui accorder d\'où d\'ailleurs naquit un enfant, mort depuis du typhus. Elle a épousé un diplomate sans lui cacher que son cœur était ailleurs. C\'est sur son lit de mort qu\'elle rédige cette terrible missive. Le pianiste comprend alors pourquoi un diplomate viennois l\'a provoqué en duel la veille.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/7G309Morm6sNt2S17Z5qz2W2Fzw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7amSQSipxgiQnEejWX6iQonFrZI.jpg', 'https://www.youtube.com/embed/DXG-hzPFRNw', 87, '1948', 3.9, 1),
(947, 'United Kingdom', 'Lawrence d\'Arabie', 'Le destin hors du commun de l’officier britannique T. E. Lawrence, qui mena la révolte arabe contre l’oppresseur turc au cours de la Première Guerre mondiale. Il a fallu plus de deux ans de travail de détective et d’archéologue au producteur Robert A. Harris, à qui l’on doit la restauration du «Napoléon» d’Abel Gance pour reconstituer la première version 70 mm intégrale de «Lawrence d’Arabie».', 'Horizon Pictures', 'https://image.tmdb.org/t/p/w1280/l6pOdchQfeBe5L9OByhtW0jhFzv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mx2jS5Kaa5rmaldEFzKeKpDN9Q2.jpg', 'https://www.youtube.com/embed/VUAu2rNLfsw', 227, '1962', 3.99, 1),
(948, 'United States of America', 'La nuit des masques', 'Il y a 15 ans, dans une petite ville des États-Unis, le soir d’Halloween, au cours de laquelle les enfants ont l’habitude de se déguiser, un petit garçon, Michael, épie sa sœur et son ami qui flirtent. Michael les suit et, armé d’un couteau de cuisine, assassine la jeune fille. Quinze ans plus tard, un psychiatre, le docteur Loomis qui étudie le cas du jeune meurtrier apprend que le criminel s’est échappé : il est revenu sur les lieux de son crime pour continuer son œuvre…', 'Compass International Pictures', 'https://image.tmdb.org/t/p/w1280/7QkWoGZU7dYX0hkmg9R2JYMGXrz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aRka9neADW1M0Zf9lF8kW2jEgXe.jpg', 'https://www.youtube.com/embed/nrngEGwvKLU', 91, '1978', 3.78, 1),
(949, 'United States of America', 'Heat', 'Un groupe de braqueurs de banque professionnels commence à sentir la chaleur de la police quand, sans le savoir, il laisse un indice à son dernier vol.', 'Regency Enterprises', 'https://image.tmdb.org/t/p/w1280/e0xv5Y7UVrhKEVy1g3URMLLVDYB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xKsnZDERG1dk95wuZ5q9iks3OL3.jpg', 'https://www.youtube.com/embed/Xl7X4Pf3PTY', 170, '1995', 3.95, 1),
(950, 'United States of America', 'L\'Âge de glace 2', 'Pour Manny le mammouth, Sid le paresseux et Diego le tigre à dents de sabre, la vie est beaucoup plus douce depuis que les glaces fondent et que la température remonte. Mais les problèmes ne sont pas terminés pour autant! Manny rêve de fonder une famille, mais la toute dernière femelle de son espèce, Ellie, se prend pour un opossum… Plus grave encore, un immense barrage de glace qui retient l’océan est sur le point de se rompre sous l’effet du réchauffement et menace d’engloutir leur petit coin de paradis. Leur seule chance de survie se trouve à l’autre bout de la vallée… Voilà nos trois héros, accompagnés d’Ellie et de ses deux insupportables frères, Crash et Eddie – de vrais opossums, eux! – lancés dans un périlleux voyage vers la vie…', '20th Century Fox Animation', 'https://image.tmdb.org/t/p/w1280/j29g3raXkAuEyY4yVXCLIWzorBm.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wRTZaxAiDP0ZEeQsO0HiiSqYCSp.jpg', 'https://www.youtube.com/embed/47M5sClJNVI', 91, '2006', 3.34, 1),
(951, 'United States of America', 'Un flic à la maternelle', 'Poursuivant un dangereux malfaiteur et sa mère trafiquants de drogue, John Kimble, policier remarquable, est amené à la suite de la défaillance d’une collègue à faire la classe à une maternelle. En quelques heures c’est l’anarchie la plus totale et le brillant policier a plus de mal à contenir trente bambins que les plus coriaces bandits. Mais grâce à une collègue attentive et à son fils, il réussira à se faire des alliés des enfants et à retrouver les méchants.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/AtFlNvuENqXF6ILQDPmIlhCmHim.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mbtvyCr73zTz45lANjURpKu493l.jpg', 'https://www.youtube.com/embed/xV-kbUY0fiI', 111, '1990', 3.03, 1),
(953, 'United States of America', 'Madagascar', 'Lorsqu’un lion, un zèbre, une girafe, un hippopotame et une poignée de pingouins psychotiques fuient leur zoo new‐yorkais pour secourir l’un des leurs, l’aventure s’écrit avec un grand A. Et lorsque le destin les réunit sur l’île de Madagascar, ils doivent apprendre en formation accélérée les rudiments de la vie à l’air libre.', 'DreamWorks Pictures', 'https://image.tmdb.org/t/p/w1280/aA1eZtISZ2rqUk2QIUgu1pXcHrm.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8NCftAWfkETwrbf7QwEaDH1xpus.jpg', 'https://www.youtube.com/embed/BaK_dCpAidE', 86, '2005', 3.44, 1),
(954, 'United States of America', 'Mission : Impossible', 'Les membres d’un commando de la CIA sont envoyés à Prague avec pour mission d’appréhender, lors d’une réception dans l’ambassade américaine, un espion ennemi qui s’apprête à dérober une disquette contenant la liste secrète des agents en Europe centrale. Seulement ils ignorent que la CIA, persuadée que le commando est infiltré par une taupe, a envoyé une seconde équipe sur place.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/l5uxY5m5OInWpcExIpKG6AR3rgL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pbaAkR1FDvgndTVFgGRIzf9o49r.jpg', 'https://www.youtube.com/embed/EvOqiaqfewU', 110, '1996', 3.48, 1),
(955, 'United States of America', 'Mission : Impossible 2', 'Votre mission, monsieur Hunt, si vous décidez de l\'accepter, sera de récupérer un virus génétiquement modifié, baptisé la Chimère. Sean Ambrose, qui fut votre élève avant de devenir votre ennemi juré, s\'est emparé de l\'antidote et se terre dans un laboratoire secret de Sydney. Son ex-maîtresse, Nyah Hall, pourrait s\'avérer utile dans vos tentatives d\'infiltration de ce QG hautement protégé. Comme toujours, si vous ou l\'un de vos équipiers étiez capturés ou tués, le Département d\'État nierait avoir eu connaissance de vos agissements. Ce résumé s\'autodétruira dans cinq secondes.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/1VMWLpk9VXyYcEZ8w3uUhp0OF1v.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//24DZfupDlhXeTchmcOkoGRhP5Vg.jpg', 'https://www.youtube.com/embed/FQfbmK93o1k', 123, '2000', 3.05, 1),
(956, 'United States of America', 'Mission : Impossible 3', 'Ethan espérait avoir tourné une page en quittant le service actif de la Force Mission Impossible pour un poste de formateur ; pouvoir enfin mener une vie « normale », se consacrer tout entier à sa ravissante épouse, Julia. Mais lorsque Lindsey, la plus brillante recrue de l’IMF « tombe » à Berlin, Ethan se sent moralement obligé de lui porter secours. Assisté de ses fidèles coéquipiers Luther, Zhen et Declan, il infiltre le repaire du trafiquant Owen Davian et arrache la jeune femme des mains d’une quinzaine de ses sbires. Trop tard : quelques instants plus tard, une mini‐capsule de magnésium explose dans la tête de Lindsey, la tuant sur le coup. Davian avait tout prévu. Pour Ethan, c’est bien plus qu’un ratage : c’est une faillite personnelle dont il lui faut au plus vite se racheter.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/oIp8jZmsRdA6DrboUsi4YViDvCT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sjcPWJ5TXgFglsoixNxyZRyEUq3.jpg', 'https://www.youtube.com/embed/8xHMZPRN49c', 125, '2006', 3.35, 1),
(957, 'United States of America', 'Spaceballs', 'When the nefarious Dark Helmet hatches a plan to snatch Princess Vespa and steal her planet\'s air, space-bum-for-hire Lone Starr and his clueless sidekick fly to the rescue. Along the way, they meet Yogurt, who puts Lone Starr wise to the power of \"The Schwartz.\" Can he master it in time to save the day?', 'Brooksfilms Ltd.', 'https://image.tmdb.org/t/p/w1280/o624HTt93iIJIc1Sg5hNkDTnk5l.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//g1h8OE4ZPg5aLbwUm7DPeCOBuHC.jpg', 'https://www.youtube.com/embed/9H_Rx3-hYOw', 96, '1987', 3.41, 1),
(961, 'United States of America', 'Le Mécano de la « Générale »', 'Conducteur de locomotive, Johnnie Gray habite à Marietta, en Géorgie. Il est fiancé à Annabelle Lee. La guerre de Sécession éclate : le père et le frère de la jeune fille sont incorporés. Pas Johnny, qu\'on juge plus utile à son poste et qu\'entache ainsi, aux yeux de tous et même de sa fiancée, un soupçon de couardise. Un jour, des soldats nordistes volent sa locomotive, la «General», et enlèvent dans la foulée sa fiancée, Annabelle Lee. De peur d\'être définitivement pris pour un lâche, Johnnie s\'en va-t-en guerre : il se lance seul à la poursuite des voleurs...', 'Joseph M. Schenck Productions', 'https://image.tmdb.org/t/p/w1280/fBqCF0ScIDElrSKzaXz0fHc85Nj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//h68ilwiTesb5wmDgy2mHYkVuOBP.jpg', 'https://www.youtube.com/embed/ZROzVhuddiI', 67, '1926', 4.01, 1),
(962, 'United States of America', 'La Ruée vers l\'or', 'Le célèbre assaut pour tout l\'or de l\'Oklahoma vu par l\'un des maîtres du burlesque américain.', 'Charles Chaplin Productions', 'https://image.tmdb.org/t/p/w1280/fT3OU1AjdTxiJmKvfCnzBBAQivp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hZHeDPQGNKN9NN9GuW7qVbM2tDx.jpg', 'https://www.youtube.com/embed/', 96, '1925', 4.02, 1),
(963, 'United States of America', 'Le Faucon maltais', 'Sam Spade et Miles Archer sont deux privés. Au cours d\'une enquête, Miles est assassiné. Sam soupçonne Brigid qui les avait dirigés sur l\'enquête. Mais cette dernière, qui fascine Sam par sa beauté et son argent, lui demande de l\'aider et il accepte.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/eOyezPtl1xr2st2fZhz0yG7ydZn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5lMm0MmAviP6DF45nxBVOT9LCwK.jpg', 'https://www.youtube.com/embed/', 100, '1941', 3.88, 1),
(964, 'United States of America', 'The Phantom of the Opera', 'A grotesquely disfigured composer known as \"The Phantom\" haunts Paris\' opera house, where he\'s secretly grooming Christine Daae to be an opera diva. Luring her to his remote underground lair, The Phantom declares his love. But Christine loves Raoul de Chagny and plans to elope with him. When The Phantom learns this, he abducts Christine.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/mvaYpAYj957C2tlq3vVJPSzGJXK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6FSs7jMimg1PBYdhZtPNQhtKtEc.jpg', 'https://www.youtube.com/embed/', 107, '1925', 3.57, 1),
(965, 'United States of America', 'La Splendeur des Amberson', 'Eugène Morgan revient après vingt ans d\'absence sur les lieux de ses amours malheureuses. Il fut jadis éconduit par Isabel Amberson, fille d\'une famille riche et puissante. Eugène est à présent patron d\'une importante usine d\'automobiles, tandis que la splendeur des Amberson n\'est plus que le reflet d\'une époque révolue.', 'Mercury Productions', 'https://image.tmdb.org/t/p/w1280/85jLnTTQyn6CMWIihH4xn0RXq4t.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//i87Uli8Zb0nEI0zDNALnATyT6vd.jpg', 'https://www.youtube.com/embed/', 90, '1942', 3.66, 1),
(966, 'United States of America', 'Les Sept Mercenaires', 'Un petit village de paysans du nord du Mexique subit les raids incessants de bandits menés par le pilleur Calvera. Accablés par cette situation, les paysans décident d\'aller chercher du soutien de l\'autre côté de la frontière américaine. Ils le trouvent en la personne de Chris, baroudeur taciturne et excellent tireur. Ensemble, ils recrutent six autres hommes, tous mercenaires, chacun motivé par des raisons personnelles et un sens de l\'honneur propre.', 'Alpha Productions', 'https://image.tmdb.org/t/p/w1280/4EJqOoRu9CtnbV4coJYSHvrrEAv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2aC3284N1p86o6S4Uyj9AaryYeR.jpg', 'https://www.youtube.com/embed/', 128, '1960', 3.77, 1),
(967, 'United States of America', 'Spartacus', 'Italie, 73 av. J.C. Esclave devenu gladiateur, Spartacus est épargné par un de ses compagnons d\'infortune dans un combat à mort. Ce répit soulève en lui plus que jamais le souffle de la révolte, et après avoir brisé ses chaînes, il enjoint les autres esclaves à faire de même. Rapidement à la tête d\'une colossale armée, Spartacus entend rejoindre le port de Brides au sud du pays pour prendre la mer à bord des navires ciliciens. Mais l\'Empire romain ne l\'entend pas de cette oreille et lance ses légions à la poursuite des esclaves révoltés…', 'Bryna Productions', 'https://image.tmdb.org/t/p/w1280/7jIkNQenhZdiGRcwMk8w9KhwFi6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aheSIG4h3JNxWeDvdb1NxKzgjaM.jpg', 'https://www.youtube.com/embed/', 181, '1960', 3.78, 1),
(968, 'United States of America', 'Un après-midi de chien', 'Des gangsters débutants braquent une banque et se retrouvent cernés par la police et les médias. Ils prennent en otage les employés de la banque. Débute alors un cauchemar qui va durer des heures…', 'Artists Entertainment Complex', 'https://image.tmdb.org/t/p/w1280/bIkVY8xpYL8c3GTlFP2NqnTjm2m.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//v1pWTh1I20jJbNpJvcwUIUjJqbs.jpg', 'https://www.youtube.com/embed/', 130, '1975', 3.91, 1),
(975, 'United States of America', 'Les Sentiers de la gloire', 'En 1916, durant la Première Guerre mondiale, le général français Broulard ordonne au général Mireau de lancer une offensive suicidaire contre une position allemande imprenable, surnommée la « Fourmilière ». Au moment de l\'attaque, les soldats tombent par dizaines et leurs compagnons, épuisés, refusent d\'avancer…', 'United Artists', 'https://image.tmdb.org/t/p/w1280/jfE5FYueGzdNZUg60WJ7JSJCLkG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3G9YiVm0bQB1XyyyiDzfeNCiFLw.jpg', 'https://www.youtube.com/embed/yzTwmbXg7pA', 86, '1957', 4.14, 1),
(976, 'United States of America', 'Le Grand Chantage', 'J.J. Hunsecker est l\'éditorialiste le plus influent de New York. Il a décidé d\'empêcher sa sœur d\'épouser un guitariste de jazz. Pour cela, il demande à Sidney Falco, attaché de presse minable et sans scrupules de tout faire pour empêcher cette union. Ce dernier, aux abois, n\'hésitera pas à se compromettre pour arriver à ses fins.', 'Hecht-Hill-Lancaster Productions', 'https://image.tmdb.org/t/p/w1280/oS8pYFu4cFWqDwUjG9BOUORKRNJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6L1Co3uRWuoaqDxpWvGDvgXms7T.jpg', 'https://www.youtube.com/embed/6L7VJN4zd_M', 96, '1957', 3.83, 1),
(977, 'United States of America', 'Tabu', 'The youngsters Matahi and Reri are in love with each other. The old warrior Hitu announces that Reri is to be the new chosen virgin for the gods. This means she must stay untouched, otherwise she and her lover will be killed. But Matahi abducts and escapes with her to an island ruled by the white man, where their gods would be harmless and powerless.', 'Murnau-Flaherty Productions', 'https://image.tmdb.org/t/p/w1280/c4zfawkB8Jsp5lhWl62QCzczR3M.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jLtiBuYhQoqAEACLyyhO3mo4JHx.jpg', 'https://www.youtube.com/embed/', 86, '1931', 3.6, 1),
(978, 'United Kingdom', 'Sept ans au Tibet', 'À la fin de l\'été 1939, l\'alpiniste autrichien Heinrich Harrer, qui rêve de conquérir le Nanga Parbat, sommet inviolé de l\'Himalaya, accepte de l\'argent nazi pour y planter le drapeau à croix gammée. La guerre éclate. Prisonnier des Britanniques à la frontière de l\'Inde, il s\'évade. Commence alors une longue errance qui se termine à Lhassa, résidence du jeune dalaï-lama avec qui il se lie d\'amitié.', 'TriStar Pictures', 'https://image.tmdb.org/t/p/w1280/6D3DsHSjqVETMX96TV9KpvEXKkt.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dgiOBykxfUAtb01VUnkHsTCwfsG.jpg', 'https://www.youtube.com/embed/TWkrRTPtKss', 135, '1997', 3.58, 1),
(979, 'France', 'Irréversible', 'Une jeune femme, Alex, se fait violer par un inconnu dans un tunnel. Son compagnon Marcus et son ex-petit ami Pierre décident de faire justice eux-mêmes.', 'Wild Bunch', 'https://image.tmdb.org/t/p/w1280/ne31Fq4h1UhIoS2o17JrICrEBrT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xV1EfNSEg6id6juJPr1vM6p9x5X.jpg', 'https://www.youtube.com/embed/FxPNSErZ5bE', 99, '2002', 3.62, 1),
(980, 'United States of America', 'L\'Étrange Incident', 'En 1885, dans un village du Nevada, un homme annonce que le fermier Kinkaid a été assassiné. Un autre donne une autre version des faits. Le shérif étant absent, le meilleur ami de Kinkaid, aidé d\'un commandant sudiste et d\'un shérif adjoint, vont former une milice malgré l\'opposition du juge.', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/bgoGtddrwfi1MmaEmHA48MJjpgU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//A1aJIo66DkwjWCZOPdRdShzDW2O.jpg', 'https://www.youtube.com/embed/hKd34tmlqko', 72, '1943', 3.89, 1),
(981, 'United States of America', 'Indiscrétions', 'Une séparation, des fiançailles, une rupture et trois prétendants. Une comédie alerte et enjouée parodiant la haute société américaine et ses parfums de scandale.', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/35qRcFOhsCEWCq3MAMzrGtKkebK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cItyRXbbuu5KTVeb9GLaovIRfb8.jpg', 'https://www.youtube.com/embed/', 113, '1940', 3.83, 1),
(982, 'United States of America', 'Un crime dans la tête', 'À son retour de la guerre de Corée, Raymond Shaw reçoit la médaille d\'honneur du combattant. Il est décoré par le président des États-Unis. Tout le monde ignore que, durant sa captivité, il a subi un lavage de cerveau qui a fait de lui le jouet de l\'ennemi. Manipulé par un agent communiste qui s\'avère être sa mère, il prépare la délicate mission qu\'on lui a confiée : assassiner le Président. En retrouvant sa fiancée, il redevient l\'homme qu\'il était avant la guerre. Mais ce retour à la normale s\'avère très provisoire. Le capitaine Bennett Marco fait régulièrement un étrange cauchemar dans lequel Raymond Shaw, qui commandait sa patrouille en Corée, est hypnotisé et tue un soldat...', 'MC Productions', 'https://image.tmdb.org/t/p/w1280/86EJh81aylhncq62OlPnjDCXtTv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7dX07NQv4p6kfzSkA9rf9LvlvVD.jpg', 'https://www.youtube.com/embed/', 131, '1962', 3.8, 1),
(983, 'United States of America', 'L\'Homme qui voulut être roi', 'À la fin du XIXème siècle, Rudyard Kipling, un jeune journaliste installé en Inde, fait la connaissance de Daniel Dravot et de Peachy Carnehan, deux anciens sergents de l\'armée britannique à la recherche de la fortune et de la gloire. Après un long et périlleux voyage via l\'Afghanistan, ces derniers pénètrent dans une contrée sauvage, le Kafristan, où des villageois sont en guerre contre une ville rivale. Tous deux s\'engagent dans la bataille. Au cours des combats, Dravot reçoit une flèche en pleine poitrine, mais continue à lutter. En réalité, la flèche s\'est plantée dans la cartouchière. Mais aux yeux du peuple, il passe pour un être surnaturel, le dieu Sikander, fils d\'Alexandre le Grand. Après ce miracle supposé, Dravot est proclamé roi du Kafristan et bénéficie de la puissance absolue. Mais le pouvoir peut corrompre même le meilleur des hommes.', 'Persky-Bright Productions', 'https://image.tmdb.org/t/p/w1280/ob2eV5XBD5UtcrOHU0ndCf9r17P.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1Jgefbg5cKfCrppNbP0nPJm2TdR.jpg', 'https://www.youtube.com/embed/JG8fG_sgzbQ', 129, '1975', 3.75, 1),
(984, 'United States of America', 'L\'Inspecteur Harry', 'Un tueur inconnu menace de poursuivre une série d\'assassinats si la police de San Francisco ne lui remet pas immédiatement 200 000 dollars. L\'inspecteur Harry Callahan, aux méthodes expéditives mais efficaces, le traque.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/uMt4rA1ViG7DPG2GBrWCbuiLQfL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ezrb56YdkoG59fZj50IxE9OnADx.jpg', 'https://www.youtube.com/embed/Dl39nG83WDM', 102, '1971', 3.74, 1),
(985, 'United States of America', 'Eraserhead', 'Un homme est abandonné par son amie qui lui laisse la charge d\'un enfant prématuré, fruit de leur union. Il s\'enfonce dans un univers fantasmatique pour fuir cette cruelle réalité.', 'American Film Institute (AFI)', 'https://image.tmdb.org/t/p/w1280/fjq2xZvWWKZJtg8FGNHXdbVoAAf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ApB0mF2d5Oqioi3yxjuogiotSLI.jpg', 'https://www.youtube.com/embed/', 89, '1977', 3.71, 1),
(986, 'Spain', 'Falstaff', 'Les frasques du prince de Galles, fils d\'Henry IV, roi d\'Angleterre, et de son ami Falstaff, grand buveur, mangeur et voleur par-devant l\'éternel. Accédant au pouvoir, Henry V envoie son ami en exil où ce dernier meurt de chagrin.', 'Internacional Films Espagnol', 'https://image.tmdb.org/t/p/w1280/aBfTkdn3gmNEB90uJiSOWUgQ24Y.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//atMZwFMnbTEvOpGOh9zFob2yt9T.jpg', 'https://www.youtube.com/embed/z6_yO1HqP_w', 116, '1965', 3.6, 1),
(987, 'United States of America', 'Spéciale première', 'La salle de presse du tribunal est en émoi : Earl Williams, un tueur de policier, doit être exécuté ce matin. Mais alors que chacun est sur le qui-vive, tâchant qui d’obtenir une interview exclusive,  Walter Burns, rédacteur en chef du Chicago Examiner, reçoit la démission de son journaliste vedette, Hildy Johnson, sur le point de convoler avec sa fiancée et d’accepter un poste de publicitaire à Philadelphie.  L’idée est inacceptable pour Burns, qui va donc essayer de convaincre Hildy de couvrir l’événement, d’autant que lorsqu’on apprend l’évasion de Williams, il est évident qu’Hildy est l’homme de la situation.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/4pOaF9RitDmi1zwc3U9fRN6oeM4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zmmvegeYIOEi8cBNPz45xrBTIZX.jpg', 'https://www.youtube.com/embed/Os4KgsvJ9Ys', 105, '1974', 3.66, 1),
(988, 'United States of America', 'Le Syndrome chinois', 'Une journaliste et son caméraman filment clandestinement un incident dans une centrale nucléaire. Le reportage, jugé trop brûlant, est refusé par la télévision.', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/WbnkHNO52mm9hlgwD2pIxprvaR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qvlSLwRbTw0bY0fJmsRxzbnRHyt.jpg', 'https://www.youtube.com/embed/', 117, '1979', 3.57, 1),
(989, 'United States of America', 'La Tempête qui tue', 'Une famille allemande, unie et heureuse, se trouve divisée à l\'avénement du national-socialisme. Le père, professeur de faculté et savant renommé, la mère, et Martin, un jeune paysan ami de la famille, sont pour la paix. Les deux fils et Fritz, le fiancé de Freyda, sont tentés par l\'aventure hitlérienne.', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/aW1n9pZVR3XHmrPlR0K3XIkmHbh.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zqgzF9zkDlLqVARJGgoMSugb1at.jpg', 'https://www.youtube.com/embed/', 100, '1940', 3.6, 1),
(990, 'United States of America', 'L\'Arnaqueur', 'Eddie Felson est un brillant joueur de billard. Il se rend à New York en compagnie de son manager et rencontre le légendaire champion, Minnesota Fats, poulain de Bert Gordon. Minnesota gagne après une nuit de combat acharné. Au petit matin, Eddie, ivre, rencontre une jeune femme désœuvrée et alcoolique avec laquelle il se met a vivre. Sarah va mettre sa vie en jeu pour l\'aider mais il n\'a finalement besoin que d\'une victoire.', 'Rossen Films', 'https://image.tmdb.org/t/p/w1280/uTsKrRVvufDQwjilnWdS7PKJk8h.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1aspiiXDHVizaCYTNaWwRQSmXCh.jpg', 'https://www.youtube.com/embed/', 135, '1961', 3.87, 1),
(991, 'United Kingdom', 'L\'Homme qui venait d\'ailleurs', 'Envoyé sur Terre pour trouver un remède au manque d\'eau qui décime lentement les habitants de sa planète, un extra-terrestre est confronté à la folie des humains et au souvenir nostalgique d\'une femme et de ses deux enfants qui l\'attendent.', 'British Lion Films', 'https://image.tmdb.org/t/p/w1280/qo1q9RFtj76w65Q1clQ0ABAAlBT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xarA1q7NcqPVXD2gOKslUeynqRD.jpg', 'https://www.youtube.com/embed/', 138, '1976', 3.24, 1),
(992, 'United States of America', 'Sherlock Jr.', 'A film projectionist longs to be a detective, and puts his meagre skills to work when he is framed by a rival for stealing his girlfriend\'s father\'s pocketwatch.', 'Metro Pictures Corporation', 'https://image.tmdb.org/t/p/w1280/1G9r3rqtbFAQuyWKOZm4Y5J5s7Q.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dRKCNvOjXkRTIA3D3KAve7GRu4k.jpg', 'https://www.youtube.com/embed/wZ2ej7L4k9g', 45, '1924', 4.06, 1),
(993, 'United Kingdom', 'Le Limier', 'Sir Andrew Wyke, un riche auteur de romans policiers anglais, a invité Milo Tindle, un coiffeur londonien d\'origine plus modeste, à lui rendre visite dans sa somptueuse résidence, aménagée et décorée avec un art consommé du trompe-l’œil. Maniaque de l\'énigme et de la mystification, cachant mal son mépris pour ce parvenu dont il connaît la liaison avec son épouse Marguerite, Andrew lui propose de simuler un cambriolage pour toucher l\'argent de l\'assurance. Milo, impressionné par Wyke, accepte...', 'Palomar Pictures International', 'https://image.tmdb.org/t/p/w1280/6ya0B3t0VxcTjUEXqSj2sdemdKw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jpP8oOge5W47mHdgp3j3zEJnT6Q.jpg', 'https://www.youtube.com/embed/XBRMaieaLdU', 138, '1972', 3.85, 1),
(994, 'United Kingdom', 'Les Chiens de paille', 'David, jeune mathématicien américain, vient habiter avec sa femme dans l\'arrière pays anglais pour se concentrer sur ses recherches. Il engage de jeunes ouvriers du village pour réparer la ferme, qui finissent par tourmenter le couple non violent. Cela s\'intensifie lorsqu\'ils attaquent la ferme après que David a pris la défense d\'Henry Niles, l\'idiot du village, accusé de meurtre. David met toute son intelligence au service de sa survie ; retranché dans la ferme, il élabore des pièges qui font de lui l’égal de ses assaillants. Ses convictions non violentes et sa répugnance à tuer sont dissipées par les actes qu’il commet.', 'ABC Pictures', 'https://image.tmdb.org/t/p/w1280/VWBXsUuHtA5KEFrUFHV7CWDLSJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8eWzglk0uHAtbFgKb3lVTXnJvxp.jpg', 'https://www.youtube.com/embed/', 118, '1971', 3.55, 1),
(995, 'United States of America', 'La Chevauchée fantastique', 'La diligence est le lieu de rencontre de neuf personnes qui font route, en Arizona, sur une piste menacée par les Indiens de Geronimo. Dallas, une prostituée, est chassée de la ville, tout comme Josiah Boone, un vieux médecin alcoolique. Mrs Mallory, enceinte, va rejoindre son mari, un officier, tandis que Hatfield, un joueur, décide de l\'accompagner par galanterie. Gatewood, le banquier, s\'enfuit avec l\'or déposé chez lui. Mr Peacok, qui place du whisky dans les saloons, regagne sa famille à Kansas City. Curly Wilcox, le shérif, accompagne le conducteur Buck, sur cette route dangereuse. À la sortie de la ville, ils prennent un autre passager, Ringo Kid, qui souhaite exécuter les trois frères Plummer, assassins de son père et de son frère. Toutes ces personnes font le difficile apprentissage de la cohabitation dans un espace clos. Le voyage se poursuit dans une atmosphère de plus en plus tendue.', 'Walter Wanger Productions', 'https://image.tmdb.org/t/p/w1280/xohHfi6MijvL7EA5S745vlShZWz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7SYNEG50fKODsTP6h9phYM3BueV.jpg', 'https://www.youtube.com/embed/OE-VWDsdkwM', 97, '1939', 3.84, 1),
(996, 'United States of America', 'Assurance sur la mort', 'Walter Neff, un employé d\'une compagnie d’assurances, tombe amoureux de sa cliente et échafaude avec elle un plan pour supprimer le mari encombrant et ainsi partager avec elle l\'assurance-vie de ce dernier.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/drQOVMFowbjonav5zV651XK0WWN.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//u546kDNwrZ1ii6q8NqqQgHwRvoW.jpg', 'https://www.youtube.com/embed/OXNBKTJnM50', 107, '1944', 4.07, 1),
(1018, 'France', 'Mulholland Drive', 'À Hollywood, durant la nuit, Rita, une jeune femme, devient amnésique suite à un accident de voiture sur la route de Mulholland Drive. Elle fait la rencontre de Betty Elms, une actrice en devenir qui vient juste de débarquer à Los Angeles. Aidée par celle-ci, Rita tente de retrouver la mémoire ainsi que son identité.', 'Asymmetrical Productions', 'https://image.tmdb.org/t/p/w1280/d5gefer4mHnL5kOmlOP5rGumdM7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1P4vCGTvJc13VxejbRLbHA1dT6f.jpg', 'https://www.youtube.com/embed/l86gBd_UbrE', 146, '2001', 3.92, 1),
(1023, 'Denmark', 'Adam\'s Apples', 'Avec ses rangers, son crâne rasé, sa croix celtique tatouée sur le biceps, Adam affiche clairement ses sympathies. De son côté, Ivan, visage ouvert, chaussettes dans les sandales et col blanc de rigueur, accueille Adam dans sa paroisse. Convaincu de la bonté fondamentale de l\'homme, ce pasteur se voue tout entier et tout sourire à sa mission : accueillir d\'anciens taulards et oeuvrer à leur réhabilitation.Mais que peut valoir la foi d\'Ivan face à la malveillance faite homme ? Bref, que peut Dieu face au diable ? Grande question, qui s\'efface bientôt au profit d\'une interrogation tout aussi cruciale : d\'Adam ou d\'Ivan, qui est le plus dérangé des deux ?', 'M&M Productions', 'https://image.tmdb.org/t/p/w1280/kYZ5mqC6KrTPpFp7LotR5UbzFPj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//iVnsOj0MtVE1lzfillNAPqCdhpR.jpg', 'https://www.youtube.com/embed/', 94, '2005', 3.74, 1),
(1024, 'New Zealand', 'Créatures célestes', 'Christchurch (Nouvelle-Zélande), en 1952. Au collège, Pauline fait la connaissance de Juliet, une Anglaise dont le père vient d\'être nommé recteur de l\'université de Canterbury. Rapidement, une amitié naît entre les deux adolescentes. Unies par une imagination débordante, et partageant un même goût pour la littérature, elles s\'inventent un monde enchanteur. Leur relation exclusive ne tarde pas à inquiéter leurs parents respectifs, qui décident de les séparer...', 'Miramax', 'https://image.tmdb.org/t/p/w1280/mS3aUKDiJAthHBNho5bSmjKjE1X.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//r6YVNhTEbPrurey0u4Ldk0WG3VA.jpg', 'https://www.youtube.com/embed/wOPkqA7IlMw', 99, '1994', 3.5, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(1039, 'Austria', 'Les Héritiers', 'Un village autrichien dans les années 20. Un propriétaire original et cynique lègue ses biens à ses valets et servantes. Ils sont sept à se partager les terres, la ferme et le bétail, au grand dam des fermiers du voisinage qui voient d\'un mauvais oeil ce renversement de l\'ordre social. Car où va le monde quand le valet devient maître ? Les héritiers eux-mêmes ont du mal à se faire à cette folle idée, tandis qu\'autour d\'eux le drame couve…', 'BR', 'https://image.tmdb.org/t/p/w1280/hEfBbr0EMz1ocoI6kqC8K4LrCsy.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 95, '1998', 3.38, 1),
(1040, 'France', 'Le Guépard', 'En 1860, tandis que la Sicile est submergée par les bouleversements de Garibaldi et de ses Chemises Rouges, le prince Salina se rend avec toute sa famille dans sa résidence de Donnafugata. Prévoyant le déclin de l\'aristocratie, ce dernier accepte une mésalliance et marie son neveu Tancrède à la fille du maire de la ville, représentant la classe montante.', 'Titanus', 'https://image.tmdb.org/t/p/w1280/h0YOTruw3MVF5lMUvMrsfBN6mpC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//myikoqu8Z2gtE7TaBgk9r6fB9MF.jpg', 'https://www.youtube.com/embed/', 170, '1963', 3.84, 1),
(1049, 'France', 'Sommersby', 'Jack Sommersby revient dans son village après la Guerre Civile. Il y retrouve son fils, ses amis, mais surtout sa femme, Laurel. Celle-ci ne reconnaît pas vraiment l\'homme qu\'elle a épousé autrefois.', 'Canal+', 'https://image.tmdb.org/t/p/w1280/tAgQKLv0GK97Tr0bvdI66oXlEVb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tGhWuZp1fdM0mftTWv88nxgkBUl.jpg', 'https://www.youtube.com/embed/', 109, '1993', 3.17, 1),
(1050, 'China', 'Shower', 'Un père et ses deux fils. Le premier quitte la maison familiale et émigre vers le sud, ou l’économie est prospère. Le second, débile léger, reste sous la protection du père, qui devient gérant de bains publics pour subsister.', 'Imar Film Co., Ltd.', 'https://image.tmdb.org/t/p/w1280/ucOFjViGVGOlEVjVXAS3CqzwzQH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ipGtZEwR99uFyJPykTrjYLxPAik.jpg', 'https://www.youtube.com/embed/', 92, '1999', 3.51, 1),
(1051, 'United States of America', 'French Connection', 'Jimmy Doyle et Buddy Russo forment la meilleure équipe de la brigade des stupéfiants de New York. Une de leurs enquêtes les mène à une filière française, dont l\'un des relais serait une boutique de confiserie à Brooklyn...', 'D\'Antoni Productions', 'https://image.tmdb.org/t/p/w1280/xgn3UvgSJpf2CYCBpEVn5DUXwk6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//AsaW2VwcArvQmYjf2wsDjqWEn6f.jpg', 'https://www.youtube.com/embed/pFRx2fVeQj4', 104, '1971', 3.77, 1),
(1052, 'United Kingdom', 'Blow-Up', 'Thomas, un célèbre photographe de mode, prépare un reportage photo sur Londres. Il passe ainsi une nuit dans un asile de clochards, puis reçoit dans son atelier un groupe de cover-girls. Pour compléter son éventail de clichés, il prend ensuite discrètement en photo un couple d\'amoureux dans un parc. À sa grande surprise, la femme se précipite vers lui pour lui arracher son appareil. Elle le poursuit jusqu\'à son domicile et s\'offre même à lui dans l\'espoir de récupérer les négatifs. Intrigué, Thomas lui remet une autre pellicule. Une fois le précieux film développé, il découvre sur les agrandissements un corps inerte, caché derrière un buisson, et une main tenant un revolver…', 'Bridge Films', 'https://image.tmdb.org/t/p/w1280/ru7XGZEDmFY1GNAhUOprEBHbTIN.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1TOB9YhatqxIj5IMIZmnrwdL7AL.jpg', 'https://www.youtube.com/embed/', 110, '1966', 3.7, 1),
(1058, 'United States of America', 'À bout de souffle made in USA', 'Voleur au grand coeur sans foi ni loi, Jesse Jujack, après s\'être emparé d\'une voiture abat un policier. Dans l\'automobile, il découvre l\'adresse d\'une étudiante française, Monica Poiccard. Jesse en tombe éperdument amoureux.', 'Orion Pictures', 'https://image.tmdb.org/t/p/w1280/97VzQFnKyrBj6ZZfDn5gNeq3mtV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9MGPMn3sBncgH6OSAXP79Hm3Mo9.jpg', 'https://www.youtube.com/embed/cVfZNh2QDVQ', 100, '1983', 2.9, 1),
(1059, 'Japan', 'La Forteresse cachée', 'Un groupe formé d\'un général, de deux paysans et d\'une princesse qui détient le trésor du clan va tenter de rejoindre un territoire ami à travers les affres de la guerre civile du XVIème siècle japonais.', 'TOHO', 'https://image.tmdb.org/t/p/w1280/nnuPxeYxanLAPcAQezfylxQmaF3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aYD6bR1xs9OAK3lA5WHbvIX2gMN.jpg', 'https://www.youtube.com/embed/1n21B1vPBRg', 139, '1958', 3.99, 1),
(1073, 'United States of America', 'Arlington Road', 'Arlington Road est une rue tranquille de la banlieue de Washington. Michael Faraday, professeur d\'histoire, est l\'un des riverains de ce quartier tranquille. Sous des apparences sereines, il se remet difficilement de la mort de sa femme, agent du FBI, morte deux ans auparavant à la suite d\'une bavure. Son fils Grant est également hanté par le souvenir de sa mère. Ils sympathisent avec leurs nouveaux voisins, les Lang, famille modèle qui vient d\'aménager dans le pavillon d\'en face. Mais Michael est vite intrigué par le comportement de M. Lang...', 'Lakeshore Entertainment', 'https://image.tmdb.org/t/p/w1280/4yYHyZuyTTQaEZuHKS7561jXjtR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7qfRbS477Io8JnYz739P0aXbBVh.jpg', 'https://www.youtube.com/embed/', 117, '1999', 3.5, 1),
(1075, 'Austria', 'Chat noir, chat blanc', 'Matko le gitan, qui vit au bord du Danube de petits trafics avec les Russes, a besoin d’argent pour réaliser un coup important. Il demande à Grga Pitic, parrain de la communauté gitane et vieil ami de la famille, de le financer. Grga accepte, mais Matko n’est pas à la hauteur et se fait doubler par le dangereux Dadan. Pour solder sa dette, Dadan lui propose de marier son fils Zare à Ladybird, sa minuscule sœur cadette. Mais Zane en aime une autre, la blonde Ida. Le mariage a lieu. La mariée profite d’un moment d’inattention et s’enfuit…', 'CiBy 2000', 'https://image.tmdb.org/t/p/w1280/bbeSx7usxfCl0ey8MklidtRnvxr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rqNM5Y6xNi5isZLDBRfvt8qCgJ3.jpg', 'https://www.youtube.com/embed/', 130, '1998', 3.84, 1),
(1088, 'Germany', 'Paï : l\'Élue d\'un peuple nouveau', 'À 12 ans, Paï est la petite fille du chef Koro. Celui-ci doit trouver le garçon qui sera digne de devenir son successeur. Paï se sent dotée des qualités particulières pour devenir chef Maori mais son grand-père, parce qu\'elle est une fille, refuse de l\'initier. Elle devra alors apprendre en cachette les rituels traditionnels afin de lui montrer qu\'elle est à la hauteur du légendaire « Whale Rider », le cavalier des mers.', 'South Pacific Pictures', 'https://image.tmdb.org/t/p/w1280/gfnbBX1OZINgzL6HdmwX9su2qax.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ppcLeOwKQLzg7BT1spZhaafuGL5.jpg', 'https://www.youtube.com/embed/E7I06gAqx2c', 97, '2003', 3.58, 1),
(1089, 'United States of America', 'Point Break', 'In Los Angeles, a gang of bank robbers who call themselves The Ex-Presidents commit their crimes while wearing masks of Reagan, Carter, Nixon and Johnson. Believing that the members of the gang could be surfers, the F.B.I. sends young agent Johnny Utah to the beach undercover to mix with the surfers and gather information.', 'Largo Entertainment', 'https://image.tmdb.org/t/p/w1280/eGSfqknufcsXmM2Rb59H9SiNd4T.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yGOHbICOQwlJ20UjK8F2ChGJjvl.jpg', 'https://www.youtube.com/embed/vxjBSIbM3UU', 122, '1991', 3.55, 1),
(1090, 'Germany', 'Passé virtuel', 'Passionné de logiciels et des années trente, Hannon Fuller est parvenu à recréer l\'époque qu\'il affectionne, dans laquelle il peut se projeter. Au cours d\'un de ses voyages virtuels, il fait une découverte aussi fascinante qu\'effrayante, dont il cherche à faire part à son associé, Douglas Hall. Malheureusement, il est assassiné avant d\'avoir pu communiquer son secret. Pour l\'inspecteur McBrian, Douglas devient le suspect ideal. Pour prouver son innocence, Douglas décide de trouver l\'assassin de son ami dans son passé virtuel.', 'Centropolis Film Productions', 'https://image.tmdb.org/t/p/w1280/cVKXNMLEVA6mN5ciQZevxv1ZuGi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nJ0jz1J3zNja31UEMeklhgFeMw5.jpg', 'https://www.youtube.com/embed/egCnBwlqLv8', 101, '1999', 3.51, 1),
(1091, 'Canada', 'The Thing', 'Une équipe de recherche américaine, basée en Antarctique, est attaquée par une créature capable de prendre l\'apparence de ses victimes.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/gajOIkrWq10MDjpHwCmIt4Yip2z.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jaO8WurWoUBE55nskqtFqPZFFaO.jpg', 'https://www.youtube.com/embed/VSZbppxWrN4', 109, '1982', 4.02, 1),
(1092, 'United Kingdom', 'Le troisième homme', 'Au lendemain de la Seconde Guerre mondiale. Invité par son ami Harry Lime, le romancier américain Holly Martins se rend à Vienne, divisée en quatre zones d\'occupation. Tout juste arrivé, il apprend que Lime vient de perdre la vie dans un accident de la circulation et qu\'on l\'enterre ce jour même. L\'écrivain n\'est pas au bout de ses surprises. Au cimetière, il est abordé par le major Calloway, pour qui Lime n\'était qu\'un vulgaire trafiquant, une crapule. Choqué, Martins décide de mener une enquête sur le défunt. Il fait bientôt la connaissance du mystérieux baron Kurtz, l\'un des deux témoins de l\'accident, l\'autre étant un Roumain du nom de Popescu…', 'London Films Productions', 'https://image.tmdb.org/t/p/w1280/4Yeqe1eiM6GVPwIqWWhidCFP1Z4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//l2iY1AgqQ8dEa3FtWkN5TQ5aVbU.jpg', 'https://www.youtube.com/embed/', 104, '1949', 4, 1),
(1093, 'France', 'Ascenseur pour l\'échafaud', 'Un homme assassine son patron avec l\'aide de sa femme dont il est l\'amant. Voulant supprimer un indice compromettant, il se retrouve bloqué dans l\'ascenseur qui l\'emporte sur les lieux du crime.', 'Nouvelles Éditions de Films (NEF)', 'https://image.tmdb.org/t/p/w1280/r6iFAvndVjJmGBK955zL0gwGtuq.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aTKvtg7KEXnbAPhQ2pF9KXO4oKM.jpg', 'https://www.youtube.com/embed/', 88, '1958', 3.82, 1),
(1103, 'United States of America', 'New York 1997', '1997, Manhattan est une ville-prison où sont enfermés 3 millions de prisonniers. Victime d’un attentat, l’avion du Président des États-Unis s’écrase dans Manhattan. Snake Plissken est chargé de le retrouver et le ramener sous 24 heures. Passé ce délai, les implants qu’il a dans la tête exploseront…', 'AVCO Embassy Pictures', 'https://image.tmdb.org/t/p/w1280/op05bjnqg8DczRldzay2bLO1lbp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qcCo2yV6xoak7tMI9YfGSoJgxKW.jpg', 'https://www.youtube.com/embed/n86imTuzZXk', 99, '1981', 3.53, 1),
(1114, 'Mongolia', 'L\'Histoire du chameau qui pleure', 'C\'est l\'été en Mongolie. Une famille de nomades aide les chamelles du troupeau à mettre bas. L\'une d\'elles y parvient difficilement. Dès la naissance, elle se désintéresse de son bébé et lui refuse son lait. La tradition veut qu\'on fasse venir un violoniste pour émouvoir la chamelle et la réconcilier avec son bébé chameau...', 'Hochschule für Fernsehen und Film (HFF)', 'https://image.tmdb.org/t/p/w1280/e46i87t6lKFwgwB4YEXGY97WaBW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8jB2BJAbXTVAUl3GvbyGCEXKXMe.jpg', 'https://www.youtube.com/embed/', 87, '2003', 3.54, 1),
(1115, 'France', 'Gespenster', '', 'Schramm Film', 'https://image.tmdb.org/t/p/w1280/3LATciTJFq7zf0GrT6mgPM7qCJZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xeC3cJqCGIforWA6iIVwGWh4TZu.jpg', 'https://www.youtube.com/embed/0SclolUcPvg', 85, '2005', 3.15, 1),
(1116, 'France', 'Le vent se lève', 'Irlande, 1920. Des paysans s\'unissent pour former une armée de volontaires contre les redoutables Black and Tans, troupes anglaises envoyées par bateaux entiers pour mater les velléités d\'indépendance du peuple irlandais.Par sens du devoir et amour de son pays, Damien abandonne sa jeune carrière de médecin et rejoint son frère Teddy dans le dangereux combat pour la liberté...', 'Sixteen Films', 'https://image.tmdb.org/t/p/w1280/w1f3fnnhk406J9YT3SG7FJq4kSz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fKrFGB96kVeJ9uE83Jc4fIWBgqO.jpg', 'https://www.youtube.com/embed/', 124, '2006', 3.7, 1),
(1123, 'France', 'Au nom de la liberté', 'En Afrique du Sud, Patrick Chamusso mène une vie simple entre sa famille et son poste à la raffinerie de pétrole de Secunda. Lorsque des activistes tentent de faire sauter la raffinerie, Patrick n\'est pas là. Il a pris une journée pour aller encourager son équipe de foot lors d\'une finale, et rendre visite en secret au fils qu\'il a eu avec son ex-petite amie. Nic Vos, un policier blanc, arrête Patrick et deux autres ouvriers noirs. Pour protéger son mariage, Patrick cache l\'alibi qui pourrait le sauver, jusqu\'à ce que sa femme, Precious, soit arrêtée à son tour et battue. Il avoue un mensonge et déclare avoir aidé les activistes. Mais Vos comprend la vérité et le relâche. Cet épisode ouvre les yeux de Patrick, qui décide de rejoindre le mouvement de l\'African National Congress (ANC). Cette fois-ci, il se porte volontaire pour détruire la raffinerie…', 'Working Title Films', 'https://image.tmdb.org/t/p/w1280/oEefK80ZaLCNrUjoPTOGQGPxKLX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ytYBqBpjOSFsw58qhhHrp5zC6Bg.jpg', 'https://www.youtube.com/embed/', 104, '2006', 3.13, 1),
(1124, 'United Kingdom', 'Le Prestige', 'Londres, au début du siècle dernier... Robert Angier et Alfred Borden sont deux magiciens surdoués, promis dès leur plus jeune âge à un glorieux avenir. Une compétition amicale les oppose d\'abord l\'un à l\'autre, mais l\'émulation tourne vite à la jalousie, puis à la haine. Devenus de farouches ennemis, les deux rivaux vont s\'efforcer de se détruire l\'un l\'autre en usant des plus noirs secrets de leur art. Cette obsession aura pour leur entourage des conséquences dramatiques...', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/37Fr7lY4QBHsuxlLJIfTNxW6nGW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mfJepkInUbiZ0mFXFhDNz8ko6Zr.jpg', 'https://www.youtube.com/embed/8UYo3uBaLe8', 130, '2006', 4.1, 1),
(1125, 'United States of America', 'Dreamgirls', 'L\'action de Dreamgirls débute dans la première moitié des turbulentes sixties et suit jusqu\'au milieu des années 70 l\'ascension d\'un trio de chanteuses composé d\'Effie, Deena et Lorrell. À l\'occasion d\'un concours de chant, ces jeunes et prometteuses \"Dreamettes\" sont repérées par l\'ambitieux manager Curtis Taylor Jr...', 'Laurence Mark Productions', 'https://image.tmdb.org/t/p/w1280/cDAgIDhGg6gvzuv3fLdL8EXGXdE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8wYluVq5AVXhnFFMhUYD9D4rTz5.jpg', 'https://www.youtube.com/embed/9gsl55lkNbE', 130, '2006', 3.39, 1),
(1126, 'New Zealand', 'In My Father\'s Den', 'Paul est un photographe de guerre désabusé. Il revient en Nouvelle-Zélande, dans la région isolée de son enfance, à la mort de son père, et retrouve son passé. A sa grande surprise, il trouve également Célia, 16 ans, la fille de sa première petite amie, qui rêve de quitter sa petite ville pour découvrir le monde.\r Mais leurs familles respectives et les gens de la ville voient leur amitié d\'un mauvais oeil. Le jour où Célia disparait, Paul se voit de plus en plus persécuté, et devient le principal suspect. Alors que la sombre vérité remonte progressivement à la surface, Paul est obligé de se confronter à la trahison et à la tragédie familliale qu\'il avait fuie dans sa jeunesse, et d\'affronter les conséquences du silence et du secret qui pèsent sur sa vie d\'adulte.', 'IFMD Ltd.', 'https://image.tmdb.org/t/p/w1280/tnFvXenEmwfESsw401SE6N9oFQp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//enR3QQW5AtpNbRtSMsFPTX3eX4O.jpg', 'https://www.youtube.com/embed/', 126, '2004', 3.56, 1),
(1127, 'Spain', 'Princesas', 'Caye et Zulema, prostituées dans les quartiers chauds de Madrid, ne se connaissent pas. La première se révolte contre son sort. Elle range dans une petite boîte en fer des billets de banque qu\'elle économise patiemment. La seconde, immigrée dominicaine sans papiers, se sent perdue dans ce pays étranger et fait profil bas pour pouvoir nourrir son fils. Un jour, agressée par un client violent, Zulema est courageusement secourue par Caye. Les deux femmes se lient d\'amitié et décident de prendre leur vie en main. Car Zulema, qui manque de confiance en elle et souffre de la solitude, espère aussi changer son destin. Autrefois, Zulema a été heureuse, peut-être le sera-t-elle à nouveau...', 'Reposado Producciones', 'https://image.tmdb.org/t/p/w1280/4synvio5SOpXHqd11qCjOLenO4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ltR2gdyFc2cbiNHW7LCfqBbQgye.jpg', 'https://www.youtube.com/embed/', 113, '2005', 3.4, 1),
(1162, 'United States of America', 'Miracle en Alabama', 'A la suite d\'une maladie, Helen Keller, une petite fille de sept ans, perd l\'usage de la parole, de la vue et de l\'ouïe. Ses parents font alors appel à Annie Sullivan, une jeune éducatrice, pour ramener l\'enfant à une vie normale. Mais celle-ci va devoir face à l\'hostilité d\'Helen et de ses parents effrayés par ses méthodes.', 'Playfilm Productions', 'https://image.tmdb.org/t/p/w1280/o8e5iUTOoZxtoUViZUvbgoO1wqH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lUUB7fPMx5bNYpE1ePoKlO8eaKj.jpg', 'https://www.youtube.com/embed/91bb-kvF9XA', 106, '1962', 3.95, 1),
(1163, 'United States of America', 'The Miracle Worker', 'Une jeune femme, Annie Sullivan, tente d\'aider une petite fille sourde, aveugle et muette. Elle va essayer d\'établir un contact avec elle et de la sortir de sa solitude.', 'Walt Disney Pictures', 'https://image.tmdb.org/t/p/w1280/A0PfwIMM7Mkit0ZoLzspgOWrmsQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 95, '2000', 3.5, 1),
(1164, 'France', 'Babel', 'En plein désert marocain, un coup de feu retentit. Il va déclencher toute une série d\'événements qui impliqueront un couple de touristes américains au bord du naufrage, deux jeunes Marocains auteurs d\'un crime accidentel, une nourrice qui voyage illégalement avec deux enfants américains, et une adolescente japonaise rebelle dont le père est recherché par la police à Tokyo. Séparés par leurs cultures et leurs modes de vie, chacun de ces quatre groupes de personnes va cependant connaître une même destinée d\'isolement et de douleur…', 'Babel Productions Inc.', 'https://image.tmdb.org/t/p/w1280/kM7WbyfQg5eVBXM4mQBvW7GKfCS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oW5I6bexwnTNAS1mMVTfrGF3WZS.jpg', 'https://www.youtube.com/embed/T7ho5PSXl9Q', 135, '2006', 3.59, 1),
(1165, 'France', 'The Queen', 'Dimanche 31 août 1997. La princesse Diana meurt des suites d\'un accident de voiture survenu sous le pont de l\'Alma à Paris. Si cette disparition plonge la planète dans la stupeur, elle provoque en Grande-Bretagne un désarroi sans précédent. Alors qu\'une vague d\'émotion et de chagrin submerge le pays, Tony Blair, élu à une écrasante majorité au mois de mai précédent, sent instantanément que quelque chose est en train de se passer, comme si le pays tout entier avait perdu une sœur, une mère ou une fille. Au château de Balmoral en Écosse, Elizabeth II reste silencieuse, distante, apparemment indifférente. Désemparée par la réaction des Britanniques, elle ne comprend pas l\'onde de choc qui ébranle le pays. Pour Tony Blair, il appartient aux dirigeants de réconforter la nation meurtrie et il lui faut absolument trouver le moyen de rapprocher la reine de ses sujets éplorés.', 'Granada Productions', 'https://image.tmdb.org/t/p/w1280/wg18pnn6m0QIkTd09sLAAtMr6Oz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wDr0XU8oLlZbtWgg5G25Gi4aEiE.jpg', 'https://www.youtube.com/embed/5Cee0OBlYL8', 99, '2006', 3.48, 1),
(1213, 'United States of America', 'Le Talentueux M. Ripley', 'Tom Ripley, jeune homme désargenté mais ambitieux, attire l’attention d’un riche vieillard, Herbert Greenleaf, qui le charge de convaincre son fils Dickie, exilé en Italie, de rentrer aux États‐Unis. Sur place, Tom se laisse fasciner par l’existence insouciante et dorée que mène le jeune oisif. Il adopte ses goûts, imite son comportement, désire sa compagne, et va jusqu’à s’éprendre de Dickie lui‐même. Celui‐ci, dans un premier temps, traite Tom comme un ami mais, très vite, il commence à le trouver encombrant, pour ne pas dire énervant. Un jour, alors qu’ils sont seuls en mer, Tom avoue son amour à Dickie, qui le repousse violemment. Le conflit qui s’ensuit se termine par la mort de Dickie…', 'Timnick Films', 'https://image.tmdb.org/t/p/w1280/vU4qTwtFpYF5EDsQwxqn4B83hzk.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//51UDa3IuGyiKGe2MgMcLGvJE2Fm.jpg', 'https://www.youtube.com/embed/cS4XGbu3NT4', 133, '1999', 3.59, 1),
(1244, 'Germany', 'Das wilde Leben', '', 'Babelsberg Film', 'https://image.tmdb.org/t/p/w1280/iS4lKOubeG7cHIT5eC1xev8mtWb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sTomxWxuyzUjnSvZ2Odsg6n7VOn.jpg', 'https://www.youtube.com/embed/', 114, '2007', 3.2, 1),
(1245, 'United Kingdom', 'Les Vestiges du jour', 'Un Américain, Lewis, vient d\'acheter la riche et vaste demeure de Darlington Hall. À peine installé, il prie James Stevens, majordome dans la maison depuis plus de 30 ans, de prendre des vacances. Stevens décide d\'en profiter pour rendre visite à madame Benn, qu\'il connut et aima sans jamais le lui avouer, lorsqu\'elle n\'était encore que miss Sarah Kenton et œuvrait comme gouvernante à Darlington Hall. Pendant le trajet, Stevens se souvient. Il revoit son maître, lord Darlington, un inépuisable partisan du rapprochement entre l\'Allemagne nazie et l\'Angleterre, éprouvant encore l\'espèce de fidélité qui le liait à cet homme controversé…', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/74by6zzrrfr817p1CLkvJKZtQRJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6fQMuCjxdaezTAWVP3MOp3YOhaa.jpg', 'https://www.youtube.com/embed/', 128, '1993', 3.69, 1),
(1246, 'United States of America', 'Rocky Balboa', 'Rocky Balboa, le légendaire boxeur, a depuis longtemps quitté le ring. De ses succès, il ne reste plus que des histoires qu\'il raconte aux clients de son restaurant. La mort de son épouse lui pèse chaque jour et son fils ne vient jamais le voir. Le champion d\'aujourd\'hui s\'appelle Mason Dixon, et tout le monde s\'accorde à le définir comme un tueur sans élégance ni cœur. Alors que les promoteurs lui cherchent désespérément un adversaire à sa taille, la légende de Rocky refait surface. L\'idée d\'opposer deux écoles, deux époques et deux titans aussi différents enflamme tout le monde. Pour Balboa, c\'est l\'occasion de ranimer les braises d\'une passion qui ne l\'a jamais quitté. L\'esprit d\'un champion ne meurt jamais...', 'Rogue Marble', 'https://image.tmdb.org/t/p/w1280/n1bDWLREGtXSqmQx2KoA5WBPX22.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9mwMaNeeqPXJviKk2UKLxFm9vUW.jpg', 'https://www.youtube.com/embed/K_z4bNupt1A', 105, '2006', 3.4, 1),
(1247, 'United States of America', 'Raisons d’État', 'Pour Edward Wilson, seul témoin du suicide de son père et membre de la Skull and Bones Society à l\'Université de Yale, l\'honneur et la discrétion sont des valeurs primordiales. Ce sont ces qualités qui poussent la CIA, l\'agence gouvernementale qui vient d\'être créée, à le recruter. Influencé par l\'ambiance paranoïaque que provoque la guerre froide dans toute l\'agence, Wilson se montre de plus en plus suspicieux. Son pouvoir grandit, mais il a de moins en moins confiance en ceux qui l\'entourent. Son obsession du travail va lui coûter cher, l\'isolant chaque jour un peu plus de ses proches et de celui qu\'il était…', 'Morgan Creek Productions', 'https://image.tmdb.org/t/p/w1280/aai7Y4RquuNK8ACYuveFB4HEZEl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9djPnra3CJs83JAqcyhy9lpvsnI.jpg', 'https://www.youtube.com/embed/FOrhrfB5l8g', 167, '2006', 3.17, 1),
(1248, 'Czech Republic', 'Hannibal Lecter : Les Origines du mal', 'Comment un petit garçon comme les autres est‐il devenu l’un des criminels les plus fascinant qui soit ? Au travers du parcours atypique d’un adolescent meurtri par les atrocités vécues pendant la Seconde Guerre Mondiale, suivez la naissance de l’incarnation absolue du mal… Hannibal Lecter.', 'Young Hannibal Productions', 'https://image.tmdb.org/t/p/w1280/dDhHJysEmDRoNRJM0WHfUloI8cS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//am6ZfhUTUmcjPjjA4GIkLEJ33TN.jpg', 'https://www.youtube.com/embed/VTVGED-3i5c', 115, '2007', 3.12, 1),
(1249, 'Canada', 'Hollywoodland', '16 juin 1959. L\'acteur George Reeves, le héros du feuilleton télévisé Les Aventures de Superman, est abattu d\'une balle dans sa maison des collines de Hollywood. Il laisse derrière lui sa fiancée, la starlette Leonore Lemmon, et des millions de fans sous le choc. Malgré les circonstances étranges de sa mort, la police clôt aussitôt l\'affaire, mais la mère de George, Helen Bessolo, n\'est pas décidée à s\'en tenir là. Elle engage un détective privé, Louis Simo. Celui-ci découvre que la liaison torride entre Reeves et Toni, l\'épouse d\'Eddie Mannix, un cadre haut placé chez MGM, pourrait bien être la clé du meurtre. L\'enquête de Simo va le conduire dans l\'envers du décor de Hollywood et il va se rendre compte que la justice y règne plus sur les écrans que dans la vie. L\'affaire implique beaucoup de monde et il n\'en sortira pas indemne. George Reeves avait des secrets...', 'Focus Features', 'https://image.tmdb.org/t/p/w1280/4fLd3QKSanNLehzsSBAWT2tneuu.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//grBVNhFI7iNB54eFfXVzbYfDSQk.jpg', 'https://www.youtube.com/embed/', 126, '2006', 3.05, 1),
(1250, 'United States of America', 'Ghost Rider', 'Johnny Blaze n’était qu’un cascadeur adolescent lorsqu’il vendit son âme au diable. Aujourd’hui, célèbre casse-cou le jour, il incarne le légendaire Ghost Rider la nuit. Chasseur de prime du diable, il doit traquer les âmes diaboliques sur Terre et les retourner en enfer. Mais une rencontre inespérée avec l’amour de sa vie le pousse à croire qu’il peut retrouver le bonheur, s’il vainc le diable et reprend son âme. Pour réussir, il devra terrasser Blackheart, le fils rebelle du diable, qui complote de faire régner le mal sur Terre en renversant son père, à moins que Ghost Rider ne l’arrête.', 'Crystal Sky Pictures', 'https://image.tmdb.org/t/p/w1280/2UkrnXldUQyRrU6Q1pPyr0Xgsnd.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7zS58YPAw002RNejOF1vNB3XHbW.jpg', 'https://www.youtube.com/embed/nu6R7ypaz5g', 105, '2007', 2.77, 1),
(1251, 'Japan', 'Letters from Iwo Jima', 'The story of the battle of Iwo Jima between the United States and Imperial Japan during World War II, as told from the perspective of the Japanese who fought it.', 'DreamWorks Pictures', 'https://image.tmdb.org/t/p/w1280/kZokxQtzMPURvijWYFuvh1fAvnv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//p9V3vD1Ye2zRNfTsE8oY58Fe81S.jpg', 'https://www.youtube.com/embed/lXV1Xi_xyck', 141, '2006', 3.73, 1),
(1252, 'United States of America', 'Cœurs perdus', 'À la fin des années 40, un couple aussi séduisant que mortel sème la panique dans tous les États-Unis. Leur mode opératoire est toujours le même : Ray séduit de jeunes femmes isolées et les dépouille, puis avec le soutien actif de Martha, les tue. L\'inspecteur Elmer C. Robinson se lance à leurs trousses, et cette affaire change définitivement sa vie.', 'Millennium Films', 'https://image.tmdb.org/t/p/w1280/1N93yYs05JBG881lb9HIOy8ZCJA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cUh3QGvpXXdeNdms7I86XVDL4bv.jpg', 'https://www.youtube.com/embed/2u1cPQ_DatU', 108, '2006', 3.02, 1),
(1253, 'United Kingdom', 'Par effraction', 'Will traverse une période difficile avec Liv, sa compagne. Il vient en plus d\'installer son cabinet d\'architecte paysagiste dans King\'s Cross, un quartier de Londres en pleine réhabilitation. Ses luxueux locaux attirent une bande du coin qui le cambriole à répétition. Excédé, Will finit par suivre l\'un des jeunes voleurs jusque chez lui où le jeune homme, Miro, vit avec sa mère, Amira, une réfugiée bosniaque.Afin d\'en apprendre plus sur le gang, Will s\'arrange pour sympathiser avec Amira mais rapidement, des sentiments imprévus surgissent... Pour Will, c\'est le début d\'une plongée au cœur d\'un autre univers que le sien, et au plus profond de lui-même.', 'Miramax', 'https://image.tmdb.org/t/p/w1280/yC1CbijqIwmQpw4G7zBPQw3yS0T.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qpeCN9X4QHxPh8yWF5gRp1wxfct.jpg', 'https://www.youtube.com/embed/g2Ekg4rYSKE', 119, '2006', 3.02, 1),
(1254, 'France', 'Je vais bien, ne t’en fais pas', 'Comme elle rentre de vacances, Lili, 19 ans, apprend par ses parents que Loïc, son frère jumeau, suite à une violente dispute avec son père, a quitté la maison. Loïc ne lui donnant pas de nouvelles, Lili finit par se persuader qu\'il lui est arrivé quelque chose et part à sa recherche. Ce qu\'elle va découvrir dépasse l\'entendement.', 'Fin Août Productions', 'https://image.tmdb.org/t/p/w1280/ffk3hWeY5CGEdEEab2qAaueYCPv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//y0eyUFB8dBLKjbQFeAgFMiklQDq.jpg', 'https://www.youtube.com/embed/PEgJhjd0mqs', 96, '2006', 3.62, 1),
(1255, 'Japan', 'The Host', 'À Séoul, Park Hee-bong tient un petit snack au bord de la rivière Han où il vit avec les siens. Il y a son fils aîné, l\'immature Gang-du, sa fille Nam-joo, une championne malchanceuse de tir à l\'arc, et Nam-il, son fils cadet éternellement au chômage. Tous idolâtrent la petite Hyun-seo, la fille unique de Gang-du. Un jour, un monstre géant et inconnu jusqu\'à présent, surgit des profondeurs de la rivière. Quand la créature atteint les berges, elle se met à piétiner et attaquer la foule sauvagement, détruisant tout sur son passage. Le snack démoli, Gang-du tente de s\'enfuir avec sa fille, mais il la perd dans la foule paniquée. Quand il l\'aperçoit enfin, Hyun-seo est en train de se faire enlever par le monstre qui disparaît, en emportant la fillette au fond de la rivière. La famille Park décide alors de partir en croisade contre le monstre, pour retrouver Hyun-seo...', 'Chungeorahm Film', 'https://image.tmdb.org/t/p/w1280/gqAii6XERy4vv1lK6C9fUI5y9OX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//44F22wn408ya0sipaezfRhTiBpQ.jpg', 'https://www.youtube.com/embed/1HRTy26s4hw', 121, '2006', 3.49, 1),
(1256, 'Austria', 'Dead in 3 days', 'When Nina and her high school friends receive eerie text messages declaring that they will all die within three days, they dismiss it as a hokey prank - until one by one, the pals start turning up dead in the alpine countryside. With the cops stymied, Nina and her remaining friends must scour their past for clues to identify the madman before he kills them all.', 'Allegro Film', 'https://image.tmdb.org/t/p/w1280/9OqDWRgUDtrkLZ57RwyMz8NzV81.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//L7EFekOOIN1bw9gj8NCHNmrZlN.jpg', 'https://www.youtube.com/embed/XHpXfMBF8KA', 97, '2006', 2.68, 1),
(1257, 'United States of America', 'A la recherche de l\'homme parfait', 'Daphné Wilder vit avec ses trois filles, Maggie, Mae et Milly. Elle décide de trouver l\'homme parfait; pour Milly, afin que celle-ci ne fasse pas les mêmes erreurs qu\'elle. Daphné fait donc passer, à l\'insu de ses filles, une petite annonce personnelle pour sélectionner les prétendants...', 'Gold Circle Films', 'https://image.tmdb.org/t/p/w1280/mfF62Jk0wSmjLHEO6N45V8CwebS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rdcE4paOjDuslZeZYA8zPRD6ngc.jpg', 'https://www.youtube.com/embed/uz9WTvEWio0', 102, '2007', 2.97, 1),
(1259, 'United States of America', 'Chronique d\'un scandale', 'Enseignante, à la veille de la retraite dans un collège de Londres, Barbara Covett n\'a rien d\'autre dans sa vie que son travail et un chat. Sa solitude prend fin avec l\'arrivée du nouveau professeur d\'art, Sheba Hart. La jeune femme se révèle l\'amie idéale dont Barbara avait toujours rêvé. Lorsque Barbara découvre que sa nouvelle amie a une liaison avec un de ses jeunes élèves, leur relation prend un tour plus redoutable. Barbara menace de révéler le scandale à tout le monde, à commencer par le mari de Sheba... Dans ce jeu trouble et cruel, ce sont les propres secrets et les obsessions de Barbara qui font surface. Entre les deux femmes, commence un affrontement qui va les emmener au bout de leurs faux-semblants et de leurs mensonges...', 'Fox Searchlight Pictures', 'https://image.tmdb.org/t/p/w1280/dgx8OJo2QDJLNN0OTVvUsnfGXlN.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sp1EIJbzwXRTlzlWiwEA1HGq6ym.jpg', 'https://www.youtube.com/embed/vEGIZKrVoqw', 92, '2006', 3.55, 1),
(1260, 'Estonia', 'Leiutajateküla Lotte', '', 'Eesti Joonisfilm', 'https://image.tmdb.org/t/p/w1280/3m9N28O67WLL7wKNO08dU7CaNdu.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ciSyb3yWsvpmLknmDQYgUsMQCIu.jpg', 'https://www.youtube.com/embed/', 81, '2006', 4.25, 1),
(1262, 'United States of America', 'Stranger Than Fiction', 'Harold Crick is a lonely IRS agent whose mundane existence is transformed when he hears a mysterious voice narrating his life.', 'Three Strange Angels', 'https://image.tmdb.org/t/p/w1280/nCzcepubwShvZ4vbCsygQNgF2Z1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//d9eONXYtCmQnPWw61w9pNMGlSzK.jpg', 'https://www.youtube.com/embed/', 113, '2006', 3.63, 1),
(1263, 'Germany', 'Die Aufschneider', '', '3L Filmproduktion GmbH', 'https://image.tmdb.org/t/p/w1280/zCYO4z5qNN66iHz5A76eA9ErzlI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pwB4oc2oJjS57qLXTs0FJsEkbAv.jpg', 'https://www.youtube.com/embed/', 92, '2007', 3.1, 1),
(1264, 'Bahamas', 'The Wild Soccer Bunch 4', 'With the victory against \"The Beastly Beasts\", \"The Wild Soccer Bunch\" showed it to everyone and then won every single game. Only one victory now separates them from the \"Pott\", the Freestyle Soccer Cup. For this they have to compete against the \"Wolves of Ragnarök\". But the wolves are not normal opponents! They have a dark secret - and behind them lurks a power stronger than all of them: the girl Horizon and the \"Silver Lights\" from the fog...', 'Bayerischer Banken-Fonds', 'https://image.tmdb.org/t/p/w1280/hfTuyoAIE6KtrrwAW26NXBXVFJI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kcERl3Rkh8ogn48QJt7boGiMMPP.jpg', 'https://www.youtube.com/embed/', 110, '2007', 2.64, 1),
(1265, 'United States of America', 'Le Secret de Térabithia', 'Jess est un garçon solitaire menant une vie terne. A l\'école, il est la cible de toutes les moqueries et, chez lui, se retrouve obligé d\'aider ses parents, qui éprouvent des difficultés financières, à effectuer les tâches ménagères. Ce quotidien monotone est transformé le jour où Jess fait la connaissance de Leslie, une nouvelle voisine. Dotée d\'une imagination débordante, elle entraîne Jess dans un monde féerique qu\'elle invente avec lui. Dès qu\'ils franchissent un fossé situé dans les bois proches de leurs maisons, les deux enfants gagnent un univers mystérieux, le royaume perdu de Térabithia, où rôdent de dangereuses créatures au service du roi des Ombres...', 'Lauren Levine Productions Inc.', 'https://image.tmdb.org/t/p/w1280/3S6GixboJDYu4teEbZDvd2CTszb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sqpFZaPi3VSXDRRz4gRFlHfrYKy.jpg', 'https://www.youtube.com/embed/6lntp4WR6eE', 95, '2007', 3.65, 1),
(1266, 'United States of America', 'Au bout de la nuit', 'Traversant une période de deuil, après la mort de sa femme, Tom Ludlow, vétéran de la police de Los Angeles, est accusé du meurtre d\'un policier. Toutes les preuves l\'accablant, il se retrouve acculé par tous les principes qu\'il défendait auparavant. À présent, seul contre tous, le policier va devoir renier son intégrité et utiliser les armes contre lesquelles il luttait, pour se défendre, remettant en question la loyauté de tous ses partenaires.', 'Fox Searchlight Pictures', 'https://image.tmdb.org/t/p/w1280/z4e7XSFsbDlY2k5Dxx2pkudH0hY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zsotFMYDF6cBcXc7aEEf2ygu6UG.jpg', 'https://www.youtube.com/embed/7LZxhQRq6Y4', 109, '2008', 3.31, 1),
(1267, 'United States of America', 'Bienvenue chez les Robinson', 'Rejoignez un jeune inventeur appelé Lewis dans cette aventure dans le temps pour trouver la famille qu’il n’a jamais connue. En 2037, les grenouilles qui font du hip hop et les chiens qui portent des lunettes sont aussi courants que les dinosaures qui parlent. Le futur repose entre les mains de Lewis, mais il ne peut pas le sauver seul, il aura besoin de l’aide de la famille Robinson.', 'Walt Disney Pictures', 'https://image.tmdb.org/t/p/w1280/mWzGk1CJ3kZOx4KcHxHGPvSaGKU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//f1xAxP0DFRGYSew9U8fhilP5itx.jpg', 'https://www.youtube.com/embed/pw53iDKo9nc', 102, '2007', 3.44, 1),
(1268, 'France', 'Les Vacances de Mr. Bean', 'Mr. Bean a gagné une semaine de vacances sur la Côte d\'Azur, et une caméra vidéo. Il quitte son Angleterre natale pour la France. Arrivé à Paris, il demande à un autre passager de le filmer en train de monter à bord du train pour Cannes. L\'homme est en fait le réalisateur russe Emil Duchevsky, qui se rend à Cannes pour faire partie du jury du Festival du Film. Dans la confusion du départ, Duchevsky rate le train, et Mr. Bean se retrouve à bord avec Stepan, son fils de dix ans, qui ne parle pas un mot d\'anglais. Pour Mr. Bean et Stepan commence alors un périple vers le sud de la France plein de surprises, de rencontres et d\'aventures toutes plus délirantes les unes que les autres...', 'Tiger Aspect Productions', 'https://image.tmdb.org/t/p/w1280/6TX8aDredNIFgLmS3tnRi9wMwQI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6bsZQV3CBFs7JQySYVX5npZWkh0.jpg', 'https://www.youtube.com/embed/ZV_HYwmEi_k', 90, '2007', 3.17, 1),
(1269, 'Germany', 'Neues vom Wixxer', '', 'GFP Medienfonds', 'https://image.tmdb.org/t/p/w1280/uZBbfB0OrEM6YuTc8j3KNaATSmn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jebknLWJIkB652DqNWaGEUdXbbY.jpg', 'https://www.youtube.com/embed/', 98, '2007', 3.22, 1),
(1271, 'Bulgaria', '300', 'Adapté du roman graphique de Frank Miller, 300 est un récit épique de la Bataille des Thermopyles, qui opposa en l’an – 480 le roi Léonidas et 300 soldats spartiates à Xerxès et l’immense armée perse. Face à un invincible ennemi, les 300 déployèrent jusqu’à leur dernier souffle un courage surhumain ; leur vaillance et leur héroïque sacrifice inspirèrent toute la Grèce à se dresser contre la Perse, posant ainsi les premières pierres de la démocratie.', 'Virtual Studios', 'https://image.tmdb.org/t/p/w1280/hGZ9sDGcekhJUFmu3NnOhRT8uQS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//eGhjeUbzttA3E4flxdAm8gHz4h4.jpg', 'https://www.youtube.com/embed/1R2HpgDVrFc', 115, '2007', 3.58, 1),
(1272, 'United Kingdom', 'Sunshine', 'En cette année 2057, le soleil se meurt, entraînant dans son déclin l’extinction de l’espèce humaine. Le vaisseau spatial Icarus II avec à son bord un équipage de 7 hommes et femmes dirigé par le Capitaine Kaneda est le dernier espoir de l’humanité. Leur mission : faire exploser un engin nucléaire à la surface du soleil pour relancer l’activité solaire…', 'Ingenious Media', 'https://image.tmdb.org/t/p/w1280/pyj5oX4lucbWnqV3jGyS0gpbJoc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5AIAnucJKZ3sHpm7r1ykFVIoUHK.jpg', 'https://www.youtube.com/embed/07TJdBME5S8', 104, '2007', 3.48, 1),
(1273, 'Hong Kong', 'TMNT', 'Depuis la défaite de leur ennemi juré The Shredder, les liens se sont distendus entre Leonardo, Raphael, Donatello et Michelangelo. Leur vieux gourou, le rat géant Splinter fait tout ce qu\'il peut pour maintenir un semblant de cohésion au sein de cette tumultueuse équipe, et s\'inquiète d\'autant qu\'il sent planer une lourde menace sur New York.De fait, le richissime industriel Max Winter est en train de lever une vaste armée de monstres aux fins de dominer le monde. Aidés de leurs fidèles comparses April O\'Neil et Casey Jones, nos Tortues vont devoir livrer le plus féroce combat de leur vie en affrontant à nouveau le mystérieux clan des \"Foot\", recruté par le diabolique Winter...', 'Imagi Animation Studios', 'https://image.tmdb.org/t/p/w1280/uYC6q7wBYJuw6mAXgxKqCTQLF7u.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//92mpNNg6v2PN2HN2C2Z4g0v3Tya.jpg', 'https://www.youtube.com/embed/', 86, '2007', 3.05, 1),
(1277, 'Germany', 'La chanson du sombre dimanche', '', 'Studio Hamburg Filmproduktion', 'https://image.tmdb.org/t/p/w1280/7cjNxmJUmz3gaaN6LYRJuEYtaKe.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7AkasKcoVAvK7WCW3kDiOY4Z3KY.jpg', 'https://www.youtube.com/embed/', 112, '1999', 3.97, 1),
(1278, 'France', 'Innocents : The Dreamers', 'Isabelle et son frère Théo, restés seuls à Paris pendant les vacances de leurs parents, invitent chez eux Matthew, un étudiant américain. Dans cet appartement où ils sont livrés à eux-mêmes, ils vont fixer les règles d\'un jeu qui les amènera à explorer leur identité émotionnelle et sexuelle. Au fil des heures, la partie s\'intensifie, les sens et les esprits s\'exacerbent. Avec pour toile de fond la France déchirée de Mai 68, reflet d\'une jeunesse dont la voix résonne dans toute l\'Europe, The Dreamers est un voyage initiatique : celui de trois adolescents testant leurs propres limites pour enfin se trouver.', 'Fiction Films', 'https://image.tmdb.org/t/p/w1280/sxfS3A6d5soVDTriDdT44Vwlmua.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xtvxa5Hu69blChmb5ndJ9poTkgB.jpg', 'https://www.youtube.com/embed/', 116, '2003', 3.61, 1),
(1279, 'South Korea', 'Samaria', 'Jae-yeong est une jeune fille encore insouciante : désireuse de s\'envoler pour l\'Europe, elle n\'a pas trouvé de moyen plus simple et plus rapide que la prostitution pour parvenir sans mal à ses fins. Elle prend le tout avec calme et naïveté, bientôt convaincue d\'être capable, à l\'image de prostituées légendaires, d\'apporter bonheur et félicité à ses nombreux clients. Yeo-jin, sa meilleure amie mais aussi sa plus proche collaboratrice, voit bientôt d\'un très mauvais œil les esquisses de relations que Jae-yeong tente de tisser avec ces hommes traversant épisodiquement sa vie.', 'Kim Ki Duk Film', 'https://image.tmdb.org/t/p/w1280/hdtu7xj30Ksfyd1xcWkeAUwX4BE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lvWOPNKEKEFDUfYyWOz62N2T2D9.jpg', 'https://www.youtube.com/embed/', 95, '2004', 3.47, 1),
(1280, 'South Korea', 'Locataires', 'Tae-suk arpente les rues à moto. Il laisse des prospectus sur les poignées de porte des maisons. Quand il revient quelques jours après, il sait ainsi lesquelles sont désertées. Il y pénètre alors, occupe ces lieux inhabités, sans jamais rien y voler. Il va même jusqu\'à laver le linge, réparer les objets cassés qui l\'entourent. Un jour, il s\'installe dans une maison aisée où habite Sun-houa, une femme maltraitée par son mari. Dès qu\'il découvre sa présence, il quitte les lieux. Pourtant, ne pouvant l\'oublier, il revient sur ses pas pour l\'emmener avec lui. Dès lors, d\'appartements en villas, de demeures en maisons, le couple partage en silence la solitude qui les unit. Alors que tout le monde cherche à les séparer, un étrange lien aussi puissant qu\'invisible semble les confondre.', 'Kim Ki Duk Film', 'https://image.tmdb.org/t/p/w1280/tbOplbFYVrmslSv190n35MmGpSb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nFtkNsd01rYZMQGyZJos2pagOHD.jpg', 'https://www.youtube.com/embed/nDlDyMl-9m0', 90, '2004', 3.9, 1),
(1281, 'United Kingdom', 'Bean', 'Le richissime général Newton a fait don à la Galerie Grierson de cinquante millions de dollars pour rapatrier aux États-Unis le chef-d\'œuvre de la peinture américaine : \"La Mère de Whistler\". Soucieux de donner le maximum de retentissement à cet événement, les administrateurs invitent la Royal National Gallery de Londres à envoyer sur place leur meilleur spécialiste en la matière. Erreur fatale : les Anglais profitent de l\'occasion pour expédier à Los Angeles leur employé le plus haï et le plus nul, dans l\'espoir de s\'en débarrasser. Son nom est Bean, Mr. Bean.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/rhDxMUDwE7D6H9v0BDd8MWPUOw3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5CVbU1Bw8Vd302SkojmLDTyFFB3.jpg', 'https://www.youtube.com/embed/Wiul5mwRWZ0', 90, '1997', 3.23, 1),
(1282, 'United States of America', 'Dogtown and Z-Boys', 'Un documentaire sur les pionniers du skate board dans les années soixante-dix.', 'Agi Orsi Productions', 'https://image.tmdb.org/t/p/w1280/eb02dpopuAhuThf7nXAAwKtAF88.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rWd7kpQ4rPAwFX6Z17DwT0O2Wmv.jpg', 'https://www.youtube.com/embed/0yrEHjl1vFo', 90, '2001', 3.55, 1),
(1283, 'Spain', 'Torrente, le bras gauche de la loi', 'Torrente, ex-policier madrilène, cynique, poivrot et supporter invétéré de l\'Atlético, deuxième équipe de football de la capitale, va tenter de rétablir l\'ordre et de faire respecter sa loi dans un quartier des bas-fonds.', 'Cartel', 'https://image.tmdb.org/t/p/w1280/3wAeqkJ8vq7TjkfUp4ikHT15oVn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zmLobjBZtfZiCqOUMKJJUCrrNF9.jpg', 'https://www.youtube.com/embed/', 100, '1998', 3.21, 1),
(1284, 'Spain', 'Torrente 2: Misión en Marbella', '', 'Amiguetes Entertainment', 'https://image.tmdb.org/t/p/w1280/5AACrCo881PtAy3Q6BhSa8L4avr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qlZhJXm2F898eTSQfo855AvdLtm.jpg', 'https://www.youtube.com/embed/', 99, '2001', 3, 1),
(1285, 'Spain', 'Torrente 3: The Protector', 'A popular and beautiful politician plans to expose the evil-doings of a multinational corporation. Hoping to silence her, the corporation\'s top executives decide to hire the most incompetent detective they can find to act as her bodyguard.', 'Atresmedia', 'https://image.tmdb.org/t/p/w1280/s6T6Sg2d98FKo3g1VCAjzJcW4H0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6QEjYHQEIgKHMzdmCwNY1C2WVV3.jpg', 'https://www.youtube.com/embed/nn7fhaEtAqg', 91, '2005', 2.7, 1),
(1294, 'Germany', 'Quatre minutes', 'Depuis soixante ans, Traude Krüger enseigne le piano à des détenues. Quand elle rencontre Jenny, jeune femme incarcérée pour meurtre, elle comprend immédiatement qu\'elle a affaire à une musicienne prodige. Passionnée par le talent de la jeune fille, Traube veut la préparer pour le Concours d\'entrée du Conservatoire. Mais la jeune femme, violente et suicidaire, est réfractaire à la moindre discipline. Obstinée, la vieille Traude Krüger ne désarme pourtant pas.', 'Kordes & Kordes Film', 'https://image.tmdb.org/t/p/w1280/lBmn123egHcW14NHNMWPQ5owhCz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oMU9AaYTYgMrmKa0nX3HViuSGzK.jpg', 'https://www.youtube.com/embed/A_dwdoOQhpo', 112, '2006', 3.42, 1),
(1358, 'Japan', 'A Brief History of Time', '', 'TBS', 'https://image.tmdb.org/t/p/w1280/suzXlM1q3L4tS29pWvYomAbFn6c.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mC6cE2M2UtGPTE0WdmOV12dgPgP.jpg', 'https://www.youtube.com/embed/', 80, '1991', 3.64, 1),
(1359, 'Canada', 'American Psycho', 'Au cœur des années Reagan, Patrick Bateman est un pur produit de la réussite américaine. Jeune, riche, il est un de ces golden boys qui triomphent à la bourse. Seul le nec plus ultra est digne de lui et il s\'emploie à ne retrouver que des symboles qui lui renvoient une image de succès. Il accumule, avec une obsession maladive, les vêtements de luxe, les relations enviables. Son vœu le plus cher est de se fondre dans cette foule, de trouver sa place au milieu de ceux auxquels il s\'identifie.', 'Muse Productions', 'https://image.tmdb.org/t/p/w1280/2DWqsx0vafGcfytSIwhtL5nI1uV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bneUTWFAcVCdsb0O5UwZbJd8xqZ.jpg', 'https://www.youtube.com/embed/QKD2PfX3tE8', 101, '2000', 3.7, 1),
(1360, 'Canada', 'Frida', 'Frida retrace la vie mouvementée de Frida Kahlo, artiste peintre mexicaine du XXe siècle qui se distingua par son oeuvre surréaliste, son engagement politique en faveur du communisme et sa bisexualité. Le film se concentre également sur les relations tumultueuses de Frida avec son mari, le peintre Diego Rivera, et sur sa liaison secrète et controversée avec Léon Trotski.', 'Miramax', 'https://image.tmdb.org/t/p/w1280/rPO3pzRgwaOFPGMqZoCcbXqYnx5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//s04Ds4xbJU7DzeGVyamccH4LoxF.jpg', 'https://www.youtube.com/embed/5LGJYo3hvz4', 123, '2002', 3.72, 1),
(1361, 'United States of America', 'Le retour du roi', 'L\'histoire de la quête de l\'anneau unique, forgé en secret par le démoniaque Sauron. Adapté du roman de J.R.R. Tolkien, \"Le retour du roi\" (\"The return of the King\").', 'Rankin/Bass Productions', 'https://image.tmdb.org/t/p/w1280/4Jt6i7iWSs5I81RPB17Ks5K0N49.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fBzwSM5zl4xp9L3rFu1PihmY0vh.jpg', 'https://www.youtube.com/embed/', 98, '1980', 3.26, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(1362, 'Japan', 'Bilbo le hobbit', 'L\'histoire de Bilbon Sacquet, hobbit paisible de la Comté, entrainé malgré lui dans une formidable aventure. Accompagné du magicien Gandalf et de treize nains, il devra récupérer un trésor dérobé par le terrible dragon Smaug...Adapté du roman de J.R.R. Tolkien \"Bilbo le hobbit ou l\'Histoire d\'un aller et retour\" (\"The Hobbit: There and back again\").', 'Rankin/Bass Productions', 'https://image.tmdb.org/t/p/w1280/2ohvyMPhvjftLrM6S6Ljr6QrL0u.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qNVf39jp9fZSLd1bWMYjOrrEkI2.jpg', 'https://www.youtube.com/embed/', 77, '1977', 3.3, 1),
(1363, 'United Kingdom', 'The Hi-Lo Country', 'An intimate story of the enduring bond of friendship between two hard-living men, set against a sweeping backdrop: the American West, post-World War II, in its twilight. Pete and Big Boy are masters of the prairie, but ultimately face trickier terrain: the human heart.', 'Gramercy Pictures', 'https://image.tmdb.org/t/p/w1280/m73KqOLXf9ZvPVCWS5dz5Hv7yQF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dTRQV0gfaOn2lAE6dJExUiwkDIr.jpg', 'https://www.youtube.com/embed/', 114, '1998', 3.14, 1),
(1364, 'Spain', 'Lucia et le sexe', 'Après la mort de son petit ami, Lucia, qui est serveuse à Madrid, disparaît. Elle s\'est exilée sur une île méditerranéenne afin de se ressourcer. Dans le calme de son exil, elle redécouvre les aspects troubles de son ancienne relation amoureuse.', 'Alicia Produce S L', 'https://image.tmdb.org/t/p/w1280/xnPGDtlTxANwpQPTSRBOOMRvgQL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2neCPMW5BZaJ7JpR2IRTpVw5KiJ.jpg', 'https://www.youtube.com/embed/', 122, '2001', 3.34, 1),
(1365, 'United States of America', 'À L\'Ombre De La Haine', 'Dans une petite ville du sud des États-Unis, Hank Grotowski, comme son père Buck avant lui, travaille au quartier des condamnés à mort au sein de la prison locale. Son fils Sonny y fait également ses débuts. Hank a depuis longtemps appris à être distant et froid, tandis que Sonny fait preuve d\'une grande sensibilité. Tous deux sont en charge de l\'exécution capitale de Lawrence Musgrove, un Noir dont le passe-temps favori est de dessiner des portraits. Sa femme Leticia et son fils Tyrell viennent régulièrement lui rendre visite. A la suite de tragiques événements, Hank et Leticia vont être amenés à faire connaissance. Cette rencontre va bouleverser leur existence.', 'Lions Gate Films', 'https://image.tmdb.org/t/p/w1280/vl417EMpofCzui3KlnKfZ1ecNCX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//G8S6je8HJkPD9sDTctoIBEpvey.jpg', 'https://www.youtube.com/embed/sm0XXnscyMs', 111, '2001', 3.38, 1),
(1366, 'United States of America', 'Rocky', 'Dans les quartiers populaires de Philadelphie, Rocky Balboa collecte des dettes non payées pour Tony Gazzo, un usurier, et dispute de temps à autre, pour quelques dizaines de dollars, des combats de boxe sous l\'appellation de \'l\'étalon italien\'. Déçu de le voir gâcher son talent, son entraîneur Mickey le laisse tomber, tandis qu\'Apollo Creed, champion en titre, cherche un nouveau challenger...', 'Winkler Films', 'https://image.tmdb.org/t/p/w1280/ewRu7vMtqH1OA9WJHYUp0e3Xf9t.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yPgAHVzCF0yJGhxupwVwknOHdJj.jpg', 'https://www.youtube.com/embed/v78idDv3gfM', 119, '1976', 3.89, 1),
(1367, 'United States of America', 'Rocky II : La Revanche', 'Battu aux points lors de son dernier combat, Rocky n\'accepte pas cette défaite et ne veut plus entendre parler de boxe. Il épouse Adrian, dépense sa fortune sans compter et bientôt se retrouve sans le sou. Poussé a bout par Apollo, qui veut disputer un vrai match il accepte de jouer la revanche...', 'Winkler Films', 'https://image.tmdb.org/t/p/w1280/hscESJv9Gy4REpvK4aLV1Ao8dec.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5tLusfAXiRrpaWL6mxHV9BJTzVZ.jpg', 'https://www.youtube.com/embed/mDG7C2A_LI8', 119, '1979', 3.65, 1),
(1368, 'United States of America', 'Rambo', 'John Rambo, ancien combattant du Viêt-nam où il a gagné plusieurs médailles, est arrêté dans une petite ville pour vagabondage. Maltraité, il décide de fuir. La chasse à l’homme commence...', 'Carolco Pictures', 'https://image.tmdb.org/t/p/w1280/2Mwyb6d6fjOBG4tgKDuoLTfTQfi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dJrYUXjgYAD95Ho67t7Utdqv8At.jpg', 'https://www.youtube.com/embed/81x6XKy8p6Q', 97, '1982', 3.74, 1),
(1369, 'United States of America', 'Rambo II : La Mission', 'John Rambo purge une peine de prison lorsque le Colonel Trautman lui donne la possibilité de sortir pour une mission délicate : avoir la preuve qu\'il reste bel et bien des prisonniers américains au Vietnam.Supposé n\'être qu\'un observateur, Rambo désobéit aux ordres et tente de sauver un prisonnier. Murdock, le responsable de la mission, décide alors de l\'abandonner en territoire ennemi, Rambo, seul, sans armes et face à l\'ennemi, prépare sa vengeance et son retour au pays.', 'Carolco Pictures', 'https://image.tmdb.org/t/p/w1280/jPMoYbpY8faABzeE8dRAfprlfTW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//iUCNrTKQZRKmKMEMIznm2UlUmEd.jpg', 'https://www.youtube.com/embed/uJ_76yL0hMg', 96, '1985', 3.31, 1),
(1370, 'United States of America', 'Rambo III', 'Le Colonel Trautman contacte Rambo dans sa retraite en Thaïlande pour qu\'il l\'accompagne dans une mission périlleuse en Afghanistan. Mais l\'ex-soldat refuse afin de se consacrer aux moines bouddhistes qui l\'ont recueilli. Lorsque, quelques jours plus tard, l\'agent Griggs lui explique que Trautman a été capturé par le Colonel Zaysen, Rambo décide de sauver son ami. Il s\'infiltre dans les lignes ennemies et découvre toute l\'horreur du conflit qui oppose les moudjahidin à l\'armée soviétique. Déterminé, il s\'attaque à toute une armée sans oublier son objectif premier : récupérer Trautman.', 'TriStar Pictures', 'https://image.tmdb.org/t/p/w1280/zpWNN8q3HvOWMHmWtOTNBuShAcs.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nEuPSz6LhmrtYp7K56dbsmomuqA.jpg', 'https://www.youtube.com/embed/mLjHFJR3jLE', 100, '1988', 3.08, 1),
(1371, 'United States of America', 'Rocky III L\'Œil du Tigre', 'Rocky Balboa est aujourd\'hui un champion respecté après sa victoire contre Apollo Creed. Mais lorsqu\'il perd contre un nouveau venu sur le circuit, c\'est Apollo Creed lui-même qui va venir à sa rescousse et lui redonner le goût du combat et de la victoire.', 'Winkler Films', 'https://image.tmdb.org/t/p/w1280/zplg0q9s5pbJDQLWCTlIQfMxC9A.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1T7d8EuYnpZRc3yHxqa3vipZ2DE.jpg', 'https://www.youtube.com/embed/ZxMC4WYgqPI', 99, '1982', 3.45, 1),
(1372, 'Germany', 'Blood Diamond', 'Alors qu\'il purge une peine de prison pour ses trafics, Archer rencontre Solomon Vandy, un pêcheur d\'origine Mende. Arraché à sa famille et forcé de travailler dans les mines diamantifères, ce dernier a trouvé et caché, un diamant rose extrêmement rare. Accompagnés de Maddy Bowen, une journaliste idéaliste, les deux hommes s\'embarquent pour un dangereux voyage en territoire rebelle pour récupérer le fameux caillou. Un voyage qui pourrait bien sauver la famille de Salomon et donner à Archer la seconde chance qu\'il n\'espérait plus.', 'Virtual Studios', 'https://image.tmdb.org/t/p/w1280/6fwxe4yGfEEmhRlmkcDk9dAVzAe.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hzhaUhU8718DjimHvQx2b65yLBk.jpg', 'https://www.youtube.com/embed/yFqmQmJAT_0', 143, '2006', 3.76, 1),
(1373, 'United Kingdom', 'The Discovery of Heaven', 'Disappointed with humanity, God wants to revoke his contract with humanity and wants to take back the stone tablets containing the ten commandments. To this end an angel is sent out to affect the personal lives of three humans so an appropriate child may be conceived.', 'Kanzaman S.A.', 'https://image.tmdb.org/t/p/w1280/posrSb1UQBfsoPb9U68vWqbGMOb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/yxmqGA7XaO4', 127, '2001', 3.3, 1),
(1374, 'United States of America', 'Rocky IV', 'Apollo Creed, ancien adversaire et dorénavant ami de Rocky Balboa, est tué sur le ring par le boxeur russe Ivan Drago. Se reprochant de n\'avoir pu sauver son camarade à temps, Rocky va demander un combat contre Ivan Drago afin de le venger. Une confrontation qui se déroulera sur le sol russe.', 'Winkler Films', 'https://image.tmdb.org/t/p/w1280/bnd1dSQZyp6wL2AqtHG2PreJyZ5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ufUdEHvs31M8yw3HMFjhTaVJIVp.jpg', 'https://www.youtube.com/embed/rOXaPE6gklI', 91, '1985', 3.55, 1),
(1375, 'United States of America', 'Rocky V', 'Des séquelles physiques irréversibles amènent Rocky Balboa à prendre sa retraite. Ruiné, il devient l\'entraîneur d\'un champion en devenir, Tommy Gunn. Mais celui-ci ne va pas rester insensible à l\'appât du gain et va quitter Rocky pour rejoindre les rangs d\'un coach plus fortuné.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/829CIMdIhYgXWUSq7OjrpgtNAR7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ne1ivJv3lGGUvZ9F72P0r2xpksB.jpg', 'https://www.youtube.com/embed/016ZGmKIlcs', 104, '1990', 2.88, 1),
(1376, 'Germany', 'Sweet Sixteen', 'Dans quelques jours, Liam aura seize ans. Jean, sa mère qui est en prison, doit être libérée à temps pour l\'anniversaire de son fils.  Liam rêve d\'une famille comme il n\'en a jamais eue et redoute l\'influence de son grand-père, comme celle de Stan, le compagnon de Jean. Il veut un foyer, un endroit sûr pour sa mère, sa soeur Chantelle et lui-même.  Encore faut-il trouver de l\'argent et, pour un adolescent sans le sou, ce n\'est pas une mince affaire. Avec ses amis, Liam monte quelques combines, mais les ennuis ne vont pas tarder à commencer...', 'Alta Films S.A.', 'https://image.tmdb.org/t/p/w1280/cTDx9LyaMrJ78fKyRThM6qbk56u.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xpdXXd5i1IN7d4eOhqAreApobxT.jpg', 'https://www.youtube.com/embed/', 106, '2002', 3.52, 1),
(1377, 'United States of America', 'La péniche du bonheur', 'À la mort de sa femme dont il s\'était éloigné, Tom Winters décide de s\'occuper de l\'éducation de ses trois jeunes enfants qu\'il connaît fort peu. Il les emmène à Washington mais ceux-ci, habitués à la campagne ont du mal à se faire à cette nouvelle vie avec un père qui ne sait pas comment s\'y prendre. Un des enfants fait une fugue et est retrouvé par Cinzia, fille d\'un célèbre musicien italien. Winters la prend pour une pauvresse et lui propose une place de bonne…', 'Paramount', 'https://image.tmdb.org/t/p/w1280/pyWAbtQlBHq01EncREhPNSV9MAI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2FGHLkSXIUqpTr2iXMt9tyOY5es.jpg', 'https://www.youtube.com/embed/OeDHYXqHdng', 110, '1958', 3.19, 1),
(1378, 'Netherlands', 'Shortbus', 'Shortbus suit plusieurs personnages new-yorkais dont les aventures tragi-comiques naviguent entre sexualité et sentiments. Tous fréquentent un club underground moderne, Shortbus, où s\'expriment toutes les sexualités.  Sofia est sexologue et n\'a jamais connu l\'orgasme. Avec son mari Rob, elle simule le plaisir depuis des années. Sofia croise Severin, une maîtresse dominatrice qui tente de l\'aider.  Parmi les patients de Sofia, James et Jamie sont un couple gay qui tente d\'ouvrir ses relations sexuelles à un troisième partenaire. James propose une relation avec Ceth, mais Jamie reste sur ses gardes. James semble avoir un projet secret. Il est suivi par un mystérieux observateur, Caleb…', 'Fortissimo Films', 'https://image.tmdb.org/t/p/w1280/s8QBrWgpZpYrySSyTQ0xbFLPKrS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oOGKH94nhD2cd4AzQJUKCm5IQyZ.jpg', 'https://www.youtube.com/embed/', 102, '2006', 3.2, 1),
(1379, 'Finland', 'Les lumières du faubourg', 'Koistinen, gardien de nuit, arpente le pavé à la recherche d\'une petite place au soleil, mais l\'indifférence générale et la mécanique sans visage de la société se liguent pour briser ses modestes espoirs les uns après les autres.  Un groupe de bandits exploite sa soif d\'amour et son poste de veilleur de nuit avec l\'aide d\'une femme calculatrice. Ils organisent un cambriolage dont Koistinen est rendu seul responsable. Et voilà celui-ci privé de son travail, de sa liberté et de ses rêves.', 'Sputnik', 'https://image.tmdb.org/t/p/w1280/4YjjNGI4jI7NuWe8TzRXcyLxbVM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7sDOQT5EgZ08xmyInwAYaFYoCto.jpg', 'https://www.youtube.com/embed/', 77, '2006', 3.33, 1),
(1380, 'United States of America', 'Gleaming the Cube', 'An Orange County teenager\'s carefree life of ditching class and skateboarding abandoned pools comes to a screeching halt when someone close to him dies. The cops rule the death a suicide, but the bereaved skater believes he was murdered. It\'s up to him to solve the case, with a skateboard.', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/116J84YjEpMtZefgJtkDmEsdXWc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lBTk2RgneFZqSQyKBGHfpknT1RK.jpg', 'https://www.youtube.com/embed/', 101, '1989', 2.96, 1),
(1381, 'Canada', 'The Fountain', 'The Fountain raconte le combat à travers les âges d\'un homme pour sauver la femme qu\'il aime. Espagne, XVIe siècle. Le conquistador Tomas part en quête de la légendaire Fontaine de jouvence, censée offrir l\'immortalité. Aujourd\'hui. Un scientifique nommé Tommy Creo cherche désespérément le traitement capable de guérir le cancer qui ronge son épouse, Izzi. Au XXVIe siècle, Tom, un astronaute, voyage à travers l\'espace et prend peu à peu conscience des mystères qui le hantent depuis un millénaire. Les trois histoires convergent vers une seule et même vérité, quand les Thomas des trois époques - le guerrier, le scientifique et l\'explorateur - parviennent enfin à trouver la paix face à la vie, l\'amour, la mort et la renaissance.', 'Regency Enterprises', 'https://image.tmdb.org/t/p/w1280/un2myByLaRSMbK3W54RuhOIZN2K.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9RNJ0pKYA8EQiMa0lFZ68gzeElH.jpg', 'https://www.youtube.com/embed/', 96, '2006', 3.47, 1),
(1382, 'United States of America', 'Moi, toi et tous les autres', 'Christine Jesperson, une jeune artiste touchante et spontanée, mélange dans son quotidien art et réalité. Elle entre sur la pointe des pieds dans la vie de Richard, vendeur de chaussures, père de deux garçons et tout juste redevenu célibataire. Autour d\'eux, Robby et Peter, les enfants de Richard, son ex-femme, la patronne d\'une galerie d\'art, les voisins et les voisines. Tous sont à la recherche d\'un lien qui les connecte aux autres sur Terre...', 'IFC Films', 'https://image.tmdb.org/t/p/w1280/bIQqJevBFZ9oYmlHqZJLI5TtOyW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//riiT83kvwWhlBTaVTDA4RmDYrDh.jpg', 'https://www.youtube.com/embed/OYtWgmouQws', 87, '2005', 3.51, 1),
(1386, 'France', 'C\'était un rendez-vous', 'Une traversée de Paris, à grande vitesse, réalisée en plan séquence à l\'avant d\'une voiture.', 'Les Films 13', 'https://image.tmdb.org/t/p/w1280/xRa1Vs1z2FXmewlLWIM3ZMQilHl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4lw52AgWNADFkdU3VSRvFK4TPr6.jpg', 'https://www.youtube.com/embed/', 9, '1976', 3.6, 1),
(1387, 'United States of America', 'Superstar : l\'histoire de Karen Carpenter', 'Évocation, à l\'aide de poupées Barbie, de la vie de Karen Carpenter, chanteuse des Carpenters, décédée à 32 ans des suites d\'une anorexie.', 'Iced Tea Productions', 'https://image.tmdb.org/t/p/w1280/eqlwpI7NAe1SBTDtpklNqHkNJwI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8Mv3ldkLTo9w7cHvG1fwZxsVaAw.jpg', 'https://www.youtube.com/embed/', 43, '1988', 3.5, 1),
(1391, 'Mexico', 'Et... ta mère aussi', 'Les vies de Julio et Tenoch, deux adolescents de 17 ans, sont régies par leurs hormones, leur amitié et la vitesse précipitée avec laquelle ils cherchent à passer à l\'âge adulte. Au cours d\'un après-midi de fête familiale, ils font la rencontre de Luisa, une Espagnole de 28 ans, et ne tardent pas à flirter avec. En plaisantant, ils l\'invitent à les accompagner en voiture sur une plage sauvage appelée la Boca del cielo, sans lui dire où elle se situe, ni même si elle existe vraiment. Luisa les ignore aimablement, ils prennent des routes différentes, l\'incident est rapidement oublié. Cependant, celle-ci reçoit des nouvelles dévastatrices. Devant la nécessité d\'un changement dans sa vie, elle retrouve les garçons et accepte leur offre.', 'Bésame Mucho Pictures', 'https://image.tmdb.org/t/p/w1280/99eRV6tjlowL84D2hO6xdEVzmWe.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9G6m2ZFmtiX7IfbJ7b794UyDI80.jpg', 'https://www.youtube.com/embed/', 105, '2001', 3.71, 1),
(1392, 'United States of America', 'Camera kids', 'Quartier chaud de Calcutta : un groupe d\'enfants inoubliables. Ils sont souriants, pleins de vie, malicieux et drôles : ils sont les fils et filles de prostituées. Face à la plus grande des pauvretés, face aux abus et au désespoir, ils ont peu de chance d\'échapper à un futur écrit d\'avance et de se construire une vie meilleure.\r En compagnie de la photographe new-yorkaise Zana Briski qui leur enseigne l\'art de la photographie, ils embarquent dans un voyage extraordinaire qui va les transformer. Les photos prises par les enfants ne sont pas seulement exemplaires et remarquables en terme d\'observation, elles reflètent quelque chose de moralement plus grand : l\'art comme force immense de \"salut\" et d\'ascension.', 'Red Light Films', 'https://image.tmdb.org/t/p/w1280/e7OWmWptBRCnUKj6MJ2qbxj5ZY5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//r6Ai2I1F4rWlNo5SzAUzQ4hWGjC.jpg', 'https://www.youtube.com/embed/', 83, '2004', 3.47, 1),
(1393, 'Mongolia', 'Le Chien jaune de Mongolie', 'Nansal, une gamine de six ans, est l\'aînée d\'une famille de nomades du Nord de la Mongolie. Un jour, elle ramène chez elle un chien abandonné, mais son père pense qu\'il va leur porter malheur et veut qu\'elle s\'en débarrasse. Nansal tente de le cacher, mais le jour où la famille déménage, elle doit abandonner le chien...', 'BKM Film', 'https://image.tmdb.org/t/p/w1280/889pJGbT83Xw3zY2GxzPOQZw2iN.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sJnd3cwK2IzDphBPv3HqaLNdzkO.jpg', 'https://www.youtube.com/embed/', 93, '2005', 3.65, 1),
(1394, 'Italy', 'Nostalghia', 'Un poète russe, Gortchakov, est à la recherche d\'un compatriote compositeur qui a séjourné en Italie au XVIIIe siècle. Il est accompagné dans son voyage par une jeune interprète, Eugenia. Dans un village où se trouve une piscine thermale dédiée à sainte Catherine de Sienne, il fait la rencontre d’un ermite, Domenico, qui lui confie une tâche originale.', 'Sovinfilm', 'https://image.tmdb.org/t/p/w1280/d9NbXdJHvyPLCBtPYqEFdbeVaL5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ePq5SQuGHbQ209pf4ViE747dGCw.jpg', 'https://www.youtube.com/embed/ruz8jMsjROA', 130, '1983', 3.94, 1),
(1396, 'Soviet Union', 'Le Miroir', 'Alexeï, malade et alité pour une « blanche, blanche journée », profite de son oisiveté forcée pour s’adonner à un long monologue intérieur. Il se laisse, pour d’obscures raisons, aller à un soudain besoin irrépressible de replonger dans sa propre mémoire. Il y voit notamment défiler ses sentiments ambivalents pour sa mère, et le souvenir amer d’un père poète, ayant trop tôt déserté le foyer familial. Par ce voyage intime qui le mène au cœur de son enfance, Alexeï espère éclaircir les mystères de son devenir. Il le renvoie pourtant irrémédiablement à sa propre situation et celle de son fils, confronté comme lui à une séparation parentale et au départ du père.', 'Mosfilm', 'https://image.tmdb.org/t/p/w1280/6gGQ2MW3DZ8aCCpqX13Q5lARp8W.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5t3ObSn7mRi2QpV9Rs7heb3y9rJ.jpg', 'https://www.youtube.com/embed/', 105, '1975', 4, 1),
(1410, 'United States of America', 'Dark Star', '« Dark Star » est un vaisseau spatial chargé de détruire les planètes qui encombrent le système solaire. Alors qu\'il s\'apprête à lancer une nouvelle bombe, une avarie se produit.', 'Jack H. Harris Enterprises', 'https://image.tmdb.org/t/p/w1280/boSPCWGqQ8zSJkpvQil859aYXqi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//u6qDqxrCSeo81oZ46Q4M04HItMM.jpg', 'https://www.youtube.com/embed/', 85, '1974', 3, 1),
(1411, 'United States of America', 'Dernier sacrifice', 'Sharon est une femme dont la vie l\'ennuit. Elle est télé-opératrice et n\'a plus aucun goût, plus d\'envie. Par chance, elle intègre une petite secte chrétienne qui lui redonne de nouveaux objectifs. Elle se remarie avec l\'un de ses anciens amants, Randy, et conçoivent une fille. Mais un beau jour, Randy est brutalement assassiné...', 'Fine Line Features', 'https://image.tmdb.org/t/p/w1280/j36g0oeqS2hk5rrxVZvAn4Erwvx.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ylXFsNIhzq8A5nEqLhPdDYPOnVo.jpg', 'https://www.youtube.com/embed/', 100, '1991', 2.9, 1),
(1412, 'United States of America', 'Sexe, mensonges & vidéo', 'John et Ann Melaney forment un couple apparemment sans histoires. Mais en vérité, rien ne va plus entre eux. Ne ressentant plus le besoin de faire l\'amour, Ann se refuse à son mari. Celui-ci a décidé de la délaisser pour Cynthia, sa sœur, une femme au tempérament diamétralement opposé. Un ami de John, Graham Dalton, de retour dans sa ville natale, s\'installe pour quelque temps chez les Melaney. Au départ, Ann se sent irritée par cet homme au charme évident et à la franchise inhabituelle. Jusqu\'au jour où il lui révèle son impuissance, ainsi que sa manie d\'enregistrer en vidéo les révélations que lui font les femmes au sujet de leur sexualité… (Palme d\'Or à Cannes 1989)', 'Miramax', 'https://image.tmdb.org/t/p/w1280/yHiI1AK3EGAgDbKBe3VIsIZOMUQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kKWWahS4JBfmqFHocMXdQTyODAF.jpg', 'https://www.youtube.com/embed/6BMZrfINaUk', 100, '1989', 3.47, 1),
(1413, 'United States of America', 'M. Butterfly', 'In 1960s China, French diplomat Rene Gallimard falls in love with an opera singer, Song Liling - but Song is not at all who Gallimard thinks.', 'Geffen Pictures', 'https://image.tmdb.org/t/p/w1280/zPanmbKQxDOdmNr6Uy82y2wsUhc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7cqxSTOUe0olgvjXxRs8XedFjOr.jpg', 'https://www.youtube.com/embed/fgANS15AN4I', 101, '1993', 3.29, 1),
(1414, 'Finland', 'Les Amants du cercle polaire', 'Dans la froide Laponie finlandaise, sous l\'éternel soleil de minuit, deux amants ardents se retrouvent une fois de plus après une longue période de séparation, gouvernée par un puissant et éloquent motif circulaire tissé par le destin, la foi et l\'amour. Peuvent-ils refuser leur destin ?', 'Sogetel', 'https://image.tmdb.org/t/p/w1280/c2MSWUxtRxGyJhAzAkaDADYJT5h.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//v27qs9LEtgxXgNYuzkdjXy9Hpcc.jpg', 'https://www.youtube.com/embed/', 112, '1998', 3.65, 1),
(1415, 'Netherlands', 'Party Monster', 'L\'ascension et la chute de Michael Alig, une personnalité des nuits new-yorkaises, au début des années quatre-vingt dix. Celui-ci assassina son fournisseur de drogue et pensa pouvoir échapper aux forces de l\'ordre.', 'ContentFilm', 'https://image.tmdb.org/t/p/w1280/fAkq4jzFttRaxpIt7HhpsiFGhxI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yd1AWFcHxwvvu1sjEYNB0LiaQdE.jpg', 'https://www.youtube.com/embed/', 98, '2003', 2.93, 1),
(1416, 'South Korea', 'The Coast Guard', 'En Corée du Sud, une base militaire sur la côte veille à ce qu\'aucun espion de Corée du Nord ne pénètre dans le pays. Pour nombre de militaires présents, cette mission tient plus de la corvée que du sacerdoce. Le soldat Kang, par contre, prend tout cela très à cœur : il ne vit en fait que pour une chose, pouvoir abattre un espion nord-coréen. Un soir, alors qu\'il monte la garde, il aperçoit une ombre sur la plage avoisinante. Pas de doute, un homme se cache derrière les rochers. Kang ouvre le feu et, afin de ne laisser aucune chance à sa cible, lance même une grenade. Une fois rendu sur place avec son unité, le jeune obsédé de la gâchette découvre pourtant une réalité bien différente : l\'homme qu\'il a abattu est un pêcheur du coin qui était en train de faire l\'amour avec sa douce, Mee-Young…', 'Prime Entertainment', 'https://image.tmdb.org/t/p/w1280/9y03SRX71EMKTaUC5huUaM0aDRy.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//greamH3Xe4jvAySICzV167yfZ5r.jpg', 'https://www.youtube.com/embed/LTMhKoopuvI', 95, '2002', 3.2, 1),
(1417, 'Mexico', 'Le Labyrinthe de Pan', 'Espagne 1944. Ofelia s’installe avec sa mère dans une garnison dirigée par Vidal, son beau‐père, capitaine autoritaire de l’armée franquiste. À proximité de la grande maison familiale, la jeune fille découvre un étrange labyrinthe gardé par une créature nommée Pan. Le monstre lui révèle qu’elle n’est autre que la princesse d’un royaume enchanté. Afin de découvrir la vérité, Ofelia devra se soumettre à trois épreuves que rien ne l’a préparée à affronter…', 'Estudios Picasso', 'https://image.tmdb.org/t/p/w1280/pRUZ15Z6UWPdxYjyN9paQdefDaK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gsR5KLGBDa7oqjPCciKDVuiWfcx.jpg', 'https://www.youtube.com/embed/5GtDgxRJ1K0', 113, '2006', 3.88, 1),
(1418, 'Spain', 'Ne dis rien', 'Par une nuit d\'hiver, une jeune femme, Pilar, s\'enfuit de chez elle en emmenant son fils. Antonio, son mari, la poursuit, veut la ramener à la maison, lui promet de changer, de ne plus être violent. Rien n\'y fait, Pilar a pris sa décision. Il va alors tenter de la reconquérir et de maîtriser ses accès de colère qui immanquablement débouchent sur de la violence physique. Thérapie de groupe, retour sur soi, Antonio veut guérir. Mais pendant ce temps, Pilar va trouver loin de son époux un nouveau sens à sa vie.', 'Producciones La Iguana S.L.', 'https://image.tmdb.org/t/p/w1280/k5st4MNgfSoXKHU7Pi5uF60RySZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7i0WHzf7GxUhfnrj1vOQRrKwrqK.jpg', 'https://www.youtube.com/embed/9X45K0NHSO4', 104, '2003', 3.61, 1),
(1419, 'Germany', 'Vollidiot', '', 'Goldkind Filmproduktion', 'https://image.tmdb.org/t/p/w1280/bbtlSUOiNLEV1JvS99WtwKpBtE5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hszsENCd2zuAGKO2Jpm3uMXNQyB.jpg', 'https://www.youtube.com/embed/', 102, '2007', 2.14, 1),
(1420, 'Ireland', 'Breakfast on Pluto', 'Patrick \"Kitten\" Brady a quitté son Irlande natale en quête d\'une nouvelle vie dans le tourbillon londonien des années 70. En quête d\'identité sexuelle, il devient travesti et côtoie le monde haut en couleur de la prostitution. Au gré de ses errances et de ses rencontres, \"Kitten\" va rapidement se trouver mêlé à un complot de l\'IRA visant la capitale britannique.', 'Pathé Pictures International', 'https://image.tmdb.org/t/p/w1280/14tmdb1PiLNDZf3VD29S2nUKVV0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rK3mQca9rBpCPepDjHIvedJX4nA.jpg', 'https://www.youtube.com/embed/', 122, '2005', 3.58, 1),
(1421, 'France', 'L\'Homme qui aimait les femmes', 'Bertrand est autant amoureux des femmes que de l\'idée même de la femme. Pour lui, toutes les femmes sont uniques et irremplaçables. Elles sont à la fois l\'œuvre de sa vie, son inspiration artistique et la cause de sa mort. Une passion qu\'il résume par ces mots : \"Les jambes de femmes sont des compas qui arpentent le globe terrestre en tous sens, lui donnant son équilibre et son harmonie\".', 'Les Films du Carrosse', 'https://image.tmdb.org/t/p/w1280/bBp78xFpP12AkNgco6WLOX0gcxd.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cTaT7WiNAS7rCl1sdl7xtYGBx6b.jpg', 'https://www.youtube.com/embed/wpa0CsmPqpI', 118, '1977', 3.6, 1),
(1422, 'Hong Kong', 'Les Infiltrés', 'À Boston, une lutte sans merci oppose la police à la pègre irlandaise. Pour mettre fin au règne du parrain Frank Costello, la police infiltre son gang avec « un bleu » issu des bas quartiers, Billy Costigan. Tandis que Billy s’efforce de gagner la confiance du malfrat vieillissant, Colin Sullivan entre dans la police au sein de l’Unité des Enquêtes Spéciales, chargée d’éliminer Costello. Mais Colin fonctionne en « sous‑marin » et informe Costello des opérations qui se trament contre lui. Risquant à tout moment d’être démasqués, Billy et Colin sont contraints de mener une double vie qui leur fait perdre leurs repères et leur identité. Traquenards et contre‑offensives s’enchaînent jusqu’au jour où chaque camp réalise qu’il héberge une taupe. Une course contre la montre s’engage entre les deux hommes avec un seul objectif : découvrir l’identité de l’autre sous peine d’y laisser sa peau…', 'Vertigo Entertainment', 'https://image.tmdb.org/t/p/w1280/xHeuF5zzlx1YxkULiz0mx1TMBJ7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6WRrGYalXXveItfpnipYdayFkQB.jpg', 'https://www.youtube.com/embed/KHumQ6EIrgE', 151, '2006', 4.08, 1),
(1440, 'United States of America', 'Little Children', 'The lives of two lovelorn spouses from separate marriages, a registered sex offender, and a disgraced ex-police officer intersect as they struggle to resist their vulnerabilities and temptations.', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/so9xla7b7WfFiarDwOukhQpRuyd.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3qxeRRkU6bf7JqiY5umzlSCtHNO.jpg', 'https://www.youtube.com/embed/137660756', 137, '2006', 3.54, 1),
(1441, 'Bulgaria', 'The Contract', 'Attempting to recover from a recent family trauma by escaping into the woods for a peaceful hiking trip, an ex-lawman and his young son stumble across a dangerous contract killer.', '3L Filmverleih', 'https://image.tmdb.org/t/p/w1280/sU2yzV3T1LetBdQPAeBRDb4YwLo.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//btd9VPSfnVh0pHZqbiUJLsOkBDf.jpg', 'https://www.youtube.com/embed/lFELOkQbHDc', 96, '2006', 2.86, 1),
(1442, 'Germany', 'Full Metal Village', '', 'Flying Moon Filmproduktion GmbH', 'https://image.tmdb.org/t/p/w1280/62uE6zG7I3RvZl0b4mFBoUpCAet.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 90, '2007', 3.28, 1),
(1443, 'United States of America', 'Virgin Suicides', 'Dans une ville américaine tranquille et puritaine des années soixante-dix, Cecilia Lisbon, 13 ans, tente de se suicider. Elle a 4 sœurs, de jolies adolescentes. Cet incident éclaire d\'un jour nouveau le mode de vie de toute la famille. L\'histoire, relatée par l’intermédiaire de la vision des garçons du voisinage, obsédés par ces sœurs mystérieuses, dépeint avec cynisme la vie adolescente. Petit a petit, la famille se referme et les filles reçoivent rapidement l\'interdiction de sortir. Alors que la situation s\'enlise, les garçons envisagent de secourir les filles.', 'American Zoetrope', 'https://image.tmdb.org/t/p/w1280/yHIAt0xdPis7UwoJuM2AwORsLAM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6b6UpsOXmjO8mJKYsGTG9HW49CN.jpg', 'https://www.youtube.com/embed/M2xQdhHQZnQ', 96, '1999', 3.55, 1),
(1444, 'United States of America', 'Junebug', '', 'Epoch Films', 'https://image.tmdb.org/t/p/w1280/asC6UOPrR6OlNMiyXbeXWu08SOG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bgglizDnM6MFm0F216VI7l0SoyJ.jpg', 'https://www.youtube.com/embed/', 106, '2005', 3.33, 1),
(1448, 'United Kingdom', 'La Sagesse des crocodiles', 'Steven, grand séducteur, est soupçonné du meurtre de sa petite amie, retrouvée morte dans la mer. Mais l\'absence de mobile fait de lui un improbable coupable. Pourtant, le détective Roche est loin d\'être convaincu de son innocence, d\'autant plus qu\'une des ex-petites amies de Steven a disparu dans d\'obscures circonstances. Entre-temps, ce dernier vient de rencontrer Anne. Une étrange relation s\'installe entre eux.', 'Film Foundry Partners', 'https://image.tmdb.org/t/p/w1280/a1bFykpvRfiuY7AcBfU8V2ekvy5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rKY8SodMU6NnTVPSrxIBhzBJDPn.jpg', 'https://www.youtube.com/embed/', 88, '1998', 2.91, 1),
(1450, 'China', 'Blood : The Last Vampire', 'À la veille de la guerre du Vietnam, une base américaine est infestée par d\'étranges créatures démoniaques à l\'apparence humaine. Une jeune fille répondant au nom de Saya est envoyée sur place par une organisation gouvernementale secrète dans le but de les éliminer. Pour mener à bien sa mission, elle adopte alors l\'identité d\'une écolière et intègre le collège de la base.', 'East Wing Holdings', 'https://image.tmdb.org/t/p/w1280/tRwH5gdH4oVDK42Kc0c8pQqrEpH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ryBUkjVLKjSJOTgBfxHrdu7rxG0.jpg', 'https://www.youtube.com/embed/', 99, '2009', 2.86, 1),
(1452, 'United States of America', 'Superman Returns', 'Alors qu’un ennemi de longue date, Lex Luthor, tente de l’affaiblir en lui dérobant tous ses superpouvoirs, Superman doit faire face à un problème d’un autre genre : Lois Lane, la femme qu’il aime, est partie mener une nouvelle vie loin de lui. Mais l’a‐t‐elle vraiment oublié ? Le retour de Superman sera donc ponctué de nombreux défis puisqu’il devra se rapprocher de son amour tout en retrouvant sa place au sein d’une société qui semble ne plus avoir besoin de lui. En tentant de protéger le monde qu’il aime de la destruction totale, Superman se retrouve au centre d’une aventure incroyable qui le mènera des fonds de l’océan à des milliers d’années lumière de notre galaxie.', 'DC Comics', 'https://image.tmdb.org/t/p/w1280/3zsvzLmKXKrTYUUWeavHuAOuWhz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8eRscFbRYl681zDfkjv1jjW1KAA.jpg', 'https://www.youtube.com/embed/9OtcziYNuq8', 154, '2006', 2.86, 1),
(1479, 'United States of America', 'Clean, Shaven', 'Peter Winter est un jeune schizophrène à la recherche de sa fille placée en famille d\'accueil. Il essaie d\'avancer dans un monde qui, pour lui, est peuplé de voix étranges, de bruits électriques et d\'images déconcertantes. Il se raccroche à son humanité comme à un radeau balloté dans un océan de terreur. Pendant ce temps, La police enquête sur des meurtres d\'enfants.', 'DSM III', 'https://image.tmdb.org/t/p/w1280/tMRfKXRlIWvrsEP30L2uLcI1FNn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//eLbXAL8fe7wbK898QOfYKLz0NeQ.jpg', 'https://www.youtube.com/embed/', 79, '1993', 3.23, 1),
(1480, 'United States of America', 'La soif du Mal', 'À la frontière entre les États-Unis et le Mexique, une bombe explose dans la voiture de l\'homme qui tient la ville sous sa coupe. Hank Quinlan, un inspecteur américain, et Vargas, un haut fonctionnaire mexicain, vont mener l\'enquête.', 'Universal International Pictures', 'https://image.tmdb.org/t/p/w1280/ii5R76odySXCQjE8IIGMB0LQ5EL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vZBHQfRbBZNsFbqw3B6MQPOa8S6.jpg', 'https://www.youtube.com/embed/', 95, '1958', 3.89, 1),
(1481, 'Australia', 'Metal Skin', '', 'Daniel Scharf Productions', 'https://image.tmdb.org/t/p/w1280/1rPtJZbFIusaA8Ieg3MnJgzJv3U.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fj9cMcdfP0IMwo8AnEWZ5bJj9qk.jpg', 'https://www.youtube.com/embed/', 115, '1994', 2.6, 1),
(1482, 'United States of America', 'Laws of Gravity', '', 'Island World', 'https://image.tmdb.org/t/p/w1280/zFN3C7flx1xj3dxGEAsSK7Uz7bB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 100, '1992', 3.5, 1),
(1483, 'United States of America', 'Begotten', 'Dieu se débarasse avec un rasoir droit. La Terre Mère, semblable à un esprit, émerge, s\'aventurant dans un paysage sombre et stérile. Secousses et recroquevillés, le Fils de la Terre est attaqué par des cannibales sans visage. Présenté de manière surréaliste, sanglante et entièrement visuelle, Begotten raconte la mort de la religion, l\'abus de la nature par l\'homme et une vision nihiliste de ce qu\'est finalement la vie.', 'Theatre Of Material', 'https://image.tmdb.org/t/p/w1280/qYJh4HESlOyZll77erHcVAKqrbt.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1vSPlCXoiFpk8y19D1UadakS4gn.jpg', 'https://www.youtube.com/embed/', 72, '1991', 2.95, 1),
(1484, 'Germany', 'L\'Homme de la mort', 'Le commerçant Fritz Haarmann avoue avoir tué et dépecé vingt-sept jeunes hommes. Il rejette par contre l\'accusation de cannibalisme. Un expert est nommé pour enquêter sur l’état mental de l\'assassin.', 'Pantera Film', 'https://image.tmdb.org/t/p/w1280/ohAbWZ6tWm188u14bh9n73jneDw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vFAiN9bZJvgpRlwwXrVhJmEb7a9.jpg', 'https://www.youtube.com/embed/', 110, '1995', 3.3, 1),
(1485, 'United Kingdom', 'La Loi du milieu', 'Jack Carter est un tueur froid et méthodique travaillant pour le « milieu » londonien. Lorsqu\'il apprend la mort de son frère Frank, il retourne à Newcastle où ce dernier vivait, et où lui-même a grandi. Très vite, il s\'aperçoit qu\'en dépit des apparences cette mort n\'est pas accidentelle comme l\'a conclu le rapport de police.', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/65nqPt7nmK3pXHHMNdAmwCPqDG6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pRBCb6Hs6Xo4diXwpnBTcwMizE.jpg', 'https://www.youtube.com/embed/zxnphCimk_c', 112, '1971', 3.52, 1),
(1487, 'Czech Republic', 'Hellboy', 'Né dans les flammes de l\'enfer, le démon Hellboy est transporté sur Terre lors d\'une sombre cérémonie célébrée par les nazis, désireux d\'utiliser les forces infernales à des fins de conquête. Sauvé par le docteur Broom, Hellboy est alors élevé pour combattre les forces du Mal. Armé, possédant un bras droit en pierre, il fait équipe avec le télépathe Abe Sapien et Liz Sherman, capable de contrôler le feu...', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/wOuV25q9QoBEO6hmAvmgT5wd6qf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qdTUAwQKQ9n7PfZeVJzs7sOP8S8.jpg', 'https://www.youtube.com/embed/xbeIT-RYA5g', 122, '2004', 3.35, 1),
(1488, 'China', 'Mongolian Ping Pong', 'Bilike has never seen a ping-pong ball before. He and his family live without electricity and running water in a solitary tent home among the vast steppe grasslands. The magnificent landscape here has changed little since the days of Genghis Kahn. But life in the middle of nowhere can be exciting for a young boy. The smallest of details become big events for curious Bilike and his best friends Erguotou and Dawa. The mystery of the small white ball floating in the creek leads to questions about the world around them, as well as innocent mischief.', 'TV Productions LTD And Beijing Hop Culture Co', 'https://image.tmdb.org/t/p/w1280/yVzn3We2n1rNgYhQVKLWCqLnUNX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 102, '2005', 2.8, 1),
(1523, 'Germany', 'The Last King of Scotland', 'Young Scottish doctor, Nicholas Garrigan decides it\'s time for an adventure after he finishes his formal education, so he decides to try his luck in Uganda, and arrives during the downfall of President Obote. General Idi Amin comes to power and asks Garrigan to become his personal doctor.', 'Fox Searchlight Pictures', 'https://image.tmdb.org/t/p/w1280/mTtgpH6UnHUtD8moRJUzfGLOZTj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tO40eTUxPoKrmMKBDWViA9pVYg3.jpg', 'https://www.youtube.com/embed/H-PpGsDpf6k', 123, '2006', 3.72, 1),
(1534, 'United States of America', 'Pathfinder', 'Plus de cinq siècles avant que Christophe Colomb ne découvre officiellement l\'Amérique, un drakkar viking aborda les côtes de ce continent sauvage. Entre les barbares du nord et les Indiens natifs, le choc fut effroyable, et seul un enfant viking survécut. Adopté par la tribu des Indiens Wampanoag, le jeune homme blanc désormais connu sous le nom de Ghost grandit et devint un redoutable guerrier.', 'Dune Entertainment', 'https://image.tmdb.org/t/p/w1280/yM9iz3lCIqvQ1EersvZ3yOSWSU7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//t2hqoksHqbHMpB4bBKXZ0JxkI3q.jpg', 'https://www.youtube.com/embed/6XM4LpL1iMc', 101, '2007', 2.81, 1),
(1535, 'France', 'Spy game, jeu d\'espions', 'Sur le point de prendre sa retraite, Nathan Muir apprend que Tom Bishop, son ex-partenaire, vient d\'être capturé en Chine. Accusé d\'espionnage, Tom sera exécuté dans les prochaines 24 heures et la CIA refuse de se porter à son secours. Oubliant les rancœurs du passé, Nathan va se lancer dans sa mission la plus personnelle et la plus dangereuse.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/iT6XOQySbzOdpPhFwXxlAzE3fta.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zSAtGMQPOY05hHeIdVEeX72jfz3.jpg', 'https://www.youtube.com/embed/', 127, '2001', 3.46, 1),
(1537, 'United States of America', 'Dérapages incontrôlés', 'Ce matin, Gavin Banek et Doyle Gipson n\'ont pas une minute à perdre. Le premier, un jeune avocat, se rend au tribunal pour une affaire de la plus haute importance. Le second, un agent d\'assurances en instance de divorce, est appelé à défendre ses droits.Une queue de poisson malvenue à New York entraîne une collision sans gravité apparente. Mais Banek commet une faute irréparable : pressé par le temps, il refuse de signer un constat, glisse un chèque en blanc à Gipson et l\'abandonne à son sort... après lui avoir laissé par mégarde une pièce essentielle de son dossier. Humilié, furieux, Gipson décide de prendre sa revanche sur celui qui l\'a mis en retard au tribunal.Une mécanique sournoise se met aussitôt en mouvement, dévoilant les failles secrètes des deux adversaires, les poussant en quelques heures dans leurs derniers retranchements et les menant aux pires violences.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/rw2Xue4Op0fJfOdQBTovQVsKooW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lCPOmWoqtmVrI2yUNUw8iaOaTJn.jpg', 'https://www.youtube.com/embed/kcAs8AIwpuQ', 100, '2002', 3.12, 1),
(1538, 'United States of America', 'Collatéral', 'Max est taxi de nuit à Los Angeles. Un soir, il se lie d\'amitié avec une dénommée Annie Farrell, une belle femme procureur montée à l\'arrière de son véhicule. Quelques minutes plus tard, c\'est au tour d\'un homme prénommé Vincent de monter dans le taxi. Un businessman, selon toute apparence, avec un emploi du temps chargé : pas moins de cinq rendez-vous à tenir dans la nuit. Max accepte de lui louer ses services jusqu\'au petit matin, en échange de 600 dollars. Premier arrêt. Vincent entre dans un immeuble. Un coup de feu éclate aussitôt, un corps plonge dans le vide, s\'écrasant sur le toit du taxi. Vincent redescend et, sous la menace de son arme, oblige Max à dissimuler le cadavre dans le coffre et à reprendre son mortel périple. Un chauffeur de taxi, un tueur implacable, cinq \"cibles\" à éliminer, des agents des stups et une équipe du FBI... Leurs destins se joueront cette nuit...\r REGARDER CE FILM', 'Paramount', 'https://image.tmdb.org/t/p/w1280/5GqI9FqXdlykPrwX7dmYqYEEMRV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//luaCdru9mok7iCUGALkKDOVsptd.jpg', 'https://www.youtube.com/embed/-JDf2zIFgO8', 120, '2004', 3.6, 1),
(1539, 'Germany', 'Keine Lieder über Liebe', 'As Tobias, a young director, supposes that his girl-friend Ellen had an affair with his brother Markus, front man of \"Hansen\", one year ago, he decides to shoot a documentary about the band\'s next tour. When Ellen joins the project, everybody\'s emotions boil over, although they are observed all the time.', 'Film 1', 'https://image.tmdb.org/t/p/w1280/jq1Pbm0SevZBTwUaIIDC5b8CE1i.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 98, '2005', 2.85, 1),
(1540, 'Belgium', 'Heading South', 'A story of three female tourists who visit Haiti, in order to enjoy the sexual nature of the young men.', 'Haut et Court', 'https://image.tmdb.org/t/p/w1280/46VpNNJNAubG1iB4CXtQYSaNMA0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//i7Z2hHvm0bKEFB4EvXpk6kFYDyV.jpg', 'https://www.youtube.com/embed/', 108, '2006', 2.8, 1),
(1541, 'United States of America', 'Thelma & Louise', 'Whilst on a short weekend getaway, Louise shoots a man who had tried to rape Thelma. Due to the incriminating circumstances, they make a run for it and thus a cross country chase ensues for the two fugitives. Along the way, both women rediscover the strength of their friendship and surprising aspects of their personalities and self-strengths in the trying times.', 'Star Partners III Ltd.', 'https://image.tmdb.org/t/p/w1280/gQSUVGR80RVHxJywtwXm2qa1ebi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//u49EZzHvGCNrHdQxkc3hhLmQEPP.jpg', 'https://www.youtube.com/embed/ocJoqOA65X0', 130, '1991', 3.78, 1),
(1542, 'United States of America', 'Office Space', 'A depressed white-collar worker tries hypnotherapy, only to find himself in a perpetual state of devil-may-care bliss that prompts him to start living by his own rules, and hatch a hapless attempt to embezzle money from his soul-killing employers.', 'Cubicle Inc.', 'https://image.tmdb.org/t/p/w1280/fiB7DY9mATGFOCTd4cgK6k2Wzr9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//osVUxxcXnJd9tqSRZBk4RxVl0As.jpg', 'https://www.youtube.com/embed/', 90, '1999', 3.69, 1),
(1543, 'Germany', 'Le Bonheur d\'Emma', 'Emma vit seule. Couverte de dettes, elle élève des cochons dans une vieille ferme de famille délabrée. Elle traite ses animaux avec amour et tendresse, jusqu\'à leurs derniers instants... Max est solitaire. Employé chez un concessionnaire automobile, il souffre continuellement de douleurs à l\'estomac. Lors d\'une visite chez le médecin, il apprend qu\'il est atteint d\'un cancer en phase terminale. Sous l\'impulsion d\'une réaction excessive, il vole de l\'argent à son seul ami et réserve un billet d\'avion pour s\'enfuir à Mexico... Mais en route, Max a un accident avec sa voiture : il \"atterrit\" dans la ferme d\'Emma. Pour la jeune femme sauvage qui manque furieusement d\'amour, cet homme semble être un don du ciel...', 'ARD', 'https://image.tmdb.org/t/p/w1280/ioFUr3BHtjyzLkBsorTGAzt1Wjl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oCGXjcyvJ110utQrtHGJn4fethQ.jpg', 'https://www.youtube.com/embed/K3ceBCEWNTY', 99, '2006', 3.31, 1),
(1544, 'Germany', 'Imagine Me & You', 'Le mariage de Rachel et de Heck s\'annonce comme le plus beau jour de leur vie. Tout est parfait. Pourtant, l\'heure venue, il suffit d\'un regard pour que Rachel tombe irrémédiablement amoureuse... mais pas de celui qu\'elle doit épouser. Certains sentiments vous dépassent, vous submergent et font exploser tous les plans prévus. Contre ceux qu\'elle aime, contre les préjugés, contre elle-même, Rachel va vivre la plus incroyable des aventures, celle que l\'on n\'attend jamais mais que l\'on espère toujours...', 'BBC Film', 'https://image.tmdb.org/t/p/w1280/a7CbxY3TMwFKX6awlBxhb7Es6tS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aNgiRVe7fDrrxsfWzPh6fN1V39R.jpg', 'https://www.youtube.com/embed/ODGC_DhQHyI', 94, '2005', 3.79, 1),
(1546, 'United States of America', 'Thumbsucker', 'Justin Cobb, a teenager in suburban Oregon, copes with his thumb-sucking problem, romance, and his diagnosis with ADHD and subsequent experience using Ritalin.', 'Bob Yari Productions', 'https://image.tmdb.org/t/p/w1280/fBLjXNRkH0KuC5JEnGBUZx3SQw3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8WrFZX9TxUSoc3yVpQpfBaWXGOp.jpg', 'https://www.youtube.com/embed/', 96, '2005', 3.09, 1),
(1547, 'United States of America', 'Génération Perdue', 'Lucy emménage avec ses 2 enfants dans la petite ville de Santa Clara. Son fils tombe amoureux d\'une fille qui fait partie d\'un groupe de motards…', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/9LBBWuwyehij4KNqRbzpyBhfx4z.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//m4vNXgy0EfvOSSXMWJC6FfMSyIR.jpg', 'https://www.youtube.com/embed/', 97, '1987', 3.53, 1),
(1548, 'Germany', 'Ghost World', 'Two quirky, cynical teenaged girls try to figure out what to do with their lives after high school graduation. After they play a prank on an eccentric, middle aged record collector, one of them befriends him, which causes a rift in the girls\' friendship.', 'Mr. Mudd Production', 'https://image.tmdb.org/t/p/w1280/uwKqnUPE4dSM0kKuMW0vXpURh2T.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//o7zvlk0HCxRf13Im9ZpZ4okHehr.jpg', 'https://www.youtube.com/embed/', 111, '2001', 3.55, 1),
(1549, 'France', 'L\'Esquive', 'Abdelkrim, dit Krimo, quinze ans, vit dans une cité HLM de la banlieue parisienne. Il partage avec sa mère, employée dans un supermarché, et son père, en prison, un grand rêve fragile : partir sur un voilier au bout du monde.En attendant, il traîne son ennui dans un quotidien banal de cité, en compagnie de son meilleur ami, Eric, et de leur bande de copains. C\'est le printemps et Krimo tombe sous le charme de sa copine de classe Lydia, une pipelette vive et malicieuse...', 'CinéCinéma', 'https://image.tmdb.org/t/p/w1280/ctP6vzh3F7qsFxgWrzi3eJIHF4Z.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cyrTS0WBf8KOSNvhszWIsAnDMlL.jpg', 'https://www.youtube.com/embed/Cdjt61a-n0Q', 117, '2003', 3.4, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(1550, 'United States of America', 'Un festin à New York', 'April n\'est plus en bons termes avec sa mère. Elle a néanmoins fait preuve de bonne volonté cette année en se proposant d\'accueillir la famille pour le dîner de Thanksgiving. Dans l\'appartement new-yorkais qu\'elle partage avec son petit ami, Bobby, la voilà donc qui se met aux fourneaux pour préparer la traditionnelle dinde. Mais le four est cassé, et il lui faut frapper à la porte de tout l\'immeuble et rencontrer une foule de voisins sacrément déjantés, pour trouver un endroit où faire cuire sa volaille.  Pendant ce temps, le reste de la famille fait le trajet en voiture. Il y a le père, Jim, qui espère passer une bonne journée ; la mère, Joy, qui se plaint déjà ; la soeur, Beth, parfaitement horripilante ; le frère, Timmy, un vrai casse-pieds ; et la grand-mère, Dottie, qui a bien du mal à se rappeler des prénoms de chacun...', 'IFC Productions', 'https://image.tmdb.org/t/p/w1280/qEbo0OwAaWgLSxp4lXyoCbnmrxh.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jcue2THX5mjQFV7EXqoQyXyLlbR.jpg', 'https://www.youtube.com/embed/', 80, '2003', 3.25, 1),
(1551, 'United States of America', 'Flatliners', 'Five medical students want to find out if there is life after death. They plan to stop one of their hearts for a few seconds, thus simulating death, and then bring the person back to life.', 'Stonebridge Entertainment', 'https://image.tmdb.org/t/p/w1280/wda3j7p7YHXKpFIlSzoTCtP7myF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//f6HK5Uk9LQwPpdcdQA5BIhcNa6f.jpg', 'https://www.youtube.com/embed/', 115, '1990', 3.24, 1),
(1552, 'United States of America', 'Portrait craché d\'une famille modèle', 'Gil et sa femme Karen, ont élevé leurs trois enfants dans une ambiance protectrice, chaleureuse, libérale, pleine de tendresse et d\'humour. Malgré cela, leur fils de neuf ans, Kevin, souffre de troubles psychiques. Désemparé, Gil se dépense de plus en plus pour son fils au détriment de son travail. La soeur ainée de Gil, Helen est divorcée et mère de deux adolescents à problèmes. Sa fille Julie est en passe de devenir une femme, tandis que son fils Garry vit les premières affres de la puberté. L\'autre soeur de Gil, Susan, est mariée à un brillant et tyrannique intello, Nathan, qui élève leur fille de trois ans de façon à en faire un futur Prix Nobel. Enfin, il y a Larry, le frère cadet de Gil, la brebis galeuse de la famille qui ne réapparaît que lorsqu\'il y a des problèmes d\'argent. Bref, le portrait d\'une famille pas si modèle que ça... qui pourrait bien être la vôtre.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/2UW4w8hIjbf1hCPsa3q8Dtf3Z7i.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zdWdI9k8UroWuMjALiftO6WTXu1.jpg', 'https://www.youtube.com/embed/', 124, '1989', 3.36, 1),
(1553, 'France', 'De battre mon cœur s\'est arrêté', 'A 28 ans, Tom semble marcher sur les traces de son père dans l\'immobilier véreux. Mais une rencontre fortuite le pousse à croire qu\'il pourrait être le pianiste concertiste de talent qu\'il rêvait de devenir, à l\'image de sa mère. Sans cesser ses activités, il tente de préparer une audition.', 'La Région Île-de-France', 'https://image.tmdb.org/t/p/w1280/jx1uqLxK51x6gNaSO7jpYd1P5md.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//liIEasMsfpoJY5tMGngRO1NIQ7s.jpg', 'https://www.youtube.com/embed/hYw9lq_csu0', 107, '2005', 3.47, 1),
(1554, 'Germany', 'Down by Law', 'Dans le bayou, en Guyane, un monde de malchance et d\'ennuis pour Jack et Zack. Ces deux paumés se retrouvent en prison et rencontrent Roberto, rempli de l\'entrain qui leur manque. Il les entraîne à s\'évader.', 'Island Pictures', 'https://image.tmdb.org/t/p/w1280/pkIVPOsQX8dV4vYKZ2Md3Jfixxz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8kVPLOzuZ1G9EBYxcOrzaHbxCeC.jpg', 'https://www.youtube.com/embed/', 107, '1986', 3.68, 1),
(1555, 'France', 'L\'Auberge espagnole', 'Xavier, un jeune homme de 25 ans, part à Barcelone pour terminer ses études en économie et apprendre l’espagnol. Cette langue est nécessaire pour occuper un poste, que lui promet un ami de son père, au ministère des Finances. Mais pour ce faire, il doit quitter sa petite amie Martine, avec qui il vit depuis quatre ans. En Espagne, Xavier cherche un logement et trouve finalement un appartement dans le centre de Barcelone qu’il compte partager avec 7 autres personnes. Chacun de ses co‐locataires est originaire d’un pays différent.', 'Mate Producciones S.A.', 'https://image.tmdb.org/t/p/w1280/ecrbEwFspp9I9FORVoqD8XLmUnI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kiSderXBFLpkSp7dZ5RQkHOD5nh.jpg', 'https://www.youtube.com/embed/AsvJFtUDfl0', 120, '2002', 3.55, 1),
(1556, 'Japan', 'Les Funérailles des roses', 'Tokyo, fin des années 1960. Eddie, jeune drag-queen, est la favorite de Gonda, propriétaire du bar où elle travaille. Cette relation provoque la jalousie de la maîtresse de Gonda, Leda, matrone du bar. Eddie et Gonda se demandent alors comment se débarrasser d’elle…', 'Art Theatre Guild', 'https://image.tmdb.org/t/p/w1280/bOrrOqvcpfTtWqHaIE8YQqDTks.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zTPOzxjdezfzC3l82gbeCtIloRt.jpg', 'https://www.youtube.com/embed/ZZYwiocl1fo', 108, '1969', 3.7, 1),
(1557, 'Germany', '23', 'Histoire basée sur un fait réel, celle de Karl Koch, jeune pirate informatique de dix-neuf ans. Fascine par Hagbard Céline, personnage d\'un roman, il fait preuve d\'un talent sans faille pour accéder aux réseaux informatiques mondiaux pour les pirater. C\'est ainsi que, courtise par le KGB, il en devient un agent. Mais, intoxique à la cocaïne, il souffre de plus en plus d\'hallucinations et perd peu a peu le sens des réalités.', 'Claussen+Wöbke Filmproduktion', 'https://image.tmdb.org/t/p/w1280/x00vBQB8WGebvLWQ7shVCyjG7Im.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zbDTA5mGW6tpEI5GjR3xGplLVrZ.jpg', 'https://www.youtube.com/embed/', 99, '1998', 3.43, 1),
(1558, 'Germany', 'Liegen lernen', '', 'X Filme Creative Pool', 'https://image.tmdb.org/t/p/w1280/p8zlm6zE8NKgxCBr5UEOW17o488.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kqcBzC4MM20NRHUKoGG25aZBswS.jpg', 'https://www.youtube.com/embed/', 87, '2003', 3.15, 1),
(1559, 'Canada', 'Sweet Movie', 'Les aventures erotiques et existentielles de miss Monde contes dans une fable boufonne et fantasque qui traite de la liberation de l\'homme sous toute ses formes.', 'Maran Film', 'https://image.tmdb.org/t/p/w1280/29jUD87jFFoVMMGIKTFQvgDDRQJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uAsQfBaUU7gGlWEPYbDIOD84qWW.jpg', 'https://www.youtube.com/embed/', 100, '1974', 2.7, 1),
(1560, 'Greece', 'Singapore Sling', 'Par une chaude et humide nuit d’été, une puissante fièvre vous cloue au lit. C’est à ce moment peu opportun que votre douce moitié vous annonce qu’elle vous quitte pour refaire sa vie ailleurs. Au bord de la détresse, vous décidez de boire d’un seul trait la moitié d’un 40 oz de whisky. Après quelques minutes, vous tombez à la renverse et commencez à faire un rêve étrange. Vous êtes désormais dans un état d’esprit similaire à celui du personnage principal de Singapore Sling : coincé entre réalité, fantasmes et incompréhension.', 'Cinekip', 'https://image.tmdb.org/t/p/w1280/61qTmbRikcUUnvMxcU5xv9RUUTO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//q1B2ynMiQlkRFdYe9U9g8S6GgGF.jpg', 'https://www.youtube.com/embed/', 115, '1990', 3.35, 1),
(1561, 'France', 'Mouchette', 'Mouchette, au seuil de l\'adolescence, vit dans une campagne miserable. Elle est temoin d\'une dispuste entre le garde-champetre et un braconnier.', 'Argos Films', 'https://image.tmdb.org/t/p/w1280/8HAn6m2cKZRkCh4VU0AoJ2X6WSZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//37tFM2qQl793fq3fz6n76L59BLA.jpg', 'https://www.youtube.com/embed/Gi33NBMXfBY', 81, '1967', 3.73, 1),
(1562, 'Spain', '28 semaines plus tard', 'Il y a six mois, un terrible virus a décimé l\'Angleterre et a transformé presque toute la population en monstres sanguinaires. Les forces américaines d\'occupation ayant déclaré que l\'infection a été définitivement vaincue, la reconstruction du pays peut maintenant commencer. Don a survécu à ces atroces événements, mais il n\'a pas réussi à sauver sa femme et la culpabilité le ronge. Lorsqu\'il retrouve ses enfants, Andy et Tammy, qu\'il n\'avait pas revus depuis la catastrophe et qui reviennent à Londres avec la première vague de réfugiés, il leur apprend la mort de leur mère. Partagés entre la joie des retrouvailles et le chagrin, tous trois tentent de se reconstruire et de reprendre une vie normale dans la ville dirigée par l\'armée américaine.Pourtant, quelque part, un effroyable secret les attend. Tout n\'est pas terminé...', 'DNA Films', 'https://image.tmdb.org/t/p/w1280/15ZVYic5WUOUb2PToynDH6qWykk.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//PN7yjmQdmG0J62jsrtmrPi8ezK.jpg', 'https://www.youtube.com/embed/kbuCnTZvTvQ', 96, '2007', 3.29, 1),
(1563, 'France', 'Sans soleil', 'Des lettres d\'un caméraman-voyageur, Sandor Krasna, lues par une femme. Attiré par les deux « pôles extrêmes de la survie », le Japon et l\'Afrique, il s\'interroge sur la représentation du monde dont il est en permanence l\'artisan, et le rôle de la mémoire qu\'il contribue à forger.', 'Argos Films', 'https://image.tmdb.org/t/p/w1280/zpQRJpDjGEAhLTK7tHTo5S2XFYJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lns7roobSPQQTF54oSPzkT3qH1q.jpg', 'https://www.youtube.com/embed/', 104, '1983', 3.75, 1),
(1590, 'Germany', 'L\'Élève de Beethoven', 'XIXème siècle, à l’époque où Beethoven compose la Neuvième Symphonie, ses facultés déclinent. À l’approche de la première représentation, il cherche un copiste pour l’aider à achever sa tâche. C’est alors qu’on lui présente Anna Holz. Il tombe immédiatement amoureux de cette jeune femme très talentueuse, sentiment qui va rapidement tourner à l’obsession…', 'Sidney Kimmel Entertainment', 'https://image.tmdb.org/t/p/w1280/xbvZuKMqJgXW1UmQi7AfrXexepC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7b3cLZjiOIR8pqjnF2g2GkBwcZ4.jpg', 'https://www.youtube.com/embed/', 100, '2006', 3.2, 1),
(1591, 'Germany', 'Nowhere in Africa', 'A Jewish woman named Jettel Redlich flees Nazi Germany with her daughter Regina, to join her husband, Walter, on a farm in Kenya. At first, Jettel refuses to adjust to her new circumstances, bringing with her a set of china dishes and an evening gown. While Regina adapts readily to this new world, forming a strong bond with her father\'s cook, an African named Owuor.', 'Media Cooperation One', 'https://image.tmdb.org/t/p/w1280/2ED1GaTKhHielGYa1giBsxfoacp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7WcWTWOmCNLFnazUmIY64eSvMMz.jpg', 'https://www.youtube.com/embed/Hep5_o--OEE', 140, '2001', 3.5, 1),
(1592, 'United States of America', 'Peur primale', 'Martin Vail, brillant avocat de Chicago, aussi soucieux de sa publicité que de son talent, se porte volontaire pour défendre un jeune homme accusé du meurtre de l\'archevêque Rushman, un des plus éminents dignitaires de la ville. Aaron Stampler, le présumé coupable, provincial timide et naïf, bénéficiait de la protection de l\'archevêque qu\'il considérait comme son père. Vail est vite convaincu de l\'innocence de son client. Cependant, après certaines révélations troublantes, il sera amené a manipuler et à piéger la partie adverse.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/cxETZPGXj87i6U0VfMd0MGIDIAE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xO5RwB4o8wJrsqDrEDjDqBD4HaA.jpg', 'https://www.youtube.com/embed/', 131, '1996', 3.82, 1),
(1593, 'United States of America', 'Night at the Museum', 'Chaos reigns at the natural history museum when night watchman Larry Daley accidentally stirs up an ancient curse, awakening Attila the Hun, an army of gladiators, a Tyrannosaurus rex and other exhibits.', '1492 Pictures', 'https://image.tmdb.org/t/p/w1280/uY9k8t2FQkMj60obnAnsPKLxHCE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rwcPe582tfTSVLwQzbO25InW3Hi.jpg', 'https://www.youtube.com/embed/AN0Zdn_wQZY', 108, '2006', 3.28, 1),
(1594, 'United Kingdom', 'Quand l\'inspecteur s\'emmêle', 'Un crime est commis dans l\'hôtel particulier d\'un milliardaire. L\'affaire semble claire. Maria, la soubrette, est retrouvée près du cadavre, son amant, l\'arme à la main. Mais pour l\'inspecteur Clouseau, chargé de l\'enquête au grand dam de son supérieur hiérarchique, tout cela paraît trop simple. Il est persuadé que Maria est innocente...', 'United Artists', 'https://image.tmdb.org/t/p/w1280/9IkYSCssWMcnWEPpB88WTtQS6zO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dlO2wT1t8ujrK1TYZIeFIyqTQSl.jpg', 'https://www.youtube.com/embed/yS9g0cVME4s', 115, '1964', 3.64, 1),
(1595, 'Canada', 'Land of plenty (terre d\'abondance)', 'Lui, c\'est Paul, vétéran de la guerre du Vietnam et ardent patriote. Exposé à l\'Agent orange quand il était Marine, il souffre de sérieux troubles psychologiques et d\'une paranoïa aiguë. Depuis les événements du 11 septembre 2001 qui ont fait ressurgir les fantômes du passé, il est convaincu que l\'Amérique est en état de guerre. En défenseur acharné de son pays, il sillonne désormais les rues de la ville à bord d\'une camionnette équipée de micros et de caméras qu\'il braque sur tout individu qui lui semble suspect... Elle, c\'est Lana, jeune femme profondément chrétienne qui a choisi de vivre en accord avec sa foi. Après plusieurs années passées en Afrique et au Moyen-Orient, elle rentre aux États-Unis pour s\'engager dans une mission catholique qui vient en aide aux sans-abris. Elle cherche aussi à retrouver la trace de Paul, son oncle...', 'InDigEnt (Independent Digital Entertainment)', 'https://image.tmdb.org/t/p/w1280/AbLlE4S01PsXO0LOqpFvGzibbdF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1h8yWKNP8FkDyRrIkIhMOhsEZxr.jpg', 'https://www.youtube.com/embed/MO5W5OHbBxc', 123, '2004', 3, 1),
(1596, 'Canada', 'Population 436', 'A census-taker is sent to investigate why a certain small town has had the same population -- 436 residents -- for the last 100 years.', 'Pariah Entertainment Group', 'https://image.tmdb.org/t/p/w1280/trEcuqgfXtIt06b7Tg1fkCnOHBY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fXa1d8Jkzx4UXKUmk8hpMrc42cq.jpg', 'https://www.youtube.com/embed/', 88, '2006', 2.9, 1),
(1597, 'United States of America', 'Mon beau-père et moi', 'Greg Focker, un modeste infirmier de Chicago, vit depuis deux mois avec la charmante Pam Byrnes et rêve d\'officialiser leur union. Ravie de sa proposition, la jeune femme insiste pour un strict respect des règles bourgeoises : Greg devra obtenir l\'accord de son père, Jack.Deux semaines plus tard, le couple fait son apparition dans la luxueuse résidence des Byrnes. Accueilli à bras ouverts par la mère de Pam, Dina, Greg décèle d\'emblée une certaine froideur chez Jack. Ce dernier ne compte pas \"céder\" sa fille chérie au premier venu.Bien décidé à emporter la mise, Greg, nerveux, se met en quatre pour s\'attirer la sympathie et le respect de son beau-père, ancien agent de la CIA, mais toutes ses amabilités, toutes ses plaisanteries tombent à plat face à cet homme crispé, possessif et paranoïaque.', 'Tribeca Productions', 'https://image.tmdb.org/t/p/w1280/cEd840xfKawjUGjcnJj41KS3yBM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qcVrlyPFlPgCsmzorvELvpJN9Be.jpg', 'https://www.youtube.com/embed/CRNyXd9jiM8', 108, '2000', 3.33, 1),
(1598, 'United States of America', 'Les Nerfs à vif', 'Condamné à quatorze ans de prison pour viol et voie de fait sur une mineure, Max Cady n\'a jamais pardonné à son avocat Sam Bowden de l\'avoir abandonné. Tout au long de sa peine, il s\'est employé à discipliner son corps et son esprit, se fixant pour unique but de châtier Bowden, de briser les siens. Et aujourd\'hui, Max Cady est libre...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/sTGZzkI6lx5UWuQxBxXoRLAoxXl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ntgpger7OwFNlEldxuvvFHDKzjW.jpg', 'https://www.youtube.com/embed/MUImR5b3vsQ', 128, '1991', 3.63, 1),
(1599, 'Germany', 'J\'adore Huckabees', 'Albert Markovski vit une série de coïncidences troublantes dont le sens lui échappe. Avec l\'aide de deux detectives \"existentiels\", Bernard et Viviane Jaffe, Albert analyse sa vie, ses relations amoureuses, et son conflit avec Brad Stand, un jeune cadre dynamique et ambitieux chez Huckabees.Lorsque Brad engage les mêmes détectives qu\'Albert, ceux ci commencent à creuser dans son apparente vie parfaite et dans sa relation avec sa petite amie Dawn Campbell qui travaille aussi chez Huckabees.', 'Qwerty Films', 'https://image.tmdb.org/t/p/w1280/262GsFZa1E3MNIxI2IADHPlmt5d.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bGz9T80Y7b1p5HVNBJsZtKN4BdD.jpg', 'https://www.youtube.com/embed/2jqEoioTQDk', 106, '2004', 3.14, 1),
(1600, 'France', 'La Double Vie de Véronique', 'Il y a 20 ans dans deux villes différentes (en France et en Pologne) naquirent deux petites filles pareilles. Elles n\'ont rien en commun, ni père, ni mère, ni grands parents, et leurs familles ne se sont jamais connues. Pourtant elles sont identiques : toutes deux gauchères, aiment marcher les pieds nus, et le contact d\'un anneau d\'or sur leurs paupières. Et surtout, toutes deux ont une voix magnifique, sublime, un sens musical absolu, et la même malformation cardiaque difficilement détectable. L\'une profitera des expériences et de la sagesse de l\'autre sans le savoir. Comme si chaque fois que la première se blessait avec un objet la seconde évitait le contact de ce même objet. C\'est une histoire d\'amour, simple et émouvante. L\'histoire d\'une vie qui continue, quittant un être pour se perpétuer dans le corps et l\'âme d\'un autre être.', 'Sidéral Productions', 'https://image.tmdb.org/t/p/w1280/5IBSAkOTwd5NlHreKnlhy3MPRII.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3ekis9Ry3lNwRzfh5rRhkLqfeVm.jpg', 'https://www.youtube.com/embed/', 97, '1991', 3.78, 1),
(1607, 'United States of America', 'Il était une fois le Bronx', 'L\'histoire de la communauté italienne des années 60 dans le Bronx à travers les yeux de Calogero, neuf ans, qui hésite entre la vie de son père, honnête travailleur, et celle des affranchis, qui semble plus prometteuse.', 'Savoy Pictures', 'https://image.tmdb.org/t/p/w1280/v4fS6D7teLD9mcb3hNV7WX2T7Re.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//krYelh3x8VdSeAqOSd81NTek1aw.jpg', 'https://www.youtube.com/embed/Vfhqxc8KeSk', 121, '1993', 3.92, 1),
(1608, 'United Kingdom', 'When Saturday Comes', '', 'Pint O\'Bitter Productions', 'https://image.tmdb.org/t/p/w1280/pZtRON0IqXoXmSA0M2s2qwxgqbm.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wvPrzevsfbOsLPprAHiDznoYcih.jpg', 'https://www.youtube.com/embed/', 95, '1996', 2.9, 1),
(1609, 'France', 'Jimmy Grimble', 'Jimmy Grimble, un garçon solitaire et timide, supporter de Manchester City, tombe nez à nez avec une vieille dame vivant en ermite dans la cave d\'un bâtiment en ruines. Se noue entre eux deux une amitié qui poussera la vieille femme à offrir à Jimmy un cadeau inestimable, de vieilles chaussures de football censées être magiques et lui apporter succès et victoires. Au même instant, Eric Wirral, ancienne vedette oubliée de Manchester City est embauché pour entraîner les élèves du lycée de Jimmy.', 'Sarah Radclyffe Productions Limited', 'https://image.tmdb.org/t/p/w1280/9v4RxdSMUkhkH9cceSVU4jH4BfV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bT2WOjzIVPlRG2Ip8EczxhKZVIk.jpg', 'https://www.youtube.com/embed/', 106, '2000', 3.4, 1),
(1610, 'United Kingdom', 'Fever Pitch', '', 'Scala Productions', 'https://image.tmdb.org/t/p/w1280/xTpZGWVo5DDk1oQUrUJcRjqGzGg.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yAJkaaxujWGz39AGeP4e8aBSLEW.jpg', 'https://www.youtube.com/embed/', 102, '1997', 3.29, 1),
(1611, 'Germany', 'Le Miracle de Berne', 'Été 1954, la famille Lubanski attend le retour du père, prisonnier de guerre en Union soviétique. Depuis plus de dix ans, Christa s’est occupée seule des enfants et Matthias, son fis de 11 ans, a trouvé un père de substitution en Helmut Rahn, la star de l’équipe de football d’Essen. Quand l’équipe nationale allemande arrive en finale, Matthias veut absolument aller à Berne pour porter chance à son idole.', 'Seven Pictures', 'https://image.tmdb.org/t/p/w1280/3hBzCVAIrBgqwqZkLvHkn6erSGF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uQRMbvfrMu0rt6cah5WzFpr44eg.jpg', 'https://www.youtube.com/embed/NI06MxIJciw', 117, '2003', 3.26, 1),
(1612, 'Germany', 'Fußball ist unser Leben', '', 'Hofmann & Voges Entertainment', 'https://image.tmdb.org/t/p/w1280/lkey0NrYt1ZtYIVyQ5eGpXoxkM6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//94KQJYyww0WEb9lRqgzbssYPYSe.jpg', 'https://www.youtube.com/embed/', 92, '2000', 2.75, 1),
(1613, 'Canada', 'Le 51e État', 'Elmo McElroy est vraiment un individu à part. Chimiste génial, il a mis au point le POS 51, LA drogue parfaite, celle qui vous donne l\'impression que Dieu lui-même est venu vous faire signe. Bien décidé à commercialiser son petit chef-d\'oeuvre sans intermédiaire, Elmo se débarasse de son encombrant patron, Le Lézard, pour rallier l\'Angleterre - le 51e Etat - et s\'associe avec Félix Desouza, un petit nerveux qui règne sur l\'underground de Liverpool, parle tout le temps et ne supporte pas ce qui est Américain.Ce qu\'ignore Elmo c\'est que son ex-patron est toujours vivant, déterminé à se venger et à mettre la main sur la formule chimique. Et en plus il n\'est pas le seul : la superbe et dangereuse Dakota Phillips est également sur ses traces.', 'The Film Consortium', 'https://image.tmdb.org/t/p/w1280/mFWXzBvtpd2FK8AyzhhO63GFJPn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fn6lI2tawQgHyctkAJJtQ22v4pW.jpg', 'https://www.youtube.com/embed/', 91, '2001', 3.05, 1),
(1615, 'Germany', 'Erkan & Stefan gegen die Mächte der Finsternis', '', 'Constantin Film', 'https://image.tmdb.org/t/p/w1280/lHOYfPKVmdjpXSFR4ZF6LE1KY6t.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yL6C8QzWnHQQPePBXYGyiD7J5Xf.jpg', 'https://www.youtube.com/embed/', 80, '2002', 2.2, 1),
(1640, 'Germany', 'Collision', 'Deux voleurs de voitures. Un serrurier mexicain. Deux inspecteurs de police qui sont aussi amants. Une femme au foyer et son mari, procureur de district. Tous vivent à Los Angeles. Eux et beaucoup d\'autres ne se connaissent pas, leurs vies n\'auraient jamais dû se croiser. Pourtant, dans les prochaines 36 heures, leurs destins vont se rencontrer, révélant ce que chacun voulait cacher ou ne pas voir...', 'Lionsgate', 'https://image.tmdb.org/t/p/w1280/hnkRn59I2kS87t5jC08zkbULNvt.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//p6KTx0cpT33ZIbUrZqPjCpjHQT3.jpg', 'https://www.youtube.com/embed/G6wiehCdXHU', 112, '2005', 3.62, 1),
(1641, 'United States of America', 'Forces of Nature', 'Ben Holmes, a professional book-jacket blurbologist, is trying to get to Savannah for his wedding. He just barely catches the last plane, but a seagull flies into the engine as the plane is taking off. All later flights are cancelled because of an approaching hurricane, so he is forced to hitch a ride in a Geo Metro with an attractive but eccentric woman named Sara.', 'Roth-Arnold Productions', 'https://image.tmdb.org/t/p/w1280/rl2d5EbQvsQ2fedJjJ1R3qLSEnM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lZYsPT5WzDMgHe4tZzO9GHVN9ei.jpg', 'https://www.youtube.com/embed/', 105, '1999', 2.7, 1),
(1642, 'United States of America', 'Traque sur Internet', 'Angela Bennett est une informaticienne très douée. Omnubilée par la science de l\'informatique, elle ne sort que rarement de chez elle, préférant communiquer via internet. Un jour, elle reçoit des informations ultra secrètes d\'un ami qui se fait assassiner quelques heures après la réception du message. Angela se retrouve bientôt traquée par un commando inconnu. Obligée de fuir, elle doit se confronter à la réalité du monde extérieur. Sa fuite la mène à l\'étranger où elle perd toute identité civile...', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/oZic5o62L1WtQ0VINj3g53fhpet.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hPlL6FjbbZGZNfNaBePhOXSB9WY.jpg', 'https://www.youtube.com/embed/6zu7euvk4Xc', 114, '1995', 2.99, 1),
(1643, 'France', 'Le Dernier Tango à Paris', 'Paul, un Américain établi à Paris, et Jeanne font connaissance alors qu\'ils visitent, un matin d\'hiver, un grand appartement vide. Ils font l\'amour sans rien savoir l\'un de l\'autre, pas même leurs prénoms. Paul loue l\'appartement et le couple s\'y donne rendez-vous jusqu\'à ce que la situation devienne insoutenable.', 'United Artists', 'https://image.tmdb.org/t/p/w1280/mWg7gGwTSUnZ5WCCZBmTX0cAz8O.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jjtH0BTwO5026jyT4P4IFpbBQMw.jpg', 'https://www.youtube.com/embed/', 129, '1972', 3.5, 1),
(1644, 'United States of America', 'The Vanishing', 'The boyfriend of an abducted woman never gives up the search as the abductor looks on.', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/6d5Hf0iIGjkxL1ToOp3gi8co5pc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ker1eyGYk5eIIPiveZYGHaW9aZ5.jpg', 'https://www.youtube.com/embed/', 109, '1993', 3.04, 1),
(1645, 'United States of America', 'A Time to Kill', 'A young lawyer defends a black man accused of murdering two white men who raped his 10-year-old daughter, sparking a rebirth of the KKK.', 'Regency Enterprises', 'https://image.tmdb.org/t/p/w1280/apUSR9WE7lMATBGYhzZ8RnPDYsK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bwLQCW6LqmrJ6aJsevypcg93JCU.jpg', 'https://www.youtube.com/embed/o-T2UO6uL_s', 149, '1996', 3.68, 1),
(1646, 'Germany', 'Écrire pour exister', 'Erin Gruwell, enseignante novice de 23 ans, a choisi comme premier poste un lycée difficile de Long Beach. Ses élèves l\'ignorent superbement et se regroupent en clans, prêts à s\'affronter au moindre prétexte. L\'ambiance empire au fil des jours, en dépit des efforts sincères et maladroits d\'Erin pour prendre en main cette classe d\'«irrécupérables». Un incident mineur met finalement le feu aux poudres, donnant du même coup à Erin l\'occasion d\'ouvrir le dialogue avec les jeunes. Avec tact et humour, en évitant d\'instinct le piège du paternalisme, Erin parvient à instaurer avec la classe un vrai rapport de confiance.', 'Double Feature Films', 'https://image.tmdb.org/t/p/w1280/t6tqTwQYzCiImCgf3ZnvyyG8Ob6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//n7zm7vcZ5m2nSV9Scyh2axpY8d4.jpg', 'https://www.youtube.com/embed/MT0L1U-Rdj4', 124, '2007', 3.96, 1),
(1647, 'United States of America', 'La Recrue', 'James Clayton, un jeune homme intelligent et rusé, est recruté par Walter Burke, vétéran de la CIA, pour faire partie des services secrets américains. Mais avant de devenir un membre opérationnel, il doit survivre à The Farm, le lieu secret d\'entraînement de la CIA. James s\'impose rapidement comme l\'un des meilleurs éléments de sa promotion et tombe amoureux de Layla, une autre élève. Alors qu\'il s\'interroge sur sa situation actuelle, Burke lui demande d\'accomplir une mission à haut risque, à savoir démasquer une taupe à l\'intérieur de l\'Agence. Il va alors vite se rendre compte que les devises de la CIA sont plus que vraies : \"Ne fais confiance en personne\" et \"La réalité n\'est jamais celle que l\'on croit\". James aura rapidement l\'occasion d\'expérimenter toutes les autres lois d\'une profession à part…', 'Birnbaum / Barber Productions', 'https://image.tmdb.org/t/p/w1280/wg5jpuV3M0UDJiab8nyE2EdKqjT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bwDTWOd0SCFWfRw8ophhykOgUBS.jpg', 'https://www.youtube.com/embed/TYvVJRtN0vg', 115, '2003', 3.15, 1),
(1648, 'United States of America', 'L\'Excellente aventure de Bill et Ted', 'Bill et Ted sont des cancres au collège. Mais avec l\'aide de Rufus, ils ont mis au point une machine à voyager dans le temps sous la forme d\'une cabine téléphonique. Ils naviguent ainsi dans l\'histoire et le futur à la rencontre d\'embûches et aventures diverses. Mais toujours ils arrivent à survivre grâce leur talent d\'explorateurs.', 'Orion Pictures', 'https://image.tmdb.org/t/p/w1280/iHSqfSZUhVCizaMPBRuO1DUXpBk.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9Ac0H6cdbYolC72KXm8N0DwZc2I.jpg', 'https://www.youtube.com/embed/', 90, '1989', 3.42, 1),
(1649, 'United States of America', 'Bill & Ted\'s Bogus Journey', 'Amiable slackers Bill and Ted are once again roped into a fantastical adventure when De Nomolos, a villain from the future, sends evil robot duplicates of the two lads to terminate and replace them. The robot doubles actually succeed in killing Bill and Ted, but the two are determined to escape the afterlife, challenging the Grim Reaper to a series of games in order to return to the land of the living.', 'Orion Pictures', 'https://image.tmdb.org/t/p/w1280/tldtDfLnPFOtTWp758EmIP2Hbz5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//y5lidfqb4KCrPEwrq8fVmfaB5ul.jpg', 'https://www.youtube.com/embed/', 93, '1991', 3.15, 1),
(1650, 'Germany', 'Haytabo', '', 'HJB Filmproduktion', 'https://image.tmdb.org/t/p/w1280/n5hu9lM9ug7GMAn6FgekhD5yF2W.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 75, '1971', 3.1, 1),
(1651, 'France', 'La Sirène du Mississipi', 'Repondant à l\'annonce d\'une agence matrimoniale, une femme usurpe la place d\'une autre. Tout se complique quand le demandeur s\'apercoit qu\'il est amoureux de l\'usurpatrice.', 'Produzioni Associate Delphos', 'https://image.tmdb.org/t/p/w1280/qwK0bazHQVY1pvIPRygPSSqiw1t.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bEe4xvjFr9kObNeBCw8kce3o047.jpg', 'https://www.youtube.com/embed/', 123, '1969', 3.3, 1),
(1652, 'Germany', '00 Schneider - Jagd auf Nihil Baxter', '', 'Senator Film', 'https://image.tmdb.org/t/p/w1280/rPgKMc3GPG52hVJzSzbDBAYJqjz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7P0YiRs39xQQqYMw1EGIHE4fprs.jpg', 'https://www.youtube.com/embed/', 92, '1994', 3.29, 1),
(1653, 'Argentina', 'Carnets de voyage', 'En 1952, deux jeunes Argentins, Alberto Granado et Ernesto Guevara, partent à la découverte de l\'Amérique latine. Ils débutent leur périple sur une vieille moto baptisée « La Vigoureuse ». La confrontation avec la réalité sociale et politique des différents pays visités altère la perception que les deux amis ont du continent. Cette expérience éveillera de nouvelles vocations associées à un désir de justice sociale.', 'Senator Film', 'https://image.tmdb.org/t/p/w1280/dV72FyhQOaiMiFw4LViwFnd4q2Q.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//o6Ln9kTC4ZrHZNUhWLOwBfUvqXU.jpg', 'https://www.youtube.com/embed/', 126, '2004', 3.71, 1),
(1654, 'United Kingdom', 'The Dirty Dozen', '12 American military prisoners in World War II are ordered to infiltrate a well-guarded enemy château and kill the Nazi officers vacationing there. The soldiers, most of whom are facing death sentences for a variety of violent crimes, agree to the mission and the possible commuting of their sentences.', 'Seven Arts Pictures', 'https://image.tmdb.org/t/p/w1280/iFpgjfE4gt7guOLvrqgZZoO4Rjk.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ccegwWa7I2vxxaoXrGB8Wl1g5nl.jpg', 'https://www.youtube.com/embed/', 150, '1967', 3.81, 1),
(1655, 'Germany', 'Praxis Dr. Hasenbein', '', 'Senator Film', 'https://image.tmdb.org/t/p/w1280/r0kJskT769jdLBcYwwY1elfzSK8.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jWboV1HQ0rPeeRg2yeMI3dkmyqI.jpg', 'https://www.youtube.com/embed/KaJN_YbvT5s', 97, '1997', 3.26, 1),
(1656, 'Mexico', 'La Légende de Zorro', 'En 1850, la Californie aspire à devenir le 31e état de l\'Union, mais les membres de la mystérieuse confrérie médiévale des chevaliers d\'Aragon sont décidés à l\'en empêcher par tous les moyens... Les paysans doivent aussi se défendre contre Jacob McGivens, qui s\'empare de leurs terres par la force. Seul Zorro pourrait intervenir... Joaquin, le fils de Don Alejandro de la Vega et de son épouse Elena, a aujourd\'hui dix ans et ignore tout de l\'identité secrète de son père. Elena voudrait qu\'Alejandro abandonne ses activités de justicier pour se consacrer enfin à sa famille. Lorsque face à l\'urgence, il décide néanmoins d\'enfiler le légendaire masque de Zorro, Elena se sent trahie et demande le divorce. Armand, un aristocrate français qui vient de s\'installer en Californie, en profite pour faire la cour à la jeune femme... tout en continuant à diriger secrètement les chevaliers d\'Aragon...', 'Amblin Entertainment', 'https://image.tmdb.org/t/p/w1280/hjWcpt9GI9v9NSkex58GUZhlS25.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yPDxSdrFcD9FbWNkD3BiSVmzLdW.jpg', 'https://www.youtube.com/embed/QuYortlbVTg', 130, '2005', 3.05, 1),
(1670, 'Germany', 'Le château des chiens hurlants', 'Aux abords de Blackwood Castle, un homme se fait agresser et tuer par un mystérieux dobermann aux canines démesurément longues. En parallèle, Jane Wilson (Karin Baal) arrive au château afin d’hériter du domaine suite à la mort de son père. Une succession de personnages tous logés à l’auberge Old Inn, semblent s’intéresser de près à Blackwood Castle, mais finissent par se faire assassiner par la même bête...', 'Rialto Film Preben-Philipsen', 'https://image.tmdb.org/t/p/w1280/vnax91SYm8iS4KvgMG0ai5MADIt.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zQ6NDG4KuuOMXpqo7lah2lqPF3o.jpg', 'https://www.youtube.com/embed/', 92, '1968', 3.2, 1),
(1672, 'France', 'Le Professionnel', 'Issu de l\'élite de l\'armée française, Joss Beaumont est chargé d\'exécuter le président du Malagawi. Un contre-ordre tombe, la cible est devenue un ami de l\'Etat. Pour l\'empêcher de nuire, Beaumont est incarcéré, mais ne tarde pas à s\'évader, décidé à  mener à  bien l\'opération malgré l\'opposition de sa hiérarchie.', 'Cerito Films', 'https://image.tmdb.org/t/p/w1280/1Crro6hN91lXc1sWXkU52tfjpAs.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mQsMFca19fZsLKMc6x5FjwncTYh.jpg', 'https://www.youtube.com/embed/e6-NTe1lk-E', 105, '1981', 3.64, 1),
(1673, 'United States of America', 'Comanche Station', 'Les investigations de Jeff Cody, qui recherche sa femme capturée quelques années plus tôt par les Comanches, le mènent sur le territoire d\'indiens hostiles qui vendraient une captive blanche, Mrs Lowe. Bien que n’étant pas celle qu\'il recherche, il décide de l\'escorter jusqu’à son mari. Celui-ci avait offert une récompense de 5 000 dollars à qui la retrouverait, morte ou vive, ce qu\'ignorait Cody. Trois chasseurs de prime se joignent au groupe avec l\'intention d\'abattre Cody et Mrs Lowe afin de ramener le corps de celle-ci à son mari.', 'Ranown Pictures Corp.', 'https://image.tmdb.org/t/p/w1280/7b0Sig8w1pP5QxBJVTuGIftz7St.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cxsxTW93MYtGPCQ0mXILkLYgNyK.jpg', 'https://www.youtube.com/embed/', 73, '1960', 3.3, 1),
(1675, 'France', 'La Nuit américaine', 'Ferrand, célèbre metteur en scène, commence le tournage de son nouveau film, « Je vous présente Pamela », aux studios de la Victorine, à Nice. Il a rassemblé autour de lui Bertrand, son producteur, Alphonse, le jeune premier, Julie Baker, une actrice américaine dépressive accompagnée de son mari, le docteur Nelson, Séverine, qui noie les outrages de l\'âge dans la boisson, Alexandre, un acteur quinquagénaire et, bien sûr, toute son équipe technique. Le tournage se révèle long et difficile, d\'autant plus que tous ces personnages accumulent intrigues, passions et éclats, devant et derrière les caméras…', 'Les Films du Carrosse', 'https://image.tmdb.org/t/p/w1280/vTT3I0KTP2N7OcEyWcHzwZ7CsxN.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6MbFN88F27WvGC9WhAXq5KUIgTj.jpg', 'https://www.youtube.com/embed/', 111, '1973', 3.93, 1),
(1676, 'United States of America', 'Will Penny, le solitaire', 'Un cow-boy veillissant s\'éprend d\'une inconnue qui se rend en Californie avec son jeune fils pour y retrouver son mari. Un itinéraire géographique et amoureux s\'engage.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/eKYPNPwFcYBos4A9okuJkbyOp20.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//u6QeHLm3NNAYwVzFnIiHtjqXowQ.jpg', 'https://www.youtube.com/embed/', 110, '1967', 3.3, 1),
(1677, 'United States of America', 'Ray', 'Ray Charles, c\'est d\'abord un mythe : cinq décennies de succès, une carrière musicale exceptionnellement riche, féconde et diverse, émaillée de dizaines de classiques qui ont fait le tour du monde et inspiré des générations de jeunes artistes. Mais derrière cette image légendaire se profile l\'histoire émouvante, méconnue, d\'une vie, l\'itinéraire d\'un homme qui réussit à surmonter ses handicaps et ses drames personnels.', 'Bristol Bay Productions', 'https://image.tmdb.org/t/p/w1280/xV6v2KVfB9akAVcMfwfPf8AzOaQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yDactKFWsgN6FMWW0kYU7AXhZA9.jpg', 'https://www.youtube.com/embed/', 152, '2004', 3.72, 1),
(1678, 'Japan', 'Godzilla', 'Une série de naufrages inexpliqués défraie la chronique japonaise. Au même moment, à la suite de plusieurs pêches infructueuses, les insulaires de l\'île Odo organisent une cérémonie pour apaiser la colère de \"Gojira\", un dragon marin vénéré depuis des temps immémoriaux. Mais la nuit venue, quelque chose débarque sur l\'île dans une tempête et piétine le village. Le lendemain, le professeur Kyohei Yamane examine le sol et découvre des traces de radioactivité ainsi qu\'un trilobite. Un gigantesque monstre reptilien apparaît bientôt aux yeux de tous, avant de s\'enfoncer dans la mer.', 'TOHO', 'https://image.tmdb.org/t/p/w1280/9J8JpnUL1GWOIGwWzHTvc1PmLF4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tWeQvXUaFoS0IP5anj7pdRsP6xF.jpg', 'https://www.youtube.com/embed/', 98, '1954', 3.8, 1),
(1679, 'Japan', 'Godzilla Raids Again', 'Two fishing scout pilots make a horrifying discovery when they encounter a second Godzilla alongside a new monster named Anguirus. Without the weapon that killed the original, authorities attempt to lure Godzilla away from the mainland. But Anguirus soon arrives and the two monsters make their way towards Osaka as Japan braces for tragedy.', 'TOHO', 'https://image.tmdb.org/t/p/w1280/bBYdh9tDCyLaArBOzE38QCA7C3y.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xbKFQCZNK14gp9k6cFCwgp2OCtU.jpg', 'https://www.youtube.com/embed/', 82, '1955', 2.96, 1),
(1680, 'Japan', 'King Kong vs. Godzilla', 'The advertising director of Pacific Pharmaceuticals, frustrated with the low ratings of their sponsored TV program, seeks a more sensationalist approach. He orders his staff to Faro Island to capture King Kong for exploitation. As Godzilla re-emerges, a media frenzy generates with Pacific looking to capitalize off of the ultimate battle.', 'TOHO', 'https://image.tmdb.org/t/p/w1280/dmCfyzUl0Ylk8Rpi6dYyWuBrnNr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9H8wGFwKKt2ADRhg2odywTg1NCZ.jpg', 'https://www.youtube.com/embed/od9mdKKAAKo', 97, '1962', 3.38, 1),
(1682, 'Japan', 'Mothra vs. Godzilla', 'Journalists Ichiro Sakai and Junko cover the wreckage of a typhoon when an enormous egg is found and claimed by greedy entrepreneurs. Mothra\'s fairies arrive and are aided by the journalists in a plea for its return. As their requests are denied, Godzilla arises near Nagoya and the people of Infant Island must decide if they are willing to answer Japan\'s own pleas for help.', 'TOHO', 'https://image.tmdb.org/t/p/w1280/y49vvM03gpuyhpyMc1f55VrNkP3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dKMpMwJB9Aq1fflGAcVfagfG0R5.jpg', 'https://www.youtube.com/embed/lRlttjvvvzE', 89, '1964', 3.52, 1),
(1683, 'United States of America', 'Les Châtiments', 'Katherine Winter a quitté l\'habit de missionnaire après le meurtre, au Soudan, de son mari et de sa petite fille. Professeur d\'université, elle consacre désormais tous ses efforts à démystifier les phénomènes \"surnaturels\" et à en fournir une explication scientifique et rationnelle. Devenue l\'expert n°1 en la matière, aucun \"miracle\" n\'a résisté jusqu\'ici à sa perspicacité. Katherine reçoit un jour la visite de Doug Blackwell, instituteur de la petite bourgade sudiste de Haven, en Louisiane. Des \"fléaux bibliques\" en série ont frappé cette localité dévote, qui menace d\'en faire payer le prix à une jeune sauvageonne, Loren. Katherine accepte de se rendre sur place avec son fidèle associé, Ben, pour sauver la vie de la fillette. Les phénomènes troublants s\'enchaînent et, pour la première fois, Katherine est mise en échec. Aucune de ses théories ne tenant la route, elle va devoir réviser tous ses principes pour juguler les forces obscures qui menacent Haven et sa propre sécurité...', 'Dark Castle Entertainment', 'https://image.tmdb.org/t/p/w1280/uAmUL23c20ldaq3n662Fulb8w3M.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4eakTJuJD3sRGfv1qVWW46iPq82.jpg', 'https://www.youtube.com/embed/', 98, '2007', 2.84, 1),
(1700, 'United States of America', 'Misery', 'Paul Sheldon, romancier et créateur du personnage de Misery dont il a écrit la saga est satisfait. Il vient enfin de faire mourir son héroïne et peut passer à autre chose. Il quitte l’hôtel de montagne où il a l’habitude d’écrire et prend la route de New York. Pris dans un violent blizzard, sa voiture dérape dans la neige et tombe dans un ravin. Paul Sheldon doit son salut à Annie Wilkes, infirmière retraitée qui vit dans un chalet isolé. Annie est justement une supporter inconditionnelle de la belle Misery.', 'Castle Rock Entertainment', 'https://image.tmdb.org/t/p/w1280/jiIsyK1cGrq3BVuF3iXfLDK8LLB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9BcwaJWXqHXV5D76I7ZOepFCoFk.jpg', 'https://www.youtube.com/embed/JsLve28ipME', 107, '1990', 3.88, 1),
(1701, 'United States of America', 'Les Ailes de l\'enfer', 'Cameron Poe, accusé de meurtre, a passé huit ans derrière les barreaux. Huit années qui l\'ont empêché d\'assister à la naissance de sa fille. Libéré sur parole, il n\'est plus séparé de la liberté que par quelques heures de vol à bord d\'un avion de la Con Air, la division aérienne de la police fédérale américaine. Une simple formalité s\'il n\'était accompagné de la fine fleur des criminels américains, en voie d\'être transférée vers un tout nouveau quartier haute sécurité. Après quelques minutes de vol, et ménés par Cyrus Grissom (qui répond aussi au doux surnom «Le virus»), les prisonniers s\'emparent de l\'appareil qui, endommagé par la lutte intestine, file sur Las Vegas. Unique être sensé à bord, Cameron Poe est le seul à pouvoir empêcher Cyrus de massacrer tous les policiers capturés, alors qu\'au sol, le Marshal Vince Larking, au courant de la présence de Poe, tente d\'empêcher ses supérieurs de détruire l\'appareil en vol…', 'Touchstone Pictures', 'https://image.tmdb.org/t/p/w1280/cQyiblTAXvjptd2ybySn7C2oRED.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4iUuOIYBBy12N21AAcEbHr5LQJr.jpg', 'https://www.youtube.com/embed/XNH5nzSvpoI', 116, '1997', 3.36, 1),
(1702, 'United Kingdom', 'Death Machine', 'Chaank Armaments is experimenting with the ultimate fighting machine which is part human - part machine. So far, the Hardman project has been unreliable and has killed a number of innocent people. The genius behind this project is Jack who lives in a world of models, toys and magazines. When he is fired by Cale for killing a few corporate officers, he unleashes the ultimate killing machine called the \'Warbeast\' against Cale and those who would help her.', 'Fugitive Features', 'https://image.tmdb.org/t/p/w1280/AsxeVBAsKSgqzfHhomfARCCsIa8.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//spmyXKG2BZnEQuFPQ3R2Q539EnI.jpg', 'https://www.youtube.com/embed/', 117, '1994', 2.95, 1),
(1705, 'United States of America', 'Battle for the Planet of the Apes', 'The fifth and final episode in the Planet of the Apes series. After the collapse of human civilization, a community of intelligent apes led by Caesar lives in harmony with a group of humans. Gorilla General Aldo tries to cause an ape civil war and a community of human mutants who live beneath a destroyed city try to conquer those whom they perceive as enemies. All leading to the finale.', 'Apjac International', 'https://image.tmdb.org/t/p/w1280/dP5dYjLp5p2CG103cJMio4Nj29d.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cY4Qmw4zy4rFnKwZc0xoMThT9A8.jpg', 'https://www.youtube.com/embed/', 93, '1973', 2.86, 1),
(1710, 'United States of America', 'Copycat', 'Le docteur Helen Hudson, psychiatre reputee et auteur d\'ouvrage a succès sur les serial killers, est victime d\'un de ses \"héros\" qui l\'agresse sauvagement a l\'issue d\'une causerie. Fortement traumatisée, Helen vit recluse dans son appartement de San Francisco et n\'entretient plus que de rares relations avec le monde extérieur. Jusqu\'au jour ou elle découvre a la une d\'un journal la photo d\'une jeune fille victime d\'un serial Killer. D\'autres crimes ont lieu et Helen se rend vite compte qu\'elle est a nouveau en danger.', 'New Regency Pictures', 'https://image.tmdb.org/t/p/w1280/xVU8ZSJAXyvsVhDH53wRfqxANQU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fYER1mVSnBVsPBSC7IAN0bbscGN.jpg', 'https://www.youtube.com/embed/NuK3LLrY3aw', 124, '1995', 3.25, 1),
(1711, 'United States of America', 'Onde de choc', 'Jack Peterson et Paul De Lucca, deux flics, ex-partenaires. Ils vont refaire équipe à l\'occasion d\'une intervention musclée visant à coincer une bande de trafiquants. Mais ceux-ci parviennent à fuir en abandonnant leur fourgon contenant 50 millions d\'héroïne. Pour récupérer la cargaison, les truands sont prêts à tout. À commencer par enlever la femme de Peterson...', 'Sheen/Michaels Entertainment', 'https://image.tmdb.org/t/p/w1280/oIA2lVOhJD63LBMsumL7urzXRYV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yqwxYu9UoPMYYNJFs9l12ID9qze.jpg', 'https://www.youtube.com/embed/', 93, '1999', 2.85, 1),
(1712, 'United States of America', 'Géant', 'Jett Rink et Bick Benedict convoitent la même femme, Leslie Lynnton, la fille d\'une riche famille dans le pétrole de Virginie. Leslie épouse Bick qui devient le patron de Jett. Celui-ci décide alors de travailler pour son compte.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/e11w1vQ95Cn4yoMWdV8Nn1wcSNI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4OnfjVUg827FMn0096JOYeNcxw6.jpg', 'https://www.youtube.com/embed/HMe8Hbd7B0c', 201, '1956', 3.81, 1),
(1713, 'United States of America', 'Jungle Fever', 'Un homme noir marié et prospère envisage d\'avoir une liaison avec une fille blanche du travail. Il craint à juste titre que la différence raciale ne rende encore pire une relation déjà taboue.', '40 Acres and a Mule Filmworks', 'https://image.tmdb.org/t/p/w1280/6Xno88A3266zIs7Pd97QoEgUbja.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ccnFwmNE8FBjS174G6GTyppUrPy.jpg', 'https://www.youtube.com/embed/', 132, '1991', 3.22, 1),
(1714, 'United Kingdom', 'Fahrenheit 451', 'Dans un pays indéfini, à une époque indéterminée, la lecture est rigoureusement interdite : elle empêcherait les gens d\'être heureux. La brigade des pompiers a pour seule mission de traquer les gens qui possèdent des livres et de réduire ces objets en cendres. Guy Montag, pompier zélé et citoyen respectueux des institutions, fait la connaissance de Clarisse, une jeune institutrice qui le fait douter de sa fonction. Peu à peu, il est à son tour gagné par l\'amour des livres.', 'Anglo Enterprises', 'https://image.tmdb.org/t/p/w1280/i8fmr2XecsJIhzrsvVW944myfxs.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nWhCbmAcAhRHrR60zqpAFNET7p5.jpg', 'https://www.youtube.com/embed/', 113, '1966', 3.57, 1),
(1715, 'United States of America', 'The Cider House Rules', 'Homer is an orphan who was never adopted, becoming the favorite of orphanage director Dr. Larch. Dr. Larch imparts his full medical knowledge on Homer, who becomes a skilled, albeit unlicensed, physician. But Homer yearns for a self-chosen life outside the orphanage. What will Homer learn about life and love in the cider house? What of the destiny that Dr. Larch has planned for him?', 'Miramax', 'https://image.tmdb.org/t/p/w1280/8Fr402A5aOS9JLK0Ll8C0QDcgwm.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//h2ARbAQTzkKlHhLjHNDY3c9HeyE.jpg', 'https://www.youtube.com/embed/', 126, '1999', 3.5, 1),
(1716, 'France', 'Le Dernier Métro', 'Alors que les Allemands occupent la moitié de la France, Marion Steiner ne pense qu\'aux répétitions de la pièce qu\'elle doit monter au théâtre Montmartre dont elle assure la direction depuis que son mari, Lucas, juif allemand, s\'est enfui de Paris. En réalité, Lucas s\'est réfugié dans les sous-sols du bâtiment. Chaque soir, Marion lui rend visite et commente avec lui le travail des comédiens, notamment celui du jeune premier de la troupe, Bernard Granger.', 'Les Films du Carrosse', 'https://image.tmdb.org/t/p/w1280/nj6wa47Eahgv55vE37CEFPhAwBq.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//u97pGlftKRNbUn0jOoQgIobSBvb.jpg', 'https://www.youtube.com/embed/0N2BfFD1QTo', 133, '1980', 3.61, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(1717, 'United States of America', 'Les Fous du roi', 'Les Fous du roi raconte l\'ascension politique d\'un idéaliste en Louisiane et révèle la corruption qui conduira à sa chute. Avec pour toile de fond un univers politique qui exacerbe ce qu\'il y a de meilleur ou de pire chez l\'homme, ce film nous entraîne dans les arcanes de l\'âme humaine. De la pureté à la trahison, de la culpabilité à la rédemption, cette fable est plus que jamais d\'actualité.', 'Relativity Media', 'https://image.tmdb.org/t/p/w1280/qBNMxHIq6TG5wY41Ogcexjm5xqm.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xvUKPJ9PXrh7904qZI0tbNlTMlZ.jpg', 'https://www.youtube.com/embed/iyS6V6GWNbQ', 128, '2006', 2.9, 1),
(1718, 'United States of America', 'La Piste de Santa Fé', '1854, Jeb Stuart et George Armstrong Custer partent à Fort Leavenworth, au Kansas, rejoindre la Deuxième Unité de Cavalerie. Mais la région est troublée par un certain John Brown, partisan de l\'abolition de l\'esclavage. Et l\'armée a pour ordre de stopper ces agissements.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/iyJTCCtQMcH28VxNUsiqRdnlv2B.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ejLNia8P6YrKbIpvEsihs0Ei8wL.jpg', 'https://www.youtube.com/embed/', 110, '1940', 2.89, 1),
(1719, 'France', 'La Peau douce', 'Un écrivain célèbre, marié à une femme charmante et heureux en ménage, tombe amoureux d\'une autre femme.', 'Les Films du Carrosse', 'https://image.tmdb.org/t/p/w1280/9bHHaK5ehIcEWvQc24WgHQYtMeR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9yPgh3v4itb0ah4XWgGM4BdAtNa.jpg', 'https://www.youtube.com/embed/', 119, '1964', 3.6, 1),
(1720, 'Denmark', 'Nói albínói', 'Est-il l\'idiot du village ou un génie compromis ? Noï, un adolescent de 17 ans, vit à la dérive dans un fjord reculé du nord de l\'Islande. En hiver, le fjord est coupé du monde extérieur, cerné par des montagnes menaçantes et enseveli sous un linceul de neige.\r Noï rêve de s\'évader de cette prison blanche avec Iris, une fille de la ville qui travaille dans une station-service. Mais ses maladroites tentatives d\'évasion se succèdent et échouent lamentablement. Seule une catastrophe naturelle fera voler en éclats l\'univers de Noï et lui laissera entrevoir un ailleurs prometteur.', 'Zik Zak Filmworks', 'https://image.tmdb.org/t/p/w1280/mhON0pTeOf7MV4RicoBD6veQJyv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2verdecl3RVgi25DCi9LgynSJtF.jpg', 'https://www.youtube.com/embed/', 93, '2003', 3.45, 1),
(1721, 'Italy', 'All the Way Boys', 'The \"Trinity\" crew makes another modern era film. Plata and Salud are pilots ditching aircraft for insurance money. They wind up crashing for real in the jungles of South America. The plot involves \"Mr. Big\", who is buying the diamonds from the miners for much too little, and has thugs who keep the price down. Of course, Plata and Salud side with the miners', 'Delta', 'https://image.tmdb.org/t/p/w1280/cWhBysh8ejHqKBcv5cGaA5FCCcq.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//iHJTF9WcXUfp8iy7EHPxMQ3XQyK.jpg', 'https://www.youtube.com/embed/U0xBiiXASGU', 106, '1972', 3.37, 1),
(1722, 'France', 'Capitaine Corelli', 'En 1941 sur une île de Grèce, les habitants croient échapper à la guerre mondiale qui embrase l\'Europe. Ils sont si loin du monde, et chez eux le climat est si doux...L\'histoire les rattrape pourtant lorsque les soldats italiens débarquent pour occuper l\'île. Entre le capitaine Corelli et la jolie Pelagia, déjà fiancée au pêcheur Mandras, les sentiments naissent peu à peu. Même si la jeune femme ne veut pas trahir son peuple et son fiancé dont elle n\'a plus de nouvelles depuis qu\'il est parti au front...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/lTtggJCeb3hWolpjpmuCif46Yqa.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6pOV0Ig0RF5AOUpIxv0YkAjBPh5.jpg', 'https://www.youtube.com/embed/M3lLNzTSRPo', 131, '2001', 2.97, 1),
(1723, 'United States of America', 'Le Prête-nom', 'En plein Maccarthysme, Alfred Miller, auteur de renom demande a son ami d\'enfance, Howard Prince, modeste plongeur dans un petit restaurant, de lui servir de prête-nom. Howard accepte et signe un feuilleton de télévision qui obtient un vif succès. Le héros du feuilleton, Hecky, est bientôt inquiété par la Commission qui lui demande de réunir des informations sur Howard. Hecky se jette alors du haut d\'un pont. Le petit plongeur est à son tour convoqué. Il accusera violemment les membres de la Commission d\'établir un climat de persécution et de peur !', 'Rollins-Joffe Productions', 'https://image.tmdb.org/t/p/w1280/5tIqXaJCCsTNMhUUAIMLybIX55A.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//f87CrE40sszI5BOBlObHwbvVprn.jpg', 'https://www.youtube.com/embed/Frx4zrWPAIM', 95, '1976', 3.48, 1),
(1724, 'United States of America', 'L\'Incroyable Hulk', 'Le scientifique Bruce Banner cherche désespérément un antidote aux radiations gamma qui ont créé Hulk. Il vit dans l\'ombre, toujours amoureux de la belle Betty Ross et parcourt la planète à la recherche d\'un remède. La force destructrice de Hulk attire le Général Thunderbolt Ross et son bras droit Blonsky qui rêvent de l\'utiliser à des fins militaires. Ils tentent de développer un sérum pour créer des soldats surpuissants. De retour aux États-Unis, Bruce Banner se découvre un nouvel ennemi. Après avoir essayé le sérum expérimental, Blonsky est devenu L\'Abomination, un monstre incontrôlable dont la force pure est même supérieure à celle de Hulk. Devenu fou, il s\'est transformé en plein cœur de New York. Pour sauver la ville de la destruction totale, Bruce Banner va devoir faire appel au monstre qui sommeille en lui...', 'Marvel Studios', 'https://image.tmdb.org/t/p/w1280/7zEWoMDAgvgHlv1D11vF3Br3ZTd.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jPu8yiadqgzwFPGKJmGo637ASVP.jpg', 'https://www.youtube.com/embed/dz6eBeW19Lg', 112, '2008', 3.1, 1),
(1725, 'United States of America', 'West Side Story', 'À New York, dans les années 1950, deux gangs de rue rivaux, les Jets (Américains d\'origine polonaise, irlandaise et italienne) et les Sharks (immigrés d\'origine portoricaine), font la loi dans le quartier du West Side. Ils se provoquent sans cesse, et s\'affrontent à l\'occasion. Tony, ancien chef des Jets qui a maintenant pris ses distances avec le gang, et Maria, la sœur du chef des Sharks, tombent amoureux, mais le couple doit subir les forces opposées de leurs clans respectifs.', 'Seven Arts Productions', 'https://image.tmdb.org/t/p/w1280/oJ32zGnSUs9XOP3GdELMCraJwyF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bkahbHkwBSbIDtTm667Tu1ba2bu.jpg', 'https://www.youtube.com/embed/', 151, '1961', 3.65, 1),
(1726, 'United States of America', 'Iron Man', 'Tony Stark, inventeur de génie, vendeur d\'armes et playboy milliardaire, est kidnappé. Forcé par ses ravisseurs de fabriquer une arme redoutable, il construit en secret une armure high-tech révolutionnaire qu\'il utilise pour s\'échapper. Comprenant la puissance de cette armure, il décide de l\'améliorer et de l\'utiliser pour faire régner la justice et protéger les innocents.', 'Marvel Studios', 'https://image.tmdb.org/t/p/w1280/egEkFOCl87aHJLkIGXGxzNdpQV3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cyecB7godJ6kNHGONFjUyVN9OX5.jpg', 'https://www.youtube.com/embed/QH3eAXZl3kY', 125, '2008', 3.82, 1),
(1727, 'United States of America', 'Bird on a Wire', 'An FBI informant has kept his new identity secret for 15 years. Now an old flame has recognised him, and the bad guys are back for revenge.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/vhsv2PrAPZ79ZpV64AJ2TiEI2zX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//coTUjqmUcrNLhxVISDdAAphemLt.jpg', 'https://www.youtube.com/embed/', 110, '1990', 3.09, 1),
(1729, 'China', 'Le Royaume Interdit', 'Fan de kung-fu et de cinéma hong-kongais, Jason Tripitika, 17 ans, rêve souvent du Roi Singe. Il découvre un jour, dans une boutique de Chinatown tenue par le vieux Hop, une longue canne - un \"bo\" - ornée d\'un singe en bronze qui ressemble à celui du personnage de ses rêves. Quelque temps après, une bande de malfaiteurs oblige Jason à s\'introduire dans la boutique pour la dévaliser. Hop est abattu d\'une balle, mais il a juste le temps de confier la canne à Jason et de lui faire promettre de la restituer à son propriétaire. Paniqué, le garçon s\'enfuit et, serrant la canne contre lui, tombe du toit. Quand il reprend connaissance, il se retrouve plongé dans la Chine ancienne, toujours en possession de la canne. Alors qu\'il est attaqué par les guerriers de Jade, Lu Yan, un ivrogne, vient à son secours et réussit en quelques mouvements de kung-fu à le débarrasser des agresseurs.', 'Casey Silver Productions', 'https://image.tmdb.org/t/p/w1280/fbNXNJuRLCiIKp7AusmRrVpPG7s.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9a59H9qoAzMcj1NWurMgvg9iLaT.jpg', 'https://www.youtube.com/embed/9jJUbS9V4iI', 113, '2008', 3.3, 1),
(1730, 'France', 'Inland Empire', 'Nous voici plongés dans une histoire de mystère, l\'énigme d\'un monde au coeur des mondes, le secret d\'une femme en proie à l\'amour et aux tourments...', 'Camerimage Festival', 'https://image.tmdb.org/t/p/w1280/lWVr2tmYiSTB082YKbZA9DcMcSD.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qyePa65qZVnuYWivTBXkHV9aI3A.jpg', 'https://www.youtube.com/embed/', 180, '2006', 3.53, 1),
(1731, 'Canada', 'Helen', 'Belle, brillante, mariée à David, mère d’une adorable jeune adolescente et professeur de musique, Helen semble avoir la vie parfaite. Elle semble… en effet, car en réalité elle camouffle un lourd secret depuis plusieurs années. Elle souffre d’une dépression profonde qui l’empêche de vivre sa vie. Même si sa famille et ses amis tentent de la sortir de l’abîme, personne ne comprend vraiment sa souffrance, elle trouve alors refuge auprès de l’un de ses élèves. Il est clair que la seule personne capable de sauver Helen, c’est… elle-même.', 'Insight Film Studios', 'https://image.tmdb.org/t/p/w1280/wEs97E6NlySjkMEWsDYs0BhQ9Mw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//Av7dyBkd8AhIO44EQQkmwLfpkGF.jpg', 'https://www.youtube.com/embed/', 120, '2009', 3.4, 1),
(1732, 'United States of America', 'The Prisoner of Zenda', '', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/qu9PmZs3qBNpJyjYr84RngAaFnO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nchAb2I3vuP3nVE6BYYkaK55pQv.jpg', 'https://www.youtube.com/embed/', 108, '1979', 2.9, 1),
(1734, 'United States of America', 'Le Retour de la Momie', 'En 1935, Rick O’Connell et sa femme Evelyn mènent une vie paisible à Londres avec Alex, leur fils talentueux. Mais une nouvelle catastrophe se prépare dans les profondeurs du désert saharien. Six mille ans avant notre ère, le roi Scorpion, fit un pacte avec le dieu Anubis, qu’il trahit. Damné pour l’éternité, il est sur le point de sortir des limbes et de lever l’armée d’Anubis pour dévaster la planète. Une secte mystérieuse et avide de pouvoir menée par le diabolique Lock Nah et la séduisante Meela, ramènent à la vie la seule créature capable de faire face au roi Scorpion : le grand prêtre Imhotep, condamné depuis trois mille ans à errer comme un mort‐vivant pour avoir séduit la favorite du Pharaon. Sa momie est entreposée dans une salle secrète du British Museum. Ardeth Bay, chef militaire des Medja, implore O’Connell d’empêcher ce forfait aux conséquences désastreuses.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/lpoNz4jcuRGki78ucF0et4Uy3vB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uoOD6qqz4QFhgvhdsrrQUmkmAMc.jpg', 'https://www.youtube.com/embed/-idbUg2VJYo', 129, '2001', 3.15, 1),
(1735, 'Canada', 'La Momie : La Tombe de l\'empereur Dragon', 'Victimes d\'une sorcière maléfique, l\'Empereur Dragon et ses 5000 soldats ont été relégués pour l\'éternité dans les limbes. L\'immense armée de terre cuite reposera ainsi durant 2000 ans, oubliée de tous, jusqu\'à ce qu\'Alex commette l\'erreur de réveiller son chef. Pour éviter une vague de méfaits, Rick devra appeler à la rescousse les seules personnes plus habiles que lui à combattre les morts-vivants : sa propre famille...', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/AjIfN4s2TtkXYjU22Bm7Ow8mYaM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//z1btePhD1jIDLbjy5OCnO0KVf5O.jpg', 'https://www.youtube.com/embed/JVi6zbmXSrM', 111, '2008', 2.73, 1),
(1770, 'Ireland', 'Michael Collins', 'Épopée de la lutte pour l\'indépendance de l\'Irlande au début du siècle. La puissante Angleterre a toujours connu la contestation de la part de sa plus proche colonie, l\'Irlande. Pendant 700 ans, les révoltes ont été jugulées. Mais en 1916, une rébellion éclate à Dublin, qui changera le cours de l\'histoire. L\'artisan de cette révolte, un homme de l\'ombre voué à son pays, s\'appelait Michael Collins.', 'Geffen Pictures', 'https://image.tmdb.org/t/p/w1280/9fiZ4SsvnbhBgiXnfQV6DMC7TYp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//A4Ikk4bR7R16rMFrDUsbUrurEHM.jpg', 'https://www.youtube.com/embed/F1pkbe29910', 138, '1996', 3.45, 1),
(1771, 'United States of America', 'Captain America : First Avenger', '1941, la Seconde Guerre Mondiale fait rage. Après avoir tenté vainement de s\'engager dans l\'armée pour se battre aux côtés des Alliés, Steve Rogers, frêle et timide, se porte volontaire pour participer à un programme expérimental qui va le transformer en un Super Soldat connu sous le nom de Captain America. Sous le commandement du colonel Chester Phillips, il s\'apprête à affronter HYDRA, l\'organisation scientifique secrète des nazis dirigée par le redoutable Crâne Rouge, aux côtés de Bucky Barnes et Peggy Carter...', 'Marvel Studios', 'https://image.tmdb.org/t/p/w1280/l1SP3gyHA5ZEuf72WKx5ihtZZFO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4NWWpT0jiMUak8r6jfpvG4eBgFU.jpg', 'https://www.youtube.com/embed/W4DlMggBPvc', 124, '2011', 3.49, 1),
(1790, 'United States of America', 'Au paradis à coups de revolver', 'Devenu fondateur de la Mission évangélique du Bon Pasteur, l\'ancien tueur repenti et amnistié, Jim Killian, se consacre à présent à la pacification des communautés déchirées par tous les conflits marquants de la Conquête de l\'Ouest. Jim Killian intervient à Vinegatoon où le puissant clan des éleveurs de bovins s\'oppose aux pauvres bergers pour des raisons de pâturages. La bible se révèlera alors impuissante face aux revolvers... et l\'affrontement sera inévitable.', 'King Brothers Productions', 'https://image.tmdb.org/t/p/w1280/4A1wm2H6FYFyKDKhJSfZ8jVMcqO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ocesZs2joS6MqTXRWmRGqNIF56p.jpg', 'https://www.youtube.com/embed/', 101, '1969', 2.65, 1),
(1791, 'Austria', 'La Pianiste', 'Erika Kohut, la quarantaine, est professeur de piano au Conservatoire de Vienne. Pour échapper à l\'emprise de sa mère avec laquelle elle vit en vase clos, elle fréquente en secret les cinémas pornos et les peep-shows. Sa sexualité se résume à un voyeurisme morbide et aux mutilations masochistes qu\'elle s\'inflige. Erika est hors la vie, jusqu\'au jour où l\'un de ses élèves se met en tête de la séduire.', 'ARTE', 'https://image.tmdb.org/t/p/w1280/q4ZMM6l77I7KTTilYl5K99oZ1qL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uoW2gaHL28IyCny0U4Kqh8vxV3M.jpg', 'https://www.youtube.com/embed/DKpk8mzoweA', 125, '2001', 3.65, 1),
(1792, 'United States of America', 'Deux en un', 'Bob et Walt Tenor sont deux frères siamois. Loin d\'être un malheur, cette situation leur vaut un succès inespéré dans leur petite bourgade. Mais Walt rêve de faire du cinéma. Malgré sa réticence, Bob accepte. Arrivé à Hollywood, Walt décroche son premier rôle mais dans un film porno... La diva Cher les engage dans sa nouvelle série. Alors qu\'elle espérait torpiller le show pour se libérer de son contrat, l\'émission fait un tabac... Après trois ans de chat sur internet, Bob va rencontrer sa May qui ignore tout de la situation. Les deux frères sont confrontés à une décision qui changera leur vie à jamais...', 'Conundrum Entertainment', 'https://image.tmdb.org/t/p/w1280/5f4fCyVoQPtzc0peHLbXNWqDA7e.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nVQ8eBeXvvaTlRuU0Fe45LwJaCI.jpg', 'https://www.youtube.com/embed/', 118, '2003', 2.66, 1),
(1793, 'United States of America', 'Max Dugan Returns', 'An English teacher and struggling single mother has her life disrupted when the father who abandoned her as a child comes back into her life.', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/wYOmBIJwliiu43CwWqx79f8Zp8Z.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1JiAfaorx2V6vaHWUuDpRa1gm5v.jpg', 'https://www.youtube.com/embed/', 98, '1983', 3.28, 1),
(1802, 'Germany', 'La cérémonie', 'Une famille bourgeoise recrute une nouvelle bonne à tout faire, Sophie. Celle-ci souffre d\'un handicap qu\'elle dissimule à ses employeurs : elle est illettrée. Les choses se dégradent lorsqu\'elle se lie d\'amitié avec Jeanne, la postière qui ouvre les lettres.', 'Olga Film GmbH', 'https://image.tmdb.org/t/p/w1280/9Mnc2cp0xuucyVT7wINtikdlH0l.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//eFGZ6ojTBGhE6zIEJ03WWZhipgg.jpg', 'https://www.youtube.com/embed/H63eq2zYsI0', 111, '1995', 3.65, 1),
(1803, 'United States of America', 'Angel', 'Charmante lycéenne obtenant de brillants résultats scolaires le jour, Molly Stewart devient la nuit une prostituée dans les bas-fonds d\'Hollywwod. Dans ce cadre terrifiant, l\'horreur va encore monter d\'un cran quand un maniaque assassinera sauvagement la meilleure amie d\'Angel. Celle-ci maintenant armée, va le traquer sans relâche...', 'Adams Apple Film Company', 'https://image.tmdb.org/t/p/w1280/xGEd9xaoTLfolyaYi3GXtWutHgI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jTFVQ0TvIB3yjt2HSKssP5EiCqT.jpg', 'https://www.youtube.com/embed/E2Js81w4imY', 92, '1984', 3, 1),
(1807, 'United States of America', 'Elephant', 'En ce jour d\'automne, les lycéens, comme à leur habitude, partagent leur temps entre cours, football, photographie, potins, etc. Pour chacun des élèves, le lycée représente une expérience différente, enrichissante ou amicale pour les uns, traumatisante, solitaire ou difficile pour les autres. Cette journée semble ordinaire, et pourtant le drame couve...', 'HBO Films', 'https://image.tmdb.org/t/p/w1280/nuRL5eU6LohqFkI1nDn7cjRdPsk.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//t2DJFqKeoXwxkexpDyFtrNKcwlP.jpg', 'https://www.youtube.com/embed/PBTBoUvvFnA', 81, '2003', 3.55, 1),
(1808, 'United Kingdom', 'Velvet Goldmine', 'A travers l\'enquête d\'Arthur, un journaliste anglais expatrié à New York, sur une star du Glam Rock, Brian Slade, évocation des années soixante-dix en Angleterre. Arthur explore l\'ascension et la chute de Brian Slade qui fut son idole quand il était adolescent à Manchester, son mariage avec Mandy et sa liaison avec Curt Wild, une star de la scène rock américaine. Cette enquête sera pour Arthur l\'occasion de se pencher sur son passé, et de comprendre à quel point Brian Slade et Curt Wild ont bouleversé sa vie.', 'Channel Four Films', 'https://image.tmdb.org/t/p/w1280/lgq5k2n6ZbyuiHw68CetYr7l1Fg.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zUs2GW4rPSIsfzBp0GtXaQR2mqk.jpg', 'https://www.youtube.com/embed/mNx-hJ54L70', 120, '1998', 3.47, 1),
(1809, 'Germany', 'The Rules of Attraction', 'The incredibly spoiled and overprivileged students of Camden College are a backdrop for an unusual love triangle between a drug dealer, a virgin and a bisexual classmate.', 'Kingsgate Films', 'https://image.tmdb.org/t/p/w1280/uBYwzAtAI5GapABsHEKy49zG54f.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pIZcsiZxSWr6wpKBtHYWHSWa83B.jpg', 'https://www.youtube.com/embed/', 110, '2002', 3.09, 1),
(1810, 'United States of America', 'Viva Zapata !', '1909. Porfirio Díaz est à la tête du Mexique depuis 34 ans. Un groupe de paysans du Morelos est spolié de ses terres par des propriétaires terriens, exploitants de canne à sucre. Devant la condescendance du dictateur et son refus d\'intervenir, Emiliano Zapata, aidé de son ami Pancho Villa (Alan Reed) et de son frère Eufemio (Anthony Quinn), décide de prendre la tête de la révolte et de faire triompher le bon droit des paysans.', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/4wkaYLAz21SBn3ANPBtoR8BiiM1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7aX2mfTcQArKS9PufnngjexnaQY.jpg', 'https://www.youtube.com/embed/', 113, '1952', 3.49, 1),
(1811, 'France', 'Nowhere', 'L\'histoire d\'un voyage en apnée dans la journée banale d\'un adolescent de Los Angeles âgé de dix-huit ans, Dark Smith, hanté par la fin du monde et la quête de l\'amour pur.', 'Desperate Pictures', 'https://image.tmdb.org/t/p/w1280/9CaVnvBRbzsM7mcJoIMncpHSBBN.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4qoh74EQvi6vOXMecNX5s85FDch.jpg', 'https://www.youtube.com/embed/', 78, '1997', 3.4, 1),
(1812, 'United States of America', 'Trick', 'Gabriel is a young, aspiring musical composer whose life seems stuck in the First Act. When his new musical number gets a critical reception, a theatre colleague, Perry, tells Gabriel that he needs to get a life before he can write about one – so he heads straight for his local gay bar.', 'Roadside Attractions', 'https://image.tmdb.org/t/p/w1280/qRkpmHO6RRysdd57kTfetd2465F.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lZLPjOxBPKSBwzCfYqG85Wztd9c.jpg', 'https://www.youtube.com/embed/R94MIJXMjB8', 89, '1999', 3.55, 1),
(1813, 'Germany', 'L\'Associé du diable', 'Kevin Lomax, jeune et brillant avocat, est approché par l\'un des plus puissants cabinets New-Yorkais dirigé par l\'étrange John Milton. Assoiffé de pouvoir et d\'argent, poussé par une ambition dévorante, prêt à tout pour réussir, il accepte l\'offre et gravit les marches de la réussite de façon fulgurante. Mais l\'ambition a un prix : sans le savoir, Kevin vient de vendre son âme au diable...', 'Monarchy Enterprises B.V.', 'https://image.tmdb.org/t/p/w1280/dwRco8u0IrVfiWzSH8HLUjgRdNR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//i9lR2jLV0dHVfVs1u6QqqbQAE9I.jpg', 'https://www.youtube.com/embed/t0uptop3Zxs', 144, '1997', 3.73, 1),
(1814, 'Czech Republic', 'Schröders wunderbare Welt', '', 'filmkombinat Nordost GmbH & Co. KG', 'https://image.tmdb.org/t/p/w1280/zBczd0Y2SmY1hytez9psvJc6voh.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 114, '2006', 0, 1),
(1815, 'United Kingdom', 'Le Grand Sommeil', 'Un vieux général demande au detective privé Philip Marlowe d\'enquêter sur une affaire de chantage concernant sa plus jeune fille. L\'enquête révèle très rapidement qu\'un mystère plane autour de la disparition du mari de l\'aînée.', 'ITC Entertainment', 'https://image.tmdb.org/t/p/w1280/moBuoPdT2ow7OVkzibWJcrGnkOX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yz54vZyynTtKyq82zjJFucBcOUm.jpg', 'https://www.youtube.com/embed/', 100, '1978', 2.97, 1),
(1816, 'United States of America', 'A Chorus Line', 'A group of dancers congregate on the stage of a Broadway theatre to audition for a new musical production directed by Zach. After the initial eliminations, seventeen hopefuls remain, among them Cassie, who once had a tempestuous romantic relationship with Zach. She is desperate enough for work to humble herself and audition for him; whether he\'s willing to let professionalism overcome his personal feelings about their past remains to be seen.', 'Feuer and Martin Production, A', 'https://image.tmdb.org/t/p/w1280/eCyWdrWp6uTmXq0ZeFFxzWPNByN.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//AvPLYsn8SyDWFFBzBqmsohZ5p8x.jpg', 'https://www.youtube.com/embed/', 117, '1985', 3.15, 1),
(1817, 'United States of America', 'Phone Game', 'Stu Shepard, un attaché de presse, passe devant une cabine publique. Le téléphone sonne, Stu répond à l\'appel. Une voix qu\'il ne connaît pas l\'informe qu\'il est mort s\'il raccroche le combiné. Le point lumineux d\'un rayon infrarouge sur son torse prouve que le mystérieux interlocuteur ne bluffe pas...Un terrible incident ayant éclaté à quelques mètres de la cabine, la police arrive sur les lieux, flanquée de tireurs d\'élite. Tous pensent que Stu, et non son invisible interlocuteur téléphonique, en est l\'auteur. L\'officier responsable, le capitaine Ramey, tente de convaincre Stu de sortir de la cabine...', 'Fox 2000 Pictures', 'https://image.tmdb.org/t/p/w1280/wuRvyVea83tn2vcof8zsrinS5tf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//g7DVjfNTeYVbVhmw0nx5TZjZryS.jpg', 'https://www.youtube.com/embed/b907DkcMgbE', 81, '2003', 3.42, 1),
(1818, 'France', 'Tirez sur le pianiste', 'Charlie Kohler, pianiste dans un petit bar, commence à avoir des ennuis lorsque deux gangsters s\'en prennent à son frère qui se réfugie sur son lieu de travail. Dans le même temps, Léna, la serveuse est amoureuse de Charlie alors que ce dernier cache un sombre passé auquel la jeune femme va tenter de le soustraire.', 'Les Films de la Pléiade', 'https://image.tmdb.org/t/p/w1280/84exM47Ng4T4iWNofjFmlGZNosA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kgAZX0WXLuK6YYQ6lKN2UdF1Tho.jpg', 'https://www.youtube.com/embed/X4BY8h9B92M', 90, '1960', 3.62, 1),
(1819, 'United States of America', 'Toi et Moi… et Duprée', 'Jamais deux sans trois... Jeunes mariés, Carl et Molly Peterson sont à peine rentrés d\'une brève lune de miel à Hawaii que débarque chez eux l\'ineffable Randolph Dupree, célibataire endurci, glandeur incurable... et meilleur ami de Carl. Licencié pour s\'être octroyé une semaine de congés et plaqué par sa petite amie, Duprée se retrouve sans travail, sans ressources, sans voiture et sans domicile.Comment les Peterson lui refuseraient-ils l\'hospitalité ? Combien de temps pense-t-il rester ? Deux, trois jours au maxium, éventuellement un mois, mais peut-être un peu plus...', 'MMCB Film Produktion 2004', 'https://image.tmdb.org/t/p/w1280/fz0eoRXwxQ8TEdqmp1PGdM54zsB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gQ0iTUlpgPp0CrvBpa6ht3bY3Np.jpg', 'https://www.youtube.com/embed/', 108, '2006', 2.79, 1),
(1824, 'United States of America', 'Amour et Amnésie', 'La vie de Henry Roth est simple. Lorsque ce vétérinaire spécialiste des animaux marins polaires ne travaille pas au parc Sea Life de Hawaï, il se consacre à son autre passion : les aventures sans lendemain avec de jolies touristes en mal de romantisme. Henry refuse toute liaison sérieuse par peur de compromettre son rêve de partir en Alaska étudier les morses… Pourtant, lorsqu’il rencontre Lucy, il est tout de suite fasciné. Enfreignant sa propre règle qui lui interdit de charmer des jeunes femmes du coin, Henry aborde Lucy, discute agréablement avec elle et obtient même un rendez‐vous pour le lendemain. Lorsqu’il s’y présente, Lucy ne le reconnaît pas et hurle à l’agression. Henry va découvrir que la jeune femme souffre d’une étrange maladie qui, chaque nuit, lui fait tout oublier. S’il veut vivre quelque chose avec elle, chaque jour devra être comme le premier…', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/4Odr5SZBvY6gMQaxmlg72nqVHhI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//z6eMgnSt6VA0Gf9dirjpkBPu0uS.jpg', 'https://www.youtube.com/embed/1zl_w-BLCNQ', 99, '2004', 3.42, 1),
(1825, 'United States of America', 'Over the Top : Bras de fer', 'Chauffeur routier solitaire, Lincoln Hawk est rongé par un divorce et par la culpabilité d\'avoir abandonné un fils Michael qu\'il n\'a jamais vu. Lorsque Lincoln, sur les conseils de son ex-femme, part chercher son fils à l\'Académie Militaire, il se cogne à l\'agressivité de ce dernier. Pour Lincoln, le seul moyen de prouver à son fils, et à lui-même, qui il est réellement, c\'est de remporter le championnat du monde de bras de fer de Las Vegas !', 'Cannon Group', 'https://image.tmdb.org/t/p/w1280/bfRtSKcqdFQcQ8rnTi4iYbiD6dl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dcNs7gOSc8abhGISZA9hVIsaUDh.jpg', 'https://www.youtube.com/embed/3pYNd0MSVXs', 93, '1987', 3.18, 1),
(1826, 'France', 'Les Poupées russes', 'Xavier a 30 ans. Il a réalisé son rêve d’enfance, il est devenu écrivain, mais il semble quand même un peu perdu. Il a quelques problèmes avec sa banquière. Il a également des réticences à se fixer avec une fille et enchaîne les aventures amoureuses avec inconséquence. Xavier est contraint de continuer son travail à Londres, puis à Saint‐Pétersbourg. Ces nouveaux voyages lui permettront peut‐être de réconcilier le travail, l’amour et l’écriture.', 'StudioCanal', 'https://image.tmdb.org/t/p/w1280/6TsIJvLTlqVZPzpsx6asbz5jkfl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2GrIzazWXa7sDigrETwj9e0xIG1.jpg', 'https://www.youtube.com/embed/xxMUSPHkwAs', 125, '2005', 3.31, 1),
(1829, 'France', 'L\'Histoire d\'Adèle H.', 'Le film relate l\'histoire d\'Adèle Hugo, deuxième fille de Victor Hugo. Ce dernier, obnubilé par la mort accidentelle de son aînée, Léopoldine Hugo, avait délaissé la cadette. Adèle connaît par la suite un amour passionné, voire obsessionnel, pour le lieutenant britannique Pinson qui ne la paye pas de retour. Elle termine sa vie dans la déchéance et la folie.', 'Les Films du Carrosse', 'https://image.tmdb.org/t/p/w1280/s6T4pDrMgOni2gr2J7p79VHGiW3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//l74RI23VnGOjqBX7EjHk6gJ5NWp.jpg', 'https://www.youtube.com/embed/BAFt98b6Xv4', 98, '1975', 3.45, 1),
(1830, 'France', 'Lord of War', 'Né en Ukraine avant l\'effondrement du bloc soviétique, Yuri arrive aux Etats-Unis avec ses parents. Il se fait passer pour un émigrant juif...Audacieux et fin négociateur, il se fait une place dans le trafic d\'armes. Les énormes sommes d\'argent qu\'il gagne lui permettent aussi de conquérir celle qui l\'a toujours fasciné, la belle Ava. Parallèlement à cette vie de mari et de père idéal, Yuri devient l\'un des plus gros vendeurs d\'armes clandestins du monde. Utilisant ses relations à l\'Est, il multiplie les coups toujours plus risqués, mais parvient chaque fois à échapper à Jack Valentine, l\'agent d\'Interpol qui le pourchasse.Des luxueux immeubles new-yorkais aux palais des dictateurs africains, Yuri joue de plus en plus gros. Convaincu de sa chance, il poursuit sa double vie explosive, jusqu\'à ce que le destin et sa conscience le rattrapent...', 'Endgame Entertainment', 'https://image.tmdb.org/t/p/w1280/xdtwvmZaYiDMivwQLuuM146rrCj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aDswjn9q5QCtLi7DaoJ21rq2pm8.jpg', 'https://www.youtube.com/embed/XbK0OfY5F_4', 122, '2005', 3.63, 1),
(1831, 'United States of America', 'Un couple presque parfait', 'Abbie et Robert sont les meilleurs amis du monde. Ils ont en commun une approche assez légère de la vie, une finesse d\'esprit, une spontanéité attachante... et une vie amoureuse désastreuse. Ils formeraient un couple idéal si seulement Robert n\'était pas homosexuel. Un soir pourtant, après avoir noyé leur chagrin de la perte d\'un ami dans l\'alcool, ils vont plus loin... et Abbie tombe enceinte. Cette nouvelle inattendue bouleverse leurs plans et leur existence. Non sans hésitation, Abbie et Robert décident de vivre ensemble comme une famille ordinaire.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/qgFYUe0Eg5P63189McVqJN6jN3E.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//13JLRMl7fJajV8F85SaBErRRQvt.jpg', 'https://www.youtube.com/embed/', 207, '2000', 2.6, 1),
(1832, 'United States of America', 'Dogma', 'Bethany est chargée par Metatron, la voix de Dieu, d’une mission : empêcher Loki et Bartleby, deux anges renégats, de pénétrer dans une église consacrée du New Jersey. Leur retour au Paradis détruirait toute existence. Pour la seconder, elle est accompagnée par deux incroyables prophètes, un prétendu treizième apôtre et une muse céleste.', 'View Askew Productions', 'https://image.tmdb.org/t/p/w1280/bNrjfYFFOHgpRJs9K3Xrql8qD7D.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wXzdoMyLYvz7AoXPGx5STZ1XZDd.jpg', 'https://www.youtube.com/embed/', 130, '1999', 3.45, 1),
(1833, 'United States of America', 'Rent', 'Deux amis, Mark et Roger, partagent un appartement à New York. Mark, vidéaste, filme sans cesse son entourage, tandis que Roger, atteint du sida, rêve d\'écrire une dernière chanson avant que la maladie de l\'emporte. Sa rencontre avec Mimi, jeune toxicomane séropositive, changera sa vie. Se sachant condamnés, les deux amoureux connaîtront un amour aussi fiévreux qu\'éphémère.', '1492 Pictures', 'https://image.tmdb.org/t/p/w1280/pRl3DHOsIixdLcfHu6EID69eoL2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//iQoGzaGqJ8dbTuLhPLODn57GS0L.jpg', 'https://www.youtube.com/embed/_lyzq4LqeVg', 135, '2005', 3.42, 1),
(1834, 'United States of America', 'Adieu ma belle', 'Dans un poste de police de Los Angeles, des inspecteurs questionnent sévèrement le détective Philip Marlowe, accusé de plusieurs meurtres. Celui-ci raconte alors les faits qui l\'ont entraîné dans bien des problèmes depuis le jour où il a accepté de recherché une jeune fille nommée Velma, pour le compte d\'un ex-bagnard, \"Moose\" Malloy.', 'RKO Radio Pictures', 'https://image.tmdb.org/t/p/w1280/xEfjSAGkDGUwZCvAI2qeIwtLhOC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dR7NcWkMF2LkiMCR0oOjvec84SG.jpg', 'https://www.youtube.com/embed/', 95, '1944', 3.66, 1),
(1835, 'United States of America', 'Adieu, ma jolie', 'À sa sortie de prison, Moose Malloy engage un détective privé, Philip Marlowe, pour retrouver son amie disparue, Velma. La première piste empruntée par le détective est une impasse. L\'enquête piétine et Marlowe accepte une autre mission, qui va finalement l\'orienter vers une piste sérieuse pour la première…', 'E.K.', 'https://image.tmdb.org/t/p/w1280/8M7ZSVEuUXa8AqHm0l3oGQJJNPq.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//r0EBtfYplRIagrYMfi0pni3xpzr.jpg', 'https://www.youtube.com/embed/M3KI-GjPQdY', 91, '1975', 3.31, 1),
(1836, 'France', 'Dans ma peau', 'Agée d\'une trentaine d\'année, Esther réalise ce dont on peut rêver à son âge : en mission dans une société d\'études de marché, elle réussit à passer chef de projet junior. Elle vit aussi une histoire d\'amour avec Laurent avec qui elle envisage d\'acheter un logement.  Tout va donc bien jusqu\'au moment où elle tombe dans le jardin sombre d\'une maison où se tient une soirée à laquelle elle participe. Plusieurs heures après sa chute, elle se rend compte qu\'elle est vraiment blessée et doit se rendre aux urgences. Elle ne comprend pas pourquoi elle n\'a pas senti cette blessure, pourquoi elle n\'a pas eu conscience de ce qui se passait dans son corps.  Esther commence alors à se lacérer la peau, comme pour retrouver la présence de son corps.', 'Lazennec et Associés', 'https://image.tmdb.org/t/p/w1280/hoLNth29tYYUM5HoqXmBjKvL9zk.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jNAOK7qoSwsnDuNjbTgYRJlaogZ.jpg', 'https://www.youtube.com/embed/HP6Ro-Rwvl8', 93, '2002', 3.02, 1),
(1837, 'France', 'Le Secret', 'Marie, 35 ans, représentante en encyclopédies, aime son mari Francois, qui désire avoir un deuxieme enfant. Mais Marie hésite, sans trop savoir pourquoi. Un jour, elle rencontre un client singulier, Bill, noir américain d\'une cinquantaine d\'années. D\'abord intriguée, elle tombe peu à peu sous son charme...', 'Les Productions Bagheera', 'https://image.tmdb.org/t/p/w1280/AkszgIaZnxNQx5fE3pl114fyxPm.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 107, '2000', 3.55, 1),
(1838, 'Denmark', 'Drømmen', '', 'Zentropa Entertainments', 'https://image.tmdb.org/t/p/w1280/byJprQdypke0p7WtzDyTyZVPzau.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//a0FdVLFrrNuoATac7IIpLF8ycY1.jpg', 'https://www.youtube.com/embed/', 105, '2006', 3.55, 1),
(1839, 'France', 'Alias', '', 'Lazennec Tout Court', 'https://image.tmdb.org/t/p/w1280/xnouzPXu3xjhy437LeogB4L9nkg.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 13, '1999', 3, 1),
(1840, 'United States of America', 'The Brasher Doubloon', '', '20th Century Fox', 'https://image.tmdb.org/t/p/w1280/eneuf3VaJaMaVlZaFpcfV46VNnm.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lnQ2tA9VInk6g0NyH9ULaQHCdUX.jpg', 'https://www.youtube.com/embed/', 72, '1947', 2.98, 1),
(1841, 'United States of America', 'La Dame du lac', 'Hollywood, années 1940. Le détective Philip Marlowe est chargé par Derace Kingsley de retrouver sa femme. Elle lui a envoyé un télégramme un mois auparavant pour lui annoncer qu\'elle partait au Mexique épouser un certain Chris Lavery. Or Kingsley a rencontré Lavery quelques jours auparavant à Hollywood et il semble tout ignorer de ce voyage. Marlowe part enquêter dans la résidence secondaire des Kingsley où Chrystal Kingsley a été vue pour la dernière fois. Il va y trouver un premier cadavre dans le lac.', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/iANVw5F9H16s1j3dBsf26o2iQMb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tm4yDVgjqQxqOugvnGONpmTbWP8.jpg', 'https://www.youtube.com/embed/mB-PyUSFskI', 105, '1946', 3.01, 1),
(1842, 'United States of America', 'The Legend of Boggy Creek', '', 'P & L', 'https://image.tmdb.org/t/p/w1280/pabw9hEV93OEDtXaHGWNunX2j4W.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uTgXhEsfdxNMYTVDnmMzwZQsuWt.jpg', 'https://www.youtube.com/embed/vBe8Fk4Siv8', 87, '1972', 2.49, 1),
(1843, 'United States of America', 'Dig!', 'L\'histoire exemplaire de deux groupes de la scène indépendante américaine vue de l\'intérieur : les Brian Jonestown Massacre de San Francisco et les Dandy Warhols de Portland. Unis au départ par un même esprit de révolte et de création, par une admiration réciproque, chacun va gérer à sa façon le tiraillement entre ses aspirations artistiques et sa soif de notoriété.', 'Interloper Films', 'https://image.tmdb.org/t/p/w1280/cQvSyoQ0Dulctdojzeh7zRi3lcF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yg9W3bFUMbTYrmB3N1gXI9IuI1a.jpg', 'https://www.youtube.com/embed/', 107, '2004', 3.5, 1),
(1844, 'United Kingdom', 'Haute voltige', 'Quand, dans la nuit du 15 décembre 1999, un Rembrandt d\'une valeur inestimable est dérobe dans le salon d\'un richissime collectionneur, les soupçons se portent aussitôt sur Robert Mac Dougal, grand amateur d\'art et illustre voleur de tableaux insaisissable. Virginia Baker, le meilleur agent des Assurances Waverly, qui a étudie la personnalité de Mac Dougal, soumet au directeur un projet audacieux pour récupérer le tableau. Elle appâtera le gentleman cambrioleur en se faisant passer pour une voleuse, le séduira et le fera tomber en lui proposant un casse irrésistible.', 'Fountainbridge Films', 'https://image.tmdb.org/t/p/w1280/sxuqoTxsCKK17btEBWVXEZsiaKf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rsV4f4dzHyJIZ3WGNykh7K2WMHZ.jpg', 'https://www.youtube.com/embed/LFSpRNtxd8I', 113, '1999', 3.09, 1),
(1845, 'France', '2 Days in Paris', 'Marion, photographe d\'origine française, vit à New York avec Jack, architecte d\'intérieur. Pour donner un nouveau souffle à leur relation, ils partent en voyage à Venise. Mais leur séjour est gâché lorsque Jack attrape une gastro-entérite. Ils décident alors de se rendre à Paris où Marion a toujours des attaches. Là encore, l\'escapade amoureuse tourne court : entre les parents envahissants de la jeune femme, ses ex-petits copains dragueurs et la manie de Jack à prendre en photo la moindre pierre tombale, le couple ne trouve aucun répit ! Parviendront-ils à surmonter la tempête ? Ou passeront-ils maîtres dans l\'art de la dispute ?', '3L Filmproduktion GmbH', 'https://image.tmdb.org/t/p/w1280/x8D51JiCDJnJEuikXEIGUmAoSOa.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jyaCqYH5gLEp0Z9oZJ8nQrQM9pA.jpg', 'https://www.youtube.com/embed/UalV9UaFhTU', 96, '2007', 3.15, 1),
(1846, 'United States of America', 'La Valse des truands', 'Philip Marlowe, un détective privée mène l\'enquête sur un tueur à gages nommé Winslow Wong. En explorant plusieurs pistes, il découvre par la suite de plusieurs de ses meurtres, que l\'un des proches d\'une famille y est détenu. C\'est alors que le meurtrier va imaginer un stratagème très \"mystique\".', 'Cherokee Productions', 'https://image.tmdb.org/t/p/w1280/kSAavZdsJD8hOkg5Tpbswi3fmY0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3FuL9HdqMPvxnby7ntbwfPwlmQX.jpg', 'https://www.youtube.com/embed/M4lOi7VI42c', 95, '1969', 3, 1),
(1847, 'United States of America', 'Le privé', 'En pleine nuit, Terry Lennox demande à son ami Philip Marlowe, un détective privé, de le conduire de toute urgence au Mexique. Ce dernier accepte, mais à son retour il est fraîchement accueilli par la police. Sylvia, l\'épouse de Lennox, a en effet été retrouvée assassinée et Marlowe est inculpé pour meurtre.', 'E-K-Corporation', 'https://image.tmdb.org/t/p/w1280/rRZwoyDyzEviJ2TM5yLCrkDzDVP.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//g3KOnOycUThwV4PRjtiAK0CuzID.jpg', 'https://www.youtube.com/embed/gJlqY39imtM', 122, '1973', 3.73, 1),
(1848, 'United States of America', 'Poodle Springs', '', 'Mirage Enterprises', 'https://image.tmdb.org/t/p/w1280/ySroOZG9J50vMlKTc4fwyiOxmxR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ukFD3W0OkGQiA4qfQewAVL3WgRb.jpg', 'https://www.youtube.com/embed/PV8SMqWePlY', 92, '1998', 2.75, 1),
(1849, 'United Kingdom', 'Nine Hours to Rama', '', 'Red Lion', 'https://image.tmdb.org/t/p/w1280/nD2JeJOwl4Vod6Jze1YgA4luhqR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uenKqKQjI7FjMGff3RAsIffpL8S.jpg', 'https://www.youtube.com/embed/', 119, '1963', 3.05, 1),
(1850, 'United States of America', 'Man on the Moon', 'La carrière du comique américain Andy Kaufman, mort en 1984 d\'un cancer du poumon. Né à New York en 1949, il débute dans de nombreux cabarets avant de se faire remarquer à la télévision dans la célèbre émission \"Saturday Night Live\". Il est une des vedettes de la série \"Taxi\" puis provoque les réactions les plus diverses en montant des spectacles originaux, notamment au Carnegie Hall de New York.', 'Mutual Film Company', 'https://image.tmdb.org/t/p/w1280/msOZS07xRIFnapwp3fprGbKEAfT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aH5QhlVu7uMnLO9P432IcP8FyCI.jpg', 'https://www.youtube.com/embed/cvaHj0np8GM', 115, '1999', 3.65, 1),
(1851, 'United States of America', 'Le retour du Capitaine Nemo', 'Deux officiers naval découvrent le célèbre sous-marin Nautilus abandonné sur le fond de l\'océan et son inventeur, le Capitaine Nemo, conservé dans une chambre cryogénique. Lorsqu\'il sort de son sommeil d\'hibernation, il réactive le sous-marin pour se lancer à la poursuite d\'un autre navire commandé par un fou maléfique dont le but est de détruire Washington...', 'Irwin Allen Productions', 'https://image.tmdb.org/t/p/w1280/jRQ0btTqZJveaCnTGY3BcXWQ2Q3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//swrquFKfEEzs62e3qocKg0ZuU47.jpg', 'https://www.youtube.com/embed/', 98, '1978', 2.7, 1),
(1852, 'United States of America', 'World Trade Center', '11 septembre 2001. Une chaleur étouffante règne dès le lever du jour dans les rues de New York. Will Jimeno, du Port Authority Police Department, se demande s\'il ne va pas prendre un jour de congé pour s\'adonner à la chasse à l\'arc. Il choisit finalement de se rendre au travail et rejoint le sergent John McLoughlin, alors que celui-ci et ses collègues du PAPD commencent leur tournée quotidienne dans les rues de Manhattan. Une journée banale qui commence comme tant d\'autres... Sitôt l\'alerte donnée, cinq policiers, dont McLoughlin et Jimeno, se rendent au World Trade Center et s\'introduisent dans les Tours jumelles. McLoughlin et Jimeno survivent par miracle à l\'effondrement des gratte-ciel. Ils se retrouvent piégés sous plusieurs tonnes de béton, de charpentes métalliques tordues, de verre et de gravats...', 'Paramount', 'https://image.tmdb.org/t/p/w1280/wulyL6FDIyqH7XZXG2DbG9bUPuX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1lpo47zV1ly4JeGDBrjTePMXML4.jpg', 'https://www.youtube.com/embed/8M9lz5R1K2A', 130, '2006', 3.07, 1),
(1853, 'United States of America', 'In the Realms of the Unreal', '', 'Diorama Films', 'https://image.tmdb.org/t/p/w1280/93oeJ8kBdT0ANZ5eDpRVgeFtprp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 81, '2004', 3.6, 1),
(1880, 'United States of America', 'L\'Aube Rouge', 'Par une belle journée d\'automne, des centaines de parachutistes sous les ordres du colonel Ernesto Bella prennent d\'assaut la ville de Calumet, au Colorado. Les Cubains alliés aux Soviétiques viennent de déclencher les hostilités contre les États-Unis.', 'Valkyrie Films', 'https://image.tmdb.org/t/p/w1280/f60nY59ezmsHbPcmQV53T2DycfU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9fOfsVHZHig6MHPHczv0zMY6cKc.jpg', 'https://www.youtube.com/embed/', 114, '1984', 3.15, 1),
(1881, 'France', 'Les yeux dans les Bleus', 'Au coeur des Bleus, durant la Coupe du Monde de Football 1998.', 'StudioCanal', 'https://image.tmdb.org/t/p/w1280/nC6csHcMh7Qm0uL1WxH7hWxHgaI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1Mnpux87bf6IPGt9kabSD8Bzd1g.jpg', 'https://www.youtube.com/embed/', 157, '1998', 3.7, 1),
(1882, 'United States of America', 'C\'étaient des hommes', 'Ken, jeune lieutenant américain, est gravement blessé lors d\'un assaut dans une ville européenne pendant la Seconde Guerre mondiale. De retour aux Etats-Unis, aigri et paraplégique, Ken va connaître une difficile réadaptation à la vie de tous les jours.', 'Stanley Kramer Productions', 'https://image.tmdb.org/t/p/w1280/88hG50Z7EMxKdsKOBc5o2yOpPB5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//e9tL9KczncUBdl4Yd56DnhzJMr7.jpg', 'https://www.youtube.com/embed/', 85, '1950', 3.55, 1),
(1883, 'United States of America', 'Malcolm X', 'Une évocation de la vie de Malcolm X, leader du mouvement noir américain Nation of Islam : son enfance difficile à Omaha, son séjour en prison où il apprend à cultiver la fierté de sa race, son entrée dans l\'organisation d\'inspiration islamiste, son mariage avec l\'infirmière Betty Shabazz, son pèlerinage à la Mecque et son assassinat le 21 février 1965 au cours d\'un meeting', '40 Acres and a Mule Filmworks', 'https://image.tmdb.org/t/p/w1280/iuaD96cwj7z8cSDm0eYcysfIdUs.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//42mSR48e4h6Zp5BkTUyWPYsAA1X.jpg', 'https://www.youtube.com/embed/5imOHRs7TL0', 202, '1992', 3.76, 1),
(1884, 'United States of America', 'The Ewok Adventure', 'The Towani family civilian shuttlecraft crashes on the forest moon of Endor. The four Towani\'s are separated. Jermitt and Catarine, the mother and father are captured by the giant Gorax, and Mace and Cindel, the son and daughter, are missing when they are captured. The next day, the Ewok Deej is looking for his two sons when they find Cindel all alone in the shuttle (Mace and Cindel were looking for the transmitter to send a distress call), when Mace appears with his emergency blaster. Eventually, the four-year old Cindel is able to convince the teenage Mace that the Ewoks are nice. Then, the Ewoks and the Towani\'s go on an adventure to find the elder Towanis.', 'Lucasfilm Ltd.', 'https://image.tmdb.org/t/p/w1280/lP7FIxojVrgWsam9efElk5ba3I5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//c6UZKwtnuwMEWcQzyrT9lXsyVXj.jpg', 'https://www.youtube.com/embed/', 96, '1985', 2.98, 1),
(1885, 'United States of America', 'Karaté Kid', 'Daniel quitte le New Jersey pour s’installer avec sa mère en Californie. À l’école, ses nouveaux camarades de classe l’isolent et le persécutent. Comment faire face ? En se laissant aller à son tour à la violence ? À la haine ? Et ce vieux japonais plein de sagesse, fera‐t‐il de lui un champion de karaté ? Transformera‐t‐il sa vision de la vie ?', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/sEW4T43qyGIvFXwX8b1QbCVOHbS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4TRL9t8yOQ74j7jI4dGy7C9OVvC.jpg', 'https://www.youtube.com/embed/eEyhvUjCMcI', 126, '1984', 3.59, 1),
(1887, 'France', 'Marie-Antoinette', 'Évocation de la vie de la reine d\'origine autrichienne, épouse mal-aimée de Louis XVI, guillotinée en 1793. Au sortir de l\'adolescence, une jeune fille découvre un monde hostile et codifié, un univers frivole où chacun observe et juge l\'autre sans aménité. Mariée à un homme maladroit qui la délaisse, elle est rapidement lassée par les devoirs de représentation qu\'on lui impose. Elle s\'évade dans l\'ivresse de la fête et les plaisirs des sens pour réinventer un monde à elle. Y a-t-il un prix à payer à chercher le bonheur que certains vous refusent ?', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/uLi383ZVk1DGH3yPdNSGLzQAERp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rPm9FhnsGMwZnbeHe4zRfW7nub8.jpg', 'https://www.youtube.com/embed/rnY4AvLkJhk', 123, '2006', 3.33, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(1888, 'United States of America', 'The Fortune Cookie', 'A cameraman is knocked over during a football game. His brother-in-law, as the king of the ambulance-chasing lawyers, starts a suit while he\'s still knocked out. The cameraman is against it until he hears that his ex-wife will be coming to see him. He pretends to be injured to get her back, but also sees what the strain is doing to the football player who injured him.', 'Phalanx Productions', 'https://image.tmdb.org/t/p/w1280/tGZc0sRoXgGzRDhHaCRmqxNSKVZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7UhHVILQjvazxVqMn45T5q3tgte.jpg', 'https://www.youtube.com/embed/', 125, '1966', 3.64, 1),
(1889, 'Spain', 'Faites vos jeux, mesdames', '', 'Spéva Films', 'https://image.tmdb.org/t/p/w1280/m4Ta0Kf21p7qH72IFKQUCu5HkbQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//AddM9YKiufQhTycIdvZpe9ei4mr.jpg', 'https://www.youtube.com/embed/', 80, '1965', 2.5, 1),
(1890, 'United States of America', 'Les Enfants du silence', 'James Leed est un novateur dans sa profession. Il est professeur pour enfants sourds et ne fait preuve d\'aucune compassion. Il pense et parle librement, aborde tous les sujets tabous et obtient des résultats qui surprennent ses collègues et supérieurs hiérarchiques qui l\'estiment et l\'admirent. L\'arrivée de Sarah, née complétement sourde, va representer un défi pour le jeune professeur. Vite amoureux d\'elle, il va découvrir une femme qui refuse tout compromis.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/jJoAWtK0IiEC39iosjL5YZg43Dw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nsKeQMOTcq8emYs9FP65m6WhtFq.jpg', 'https://www.youtube.com/embed/', 84, '1986', 3.49, 1),
(1891, 'United States of America', 'L\'Empire contre-attaque', 'Malgré la destruction de l’Étoile Noire, l\'Empire maintient son emprise sur la galaxie, et poursuit sans relâche sa lutte contre l\'Alliance rebelle. Basés sur la planète glacée de Hoth, les rebelles essuient un assaut des troupes impériales. Parvenus à s\'échapper, la princesse Leia, Han Solo, Chewbacca et C-3P0 se dirigent vers Bespin, la cité des nuages gouvernée par Lando Calrissian, ancien compagnon de Han. Suivant les instructions d\'Obi-Wan Kenobi, Luke Skywalker se rend quant à lui vers le système de Dagobah, planète marécageuse où il doit recevoir l\'enseignement du dernier maître Jedi, Yoda. Apprenant l\'arrestation de ses compagnons par les stormtroopers de Dark Vador après la trahison de Lando, Luke décide d\'interrompre son entraînement pour porter secours à ses amis et affronter le sombre seigneur Sith...', 'Lucasfilm Ltd.', 'https://image.tmdb.org/t/p/w1280/qDvctAykmNWAmi9G2GrVrwWx3pr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aJCtkxLLzkk1pECehVjKHA2lBgw.jpg', 'https://www.youtube.com/embed/t8dH9-E1Ghc', 124, '1980', 4.2, 1),
(1892, 'United States of America', 'Le Retour du Jedi', 'L\'Empire galactique est plus puissant que jamais : la construction de la nouvelle arme, l’Étoile de la Mort, menace l\'univers tout entier... Arrêté après la trahison de Lando Calrissian, Han Solo est remis à l\'ignoble contrebandier Jabba Le Hutt par le chasseur de primes Boba Fett. Après l\'échec d\'une première tentative d\'évasion menée par la princesse Leia, également arrêtée par Jabba, Luke Skywalker et Lando parviennent à libérer leurs amis. Han, Leia, Chewbacca, C-3PO et Luke, devenu un Jedi, s\'envolent dès lors pour une mission d\'extrême importance sur la lune forestière d\'Endor, afin de détruire le générateur du bouclier de l’Étoile de la Mort et permettre une attaque des pilotes de l\'Alliance rebelle. Conscient d\'être un danger pour ses compagnons, Luke préfère se rendre aux mains de Dark Vador, son père et ancien Jedi passé du côté obscur de la Force.', 'Lucasfilm Ltd.', 'https://image.tmdb.org/t/p/w1280/tEQlCGiiWvMvfD7Sz8d99Pouy39.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//b5i3wPa2lKXdMQfNNX9nfxnkFfG.jpg', 'https://www.youtube.com/embed/VUgIH6fyDvs', 133, '1983', 3.94, 1),
(1893, 'United States of America', 'Star Wars, épisode I - La Menace fantôme', 'Il y a bien longtemps, dans une galaxie très lointaine... La République connaît de nombreux tourments : la corruption fait vaciller ses bases, le Sénat s\'embourbe dans des discussions politiques sans fin et de nombreux pouvoirs dissidents commencent à émerger, annonçant la chute d\'un système autrefois paisible. Puissante et intouchable, la Fédération du Commerce impose par la force la taxation des routes commerciales. Refusant de céder, la pacifique planète Naboo, dirigée par la jeune Reine Amidala, subit un blocus militaire de la Fédération. Dépêchés par le Sénat pour régler cette affaire, les chevaliers Jedi Qui-Gon Jinn et Obi-Wan Kenobi découvrent qu\'une véritable offensive de la Fédération est imminente. Libérant la Reine et ses proches, ils quittent la planète mais doivent se poser sur Tatooine pour réparer leur vaisseau...', 'Lucasfilm Ltd.', 'https://image.tmdb.org/t/p/w1280/fpEC910v5DrMvZteRNlKzXeHiHY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wDe8LzwuvHYYiuwyNfxdYQq8ti4.jpg', 'https://www.youtube.com/embed/ACvjzXOj-Dc', 133, '1999', 3.26, 1),
(1894, 'United States of America', 'Star Wars, épisode II - L\'Attaque des clones', 'Depuis le blocus de la planète Naboo par la Fédération du commerce, la République, gouvernée par le Chancelier Palpatine, connaît une véritable crise. Un groupe de dissidents, mené par le sombre Jedi comte Dooku, manifeste son mécontentement envers le fonctionnement du régime. Le Sénat et la population intergalactique se montrent pour leur part inquiets face à l\'émergence d\'une telle menace.Certains sénateurs demandent à ce que la République soit dotée d\'une solide armée pour empêcher que la situation ne se détériore davantage. Parallèlement, Padmé Amidala, devenue sénatrice, est menacée par les séparatistes et échappe de justesse à un attentat. Le Padawan Anakin Skywalker est chargé de sa protection. Son maître, Obi-Wan Kenobi, part enquêter sur cette tentative de meurtre et découvre la constitution d\'une mystérieuse armée de clones...', 'Lucasfilm Ltd.', 'https://image.tmdb.org/t/p/w1280/3nqpcTkODCBhuKuDQJ1dtRhgTqZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//abwxHfymXGAbbH3lo9PDEJEfvtW.jpg', 'https://www.youtube.com/embed/x1ZeDI-SOPY', 132, '2002', 3.27, 1),
(1895, 'United States of America', 'Star Wars, épisode III - La Revanche des Sith', 'La Guerre des Clones fait rage. Une franche hostilité oppose désormais le Chancelier Palpatine au Conseil Jedi. Anakin Skywalker, jeune Chevalier Jedi pris entre deux feux, hésite sur la conduite à tenir. Séduit par la promesse d\'un pouvoir sans précédent, tenté par le côté obscur de la Force, il prête allégeance au maléfique Darth Sidious et devient Dark Vador. Les Seigneurs Sith s\'unissent alors pour préparer leur revanche, qui commence par l\'extermination des Jedi. Seuls rescapés du massacre, Yoda et Obi-Wan se lancent à la poursuite des Sith. La traque se conclut par un spectaculaire combat au sabre entre Anakin et Obi-Wan, qui décidera du sort de la galaxie...', 'Lucasfilm Ltd.', 'https://image.tmdb.org/t/p/w1280/2RcBuU8cdxFxCJibbiYCGNLApfz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//eFaRU5y8wIwV0D14DPkbLaRUzOV.jpg', 'https://www.youtube.com/embed/jpFwt-RJ1ms', 140, '2005', 3.7, 1),
(1896, 'Spain', 'Salvador (Puig Antich)', 'The story of Salvador Puig Antich, one of the last political prisoners to be executed under Franco\'s Fascist State in 1974.', 'Future Film Group', 'https://image.tmdb.org/t/p/w1280/15BrFU5KcYLp1BWE7tCyloMDG2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gygtjTTi3O9uDN5BevYAPWeVi2S.jpg', 'https://www.youtube.com/embed/', 137, '2006', 3.36, 1),
(1899, 'Canada', 'Les Filles du botaniste', 'Dans la maison d\'un célèbre professeur de botanique chinois, sa fille et une stagiaire tombent amoureuses l\'une de l\'autre - un amour interdit qui doit être gardé secret.', 'France 2 Cinéma', 'https://image.tmdb.org/t/p/w1280/alANg9hsVPiG4v3IkuWXU6J4K4c.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yJQ9JhkVq0hTu1t5FULAqNJIqnw.jpg', 'https://www.youtube.com/embed/', 93, '2006', 3.22, 1),
(1900, 'Germany', 'Traffic', 'Le juge Robert Wakefield quitte la Cour suprême pour prendre la direction de la lutte antidrogue. Parallèlement, sa fille, Caroline, qu\'il a toujours négligée, sombre dans la toxicomanie. Au Mexique, Javier Rodriguez, un policier intègre, aide à préparer le démantèlement d\'un réseau de trafiquants…', 'USA Films', 'https://image.tmdb.org/t/p/w1280/8sDLNXBizMwm7MIdvODPLx5YZNG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7qIuxTSpDv5upnE9ofUhaWD91Jl.jpg', 'https://www.youtube.com/embed/', 147, '2000', 3.53, 1),
(1901, 'United States of America', 'En bonne compagnie', 'A 51 ans, la vie réserve encore bien des surprises, et Dan Foreman va en faire l\'expérience. Sa femme est enceinte et sa fille aînée, Alex, prend une chambre en ville, mais le pire reste à venir...Directeur des ventes publicitaires pour le magazine Sports America, Dan se retrouve avec un nouveau patron, Carter Duryea, qui a la moitié de son âge. Entre les deux hommes, le courant ne passe pas. Dan n\'accepte pas qu\'un novice puisse lui expliquer quoi faire dans une équipe qu\'il mène depuis des années, et Carter se méfie des dinosaures. Les deux hommes doivent pourtant collaborer étroitement et sont obligés de se fréquenter. Le coup de foudre d\'Alex et de Carter va encore compliquer les choses...', 'Depth of Field', 'https://image.tmdb.org/t/p/w1280/83JfvquKvHw2Zf6lmdImAe6sHe2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ukShYvWPLrGBFdy1CvnKXR79oRV.jpg', 'https://www.youtube.com/embed/', 109, '2004', 2.98, 1),
(1902, 'Spain', 'Ouvre les yeux', 'César, un jeune homme de 25 ans, est enfermé dans une unité psychiatrique carcérale. Un psychiatre l\'aide à prendre connaissance des circonstances qui l\'ont amené à commettre un meurtre. Le récit de César fait peu à peu apparaître de graves confusions dans sa perception de la réalité. Désespéré, il met en doute son équilibre psychique et imagine être victime d\'une vaste machination.', 'Sociedad General de Televisión (Sogetel)', 'https://image.tmdb.org/t/p/w1280/n2Rz9R8gdjrPxcKoPxjTeDVOEPL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2ILGrVCOQyiClPQkS6qSqp7FFvY.jpg', 'https://www.youtube.com/embed/YC9N8U2nOEM', 118, '1997', 3.74, 1),
(1903, 'Spain', 'Vanilla Sky', 'David Aames est un jeune et brillant éditeur new-yorkais qui a tout pour lui : l\'argent, la réussite professionnelle et les femmes. Son ami Pelayo commet l\'erreur de lui présenter Sofia, sa nouvelle compagne. Au premier regard, David succombe au charme de celle-ci. Tous les deux filent bientôt le parfait amour. Alors que David se dispute en voiture avec Julie, une ex folle de jalousie, la jeune femme accélère et c\'est l\'accident. Julie décède. Atrocement défiguré, David est transporté d\'urgence à l\'hôpital où les médecins ne peuvent réaliser de miracle. Sa vie bascule. Les gens ont dorénavant peur de lui et Sofia l\'évite. Mais un matin, David se fait gentiment réveiller par celle-ci, qui lui déclare son amour. Les médecins lui annoncent même qu\'il pourra retrouver son ancien visage. Réalité ou hallucination ?', 'Vinyl Films', 'https://image.tmdb.org/t/p/w1280/rP5pOnQ7kZrPOOCGay2Vc1O84Z0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wwLufumafJojc59hgIamHyJSTO9.jpg', 'https://www.youtube.com/embed/cHfcxnPNqgQ', 135, '2001', 3.4, 1),
(1904, 'France', 'Mémoires d\'une geisha', 'Quelques années avant la Seconde Guerre mondiale, Chiyo, une petite fille japonaise, est arrachée à sa famille pauvre pour aller travailler comme servante dans une maison de geishas. En grandissant, elle se plie avec docilité à l\'initiation difficile qui fera d\'elle une vraie geisha. Elle triomphe des pièges que lui tend sa rivale, la fourbe Hatsumomo et devient, après des années de travail, la légendaire geisha Sayuri. Très belle, épanouie dans son art, Sayuri fascine les hommes les plus puissants. Mais celle qui n\'a plus le droit d\'aimer reste hantée par l\'amour qu\'elle porte, en secret, au seul homme qu\'elle ne peut atteindre...', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/nodOVRLzxr9914qutKTs2NWB63P.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zJDnqXtGNHUmexiaWNa52Vslve5.jpg', 'https://www.youtube.com/embed/K6Rx55Kx9vg', 146, '2005', 3.84, 1),
(1905, 'Germany', 'Die Bettwurst', '', 'Rosa von Praunheim Filmproduktion', 'https://image.tmdb.org/t/p/w1280/vEP6AdRBXQwBtWTHS2Bi60rbEqU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9QHDcVaRHqUjRTKcW6DMft94Hb9.jpg', 'https://www.youtube.com/embed/', 81, '1971', 2.65, 1),
(1906, 'East Germany', 'Solo Sunny', 'Le rêve de Sonny, jeune chanteuse de l\'Allemagne de l\'Est, est de devenir une star dans la capitale de la RDA. Apres avoir quitte le groupe médiocre dans lequel elle se produisait, elle débute une carrière sur les scènes underground de Berlin-Est ou elle tente de se relever des différents échecs de sa vie professionnelle et sentimentale.', 'DEFA', 'https://image.tmdb.org/t/p/w1280/3QbE3063E0gntljcc5l8r4ZHn57.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2qdZSWyiJlMRsIn5kppiumz0fFy.jpg', 'https://www.youtube.com/embed/', 100, '1980', 3.14, 1),
(1907, 'United Kingdom', 'The Beach', 'Twenty-something Richard travels to Thailand and finds himself in possession of a strange map. Rumours state that it leads to a solitary beach paradise, a tropical bliss - excited and intrigued, he sets out to find it.', 'Figment Films', 'https://image.tmdb.org/t/p/w1280/r6Sr0uSiVbQOvqoebZoy5rzlPvJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cxRcmEwtUZVfNlC4HoWaNKzNNW0.jpg', 'https://www.youtube.com/embed/FAcqiIaGWII', 119, '2000', 3.23, 1),
(1908, 'United States of America', 'Inherit the Wind', 'Schoolteacher Bertram Cates is arrested for teaching his students Darwin\'s theory of evolution. The case receives national attention and one of the newspaper reporters, E.K. Hornbeck, arranges to bring in renowned defense attorney and atheist Henry Drummond to defend Cates. The prosecutor, Matthew Brady is a former presidential candidate, famous evangelist, and old adversary of Drummond.', 'Stanley Kramer Productions', 'https://image.tmdb.org/t/p/w1280/7oaHcF0gCOt2lKaT2zajhajP0Zo.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tsanZEEeIBYMfpYX9CZmcPM8kEH.jpg', 'https://www.youtube.com/embed/1PKkLSCuiEE', 128, '1960', 3.88, 1),
(1909, 'United States of America', 'Don Juan DeMarco', 'Jack Mikler, psychiatre réputé, est appelé d\'urgence pour tenter de sauver un jeune homme qui menace de se jeter du haut d\'un immeuble et qui prétend être Don Juan DeMarco, le plus grand séducteur de tous les temps. Le médecin réussit a dissuader le jeune suicidaire et le fait admettre dans sa clinique.', 'American Zoetrope', 'https://image.tmdb.org/t/p/w1280/fe0TuYz9jCKUba2Omj48K8bWJ8z.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nnrITCU29fAVFDngn3eEwBsECPX.jpg', 'https://www.youtube.com/embed/T9wFFu5CoA0', 97, '1994', 3.35, 1),
(1910, 'Germany', 'SommerHundeSöhne', '', 'Friends Production GmbH & Co. Medienproduktions KG', 'https://image.tmdb.org/t/p/w1280/8HRK4eELKhIkMVGGptjSrtkdgAH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dvi50aSg8XFedVaHnjtT5eoQ5Fg.jpg', 'https://www.youtube.com/embed/', 96, '2005', 2.8, 1),
(1911, 'United States of America', 'Le 13ème Guerrier', 'Contraint à l\'exil par son calife, pour avoir séduit la femme d\'un autre, Ahmed Ibn Fahdlan est envoyé comme ambassadeur en Asie mineure. Une prophétie l\'oblige à devenir le \"13e Guerrier\" d\'un groupe de Vikings partant porter secours au seigneur Rothgar, dont le village est régulièrement attaqué par une horde de démons, mi-humains mi-animaux. Au cours de ce long périple vers le nord de l\'Europe, Ahmed apprend la langue de ses compagnons et le maniement des armes. Sur place, il devra affronter ses propres peurs.', 'Touchstone Pictures', 'https://image.tmdb.org/t/p/w1280/2L8OCwCcZ1F12P2Knm2zGTeYoJc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xlSyZzufbB8Nq058EwAVA9HaMbt.jpg', 'https://www.youtube.com/embed/hjWadgrmWTo', 112, '1999', 3.33, 1),
(1912, 'Germany', 'Free Rainer - Dein Fernseher lügt', '', 'Coop 99 Filmproduktion', 'https://image.tmdb.org/t/p/w1280/tGoelL9ZBIiIHisc8G76DIi5SlS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pqVDgmktHuSAGdL7sDzQTd1MjJR.jpg', 'https://www.youtube.com/embed/', 129, '2007', 3.3, 1),
(1913, 'France', 'Mar adentro', 'À la suite d\'un accident dont il a été victime dans sa jeunesse, Ramón ne peut plus bouger que la tête. « Enfermé dans son corps », il vit depuis presque trente ans prostré dans un lit. Sa seule ouverture sur le monde est la fenêtre de sa chambre à travers laquelle il « voyage » jusqu\'à la mer toute proche ; cette mer qui lui a tant donné et tout repris. Pourtant très entouré par sa famille, Ramón n\'a plus qu\'un seul désir : pouvoir décider de sa propre mort et terminer sa vie dans la dignité…', 'Canal+', 'https://image.tmdb.org/t/p/w1280/954DBPqjzCs15BjWdhv6eGaVXRa.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7XmDhCTkce5GH8KCdbMoTZdxn1p.jpg', 'https://www.youtube.com/embed/0qqvyzamlns', 125, '2004', 3.79, 1),
(1914, 'Germany', 'FC Venus', '', 'Egoli Tossell Film', 'https://image.tmdb.org/t/p/w1280/5NPpGFqTiVlopGj21Hflkazk1S1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yLHJofL1EB1RppxXfycRjPd0pDp.jpg', 'https://www.youtube.com/embed/', 95, '2006', 2.9, 1),
(1915, 'Germany', 'Manta, Manta', '', 'Constantin Film', 'https://image.tmdb.org/t/p/w1280/cHBEudYatUvo6T6R5W1NtvQNUVe.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hh16SrHV81Phq8Ex9Ole5pgtMgS.jpg', 'https://www.youtube.com/embed/', 91, '1991', 2.8, 1),
(1940, 'United States of America', 'Porgy and Bess', '', 'Samuel Goldwyn Productions', 'https://image.tmdb.org/t/p/w1280/g4zwlj8bgRYsUoF0VEwPEgldCvn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//h7XT87IrWzQ5TjBwk7VZeaP4hRh.jpg', 'https://www.youtube.com/embed/', 138, '1959', 3.35, 1),
(1941, 'United States of America', 'Exodus', 'Based on Leon Uris\' novel, this historical epic provides a dramatic backstory to the creation of the state of Israel in 1948, in the aftermath of World War II. Ari Ben Canaan, a passionate member of the Jewish paramilitary group Haganah, attempts to transport 600 Jewish refugees on a dangerous voyage from Cyprus to Palestine on a ship named the Exodus. He faces obstruction from British forces, who will not grant the ship passage to its destination.', 'Otto Preminger Films', 'https://image.tmdb.org/t/p/w1280/1JXFJRztd43gCf4TAodNUwkfZoi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9Knw79HXoPpHIqa9TscDlwbuRJV.jpg', 'https://www.youtube.com/embed/JMZ9bjInqwI', 208, '1960', 3.35, 1),
(1942, 'United Kingdom', 'Bunny Lake a disparu', 'Ann Lake vient d\'emménager à Londres avec sa fille Bunny. Alors qu’elle va la chercher à l\'école, la jeune fille est introuvable et personne ne semble se souvenir d\'elle. Chargé de l\'enquête, le lieutenant Newhouse découvre qu\'Ann avait une amie imaginaire prénommée Bunny. Il se met alors à sérieusement douter de l’existence de la fillette...', 'Wheel Productions', 'https://image.tmdb.org/t/p/w1280/8pjDzpTMtiS3ubfH10FLICJFWx6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//moV8S6PFcFcUQBSxv2LS0wF7oN0.jpg', 'https://www.youtube.com/embed/HtZpIR0abB4', 107, '1965', 3.62, 1),
(1943, 'United States of America', 'Rosebud', 'In a bold coup a Palestinian terrorist group captures the yacht Rosebud and kidnaps the millionaires five daughters on it. At first they demand film clips to be shown on major European TV stations. Undercover agent Martin is hired to hunt the terrorists down.', 'Oting SA', 'https://image.tmdb.org/t/p/w1280/5NoT4BpyOIE5I1FRcIwjS6bHsvd.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wANeZwLc8obKa0Ayo2cGTVPtBa8.jpg', 'https://www.youtube.com/embed/', 127, '1975', 2.45, 1),
(1944, 'United States of America', 'Lignes de vie', 'A l\'approche de ses trente ans, Ruth, devenue écrivain, se rappelle son enfance difficile qui l\'empêche encore aujourd\'hui de s\'épanouir dans la vie. Elle n\'a jamais connu ses deux frères, décédés dans un accident de voiture, un drame qui a abouti à la séparation de ses parents. Son père se console aujourd\'hui en séduisant de jeunes filles tandis que sa mère quitte le foyer familial avec un homme bien plus âgé qu\'elle.', 'Revere Pictures', 'https://image.tmdb.org/t/p/w1280/a2lrIGtshLY3Tr8vf9xFnw3cP8X.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//61zVIux4OdinQEtO7mthpnVEjeM.jpg', 'https://www.youtube.com/embed/', 111, '2004', 3.06, 1),
(1945, 'United States of America', 'Nell', 'Dans les forêts de Caroline du Nord, une vieille femme vivant en ermite décède. Le shérif Todd Peterson et le médecin local Jerome Lovell découvrent que la défunte a laissé une fille, Nell, née d\'un viol survenu vingt ans auparavant. La jeune fille a été élevée à l\'écart du monde et dans la crainte des hommes...', 'Egg Pictures', 'https://image.tmdb.org/t/p/w1280/6WZFYXMFFwNS0AmTd3deCLXjt10.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jpYjJd0cNKqxQXufHQdMkcIHM3g.jpg', 'https://www.youtube.com/embed/n1Zay9SOYxA', 112, '1994', 3.29, 1),
(1946, 'Canada', 'eXistenZ', 'Dans un avenir proche, une créatrice de génie, Allegra Geller, a inventé une nouvelle génération de jeu qui se connecte directement au systeme nerveux : eXistenZ. Lors de la séance de présentation du jeu, un fanatique cherche à la tuer. Un jeune stagiaire en marketing, Ted Pikul, sauve la vie d\'Allegra. Une poursuite effrenée s\'engage autant dans la réalité que dans l\'univers trouble et mysterieux du jeu.', 'Dimension Films', 'https://image.tmdb.org/t/p/w1280/71AVfLrk6lfjlcaNYm9Ag3F3FcV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//247OkG4qeUpy3WiKjilQyqNBwnY.jpg', 'https://www.youtube.com/embed/', 96, '1999', 3.42, 1),
(1947, 'United States of America', 'An Unfinished Life', 'Stoic and heartbroken, Einar Gilkyson quietly lives in the rugged Wyoming ranchlands alongside his only trusted friend, Mitch Bradley. One day, the woman he blames for the death of his only son arrives at his door broke, desperate and with a granddaughter he\'s never known. But even as buried anger and accusations resurface, the way is opened for unexpected connection, adventure and forgiveness.', 'Miramax', 'https://image.tmdb.org/t/p/w1280/7ugLG1yF1l8HWYhmdmHHSC3kJ8b.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2jOCJ6ejsn9ErgYUjmxWiziOeaI.jpg', 'https://www.youtube.com/embed/6_C_8K_KnG8', 108, '2005', 3.38, 1),
(1948, 'United States of America', 'Hyper tension', 'Chev Chelios est un tueur à gages qui n\'a pas rempli un banal contrat : la veille, il a en effet raté sa cible. Et ce matin-là, Chev est réveillé par un coup de téléphone de bien mauvaise augure. A l\'autre bout du fil, le malfrat Ricky Verona lui apprend qu\'il a été empoisonné dans son sommeil et qu\'il ne lui reste qu\'une heure à vivre… Désormais, Chelios ne doit surtout pas rester immobile - sous peine de mourir d\'un instant à l\'autre : il lui faut stimuler son adrénaline pour empêcher le poison de provoquer un arrêt cardiaque. Dans une terrible course contre la montre, Chev parcourt les rues de Los Angeles, n\'hésitant pas à affronter ceux qui osent se mettre en travers de sa route. Il n\'a dorénavant d\'autre choix que de trouver l\'antidote lui permettant d\'échapper à une mort certaine…', 'Lions Gate Films', 'https://image.tmdb.org/t/p/w1280/pKfxi4fxAiZsqd58VC2aNypefiE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kSTvteM3ekuoeO7u7GJtZQkZuom.jpg', 'https://www.youtube.com/embed/bPsAMybWfXg', 88, '2006', 3.3, 1),
(1949, 'United States of America', 'Zodiac', 'Zodiac, l\'insaisissable tueur en série qui sévit à la fin des années 60 et répandit la terreur dans la région de San Francisco, fut le Jack l\'Eventreur de l\'Amérique. Prodigue en messages cryptés, il semait les indices comme autant de cailloux blancs, et prenait un malin plaisir à narguer la presse et la police. Il s\'attribua une trentaine d\'assassinats, mais fit bien d\'autres dégâts collatéraux parmi ceux qui le traquèrent. Ceci est la chronique de sa traque qui s\'étire sur deux décennies…', 'Paramount', 'https://image.tmdb.org/t/p/w1280/dn24UojGCvT4ZxZ7zqNbauSuh8j.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jP2htGBHE7vKq4MLeC75UeC0sZH.jpg', 'https://www.youtube.com/embed/6bFZL61OFzU', 157, '2007', 3.76, 1),
(1950, 'United States of America', 'Lucky You', 'Dans les salons de Las Vegas où s\'affrontent les meilleurs joueurs de poker du monde, Huck Cheever est connu comme un risque-tout. Mais, dans sa vie privée, ce flambeur acharné est un homme d\'une prudence extrême, qui refuse tout investissement émotionnel, toute relation durable.Lorsque Huck se présente au Tournoi International de Poker 2003, avec la ferme intention de remporter le titre en même temps que les faveurs de la chanteuse Billie Offer, un obstacle inattendu se dresse sur sa route : son père, L.C. Cheever, joueur légendaire, qui abandonna jadis la mère de Huck. Une lutte sans merci, attisée par des années de ressentiment, oppose d\'emblée les deux hommes pour la conquête du titre. A l\'approche du duel final, Huck comprend que, pour rafler la mise à la table de poker et au jeu de la vie, il va devoir changer de tactique...', 'Lonely Film Productions GmbH & Co. KG.', 'https://image.tmdb.org/t/p/w1280/ir3YNUn0PxuSmeMmPNvfGx60i00.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wBIQsOrenmVjnfUqSub7Zrw0JNm.jpg', 'https://www.youtube.com/embed/', 124, '2007', 2.82, 1),
(1951, 'Denmark', 'Manderlay', 'C\'est l\'étrange histoire de Manderlay, un domaine isolé dans le sud profond des États Unis. En 1933, Grace et son père avaient laissé derrière eux la petite communauté de Dogville et s\'en éloignaient pour retourner chez eux.', 'YLE', 'https://image.tmdb.org/t/p/w1280/iKN0WQ1qVYaHUHqXnwpyHyUQOw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dbAAQhptC6FyxBJx91IQv9zRiki.jpg', 'https://www.youtube.com/embed/', 139, '2005', 3.46, 1),
(1954, 'Canada', 'L\'Effet papillon', 'Une théorie prétend que si l\'on pouvait retourner dans le passé et changer quelques détails de notre vie, tout ce qui en découle serait modifié. On appelle cela «l\'effet papillon». Evan Treborn a cette faculté. Fasciné, il va d\'abord mettre ce don au service de ceux dont les vies ont été brisées dans leur enfance. Il peut enfin repartir dans le passé et sauver la seule jeune fille qu\'il ait jamais aimée. Mais Evan va découvrir que ce pouvoir est aussi puissant qu\'incontrôlable. Il va s\'apercevoir que s\'il change la moindre chose, il change tout. En intervenant sur le passé, il modifie le présent et se voit de plus en plus souvent obligé de réparer les effets indésirables de ses corrections...', 'FilmEngine', 'https://image.tmdb.org/t/p/w1280/oSfTtRBT8L9FiPbeQoCi48zHL0B.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aoL6L4PCn89MHTVyMnmjwBFLmWX.jpg', 'https://www.youtube.com/embed/4dJobSoa6Jo', 119, '2004', 3.77, 1),
(1955, 'United Kingdom', 'Elephant Man', 'Londres, 1884. Le chirurgien Frederick Treves découvre un homme complètement défiguré et difforme, devenu une attraction de foire. John Merrick, «le monstre», doit son nom de Elephant Man au terrible accident que subit sa mère. Alors enceinte de quelques mois, elle est renversée par un éléphant. Impressionné par de telles difformités, le Dr. Treves achète Merrick, l\'arrachant ainsi à la violence de son propriétaire, et à l\'humiliation quotidienne d\'être mis en spectacle. Le chirurgien pense alors que «le monstre» est un idiot congénital. Il découvre rapidement en Merrick un homme meurtri, intelligent et doté d\'une grande sensibilité.', 'Brooksfilms', 'https://image.tmdb.org/t/p/w1280/zf9GBMbvU2KA8dDpZ2MaApUsFX8.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hKpzq3U7X1C1lqnYh0WQwlPyxO5.jpg', 'https://www.youtube.com/embed/wEqKwY9Ptus', 124, '1980', 4.03, 1),
(1956, 'Argentina', 'Gerry', 'Deux hommes, nommés tous deux Gerry, traversent en voiture le désert californien vers une destination qui n\'est connue que d\'eux seuls. Persuadés d\'atteindre bientôt leur but, les deux amis décident de terminer leur périple à pied.  Mais Gerry et Gerry ne trouvent pas ce qu\'ils sont venus chercher ; ils ne sont même plus capables de retrouver l\'emplacement de leur voiture. C\'est donc sans eau et sans nourriture qu\'ils vont s\'enfoncer plus profondément encore dans la brûlante Vallée de la Mort. Leur amitié sera mise à rude épreuve.', 'Epsilon Motion Pictures', 'https://image.tmdb.org/t/p/w1280/o1SwU7jA74qFCmz4JqFpDvy3O4v.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zKygzW1zAndqbYRfDC7FTUs495v.jpg', 'https://www.youtube.com/embed/L6Gfr0OJODI', 103, '2002', 3.05, 1),
(1957, 'United States of America', 'Plus jamais', 'Slim, une jeune serveuse, a toujours eu du mal à joindre les deux bouts, jusqu\'à ce qu\'elle épouse Mitch, un riche entrepreneur. Celle-ci vit dorénavant un véritable conte de fées, elle a tout ce dont elle peut rêver : un mari attentionné, une magnifique résidence dans une banlieue huppée, et Gracie, son adorable petite fille de cinq ans. Ce paradis s\'effondre lorsque Slim découvre la véritable nature de Mitch. Elle finit par fuir ses mauvais traitements, son comportement obsessionnel et ses dangereux hommes de main. Mais malgré ses efforts pour se refaire une nouvelle vie, Mitch la retrouve et la menace à nouveau. Après avoir mis Gracie en sûreté, Slim va se consacrer corps et âme à un combat qu\'elle n\'a pas voulu mais qu\'elle est décidée à gagner. Elle ne sera plus la victime mais l\'adversaire.', 'Winkler Films', 'https://image.tmdb.org/t/p/w1280/qjNkthIH1MSogcJNY8WU4Lyjvei.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4rL8iJJ3QqYuh8ibckp5m2wrXPs.jpg', 'https://www.youtube.com/embed/0tahxDOAzT4', 115, '2002', 3.33, 1),
(1958, 'France', '8 femmes', 'Dans les années cinquante, dans une grande demeure bourgeoise en pleine campagne, les gens sont sur le point de fêter Noël. Mais un drame se produit : le maître de maison est retrouvé assassiné. Le ou plutôt la coupable se cache parmi huit femmes que fréquentait régulièrement la victime. Commence alors une longue journée d\'enquête, faite de disputes, de trahisons et de révélations.', 'France 2 Cinéma', 'https://image.tmdb.org/t/p/w1280/Asxm9fqKIHcScU0UhSvsovPzpeF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nL9x7wZKMBhCIMxZioKIFXKA9Av.jpg', 'https://www.youtube.com/embed/jGyJL8SnsOM', 103, '2002', 3.48, 1),
(1959, 'United Kingdom', 'Au cœur de la tourmente', 'Amy Foster, employée de maison, est une jeune fille renfermée, tenue à l\'écart par la communauté locale. Son seul réconfort tient dans son monde secret. Elle a découvert une grotte dans laquelle elle conserve précieusement les trésors que la mer rejette, en rêvant d\'une vie meilleure. Son monde va se transformer en conte quand la mer va lui amener le plus beau et le plus impossible des cadeaux : Yanko Gooral, un aventurier passionné qui a quitté son Ukraine natale pour découvrir le Nouveau Monde.', 'Tapson Steel Films Productions', 'https://image.tmdb.org/t/p/w1280/w5Or62J6mF099MQcn0Cq8ycIfqB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2xEzike2hCWfkAlj4HTRPvkeVo8.jpg', 'https://www.youtube.com/embed/R1y35-dlbvU', 113, '1998', 3.3, 1),
(1961, 'United States of America', 'My Name Is Bruce', 'Quatre jeunes adolescents de la minuscule ville minière de Gold Lick vandalisent un cimetière de travailleurs chinois du XIXe siècle lorsque l\'un d\'eux dérange un démon qui garde les âmes de 100 travailleurs tués dans un cambriolage. Jeff, l\'adolescent qui a survécu, part à la recherche de son héros, Bruce Campbell, vedette de cinéma de classe B. Jeff kidnappe l\'acteur et l\'amène à Gold Lick pour sauver la ville. Bruce pense que c\'est un cadeau d\'anniversaire conçu par son agent, alors il joue avec lui, il fait preuve d\'humour envers les citadins et discute avec la mère non-impressionnée de Jeff. Les corps s\'empilent comme les démons slash. Qu\'est-ce que Bruce fera quand il réalisera que Guan-Di, le démon, est réel?', 'Dark Horse Entertainment', 'https://image.tmdb.org/t/p/w1280/et2f1JBW533ZzYiCEA2T7nwzcs1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//snPM5sBGoZSm8g81yyqxsXmyzP6.jpg', 'https://www.youtube.com/embed/pfROegSomiw', 84, '2007', 2.94, 1),
(1962, 'Germany', 'Parfum d\'absinthe', 'Allemagne 1927, une Garden party entre jeunes aristocrates. C\'est l\'été. Amour, désir, ivresse les envahissent pour le meilleur comme pour le pire.\r Ni limite, ni compromis : guidé par la seule quête d\'absolu, Günther est entré dans la spirale de la perte des valeurs. Hilde, sa soeur, a épousé la même conduite, allant jusqu\'à entretenir une liaison avec Hans, l\'amant de Günther.\r Attisant les jalousies, cette relation va devenir le centre d\'un drame orchestré par un Club du suicide. Paul, l\'écrivain, en sera le témoin actif précipitant ainsi la tragédie.', 'ZDF', 'https://image.tmdb.org/t/p/w1280/tsSb2s8cwoCEinnPLt6pWHYNTUU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//h74qqBEGMvjmWAgYFQAFOn82KYq.jpg', 'https://www.youtube.com/embed/', 89, '2004', 3.19, 1),
(1963, 'Japan', 'L\'Arc', 'Un vieil homme vit avec une jeune fille qu\'il retient loin du monde, sur un bateau en pleine mer. Il compte l\'épouser lorsqu\'elle aura 17 ans. Les pêcheurs, de passage sur l\'embarcation, ne manquent pas de remarquer la ravissante jeune fille, toujours farouchement surveillée par son protecteur. Mais, les rêves de mariage de ce dernier tournent à l\'obsession lorsque s\'éveille chez sa promise un intérêt pour un jeune homme de la ville…', 'Kim Ki Duk Film', 'https://image.tmdb.org/t/p/w1280/fEoj4sPMYhmYmlJFLO75EMbSjHw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//v14OIqcRTrQYzp1kuyPYH23CxFo.jpg', 'https://www.youtube.com/embed/', 90, '2005', 3.48, 1),
(1964, 'Germany', 'A Friend of Mine', 'An introverted insurance executive at a car rental service is annoyed by his hyperactive, garrulous coworker, but the two end up becoming friends.', 'Telepool', 'https://image.tmdb.org/t/p/w1280/yUbB44z9UTH4y4D7L02ruh4KfCB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yur9QqS9G92TOVAiIx1Hiu092JG.jpg', 'https://www.youtube.com/embed/HRE_NotP9MA', 84, '2006', 3.27, 1),
(1965, 'United States of America', 'Meurtre parfait', 'Steven Taylor découvre la liaison secrète de sa jeune épouse Emily avec un peintre au passé peu reluisant, David Shaw. Maladivement jaloux et tenant David par le chantage, Taylor l\'oblige à tuer Emily. Mais ce plan machiavélique échoue quand Emily parvient à éliminer son agresseur, qui s\'avère être un tueur payé par David...', 'Kopelson Entertainment', 'https://image.tmdb.org/t/p/w1280/pVkPJqTBZ81P4DHN53ONLcCTSkW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//q3ND5eHCkwzbx7xL0inrSJko0PL.jpg', 'https://www.youtube.com/embed/', 103, '1998', 3.25, 1),
(1966, 'France', 'Alexandre', 'La vie d\'Alexandre le Grand, narrée par Ptolémée : de son enfance à sa mort, des cours d\'Aristote aux conquêtes qui firent sa légende, de l\'intimité aux champs de bataille. Fils du roi Philippe II, il soumit la Grèce révoltée, fonda Alexandrie, défit les Perses, s\'empara de Babylone et atteint l\'Indus pour établir à 32 ans l\'un des plus grands empires ayant jamais existé.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/r8vCj6X3BUGTzMVEQhE1T8NHniw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ySK5gxvXYnn55fjCIBeJVsG17RJ.jpg', 'https://www.youtube.com/embed/xX-fRBmEWic', 170, '2004', 2.95, 1),
(1967, 'United States of America', 'Demande à la poussière', 'Los Angeles a toujours été la ville de tous les rêves. Même dans les années trente, alors que les Etats-Unis sombraient dans la grande Dépression, chacun s\'y pressait, venu de tous les horizons, en espérant y saisir une chance de bonheur ou la fortune. Alors que le pays basculait dans la misère, la ville paraissait plus dorée que jamais...Pour la très belle Camilla Lopez, le seul moyen d\'échapper à sa condition est d\'épouser un riche américain ; mais sa rencontre avec Arturo Bandini, fils d\'immigrants italiens, va tout compliquer. Pour sa part, il rêve de devenir un romancier célèbre et d\'épouser une superbe blonde...Elle, mexicaine, et lui, américain, voient leurs communautés prêtes à s\'affronter pendant qu\'ils se heurtent, combattant leur époque, la ville et leurs propres limites, à la poursuite de leur destin...', 'Paramount', 'https://image.tmdb.org/t/p/w1280/4qDBP2UVvQYzN7cK9EtqzvomLnR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qykc21PjbISZCmpKedY76fojV1I.jpg', 'https://www.youtube.com/embed/J5WDnF0sV5I', 117, '2006', 2.65, 1),
(1968, 'United States of America', 'Coup de foudre et conséquences', 'Alex Whitman et Isabel Fuentes ont connu une breve aventure, une nuit a Las Vegas. Quelques mois plus tard, Isabel resurgit pour apprendre a Alex qu\'elle est enceinte de lui. Lui vient de New York et ne jure que pas son travail, elle vient du Mexique et place les sentiments au-dessus de tout.', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/sqwQXHeE6qqu8PTnKax7OgwGYBV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9f5wCpkbbEtqEUQU9UJGV3zQEyz.jpg', 'https://www.youtube.com/embed/', 109, '1997', 3.2, 1),
(1969, 'United States of America', 'Bandidas', 'Mexique, 1880. Sara Sandoval est la fille d\'un riche banquier. Maria Alvarez est la fille d\'un pauvre fermier. Ces deux jeunes femmes, qui n\'ont apparemment rien en commun, excepté leur culture mexicaine, sont entraînées dans la même aventure par le destin et les circonstances. Avec l\'aide de Quentin Cooke, un jeune et idéaliste inspecteur de police originaire de New York, elles vont s\'opposer à Tyler Jackson, le représentant de la New York Bank and Trust. Celui-ci a monté un complot visant à saisir illégalement les terres des Mexicains afin de faire passer le chemin de fer...', 'A.J.O.Z. Films', 'https://image.tmdb.org/t/p/w1280/hSNGROiCtVjAeoJiXesNdIt3Uj2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//74pF8usxBxot67OoVxy5b4yhRGs.jpg', 'https://www.youtube.com/embed/F9gs9FXUxOQ', 95, '2006', 3.01, 1),
(1970, 'United States of America', 'The Grudge', 'Dans ce qui paraît être une paisible maison de Tokyo se cache l\'un des fléaux les plus épouvantables qui soient. Quiconque franchit le seuil de la demeure est aussitôt frappé par une malédiction qui ne tardera pas à le tuer dans un sentiment d\'indicible rage.Alors que le nombre de victimes augmente, une jeune Américaine, Karen, se trouve brutalement confrontée à l\'horreur de cette réalité. Pour elle, il n\'est désormais plus temps d\'ignorer ou de fuir, il faut comprendre pour avoir une chance de survivre...', 'Vertigo Entertainment', 'https://image.tmdb.org/t/p/w1280/lJ5i3NTfTEMbzIp42sYPS5qAtKS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3F2BYZy8H74lWUEKfP5lTPFxEq8.jpg', 'https://www.youtube.com/embed/dgCoiQxcxQg', 91, '2004', 2.94, 1),
(1975, 'United States of America', 'The Grudge 2', 'Aubrey apprend que sa soeur Karen est hospitalisée au Japon. Peu de temps après son arrivée à Tokyo, Aubrey est avertie que sa soeur est devenue l\'esclave de quelque chose d\'invisible et de dangereux.De son côté, Allison étudie dans une école internationale de Tokyo. Décidée à se faire bien voir des élèves les plus populaires de l\'établissement, elle est prête à tout, y compris se rendre dans une mystérieuse maison incendiée, lieu de plusieurs meurtres inexpliqués et d\'étranges disparitions...Jake, un garçon introverti, n\'est pas heureux que son père veuf refasse sa vie avec Trish. Le fossé se creuse entre lui et les siens, mais aussi avec tous ses voisins qui semblent avoir des comportements de plus en plus étranges...Ces trois jeunes gens ne le savent pas encore, mais ils ont rendez-vous avec une terrifiante malédiction que plus rien ne retient enfermée...', 'Ghost House Pictures', 'https://image.tmdb.org/t/p/w1280/jWbDUyV6MbFN2WycsI0VJESyOsn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3HTK3FtjK5GXIvPswaIMBMHeL3E.jpg', 'https://www.youtube.com/embed/Mglv50uRLA8', 107, '2006', 2.74, 1),
(1976, 'United States of America', 'L\'insoumise', 'Sud des Etats-Unis, XIXe. Fâchée avec Pres, son fiancé, Julie profite de l\'Olympic Ball, un important évènement social, pour projeter de l\'humilier alors que leur mariage doit y être officiellement annoncé. Les femmes célibataires doivent y apparaître en blanc, elle viendra en rouge. Les fiançailles sont rompues. Trois ans plus tard, Pres revient dans la plantation, accompagné de sa femme Amy. Atteint de la fièvre jaune lors d\'une épidémie, Julie doit s\'occuper de lui.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/xewvSLrr0Ru6qVMwVqVheFLaGm4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bgfcTn3q8r16DByTJepeJwGT8Bz.jpg', 'https://www.youtube.com/embed/TTr3Mx9P4s8', 104, '1938', 3.58, 1),
(1977, 'Japan', 'The Grudge 3', 'Une jeune femme japonaise détient le secret qui pourrait mettre fin à la malédiction des Saeki. Elle voyage jusqu\'à Chicago où elle rencontre dans un immeuble une famille qui se bat pour survivre aux fantômes. Ensemble, ils vont affronter le fantôme de Kayako afin de sauver leurs âmes de leur tragique destin devenu imminent.', 'Ozla Pictures', 'https://image.tmdb.org/t/p/w1280/ilqLZK0gQSg4y4GL7wEMx4qA7Yz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5eJ00UQSJZYbOl48u9vyoWX2qsZ.jpg', 'https://www.youtube.com/embed/_lwCeK4wFe0', 90, '2009', 2.71, 1),
(1978, 'United Kingdom', 'Le Grand Alibi', 'Jonathan Cooper, épris d\'une comédienne et chanteuse, Charlotte Inwood, est soupçonné d’être l\'assassin de son mari. Il réussit à convaincre son amie Ève de son innocence. Elle décide de l\'aider.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/iEBGAfCQghkqyNgLdlQDWXyirXR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hlwiErwp7wKYuXbJQF5NxJ9C6PG.jpg', 'https://www.youtube.com/embed/', 110, '1950', 3.4, 1),
(1979, 'Germany', 'Les 4 Fantastiques et le Surfer d\'Argent', 'Alors que le mariage de Mr. Fantastic et de la femme invisible s\'annonce comme l\'événement de l\'année, un mystérieux surfer d\'argent surgit de l\'espace et provoque d\'étranges phénomènes sur la Terre. Rapidement, les quatre fantastiques vont découvrir le dessein secret de cet être aux pouvoirs surprenants et la menace qu\'il fait peser sur notre planète, mais ils vont aussi voir ressurgir leur ennemi juré... Face au danger, amis et ennemis vont devoir unir leurs forces comme jamais...', '1492 Pictures', 'https://image.tmdb.org/t/p/w1280/9Ejo1jwcq4T3CtB2fbUd2qLZOS6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7ff2FyFmskEFfmXHkxuqVr47DiG.jpg', 'https://www.youtube.com/embed/ceN7vS3EY_A', 92, '2007', 2.79, 1),
(1980, 'Australia', 'Bra Boys', '', 'Bradahood Productions', 'https://image.tmdb.org/t/p/w1280/qext495emBuNaHeHQIqY0f3S1Tf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oXsPWXElK7P9MyywmzMWUCoIZih.jpg', 'https://www.youtube.com/embed/', 90, '2007', 2.5, 1),
(1984, 'United Kingdom', '1984', 'In a totalitarian future society, a man whose daily work is rewriting history tries to rebel by falling in love.', 'Holiday Film Productions Ltd.', 'https://image.tmdb.org/t/p/w1280/2EOfGaRluwJe6OlR21JtbLhWDvt.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//eLo6eRTHAbaC21qRuxzyCmUaaT0.jpg', 'https://www.youtube.com/embed/', 90, '1956', 3.28, 1),
(1985, 'China', 'The Constant Gardener', 'Justin Quayle is a low-level British diplomat who has always gone about his work very quietly, not causing any problems. But after his radical wife Tessa is killed he becomes determined to find out why, thrusting himself into the middle of a very dangerous conspiracy.', 'Scion Films', 'https://image.tmdb.org/t/p/w1280/nkXq7V7mmJVbvwZGr3nxkHo7HkS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ksT0nX66UpCVBdvXiXW1byaZtjo.jpg', 'https://www.youtube.com/embed/9FycLyDTCWQ', 129, '2005', 3.49, 1),
(1986, 'France', 'Va, vis et deviens', 'En 1984, des milliers d\'Africains de 26 pays frappés par la famine se retrouvent dans des camps au Soudan. A l\'initiative d\'Israël et des Etats-Unis, une vaste action est menée pour emmener des milliers de Juifs éthiopiens vers Israël.Une mère chrétienne pousse son fils de neuf ans à se déclarer juif pour le sauver de la famine et de la mort. L\'enfant arrive en Terre Sainte. Déclaré orphelin, il est adopté par une famille française sépharade vivant à Tel-Aviv. Il grandit avec la peur que l\'on découvre son double-secret et mensonge : ni juif, ni orphelin, seulement noir. Il découvrira l\'amour, la culture occidentale, la judaïté mais également le racisme et la guerre dans les territoires occupés.', 'France 3 Cinéma', 'https://image.tmdb.org/t/p/w1280/9epxWjiU1epDK3dg8DKnBhHP1bn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//12YKdvErSqcMp33ZeNe7MjSW06A.jpg', 'https://www.youtube.com/embed/c1T2FX3qKmQ', 140, '2005', 3.75, 1),
(1987, 'Austria', 'Benny\'s Video', 'Benny, adolescent d\'origine bourgeoise, coupé de toute communication avec des parents trop souvent absents, s\'est enfermé dans l\'univers de la vidéo. Peu à peu son sens des réalités et des valeurs se déforme. Sa rencontre avec une jeune fille va dériver vers l\'horreur...', 'wega film vienna', 'https://image.tmdb.org/t/p/w1280/yiJZEqCdOPFkCGsmr4oUKd7Xf51.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uH7zKI0YsvZhEju7f9NpVNhtjHw.jpg', 'https://www.youtube.com/embed/', 110, '1992', 3.5, 1),
(1988, 'United Kingdom', 'Un Cœur invaincu', 'Le 23 janvier 2002, le monde entier est choqué par l\'image d\'un journaliste américain décapité devant la caméra par des extrémistes pakistanais. Daniel Pearl, superviseur du Wall Street Journal pour l\'Asie du Sud Est, enquêtait au Pakistan sur un dénommé Richard Reid, activiste et vendeur d\'armes. Alors qu\'un entremetteur doit le mener sur la piste d\'une source importante, il disparaît soudainement.Confrontée à la mort de son mari, Mariane Pearl rédige l\'histoire de son enquête, de son kidnapping et de sa mort et, surtout, l\'histoire de son propre désespoir à elle, dans \"A Mighty Heart : the Brave Life and Death of my Husband Danny Pearl\". Le film retrace son combat de chaque instant pour comprendre l\'assassinat de son mari et pouvoir enfin en faire le deuil.', 'Plan B Entertainment', 'https://image.tmdb.org/t/p/w1280/16SNI1faFcugiZPu6pAmSvMoXIc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zjVE6yJE3UvQbBTB6QbiN3fK52m.jpg', 'https://www.youtube.com/embed/', 100, '2007', 3.2, 1),
(1989, 'China', 'My Blueberry Nights', 'Après une rupture douloureuse, Elizabeth se lance dans un périple à travers l\'Amérique, laissant derrière elle une vie de souvenirs, un rêve et un nouvel ami - un émouvant patron de bar - tout en cherchant de quoi panser son coeur brisé. Occupant des emplois de serveuse, Elizabeth se lie d\'amitié avec des clients dont les désirs sont plus grands que les siens : un policier tourmenté et sa femme qui l\'a quitté, une joueuse dans la déveine qui a une affaire à régler.A travers ces destins individuels, Elizabeth assiste au spectacle du véritable abîme de la solitude et du vide, et commence à comprendre que son propre voyage est le commencement d\'une plus profonde exploration d\'elle-même.', 'Block 2 Pictures', 'https://image.tmdb.org/t/p/w1280/gTwPONsL3Jk84N9PjX52g5sNGR3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//eBTuwZ3UNvWoxi8D87kS8vGUuG8.jpg', 'https://www.youtube.com/embed/', 95, '2007', 3.2, 1),
(1990, 'France', 'Paranoid Park', 'Aux abords du Paranoid Park, Alex - un jeune skateur - tue accidentellement un agent de sécurité… Il ne réalise pas immédiatement les conséquences de son acte mais une image va tout faire basculer quelques jours plus tard.', 'Meno Films', 'https://image.tmdb.org/t/p/w1280/4q2AgFRUQWp6GPUygoBMK1NqFIG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//w8OhromKmNPJFVqpI5gOthrY5WF.jpg', 'https://www.youtube.com/embed/LQNqM8kG4kE', 85, '2007', 3.27, 1),
(1991, 'United States of America', 'Boulevard de la mort', 'C’est à la tombée du jour que Jungle Julia, la DJ la plus sexy d’Austin, peut enfin se détendre avec ses meilleures copines, Shanna et Arlene. Ce trio infernal, qui vit la nuit, attire les regards dans tous les bars et dancings du Texas. Mais l’attention dont ces trois jeunes femmes sont l’objet n’est pas forcément innocente. C’est ainsi que Mike, cascadeur au visage balafré et inquiétant, est sur leurs traces, tapi dans sa voiture indestructible. Tandis que Julia et ses copines sirotent leurs bières, Mike fait vrombir le moteur de son bolide menaçant…', 'Troublemaker Studios', 'https://image.tmdb.org/t/p/w1280/1cajesADv9jGJAMqC2peAnxh5ar.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qbVCChwbGWDAgsCXKZxyjBrRiWx.jpg', 'https://www.youtube.com/embed/ZboTEXtEZiI', 110, '2007', 3.41, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(1992, 'United States of America', 'Planète terreur', 'Dans une petite ville, William et Dakota Block, un couple de médecins, constatent que leurs patients sont soudains frappés par la gangrène et affectés par un regard vide et inquiétant… De son côté, Cherry, gogo danseuse, s’est fait arracher la jambe lors d’une attaque. Wray, son ex-petit copain, veille sur elle. Mais, Cherry a beau être au plus mal, elle n’a pas dit son dernier mot. Tandis que les malades se multiplient et deviennent des agresseurs enragés, Cherry et Wray prennent la tête d’une armée destinée à empêcher l’épidémie de se propager. Si des millions d’individus sont contaminés et beaucoup succombent, une poignée d’entre eux se battront jusqu’au bout pour se réfugier dans un lieu sûr…', 'Dimension Films', 'https://image.tmdb.org/t/p/w1280/l1gI8myz1STydCZTWoRhhCcXjNS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hQI1nR09wFYoojtHIiq9at1N80c.jpg', 'https://www.youtube.com/embed/', 105, '2007', 3.32, 1),
(1993, 'France', 'Golden Door', 'The story is set at the beginning of the 20th century in Sicily. Salvatore, a very poor farmer, and a widower, decides to emigrate to the US with all his family, including his old mother. Before they embark, they meet Lucy. She is supposed to be a British lady and wants to come back to the States. Lucy, or Luce as Salvatore calls her, for unknown reasons wants to marry someone before to arrive to Ellis Island in New York. Salvatore accepts the proposal. Once they arrive in Ellis Island they spend the quarantine period trying to pass the examinations to be admitted to the States. Tests are not so simple for poor farmers coming from Sicily. Their destiny is in the hands of the custom officers.', 'Titti Film', 'https://image.tmdb.org/t/p/w1280/gjSK4pyVDt8Pwt9KpB8OtC246DC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cz5b0Q0rk6HiTD0lSWQAeZq0aDZ.jpg', 'https://www.youtube.com/embed/', 118, '2006', 3.25, 1),
(1994, 'United States of America', 'Les Chasses du comte Zaroff', 'Un chasseur de renom échoue sur une île à la suite d\'un naufrage dont il est le seul survivant. Le comte Zaroff le recueille et le soigne, seulement, il se rendra bientôt compte que ce comte, raffiné et cultivé, entretient une mortelle passion pour la chasse. Las de la chasse conventionnelle, le mystérieux comte est à la recherche de nouveaux frissons...', 'RKO Radio Pictures', 'https://image.tmdb.org/t/p/w1280/3mNYuWJ5ToXaAkG0u5415JaJHhj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aV2b3tOQYZBaEcCeXxbRaEaP6W1.jpg', 'https://www.youtube.com/embed/eRdi7cDAKR0', 63, '1932', 3.48, 1),
(1995, 'Germany', 'Lara Croft: Tomb Raider', 'English aristocrat Lara Croft is skilled in hand-to-hand combat and in the middle of a battle with a secret society. The shapely archaeologist moonlights as a tomb raider to recover lost antiquities and meets her match in the evil Powell, who\'s in search of a powerful relic.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/7WyMvoqPYJe5g1ENsbLTv40pUrX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ic50CVnRJY3yE9M8xzwlS7ikPga.jpg', 'https://www.youtube.com/embed/8_kcjDHqO_w', 100, '2001', 2.94, 1),
(1996, 'Germany', 'Lara Croft: Tomb Raider - The Cradle of Life', 'Lara Croft is tasked by MI6 to find the mythological Pandora\'s Box, an object from ancient legends which supposedly contains one of the deadliest plagues on Earth, before evil Nobel Prize-winning scientist turned bioterrorist Jonathan Reiss can get his hands on it. Lara ventures to an underwater temple in search of a magical luminous orb, the key to finding Pandora\'s Box, but after securing it, it is promptly stolen by the villainous leader of a Chinese crime syndicate who in turn plans to sell the orb to Reiss. Lara must recover the box before evil mastermind Reiss uses it to construct a weapon of catastrophic capabilities.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/ylIEGeAr2ygSClK4FDj9mi2Ah22.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//e5P1VPToB07tH6y3n5IdqNUozBd.jpg', 'https://www.youtube.com/embed/8_kcjDHqO_w', 117, '2003', 2.87, 1),
(1997, 'France', 'Deux Frères', 'Deux frères naissent loin de tout, parmi les ruines d\'un temple oublié, englouti au cœur de la jungle d\'Angkor. Ils grandissent sous le regard affectueux et vigilant de la Tigresse, leur mère et de leur père, le grand Tigre. Hélas, en ce début des années 1920, la fièvre de l\'Art Asiatique s\'empare des grandes capitales occidentales. Des pilleurs de temples font irruption. Les deux frères sont capturés, séparés et vendus. L\'un atterrit dans un cirque, l\'autre chez un Prince. Les deux félins se retrouvent opposés, face à face, dans une arène. Au cours du combat, ils se reconnaissent et parviennent à s\'enfuir...', 'Pathé Renn Productions', 'https://image.tmdb.org/t/p/w1280/j3Ewv2OoOzcR7oFrQZQ87G9ujpF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//y60zTbctZOkh2gJ9mgSP5csKc9b.jpg', 'https://www.youtube.com/embed/B6-wgnGRWN0', 109, '2004', 3.57, 1),
(1998, 'France', 'Holy Lola', 'Le récit d\'un désir d\'enfant qui entraîne un jeune couple, Pierre et Géraldine, au coeur d\'un voyage initiatique au bout du monde, dans un pays martyrisé par l\'Histoire : le Cambodge. Pour eux, commence une aventure éprouvante et formidable : ronde des orphelinats, confrontation avec les autorités françaises et cambodgiennes, menaces de trafics. Sans oublier la méfiance et la jalousie mais aussi l\'entraide de la petite communauté des adoptants réunie par le hasard.A travers cette quête, le couple fait face à ses peurs, ses égoïsmes. Il se déchire, se rapproche et en sort à jamais transformé.', 'Canal+', 'https://image.tmdb.org/t/p/w1280/dG6ytJeEvQXQyCAZTsH9q82rgPS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 130, '2004', 3.05, 1),
(1999, 'United States of America', 'In the Bedroom', 'Dans une petite ville de la Nouvelle-Angleterre, Matt et Ruth Fowler mènent une existence paisible. Lui est médecin, tandis qu\'elle dirige la chorale locale. Leur quotidien sans histoire est ébranlé le jour où Frank, leur fils unique, engage une relation avec Natalie Strout, une femme plus âgée que lui. Cette liaison va être le détonateur d\'une série d\'événements qui vont bouleverser la vie de cette famille bien tranquille.', 'GreeneStreet/SKE Films', 'https://image.tmdb.org/t/p/w1280/4FIlOw7P2Yusdl7TqHFvKC1eMQ4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kWa4iUaC7SU2DHDlknlVvw5x9nP.jpg', 'https://www.youtube.com/embed/qCZrDiHhB2g', 131, '2001', 3.47, 1),
(2000, 'Germany', 'Aguirre, la colère de Dieu', 'La marche de ses soldats étant contrariée par de multiples périls, Pizzaro, le conquérant du Pérou, confie à un groupe d\'une quarantaine d\'hommes – sous la direction de Pedro de Ursua, secondé par don Lope de Aguirre – le soin de descendre le fleuve afin de reconnaître le terrain. Très vite, Aguirre se révolte contre Ursua, qu\'il blesse d\'un coup de feu. Rejetant l\'autorité de l\'Espagne, libre et rebelle, Aguirre entraîne alors ses compagnons vers cet Eldorado mythique qui les fait tous rêver depuis si longtemps. Il s\'est mis en tête de se tailler un empire autour de la fabuleuse cité d\'or et d\'y fonder une dynastie…', 'Werner Herzog Filmproduktion', 'https://image.tmdb.org/t/p/w1280/oq0TfwtkuMocFuwoHyEILgnbNZM.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zKakF2CHjm85bFaeyM9LeB2Ssz3.jpg', 'https://www.youtube.com/embed/eJDuicFyJPg', 94, '1972', 3.76, 1),
(2001, 'United States of America', 'La Nuit nous appartient', 'New York, fin des années 80. Bobby est le jeune patron d\'une boite de nuit branchée appartenant aux Russes. Avec l\'explosion du trafic de drogue, la mafia russe étend son influence sur le monde de la nuit. Pour continuer son ascension, Bobby doit cacher ses liens avec sa famille. Seule sa petite amie, Amada est au courant : son frère, Joseph, et son père, Burt, sont des membres éminents de la police new-yorkaise… Chaque jour, l\'affrontement entre la mafia russe et la police est de plus en plus violent, et face aux menaces qui pèsent contre sa famille Bobby va devoir choisir son camp…', 'Industry Entertainment', 'https://image.tmdb.org/t/p/w1280/b0FEbyfa8XCQ3dpb92iwxy1VM7E.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//syO4HCR4t3tz6TX9CbYlW9fTQX3.jpg', 'https://www.youtube.com/embed/cYfV3kmwAUw', 114, '2007', 3.34, 1),
(2002, 'France', 'Une vieille maîtresse', 'Paris, 1835... Comme pour conjurer les soubresauts de l\'époque, la noblesse se pique au jeu des Liaisons dangereuses, (un demi-siècle après la publication du roman épistolaire de Choderlos de Laclos), feignant de se croire encore au siècle des Lumières. La Marquise de Flers décide de marier sa petite fille, fleuron de l\'aristocratie française, avec Ryno de Marigny, une sorte de Valmont romantique. Mais ce que tout le monde ignore c\'est que ce Don Juan, impénitent, est depuis 10 ans l\'amant et la proie d\'une courtisane scandaleuse, démon de la séduction, fille naturelle d\'une duchesse et d\'un toréro.', 'La Région Île-de-France', 'https://image.tmdb.org/t/p/w1280/rWx7ef40NlGqUI4TGLT2qGqh072.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8rl2FnibCaAgn8LlkljVBayLwbU.jpg', 'https://www.youtube.com/embed/xdEcp5tKDv0', 115, '2007', 2.95, 1),
(2003, 'France', 'Anatomie de l\'enfer', 'Dans ces lieux où on se côtoie sans jamais se rencontrer, où la musique gère la pulsion des corps, il danse, lui, son fiancé, le regard tourné vers lui-même. Il ne la regarde pas. Il est bien trop occupé à fondre son corps à l\'hydre primordiale faite du corps des autres. Ils sont tous beaux, ils n\'aspirent qu\'à se reconnaître dans la beauté de l\'autre. Elle est la fille, habillée de noir, si jeune et déjà vêtue du deuil d\'elle-même. Dans les toilettes, elle prend un rasoir et entaille son poignet. C\'est ainsi qu\'ils se rencontrent. Désormais, elle prend sur lui le pouvoir des victimes. Elle paiera le prix qu\'il faut pour qu\'il la regarde « par là où elle n\'est pas regardable », car c\'est du regard des hommes qu\'est constituée l\'obscénité des femmes. Elle l\'a choisi parce qu\'il n\'aime pas les femmes. De ce tête à tête naissent le désir et la haine meurtrière qui l\'accompagne.', 'Canal+', 'https://image.tmdb.org/t/p/w1280/bXBy47Q364UcQuZifpBECjt8N1X.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//diEr7cut4E9f7Xw3bMjXDblS8Rx.jpg', 'https://www.youtube.com/embed/', 77, '2004', 2.41, 1),
(2004, 'Germany', 'Kebab Connection', 'In Hamburg, Ibrahim \"Ibo\" Secmez, of Turkish descent, wants to direct the first German kung-fu movie. For now, he makes commercials for his uncle\'s kebab restaurant. Titzie, an aspiring actress and Ibo\'s German girlfriend, finds she\'s pregnant. Ibo is uncertain about fatherhood - compounded by his father\'s disowning him for getting a German girl pregnant - so Titzie sends him packing. He makes attempts at getting it right, but as the birth approaches, he\'s still not ready. In the background are three thugs in search of good tripe soup and a Capulet-Montegue feud between the kebab joint and a Greek taverna across the street. Can Ibo be the glove upon that hand?', 'Wüste Filmproduktion', 'https://image.tmdb.org/t/p/w1280/8pgbRb69LxSaQi0BqVVjNMHIErE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//s2XyJwZ2nmtbCT8ZE3oPlm0yq1j.jpg', 'https://www.youtube.com/embed/hEVMVnYvT6Y', 96, '2004', 3.29, 1),
(2005, 'United States of America', 'Sister Act', 'Une jeune femme, témoin d\'un meurtre, intègre un couvent pour se protéger. Elle va alors donner un nouvel élan à l\'établissement religieux, invitant notamment les bonnes sœurs à une réorchestration musicale de leurs chants.', 'Touchstone Pictures', 'https://image.tmdb.org/t/p/w1280/q4QgAMUtCdKJnCqaph0c1hcK2g6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8gn0V6R8V513vT3tOsP2IfrkzEu.jpg', 'https://www.youtube.com/embed/pUQdjFqf6v8', 100, '1992', 3.41, 1),
(2006, 'United States of America', 'L\'Adorable voisine', 'Gillian Holroyd est une jeune et belle sorcière qui tient un magasin d\'art africain, à Greenwich Village, quartier de la bohème new-yorkaise. L\'étrange pouvoir qui lui permet de faire et defaire à sa guise les choses de la vie ne l\'empèche pas d\'être bien seule en cette veille de Noël. Elle sait que le jour où elle tombera amoureuse, son pouvoir magique disparaitra. C\'est alors que le séduisant éditeur Shep Henderson, et locataire du troisième étage, frappe à sa porte, son téléphone étant malencontreusement tombé en panne...', 'Julian Blaustein Productions', 'https://image.tmdb.org/t/p/w1280/2TkXjUtPCkU0DOBahzlDnpKTc8y.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//y5e5MTZtbMesmJ7EYgBdlceMcWq.jpg', 'https://www.youtube.com/embed/', 106, '1958', 3.23, 1),
(2007, 'United States of America', 'Lorenzo', 'Comment, en 1984, grâce à leur pugnacité, Augusto et Michaela Odone sauvèrent Lorenzo, leur fils atteint d\'une maladie incurable, l\'ALD, qui provoque une détérioration brutale et irréversible du système nerveux.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/o3eUyujRBO8xGK4zcvPfuP3decc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vseQJJ78NzjNNqfSji4xNlt8HBy.jpg', 'https://www.youtube.com/embed/', 127, '1992', 3.54, 1),
(2100, 'United States of America', 'Le Dernier Château', 'Injustement condamné par la cour martiale, le général Irwin est tenu responsable de la mort de huit soldats. Il doit donc purger une peine dans une prison militaire de haute sécurité appelée \"Le Château\". Le colonel Winter, qui dirige ce centre de détention, veille à ce qu\'Irwin n\'ait droit à aucun privilège quel qu\'il soit. Au grand étonnement de ce dernier, les autres prisonniers se mettent à le respecter et à le saluer comme le ferait un soldat à son général, et ce, même si son grade est tombé en désuétude. Winter voit rouge : il ne tolère pas de voir contester son autorité et ses méthodes dictatoriales. Avec l\'aide de ses compagnons de cellule, Irwin va mettre en place sa propre armée pour organiser une véritable insurrection et ainsi piéger le directeur du \"Château\".', 'DreamWorks Pictures', 'https://image.tmdb.org/t/p/w1280/lKYnBR0O7S6v9OBFbSLp2Ow2xK9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bYJyQqqJV30RJX6VPE3Rz1lPZhH.jpg', 'https://www.youtube.com/embed/', 132, '2001', 3.56, 1),
(2101, 'Spain', 'Fratello dello spazio', '', 'Constan Films', 'https://image.tmdb.org/t/p/w1280/4VaQkchsVqkvMHHmTdlc8Bs6GBA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 90, '1988', 1, 1),
(2102, 'Japan', 'Solar Crisis', 'Les scientifiques sont formels : une éruption solaire massive va détruire toute forme de vie sur Terre, et transformer notre planète en une gigantesque boule de feu.\r Les Humains envoient le vaisseau Helios vers le Soleil. Sa mission : envoyer au cœur de notre étoile une bombe à antimatière pilotée par Freddy, une intelligence artificielle. Si tout se passe comme prévu, l\'éruption solaire sera déviée de sa trajectoire et la Terre sera épargnée...', 'Trimark Pictures', 'https://image.tmdb.org/t/p/w1280/Hbv6CPtv4ehgE60dXOYKmIrcV1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2DALChI060gUghE96J9KP7RcgLb.jpg', 'https://www.youtube.com/embed/', 112, '1990', 2.26, 1),
(2103, 'United States of America', 'Solaris', 'Répondant à l\'appel de détresse lancé par son ami Giberian, le commandant du Prométhée, une station spatiale gravitant autour de la planète Solaris, le docteur Chris Kelvin décide de se rendre à son bord. Une fois sur place, il découvre que Giberian s\'est suicidé et que les deux autres scientifiques présentent des signes aigus de stress et de paranoïa. Chris mène alors des recherches sur le comportement pour le moins étrange des rescapés. Lui-même sera victime d\'une force mystérieuse qui le mettra en présence de Rheya, celle qu\'il a aimée autrefois et qui a mis fin à ses jours.', 'Lightstorm Entertainment', 'https://image.tmdb.org/t/p/w1280/d7j3E7vjLt77QoaFhMwyV8opPUN.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//avjG5EPgWXyLvsUId6hEn0iqT4A.jpg', 'https://www.youtube.com/embed/', 99, '2002', 2.95, 1),
(2104, 'France', 'Requiem', '', 'Mars Films', 'https://image.tmdb.org/t/p/w1280/hf1gIOsdIZn5AqmozMFqtAjXMQB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 98, '2001', 2.35, 1),
(2105, 'United States of America', 'American Pie', 'Mortifié pour avoir été surpris par ses parents devant un film X, Jim, élève de terminale, fait un pacte avec sa bande de copains : devenir des hommes avant l\'entrée à la fac. Il leur reste trois semaines pour utiliser toutes les techniques possibles de séduction. Tous les moyens sont bons, même les plus inattendus, car chaque jour compte. Une chose est sûre, Jim ne regardera plus jamais une tarte aux pommes de la même façon !', 'Summit Entertainment', 'https://image.tmdb.org/t/p/w1280/8P0i5EdE1LBYl8b8egIwSSZmxrV.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7hQTANu5TAEe4jrTerYHszyTOpV.jpg', 'https://www.youtube.com/embed/kWWsuBAj6XI', 95, '1999', 3.28, 1),
(2106, 'United Kingdom', 'Hot Enough for June', '', 'The Rank Organisation', 'https://image.tmdb.org/t/p/w1280/2DLxXAplrFdS4hcFMNeJhTcT03e.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 98, '1964', 3.2, 1),
(2107, 'United States of America', 'L.A. Story', 'La vie d\'un présentateur météo d\'une station de télévision locale va soudain basculer quand il perd son emploi et que sa maîtresse le trompe. À la recherche de l\'âme sœur, il croise un panneau de signalisation électronique qui lui conseille d\'appeler une jeune femme.', 'TriStar Pictures', 'https://image.tmdb.org/t/p/w1280/ixbd7uEMjgIRuY0qRkAD6xYJEW8.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hPDv0O8tvbEvcVVphIieSUuI0DH.jpg', 'https://www.youtube.com/embed/0eCSmfP4g2c', 95, '1991', 3.25, 1),
(2108, 'United States of America', 'Breakfast Club', 'Cinq lycéens aux personnalités totalement opposées se retrouvent en colle un samedi. Le professeur qui les surveille leur demande à chacun de faire une dissertation de 1 000 mots avec pour sujet : « Qui pensez‐vous être ? ». Au fur et à mesure que la journée passe, ils discutent, se déchirent et finissent par se trouver plus de points communs qu’ils ne pensaient.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/7fyU9OIvU1Z7dznrHa5l9qNXIkH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qpPFF8Sed5lkXngWraJdN8WkwDG.jpg', 'https://www.youtube.com/embed/98Zr2rhdEZ8', 97, '1985', 3.88, 1),
(2109, 'United States of America', 'Rush Hour', 'L\'inspecteur Lee est un des fleurons de la police royale de Hong Kong. Sa placidité ne laisse rien soupçonner de son génie des arts martiaux. Âgée de onze ans, la fille du consul de Chine aux États-Unis fut son élève préférée, il en était le garde du corps, il en est resté le meilleur ami. Lorsqu\'elle est enlevée par les hommes d\'un maître du crime, qui a jadis abattu son coéquipier, Lee saute dans l\'avion, bien décidé à retrouver la fillette et à châtier ses ravisseurs.', 'Roger Birnbaum Productions', 'https://image.tmdb.org/t/p/w1280/my4J6c4dfTV97zbuTRqoLK2sqSj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//r4yFYBEcV247B9VXi1307fIhVqN.jpg', 'https://www.youtube.com/embed/jMiJykxkysc', 95, '1998', 3.5, 1),
(2110, 'Japan', 'Wasabi', 'Flic solitaire au grand cœur mais aux méthodes parfois musclées, l\'inspecteur Hubert se retrouve en vacances forcées après avoir rossé le fils du préfet. Un jour, il reçoit le coup de fil d\'un notaire qui lui annonce que Miko, la femme de sa vie disparue vingt ans auparavant, vient de mourir dans d\'étranges circonstances. Seul légataire testamentaire, Hubert débarque au Japon, accueilli par son ancien équipier, pour découvrir ce dont il a hérité.', 'Canal+', 'https://image.tmdb.org/t/p/w1280/uBOCT5d9oZCMN3tFlPSQGx1SjAo.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//kSpfkuIykUsXr6XSU8NdyqiVcR4.jpg', 'https://www.youtube.com/embed/yhAqbCsz684', 95, '2001', 3.31, 1),
(2111, 'China', 'Balzac et la petite tailleuse chinoise', 'Dans la Chine maoïste des années 70, un adolescent est envoyé dans un « camp de réhabilitation », où il découvre l’amour et un trésor totalement interdit : une valise pleine de livres étrangers.', 'Les Films de la Suane', 'https://image.tmdb.org/t/p/w1280/pGVferhtrIZQuOz6AUKh0na9A7j.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sjlIIJ3kdxvUfDyUJdt2GgkPQ5w.jpg', 'https://www.youtube.com/embed/', 116, '2002', 3.4, 1),
(2112, 'United States of America', 'Payback', 'With friends like these, who needs enemies? That\'s the question bad guy Porter is left asking after his wife and partner steal his heist money and leave him for dead -- or so they think. Five months and an endless reservoir of bitterness later, Porter\'s partners and the crooked cops on his tail learn how bad payback can be.', 'Icon Productions', 'https://image.tmdb.org/t/p/w1280/gl295sH8213lY8aQ8hS2tTbuzYD.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fP9QYH8T9LBnsvnQvcqetB4nuwX.jpg', 'https://www.youtube.com/embed/H2lxSiVoeiU', 100, '1999', 3.41, 1),
(2114, 'Japan', 'Final Fantasy: Les créatures de l\'esprit', 'En 2065, la plus grande confusion règne sur notre planète. Seuls les plus résistants des humains vivent encore dans un univers de désolation dominé par l\'ennemi absolu : de mystérieux fantômes qui se nourrissent en extrayant l\'énergie de toute forme de vie terrestre. Le futur de notre espèce repose sur le courage et la volonté de quelques-uns. Déjouant les complots, évitant les pièges, ils doivent reconquérir la Terre en usant de toutes les magies. Deux clans s\'opposent sur la manière la plus efficace d\'éliminer les spectres : les premiers, commandés par un général belliqueux, souhaitent utiliser une arme de destruction totale ; les autres, conduits par le docteur Aki Ross, s\'engagent dans une voie difficile : la reconstitution d\'un rythme spirituel qui devrait chasser les fantômes et protéger les êtres vivants. L\'aventure est risquée, mais ils n\'ont plus rien à perdre.', 'Chris Lee Productions', 'https://image.tmdb.org/t/p/w1280/dgdj1VFvxwr8E8IcOxFJFKPHmC2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qyOO0dgss0oeUYFPWbbdALDgOSm.jpg', 'https://www.youtube.com/embed/qUXVOfdGE4o', 106, '2001', 3.09, 1),
(2115, 'United States of America', 'Electric Blue', 'Joe travaille dans une usine de métallurgique de Cleveland.  Quand vient la nuit, il monte sur scène pour jouer de la guitare avec les Barbusters, le groupe de rock qu\'il a monté avec sa sœur Patti.  La vie n\'est pas facile pour Joe, qui essaie tant bien que mal de maintenir autour de lui une famille désunie et en conflit, de prendre soin de Patti, et de mener à bien sa carrière de musicien.  Son seul plaisir est de jouer devant son public tous les soirs et de donner libre cours à son talent.', 'HBO', 'https://image.tmdb.org/t/p/w1280/hFXnASDyZd3i9TOuBPUtJRvfZsK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//n0vzpcFYe1c9AcOyCPMvrlL4uEX.jpg', 'https://www.youtube.com/embed/', 102, '1987', 2.68, 1),
(2116, 'United States of America', 'Out of Time', 'Matt Lee Whitlock est le chef de la police de Banyan Key en Floride. Respecté par ses pairs et apprécié par les habitants, il dirige une équipe de quatre policiers incluant sa femme, l\'inspecteur Alex Diaz, dont il est sur le point de divorcer. Whitlock a renoué avec sa petite amie, Ann, mariée à un footballeur déchu au tempérament violent, Chris. Un jour, celle-ci lui déclare qu\'elle souffre d\'un cancer. Son seul espoir : se rendre en Europe pour y suivre un traitement expérimental, mais elle est à court d\'argent.Prêt à tout pour sauver sa jeune maîtresse, Matt vole alors dans le coffre-fort du commissariat 485 000 dollars saisis lors d\'une récente opération anti-drogue, et les lui remet. Un mystérieux incendie ravage dans la nuit la maison d\'Ann et de Chris, où l\'on retrouve deux corps carbonisés. Matt découvre que ses liens avec Ann et le vol de l\'argent en font le suspect n°1...', 'Monarch Pictures', 'https://image.tmdb.org/t/p/w1280/wdniUkm0hwXv2RqzvwWy5XtRNvB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mNepuK3LthcA5acdh8j3T96taWu.jpg', 'https://www.youtube.com/embed/o1QgbqVvS-E', 105, '2003', 3.15, 1),
(2117, 'Germany', 'Sophie Scholl, les derniers jours', 'Munich, 1943. Tandis que Hitler mène une guerre dévastatrice à travers l\'Europe, un groupe d\'étudiants forme un mouvement de résistance, La Rose Blanche, appelant à la chute du IIIème Reich. D\'obédience pacifique, ces membres propagent des tracts antinazis, couvrant les murs de la ville de slogans, et invitent la jeunesse du pays à se mobiliser.\r Le 18 février, Hans Scholl et sa sœur Sophie - qui font partie du noyau dur du mouvement - sont aperçus par le concierge de l\'université de Munich en train de jeter des centaines de tracts du haut du deuxième étage donnant sur le hall. Ils sont immédiatement appréhendés par la Gestapo et emprisonnés à Stadelheim.\r Durant les jours suivants, l\'interrogatoire de Sophie Scholl est mené par l\'agent de la Gestapo Robert Mohr. Un véritable duel psychologique s\'engage...', 'Goldkind Filmproduktion', 'https://image.tmdb.org/t/p/w1280/eqDNSoa9BePJBeUHfEBRT6lSM94.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4aciRChTrbvlVXI8DNVeG0K2qTy.jpg', 'https://www.youtube.com/embed/', 105, '2005', 3.58, 1),
(2118, 'United States of America', 'L.A. Confidential', 'Los Angeles, années 50. Alors que la ville est sujette à une vague de règlements de comptes après la chute du caïd Mickey Cohen, la police criminelle se mobilise toute entière sur l’affaire de L’Oiseau de nuit, un massacre au cours duquel est tombé un ancien flic. Trois inspecteurs au style radicalement différent vont être amenés à coopérer pour démêler les fils d’une histoire plus compliquée qu’il n’y paraît…', 'Regency Enterprises', 'https://image.tmdb.org/t/p/w1280/jTKTh4wmxV47gSzAJo1EdylD3Af.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fGbM2cqPauRu7ALFPSTDBH9FgpU.jpg', 'https://www.youtube.com/embed/MHhaTqEk6G0', 138, '1997', 3.89, 1),
(2119, 'United States of America', 'Jours de Tonnerre', 'Cole Trickle est un nouveau venu dans le monde des courses de stock-cars. Malgré son inexpérience, il gagne la confiance du patron d\'équipe Tim Daland et du constructeur Harry Hogge. De circuit en circuit, Cole apprend les secrets du métier. De fréquents duels l\'opposent à Rowdy Bums, le champion en titre, jusqu\'au jour où, après une violente collision, ils se retrouvent tous les deux à l\'hôpital. Provisoirement sur la touche, Cole est remplacé par Russ Wheeler, un jeune pilote ambitieux et sans scrupules. Tandis qu\'il ronge son frein, il noue une idylle avec la séduisante doctoresse Claire Lewicki...', 'Paramount', 'https://image.tmdb.org/t/p/w1280/cE6GeExVEAwTsqOx2YWO7aEKEI8.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9kEM0ju09rLPjjcSMooZLGGGmir.jpg', 'https://www.youtube.com/embed/-oQ8SVNFbuk', 107, '1990', 3.15, 1),
(2120, 'Germany', 'Cedric', '', 'Technische Hochschule Ostwestfalen-Lippe', 'https://image.tmdb.org/t/p/w1280/v158R46vHrjpKQqP1bwVni2RGxJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//m1CSCeQtLN5bHrclX8JtADzXBlH.jpg', 'https://www.youtube.com/embed/', 11, '2006', 0, 1),
(2122, 'United States of America', 'Mon voisin le tueur 2', 'Grâce à son ex-voisin, Nicholas \" Oz \" Oseransky, qui lui a fourni un dossier dentaire bidouillé, Jimmy \" La Tulipe \" Tudeski, tueur à gages rangé des voitures, passe désormais ses journées à jouer les fées du logis et les parfaits cordons bleus en compagnie de son épouse Jill, qui se figure être une meurtrière professionnelle sans avoir jamais fait mouche. Et voilà qu\'une vieille connaissance ressurgit inopportunément sur leur pas de porte : il s\'agit de Oz, qui les supplie de l\'aider à arracher sa femme Cynthia à des gangsters hongrois. Ensemble, il leur faudra surmonter mille obstacles afin de défaire ces malfaisants mafieux.', 'Nine Yards Two Productions', 'https://image.tmdb.org/t/p/w1280/whhhjD29tbdq0a69nrOweGgSvFD.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cQUSBypH7uVSLvZYW6yVgorjgHK.jpg', 'https://www.youtube.com/embed/bdQxiIfGxxM', 95, '2004', 2.85, 1),
(2123, 'United States of America', 'Fous d\'Irène', 'Charlie Baileygates est un policier souffrant de troubles de la personnalité. Après avoir suivi un traitement médical, il se voit confier la mission d\'escorter Irène Waters dans un autre État, où elle est recherchée pour une grave violation au code de la route. Mais Charlie entame ce voyage en oubliant ses médicaments, permettant par là même à son alter ego dérangé, Hank, de refaire surface. Et lorsque les deux personnalités commencent à se disputer l\'amour de leur belle prisonnière, Irène se rend compte qu\'elle est finalement attirée... par les deux.', 'Conundrum Entertainment', 'https://image.tmdb.org/t/p/w1280/t5CjP8vQyXQCT4lt2x0qEcDl9Da.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8qLen3NLCVSu1I9aqGWbTUIoBLQ.jpg', 'https://www.youtube.com/embed/L1NTw1zxm-o', 117, '2000', 3.29, 1),
(2124, 'United States of America', 'Color of Night', 'Le psychanalyste Bill Capa vient se reposer chez son ami et collègue Bob Moore. Ce dernier l\'intègre à l\'un de ses groupes de travail avant de lui apprendre qu\'il a recu des menaces de mort. Quelques jours plus tard, il est sauvagement assassiné. Bill décide de prendre les fonctions de son ami, de manière à démasquer l\'assassin, certainement parmi ses clients.', 'Cinergi Pictures Entertainment', 'https://image.tmdb.org/t/p/w1280/wkkmt0u8Qz48Wa8CCgPtpiqzImP.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3yFGxAMXvfsVWIEmzRbntELcdkw.jpg', 'https://www.youtube.com/embed/', 122, '1994', 2.89, 1),
(2125, 'United States of America', 'Wedlock', 'Condamné pour vol, Frank Warren doit purger sa peine dans une prison futuriste où chaque individu est lié à son co-détenu par un collier explosif. Le redoutable système se déclenche simultanément dès qu\'un prisonnier s\'éloigne de son partenaire d\'infortune. Lorsque Frank apprend que Tracy Little est sa nouvelle co-équipière, ils décident de s\'évader ensemble.', 'Spectacor Films', 'https://image.tmdb.org/t/p/w1280/oGJOvLP3Jk6hRdkTeLfeSGef0Ok.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//npnbvNO28udi5EfL0ompXf2KL8Z.jpg', 'https://www.youtube.com/embed/B6hGvRSQJaw', 101, '1991', 2.87, 1),
(2200, 'Czechoslovakia', 'Jacob le menteur', 'Dans le ghetto juif d\'une petite ville polonaise, Jakob Heym est arrêté pour n\'avoir pas respecté le couvre-feu. Dans la salle de garde, il entend à la radio que l\'Armée rouge, est proche : espérance inopinée. Pour redonner espoir à ses compagnons d\'infortune déportés par vagues successives, Jakob affirme détenir une radio, ce qui est strictement interdit. Pris au piège de son mensonge, il doit inventer jour après jour des nouvelles. Jakob devient un héros jusqu\'à ce qu\'il soit rejoint par son destin.', 'DEFA', 'https://image.tmdb.org/t/p/w1280/f1l7ANZgiBNbdztxpUgYl7OK0Qb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//64CkfRtM8X1haK9JvkWBgPeoVRF.jpg', 'https://www.youtube.com/embed/', 96, '1975', 3.6, 1),
(2202, 'United States of America', 'Fidèle Lassie', 'Par manque de moyens pour l\'entretenir, les Carraclough, une famille de fermiers, sont obligés de vendre leur brave chienne Lassie qui se retrouve chez le duc de Rudling, dans une autre région d\'Angleterre. Mais la chienne s\'enfuit et tente de retrouver le chemin de la maison ...', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/nCZbjo5NvfO0sFx2nrUeQYe7Ply.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yzf3b8zFC2ol90eGL0VySETR94K.jpg', 'https://www.youtube.com/embed/', 89, '1943', 3.39, 1),
(2300, 'United States of America', 'Space Jam', 'Bugs Bunny et ses amis font appel à une légende du basket pour défier une équipe d\'extraterrestres sur le terrain.', 'Warner Bros. Pictures', 'https://image.tmdb.org/t/p/w1280/oAdHWUSnlpYy1oX31ujqrLcrnEX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xIoWDHSA2ymOewcCpoUID4PpDb3.jpg', 'https://www.youtube.com/embed/zeg1IiqnZ7Y', 88, '1996', 3.42, 1),
(2301, 'Germany', 'Collin', '', 'Windrose Film- und Fernsehproduktion', 'https://image.tmdb.org/t/p/w1280/xYqAfCDhdNjChTIlrIRg72LwkuB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 181, '1981', 5, 1),
(2302, 'United States of America', 'Avalon', 'Une famille d\'immigrés juifs débarque aux eats-Unis au début du 20e siècle afin de trouver de meilleures conditions de vie.', 'TriStar Pictures', 'https://image.tmdb.org/t/p/w1280/mcexRwLvIV3ralF7jZTlAaSwes4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mbkvzsl53rdwzkfxdOnQDaOA44X.jpg', 'https://www.youtube.com/embed/b37auo3dSuM', 126, '1990', 3.28, 1),
(2303, 'Germany', 'Gespräch mit dem Biest', '', 'Rudolf Steiner TV/Film Produktion & Consult GmbH', 'https://image.tmdb.org/t/p/w1280/dn9SmbgxHROjQd1WDSpbdRc82QC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 95, '1997', 0, 1),
(2304, 'France', 'The Wounded Man', 'Henri is a lonely, isolated young man who lets no one get close to him. He meets a street hustler and comes out of his shell, going 180 degrees into gay obsession. Though he has yet to physically approach the object of his affection, Henri builds up so much unrequited lust that it explodes with horrible results.', 'France 3 Cinéma', 'https://image.tmdb.org/t/p/w1280/bZlCceaqycJo5mtheTpm3v6qxbs.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//hFZ9KW2RHcPL5tcrwWPYYMRAi6f.jpg', 'https://www.youtube.com/embed/2L1ooVmp75k', 109, '1983', 2.75, 1),
(2306, 'Austria', 'Welcome in Vienna - Partie 1 : Dieu ne croit plus en nous', 'Vienne 1938 : après la Nuit de Cristal et le meurtre de son père par les nazis, Ferry Tobler, un adolescent juif, fuit l\'Autriche. Avec un laissez-passer difficilement acquis, il échoue à Prague. Là, Il y fait la connaissance de Gandhi, soldat allemand anti-nazi échappé de Dachau, et d\'Alena, une tchèque chargée d\'assister les réfugiés. Ensemble et avec d\'autres immigrants juifs, ils parviennent jusqu\'à Paris. Mais, sans papiers, ils sont arrêtés et internés par les autorités françaises dans le camp de rétention de Saint-Just-en-Chaussée. Profitant du chaos qui suit l\'invasion allemande, ils s\'échappent et tentent de rejoindre Marseille dans l\'espoir de s\'embarquer pour les Etats-Unis.', 'ORF', 'https://image.tmdb.org/t/p/w1280/a0Hvq5YfECyaqNWL9QrfxvuhGdT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/_ZFRMgkdgbU', 115, '1982', 3.55, 1),
(2307, 'United States of America', 'A Pyromaniac\'s Love Story', '', 'Hollywood Pictures', 'https://image.tmdb.org/t/p/w1280/9pU8aNS1wEXVGNR9WnsX2O3w9qF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 94, '1995', 2.5, 1),
(2309, 'United States of America', 'Cœur d\'encre', 'Mortimer (alias Mo) et Meggie forment une famille heureuse, et sont férus de lecture. Mo possède cependant un don. En effet, lorsqu’il lit un livre à voix haute, les personnages et les objets issus de l\'histoire prennent forme dans le monde réel. Mais ce pouvoir magique respecte le principe de l\'échange-équivalent et lorsque quelque chose ou quelqu\'un vient dans notre monde, quelque chose voire quelqu\'un doit prendre sa place dans le livre...', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/pUApLGPVuu15noWjGSsGKjiggSy.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mtxWo485jB3GeK3UxbfaguNtpU2.jpg', 'https://www.youtube.com/embed/evtROJ0mn-c', 107, '2008', 3.14, 1),
(2310, 'United States of America', 'La Légende de Beowulf', 'En ces temps lointains, les sauvages contrées du Nord de l\'Europe étaient peuplées de héros et de monstres, et des hommes audacieux, taillés pour la lutte et les conquêtes, pouvaient encore se forger des destins d\'exception. Le plus glorieux d\'entre ces aventuriers fut le Viking Beowulf, qui surgit un beau jour pour sauver le vieux roi Hrothgar et ses sujets des assauts d\'une féroce créature. Son nom devint vite légendaire à travers le royaume et, partout, l\'on chanta sa bravoure face au maléfique Grendel. Beowulf ne devint pas seulement célèbre, mais riche. Et avec la richesse vinrent bientôt de dangereuses tentations et une inextinguible soif de pouvoir. Car le héros était aussi humain, trop humain, sans doute, et le guerrier plus avide, plus ambitieux et bien plus faillible qu\'on ne l\'imaginait...', 'Paramount', 'https://image.tmdb.org/t/p/w1280/cq3FPhKCeCGI2XIbAgaUkiMbLsY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rg95KykzGaiFqAonoHLmXzjlW4q.jpg', 'https://www.youtube.com/embed/', 115, '2007', 2.94, 1),
(2400, 'France', 'Eugénie Grandet', 'Madame Grandet et la jeune Eugénie vivent près de Saumur, dans l\'ombre du père Grandet, homme autoritaire et avare, respecté de tous pour son immense fortune. En tant qu\'héritière, Eugénie est l\'objet de la cupidité de deux familles voisines. Quand arrive à l\'improviste le cousin Charles, dont le père vient de faire faillite, Eugénie s\'éprend de lui. Partant tenter sa chance aux Indes, le jeune homme fait alors le serment de lui être éternellement fidèle.', 'France 3', 'https://image.tmdb.org/t/p/w1280/2Nrj3BZQnIBF7P3V6v4Gm7VET5e.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 82, '1994', 0, 1),
(2501, 'United States of America', 'La Mémoire dans la peau', 'Un homme entre la vie et la mort est tiré de l’océan par un bateau de pêche italien. Ayant retrouvé ses esprits, il se rend compte qu’il souffre d’amnésie totale et qu’il n’a sur lui aucun papier d’identité. Les nombreux talents qu’il se découvre, techniques de combat et connaissances de plusieurs langues, lui suggèrent un passé dangereux. Aidé de la d’abord récalcitrante Marie, il s’engage dans une recherche désespérée pour retrouver son identité et la raison qui pousse d’impitoyables assassins à le traquer.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/fhY7ry0Ljsfg4HSJzB7bnJ0xPnc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uSkcH2bcDBkUZCZMPcLSzaMY0td.jpg', 'https://www.youtube.com/embed/zTRMFgZK4oE', 118, '2002', 3.73, 1),
(2502, 'Germany', 'La Mort dans la peau', 'Depuis deux ans, l’ex‐agent / tueur à gages de la CIA Jason Bourne et sa compagne Marie ont réussi à tromper leurs poursuivants au prix d’une vigilance sans faille. Ce paisible village de Goa aurait dû être leur dernier refuge. Vain espoir. Deux ans plus tôt, Jason avait juré de se venger de quiconque le relancerait. Il tiendra parole.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/7pXKWSHGVb9eHoXgEZZnRZVM3gi.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fE7RqvVHbGHjBC9NjIjlLh2t4zK.jpg', 'https://www.youtube.com/embed/zsrdBGr8NIk', 108, '2004', 3.65, 1),
(2503, 'France', 'La Vengeance dans la peau', 'Jason Bourne vit tranquillement maintenant. Mais le département de la Défense lance en grand secret un second programme encore plus sophistiqué : Blackbriar, visant à fabriquer une nouvelle génération de tueurs supérieurement entraînés. Jason est, pour le directeur des opérations spéciales, une menace et une tache à effacer au plus vite. Ordre est donné de le supprimer. La traque recommence : Moscou, Paris, Madrid, Londres, Tanger et New York.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/otHGLrjjyHK8BQ8RQRe6d6IKLWn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qiBILuWhv7ipF0pxiEqIJdkQzj8.jpg', 'https://www.youtube.com/embed/wftAmNH0Qh0', 115, '2007', 3.71, 1),
(2516, 'United Kingdom', 'Chaque soir à neuf heures', 'Ils sont sept enfants de 4 à 13 ans qui vivent avec leur mère dans une petite maison de la banlieue de Londres. Mais lorsque celle-ci meurt, les enfants, craignant d\'être envoyés à l\'orphelinat, cache le décès aux yeux de tous. Chaque soir à neuf heures, ils se recueillent dans l\'abri de jardin où ils l\'ont enterré. Un jour, leur père disparu depuis des années refait surface. Et son penchant pour l\'alcool va bouleverser l\'équilibre de la petite communauté.', 'Filmways Pictures', 'https://image.tmdb.org/t/p/w1280/nHC0b6UUwIk5PuettUTfxankH3t.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5NSTd8UFpLK57h8Ji5oYdgklKsg.jpg', 'https://www.youtube.com/embed/tv-RblxoRqE', 104, '1967', 3.5, 1),
(2517, 'Japan', 'Nobody knows', 'Quatre frères et soeurs vivent avec leur mère. L\'ainé, Akira, s\'occupe de ses jeunes frères et soeurs, chacun d\'un père différent. Un matin d\'hiver, leur mère disparaît et les enfants commencent à vivre seuls.', 'Engine Film', 'https://image.tmdb.org/t/p/w1280/wTogch5mkGjrK9qnx1C22JwiE66.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dTL3unDQ9J3opvmjeSNC8MPUk5V.jpg', 'https://www.youtube.com/embed/Ig4as8PCBtY', 141, '2004', 3.99, 1),
(2525, 'Italy', 'The Bible: In the Beginning...', 'Extravagant production of the first part of the book of Genesis. Covers Adam and Eve, Noah and the Flood and Abraham and Isaac.', 'Thalia AG', 'https://image.tmdb.org/t/p/w1280/2BtesvzFQJYFS2sPVVbUdet0TTC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6xBqZoj40gIAyLSuemwI38c6OID.jpg', 'https://www.youtube.com/embed/uDrSn0wrJTU', 174, '1966', 3.65, 1),
(2604, 'United States of America', 'Né un 4 juillet', 'Ron Kovic, né un 4 juillet, au jour de l\'Indépendance, et fervent patriote, est volontaire pour se battre au Viêt Nam. Il en revient paraplégique et remet en question ses valeurs sur la guerre.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/is9ZZxhUGA7MscRsfwBFwG6e6Vo.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gjZFMKtoJdpEDt3T0dnoiMfXYof.jpg', 'https://www.youtube.com/embed/9hToJljcFnA', 145, '1989', 3.5, 1),
(2605, 'United States of America', 'Short Circuit', 'Robot participant à une expérience scientifique, Numéro 5 développe une intelligence artificielle et des caractéristiques humaines après un court-circuit. Il essaie d\'échapper à son condition de robot et s\'enfuit. Les autorités organisent alors la traque...', 'David Foster Productions', 'https://image.tmdb.org/t/p/w1280/7cTm9f3qxvn6lFlVnO26sYyTfct.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dNt0qZTGIFntUcXfGASLrRcz3Xw.jpg', 'https://www.youtube.com/embed/', 98, '1986', 3.28, 1),
(2608, 'United States of America', 'Maid to Order', '', 'The Vista Organization', 'https://image.tmdb.org/t/p/w1280/l5XNXwjRieKMixWL7rGgtLANf75.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//eO8tgebmtaQKIrmIBzmGWSHoAy8.jpg', 'https://www.youtube.com/embed/', 93, '1987', 2.88, 1),
(2609, 'United States of America', 'Un ticket pour deux', 'À deux jours de Thanksgiving, Neal Page se prépare à rejoindre sa femme à Chicago afin de passer les fêtes en famille. Mais le mauvais temps est de la partie, l\'avion est annulé, et Neal se trouve affublé d\'un compagnon d\'infortune, Del Griffith, sympathique mais bavard vendeur de rideaux de douche, qui ne semble pas décidé à le lâcher ...', 'Paramount', 'https://image.tmdb.org/t/p/w1280/aRegNTVa6QyxrQn8uQVYT0eixj7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tbgf0S955FdGrvfZvxsgia7spL3.jpg', 'https://www.youtube.com/embed/', 93, '1987', 3.62, 1),
(2610, 'United States of America', 'Shopgirl', 'Mirabelle, vendeuse au rayon gants chez Saks à Bervely Hills, est une jeune femme désabusée qui n\'aspire qu\'à devenir artiste. Elle a deux hommes dans sa vie : Ray Porter, un riche quinquagénaire divorcé qui a choisi de mener une vie de célibataire sans engagement, et Jeremy, un jeune musicien un peu paumé. Mirabelle réalise peu à peu qu\'elle va devoir choisir entre l\'un ou l\'autre.', 'Touchstone Pictures', 'https://image.tmdb.org/t/p/w1280/vLfPXJh7M0RYBUzHBHP9H1tTQs5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qXpH9cCA8LUJzCgnveciovBYcmr.jpg', 'https://www.youtube.com/embed/', 104, '2005', 2.91, 1),
(2611, 'United States of America', 'Ta mère ou moi', 'Dany Muldoon est un policier newyorkais qui a toujours vécu avec sa mère, légèrement possessive. Lorsqu\'il rencontre Theresa, une jeune et timide jeune femme, il va devoir prendre sur lui pour se sortir du cocon maternel.', 'Hughes Entertainment', 'https://image.tmdb.org/t/p/w1280/rywiWeYxDuv492zcG8zO3J9Vmlv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//iEuHQGXpiBDo2s6amcxNuKaYr5E.jpg', 'https://www.youtube.com/embed/', 104, '1991', 3.02, 1),
(2612, 'United States of America', 'Monsieur Destinée', 'Le jour de ses 35 ans, Larry n\'est pas à la fête et accumule les ennuis. Il décide d\'aller boire un verre et raconte ses problèmes au barman. Ce dernier lui sert un cocktail magique, et pour Larry commence une nouvelle vie prometteuse.', 'Touchstone Pictures', 'https://image.tmdb.org/t/p/w1280/57TBocyB5XyFX0ImGe9lOZJLwrd.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uyk6e6zEBB4JB6rtmhQPThaWclH.jpg', 'https://www.youtube.com/embed/', 100, '1990', 3.09, 1),
(2613, 'United States of America', 'Le Baiser empoisonné', 'Le jour de son mariage, une jeune femme reçoit le baiser d\'un étrange vieillard qu\'elle ne connait pas. A ce moment précis, l\'âme de ce dernier va investir le corps de cette jeune mariée. Et c\'est avec un caractère de cochon que le jeune marié va devoir apprendre à vivre.', 'Gruskoff/Levy Company', 'https://image.tmdb.org/t/p/w1280/2jircyuuGwx7OtFcSMVVXW0fNvv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//l7Qi8DAsPfiqejik3C71d8qLyl4.jpg', 'https://www.youtube.com/embed/', 105, '1992', 2.82, 1),
(2614, 'United States of America', 'L\'Aventure intérieure', 'Forte tête de la marine américaine, le lieutenant Tuck Pendelton se porte volontaire pour une expérience très risquée. Miniaturisé, aux commandes d\'un submersible de poche, il va être injecté dans l\'organisme d\'un lapin. Mais des espions industriels s\'emparent de la puce qui peut inverser le processus. C\'est alors que Tuck se trouve propulsé dans le corps d\'un modeste employé de supermarché. Il va devoir convaincre son hôte de le sortir de là !', 'Amblin Entertainment', 'https://image.tmdb.org/t/p/w1280/5qKham6cfFf6Xq2XA9vHYonYgXy.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cDEseDgCAYCEUT6q1n0U742X3tZ.jpg', 'https://www.youtube.com/embed/HLAbTbGQcr8', 120, '1987', 3.42, 1),
(2616, 'United States of America', 'L\'oncle Buck', 'Après que son père ait eu une crise cardiaque, un couple cherche une baby-sitter afin de se rendre à son chevet. Par dépit, ils doivent demander à l\'oncle Buck, un célibataire endurci très gentil mais également très maladroit. Pour sa première nuit de baby-sitting, il va devoir affronter les conséquences de sa vie privée mouvementée, les caprices de deux jeunes enfants et la rébellion d\'un adolescent de 15 ans.', 'Hughes Entertainment', 'https://image.tmdb.org/t/p/w1280/hMrWe2LdiZHitc7I0VCP7vhWeO0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nc68w1Fa30btNaU6aR3k5gkTn9k.jpg', 'https://www.youtube.com/embed/', 99, '1989', 3.39, 1),
(2617, 'United States of America', 'Vacances très mouvementées', 'Chet est un père de famille attentionné qui décide de partir avec sa femme et ses enfants en vacance à la montagne prendre le bon air. Mais, ces vacances familiales vont se transformer en vrai désastre quand on beau-frère maladroit et collant débarque lui-aussi avec femme et enfants.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/etjgNJvuNW2205EdZRMHFPKQpxS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//zkURY6E83XO6M6E7mAyGQRqg57E.jpg', 'https://www.youtube.com/embed/', 91, '1988', 3.22, 1),
(2619, 'United States of America', 'Splash', 'Allen Bauer, un accro au travail, est convaincu qu’il ne peut pas tomber amoureux, jusqu’à ce qu’il soit sauvé par la sirène de ses rêves. Allen et Madison vont être pris dans une romance drôle et émouvante.', 'Touchstone Pictures', 'https://image.tmdb.org/t/p/w1280/1IuoLxTYKUQA4Dktomx0z391MAf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5nMdiUoG8e7cQuo2XFx9D2aHWeR.jpg', 'https://www.youtube.com/embed/', 111, '1984', 3.12, 1),
(2620, 'United States of America', 'Armed and Dangerous', 'Dooley, un policier, et Kane, un avocat démis de leurs fonctions se font engager dans une entreprise de sécurité où ils deviennent partenaires. Bientôt, Dooley suspecte que les sommes qu\'ils sont obligés de verser à leur syndicat sont utilisées à des fins douteuses …', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/48pWtaTngOHkq2xOc8pFAoro1fU.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rjVEWrIcBHa22BwbDrI1FMPY7FB.jpg', 'https://www.youtube.com/embed/', 88, '1986', 2.82, 1);
INSERT INTO `films` (`id_film`, `film_city`, `film_titre`, `film_description`, `film_realisateur`, `film_cover_image`, `film_back_image`, `film_trailer`, `film_duree`, `film_date`, `film_popularity`, `film_value`) VALUES
(2621, 'United States of America', 'Droit au cœur', 'Bob Rueland et sa femme Elizabeth forment un couple parfait, aimé et apprecié de tous. Lorsque Elizabeth meurt dans un accident de la circulation, Bob est fou de chagrin et de douleur. Quelques heures après sa mort, le coeur d\'Elizabeth est transplanté dans le corps de Grace Briggs, qui renaît ainsi à la vie. Un an plus tard, Bob n\'a pas encore fait son deuil, en dépit des efforts de son ami Charlie pour l\'arracher à sa solitude. Un soir, pourtant, il accepte de diner avec lui au restaurant. Il y rencontre Grace. C\'est le coup de foudre. Leur amour est-il possible ?', 'JLT Productions', 'https://image.tmdb.org/t/p/w1280/qvfaAQBC9sG0uelasG09WuzDfF5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//oNOJoW2XoH3shkQxHtOyacJRBCQ.jpg', 'https://www.youtube.com/embed/', 115, '2000', 3.3, 1),
(2623, 'United States of America', 'Officier et Gentleman', 'Fils d\'un sous-officier de marine alcoolique et dépravé, Zack Mayo connaît une enfance difficile, aux Philippines, en compagnie d\'un père qu\'il méprise. Il s\'inscrit au programme de formation des officiers de l\'aéronavale pour échapper à sa sordide condition.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/7xaGeNgsx9X0Yw4q9Iz8c04ibkn.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xzyHYTcN4RPqk7gPzuguPFIjsG1.jpg', 'https://www.youtube.com/embed/vMjJ62_Lr9I', 124, '1982', 3.51, 1),
(2625, 'United States of America', 'Mister Jones', 'Généreux, attachant, plein de charme, Mr. Jones est un homme exceptionnel. Cependant il souffre d\'une maladie psychique que les médecins appellent une psychose maniaco-dépressive qui l\'entraine parfois à des actes inconsidérés, mettant en danger sa propre sécurité et celle des autres. Apres un excès d\'enthousiasme pour Beethoven, il se retrouve a l\'hopital psychiatrique où le docteur Elizabeth Bowen le prend en charge. C\'est le debut de la guérison et d\'une belle histoire d\'amour!', 'TriStar Pictures', 'https://image.tmdb.org/t/p/w1280/rmAnfar51B0qSQ1Wkix0iKtUUnx.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cvtHD8gxuHyLtF6M8ZN2QPWxOYr.jpg', 'https://www.youtube.com/embed/oc7XozMbR9A', 114, '1993', 2.87, 1),
(2636, 'Peru', 'L\'Expert', 'Désireuse de se venger des assassins de ses parents, tués sous ses yeux alors qu\'elle n\'était qu\'une enfant, la troublante May Munro recourt aux services de Ray Quick, ancien membre des Services spéciaux américains.', 'Jerry Weintraub Productions', 'https://image.tmdb.org/t/p/w1280/lPXWRrIN1VFA1Ovj2O6164x0C7V.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//etfxKjfs1BE5HRpEuYfjFsZJA0k.jpg', 'https://www.youtube.com/embed/Y6Ox25NdFbE', 110, '1994', 2.93, 1),
(2637, 'United States of America', 'La Prophétie des ombres', 'Le 5 septembre, à Washington DC, avant de mourir, la femme du journaliste John Klein raconte à son mari avoir vu une silhouette étrange. Le 12 novembre, à Point Pleasant, en Virginie, ce dernier s\'aperçoit, après enquête, que plusieurs personnes de cette petite ville ont été témoins de la même apparition... et que toutes sont décédées. \"Créature étrange\", \"regard glaçant\", \"grandes ailes\", ces indications semblent décrire un spectre diabolique que seules les personnes qui vont mourir aperçoivent. Le 28 novembre, à Denver, dans le Colorado, la silhouette apparaît et 99 personnes périssent. Le 10 décembre, à Point Pleasant, la silhouette de mauvaise augure se manifeste à nouveau... Annonce-t-elle une catastrophe ? La psychose commence.', 'Screen Gems', 'https://image.tmdb.org/t/p/w1280/nVbStvVMvsz7uME9ezki2dDpoyJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6FSoZZTwYYrhs5lWdLhj9FCPtT9.jpg', 'https://www.youtube.com/embed/', 119, '2002', 3.09, 1),
(2639, 'United States of America', 'Harry dans tous ses états', 'Harry, auteur célèbre en panne d\'inspiration, est invité par son ancienne université, dont il fut jadis viré, pour un hommage. Il est brouillé avec tout le monde, ses femmes, ses maîtresses, ses psys et ne trouve pour l\'accompagner à la cérémonie que Cookie, une prostituée noire, Richard, son ami cardiaque et Hilly, son jeune fils, qu\'il a enlevé à la sortie de l\'école.', 'Fine Line Features', 'https://image.tmdb.org/t/p/w1280/qSZHbERQk8lG7zuDMkh9hl1JOmz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//f8Q3Sug5Sa42psw2b3Gdd1aT8t.jpg', 'https://www.youtube.com/embed/WwXOol3hRUg', 96, '1997', 3.66, 1),
(2640, 'United States of America', 'Fatal Games', 'Trois filles de riches chacune prénommée Heather sont les reines du lycée de Westerburg. Elles acceptent néanmoins dans leur clan Veronica, dont elles exploitent la candeur et la naïveté. Celle-ci, sous l\'influence de J.D., un autre jeune marginalisé, organise une petite vengeance qui va mal tourner...', 'New World Pictures', 'https://image.tmdb.org/t/p/w1280/dGbVfM4WlM7uvIbyRehfPZUIgp2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5pLaYZGbweHYULiNiRehPxYuUnn.jpg', 'https://www.youtube.com/embed/', 103, '1989', 3.66, 1),
(2642, 'Australia', 'L\'Amour sans préavis', 'Le millionnaire Georges Wade ne prend aucune décision sans consulter Lucy Kelson, sa conseillère multi-fonction en chef à la Wade Corporation. Brillante avocate et fin stratège, elle a aussi un ulcère et ne dort pas beaucoup. Ce n\'est pas son travail qui en est la cause mais George. Intelligent, charmeur et totalement centré sur lui-même, il la traite plus comme sa nourrice que comme une avocate sortant de Harvard. Aujourd\'hui, après avoir tout régi pendant cinq ans, de ses vêtements à son divorce, Lucy Kelson a décidé de démissionner. George accepte l\'idée de son départ de la Wade Corporation à la condition qu\'elle se trouve une remplaçante. Au bout d\'une recherche non sans difficultés, elle engage June Carter, une jeune avocate ambitieuse qui, très vite, ne cache pas ses visées sur son riche nouveau patron...', 'Fortis Films', 'https://image.tmdb.org/t/p/w1280/2TjYOdnxCePqs7UERkdr9ElLVT1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//owRq5hVmyLv8pNx3Kn1dmE6AQOm.jpg', 'https://www.youtube.com/embed/zYik5pS6ANQ', 101, '2002', 3.18, 1),
(2644, 'Hong Kong', 'Mad Mission', 'Sam, alias Gant blanc vole des diamants à la mafia. Langue Chaude et Kody Jack, un inspecteur gaffeur new-yorkais sont chargés de l\'enquète. Sam doit faire équipe avec la police afin d\'échapper à la mafia.', 'Cinema City & Films Co.', 'https://image.tmdb.org/t/p/w1280/nhxerreZTXbvmgfjP3AfeEmxuEs.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wUfM71xLbKV9YbEtuBc3DfjgMia.jpg', 'https://www.youtube.com/embed/', 93, '1982', 3.27, 1),
(2645, 'Hong Kong', 'Mad mission 2 - Les robots', 'Un assassin appelé Filthy Harry est embauché par une silhouette louche et chargé de tuer les héros. Les deux hommes sont encadrés deux fois pour des vols différents par la nouvelle petite amie de King Kong, presque engagés dans un hôpital psychiatrique par leur patron sournois, et contraints de combattre le robot chargé d\'armes de Filthy Harry alors qu\'ils sont couverts de bombes à retardement.', 'Cinema City & Films Co.', 'https://image.tmdb.org/t/p/w1280/5oH9EbVv6eogQPXhKoABHskqmWL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tcdNI5PUOyDTVWYRn11jztcYHAW.jpg', 'https://www.youtube.com/embed/', 100, '1983', 3.19, 1),
(2800, 'Germany', 'La rumeur court…', 'Sarah a accepté la demande en mariage de son compagnon, mais est terrifiée à l\'idée de passer à l\'acte. Pour comble de malheur, sa soeur Annie s\'apprête à convoler avec un tennisman, obligeant du même coup Sarah à passer un week-end dans ce faubourg ultra-chic de Pasadena qu\'elle déteste... et à affronter une famille dont elle se considère comme le mouton noir.Seule consolation : revoir son alerte grand-mère Katharine, dont les rosseries, l\'humour gaulois et les \"conseils\" tordus l\'enchantent. Et cette année, Mamie a quelque chose à lui apprendre. La rumeur court en effet que Katharine et la défunte mère de Sarah auraient été les modèles de Mrs. Robinson et sa fille et rivale Elaine dans le roman et le film Le Lauréat. Du coup, Sarah commence à s\'interroger sur sa propre identité...', 'Village Roadshow Pictures', 'https://image.tmdb.org/t/p/w1280/oPTjddyDsKx3vVlraWU8LmXVtl7.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gHyylG9wLbTLRfmlOfn9PDEeLgR.jpg', 'https://www.youtube.com/embed/coly9nMtQ00', 96, '2005', 2.81, 1),
(2802, 'Netherlands', 'De Arm Van Jezus', '', 'Riba Filmproductions', 'https://image.tmdb.org/t/p/w1280/fMOVSKNF5FwWZrcg37ecTvBLZc5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 70, '2003', 0, 1),
(2900, 'United States of America', 'Intrusion', 'Spencer Armacost, astronaute à la NASA et Jillian, sa femme, sont passionnément amoureux l\'un de l\'autre et la distance qui les sépare au cours des voyages de Spencer semble encore les rapprocher. Or un jour au cours d\'une mission spatiale de routine, une explosion survient et le contact entre la navette spatiale et la Terre est rompu pendant deux minutes. Quand Spencer retourne sur Terre, malgré sa joie, Jillian reste inquiète. Elle est sujette à de sombres pensées et d\'affreux cauchemars. C\'est alors qu\'elle découvre qu\'elle attend des jumeaux.', 'New Line Cinema', 'https://image.tmdb.org/t/p/w1280/zXTjHghe76InGKVwbaLqZkwSQsZ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6WLXXpntALn42Is3hwxKeUzUujQ.jpg', 'https://www.youtube.com/embed/pu_TmXgGEG8', 104, '1999', 2.8, 1),
(3001, 'United States of America', 'How to Steal a Million', 'A woman must steal a statue from a Paris museum to help conceal her father\'s art forgeries.', 'World Wide Productions', 'https://image.tmdb.org/t/p/w1280/xaf3pwmITJvfz9Ab8DiGM8OOtBC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lX5nHKBnF35dzTzYNavCBrZ6twU.jpg', 'https://www.youtube.com/embed/UPStHOzjQWU', 123, '1966', 3.75, 1),
(3002, 'United States of America', 'The Lost World', '', 'The Over the Hill Gang', 'https://image.tmdb.org/t/p/w1280/tPeFZ847p7M6gnmeqcPekxtLsrt.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//A25GFydnHf5Kt2OrvfzlR5L6jDL.jpg', 'https://www.youtube.com/embed/', 92, '1999', 2.9, 1),
(3003, 'Germany', 'Le monde interdit', 'Londres, 1911. Une conférence paléontologique tenue par le professeur Summerlee est interrompue par le professeur Challenger, tout juste rentré d\'une expédition en Amérique du Sud. Ce dernier avance l\'hypothèse de l\'existence de dinosaures vivants quelque part en Amazonie, sur un plateau encore inconnu et inexploré de l\'Homme. Malgré la risée de l\'assemblée, il fait alors part de son projet d\'expédition pour repartir sur place et découvrir ce « monde perdu ».  Se joignent au voyage de Challenger le journaliste Edward Malone, le chasseur Lord John Roxton et le professeur Summerlee lui-même (qui, armé de son esprit critique académique, n\'attend qu\'une occasion pour prouver la supercherie de son confrère). Le jeune Malone s\'embarque surtout pour sa fiancée Gladys, qu\'il aimerait à tout prix séduire en lui prouvant sa valeur par un acte héroïque.', 'RTL', 'https://image.tmdb.org/t/p/w1280/22PtJeHtI19j15nkQiM561Ng7cH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mSbm5ImUlZd029dRkoAGNAi7nKq.jpg', 'https://www.youtube.com/embed/', 145, '2001', 2.96, 1),
(3004, 'France', '12 + 1', '', 'Compagnia Generale Finanziaria Cinematografica', 'https://image.tmdb.org/t/p/w1280/rArtk4TQpPJRfsy5TuE2R3NiNtc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dk5swBO7et0usbxehhkCGPokoZe.jpg', 'https://www.youtube.com/embed/', 94, '1969', 2.7, 1),
(3006, 'United States of America', 'Dr. Jekyll and Mr. Hyde', 'Le docteur Henry Jekyll trouve par des moyens scientifiques la façon de révéler le côté caché et sombre de l\'homme et libère ainsi un meurtrier qui sommeillait en lui-même.', 'Selig Polyscope Company', 'https://image.tmdb.org/t/p/w1280/hYArtU4tx01bOBeBLrkH1lY4VGb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 16, '1908', 0, 1),
(3007, 'Germany', 'La Femme sur la Lune', 'Un scientifique découvre qu\'il y a de l\'or sur la lune. Il construit une fusée pour y aller mais il y a trop de rivalité au sein de l\'équipe pour que l\'expédition soit couronnée de succès.', 'UFA', 'https://image.tmdb.org/t/p/w1280/68nJct7M76m8CQK4Uaq6u4lCSzc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vvC208hrWqHvh6VnbxXFZ58DI6l.jpg', 'https://www.youtube.com/embed/', 169, '1929', 3.65, 1),
(3008, 'Spain', 'Dix heures et demi du soir en été', 'Poussé à bout, Palestra tue sa femme infidèle dans un excès de rage. Traqué par la police, il se réfugie dans un petit hôtel où Maria tente de l\'aider. Maria elle aussi trompée par son mari, Maria qui s\'est réfugiée dans l\'alcool... Tandis que l\'étau policier se resserre inéluctablement autour d\'eux, L\'assassin et sa protectrice vivent des heures inoubliables.', 'Jorilie', 'https://image.tmdb.org/t/p/w1280/75HF5TuNEk1O2nWkV1U15nJprhz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4k8KQZyzdu9M77JVXNAivPMcRFn.jpg', 'https://www.youtube.com/embed/', 85, '1966', 2.8, 1),
(3009, 'France', 'Le Procès', 'Joseph K, petit fonctionnaire besogneux et sûr de son bon droit, suit sans se poser de questions une vie dont les lignes sont déjà toutes tracées. Un matin, il est mis en « état d\'arrestation », selon la formule consacrée, et ce sans raison apparente. Cherchant à comprendre, Joseph K, plongé dans le labyrinthe de l\'appareil judiciaire, se heurte à la bureaucratie, où l\'absurde le guette à chaque instant. Peu à peu, il entrevoit la terrible vérité : on lui reproche simplement sa qualité d\'homme. Mais Joseph K ne se résigne pas à être broyé par une société inhumaine…', 'Hisa-Film', 'https://image.tmdb.org/t/p/w1280/w1vwBkKQT4M6po5OwfvjIho4okp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ciC1MRPPcvCpULFRh0FvSvdgKeX.jpg', 'https://www.youtube.com/embed/', 122, '1962', 3.74, 1),
(3010, 'United States of America', 'Le Cardinal', 'A Rome en 1939, Stephen Fermoyle est ordonné cardinal. A cette occasion, il se souvient des principales étapes de sa vie. Natif de Boston, il seconde en 1917 le responsable d\'une petite paroisse. Mais l\'archevêque Glennon l\'envoie au fin fond du Canada, où il devient le secrétaire particulier d\'un prêtre malade. Lorsque sa soeur meurt en couche, il décide de retourner à la vie laïque.', 'Otto Preminger Films', 'https://image.tmdb.org/t/p/w1280/ozOIhI5rv1H7YFzPFdZXMghYxqL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qmSndmoRi5s3F4zTZpVvBIYcmTc.jpg', 'https://www.youtube.com/embed/', 175, '1963', 3.27, 1),
(3011, 'United States of America', 'Prête-moi ton mari', 'Sam, publiciste, reussit a obtenir le budget d\'un client grace a la confiance qu\'il inspire a celui-ci par le calme de sa vie de couple. Mais l\'arrivee de Janet, une amie d\'enfance de sa femme qui a besoin de lui pour le faire passer pour son mari et toucher un heritage, va plonger la vie du pauvre Sam dans un desordre complet.', 'Columbia Pictures', 'https://image.tmdb.org/t/p/w1280/vOyKPfJKzoVlFMWAZJSORYqynRG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//AjAh4kC9EPmbM4EuyQpM0TCGkIR.jpg', 'https://www.youtube.com/embed/', 130, '1964', 3.35, 1),
(3012, 'United Kingdom', 'Les vainqueurs', 'L\'histoire suit les pas d\'un bataillon de jeunes soldats américains aux premiers jours de la Bataille d\'Angleterre, à travers les violents combats en Italie et en France, jusqu\'à la paix difficile, à Berlin. Le film est une suite de brèves histoires cruelles, qui illustrent les épreuves qui attendent les deux jeunes Américains en faction, lors d\'une alerte à Londres.', 'Highroad Productions', 'https://image.tmdb.org/t/p/w1280/hf75NRJBrDQgo2Y7MkXcPopGOFy.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dYCmzdD0INOsNRoJOjqCLsirl4M.jpg', 'https://www.youtube.com/embed/', 146, '1963', 3.4, 1),
(3013, 'Germany', 'Liés par le sang', 'Héritière d\'une importante firme pharmaceutique Suisse, Elizabeth Roffe s\'aperçoit que des membres de sa famille sont prêts à tout pour l\'évincer. Un inspecteur est alors chargé de l\'enquête ...', 'NF Geria III-Produktion München', 'https://image.tmdb.org/t/p/w1280/bMiBusE5lhrZN0z4DXHlg3LXkSf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//AvvmBWw7X9Fh6tg1LsHm9KoyXbL.jpg', 'https://www.youtube.com/embed/', 116, '1979', 2.35, 1),
(3014, 'United Kingdom', 'The Man Between', 'A British woman on a visit to post-war Berlin is caught up in an espionage ring smuggling secrets into and out of the Eastern Bloc.', 'London Films Productions', 'https://image.tmdb.org/t/p/w1280/83iaJPA6MquVGPBNSopDuIURYNe.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rBOntYgK9u7k51RKvktcWxitnXV.jpg', 'https://www.youtube.com/embed/', 100, '1953', 3.5, 1),
(3015, 'Germany', 'Der Januskopf', '', 'Lipow-Film', 'https://image.tmdb.org/t/p/w1280', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//j47aNKg3pdvJ2jM66RxjLWb4Aty.jpg', 'https://www.youtube.com/embed/', 107, '1920', 0, 1),
(3016, 'United States of America', 'Docteur Jekyll et M. Hyde', 'Le Dr Jekyll, respectable savant, confectionne une drogue qui, une fois ingurgitée, le transforme en un personnage monstrueux, M. Hyde. Il va répéter l\'expérience mais bientôt, il ne pourra plus revenir sur ses pas. Les expériences scientifiques du Dr Henry Jekyll révèlent sa face cachée inavouable et font de lui un tueur.', 'Famous Players-Lasky Corporation', 'https://image.tmdb.org/t/p/w1280/u8OL0RbTNzqqB1WmkxroTBXohnv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tQRHrssevbysfmDG9FbA86qesCH.jpg', 'https://www.youtube.com/embed/', 79, '1920', 3.47, 1),
(3017, 'United States of America', 'Docteur Jekyll et M. Hyde', 'Quand la première transformation de Jekyll en Hyde commence, le majordome de Jekyll s\'exclame qu\'il est maintenant \"l\'Apôtre de l\'Enfer!\" Hyde, avec des crocs et des cheveux hirsutes, déambule à travers la ville commettant des actes odieux comme voler le sac à main d\'une femme. La police rattrape finalement Hyde, l\'interroge, le met en prison et l\'attache à la chaise électrique. Assis dans sa chaise à la maison, Jekyll se réveille de son cauchemar pour déclarer: «Je crois en Dieu, j\'ai une âme ...» et décide de ne pas créer de potion chimique.', 'Pioneer Film Company', 'https://image.tmdb.org/t/p/w1280/5Hw6imY9cCLX6jaoMtstZbHnHhw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 40, '1920', 2.9, 1),
(3019, 'United States of America', 'Dr. Jekyll and Mr. Hyde', 'Dr. Henry Jekyll believes that there are two distinct sides to men - a good and an evil side. He believes that by separating the two, man can become liberated. He succeeds in his experiments with chemicals to accomplish this and transforms into Hyde to commit horrendous crimes. When he discontinues use of the drug, it is already too late.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/mZtQORzQWkCSqeeHApH6vJDA1D2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//i2Wb6QsKg14tl4p9HgJENfUCqhh.jpg', 'https://www.youtube.com/embed/', 98, '1931', 3.63, 1),
(3021, 'United States of America', 'Chambre 1408', 'Bien qu\'il soit un auteur réputé de romans d\'épouvante, Mike Enslin n\'a jamais cru aux fantômes et aux esprits. Pour lui, la vie après la mort n\'est que pure invention, et il a passé suffisamment de temps dans des maisons hantées et des cimetières pour le vérifier... En travaillant sur son dernier ouvrage, il découvre l\'existence d\'une chambre, la 1408 du Dolphin Hotel, où se sont produites de nombreuses morts inexpliquées et souvent violentes. Malgré les mises en garde du directeur de l\'hôtel, Enslin décide d\'y passer une nuit. Face à ce qu\'il va vivre, son scepticisme va voler en éclats. Pour lui, la question n\'est plus de savoir si le paranormal existe, mais d\'espérer survivre à la nuit de tous les cauchemars...', 'Di Bonaventura Pictures', 'https://image.tmdb.org/t/p/w1280/pP1EY1gp9hKrILIHyUivISwOedF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yzltOpo9TzfgB7h7U7seIOYqcf5.jpg', 'https://www.youtube.com/embed/ouefsWij8uU', 96, '2007', 3.33, 1),
(3022, 'United States of America', 'Dr. Jekyll et Mr. Hyde', 'Le docteur Henry Jekyll, jeune et brillant médecin, est fiancé à la jolie Beatrix Emery. Ses recherches sur la dualité du Bien et du Mal chez l’homme et son désir de dissocier ces tendances l’accaparent complètement. Ses théories ne font pas l’unanimité auprès de ses confrères plus conservateurs. Le père de Beatrix, Sir Charles Emery, mécontent du non-conformisme de Jekyll et de son impatience à épouser sa fille décide d’éloigner celle-ci pendant un temps, afin d’éprouver leur attachement. Un soir, Jekyll accompagné de son ami, le docteur John Lanyon, sauve d’une agression la belle Ivy Peterson, une serveuse de bar, et la raccompagne chez elle. Reconnaissante, elle fait des avances à un Jekyll profondément troublé. Après de longues recherches cloîtré dans son laboratoire, Jekyll se décide à expérimenter sur lui-même un breuvage qu’il a mis au point. Il sombre alors dans un état semi-conscient et se transforme en une créature maléfique qu’il baptisera Mister Hyde...', 'Metro-Goldwyn-Mayer', 'https://image.tmdb.org/t/p/w1280/uDCa6zfiYJFuA0zCWqbsnCwxaPu.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uexFmOh0LenFTK9dd8DvpNHB5qc.jpg', 'https://www.youtube.com/embed/', 113, '1941', 3.24, 1),
(3023, 'United States of America', 'Deux nigauds contre le Docteur Jekyll et M. Hyde', 'Deux policiers américains pas très fûtés, Slim et Tubby, débarquent en Angleterre pour combattre le Docteur Jekyll, dont le double maléfique Mister Hyde commet de nombreux meurtres. Un jour, le sérum du Docteur Jekyll est injecté dans le corps de Tubby.', 'Universal Pictures', 'https://image.tmdb.org/t/p/w1280/spZzSuujqiYHMK5pIvJOS5LDYD0.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aM81XfMvYyb1Qpig5rp8tOodRjt.jpg', 'https://www.youtube.com/embed/', 76, '1953', 3.25, 1),
(3024, 'Canada', 'The Strange Case of Dr. Jekyll and Mr. Hyde', '', 'Dan Curtis Productions', 'https://image.tmdb.org/t/p/w1280/xlVyTmUJbsyxdpjyLySUoLPm9rv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8n27EVQ1nbEcMq1dt2OVYmAeKRd.jpg', 'https://www.youtube.com/embed/', 120, '1968', 3.3, 1),
(3025, 'United Kingdom', 'Les Deux visages du Dr Jekyll', 'M. Hyde fait peser sur le docteur Jekyll le poids de ses crimes, jusqu’à ce que la personnalité du Docteur triomphe.', 'Hammer Film Productions', 'https://image.tmdb.org/t/p/w1280/gFhJMtJ5lu8y0E9ooVPxWecM3bC.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6trIEq8wjlfDBUkJmpTzt8f2yB1.jpg', 'https://www.youtube.com/embed/HM8FwYrbzZg', 88, '1960', 3.16, 1),
(3026, 'France', 'Le Testament du Docteur Cordelier', 'Le docteur Cordelier, celebre psychiatre, a confie a Maitre Joly un testament en faveur d\'un certain Opale, sinistre individu, sadique et meurtrier. Cordelier presente Opale comme un patient sur lequel il se livre a des experiences. Mais on apprend bientot qu\'Opale et Cordelier ne font qu\'un...', 'Compagnie Jean Renoir', 'https://image.tmdb.org/t/p/w1280/7G0PbmmPifmkNMDwFbEZfLZe0hr.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6hObqW3SO5vzPVRsPwrx3hYZljc.jpg', 'https://www.youtube.com/embed/', 95, '1959', 3.35, 1),
(3027, 'United States of America', 'Dr Jekyll et Mr Hyde', 'Version musicale de l\'histoire dans laquelle des expériences Dr Henry Jekyll avec des moyens scientifiques révélant la, face cachée sombre de l\'homme et libère un assassin de l\'intérieur lui-même.', 'Bryna Productions', 'https://image.tmdb.org/t/p/w1280/wuu2eV3CgACXGgQ1aM199rROOny.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/', 78, '1973', 3, 1),
(3028, 'United States of America', 'Jekyll and Hyde... Together Again', 'Chirurgien brillant Daniel Jekyll se consacre à la recherche médicale, dans l\'espoir de débloquer la nature animale de l\' homme et d\'accroître sa capacité d\'auto-guérison. Jekyll crée accidentellement une poudre blanche qui, lorsqu\'il est inhalé par le nez, le transforme temporairement en un maniaque sexuel complètement désinhibé qui se fait appeler Steven Hyde. Jekyll ne peut pas se résoudre à jeter le médicament ou à cesser de le prendre, et les frasques de Hyde font des ravages dans la vie de Jekyll.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/k1PkapN7CByX5u443rtiYc9LL8J.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ijGHbdhjSxZSo9jiH6AZzsnNOL.jpg', 'https://www.youtube.com/embed/', 87, '1982', 2.65, 1),
(3029, 'France', 'La fin du monde', 'En observant le ciel, Jean Novalic, un savant, découvre une comète. La trajectoire de cette dernière doit l\'amener irrémédiablement à entrer en collision avec la Terre. Dès la nouvelle connue, la panique s\'empare des terriens. Profitant de cet état d\'esprit, l\'astronome décide de proclamer une république universelle. Mais la comète ne fait qu\'effleurer le globe terrestre...', 'L\'Écran d\'Art', 'https://image.tmdb.org/t/p/w1280/vqZAjDdi1mYUdR61WBUpZE12HLf.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nrycLanWj1avjGEchQj1evoczWo.jpg', 'https://www.youtube.com/embed/xzqeSUOEWNU', 105, '1931', 2.5, 1),
(3030, 'United States of America', 'Destruction planète terre', 'Après avoir été témoin de la mort d\'un homme dans un accident bizarre, le père Pergado part en retraite spirituelle. Là, il rencontre son double extraterrestre penché sur la conquête du monde.', 'Charles Band Productions', 'https://image.tmdb.org/t/p/w1280/3sTQjihida7icnNe0jtFTFHMTmY.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rmtpRm2qZ2ekO3jwqtYwwf9xPy9.jpg', 'https://www.youtube.com/embed/', 88, '1977', 1.7, 1),
(3031, 'United States of America', 'L\'île du docteur Moreau', 'Sur une île perdue du Pacifique, le docteur Moreau créé des hybrides d\'animaux et d\'humains.', 'Paramount', 'https://image.tmdb.org/t/p/w1280/ryA3xzSQtQtxMISO0PimWMMixpe.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//61IefEsvLfIu60mp1WWu144hoHN.jpg', 'https://www.youtube.com/embed/', 70, '1932', 3.49, 1);
