INSERT INTO `livres` (`id_livre`, `livre_titre`, `livre_editeur`, `livre_auteur`, `livre_date_publication`, `livre_nombre_page`, `livre_cover_image`, `livre_description`, `livre_popularity`, `livre_value`) VALUES
(0, '0', '0', '0', '2023-05-27', 0, '0', '0', 0, 0),
(1, '1984', 'Éditions Gallimard', 'George Orwell', '1949-06-08', 328, 'https://www.gallimard.fr/var/storage/images/product/bb0/product_9782072730030_195x320.jpg', '1984 est un roman dystopique de George Orwell publié en 1949. L\'histoire se déroule dans un monde totalitaire où la liberté individuelle est limitée et la surveillance de l\'État est omniprésente.', 4.5, 1),
(2, 'Le Seigneur des anneaux', 'Allen & Unwin', 'J.R.R. Tolkien', '1954-07-29', 1216, 'https://www.clovis-diffusion.com/Files/19840/Img/20/Item33166.png', 'Le Seigneur des anneaux est une trilogie de romans de fantasy écrite par J.R.R. Tolkien. L\'histoire se déroule dans un monde imaginaire et suit les aventures d\'un groupe de personnages dans leur quête pour détruire un anneau magique.', 4.8, 1),
(3, 'Harry Potter à l\'école des sorciers', 'Bloomsbury Publishing', 'J.K. Rowling', '1997-06-26', 320, 'https://cdn1.booknode.com/book_cover/835/harry_potter_tome_1_harry_potter_a_lecole_des_sorciers-835229-264-432.jpg', 'Harry Potter à l\'école des sorciers est le premier livre de la série Harry Potter de J.K. Rowling. Il raconte l\'histoire d\'un jeune sorcier nommé Harry Potter et de ses aventures à l\'école de sorcellerie de Poudlard.', 4.7, 1),
(4, 'Le Petit Prince', 'Gallimard', 'Antoine de Saint-Exupéry', '1943-04-06', 96, 'https://images-na.ssl-images-amazon.com/images/I/71lyHAf7XXL.jpg', 'Le Petit Prince est un conte philosophique d\'Antoine de Saint-Exupéry. Il raconte l\'histoire d\'un petit prince venu d\'une autre planète et de ses rencontres avec divers personnages.', 4.6, 1),
(5, 'Orgueil et Préjugés', 'Penguin Classics', 'Jane Austen', '1813-01-28', 432, 'https://cdn1.booknode.com/book_cover/862/orgueil_et_prejuges-861757-264-432.jpg', 'Orgueil et Préjugés est un roman de Jane Austen. Il raconte l\'histoire de la famille Bennet et de ses cinq filles, en particulier de l\'histoire d\'amour entre Elizabeth Bennet et Fitzwilliam Darcy.', 4.4, 1),
(6, 'Les Misérables', 'A. Lacroix, Verboeckhoven & Cie', 'Victor Hugo', '1862-03-01', 1488, 'https://m.media-amazon.com/images/I/510ypkdwIYL.jpg', 'Les Misérables est un roman de Victor Hugo publié en 1862. Il raconte l\'histoire de Jean Valjean, un ancien bagnard, et de ses rencontres avec différents personnages.', 4.3, 1),
(7, 'Cinquante nuances de Grey', 'Vintage Books', 'E.L. James', '2011-06-20', 528, 'https://m.media-amazon.com/images/I/51knm9fa2GL.jpg', 'Cinquante nuances de Grey est un roman érotique d\'E.L. James. Il raconte l\'histoire d\'une étudiante en littérature qui entame une relation BDSM avec un homme d\'affaires.', 4.2, 1),
(8, 'Le Comte de Monte-Cristo', 'Pétion Éditeur', 'Alexandre Dumas', '1844-08-28', 1276, 'https://m.media-amazon.com/images/P/B008UBX6LQ.01._SCLZZZZZZZ_SX500_.jpg', 'Le Comte de Monte-Cristo est un roman d\'aventure et de vengeance écrit par Alexandre Dumas. Il raconte l\'histoire d\'Edmond Dantès, trahi et emprisonné à tort, qui cherche à se venger de ceux qui l\'ont injustement condamné.', 4.7, 1),
(9, 'Guerre et Paix', 'Éditions Flammarion', 'Léon Tolstoï', '1869-01-01', 1424, 'https://m.media-amazon.com/images/I/516OVn0hpuL._SY346_.jpg', 'Guerre et Paix est un roman historique de Léon Tolstoï. Il se déroule pendant les guerres napoléoniennes et suit les vies et les amours de plusieurs personnages principaux.', 4.6, 2);
