(19, 'US', 'La Planète des Singes', 'Anthony Wilson', 'En 1988, deux astronautes, Alan Virdon et Peter Burke, sont happés par une distorsion temporelle et atterrissent en 3085 sur la Terre. Une époque où la modernité n\'existe plus et la race des singes a pris le contrôle de la planète, reléguant l\'espèce huma', 50, 'https://image.tmdb.org/t/p/w1280/3Wfz5D3sV2mHMGUXk2BhUV1yJB2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//JrBiUtR2CwxZR5GMK5Z9dU7Wr4.jpg', ' ', 14, 1, 3.45, 1),
(20, 'US', 'Wildboyz', 'Jeff Tremaine', 'Aucune donnée sur la description', 30, 'https://image.tmdb.org/t/p/w1280/sM3SK4hx4eI6mdw1piUyVdV9WaW.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//25oFvo7MV1fu9GlneFlCcUDIO39.jpg', ' ', 32, 4, 2.22, 1),
(22, 'Aucune donnée sur la ville d\'origine de la série', 'Pain Clinic', 'Aucune donnée sur le réalisateur', 'Aucune donnée sur la description', 60, 'https://image.tmdb.org/t/p/w1280', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', ' ', 0, 0, 0, 1),
(23, 'AU', 'Tugs', 'Robert D. Cardona', 'Aucune donnée sur la description', 15, 'https://image.tmdb.org/t/p/w1280/iA5FdGkXlOhRjvZLPkkrNMcqqq1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', ' ', 13, 1, 5, 1),
(24, 'US', 'Presidio Med', 'John Wells', 'Aucune donnée sur la description', 44, 'https://image.tmdb.org/t/p/w1280/dpsbrvlgr48nshG1MS8i2saaINQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rU36ztMT9kNw8LZGlO3DNoOqu2X.jpg', ' ', 16, 1, 3.5, 1),
(25, 'US', 'Star Wars : Droids', 'George Lucas', 'Retrouvez R2-D2 et C-3PO qui embarquent pour une aventure périlleuse, palpitante et à l\'humour décapant ! Des années avant leur rencontre avec Luke Skywalker, vos droïdes préférés de Star Wars ont parcouru la galaxie, dans leur quête sans fin pour trouver', 22, 'https://image.tmdb.org/t/p/w1280/b3gsZSTauRBJDJvWCbD9oVAsFe1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qWIhNn6ZxbjYya6m5amiKXUhlQY.jpg', ' ', 13, 1, 2.59, 1),
(26, 'US', 'Hawaii', 'Jeff Eastin', 'Hawaï peut séduire n\'importe qui si vous êtes un flic ou un criminel. Les détectives qui travaillent ici ne peuvent jamais vraiment prendre une pause de paradis, parce qu\'ils sont empêtrés dans le côté sombre de ce paradis. Ce groupe de détectives du dépa', 60, 'https://image.tmdb.org/t/p/w1280/6KTBQFaNk7AxDkPn8648CwxWUHQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', ' ', 8, 1, 4.1, 1),
(27, 'US', 'Bratz', 'Aucune donnée sur le réalisateur', 'Aucune donnée sur la description', 20, 'https://image.tmdb.org/t/p/w1280/qbQfewZQRwQMrd4enAPRx5AMjng.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//61WtwoHaWHRiabd3DkHCDmLKzaT.jpg', ' ', 0, 2, 4.21, 1),
(29, 'US', 'Mary Hartman, Mary Hartman', 'Gail Parent', 'In the fictional town of Fernwood, Ohio, suburban housewife Mary Hartman seeks the kind of domestic perfection promised by Reader’s Digest and TV commercials. Instead she finds herself suffering the slings and arrows of outrageous fortune: mass murders, l', 30, 'https://image.tmdb.org/t/p/w1280/O1bcYEBW8v7JOMNVpYOBTL6PjL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//18i713jPa0nhpSUxsO3dk09oEzE.jpg', ' ', 307, 2, 3.13, 1),
(30, 'US', 'St. Elsewhere', 'Joshua Brand', 'Aucune donnée sur la description', 60, 'https://image.tmdb.org/t/p/w1280/mEfcA56iisaOfnK8FsY1sSE2wLu.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cv0wAiHqjKYQs4ObXT8qiaRpKwW.jpg', ' ', 137, 6, 2.67, 1),
