(33, 'US', 'Ce que j\'aime chez toi', 'Dan Schneider', 'Experte en relation publique, Valerie Tyler se voit contrainte de partager son appartement avec sa jeune soeur lorsque leur père part travailler au Japon. La fraîcheur et l\'insouciance de Holly s\'opposent au sérieux de Valerie.', 30, 'https://image.tmdb.org/t/p/w1280/zSBXCHUwMR3uCCeheTCeb6lzpEI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7Ls73KYosHXFYOmgUE6zSflRJpA.jpg', ' ', 86, 4, 3.12, 1),
