(151, 'JP', 'Les aventures du Bosco', 'Soji Yoshikawa', 'La princesse Abricotine est destinée à régner sur le Pays des Fontaines où coule la « Fontaine de Vie », source de toute vie dans le Monde du Bosco. Traquée par des bandits soucieux de s\'emparer de ce territoire luxuriant, la Princesse est finalement kidn', 30, 'https://image.tmdb.org/t/p/w1280/k7agjaxwbNFIHm3plzpCdjMF7G.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8fPGleo9X3jsToxOFp8L82FwqrX.jpg', ' ', 26, 1, 2.5, 1),
