(155, 'US', 'Troisième planète après le Soleil', 'Bonnie Turner', 'Cette série raconte la vie quotidienne d\'une famille de quatre extraterrestres venus sur la Terre, à Rutherford dans l\'Ohio, pour observer les humains. Pour cela ils prennent forme humaine et se font appeler Dick, Sally, Harry et Tommy Solomon.\n\nCes extra', 30, 'https://image.tmdb.org/t/p/w1280/ux8Bj6O2Aglkd8eduAv8m70Kicb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//eZmgVaSzSYBCw1pIX1yNetEjzc0.jpg', ' ', 139, 6, 3.74, 1),
