(160, 'US', 'Teenage Mutant Ninja Turtles', 'Kevin Eastman', 'Four turtles fall into the sewers and are befriended by Hamato Yoshi a Japanese man sent to New York who was forced to live in the sewers. One day he sees a strange green glow which transforms the four turtles into human-like creatures. Hamato (now Master', 22, 'https://image.tmdb.org/t/p/w1280/AaihPizftZo5YCqzEgHMwkceaEo.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6u51epAshvovaJSG5AWsCoooPPQ.jpg', 'https://www.youtube.com/embed/euiAbXjIl4c', 193, 10, 3.8, 1),
