(164, 'US', 'Dark Skies : L\'Impossible Vérité', 'Aucune donnée sur le réalisateur', 'Dans les années 1960, Kimberly Sayers et John Loengard emménagent à Washington pour le travail de John comme assistant parlementaire. Il enquête sur une administration, Majestic (voir Majestic 12 pour un possible parallèle), et découvre que celle-ci lutte', 60, 'https://image.tmdb.org/t/p/w1280/s9OsGyWkj9dsXzc2gGbNiwm4ko6.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//d6gaIKwu3e6AFqXnHwkJc2a2G3J.jpg', ' ', 19, 1, 3.83, 1),
(165, 'US', 'Un Agent très secret', 'Glenn Gordon Caron', 'Gravement blessé à la suite d\'un accident, Michael Wiseman, marié et père de famille, devient l\'objet d\'un programme top secret. Son cerveau est transplanté dans un corps bionique... plus jeune et plus beau ! Désormais doté d\'une force surhumaine, Michael', 45, 'https://image.tmdb.org/t/p/w1280/cCAXhFIxJTbQFqJAt5nZtFSnBbQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7fATjiFmnPBsMuxaS24VMqfY6ZP.jpg', 'https://www.youtube.com/embed/yTsgq-a9CUw', 22, 1, 3.4, 1),
