(167, 'US', 'La Femme Nikita', 'Joel Surnow', 'La Femme Nikita was a Canadian action/drama television series based on the French film Nikita by Luc Besson. The series was co-produced by Jay Firestone of Fireworks Entertainment and Warner Bros.. It was adapted for television by Joel Surnow. The series ', 60, 'https://image.tmdb.org/t/p/w1280/pvm8hc0JzbDOcH85bPmlqmMJDvT.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8OapOjQUbA52qDdog8GGIIy8bdh.jpg', 'https://www.youtube.com/embed/Wprr7YXYQxI', 96, 5, 3.8, 1);
