(171, 'US', 'Martin', 'Martin Lawrence', 'Sassy sitcom centrée sur la personnalité de la radio et de la télévision Martin Payne. La série se concentre sur sa relation amoureuse avec sa petite amie Gina, sa meilleure amie Pam et ses escapades avec les meilleurs amis Tommy et Cole.', 30, 'https://image.tmdb.org/t/p/w1280/pJE7GR2XSTcUn4wW89nrLawk5FX.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//weME33HlqhoexXlX9wJ0C9VipCU.jpg', ' ', 132, 5, 3.89, 1),
(172, 'US', 'Arliss', 'Aucune donnée sur le réalisateur', 'Arliss est un puissant agent sportif de Los Angeles. Dans les coulisses du sport professionnel, brassant des sommes considérables, il fait preuve d\'un optimisme inébranlable et d\'une incapacité totale à dire «non».', 30, 'https://image.tmdb.org/t/p/w1280/j8OWiFdjQJyU2rSfdIaktUec4Le.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uMON3pgXYNlw3Aa4EsyMSmjMjVr.jpg', ' ', 80, 7, 3.45, 1),
(173, 'CA', 'Les années collège', 'Kit Hood', 'Bienvenue au collège Degrassi où vous ferez la connaissance de leurs élèves  et de leurs professeurs. La vie quotidienne de ces collegiens est rythmée par des aventures palpitantes et réalitstes sur de nombreux thèmes liés à l\'adolescence...', 30, 'https://image.tmdb.org/t/p/w1280/5fCPJdwgMdIfeoETslRN6ZR8uxK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tyf0Hiir1mYy0WRwGwDnvO3Mm7h.jpg', ' ', 42, 3, 3.95, 1),
(174, 'US', 'Monster Garage', 'Thom Beers', 'L\'émission consiste à transformer un véhicule dans un but improbable, par exemple transformer une Rolls-Royce en vidangeur de WC chimiques et épandeur, ou une voiture de police en machine à beignets, le tout en sept jours et avec un budget ne dépassant pa', 45, 'https://image.tmdb.org/t/p/w1280/jiVq7N0khQdCZdnp9AjcPwxCKkb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4zpY5hvumlsAyzEfi0WFXFtL8e5.jpg', ' ', 98, 6, 2.85, 1),
(175, 'GB', 'All Along the Watchtower', 'Aucune donnée sur le réalisateur', 'Aucune donnée sur la description', 30, 'https://image.tmdb.org/t/p/w1280', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', ' ', 6, 1, 4, 1),
(177, 'US', 'I Am Weasel', 'David Feiss', 'Aucune donnée sur la description', 30, 'https://image.tmdb.org/t/p/w1280/ibSVhfayNItAAoGkI8bHYOHPQdH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4vR2Ctk0dBrEKIxwBaV3BCkYCRc.jpg', ' ', 79, 5, 3.61, 1),
(178, 'US', 'Jenny Robot', 'Rob Renzetti', 'XJ-9 (« Jenny » comme elle-même s\'est renommée) est un robot de combat fortement sophistiqué créé par le Dr Nora Wakeman, mais Jenny veut seulement vivre la vie d\'une adolescente normale. Tous vivent dans la ville futuriste fictive de Tremorton (Ohio), en', 24, 'https://image.tmdb.org/t/p/w1280/1l2olmIShEAP36T2z52IVmKh9mR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//cCy8zz9QcI3bzzfMtbvixk7hYmq.jpg', ' ', 76, 3, 3.75, 1),
