(184, 'US', 'Jeremiah', 'J. Michael Straczynski', 'En 2006, un virus surnommé la Grande Mort a causé d\'énormes pertes humaines. Seuls les enfants n\'ayant pas atteints l\'âge de la puberté ont survécu à ce drame. Dans un monde post-apocalyptique, les survivants se sont alors retrouvés livrés à eux-mêmes.\n\n1', 45, 'https://image.tmdb.org/t/p/w1280/yBaq79cbv8Lmhaa7ej3z6GOp9zK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//dlDynz58qyEqrd3gzxqfYB2JiUW.jpg', ' ', 35, 2, 3.49, 1),
(185, 'US', 'La caravane de l\'étrange', 'Daniel Knauf', 'La série se déroule aux Etats-Unis en 1934, durant la Grande Dépression de l\'entre deux guerres. Nous y suivons deux personnages : Ben Hawkins, jeune fermier recueilli par le Carnivàle, un cirque ambulant où se côtoient femme à barbe, sœurs siamoises, hom', 54, 'https://image.tmdb.org/t/p/w1280/ejw21dsIC1edqYvOW2rRbifB0l4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vIZTdNpIKj0wUSIwUgohD0pm7J0.jpg', ' ', 24, 2, 3.99, 1),
(186, 'US', 'Weeds', 'Jenji Kohan', 'After the unexpected death of her husband, a suburban mom resorts to selling weed to support her family.', 25, 'https://image.tmdb.org/t/p/w1280/gKUsBTa5b0GY7U4iWBseeBalfjO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8PtOfFfX3anE4T63NjnfULRalMq.jpg', 'https://www.youtube.com/embed/qZDIH2gbJMM', 102, 8, 3.72, 1),
(187, 'GB', 'All Our Saturdays', 'Aucune donnée sur le réalisateur', 'Aucune donnée sur la description', 30, 'https://image.tmdb.org/t/p/w1280', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', ' ', 6, 1, 0, 1),
(188, 'GB', 'Les Animaux du Bois de Quat\'sous', 'Jenny McDade', 'Les animaux du Bois de Quat’Sous menaient jadis une vie paisible dans leur petite forêt, mais au cours d’un été caniculaire leur logis fut attaqué par les bulldozers et les bétonneuses. Menacés à la fois par l’homme et la sécheresse, contraints de fuir po', 25, 'https://image.tmdb.org/t/p/w1280/nk7rHpJ3BDWR3tirkH70pU6YHwI.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gvV7FJgZdgjGTkglbuzBJwWIoCY.jpg', 'https://www.youtube.com/embed/ZsXiSP7GNzE', 39, 3, 4.18, 1),
