(190, 'US', 'Def Comedy Jam', 'Stan Lathan', 'Def Comedy Jam est une série télévisée HBO produite par Russell Simmons.\n\nLa série a eu sa première diffusion du 1er juillet 1992 au 1er janvier 1997. L\'émission est revenue sur la programmation d\'automne de HBO en 2006. Def Comedy Jam a aidé à lancer la ', 60, 'https://image.tmdb.org/t/p/w1280/ksjgVXKnovogx01Xqf9GzYKIZKq.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vqjAu8Qdkc4uwJVlypU8Pep3QL5.jpg', ' ', 29, 11, 3.7, 1),
