(194, 'US', 'NYPD Blue', 'Steven Bochco', 'Police drama set in New York City, exploring the internal and external struggles of the fictional 15th precinct of Manhattan. Each episode typically intertwined several plots involving an ensemble cast.', 60, 'https://image.tmdb.org/t/p/w1280/hrdusQVSArJPRGnB5bHzd2ISP4V.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//uRxrvomx1pBL78UYHOVNTNgJYxq.jpg', ' ', 261, 12, 3.56, 1),
