(206, 'US', 'High Secret City, la ville du grand secret', 'David E. Kelley', 'Il s\'agit d\'une chronique de la vie quotidienne des habitants de la petite ville de Rome dans le Wisconsin. Les histoires sont articulées autour de la famille Brock dont le père est le shérif de la ville et la mère le médecin généraliste.', 42, 'https://image.tmdb.org/t/p/w1280/8Ob5zlT7HZaNK2uG9MjqUIpclWc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nrnIWaRKlPVBRkqpZQJG4ioTUbY.jpg', ' ', 88, 4, 3.85, 1),
