(231, 'US', 'The Soup', 'Aucune donnée sur le réalisateur', 'La soupe règne dans les moments les plus fous et les plus mémorables de la semaine dans le monde de la télévision avec des commentaires hilarants, des clips scandaleux et des invités de célébrités surprise.', 30, 'https://image.tmdb.org/t/p/w1280/kUCMWgkia4jnGUmbQkHpk9L95VK.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ppwW0bAMRqEMrgu248dfEHjzNbY.jpg', ' ', 643, 13, 2.9, 1),
