(234, 'US', 'Mon copain de classe est un singe', 'Julie McNally Cahill', 'L\'histoire se base sur un jeune garçon humain nommé Adam Lyon. Ce dernier a été transféré du collège Chester Arthur (une école normale) au collège Charles Darwin (une école pour animaux) à la suite d\'une faute d\'orthographe commise par le service des insc', 30, 'https://image.tmdb.org/t/p/w1280/pFdCAw8vY8PUFV5YIgvBmiVEE5j.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//1t0om24UpvGeljqRPhq8S7T3pJ6.jpg', ' ', 100, 4, 3.08, 1),
