(236, 'US', 'Flash', 'Danny Bilson', 'Un soir, alors qu\'il travaille dans son laboratoire, Barry Allen est victime d\'un accident. Electrocuté et aspergé de produits chimiques, il perd conscience. A son réveil, il découvre qu\'il a le pouvoir de se déplacer à une vitesse extraordinaire. Christi', 45, 'https://image.tmdb.org/t/p/w1280/fi1GEdCbyWRDHpyJcB25YYK7fh4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4yqH859U1oklGm4O5mFhrmtabKL.jpg', ' ', 22, 1, 3.73, 1),
