(314, 'US', 'Star Trek : Enterprise', 'Brannon Braga', 'Au xxiie siècle (de 2151 à 2161), avant l\'existence de la Fédération, le capitaine Jonathan Archer reçoit le commandement de l’Enterprise (NX-01), premier vaisseau spatial humain équipé de la Distorsion 5 et envoyé par Starfleet pour explorer la galaxie.\n', 44, 'https://image.tmdb.org/t/p/w1280/n1Jjc0gkxHpXYXppSCtJWx6mHA9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gH5HQbMsSfPc0R41JYTefjB7klZ.jpg', ' ', 98, 4, 3.81, 1),
