(318, 'US', 'American Gothic', 'Shaun Cassidy', 'Everything is not what it seems in Trinity, South Carolina. Sheriff Lucas Buck develops a sinister interest in Caleb. Caleb\'s cousin Gail tries to protect him, but that\'s complicated since she has feelings for Sheriff Buck. And Caleb\'s dead sister, Merlyn', 45, 'https://image.tmdb.org/t/p/w1280/qajOMTtQ958JEpmokPXTruwA9qp.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//aqYSSDOMcc9lhkKBgb006IZjCks.jpg', ' ', 18, 1, 3.81, 1),
(319, 'US', 'The Tony Danza Show', 'Aucune donnée sur le réalisateur', 'The Tony Danza Show was a daytime variety talk show that premiered on September 13, 2004 in syndication and was distributed by Buena Vista Television.', 60, 'https://image.tmdb.org/t/p/w1280/6w7n6O6UNZKvL1liVFKYmTXFdNH.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', ' ', 328, 2, 3.07, 1),
(320, 'US', 'Fear Factor', 'Aucune donnée sur le réalisateur', 'Competition reality series in which contestants must decide if they have the guts and determination to face their fears while outpacing the competition.', 60, 'https://image.tmdb.org/t/p/w1280/A9FxroNWtOxiApMPxOHbZUWJoaB.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tjH61YOH8DksSyWRVcrWzVLcEU6.jpg', 'https://www.youtube.com/embed/IbYR1lqHbqE', 156, 7, 2.95, 1),
(321, 'US', 'Voyage au fond des mers', 'Irwin Allen', 'La série Voyage au fond des mers est une sorte de spin-off du film Le Sous-marin de l\'apocalypse réalisé en 1961 par Irwin Allen producteur de la série TV. En anglais, le film et la série ont d\'ailleurs le même titre, Voyage to the Bottom of the Sea. Les ', 60, 'https://image.tmdb.org/t/p/w1280/q0ZDfU8p9XQ0TS2Cku0jEff89K4.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//58JWKf2FjsXwuiIS4wngeFG5A6e.jpg', ' ', 110, 4, 3.89, 1),
(322, 'US', 'Perversions of Science', 'Aucune donnée sur le réalisateur', 'Aucune donnée sur la description', 30, 'https://image.tmdb.org/t/p/w1280/lA4zvjHMICXl5XDpShfemcNSDNv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nhYLGiTWcBXYOvMfvu83tPugnLG.jpg', 'https://www.youtube.com/embed/_Gp4u5vR0hk', 10, 1, 2.65, 1),
(323, 'US', 'Les As du braquage', 'Rob Burnett', 'Son rêve d\'ouvrir un bar semble irréalisable avec un salaire de balayeur. Jusqu\'au jour où Eugène décide d\'organiser un cambriolage pour s\'offrir son rêve ! Avec une équipe aussi inexpérimentée que lui dans ce domaine, il vise haut : le luxueux appartemen', 30, 'https://image.tmdb.org/t/p/w1280/dHC6RqL1BtZ2O0ChbfwrfxmGnp2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//jo9fDfMBAbZkDpNFtdEVntQslzv.jpg', ' ', 13, 1, 3.7, 1),
