(325, 'US', 'Les aventures des Galaxy Rangers', 'Robert Mandell', 'Les Galaxy Ranger sont quatre justiciers qui font régner la loi. Dotés de pouvoirs extraordinaires, ces cow-boys de l’espace mènent une lutte farouche contre les pirates du cosmos et ennemis de la liberté, parmi lesquels le Capitaine Kidd ou la Reine Rajj', 30, 'https://image.tmdb.org/t/p/w1280/wo44yfN8zni0iG9r8vCxfgeEeiA.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qfUfiI8kLiSvBfQoPB89R6Re5rO.jpg', 'https://www.youtube.com/embed/9Se_cC4nvx8', 65, 1, 3.68, 1),
(326, 'GB', 'Red Dwarf', 'Rob Grant', 'Red Dwarf est un vaisseau terrien minier de 8kms de long, qui circule en orbite autour de Saturne. A bord, officiers et miniers cohabitent tant bien que mal. Dave Lister vit à bord et possède un chat bien que cela soit strictement interdit. Découvert, il ', 30, 'https://image.tmdb.org/t/p/w1280/dAaVWMhCCrSuimSETs9Z5ZTZQ3v.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//rNVKSn9g7PA4u3IzZTX1DbulGkk.jpg', ' ', 73, 12, 4.02, 1),
