(333, 'KR', 'Dae Jang Geum', 'Kim Young-hyun', '\"Jewel in the Palace\" (Dae Jang Geum) est basé sur l\'histoire vraie de Jang Geum, une jeune fille de la classe ouvrière de Joseon qui parvient à obtenir un emploi comme apprentie cuisinière du palais royal. Mais la jalousie d\'une famille avide de pouvoir ', 80, 'https://image.tmdb.org/t/p/w1280/rQbcx9cotedaXTXQFOHc375BRFs.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//mkmlUSTmOb2LI5A6aU1gHaRDElG.jpg', ' ', 54, 1, 4.26, 1),
