(337, 'US', 'The Nine, 52 Heures En Enfer', 'Hank Steinberg', 'Une interminable prise d\'otages se termine en un véritable carnage ! Seules neuf personnes en réchappent. Que s\'est-il passé lors des longues heures d\'angoisse à l\'intérieur de la banque ? Après un tel traumatisme, une vie normale est-elle encore envisage', 42, 'https://image.tmdb.org/t/p/w1280/5FWsBK96U8VUywOun1N34cCU7Nj.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2iKOl8635V4txujzFfFN8jDlEr0.jpg', ' ', 13, 1, 2.88, 1),
