(345, 'Aucune donnée sur la ville d\'origine de la série', 'Mon petit poney', 'Aucune donnée sur le réalisateur', 'Les poneys vivent dans un pays merveilleux peuplé de créatures pacifiques. Cependant, ils doivent souvent lutter contre les sorcières, démons, elfes, lutins, dragons et autres créatures maléfiques qui aimeraient bien les réduire en esclavage.', 15, 'https://image.tmdb.org/t/p/w1280/tkVztC8YKR8JSIHgwRWD5boViBJ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//fddXpCK4pqGJcgiMniTCmUFZphH.jpg', ' ', 65, 2, 3.46, 1),
(346, 'US', 'American Dragon: Jake Long', 'Jeff Goode', 'Cette série raconte l\'histoire d\'un jeune garçon, Jake Long, qui descend par sa mère d\'une famille de dragons. En conséquence, il a lui-même hérité de la faculté de se transformer à volonté, partiellement ou entièrement, en un dragon, avec toutes les capa', 22, 'https://image.tmdb.org/t/p/w1280/sAgoJOdvuMa3DD0JDpos9bdaF9S.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3lTao8ECc1OidUuelD3NcR01DmI.jpg', ' ', 55, 2, 3.91, 1),
(347, 'GB', 'Ultimate Force', 'Chris Ryan', 'L\'univers et le quotidien d\'une équipe de l\'unité d\'élite du \"Special Air Service\" qui luttent contre criminels et terroristes...chaque jour, ils risquent leurs vies pour sauver leur pays et rester dans cet escadron du SAS.', 70, 'https://image.tmdb.org/t/p/w1280/616qGkxSeZBAX5t1fIO7h6WY2Ec.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//3YfGCGR9WMjjb8aLdKzeXFroabE.jpg', ' ', 21, 4, 3.45, 1),
