(349, 'US', 'Point Pleasant', 'Marti Noxon', 'A series of supernatural events begins in a small coastal New Jersey town after the arrival of a mysterious teenage girl, who apparently has the ability to influence the people and events around her.', 44, 'https://image.tmdb.org/t/p/w1280/hwVJnaxrC6GPLISLrcLEICurKH9.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//yWY9senDDTOyNmaOljIF1xKIRVY.jpg', ' ', 13, 1, 3.42, 1),
