(485, 'AU', 'Sydney Police', 'Aucune donnée sur le réalisateur', 'Sydney Police (Police Rescue) est une série télévisée australienne créée par Christopher Lee, composée d\'un téléfilm de 90 minutes diffusé le 15 mars 1989, suivi de 61 épisodes de 50 minutes diffusés entre le 14 février 1991 et le 22 novembre 1996 sur ABC', 50, 'https://image.tmdb.org/t/p/w1280/191mvmC214GbGJjCn63Aw1QEdQ2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2CAFagyKOpG6Xl2xt22ZvhlY8TS.jpg', ' ', 61, 5, 2.88, 1),
(486, 'GB', 'Capitaine Scarlet', 'Sylvia Anderson', 'Capitaine Scarlet (Captain Scarlet and the Mysterons) est une série télévisée d\'animation de marionnettes (Supermarionation) britannique en 32 épisodes de 25 minutes, créée par Gerry et Sylvia Anderson et diffusée entre le 28 septembre 1967 et le 14 mai 1', 30, 'https://image.tmdb.org/t/p/w1280/6dEZ3sbJMlQFw5VQD2GIekEyXxO.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//sDXpAPO6MudcF98AH599RJc2Bbg.jpg', 'https://www.youtube.com/embed/WVeYVQZHDAk', 32, 1, 3.85, 1),
