(490, 'FR', 'Joë chez les abeilles', 'Jean Image', 'Un jour qu\'il se promène à la campagne, Joë surprend deux gamins en train de voler du miel dans une ruche. Furieux, il réussit à les arrêter et à les faire fuir. Pour le remercier, la reine des abeilles, Reine Fleur de Miel 145, et son conseiller Bzz lui ', 0, 'https://image.tmdb.org/t/p/w1280/e6IQDsCh2jEuxaNpF7jwRmqw7G3.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', ' ', 13, 1, 0, 1),
