(494, 'US', 'Alice', 'Robert Getchell', 'Alice is an American sitcom television series that ran from August 31, 1976 to March 19, 1985 on CBS. The series is based on the 1974 film Alice Doesn\'t Live Here Anymore. The show stars Linda Lavin in the title role, a widow who moves with her young son ', 30, 'https://image.tmdb.org/t/p/w1280/iEEtQs1mPz3kvvaEFR7HVnME9Or.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//5NexbDdOhcJkqqkkymIggVPHLvu.jpg', 'https://www.youtube.com/embed/2iM6PcJFLow', 202, 9, 3.27, 1),
