(496, 'US', 'Sacrée Famille', 'Gary David Goldberg', 'Cette sitcom met en scène un couple d\'anciens hippies, Steven et Elyse, confronté à leurs trois enfants, très conservateurs, particulièrement leur fils Alex, un républicain ambitieux...', 30, 'https://image.tmdb.org/t/p/w1280/3JVBzBToscU4uCyA67piI1RNarz.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//m4G421LlrPxqdtq980PLM91u38Y.jpg', ' ', 176, 7, 3.7, 1),
