(500, 'US', 'Dingue de toi', 'Paul Reiser', 'La vie de couple n\'est jamais facile, et Paul et Jamie se rendent bien compte que la cohabitation est une véritable épreuve : il faut s\'adapter aux habitudes et aux manies de l\'autre, supporter les amis envahissants et la belle famille, et renoncer à son ', 23, 'https://image.tmdb.org/t/p/w1280/vvnslQjc1LnERuroGVh8bPdBi2r.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//bEjFkaFctIXgCUeYn4ei3ECULQi.jpg', 'https://www.youtube.com/embed/48a1Xk_nTsY', 164, 7, 3.33, 1),
(501, 'US', 'Battlestar Galactica', 'Glen A. Larson', 'Les aventures des passagers du vaisseau Galactica, à la recherche d\'une planète sur laquelle vivraient des gens semblables à eux : la Terre.', 60, 'https://image.tmdb.org/t/p/w1280/hH2LkeDX420tpacGCg9nfCzpvTl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//88sdvwvX91VOYqGJUY1XQO84XIb.jpg', 'https://www.youtube.com/embed/75Sr6r7YEHg', 22, 1, 3.52, 1),
