(503, 'US', 'Cher Oncle Bill', 'Edmund L. Hartmann', 'Bill Davis est un riche ingénieur vivant en célibataire endurci dans son luxueux appartement de la cinquième avenue, à New York. Du jour au lendemain, son quotidien est bouleversé par la mort de son frère et de sa belle-sœur lors d’un tragique accident de', 20, 'https://image.tmdb.org/t/p/w1280/wsrwrXD02xed9CCbFYr2iD0Komu.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//wqV25fGvIKqHGDYNiJVuQQsBZlM.jpg', 'https://www.youtube.com/embed/YJ6xGEeWBxM', 138, 5, 3.3, 1),
