(505, 'GB', 'Dad\'s Army', 'Jimmy Perry', 'Introducing the Walmington-On-Sea home guard. During WW2, in a fictional British seaside town, a ragtag group of Home Guard local defense volunteers prepare for an imminent German invasion.', 30, 'https://image.tmdb.org/t/p/w1280/8GaK29vo3R0iLBE5DMEvt3bojmP.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//AfzpsVEOzThowOcG0w6vj2ho0Wg.jpg', ' ', 77, 9, 3.59, 1),
