(512, 'US', 'New York 911', 'John Wells', 'À New York, les unités de secours de la brigade 55 sont prêtes à intervenir dès la moindre alerte. Accidents, incendies, malaises, cambriolages ou encore agressions font partie du quotidien de cette équipe de pompiers, policiers et secouristes, qui travai', 44, 'https://image.tmdb.org/t/p/w1280/dXSOI9mAkTzzgHqPLK3EM5pHv6l.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gQYwrYJUf8Vq8biFFqkHCj4QsOk.jpg', 'https://www.youtube.com/embed/Z7zFpnbD2IU', 131, 6, 3.93, 1),
(513, 'US', 'Batman - La relève', 'Aucune donnée sur le réalisateur', 'Trop vieux et incapable de poursuivre sa mission, Bruce Wayne raccroche le costume de Batman. Vingt ans plus tard, Gotham City est devenue une ville ultramoderne mais gangrénée par le crime. Le jeune Terry McGinnis, adolescent difficile, découvre la Batca', 24, 'https://image.tmdb.org/t/p/w1280/rpbHPyhLstNd5qgtjaDMdPtyPeQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//l7h6eWj71g8oE51dBFj9g9Fgmnp.jpg', ' ', 52, 3, 4.08, 1),
