(592, 'FR', 'Jayce et les Conquérants de la lumière', 'J. Michael Straczynski', 'Lors d\'expériences destinées à trouver de nouvelles plantes capables de vaincre la famine dans l\'univers, le biologiste Audric crée par erreur les Monstroplantes, espèces mi-végétales, mi-animales, dotées d\'intelligence et habitées par la Lumière Noire.\n\n', 20, 'https://image.tmdb.org/t/p/w1280/hf1nsMQDQL5dOmzzpoJ6s0wmBH5.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//xBruuaSgqPnQKy1BpySmTA0WiVM.jpg', ' ', 65, 1, 3.4, 1),
(593, 'US', 'Sammy et Scooby-Doo en Folie !', 'Iwao Takamoto', 'Sammy et Scooby en folie : Un jour, Sammy apprend qu\'il hérite de la fortune (estimée à 1 milliard de dollars) ainsi que du manoir de son oncle Albert. Nos deux compères quittent le scooby-gang pour retrouver l\'oncle Albert qui a disparu. Ils devront affr', 22, 'https://image.tmdb.org/t/p/w1280/g57VItOxwWOoWbHHBZy3Ksh2aeS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7MaeZP8g5HHztlPPBSYiRzQ2hXY.jpg', ' ', 26, 2, 4.28, 1),
(594, 'US', 'Higher Ground', 'Matthew Hastings', 'Higher Ground is an American-Canadian drama action television show shot outside Vancouver, British Columbia. The series ran from January 14, 2000 - June 16, 2000 and aired on Fox Family. It stars Joe Lando, Hayden Christensen, A.J. Cook, Meghan Ory, Kandy', 60, 'https://image.tmdb.org/t/p/w1280/6sDziyxR3RDirGVVrGP1nSXxbtE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//lMocBOJ4LEZGMDWYtGCSHgIeqXS.jpg', ' ', 22, 1, 4.16, 1),
(595, 'SG', 'Best of Phua Chu Kang Pte Ltd', 'Andrea Teo', 'Aucune donnée sur la description', 21, 'https://image.tmdb.org/t/p/w1280/rzWeRlOIWRTmpBTycjvD2wxwDJv.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//gwxYDBqZgdcTiYgLnUXUgIFabvR.jpg', ' ', 53, 2, 3.4, 1),
(597, 'CA', 'Cold Squad, brigade spéciale', 'Aucune donnée sur le réalisateur', 'La série se concentre sur les enquêtes qui n\'ont jamais été résolues et qui ont été classées depuis des années. Dans chaque épisode, une brigade spéciale se penche sur l\'une de ces enquêtes qui peuvent dater aussi bien de cinq ans que de cinquante ans afi', 60, 'https://image.tmdb.org/t/p/w1280/osBRrzhK7RntjQyagnkK5fyb1xP.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', ' ', 98, 7, 3.39, 1),
