(600, 'US', 'Renegade', 'Stephen J. Cannell', 'Framed for murder, Detective Reno Raines becomes a fugitive bounty hunter who fights crime while trying to clear his name. His troubles began after he testified about police corruption, leading Lt. Donald Dixon to set him up.', 44, 'https://image.tmdb.org/t/p/w1280/xdpsXW6uAJDWOA0xsWX6tJACQmF.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8LaQ8T9iMQeU207awX2RPWLSTEf.jpg', ' ', 110, 5, 3.32, 1),
