(603, 'US', 'Veronica\'s Closet', 'Marta Kauffman', 'Aucune donnée sur la description', 24, 'https://image.tmdb.org/t/p/w1280/8mFqH6PkKc3Sv9buS7cx5e7nuV2.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//khveUylm0fqlLGuUHLg74tKozdy.jpg', ' ', 62, 3, 2.55, 1),
(604, 'US', 'Teen Titans', 'Sam Register', 'Robin, Cyborg, Starfire, Raven et Changelin, alias les Teen Titans, sont des adolescents à priori sans histoires, sauf qu’ils ont pour hobby de sauver le monde !', 23, 'https://image.tmdb.org/t/p/w1280/Amf77y1dohmt3M0lgz1CHogPgyc.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qA3pGPhOOaXtDl50vFY0yBLhB1i.jpg', ' ', 65, 5, 4.16, 1),
(605, 'US', 'Sabrina, l\'apprentie sorcière', 'Nell Scovell', 'À 16 ans, Sabrina se découvre des pouvoirs de sorcière. Guidée par ses tantes, son apprentisage de la magie commence. Mais sa vie va s\'en trouver bouleversée...', 22, 'https://image.tmdb.org/t/p/w1280/lJSnXeLh4ud49YuoVoSJR4mWeCG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//4PhaaA593zHfAyYUIXVWTih3qcD.jpg', ' ', 163, 7, 3.93, 1),
(606, 'US', 'Ed, Edd n Eddy', 'Danny Antonucci', 'Trois adolescents, Ed, Edd \"Double D\" et Eddy, connus collectivement sous le nom de \"les Eds\", inventent constamment des stratagèmes pour gagner de l\'argent auprès de leurs pairs pour acheter leur confiserie préférée, des casse-gueule. Leurs plans échouen', 11, 'https://image.tmdb.org/t/p/w1280/8BguP5zLyf3AzlTgRRhpXdz9bnS.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//f307veKEFZqvFRkMkffDEXf280w.jpg', ' ', 126, 6, 3.94, 1),
(607, 'US', 'The Powerpuff Girls', 'Craig McCracken', 'The Powerpuff Girls is a animated television series about Blossom, Bubbles, and Buttercup, three kindergarten-aged girls with superpowers, as well as their \"father\", the brainy scientist Professor Utonium, who all live in the fictional city of Townsville,', 12, 'https://image.tmdb.org/t/p/w1280/468mmhMd21pY4Yx0S0woqeEcxtL.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7tPJfShsyTda32HLIFKbYvD0N87.jpg', ' ', 136, 6, 3.75, 1),
