(609, 'US', 'Les Arpents Verts', 'Paul Henning', 'Las de la vie citadine, un avocat new-yorkais et son épouse s\'installent dans une ferme dans la petite communauté de Hooterville. Un changement radical de vie qui s\'avère bien difficile...', 30, 'https://image.tmdb.org/t/p/w1280/5SvzEon5wYTVqEFIHFkyCKerEmw.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//8FYS7G2G0bCvB5wvaaShDgW0W7E.jpg', ' ', 170, 6, 3.71, 1),
