(615, 'US', 'Futurama', 'Matt Groening', 'Accidentellement cryogénisé le 31 décembre 1999 alors qu\'il livrait une pizza, Fry se réveille 1000 ans plus tard à New York. À l\'aube de l\'an 3000, le monde a bien changé, peuplé de robots et d\'extraterrestres. Le jeune homme retrouve l\'un de ses descend', 22, 'https://image.tmdb.org/t/p/w1280/k5e8kAq9jpaSmgvFM10su5LXGFR.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//tEjnoEdE2PtFp9UcqQse5hDgW8U.jpg', ' ', 124, 7, 4.2, 1),
