(619, 'US', 'Half et Half', 'Jeffrey Klarik', 'Mona et Dee-Dee n\'ont apparemment qu\'une chose en commun : leur père ! Après avoir grandi loin l\'une de l\'autre, elles vont vivre dans le même immeuble à San Francisco et découvrir un lien fraternel nouveau, unique et fort.', 30, 'https://image.tmdb.org/t/p/w1280/8TVku3ieyStr4mJihUZal2gay9I.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//2PtQyFLTdpzr7MkxKCTBN5dmPpA.jpg', ' ', 91, 4, 4.08, 1),
