(622, 'GB', 'Let Me Entertain You', 'Aucune donnée sur le réalisateur', 'Let Me Entertain You was a daytime variety show that aired on BBC Two from 21 August 2006 and ended on 22 June 2007. The show is presented by British funnyman, Brian Conley, with co-presenter Christine Bleakley.', 30, 'https://image.tmdb.org/t/p/w1280', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', ' ', 40, 2, 0, 1),
(623, 'US', 'Profit', 'David Greenwalt', 'Jim Profit est un employé nouvellement promu de Gracen & Gracen (G&G), une entreprise multinationale dont certains de ses principaux dirigeants n\'ont que peu d\'éthique dans leurs activités professionnelles. Cela ne désole pas Profit, qui emploie des métho', 42, 'https://image.tmdb.org/t/p/w1280/ck9YLbs0LtNwv1eFLpAVHfS759q.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//6amxlZTSAKTtruPZCO3m5BobExy.jpg', ' ', 8, 1, 4.2, 1),
(625, 'US', 'The Black Donnellys', 'Paul Haggis', 'Rencontrez les frères Donnelly : Tommy, Jimmy, Kevin et Sean. Il n\'y a rien que ces quatre frères irlandais ne feraient pas pour se protéger, et pour eux cela signifie mentir, tricher, voler et, parfois, appeler les flics. Racontée par le gangster en herb', 60, 'https://image.tmdb.org/t/p/w1280/oo8NjQRqIfDauaxtnvfn8RwZ4Sb.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//7MNHo538VQQUqRWthYP1XWZovnL.jpg', ' ', 13, 1, 3.69, 1),
