(630, 'US', 'Standoff : les négociateurs', 'Craig Silverstein', 'Emily et Matt sont les meilleurs négociateurs de l\'Unité de Négociation de Crise du FBI. Mais, en secret, ils sont aussi amoureux...', 60, 'https://image.tmdb.org/t/p/w1280/q4741FlAgOXbs1PdD5eCDxO4ykQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//f8aE5naRTPsyjgfZKLRfhdlhWkA.jpg', 'https://www.youtube.com/embed/Gx443vGYZRU', 18, 1, 2.75, 1),
