(634, 'US', 'Madame est servie', 'Blake Hunter', 'Un ex-champion de base-ball veuf, l\'italo-américain Tony Micelli, souhaite quitter Brooklyn pour offrir à sa fille Samantha un cadre de vie plus agréable. Il devient alors homme à tout faire dans une famille aisée du Connecticut, constituée d\'Angela Bower', 23, 'https://image.tmdb.org/t/p/w1280/pq0MpKocm2z1bkBzWmpKScSgksx.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//qi925RRpANnzvZ00pybnHgXUA0a.jpg', ' ', 196, 8, 3.81, 1),
