(636, 'US', 'Kung Fu - la Légende Continue', 'Ed Spielman', 'Kwai Chang Caine retrouve la trace de son fils Peter Caine, qui est devenu flic. Ensemble, ils vont faire équipe pour résoudre des enquêtes...', 44, 'https://image.tmdb.org/t/p/w1280/ncY99oMyS8kZvFcloSV4WNxqYjE.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', 'https://www.youtube.com/embed/kRGnvRLiQuA', 88, 4, 3.24, 1),
