(643, 'GB', 'ma tribu', 'Fred Barron', 'Le quotidien d\'une famille anglaise, excentrique et drôle. Le père, Ben Harper, est un dentiste misanthrope, et son épouse, Susan, travaille comme guide touristique. Étourdie et optimiste, elle aimerait bien contrôler la vie de ses enfants. L\'aîné, Nick, ', 30, 'https://image.tmdb.org/t/p/w1280/3Yba2Uy2eERcduYXnZz37kMuVUG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//9OQO2OCtDrJR0ZibHnZ3vtah9ui.jpg', ' ', 110, 11, 3.45, 1);
