(652, 'US', 'Quoi d\'neuf Scooby-Doo ?', 'Sander Schwartz', 'Scooby-Doo et ses quatre inséparables amis, Sammy, Vera, Fred et Daphné, sont à nouveau réunis pour de trépidantes aventures. A bord de leur éternel van, la Mystery Machine, ils sillonnent les lieux les plus reculés aux plus exotiques, afin de résoudre de', 22, 'https://image.tmdb.org/t/p/w1280/mD0T5o4908uRPbLsHiFR14WlrN1.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//azYkdfJEkhn94jozR87t46LeCst.jpg', ' ', 42, 3, 3.95, 1),
