(654, 'US', 'Reba', 'Allison M. Gibson', 'After her dentist husband of 20 years leaves her for his dental hygienist, Reba Hart\'s seemingly perfect world is turned upside down.​', 30, 'https://image.tmdb.org/t/p/w1280/rq9KjMTMXSbYtvpRuNh5G3YQODG.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//ebslbqRYv1SK9JlkWqASf9JUYQw.jpg', ' ', 125, 6, 3.39, 1),
(655, 'US', 'Star Trek : La nouvelle génération', 'Gene Roddenberry', 'Cette série raconte les aventures, au XXIVe siècle, du vaisseau USS Enterprise (NCC-1701-D), commandé par un capitaine d\'origine française, Jean-Luc Picard, et de son équipage.', 45, 'https://image.tmdb.org/t/p/w1280/6SCYWrBsB2MSSvESNPyXcxNCbkg.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//nMASWgNCBlb3FW6bLYEOsm0UZL0.jpg', ' ', 177, 7, 4.16, 1),
(656, 'US', 'George le petit curieux', 'Margret Rey', 'Georges, le petit singe curieux avec penchant pour l’aventure, s’engage dans un nouvel épisode, où sa nature enjouée et audacieuse lui gagnera l’affection de nouveaux amis et le propulsera dans une série de (més)aventures.', 23, 'https://image.tmdb.org/t/p/w1280/AWQF9ZP7X5GqGUoXnyj1NSQjKo.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//vSscKZocnih10gBlT4KLnWA8iyO.jpg', ' ', 389, 15, 3.49, 1),
