(661, 'US', 'Les Aventures du jeune Indiana Jones', 'George Lucas', 'Cette série relate l\'enfance et l\'adolescence de Henry Walton Jones Jr, dit \"Indiana Jones\" ou \"Indy\". Bien avant d\'être professeur d\'archéologie, le jeune homme parcourt le monde et rencontre de nombreux lieux et figures historiques, des pyramides égypti', 45, 'https://image.tmdb.org/t/p/w1280/efA2ubsbI9MhdMgHqMyeGVDAGIl.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces//pVja1YCG4C75Q5dpdkNbXq2wrWb.jpg', ' ', 43, 3, 3.3, 1),
