(678, 'US', 'Justice', 'David McNally', 'Justice is an American legal drama produced by Jerry Bruckheimer that aired on Fox in the USA and CTV in Canada. The series also aired on Warner Channel in Latin America, Nine Network in Australia, and on TV2 In New Zealand.\n\nIt first was broadcast on Wed', 60, 'https://image.tmdb.org/t/p/w1280/8ZvaLekKg4dW7xoTyBG7GWF6rLQ.jpg', 'https://image.tmdb.org/t/p/w1920_and_h800_multi_faces/', ' ', 13, 1, 3.6, 1),
